import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-38823325"]]),M=JSON.parse(`[{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D9%84%D8%AA%D8%A7%D8%B2%D8%A7%D8%B1_%D9%85%D8%A7%D8%AB%D9%8A%D8%A7%D8%B3_%D9%83%D9%8A%D9%84%D9%87%D8%A7%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Baltazar_Mathias_Keilhau.jpg","page_title":"بالتازار ماثياس كيلهاو","context_page_description":"بالتازار ماثياس كيلهاو ‏ هو بروفيسور وجيولوجي نرويجي، ولد في 2 نوفمبر 1797 في Biri في النرويج، وتوفي في 1858 في كريستيانية في النرويج."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%DB%8C%D8%AF%D8%A7%D8%B1%D9%88%D8%A8%DB%8C%D8%B3%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Idarubicin_ball-and-stick.png","page_title":"آیداروبیسین","context_page_description":"آیداروبیسین یا ۴-دمتوکسی‌دانوروبیسین با نام‌های تجاری ایدانترا، زاودوس و آیدامایسین یک داروی ضد لوسمی و با ساختار آنتراسیکلینی است. این دارو آنالوگ داروی دانوروبیسین است که به علت نداشتن گروه متوکسی، حلالیت در چربی و جذب سلولی بالاتری دارد.\\nرده درمانی:داروهای درمان نئوپلاسم.\\nاشکال دارویی: آمپول"},{"page_url":"https://ca.wikipedia.org/wiki/Arties_e_Gar%C3%B2s","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Arties.JPG","page_title":"Arties e Garòs","context_page_description":"Arties e Garòs és una entitat municipal descentralitzada dependent de l'ajuntament de Naut Aran, a la part sud-occidental del terme. Els dos pobles que la formen, Arties i Garòs, estan situats al llarg de la Garona i de la carretera nacional C-28 que uneix Vielha amb Esterri d'Àneu pel port de la Bonaigua, entre Casarilh a l'oest i Gessa a l'est. El seu terme coincideix en bona part amb la conca del riu de Valarties.\\nArties i Garòs, juntament amb altres pobles del municipi actual de Naut Aran, ja havien format part del terçó de Garòs, antiga batllia de la Vall d'Aran. Quan els terçons es van dividir en sesterçons es va crear l'actual d'Arties e Garòs. Va tenir ajuntament propi fins al 21 de desembre del 1967, en què es va fusionar amb Salardú, Gessa, Tredòs i Bagergue per constituir el municipi de Naut Aran. El seu terme coincideix en bona part amb la conca del riu de Valarties i es correspon amb el de l'antic municipi d'Arties, d'uns 78,58 km². L'entitat municipal descentralitzada es va crear el 9 de juliol del 1970."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D0%9A_%D0%98%D0%BD%D1%82%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Flag_of_Milan.svg","page_title":"ФК Интер","context_page_description":"ФК Интер е италиански футболен клуб, основан на 9 март 1908 г. в Милано, областта Ломбардия, състезаващ се в най-елитната италианска дивизия „Серия А“.\\n„Черно-сини“, каквито са и райетата на фланелките, е прозвището на отбора, а за символ е избрана змията, която е част от емблемата на гр. Милано.\\nИнтер играе своите домакински мачове на стадион „Джузепе Меаца“, известен също като „Сан-Сиро“. Тренировките на клуба се провеждат в спортния център „Анджело Морати“, част от комплекса „Апиано Джентиле“ на провинция Комо.\\nИнтер е единственият италиански отбор, който никога не е изпадал в по-долна дивизия и печелил требъл за един сезон, за изиграните до момента сезони във витрината на клуба присъстват общо: 18 скудети, 7 купи на Италия, 5 суперкупи на страната, 3 купи на УЕФА, 3 купи на европейските шампиони и 3 междуконтинентални купи. С тези 39 трофея, Интер е третият най-успешен италиански клуб, след Ювентус и Милан."},{"page_url":"https://ro.wikipedia.org/wiki/Antichitatea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Zalabiya%2CEuphrat.jpg","page_title":"Antichitatea","context_page_description":"Antichitatea este cea de-a doua epocă a istoriei. Reprezintă epoca în care s-au dezvoltat cultura, arta, religia și marile civilizații."},{"page_url":"https://de.wikipedia.org/wiki/Botanischer_Garten_Akureyri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Arctic_flora_at_Akureyri_Botanical_Gardens.jpg","page_title":"Botanischer Garten Akureyri","context_page_description":"Der Botanische Garten Akureyri war der erste Botanische Garten Islands."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BD%E8%83%8C%E5%85%80%E9%B9%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Gyps_bengalensis_PLoS.png","page_title":"白背兀鹫","context_page_description":"白背兀鹫也称拟兀鹫，为鹰科兀鹫属的鸟类。在中国大陆，分布于云南等地，多生活于开阔地区以及筑巢于高的树上。该物种的模式产地在孟加拉国。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BA%D0%B5-%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D1%81%D1%8C%D0%BE%D1%81_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Estaci%C3%B3n_Parque_de_los_Patricios_%284%29.JPG","page_title":"Парке-Патрисьос (станция метро)","context_page_description":"«Парке-Патрисьос» — станция Линии H метрополитена Буэнос-Айреса. Станция расположена между станциями «Касерос» и «Оспиталес». Станция расположена на пересечении улиц Патагонес и Монтеагудо, в районе Парке-Патрисьос.\\nОна имеет две боковые платформы и два трека. Также на станции расположен верхний вестибюль, который соединяет платформы с доступом на улицу по лестнице, эскалаторы и лифты; а также туалеты для инвалидов и общественный Wi-Fi."},{"page_url":"https://tr.wikipedia.org/wiki/S%C3%BCr%C3%BCklenim","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Drag_curves_for_aircraft_in_flight.svg","page_title":"Sürüklenim","context_page_description":"Akışkanlar dinamiğinde, sürüklenim bir sıvı içerisinde hareket eden bir cismin hareket yönüne zıt yönde etki eden kuvvet topluluğuna denir. Bu kuvvet iki sıvı yüzeyi arasında veya bir katı ve bir sıvı yüzeyi arasında olabilir. Diğer durdurucu kuvvetler nazaran sürüklenim kuvveti hıza bağlıdır. Bir sıvının akış yönü hizasında bulunan katı bir cisme göre, sürüklenim kuvvetleri sıvının hızını her zaman azaltır."},{"page_url":"https://eo.wikipedia.org/wiki/NGC_4239","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/NGC4239_-_SDSS_DR14.jpg","page_title":"NGC 4239","context_page_description":"NGC 4239 estas galaksio en konstelacio Berenica Hararo.\\nĈi tiu objekto estis jam en la originala versio de NGC-katalogo."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%BC_%EC%A0%B1%ED%82%A8%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Karl_Jenkins.jpg","page_title":"칼 젱킨스","context_page_description":"칼 젱킨스 경은 영국 웨일스의 작곡가이다. 프로젝트 《아디에무스》로 유명하며, 캔터베리 신을 이끈 밴드 소프트 머신의 주요 구성원으로 활동하기도 했다.\\n미사곡 《The Armed Man》과 레퀴엠 작품도 인기를 끌었다.\\n현재 영국 더블 리드 협회 공동 회장으로 있다."},{"page_url":"https://en.wikipedia.org/wiki/Jardins_de_Callunes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Jardins_de_Callunes.jpg","page_title":"Jardins de Callunes","context_page_description":"The Jardins de Callunes are botanical gardens specializing in heather. They are located at 5, Chemin de la Prelle, Ban-de-Sapt, Vosges, Grand Est, France, and open daily in the warmer months; an admission fee is charged.\\nThe gardens opened to the public in 1996 after 7 years of design and planting under the direction of landscaper Jacques Couturieux. They form part of the rehabilitation of a former quarry, and traces of the pink sandstone and trench warfare from World War I still remain.\\nToday the gardens comprise ten distinct areas linked by sweeping lawns and walkways. The pine forest, created in 1994, contains good collections of rhododendron and azalea beneath pines and Japanese maples. The heather gardens contain about 250 varieties of Erica, Calluna, and Daboecia, with rock gardens containing a further 180 taxa of alpine plants. The garden also contains tree peonies, phlox, saxifrage, water plants, and various perennials and shrubs."},{"page_url":"https://en.wikipedia.org/wiki/Big_Blue_Bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Big_Blue_Bus_on_R7_layover.jpg","page_title":"Big Blue Bus","context_page_description":"The Santa Monica Big Blue Bus is a municipal bus operator in the Westside region of Los Angeles County, that provides local and bus rapid transit service in Santa Monica and adjacent neighborhoods of Los Angeles. Express service is also provided to Downtown Los Angeles and Union Station."},{"page_url":"https://tl.wikipedia.org/wiki/Capsicum_annuum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Capsicum_annuum.JPG","page_title":"Capsicum annuum","context_page_description":"Ang Capsicum annuum ay isang domestikadong espesye ng halamang saring Capsicum na likas sa katimugang bahagi ng Hilagang Amerika at sa hilagang bahagi ng Timog Amerika. Ang espesyeng ito ay ang pinaka-karaniwan at malawakang nililinang sa limang domestikadong uri ng capsicum. Iba-iba ang hugis at laki ng espesyeng ito, na may katamtaman hanggang sobrang anghang, mula sa kultibar na siling kampana hanggang sa siling maanghang. Ang ilang makahoy na uri ng espesyeng ito ay dating tinatawag na C. frutescens, subalit ang mga katangian na kaiba sa uring iyon ay makikita sa maraming uri ng C. annuum, samakatuwid ay magkaiba at natatangi ang dalawang espesyeng iyon ng Capsicum."},{"page_url":"https://ro.wikipedia.org/wiki/Cannibal_Corpse","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Pat_O%27Brien_of_Cannibal_Corpse.jpg","page_title":"Cannibal Corpse","context_page_description":"Cannibal Corpse este o formație americană de death metal fondată în 1988. Deși Cannibal Corpse nu a avut practic nici o expunere la radio sau televiziune, trupa a început să fie foarte ascultată odată cu lansarea albumelor Butchered at Birth din 1991 și Tomb of the Mutilated din 1992. Cannibal Corpse a vândut peste 1 milion de albume în toată lumea, dintre acestea, 558,929 numai în S.U.A, fiind una dintre cele mai vândute trupe de death metal.\\nStilul trupei are influențe provenite de la unele trupe thrash metal, cum ar fi Slayer, Kreator și alte trupe death metal, cum ar fi Death sau Obituary. Cannibal Corpse a primit o etichetă de infamie pentru albumele sale de tip horor, pentru folosirea de violență grafică, mutilare, crimă, necrofilie, canibalism, zombii, tortură, viol și moarte. Rezultatul acestui stil de versuri a avut ca rezultat interzicerea trupei în Coreea și cenzurarea primelor trei albume de către guvernul german."},{"page_url":"https://pl.wikipedia.org/wiki/Kr%C3%B3likarnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Warsaw_-_Krolikarnia_palace_%28front%29.jpg","page_title":"Królikarnia","context_page_description":"Królikarnia – klasycystyczny pałac znajdujący się przy ul. Puławskiej 113a w Warszawie, na skarpie wiślanej. Siedziba Muzeum Rzeźby im. Xawerego Dunikowskiego"},{"page_url":"https://tr.wikipedia.org/wiki/Yumurta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Coturnix_coturnix_eggs.jpg","page_title":"Yumurta","context_page_description":"Yumurta, dişi hayvanların ve özellikle kuşların embriyoyu korumak amacıyla yumurtladığı yuvarlak ve oval şekilli cisimlerdir. Birçok hayvanın yumurtaları yiyecek olarak kullanabilmesine karşın, yumurta denince akla ilk gelen şey tavuk yumurtasıdır. Tavuk yumurtası sayısız yemeğin hazırlanmasında malzeme olarak kullanılır. Dünyanın hemen hemen her mutfağında yaygın olarak kullanılır.\\nYaygın bir inanış olan bıldırcın yumurtasının bir tavuk yumurtası kadar protein içerdiği doğru değildir.\\nSon yıllarda hazır gıda üretimindeki artış, yumurtanın kullanıma hazır, pastörize ve yumurta tozu halinde üretimini yaygınlaştırmıştır. Bu artışı baskılamak, baltalamak isteyenler tarafından \\"günde iki defa yumurtlatıyorlar\\", yemlerinde \\"antibiyotik\\" katıyorlar gibi konunun uzmanı olmayan kişiler tarafından propogandalar yapılmaktadır. Fakat bu işin içinde olan herkesin ve veteriner hekimlerinin doğrulayacağı gibi tavuğun günde iki defa yumurtlama gibi bir olasılığı yoktur. Konvensiyonel veya özel hibrit tavukların hepsi için geçerlidir. Türkiye'de de çoğu Avrupa ülkesinde olduğu gibi yemlere antibiyotik karıştırılması yasaktır."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%98%E0%B8%87%E0%B8%8A%E0%B8%B2%E0%B8%95%E0%B8%B4%E0%B9%80%E0%B8%AD%E0%B8%A3%E0%B8%B4%E0%B9%80%E0%B8%97%E0%B8%A3%E0%B8%B5%E0%B8%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Flag_of_Eritrea.svg","page_title":"ธงชาติเอริเทรีย","context_page_description":"ธงชาติเอริเทรีย ในปัจจุบัน มีลักษณะเป็นธงสี่เหลี่ยมผืนผ้า กว้าง 1 ส่วน ยาว 2 ส่วน ที่ด้านค้นธงมีรูปสามเหลี่ยมสีแดง ฐานกว้างเท่ากับความกว้างธง และความยาวของรูปนั้นยาวเท่ากับความยาวธงพอดี ภายในรูปนั้นมีพวงมาลัยล้อมต้นมะกอกสีเหลืองซึ่งมีใบ 14 ใบ พื้นที่ส่วนที่เหลือซึ่งถูกแบ่งเป็น 2 ส่วนด้วยรูปสามเหลี่ยมแดง ประกอบด้วยส่วนบนเป็นพื้นสีเขียว และส่วนล่างเป็นพื้นสีฟ้า เริ่มใช้เป็นธงชาติอย่างเป็นทางการเมื่อวันที่ 5 ธันวาคม พ.ศ. 2538\\nแบบของธงนี้มาจากธงของกลุ่มแนวร่วมปลดปล่อยประชาชนเอริเทรีย ซึ่งมีลักษณะที่เหมือนกันกับธงชาติเอริเทรียเกือบทุกประการ ผิดกันแต่ว่าในรูปสามเหลี่ยมสีแดงนั้นเป็นรูปดาวห้าแฉกสีเหลือง อนึ่ง สัญลักษณ์พวงมาลัยมีต้นมะกอกนี้เริ่มปรากฏในธงชาติเอริเทรียตั้งแต่ปี พ.ศ. 2495 โดยลักษณะธงในขณะนั้นแตกต่างจากที่ใช้ในปัจจุบันมาก"},{"page_url":"https://en.wikipedia.org/wiki/Robert_A._Parker","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/S035_Parker.jpg","page_title":"Robert A. Parker","context_page_description":"Robert Allan Ridley Parker is an American physicist and astronomer, former Director of the NASA Management Office at the Jet Propulsion Laboratory, and a retired NASA astronaut. He was a Mission Specialist on two Space Shuttle missions, STS-9 and STS-35.\\nHe has logged over 3,500 hours flying time in jet aircraft and 463 hours in space."},{"page_url":"https://de.wikipedia.org/wiki/Bildungs-_und_Kulturzentrum_Frankfurt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Bikuz_Nordfassade.jpg","page_title":"Bildungs- und Kulturzentrum Frankfurt","context_page_description":"Das Bildungs- und Kulturzentrum Frankfurt ist ein Gebäudekomplex im Frankfurter Stadtteil Höchst. Es ist seit 1975 Sitz zahlreicher Bildungs- und Kultureinrichtungen im Frankfurter Westen."},{"page_url":"https://tr.wikipedia.org/wiki/Ejder_Stadyumu","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Dragao07.jpg","page_title":"Ejder Stadyumu","context_page_description":"Ejder Stadyumu, Portekiz Porto'da bulunan futbol stadyumudur. FC Porto tarafından kullanılan stad 50.476 kişiliktir.\\nStad 2004 Avrupa Futbol Şampiyonası için 2003 yılında tamamlanmış, aynı zamanda FC Porto kulübünün eski stadının yerine geçmiştir. Mimar Manuel Salgado tarafından projelendirilmiş ve Grupo Amorim şirketi tarafından € 97.755.318 maliyetle yapılmıştır. Bu miktarı karşılamak için stadın bölümlerine çeşitli sponsorların isimleri verilmiştir.\\nStadın adı, FC Porto kulübünün simgesi olan ejderhadan gelmektedir. Açılış maçında FC Porto ve FC Barcelona karşılaşmıştır. Spor faaliyetleri dışında da konser ve diğer sosyal etkinlikler de yapılabilmektedir. 2020 UEFA Süper Kupası finali Ejder Stadyumu'nda oynanacaktır."},{"page_url":"https://it.wikipedia.org/wiki/Rigutino","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Panorama_Rigutino.JPG","page_title":"Rigutino","context_page_description":"Rigutino è una frazione del comune di Arezzo, situata nella Valdichiana, alle falde del Monte Lignano.\\nGià abitata nella preistoria, nel periodo etrusco vide la nascita di alcune fattorie. Al periodo romano risalgono diverse ville-fattorie fra cui quella della famiglia Briccia, da cui prese il nome che portò fino al 1000. All'età romana risale una statua di Silvano, il dio dei boschi e dei confini, qui ritrovata verso il 1930.\\nNel medioevo vi fu costruito un castello, chiamato \\"di Briciano\\", ma siccome si trovava in località Ruvetinum in seguito questo toponimo soppiantò quello più antico dando poi origine al nome attuale di Rigutino.\\nInteressante l'antica Pieve di San Quirico, in località La Sassaia, costruita verso l'XI secolo e rimaneggiata nel XV secolo, come attesta un'iscrizione sull'architrave esterno.\\nLa Parrocchiale è stata costruita nei primi decenni del XX secolo.\\nLa Frazione, sede di Circoscrizione del comune di Arezzo, è nota per le sue iniziative ricreative e culinarie che si svolgono nei vari periodi dell'anno come ad esempio la sagra della polenta che si tiene agli inizi di ottobre."},{"page_url":"https://fi.wikipedia.org/wiki/Lakotat","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Lakota_portraits.jpg","page_title":"Lakotat","context_page_description":"Lakotat eli tetonit kuuluivat siouxien läntiseen haaraan. He edustivat ratsain liikkuvaa tasankointiaanien perustyyppiä, joka on tullut tutuksi niin Villin lännen elokuvista kuin sarjakuvistakin. Lakotojen alkuperäiset maat sijaitsivat Minnesotassa ja Iowassa. 1700-luvun aikana he siirtyivät Missourin lännenpuolisille alueille. Hankittuaan ratsuja lakotat laajensivat asuinmaitaan läpi Etelä-Dakotan aina Montanan ja Wyomingin itäosiin saakka. Black Hillsistä tuli heidän uskonnollinen keskuspaikkansa. 1870-luvulla erimielisyydet Yhdysvaltain kanssa johtivat pohjoisilla tasangoilla käytyyn sotaan, jonka huipentumana pidetään Little Bighornin taistelua 1876.\\nLakotat jakaantuivat seitsemään eri heimoon."},{"page_url":"https://en.wikipedia.org/wiki/197th_Pennsylvania_Infantry_Regiment","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/197th_Pennsylvania_Infantry_Recruiting_Advertisement_14_July_1864.jpg","page_title":"197th Pennsylvania Infantry Regiment","context_page_description":"The 197th Regiment Pennsylvania Volunteer Infantry, alternately the 3rd Coal Exchange Regiment was an infantry regiment of the Union Army in the American Civil War. Raised in Philadelphia in mid-1864, the regiment was made up of Hundred Days Men in an effort to augment existing manpower for an all-out push to end the war within 100 days, and spent most of its service guarding Confederate prisoners of war at Rock Island."},{"page_url":"https://fr.wikipedia.org/wiki/Nikola%C3%AF_Alexandrovitch_Sergue%C3%AFev","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87.png","page_title":"Nikolaï Alexandrovitch Sergueïev","context_page_description":"Nikolaï Alexandrovitch Sergueïev est un peintre russe paysagiste, membre d'honneur de l'Académie russe des beaux-arts.\\nIl est né dans l'Empire russe à Kharkiv en 1855. Il apprend la peinture auprès d'un professeur réputé de l'académie russe des beaux arts et peintre de l'école de peinture de Cimmérie, Lev Lagorio. Parmi ses meilleures toiles : Rivière disparue, Juin, Élégie, Le Nuage, Le vent se renforce, La Steppe, Les Étoiles, Le Golfe du Dnieper. Ses tableaux surprennent par leurs effets de lumières.\\nEn 1889 il est décore de l'ordre de Saint-Stanislas de 3ᵉ degré pour la promotion des activités dans le domaine artistique.\\nEn 1910 Sergueïev devient académicien de la peinture de paysage. Nikolaï Alexandrovitch Sergueïev meurt en 1919."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9C%E0%A4%B2%E0%A4%AF%E0%A5%8B%E0%A4%9C%E0%A4%A8_%E0%A4%85%E0%A4%AD%E0%A4%BF%E0%A4%95%E0%A5%8D%E0%A4%B0%E0%A4%BF%E0%A4%AF%E0%A4%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Cyclohexanol_Formation_V.1.png","page_title":"जलयोजन अभिक्रिया","context_page_description":"रसायन विज्ञान में, जब कोई पदार्थ जल से रासायनिक अभिक्रिया करता है तो उसे जलयोजन अभिक्रिया कहते हैं।"},{"page_url":"https://ca.wikipedia.org/wiki/Ex%C3%A8rcit_franc%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Logo_of_the_French_Army_%28Armee_de_Terre%29.svg","page_title":"Exèrcit francès","context_page_description":"L'Exèrcit francès constitueixen la força militar de la República francesa encarregada de la defensa del país i de la protecció dels interessos nacionals de França. Estan compostes de quatre grandes forces dee les quals trs estan sota l'autoritat exclusiva del Ministeri de la Defensa:\\nuna força terrestre: l'exèrcit de terra francès;\\nuna força aèria: l'exèrcit de l'aire francès;\\nuna força naval: la marina nacional francesa.\\nLa quarta força és la gendarmeria Nacional Francesa. Des de la llei del 3 d'agost de 2009, la gendarmeria nacional està adjunta al Ministeri de l'Interior i del ministeri de defensa. El personal de la gendarmeria conserva el seu estatus militar i certes formacions especialitzades de la gendarmeria són posades sota l'autoritat de l'estat major d'altres forces armades.\\nLes forces armades franceses comprenen també diversos serveis interexèrcit posats sota la direcció del cap de l'estat major dels exèrcits francesos"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%D8%B2_%D8%A7%D9%8A%D9%86%D8%AB%D8%A7%D9%84%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Rene-lotz-1350126350.jpg","page_title":"فرانز اينثالير","context_page_description":"فرانز اينثالير كان لاعب سباق عجل من النمسا."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%90%E3%83%AB%E3%83%BB%E3%82%A4%E3%83%B3%E3%83%97%E3%83%AC%E3%83%83%E3%82%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/1995_WRX_STI_RA_GC8.jpg","page_title":"スバル・インプレッサ","context_page_description":"インプレッサは、SUBARUが生産・販売する乗用車である。"},{"page_url":"https://es.wikipedia.org/wiki/Jaime_Vald%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Colo_Colo_-_Huachipato%2C_2018-03-03_-_Juan_C%C3%B3rdova_y_Jaime_Vald%C3%A9s.jpg","page_title":"Jaime Valdés","context_page_description":"Jaime Andrés Valdés Zapata es un futbolista profesional chileno que se desempeña como volante mixto y actualmente milita en La Serena de la Primera División de Chile."},{"page_url":"https://fr.wikipedia.org/wiki/Skull_Fist","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Skull_Fist_-_Wacken_Open_Air_2017_00.jpg","page_title":"Skull Fist","context_page_description":"Skull Fist est un groupe de heavy et speed metal canadien, originaire de Toronto."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%9F%E6%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Saturn.Aurora.HST.UV-Vis.jpg","page_title":"土星","context_page_description":"土星は、太陽から6番目の、太陽系の中では木星に次いで2番目に大きな惑星である。巨大ガス惑星に属する土星の平均半径は地球の約9倍に当る。平均密度は地球の1/8に過ぎないため、巨大な体積の割りに質量は地球の95倍程度である。そのため、木星型惑星の一種と分類されている。\\n土星の内部には鉄やニッケルおよびシリコンと酸素の化合物である岩石から成る中心核があり、そのまわりを金属水素が厚く覆っていると考えられ、中間層には液体の水素とヘリウムが、その外側はガスが取り巻いている。\\n惑星表面は、最上部にあるアンモニアの結晶に由来する白や黄色の縞が見られる。金属水素層で生じる電流が作り出す土星の固有磁場は地球磁場よりも若干弱く、木星磁場の1/12程度である。外側の大気は変化が少なく色彩の差異も無いが、長く持続する特徴が現れる事もある。風速は木星を上回る1800km/hに達するが、海王星程ではない。\\n土星は恒常的な環を持ち、9つが主要なリング状、3つが不定的な円弧である。これらはほとんどが氷の小片であり、岩石のデブリや宇宙塵も含まれる。知られている限り82個の衛星を持ち、うち53個には固有名詞がついている。これにはリングの中に存在する何百という小衛星は含まれない。タイタンは土星最大で太陽系全体でも2番目に大きな衛星であり、水星よりも大きく、衛星としては太陽系でただひとつ有意な大気を纏っている。\\n日本語で当該太陽系第六惑星を「土星」と呼ぶ由来は、古代中国において五惑星が五行説に当てはめて考えられた際、この星に土徳が配当されたからである。英語名サターンはローマ神話の農耕神サートゥルヌスに由来する。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A2%E1%83%A3%E1%83%A0%E1%83%95%E1%83%A3_(%E1%83%9E%E1%83%90%E1%83%A0%E1%83%90%E1%83%9C%E1%83%90)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Brasaoturvopr.jpg","page_title":"ტურვუ (პარანა)","context_page_description":"ტურვუ (პარანა) — მუნიციპალიტეტი ბრაზილიაში, პარანის შტატში; მდებარეობს ზღვის დონიდან 1 040 მეტრზე. მიეკუთვნება სამხრეთ-ცენტრალური პარანის მეზორეგიონს. შედის ეკონომიკურ-სტატისტიკურ მიკრორეგიონ გუარაპუავის შემადგენლობაში.\\n2010 წლის მონაცემებით, მოსახლეობა 13 811 ადამიანს შეადგენდა, მოსახლეობის სიმჭიდროვე 14.9 კმ²-ზე. ფართობი 926 767 კმ²-ია."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%A2%D7%93%D7%AA_%D7%94%D7%A9%D7%9E%D7%95%D7%AA_%D7%94%D7%9E%D7%9E%D7%A9%D7%9C%D7%AA%D7%99%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Dvir_naming.jpg","page_title":"ועדת השמות הממשלתית","context_page_description":"ועדת השמות הממשלתית היא ועדה ציבורית הממונה על ידי ממשלת ישראל, ועוסקת בקביעת שמות ליישובים ולנקודות נוספות במפת ישראל ובהחלפת שמות ערביים שהיו קיימים עד 1948 לשמות עבריים. החלטות הוועדה מחייבות את מוסדות המדינה.\\nבמתן שמות מתבססת הוועדה על שמות היסטוריים, על תרגום שמות ערביים ועל מתן צורה עברית לשמות ערביים."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BC%D0%B1%D0%BE%D1%80%D0%BD%D0%B5-%D0%BB%D0%B5-%D0%91%D0%B5%D0%BB%D1%8C%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Chambornay-l%C3%A8s-Bellevaux%2C_la_chapelle_Saint_Justin.jpg","page_title":"Шамборне-ле-Бельво","context_page_description":"Шамборне́-ле-Бельво́ — муніципалітет у Франції, у регіоні Бургундія-Франш-Конте, департамент Верхня Сона. Населення — 167 осіб.\\nМуніципалітет розташований на відстані близько 330 км на південний схід від Парижа, 18 км на північ від Безансона, 26 км на південь від Везуля."},{"page_url":"https://lb.wikipedia.org/wiki/L%C3%ABscht_vun_den_nationale_Monumenter_an_der_Gemeng_Sch%C3%ABffleng","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/67_r_Liberation%2C_Schifflange%2C_Luxembourg_2011-08.jpg","page_title":"Lëscht vun den nationale Monumenter an der Gemeng Schëffleng","context_page_description":"An dëser Lëscht vun den nationale Monumenter an der Gemeng Schëffleng sinn all national Monumenter opgezielt, déi an der lëtzebuergescher Gemeng Schëffleng ze fanne sinn."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D0%B0%D0%BD%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Dimos_Peanias.png","page_title":"Пеанія","context_page_description":"Пеанія — місто в Греції, розташоване на схід від Афін та гори Іметт. До кінця 20 століття місто носило греко-албанську назву Ліопесі."},{"page_url":"https://sv.wikipedia.org/wiki/Grothusenkoog","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Blick_ins_Wattenmeer_vor_Grothusenkoog.jpg","page_title":"Grothusenkoog","context_page_description":"Grothusenkoog är en kommun i Kreis Nordfriesland i förbundslandet Schleswig-Holstein i Tyskland.\\nKommunen ingår i kommunalförbundet Amt Eiderstedt tillsammans med ytterligare 15 kommuner."},{"page_url":"https://ms.wikipedia.org/wiki/Quedlinburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Quedlinburg_asv2018-10_img48_Castle.jpg","page_title":"Quedlinburg","context_page_description":"Quedlinburg merupakan sebuah bandar terletak di daerah Harz, Saxony-Anhalt, Jerman."},{"page_url":"https://ca.wikipedia.org/wiki/9a_Divisi%C3%B3_Panzer_SS_Hohenstaufen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Waffen_SS_POWS_Netherlands_Sep_1944_IWM_BU_1159.jpg","page_title":"9a Divisió Panzer SS Hohenstaufen","context_page_description":"9a Divisió Panzer SS Hohenstaufen fou una unitat de les Waffen SS de l'Alemanya nazi que va combatre en la Segona Guerra Mundial en tot el Teatre d'operacions europeu, des de la seva creació el 1942, fins al final de la guerra a Europa el 8 de maig de 1945."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%83%AB%E3%83%88%E3%83%AA%E3%83%BC%E3%83%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/OutDoor_2018%2C_Friedrichshafen_%281X7A9934%29.jpg","page_title":"オルトリーブ","context_page_description":"オルトリーブとは、ドイツの鞄メーカー。完全防水機能を持った旅行用の自転車専用バッグを製造していることで知られる。創業は1982年。社名は創業者で現・社長でもあるハートムート・オルトリーブの名前から付けられた。自転車用のバッグの他に、同じく完全防水機能を持ったメッセンジャーバッグやバックパック、同社製品に用いられている完全防水機能を持ったジッパーなどの製品がある。"},{"page_url":"https://sh.wikipedia.org/wiki/Epfenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Epfenbach_in_HD.svg","page_title":"Epfenbach","context_page_description":"Epfenbah je opština u njemačkoj saveznoj državi Baden-Virtemberg. Jedno je od 54 opštinska središta okruga Rajn-Nekar. Prema procjeni iz 2010. u opštini je živjelo 2.508 stanovnika. Posjeduje regionalnu šifru 8226017."},{"page_url":"https://vi.wikipedia.org/wiki/Earina_mucronata","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Earina_mucronata.jpg","page_title":"Earina mucronata","context_page_description":"Earina mucronata là một loài thực vật có hoa trong họ Lan. Loài này được Lindl. mô tả khoa học đầu tiên năm 1834."},{"page_url":"https://sv.wikipedia.org/wiki/Talicada_nyseus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Talicada.nyseus..jpg","page_title":"Talicada nyseus","context_page_description":"Talicada nyseus är en fjärilsart som beskrevs av Guérin-meneville 1843. Talicada nyseus ingår i släktet Talicada och familjen juvelvingar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Nicola_(Pisa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Pisa_-_Chiesa_di_San_Nicola_01.JPG","page_title":"Chiesa di San Nicola (Pisa)","context_page_description":"La parrocchia di San Nicola di Pisa si trova in via Santa Maria, 2."},{"page_url":"https://es.wikipedia.org/wiki/Lejona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Bizkaia_municipalities_Leioa.PNG","page_title":"Lejona","context_page_description":"Lejona​​​​ es una localidad y municipio español situado en el territorio histórico de Vizcaya, en la comunidad autónoma del País Vasco. Pertenece al área metropolitana de Bilbao, y alberga la sede del campus principal de la Universidad del País Vasco."},{"page_url":"https://pt.wikipedia.org/wiki/Terno_de_Sainha_Irm%C3%A3os_Paiva","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Componente_mirim_com_a_caixa_-_Terno_dos_Irm%C3%A3os_Paiva.jpg","page_title":"Terno de Sainha Irmãos Paiva","context_page_description":"A Congada Terno de Sainha Irmãos Paiva é um grupo folclórico que retrata a Festa de Congo na cidade de Santo Antônio da Alegria. A tradição de família é repassada entre as gerações, que exercem o importante trabalho de levar o nome do terno adiante."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B8%D1%81%D1%82%D0%B5%D1%86%D1%82%D0%B2%D0%BE_%D0%86%D1%81%D0%BF%D0%B0%D0%BD%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Masacre_de_Gonzalez_de_Ocampo_en_Cumana.jpg","page_title":"Мистецтво Іспанії","context_page_description":"Мистецтво Іспанії — візуальне мистецтво народів, що мешкали на території Іберійського півострову від кам'яної доби до сьогодення."},{"page_url":"https://de.wikipedia.org/wiki/Reinhardswald","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Anti-wind_farm_sign_in_Reinhardswald_forest_%28Sababurg%29%2C_Hessen%2C_Germany.jpg","page_title":"Reinhardswald","context_page_description":"Der Reinhardswald ist ein über 200 km² großes und bis 472,2 m ü. NHN hohes Mittelgebirge des Weserberglands im Landkreis Kassel, Nordhessen. Davon sind 183 km² Teil des gemeindefreien Gebiets Gutsbezirk Reinhardswald.\\nAls Ort von Sagen und Legenden, wie Grimmscher Märchen, und besonders durch das Dornröschenschloss Sababurg ist der Reinhardswald überregional bekannt."},{"page_url":"https://de.wikipedia.org/wiki/Feuerstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Flintstone1.jpg","page_title":"Feuerstein","context_page_description":"Feuerstein, auch Flint oder Silex, ist ein Kieselgestein und besteht nahezu ausschließlich aus Siliziumdioxid. Das Siliziumdioxid liegt hierbei in Form von sehr feinkörnigem Quarz und Mogánit und/oder in Form von Opal vor. Hinzu kommen akzessorische Minerale, zum Beispiel Hämatit, die dem Gestein eine bestimmte Farbe verleihen können. Bevorzugt werden solche Bildungen mit dem Begriff Feuerstein belegt, die diagenetisch in feinkörnigen marinen Kalksteinen entstanden sind. Der Name Feuerstein verweist auf seine historische Bedeutung für das Feuermachen. Die „Feuersteine“, die in modernen Feuerzeugen eingesetzt werden, sind allerdings aus einer Metalllegierung und werden Zündsteine genannt."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Antonio_Montesinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Juan_Ant_Montesinos_i_Manuel_Fraga_-_AP.JPG","page_title":"Juan Antonio Montesinos","context_page_description":"Juan Antonio Montesinos García ​ fue un político español del reinado de Juan Carlos I, uno de los fundadores de Alianza Popular y uno de los líderes que refundó esa formación dando lugar al Partido Popular.​​ Perteneciente al sector liberal-conservador​ fue referencia de la derecha democrática en la Comunidad Valenciana, durante tres Legislaturas fue diputado en el Congreso por la circunscripción de Alicante y vicepresidente de las Cortes Valencianas​ durante el último mandato del president socialista Joan Lerma, constituyendo esa vicepresidencia el cargo de máxima representación del PP en la Comunidad Valenciana durante la III Legislatura de esa autonomía.\\nAdemás fue ingeniero de cálculo y constructor; decano-fundador del Colegio de Peritos de Alicante y miembro del Consejo Superior de Peritos Industriales de España. Profesor colaborador universitario en I.C.E.* de la Universidad Politécnica de Valencia, ​ director del Instituto Politécnico Nacional de Alicante, catedrático de Enseñanza Secundaria y alto funcionario de la Administración General del Estado."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D0%B5%D1%80_%D0%90%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Peter_Acs.jpg","page_title":"Петер Ач","context_page_description":"Петер Ач – угорський шахіст, гросмейстер від 1998 року."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1947","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/WildeFlowers.jpg","page_title":"Lijst van personen geboren in 1947","context_page_description":"Dit is een lijst van personen die geboren zijn in 1947.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Luftkrieg_im_Zweiten_Weltkrieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bundesarchiv_Bild_146-1981-157-29%2C_Bombenopfer.jpg","page_title":"Luftkrieg im Zweiten Weltkrieg","context_page_description":"Der Luftkrieg im Zweiten Weltkrieg umfasst den Zeitraum vom 1. September 1939 bis zum 2. September 1945. Ziele waren\\nLuftüberlegenheit zu erringen und diese zu nutzen,\\nMilitäreinrichtungen und Infrastruktur des Gegners zu zerstören,\\nSeestreitkräfte des Gegners – Schiffe und U-Boote – zu versenken,\\nNachschub transportierende Handelsschiffe zu versenken,\\ndie Bevölkerung zu demotivieren/demoralisieren.\\nIm Verlauf des Zweiten Weltkriegs nahmen Angriffe gegen Industriestandorte und Zivilbevölkerung an Intensität und Anzahl zu. Spätestens mit Beginn der Luftschlacht um England wurde die Luftverteidigung ein Schwerpunkt des Luftkrieges.\\nEine ständige Aufgabe der Luftstreitkräfte der kriegführenden Staaten war die Luftnahunterstützung der Bodentruppen mit gleichzeitiger Gefechtsfeldabriegelung."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%B4%D0%B7%D1%96%D1%81%D0%BB%D0%B0%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Wodzislaw_church_20070512_1601.jpg","page_title":"Водзіслав","context_page_description":"Водзіслав — село в Польщі, у гміні Водзіслав Єнджейовського повіту Свентокшиського воєводства.\\nНаселення — 1153 особи.\\nУ 1975-1998 роках село належало до Келецького воєводства."},{"page_url":"https://en.wikipedia.org/wiki/September_2009_Vietnam_tropical_depression","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/JMA_Tropical_Depression_20_2009-09-03_0335Z.jpg","page_title":"September 2009 Vietnam tropical depression","context_page_description":"The September 2009 Vietnam tropical depression was a weak tropical depression that caused deadly flooding throughout central Vietnam in early September. Forming out of an area of low pressure on September 3, the depression hardly intensified as it meandered off the coast of Vietnam. Initially situated in a favorable environment, convective banding features began to develop and shower and thunderstorm activity formed near the center. On September 4, the Joint Typhoon Warning Center issued a Tropical Cyclone Formation Alert; however, a sudden increase in wind shear caused the system to rapidly become disorganized, leading to the cancellation of the alert the next day. The system continued to slowly track off the coast of Vietnam, nearly dissipating on September 5, before becoming better organized. However, the depression remained weak, with the JTWC reporting on September 7 that the depression had dissipated, though the Japan Meteorological Agency continued to issue advisories until the depression dissipated during September 9.\\nAlthough the depression did not make landfall, the outer rainbands of the storm led to heavy rainfall throughout central Vietnam, peaking at 430 mm."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Ravensburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Ravensburg_Marienplatz32_img01.jpg","page_title":"Liste der Kulturdenkmale in Ravensburg","context_page_description":"In der Liste der Kulturdenkmale in Ravensburg sind Bau- und Kunstdenkmale der Stadt Ravensburg verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg verzeichnet sind. Dieses Verzeichnis ist nicht öffentlich und kann nur bei „berechtigtem Interesse“ eingesehen werden. Die folgende Liste ist daher nicht vollständig und beruht auf anderweitig veröffentlichten Angaben."},{"page_url":"https://fr.wikipedia.org/wiki/Gilbert_Tillmann","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Gilbert_Tillmann_Hello_Max_-_Sieger_-_Deutsches_Spring-Derby_2013.JPG","page_title":"Gilbert Tillmann","context_page_description":"Gilbert Tillmann est un cavalier d'obstacles allemand."},{"page_url":"https://en.wikipedia.org/wiki/Le_Studio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Le_studio_Logo.png","page_title":"Le Studio","context_page_description":"Le Studio was a residential recording studio in the Laurentian Mountains near the town of Morin-Heights, Quebec, Canada built in 1972 by recording engineer and producer André Perry, Nick Blagona and Yaël Brandeis. The studio, where artists recorded and stayed, was the venue for many notable Canadian and international artists, including Vain, Rush, The Police, Bee Gees, Chicago, David Bowie, April Wine and Cat Stevens. Perry described the facility as \\"like the United Nations. I had people from London, New York, Quebec, all over the world.\\"\\nRenowned for its retreat-like location as well as its state-of-the-art equipment, it was one of the earliest studios to install Solid State Logic mixing desk and RADAR digital-recording equipment. Perry sold the studio in 1988. In 2008 the studio had gone out of business, and as of 2015 the property was up for sale. On 11 August 2017, the building was partially destroyed by \\"a suspicious\\" fire."},{"page_url":"https://fr.wikipedia.org/wiki/Brother_(entreprise)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Brother_Main_Office_20140517.JPG","page_title":"Brother (entreprise)","context_page_description":"Brother est une marque créée au Japon en 1908. D’abord spécialiste des machines à coudre industrielles, le groupe Brother s'est développé depuis et a élargi ses activités autour du partage et de la gestion de l’information et du document. L'entreprise construit maintenant des périphériques d’impressions et des étiqueteuses électroniques."},{"page_url":"https://eu.wikipedia.org/wiki/Elikagaien_industria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Fredmeyer_edit_1.jpg","page_title":"Elikagaien industria","context_page_description":"Elikagaien industria edo janarien industria munduko populazio osoa janariz hornitzen duten negozioen multzo anitz, konplexu eta globala da. Iraupen nekazaritzatik eratorritako janariak eta ehiztari-biltzaileek eskuratutakoak soilik daude sistema horretatik kanpo.\\nElikagaien industriak honakoak biltzen ditu:\\nNekazaritza: uztak, abereak eta arrainak haztea\\nManufaktura: agrokimikoak, nekazaritzarako eraikuntza, nekazaritzako makineria eta hornigaiak, haziak, etab.\\nJanariaren prozesamendua: merkatuetarako produktu freskoak prestatzea, eta prestatutako janari produktuak manufakturatzea\\nMarketina: produktuen sustapena, produktu berrien merkaturatzea, iragarkiak, marketin kanpainak, paketatzea, harreman publikoak, etab.\\nHandizkarien lana eta janariaren banaketa: logistika, garraioa, biltegiratzea\\nJanariaren zerbitzua: jatetxeak, catering formak\\nJanari dendak, nekazaritza azokak eta txikizkako beste saltoki batzuk\\nErregulazioak: tokiko, eskualdeko, estatu mailako eta nazioarteko arau eta legeak janariaren ekoizpena eta salmenta erregulatzeko\\nHezkuntza: jarduera akademikoak, kontsultak\\nikerketa eta garapena: elikagaien teknologia\\nFinantza zerbitzuak: kredituak, aseguruak"},{"page_url":"https://it.wikipedia.org/wiki/Antoniotto_Adorno_(1340-1398)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Antoniotto_Adorno_moneta_1396.jpg","page_title":"Antoniotto Adorno (1340-1398)","context_page_description":"Il Serenissimo Principe Antoniotto Adorno fu doge della Repubblica di Genova per ben quattro volte, evento unico. Tra il 1396 e il 1397 ricoprì la carica di governatore genovese per Carlo VI di Francia. Fu inoltre barone del Regno di Sicilia e Gerusalemme, signore di Grimault, signore di Saint-Tropez, signore della Valle Arroscia e signore di Serravalle Scrivia."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%D8%A7%D9%84%D9%B9_%D9%84%DB%8C%DA%A9_%D8%A7%D8%B3%D9%B9%DB%8C%DA%88%DB%8C%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Salt_Lake_Stadium_%28_Yuba_Bharati_Krirangan_%29_Kolkata_India_-_FC_Bayern_Munich_Mohun_Bagan_Oliver_Kahn_4.jpg","page_title":"سالٹ لیک اسٹیڈیم","context_page_description":"سالٹ لیک اسٹیڈیم رسمی طور پر وویكاندا یوبا بھارتی كريرانگن بدھان نگر، کولکاتا، مغربی بنگال میں ایک کثیرالمقاصد اسٹیڈیم ہے جس کی گنجائش 85،000 ہے۔\\nیہ بلحاظ گنجائش بھارت کا سب سے بڑا اسٹیڈیم ہے۔"},{"page_url":"https://es.wikipedia.org/wiki/Sello_(indumentaria)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Anello_d%27argento_sigillare_e_beneaugurale%2C_vi-vii_sec.%2C_con_monogramma_greco_su_croce.jpg","page_title":"Sello (indumentaria)","context_page_description":"En indumentaria el sello es un tipo de anillo en que la parte superior es más ancha que la inferior y además es plana, suele tener forma rectangular u ovalada, y suele llevar inscritas las iniciales de la persona que lo lleva. Casi siempre son de metales preciosos, normalmente oro o plata, y pueden ser pequeños o de gran tamaño. Las iniciales suelen estar grabadas, aunque también pueden estar en relieve. Suelen llevarse normalmente en el dedo medio o en el anular, y son más típicos de hombres.\\nSe utilizaban para marcar con él el lacre de las cartas o ducumentos, como prueba de autenticidad del emisor.\\nWikimedia Commons alberga una categoría multimedia sobre Sello."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27arrondissement_de_Lisieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Vieux-Pont-en-Auge%2C_Fa%C3%A7ade_nord_de_l%27%C3%A9glise.JPG","page_title":"Liste des monuments historiques de l'arrondissement de Lisieux","context_page_description":"Cette liste regroupe une partie des monuments historiques du Calvados."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B1%DA%A9%D8%B3%D8%AA%D8%B1_%D8%B3%D8%B1%D8%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Fotothek_df_pk_0000201_012.jpg","page_title":"ارکستر سرخ","context_page_description":"ارکستر سرخ نامی است که از سوی گشتاپو به یک نهضت مقاومت جاسوسی ضدنازی در خلال جنگ جهانی دوم اطلاق می‌شد. هستهٔ اصلی ارکستر سرخ شامل دو دوست به نام‌های هارلو شولتسه-بویزن و آروید هارناک در برلین بود. همچنین افرادی مستقل از برلین، در پاریس و بروکسل فعال بودند. این سازمان را لئوپولد ترپر از طرف اداره کل امنیت ملی شوروی پایه ریخته‌بود. ارکستر سرخ به صورت شبکه‌ای از افراد و گروه‌ها و بود و در حدود چهارصد عضو داشت. اقدامات آنان را چاپ شبنامه‌ها، کمک به اپوزیسیون و یهودیان برای گریز، و گردآوری مدارک جرم نازی‌ها عنوان شده‌است.\\nشعبه‌ای از ارکستر سرخ در سوئیس به نام سه سُرخ خوانده می‌شد و شبکهٔ جاسوسی اتحاد جماهیر شوروی سوسیالیستی در اروپای غربی از ۱۹۳۰ تا پایان جنگ دوم جهانی بود."},{"page_url":"https://en.wikipedia.org/wiki/J%C3%A1n_Francisci-Rimavsk%C3%BD_Gymnasium","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Secondary_school_levoca.jpg","page_title":"Ján Francisci-Rimavský Gymnasium","context_page_description":"The Ján Francisci-Rimavský Gymnasium in Levoča, Slovakia, is a four-year high school with general classes and an eight-year college with a focus on foreign languages. Students are eligible to attend upon completion of the fifth grade of elementary school. The school is situated in the historic centre of Levoča."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%A0%E1%83%99%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bascanska_draga_07.jpg","page_title":"კრკი","context_page_description":"კრკი — ხორვატიის კუნძული ჩრდილოეთ ადრიატიკის ზღვაში. მდებარეობს რიეკას მახლობლად კვარნერის უბეში და შედის პრიმორიე-გორსკი-კოტარის მხარეში.\\nმრავალი წლის განმავლობაში ითვლებოდა, რომ კრკი 405.78 კმ² ფართობით იყო ადრიატიკის უდიდესი კუნძული, თუმცა ბოლო გამოთვლებით მეზობელ კუნძულ ცრესსაც იგივე ფართობი აქვს. სამაგიეროდ კრკი ადრიატიკის ყველაზე დასახლებულ კუნძულს წარმოადგენს, მასზე 19,286 ადამიანი ცხოვრობს."},{"page_url":"https://pl.wikipedia.org/wiki/Krystyna_Pisarkowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Krak%C3%B3w_tab_K._Pisarkowa_W._Pisarek_W._Dobrucki.jpg","page_title":"Krystyna Pisarkowa","context_page_description":"Krystyna Pisarkowa – polska językoznawczyni, absolwentka Uniwersytetu Jagiellońskiego w 1954, stopień doktora otrzymała w 1963, habilitowała się w 1968. Profesor nadzwyczajny i zwyczajny. Członek Polskiej Akademii Umiejętności."},{"page_url":"https://pl.wikipedia.org/wiki/Marilyn_Manson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Marilyn_Manson_f9214071.jpg","page_title":"Marilyn Manson","context_page_description":"Marilyn Manson, właśc. Brian Hugh Warner – amerykański piosenkarz, lider i wokalista zespołu Marilyn Manson, malarz.\\nUznawany za skandalistę, był tematem wielu kontrowersji, szczególnie pod koniec lat 90. XX wieku. Znany z prowokujących tekstów, kontrowersyjnego wizerunku i zachowania.\\nW 2006 został sklasyfikowany na 44. miejscu listy „100 najlepszych wokalistów metalowych wszech czasów” według Hit Parader, w 2009 został sklasyfikowany na 19. miejscu listy „50 najlepszych heavymetalowych frontmanów wszech czasów” według Roadrunner Records, a w 2011 został sklasyfikowany na 30. miejscu listy „50 największych współcześnie gwiazd rocka” według Kerrang."},{"page_url":"https://ast.wikipedia.org/wiki/Eric_Heiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Eric_Heiden2.jpg","page_title":"Eric Heiden","context_page_description":"Eric Heiden ye un patinador d'Estaos Xuníos retiráu que llogró cinco medayes d'oru olímpicu nos Xuegos Olímpicos de Lake Placid en 1980, amás de batir cuatro récor olímpicos y unu mundial mientres dichos Xuegos.\\nNació en Madison, Wisconsin, y ye un iconu del patinaxe de velocidá mundial, sobremanera n'Europa. Ye consideráu como'l patinador más completu de la hestoria, yá que llogró victories en carreres tantu de curtia como de llarga distancia."},{"page_url":"https://fi.wikipedia.org/wiki/Vesa_Toskala","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Vesa_Toskala_trying_to_make_a_save_on_a_high_shot.jpg","page_title":"Vesa Toskala","context_page_description":"Vesa Tapani Toskala on suomalainen uransa lopettanut jääkiekkomaalivahti. Viimeisellä kaudellaan Toskala edusti Tampereen Ilvestä. Hän torjui perhostyylillä. Toskala oli aikakautensa maalivahdiksi melko pienikokoinen, mutta pienen kokonsa hän korvasi reflekseillään ja nopealla hanskakädellään. Toskala pelasi urallaan yhteensä 266 NHL-ottelua."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%95%D7%A8%D7%A7_%D7%94%D7%A4%D7%A0%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Slide11aaa.JPG","page_title":"עורק הפנים","context_page_description":"עורק הפנים הוא סעיף של העורק התרדמני החיצוני שמתפצל מעורק התרדמה, המספק דם למבנים בפנים כמו שרירים ובלוטות."},{"page_url":"https://tr.wikipedia.org/wiki/Cumhurba%C5%9Fkanl%C4%B1%C4%9F%C4%B1_K%C3%BClliyesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Be%C5%9Ftepe_Millet_Camii1_%281%29.jpg","page_title":"Cumhurbaşkanlığı Külliyesi","context_page_description":"Cumhurbaşkanlığı Külliyesi, Türkiye'nin başkenti Ankara'daki Atatürk Orman Çiftliği'nin içerisinde bulunan ve Türkiye cumhurbaşkanı tarafından 2014'ten itibaren kullanılan yerleşke. İçinde Cumhurbaşkanlığı Sarayı, Millet Camii ve 15 Temmuz Şehitler Abidesi'nin yer aldığı külliyedeki yapılardan ilk olarak sarayın inşası tamamlanmış, resmî olarak 29 Ekim 2014'te Türkiye'nin 91. kuruluş yıl dönümünü anmak için düzenlenen Cumhuriyet Bayramı resepsiyonda açılışının yapılacağı açıklanmışsa da bazı davetli katılımcıların etkinliği boykot edeceğini açıklaması ve Ermenek maden kazasının gerçekleşmesi yüzünden açılış resepsiyonu iptal edilmiştir.\\nYerleşkeyi tanımlamak için Ak Saray ilk belirlenen isim olmuştur. Daha sonra yerleşkeye, Temmuz 2015 tarihinde resmi olarak Cumhurbaşkanlığı Külliyesi ismi verilmiş olup, kamuoyunda Cumhurbaşkanlığı Sarayı, Beştepe veya yalnızca Saray ve Külliye tabirleri de kullanılmaktadır."},{"page_url":"https://sk.wikipedia.org/wiki/Hutta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ulrich_von_Hutten_Buch_von_D.Strauss.jpg","page_title":"Hutta","context_page_description":"Hutta je priezvisko najčastejšie sa vyskytujúce v Nemecku, Česku, Poľsku a na Slovensku. Pochádza zo starohornonemeckého slova „hutta“, ktoré v prenesenom zmysle znamená aj chata, skrývať sa, chrániť. Od koreňa vyššie uvedených slov je možné odvodiť aj nasledujúce významy ako zakrytie, skrývanie alebo ochrana, ako je tomu aj v koreni staronemeckého slova „huotan“. V angličtine je príbuzné slovo „hide“ - schovať.\\nPodľa niektorých prameňov vznikol termín Hutta nielen odvodením z prastarého slova „hutta“ alebo „hutten“, ktoré znamenalo kryť sa a chrániť, ale aj zo slova „Hutte“, ktoré znamená stráž, strážny post. Z koreňov slova „huete“, „huot“ si odvodil šľachtic a humanista Ulrich von Hutten svoje rodinné meno a zdôrazňoval jeho význam v zmysle ochrancu hraníc."},{"page_url":"https://en.wikipedia.org/wiki/Frank_J._Hogan","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/HOGAN%2C_FRANK_J._LOC_hec.07476_%28cropped%29.jpg","page_title":"Frank J. Hogan","context_page_description":"Francis Joseph Hogan was an American lawyer who co-founded the firm of Hogan & Hartson in 1904 and served as president of American Bar Association from 1938 to 1939. He represented several high-profile clients, including president Warren G. Harding, oil tycoon Edward L. Doheny, and banker Andrew Mellon. As ABA president he created the association's Committee on the Bill of Rights and supported the controversial Walter-Logan bill.\\nIn 1938, Hogan denounced racial and religious intolerance in a half-hour speech aimed at fellow Catholics; the speech was aired on the same 34 radio stations used by the notoriously antisemitic priest, Charles Coughlin, immediately following Coughlin's regular broadcast."},{"page_url":"https://de.wikipedia.org/wiki/PCC-Wagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/MadridCAF1969.jpg","page_title":"PCC-Wagen","context_page_description":"Der PCC-Wagen ist ein in den 1930er Jahren in den Vereinigten Staaten entwickelter Großraumstraßenbahnwagen. Das Akronym PCC steht für Presidents’ Conference Committee – es handelt sich um ein Fahrzeug, dessen Baumerkmale im Oktober 1929 in der Direktorenkonferenz der US-Verkehrsbetriebe festgelegt wurden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Prerow","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Prerow_Strandstrasse_15_Haus_Seestern_01.jpg","page_title":"Liste der Baudenkmale in Prerow","context_page_description":"In der Liste der Baudenkmale in Prerow sind alle Baudenkmale der Gemeinde Prerow im Landkreis Vorpommern-Rügen und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Denkmalliste des Landkreis Vorpommern-Rügen, Auszug aus der Kreisdenkmalliste vom August 2015."},{"page_url":"https://pl.wikipedia.org/wiki/Twierdza_Zmartwychwstanek","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Twierdza_Zmartwychwstanek%28tablica%29.jpg","page_title":"Twierdza Zmartwychwstanek","context_page_description":"Twierdza Zmartwychwstanek – nazwa zespołu klasztorno-szkolnego ss. zmartwychwstanek, mieszczącego się w Warszawie przy ul. Krasińskiego 31 pełniącego rolę szpitala i silnego punktu obrony podczas powstania warszawskiego."},{"page_url":"https://en.wikipedia.org/wiki/Fabricaciones_Militares","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Cohete_de_127_mm.JPG","page_title":"Fabricaciones Militares","context_page_description":"Fabricaciones Militares, the full name is Fabricaciones Militares Sociedad del Estado, is a state-owned Argentine arms manufacturer based in Buenos Aires. The company was a government agency under the name Dirección General de Fabricaciones Militares.\\nFounded in 1941, over the years the company has diversified into different areas such as mining, petroleum, rolling stock and petrochemicals. The company is under the direction of the Argentine Ministry of Defence."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%82%D1%80%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/MC-27J-_cannone_da_30_millimetri.jpg","page_title":"Контрпартизанский самолёт","context_page_description":"Контрпартизанский самолёт — штурмовик, специализированный для контрпартизанской борьбы."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%BA%E8%80%85%E9%9B%85%E7%BD%97%E6%96%AF%E6%8B%89%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Yaroslav_I_of_Russia_%28Granovitaya_palata%2C_1881-2%29.jpg","page_title":"智者雅罗斯拉夫","context_page_description":"雅罗斯拉夫一世·弗拉基米罗维奇古罗斯王公，基辅大公。在成为大公之前，他是罗斯托夫和诺夫哥罗德的王公。他统治时代是基辅罗斯最强盛的时期之一。"},{"page_url":"https://en.wikipedia.org/wiki/45th_Space_Wing","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Brig_Gen_Wayne_Monteith_%282%29.jpg","page_title":"45th Space Wing","context_page_description":"The 45th Space Wing is a United States Space Force space launch wing. The 45th Space Wing is assigned to Space Operations Command and headquartered at Patrick Air Force Base, Florida. The wing also controls Cape Canaveral Air Force Station. The 45th Space Wing is responsible for all space launch operations from the East Coast. It manages the Eastern Range, including launch activities for the Space Force, Department of Defense, NASA, and other private space corporations."},{"page_url":"https://hu.wikipedia.org/wiki/Csupasznyak%C3%BA_sisakosmad%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Cephalopterus_glabricollis.jpg","page_title":"Csupasznyakú sisakosmadár","context_page_description":"A csupasznyakú sisakosmadár a madarak osztályának a verébalakúak rendjéhez, ezen belül a kotingafélék családjához tartozó faj."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%8B%E9%98%B2%E5%A4%A7%E8%87%A3_(%E8%8B%B1%E5%9C%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/George_Younger.JPEG","page_title":"國防大臣 (英國)","context_page_description":"女王陛下首席國防大臣；簡稱國防大臣，是英國政府的內閣級職位和英國國防部的首長。\\n該職位於1964年設立，以替代國防協調部長和國防部長。該職位也取代了海軍大臣、陸軍大臣 (英國)和空軍大臣這三個職位，海軍部、陸軍部和空軍部也隨著國防部的成立而一併撤銷。"},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_Gabenor_Singapura","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Flag_of_the_Governor_of_Singapore_%281946%E2%80%931952%29.svg","page_title":"Senarai Gabenor Singapura","context_page_description":"Gabenor Singapura ialah pemimpin politik sebelum kemerdekaan Singapura."},{"page_url":"https://ca.wikipedia.org/wiki/Comunicaci%C3%B3_cel%C2%B7lular","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/USDAbacteria.jpg","page_title":"Comunicació cel·lular","context_page_description":"La comunicació cel·lular forma part d'un sistema complex de comunicació que governa les activitats cel·lulars bàsiques i coordina les accions de la cèl·lula. L'habilitat de les cèl·lules de percebre i respondre correctament als seus microhàbitats és la base del desenvolupament, la reparació de teixit, i la immunitat com també de l'homeòstasi de teixit normal. Els errors en el processament d'informació cel·lular són els responsables de malalties com el càncer, l'autoimmunitat, i la diabetis.\\nLa feina tradicional en biologia s'ha centrat a estudiar parts individuals de les seqüències de la comunicació cel·lular. La recerca en biologia de sistemes ens ajuda a entendre l'estructura subjacent de les xarxes de comunicació cel·lular i com els canvis en aquestes xarxes poden afectar la transmissió i el cabal d'informació. Tals xarxes són sistemes complexos en la seva organització i poden exhibir gran nombre de propietats emergents incloent-hi la biestabilitat i la ultrasensitivitat. La regulació al·lostèrica de llarg abast sovint és un component significatiu dels actes de comunicació cel·lular."},{"page_url":"https://en.wikipedia.org/wiki/Jeffrey_Wammes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Rio_2016-_Artistic_gymnastics_-_men%27s_qualification_%2828713115604%29.jpg","page_title":"Jeffrey Wammes","context_page_description":"Jeffrey Wammes is a former internationally competitive Dutch gymnast. Specializing in the floor exercise and vault, Wammes began competing on the elite level in 2005. Wammes trained alongside Yuri van Gelder at the Flik-Flak club in 's-Hertogenbosch."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Straelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Baudenkm%C3%A4ler_Straelen_060_Hochstra%C3%9Fe_13.jpg","page_title":"Liste der Baudenkmäler in Straelen","context_page_description":"Die Liste der Baudenkmäler in Straelen enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Straelen im Kreis Kleve in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Straelen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_from_Englewood,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Upton_Beall_Sinclair_Jr.jpg","page_title":"List of people from Englewood, New Jersey","context_page_description":"The people that are listed below were born in, residents of, or otherwise closely associated with Englewood, New Jersey."},{"page_url":"https://cs.wikipedia.org/wiki/%C3%9Ajezd_u_Brna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/%C3%9Ajezd_u_Brna%2C_n%C3%A1m%C4%9Bst%C3%AD_Svat%C3%A9ho_Jana.jpg","page_title":"Újezd u Brna","context_page_description":"Újezd u Brna je město v okrese Brno-venkov v Jihomoravském kraji. Leží v Dyjsko-svrateckém úvalu, asi 15 km jihovýchodně od Brna. Žije zde přibližně 3 400 obyvatel.\\nJedná se o vinařskou obec ve Velkopavlovické vinařské podoblasti."},{"page_url":"https://en.wikipedia.org/wiki/Birdsville_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/YBDV_Birdsville_Airport.jpg","page_title":"Birdsville Airport","context_page_description":"Birdsville Airport is an airport serving Birdsville, Queensland, Australia. During the Birdsville Races weekend each September, as many as 200 light aircraft visit the airport, with aviators permitted to camp under the wings of their planes. The Channel Mail Run, the world's longest mail run operates between Port Augusta, South Australia and Birdsville, stopping in the town to collect mail for the remote Queensland cattle stations of Glengyle and Durrie.\\nIn September 2011, a $1.5 million upgrade was completed which included construction of a new terminal building, resurfacing and the installation of edge lights on runway 14/32 and extensions to the apron area to provide more aircraft parking and manoeuvring space. The upgrade was funded by the Diamantina Shire Council and Queensland Government's Regional Airport Development Scheme, in response to growth in aviation-related tourism leading to increased movements at the airport."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2_%D0%A2%D0%BE%D0%BB%D0%B8%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%C3%89douard_Manet_-_Antonin_Proust_-_Google_Art_Project.jpg","page_title":"Музей искусств Толидо","context_page_description":"Музей искусств Толидо — крупнейший художественный музей в Толидо, штат Огайо. В его собрании более чем 30 000 экспонатов.\\nМузей основан в 1901 г. стеклозаводчиком Эдвардом Либби. С 1912 г. занимает нынешнее здание, своим стилем напоминающее храмы древнего мира. Здание дважды расширялось. Директором музея с 2010 года является Брайан Кеннеди.\\nМузею принадлежит значимое собрание картин европейских и американских художников XIX-XX вв. и большая коллекция изделий из художественного стекла. Интерес также представляют отделы античности, эпохи Возрождения и японского искусства.\\nВ восточном крыле музейного здания расположен концертный зал, пристроенный в 1930-х годах в стиле неоклассицизма. Это основная концертная площадка для симфонического оркестра Толедо. Рассчитан на 1750 мест.\\nВ 2001 г. при музее открылся парк скульптуры, расположенный в створе улицы Монро. Здесь представлены произведения скульпторов второй половины XX века, преимущественно американских.\\nЦентр визуального искусства, построенный в 1990-е годы по проекту Фрэнка Гери, включает в себя библиотеку, музей, а также студии, офисные и учебные помещения для художественного факультета университета Толедо."},{"page_url":"https://en.wikipedia.org/wiki/South_Fayette_Township_School_District","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/South_Fayette_High_School.jpg","page_title":"South Fayette Township School District","context_page_description":"The South Fayette Township School District is a suburban, public school district serving the Pittsburgh suburb of South Fayette Township, Pennsylvania. The district encompasses approximately 21 square miles. In 2010, the district's population was 14,416 people. In 2009, the district residents’ per capita income was $26,082, while the median family income was $65,473. In the Commonwealth, the median family income was $49,501 and the United States median family income was $49,445, in 2010.\\nAccording to District officials, in school year 2009-10 the South Fayette Township School District provided basic educational services to 2,380 pupils. The District employed: 165 teachers, 166 full-time and part-time support personnel, and 11 administrators. South Fayette Township School District received more than $6.5 million in state funding in school year 2009-10.\\nSouth Fayette Township School District operates four schools: South Fayette High School, South Fayette Middle School, South Fayette Intermediate School and South Fayette Elementary School. The Intermediate School was put into use in time for the 2013-14 school year."},{"page_url":"https://en.wikipedia.org/wiki/Wolf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Wolf_with_Caribou_Hindquarter.jpg","page_title":"Wolf","context_page_description":"The wolf, also known as the gray wolf or grey wolf, is a large canine native to Eurasia and North America. More than thirty subspecies of Canis lupus have been recognized, and gray wolves, as colloquially understood, comprise non-domestic/feral subspecies. The wolf is the largest extant member of Canidae, males averaging 40 kg and females 37 kg. Wolves measure 105–160 cm in length and 80–85 cm at shoulder height. The wolf is also distinguished from other Canis species by its less pointed ears and muzzle, as well as a shorter torso and a longer tail. The wolf is nonetheless related closely enough to smaller Canis species, such as the coyote and the golden jackal, to produce fertile hybrids with them. The banded fur of a wolf is usually mottled white, brown, gray, and black, although subspecies in the arctic region may be nearly all white.\\nOf all members of the genus Canis, the wolf is most specialized for cooperative game hunting as demonstrated by its physical adaptations to tackling large prey, its more social nature, and its highly advanced expressive behaviour. It travels in nuclear families consisting of a mated pair accompanied by their offspring."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_senatoren_uit_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/James_Chamberlain_Jones_Governor_of_Tennessee.jpg","page_title":"Lijst van senatoren uit Tennessee","context_page_description":"Dit is een lijst van de senatoren voor de Amerikaanse staat Tennessee. De senatoren voor Tennessee zijn ingedeeld als Klasse I en Klasse II. De twee huidige senatoren voor Tennessee zijn: Lamar Alexander senator sinds 2003 de en Marsha Blackburn senator sinds 2019 de, beiden lid van de Republikeinse Partij.\\nEen aantal prominente personen die hebben gediend als senator voor Tennessee zijn: Andrew Jackson, George Campbell, John Eaton, Felix Grundy, Andrew Johnson, Howell Jackson, Al Gore sr., Bill Brock, Bill Frist, Hugh White, John Bell, Isham Harris, Cordell Hull, Estes Kefauver, Howard Baker, Al Gore, Fred Thompson en Lamar Alexander."},{"page_url":"https://hu.wikipedia.org/wiki/Cs%C3%B6rg%C5%91_kakasc%C3%ADmer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Yellow-rattle_close_700.jpg","page_title":"Csörgő kakascímer","context_page_description":"A csörgő kakascímer az ajakosvirágúak rendjéhez tartozó vajvirágfélék családjába sorolt kakascímer nemzetség hét, Magyarországon is élő fajának egyike. A németek kis csörgőfazéknak nevezik."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D1%81%D1%81%D0%B8,_%D0%A2%D0%B5%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Theo_Rossi_by_Gage_Skidmore.jpg","page_title":"Росси, Тео","context_page_description":"Джон Те́одор Ро́сси — американский актёр кино и телевидения, наиболее известный по роли «Шустрого» в американском телесериале «Сыны анархии»."},{"page_url":"https://ast.wikipedia.org/wiki/Reinu_de_Bernicia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Y_Gogledd.jpg","page_title":"Reinu de Bernicia","context_page_description":"Bernicia foi un reinu anglosaxón establecíu polos anglos, ente'l c. 420 y el 634, nel sieglu V no qu'anguaño ye'l nordés d'Inglaterra.\\nEl territoriu anglu de Bernicia foi aprosimao equivalente al área que los condaos de Northumberland y Durham ocupen anguaño, moviéndose dende'l ríu Tweed hasta'l ríu Tees. A principios del sieglu VII, xunir col so vecín del sur, Deira, pa formar el reinu de Northumbria y per ende les sos fronteres espandiéronse considerablemente."},{"page_url":"https://vi.wikipedia.org/wiki/Jatropha_mahafalensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Hypolimnas_misippus_%284372946472%29.jpg","page_title":"Jatropha mahafalensis","context_page_description":"Jatropha mahafalensis là một loài thực vật có hoa trong họ Đại kích. Loài này được Jum. & H.Perrier mô tả khoa học đầu tiên năm 1910."},{"page_url":"https://en.wikipedia.org/wiki/Mikkel_Andersen_(physicist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Mikkel_Andersen_%28cropped%29.png","page_title":"Mikkel Andersen (physicist)","context_page_description":"Mikkel F. Andersen is a physicist, Associate Professor at the University of Otago, and an investigator at the Dodd-Walls Centre in Dunedin, New Zealand. His research deals with ways to capture fast-moving atoms."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B2%D0%B5%D0%BD%D0%B8%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Zvenyhorodskiy_rayon_gerb.png","page_title":"Звенигородський район","context_page_description":"Звени́городський райо́н — адміністративно-територіальна одиниця Черкаської області, Україна. Площа — 1010 км². Районний центр — місто Звенигородка.\\n17 липня 2020 року було укрупнено внаслідок адміністративно-територіальної реформи"},{"page_url":"https://da.wikipedia.org/wiki/S%C3%A4ve%C3%A5n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Kusebacka_bro_%C3%B6ver_S%C3%A4ve%C3%A5n_i_Floda%2C_den_15_juli_2006.JPG","page_title":"Säveån","context_page_description":"Säveån er en 130 km lang flod i Västergötland, med et afvandingsområde på 1.475 km². Den har sit udspring ved Vänga sydøst for søen Säven mellem Borås og Vårgårda, hvor to små kildefloder øber sammen. Ved Vänga er der en gammel vandmølle og en stenbeklædt kanal.\\nÅen passerar tæt ved byen Vårgårda, løber gennem Alingsås og munder ud i søen Mjörn. I passagen mellem Mjörn og Lillelången ved Norsesund er der et mindre vandkraftværk. Vandet flyder via den lille men langstrakte sø Sävelången til Floda hvor der er endnu en dæmning. Åen fortsætter gennem Hillefors Grynkvarn inden den passerer Stenkullen og Lerum for at munde ud i søen Aspen. I Jonsered ved Aspens vestre ende findes flere dæmninger og kraftværker inden åen passerer Partille på vej til Göteborg. Cirka 300 meter før udmundingen i Göta älv munder Mölndalsån ud i Säveån. Säveån løber ud i Göta älv ved Göteborgs havn, øst for Tingstadstunnellen.\\nNamnet Säve kommer af den ældre navneform sæva og sæver med betydningen rolig, stille, med hentydning til den rolige forløb."},{"page_url":"https://es.wikipedia.org/wiki/Arquitectura_barroca_en_Hispanoam%C3%A9rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Interior_Templo_de_Santo_Domingo_de_Guzman_Oaxaca.JPG","page_title":"Arquitectura barroca en Hispanoamérica","context_page_description":"La arquitectura barroca en Hispanoamérica ocurre en los siglos XVII y XVIII, cuando la conquista y dominación de las Indias llega a su apogeo. Se crean nuevas ciudades y se reconstruyen las ya existentes."},{"page_url":"https://en.wikipedia.org/wiki/Mouth_%26_MacNeal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/MouthMacNeal1974.jpg","page_title":"Mouth & MacNeal","context_page_description":"Mouth & MacNeal was a Dutch pop duo that enjoyed some commercial success in the 1970s. They are best known for their million selling recording of \\"How Do You Do\\" in 1972, which topped the Dutch chart and became a US top ten hit, also reaching number 2 in Canada, and for representing the Netherlands at the 1974 Eurovision Song Contest, finishing third with the song \\"I See a Star\\", which went on to become a UK top ten hit."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/YurtIssykFamily.jpg","page_title":"Киргиз","context_page_description":"Товчоор Киргиз буюу Бүгд Найрамдах Киргиз Улс — Дунд Ази дахь Тэнгэр уулын уулархаг нутагт оршдог бүрэн эрхт улс юм. Хойд талаараа Хасаг, баруун талаараа Узбек, урд талаараа Тажик, зүүн талаараа Хятад улстай хиллэдэг далайд гарцгүй орон. Нийслэл нь — Бишкек.\\nНутаг дэвсгэр – 199,900 км², 2015 онд тооцсоноор хүн амын тоо – 5,895,100. Олонх буюу 72 хувь нь хиргис үндэстэн. Мөн узбек, орос, дунган, тажик, турк, хасаг зэрэг ард түмэн амьдардаг. Дийлэнх олонх 80 хувь нь ислам шүтлэгтэй.\\nКиргиз орныг иран, түрэг, монгол угсаатан ээлжлэн эзэрхэж явсан. 19-р зуунаас Оросын мэдэлд орж \\"хар хиргис\\" хэмээгдээд ЗХУ-ын мэдлийн доор 1936 онд «Зөвлөлт Социалист Бүгд Найрамдах Киргиз Улс» болсон. 1991 онд хил хязгаар хэвээрээ, тусгаар тогтносон улс болж 1992 онд НҮБ-ын бүрэн эрхт гишүүн болжээ. Ойрын арван жилд хоёр ч хувьсгал гарсан Хиргис нь төрийн нэгдмэл байгууламж, парламентийн эрх мэдэл давамгай бүгд найрамдах засагтай. Түрэг төрлийн хиргис хэл болон хуучин байсан орос хэл гэсэн хоёр хэлийг албанд хэрэглэдэг.\\nНэг хүнд ноогдох ДНБ-ийн хэмжээ харьцангуй бага буюу 2,372 $. Гадаадад алт, эрчим хүч экспортолдог."},{"page_url":"https://de.wikipedia.org/wiki/Kauhajoki","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Lauhanvuori_6.jpg","page_title":"Kauhajoki","context_page_description":"Kauhajoki ist eine Kleinstadt im Westen Finnlands. Die Gemeinde liegt in der Landschaft Südösterbotten, wurde 1868 gegründet und hat 13.375 Einwohner. Am 1. Juli 2001 erhielt sie das Stadtrecht."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9_Kate%C5%99iny_Alexandrijsk%C3%A9_(Chrudim)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Chrudim%2C_kostel_sv._Kate%C5%99iny%2C_ji%C5%BEn%C3%AD_port%C3%A1l_z%C3%A1padn%C3%ADho_pr%C5%AF%C4%8Del%C3%AD..JPG","page_title":"Kostel svaté Kateřiny Alexandrijské (Chrudim)","context_page_description":"Kostel svaté Kateřiny v Chrudimi je goticko-renesanční chrám, který je chráněn jako kulturní památka České republiky."},{"page_url":"https://sv.wikipedia.org/wiki/Skepparm%C3%B6ssa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Prinz-Heinrich-Muetze.jpg","page_title":"Skepparmössa","context_page_description":"Skepparmössa är en mörkblå skärmmössa med en smal kant, platt kulle av tyg och normalt en hård skärm.\\nTysklands förre förbundskansler Helmut Schmidt bar gärna en skepparmössa av typ Elblotsen-Mütze som mycket liknar en Prinz-Heinrich-Mütze.\\nSkepparmössan tillverkas idag inom Sverige av bland andra CTH Ericson"},{"page_url":"https://en.wikipedia.org/wiki/Peace","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Mohandas_K._Gandhi%2C_portrait.jpg","page_title":"Peace","context_page_description":"Peace is a concept of societal friendship and harmony in the absence of hostility and violence. In a social sense, peace is commonly used to mean a lack of conflict and freedom from fear of violence between individuals or groups. Throughout history leaders have used peacemaking and diplomacy to establish a certain type of behavioral restraint that has resulted in the establishment of regional peace or economic growth through various forms of agreements or peace treaties. Such behavioral restraint has often resulted in the reduction of conflicts, greater economic interactivity, and consequently substantial prosperity.\\n\\"Psychological peace\\" is perhaps less well defined yet often a necessary precursor to establishing \\"behavioral peace.\\" Peaceful behavior sometimes results from a \\"peaceful inner disposition.\\" Some have expressed the belief that peace can be initiated with a certain quality of inner tranquility that does not depend upon the uncertainties of daily life for its existence. The acquisition of such a \\"peaceful internal disposition\\" for oneself and others can contribute to resolving of otherwise seemingly irreconcilable competing interests."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_de_Kerkstraat_(Amsterdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/RM2864_Amsterdam_-_Kerkstraat_277.jpg","page_title":"Lijst van rijksmonumenten in de Kerkstraat (Amsterdam)","context_page_description":"Een overzicht van de 140 rijksmonumenten in de Kerkstraat in Amsterdam."},{"page_url":"https://sk.wikipedia.org/wiki/Slia%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Hajnik_%28ekkor_%C3%B6n%C3%A1ll%C3%B3%2C_ma_a_v%C3%A1ros_r%C3%A9sze%29%2C_Szent_Mikl%C3%B3s-templom._Fortepan_96015.jpg","page_title":"Sliač","context_page_description":"Sliač je kúpeľné mesto na Slovensku v okrese Zvolen. Známe je aj novozrekonštruovaným medzinárodným civilným a vojenským letiskom. Najvýznamnejšia pamiatka je gotický Kostol sv. Mikuláša v časti Hájniky zo začiatku 14. storočia. V časti Sampor v roku 2011 odkryli základy gotického kostolíka sv. Michala Archanjela."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%89%B9%E5%88%A5%E6%94%BB%E6%92%83%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/USS_Franklin_%28CV-13%29_and_USS_Belleau_Wood_%28CVL-24%29_afire_1944.jpg","page_title":"特別攻撃隊","context_page_description":"特別攻撃隊は、必死あるいは決死の任務を行う部隊。略称は「特攻隊」。\\n当記事では攻撃自体を指す特別攻撃およびその略称の特攻についても述べる。"},{"page_url":"https://es.wikipedia.org/wiki/Fundaci%C3%B3n_nacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Bencz%C3%BAr_The_Baptism_of_Vajk_1870.jpg","page_title":"Fundación nacional","context_page_description":"La fundación de una nación es un concepto problemático, que se ha construido de manera diferente para cada nación-Estado o ente similar, como parte de los distintos procesos de construcción nacional o nacionalismos. Igualmente problemáticos son la preexistencia o no de la nación al Estado, su identificación o no con un pueblo, su ubicación o no en un territorio de determinados límites y dimensiones, su definición o no mediante todo tipo de características, y su permanencia o no en el tiempo.​ El hito o hecho fundacional que se elija es en gran medida un mito ​ cuya elección ha dependido históricamente en cada caso de distintas concepciones de la historia nacional y de la voluntad de señalar un único hecho o proceso histórico como discontinuidad significativa; en la mayor parte de los países del mundo se celebra una fiesta nacional, que muy a menudo coincide con el Día de la Independencia, y muchos honran a uno o varios padres de la patria, próceres, forjadores o libertadores.​"},{"page_url":"https://war.wikipedia.org/wiki/Eurrhypis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Eurrhypis_pollinalis.jpg","page_title":"Eurrhypis","context_page_description":"An Eurrhypis in uska genus han Lepidoptera. An Eurrhypis in nahilalakip ha familia nga Crambidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/American_Wind_Power_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Chuckwagon_exhibit%2C_Lubbock%2C_TX_IMG_1656.JPG","page_title":"American Wind Power Center","context_page_description":"The American Wind Power Center is a museum of wind power in Lubbock, Texas. Located on 28 acres of city park land east of downtown Lubbock, the museum has more than 160 American style windmills on exhibition."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A4%E0%A4%B8%E0%A5%8D%E0%A4%B2%E0%A5%80%E0%A4%AE%E0%A4%BE_%E0%A4%A8%E0%A4%B8%E0%A4%B0%E0%A5%80%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Taslima_Nasrin5.jpg","page_title":"तस्लीमा नसरीन","context_page_description":"तस्लीमा नसरीन ही बंगाली, बांगलादेशी डॉक्टर व लेखिका आहे. उदयोन्मुख लेखिका म्हणून इ.स. १९८०च्या दशकात तिची साहित्यिक कारकीर्द सुरू झाली. स्त्रीवादी विचारसरणीमुळे, तसेच धर्मावरील व विशेषकरून इस्लामावरील टीकेमुळे इ.स.च्या २०व्या शतकाच्या अखेरीस तिचे व्यक्तिमत्त्व व साहित्य आंतरराष्ट्रीय स्तरावरील चर्चेचा विषय बनले. इ.स. १९९४मध्ये ती बांगलादेशातून परागंदा झाली व तिने भारतात आश्रय घेतला."},{"page_url":"https://eo.wikipedia.org/wiki/ISO_3166-2:SV","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Bandera_de_sonsonate.png","page_title":"ISO 3166-2:SV","context_page_description":"ISO 3166-2:SV estas subaro de la normo ISO 3166-2 rilate Salvadoron. Ĉiu kodo konsistas el du partoj, apartigitaj per streketo. La unua estas SV, la ISO 3166-1 dulitera kodo de Salvadoro. La dua parto estas du literoj."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B4%D8%A7%D8%B1%D9%84%D9%8A_%D8%A5%D9%86%D8%BA%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/CE_head-shot.jpg","page_title":"تشارلي إنغل","context_page_description":"تشارلي إنغل ‏ هو عداء مراثوني أمريكي، ولد في 20 سبتمبر 1962 في تشابل هيل في الولايات المتحدة."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%AF%8C%E8%B1%AAB9TL","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/VT4112-AVG3-59X.jpg","page_title":"富豪B9TL","context_page_description":"富豪B9TL，曾一度被稱為富豪奧林比安的低地台版本，是富豪車廠生產的一款超低地台雙層巴士，於2002年首次生產。而它是全球暢銷度排名第二的3軸雙層巴士，僅次於亞歷山大丹尼士Enviro 500 MMC，由2002年至今已售出超過2,000輛。"},{"page_url":"https://ca.wikipedia.org/wiki/Colliguaja_odorifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Colliguaja_odorifera_gen.JPG","page_title":"Colliguaja odorifera","context_page_description":"Colliguaja odorifera és una espècie endèmica del centre de Xile del gènere de plantes Colliguaja de la família Euphorbiaceae."},{"page_url":"https://en.wikipedia.org/wiki/List_of_bacon_dishes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Dennys_Maple_Bacon_Sundae_%285576479106%29.jpg","page_title":"List of bacon dishes","context_page_description":"The following is a list of bacon dishes. The word bacon is derived from the Old High German bacho, meaning \\"buttock\\", \\"ham\\", or \\"side of bacon\\", and cognate with the Old French bacon. Bacon is made from the sides, belly, or back of the pig and contains varying amounts of fat depending on the cut. It is cured and smoked over wood cut from apple trees, mesquite trees, or hickory trees. Bacon is used as an ingredient or condiment in a number of dishes."},{"page_url":"https://no.wikipedia.org/wiki/Ural-375D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/BM-21_Grad_on_Ural-375D_chassis_in_a_museum_in_Herat%2C_Afghanistan.jpg","page_title":"Ural-375D","context_page_description":"Ural-375D er en 4,5 tonns sekshjulsdrevet lastebil, produsert av Ural i Russland og det tidligere Sovjetunionen siden tidlig på 1960-tallet. Forgjengeren var ZIL-157, og etterfølgeren var Ural-4320.\\nLastebilen er brukt blant annet som plattform for BM-21 «Grad» rakettsystem. Andre bruksområder inkluderer transport av soldater og last."},{"page_url":"https://sco.wikipedia.org/wiki/Aicorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Acorns_small_to_large.jpg","page_title":"Aicorn","context_page_description":"The aicorn, or aik nit, is the nit o the aiks an thair close relatives. It uisually conteens a single seed, enclosed in a teuch, leathery shell, an borne in a cup-shaped cupule. Aicorns are 1–6 cm lang an 0.8–4 cm broad. Acorns tak atween 6 an 24 month tae matur."},{"page_url":"https://hu.wikipedia.org/wiki/Phuket_(telep%C3%BCl%C3%A9s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Seal_of_Phuket.png","page_title":"Phuket (település)","context_page_description":"Phuket városa Thaiföld délnyugati részén az azonos nevű Phuket sziget és tartomány székhelye és legnagyobb települése. Lakossága 75 ezer fő volt 2012-ben.\\nPhuket város jelentősége a 19. század eleje körül nőtt meg, amikor a sziget ónbányái sok ezer kínai bevándorlót vonzottak ide. Sok kereskedő gazdagodott meg az ónból, pompás épületeket emeltek és gyerekeiket a brit Pinangra küldték tanulni. A hokkien kínait beszélő ónbányászok a helyi thaiokkal házasodtak. A kínai örökség tovább él a kínai-portugál üzletházakban, templomokban, a helyi ételekben és a Vegetáriánus Fesztiválban."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Martin_(Delmas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Delmas_48_Haiti.jpg","page_title":"Saint-Martin (Delmas)","context_page_description":"La sección de Saint-Martin es la única sección de comuna de la comuna haitiana de Delmas."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B8%E0%B1%86%E0%B0%82%E0%B0%9F%E0%B1%8D%E0%B0%B0%E0%B0%B2%E0%B1%8D_%E0%B0%86%E0%B0%AB%E0%B1%8D%E0%B0%B0%E0%B0%BF%E0%B0%95%E0%B0%A8%E0%B1%8D_%E0%B0%B0%E0%B0%BF%E0%B0%AA%E0%B0%AC%E0%B1%8D%E0%B0%B2%E0%B0%BF%E0%B0%95%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Republique_Centrafricaine_-_Boali_-_Chutes_de_Boali.jpg","page_title":"సెంట్రల్ ఆఫ్రికన్ రిపబ్లిక్","context_page_description":"మధ్య ఆఫ్రికా గణతంత్రం లేదా సెంట్రల్ ఆఫ్రికన్ రిపబ్లిక్కు సెంట్రల్ ఆఫ్రికాలో ఒక భూబంధిత దేశం. దేశ ఉత్తర సరిహద్దులో చాద్, ఈశాన్య సరిహద్దులో సూడాన్, తూర్పు సరిహద్దులో దక్షిణ సూడాన్, దక్షిణ సరిహద్దులో కాంగో డెమొక్రాటిక్ రిపబ్లిక్, నైరుతి సరిహద్దులో కాంగో రిపబ్లిక్, పశ్చిమ సరిహద్దులో కామెరూన్ ఉన్నాయి. సి.ఎ.ఆర్. సుమారు 6,20,000 చదరపు కిలో మీటర్ల భూభాగ వైశాల్యాన్ని కలిగి ఉంది. 2016 నాటికి సుమారుగా అంచనా వేసిన జనాభా 4.6 మిలియన్లుగా అంచనా వేయబడింది.\\nసి.ఎ.ఆర్.లో అధిక భాగం సుండో - గుయినీన్ సవన్నా ఉంది. కానీ దేశం ఉత్తరంలో ఉన్న సహెల్-సూడాన్ జోన్, దక్షిణాన ఒక ఈక్వెటోరియల్ అటవీ ప్రాంతం దేశంలో భాగంగా ఉన్నాయి. దేశంలో మూడింట రెండు వంతులభూభాగం ఉబాంగి నదీ పరీవాహక ప్రాంతంగా ఉంది. మిగిలిన మూడవ భూభాగం చారి ముఖద్వారంలో ఉంది. చారి నదీ జలాలు చాదు సరోవరంలోకి సంగమిస్తుంటాయి.\\nప్రస్తుత సెంట్రల్ ఆఫ్రికన్ రిపబ్లిక్ ప్రాంతంలో వేల సంవత్సరాల నుండి మానవనివసిత ప్రాంతంగా ఉంది. ప్రస్తుత దేశం సరిహద్దులు ఫ్రాన్సుచే స్థాపించబడ్డాయి. 19 వ శతాబ్దం చివరలో ఈ భూభాగంలో కాలనీగా పాలన ప్రారంభం అయింది. 1960 లో ఫ్రాన్సు నుండి స్వాతంత్ర్యం పొందిన తరువాత సెంట్రల్ ఆఫ్రికన్ రిపబ్లిక్కును పలువురు నిరంకుశ నాయకులు పాలించారు. ఒక రాచరిక పాలన విఫలమైంది."},{"page_url":"https://ceb.wikipedia.org/wiki/Bulbophyllum_cornutum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Bulbophyllum_cornutum_%28Dark_color_type%29_%28Blume%29_Rchb.f._in_W.G.Walpers%2C_Ann._Bot._Syst._6_247_%281861%29_%2843542327702%29.jpg","page_title":"Bulbophyllum cornutum","context_page_description":"Espesye sa orkidya nga una nga gihulagway ni Carl Ludwig von Blume, ug nga gihatagan sa eksakto nga ngalan ni Heinrich Gustav Reichenbach ang Bulbophyllum cornutum. Ang Bulbophyllum cornutum sakop sa kahenera nga Bulbophyllum sa kabanay nga Orchidaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Niels-Peter_M%C3%B8rck","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/FC_Liefering_versus_WSG_Wattens_%2819._Mai_2017%29_07.jpg","page_title":"Niels-Peter Mørck","context_page_description":"Niels-Peter Wilhelm Mørck ist ein dänischer Fußballspieler."},{"page_url":"https://it.wikipedia.org/wiki/Levriero_russo","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Borzoi_female.jpg","page_title":"Levriero russo","context_page_description":"Il levriero russo è una razza canina di origine russa riconosciuta dalla FCI.\\nIl suo nome originale: Russkaja Psovaja Borzaja, significa \\"cane rapido a pelo lungo\\"."},{"page_url":"https://fi.wikipedia.org/wiki/Justus_Lipsius","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Justus_Lipsius_-_Imagines_philologorum.jpg","page_title":"Justus Lipsius","context_page_description":"Justus Lipsius, tunnettu myös nimillä Joost Lips ja Josse Lips oli flaamilainen kielentutkija ja humanisti.\\nHänet lähetettiin nuorena jesuiittojen kouluun Kölniin, mutta vanhemmat siirsivät hänet Leuvenin katoliseen yliopistoon, koska pelkäsivät poikansa kääntyvän jesuiitaksi. Hän pääsi kahdeksi vuodeksi Vatikaaniin kardinaalin seurueeseen. Siellä hän käytti vapaa-aikansa latinalaisten klassikoiden ja vanhojen käsikirjoitusten tutkimiseen.\\nHän liikkui sujuvasti Keski-Euroopan eri yliopistojen välillä, vaikka ne kuuluivat eri uskontokunnille. Tuotteliaimmat vuotensa Lipsius vietti kalvinistisessa Leidenissä. Vuonna 1590 hän siirtyi Mainziin ja palasi katolisen kirkon huomaan. Kääntyminen herätti huomiota katolisessa maailmassa. Lipsiukselle sateli kutsuja Italian, Itävallan ja Espanjan hoveista ja yliopistoista, mutta hän valitsi synnyinmaansa ja otti vastaan Leuvenin yliopiston latinan kielen professorin viran. Virkaan ei sisältynyt opetusvelvollisuutta. Sen sijaan hän toimi virkaa rahoittavan Espanjan kuninkaan yksityisenä neuvonantajana ja historiankirjoittajana."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86%D8%AA_%D8%A3%D9%86%D8%AC%D9%8A%D9%84%D9%88_%D8%AF%D9%8A_%D8%A8%D8%B1%D9%88%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Sant%27Angelo_di_Brolo%2C_Sicile.jpg","page_title":"سانت أنجيلو دي برولو","context_page_description":"سانت أنجيلو دي برولو هي بلدية في مقاطعة ميسينا في صقلية الإيطالية."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_a%C3%A9roports_les_plus_fr%C3%A9quent%C3%A9s_en_Afrique","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/CTIA-CentralTerminal.jpg","page_title":"Liste des aéroports les plus fréquentés en Afrique","context_page_description":"Cet article dresse les classements des 20 aéroports en Afrique ayant le plus important nombre annuel de passagers. Les chiffres cumulent les passagers au départ, à l'arrivée et en transit.\\nLes sources des chiffres sont données individuellement pour chaque aéroport et proviennent normalement des statistiques de l'autorité nationale de l'aviation, sinon de celles de l'opérateur de l'aéroport."},{"page_url":"https://vi.wikipedia.org/wiki/V%C4%83n_ph%C3%B2ng_tr%E1%BB%8Dn_g%C3%B3i","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Van-phong-tron-goi.jpg","page_title":"Văn phòng trọn gói","context_page_description":"Văn phòng trọn gói hay còn gọi là Văn phòng tiện lợi là một loại hình dịch vụ cung cấp diện tích văn phòng cho thuê đi kèm các dịch vụ khác sử dụng chung phục vụ cho nhu cầu hoạt động của một văn phòng.\\nThuật ngữ văn phòng tịên lợi thường dùng cho các văn phòng có diện tích nhỏ, và dịch vụ dùng chung để chia sẻ chi phí giữa các doanh nghiệp trên một diện tích chung. Phần dùng chung có thể là phòng họp, lễ tân, khu tiếp khách...\\nSau đó, dịch vụ Văn phòng tiện lợi để mô tả một dịch vụ cung cấp một cách trọn gói tất cả các dịch vụ phụ trợ cho một doanh nghiệp hoạt động từ việc tìm kiếm văn phòng phù hợp, thi công nội thất, lắp đặt, quản lý văn phòng, cung cấp văn phòng phẩm cũng như các dịch vụ khác phục vụ cho các doanh nghiệp hoạt động. Hay chỉ là tạo ra một khu tổ hợp văn phòng với đầy đủ tiện nghi có các diện tích cho thuê khác nhau cho các doanh nghiệp lựa chọn.\\nVới dịch vụ này doanh nghiệp chỉ còn phải tập trung vào lĩnh vực kinh doanh chính của mình còn các vấn đề phụ trợ đã do đơn vị cung cấp dịch vụ chịu trách nhiệm."},{"page_url":"https://it.wikipedia.org/wiki/Ouriel_Zohar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/With_Peter_Brook_1991_0001_%282%29.jpg","page_title":"Ouriel Zohar","context_page_description":"Ouriel Zohar è un regista teatrale, drammaturgo, poeta e traduttore israeliano naturalizzato francese; professore presso il Dipartimento di Scienze umane e Arti della Technion University, nel 1986 ha creato il Teatro Technion. È professore ordinario all'Università di Parigi VIII dal 1997, e dal 1995 è Visiting Professor all'École des hautes études commerciales de Paris dal 1995."},{"page_url":"https://id.wikipedia.org/wiki/Gloster_E.28/39","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Gloster_E.28-39.svg","page_title":"Gloster E.28/39","context_page_description":"Gloster E.28/39, adalah pesawat terbang bermesin jet yang pertama Inggris. Ini dirancang untuk menguji mesin jet Whittle dalam penerbangan, mengarah ke pengembangan Gloster Meteor."},{"page_url":"https://ca.wikipedia.org/wiki/Beldi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Int%C3%A9rieur_f%C3%A9minin_tunisois.jpg","page_title":"Beldi","context_page_description":"El beldi o baldi designa una categoria social de la societat tunisiana, constituïda pels ciutadans que viuen en l'entorn urbà de la capital, Tunis, abans del segle xix."},{"page_url":"https://ca.wikipedia.org/wiki/Bioreactor","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Bench-scale_Bioreactor.JPG","page_title":"Bioreactor","context_page_description":"Un bioreactor és un sistema que manté un ambient biològicament actiu per facilitar el creixement de cultius cel·lulars, teixits o microorganismes. Duu a terme un procés bioquímic aeròbic o anaeròbic que involucra organismes o substàncies bioquímicament actives. També se l'anomena digestor o fermentador, nom que només s'aplica als bioreactors sense airejar."},{"page_url":"https://hu.wikipedia.org/wiki/Poll%C3%A1k_Miksa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Poll%C3%A1k_Miksa.jpg","page_title":"Pollák Miksa","context_page_description":"Pollák Miksa rabbi, történettudós. Pap Károly író apja."},{"page_url":"https://mg.wikipedia.org/wiki/Barbara_Kopple","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Barbara_Kopple_2015.jpg","page_title":"Barbara Kopple","context_page_description":"Barbara Kopple dia mpamoaka horonantsary, talen-koronantsary mizaka ny zom-pirenen'i Etazonia teraka ny 30 Jolay 1946 tao New York"},{"page_url":"https://it.wikipedia.org/wiki/Saint-Martin-de-Fresnay","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/FranceNormandieLOudonSaintMartinDeFresnayEglise.jpg","page_title":"Saint-Martin-de-Fresnay","context_page_description":"Saint-Martin-de-Fresnay è una località e un comune francese soppresso di 1.347 abitanti situato nel dipartimento del Calvados nella regione della Normandia.\\nNel 1973 fu accorpato al comune di L'Oudon."},{"page_url":"https://fr.wikipedia.org/wiki/Chhatri","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Taj_chhatri.jpg","page_title":"Chhatri","context_page_description":"Les chhatris sont des structures en forme de pavillon ou de kiosque carré coiffés de dômes, typiques de l'architecture indienne. Ce sont des symboles de fierté, d'honneur et de commémoration dans l'architecture Rajput au Rajasthan. On les retrouve fréquemment dans les palais, les forteresses, ou pour délimiter les sites funéraires.\\nEn hindi, le terme de chhatri désigne un parapluie ou une case.\\nCe composant a été étendu à l'architecture indienne, notamment hindoue. Mais les chhatris ont aussi été repris dans l'architecture moghole où on les retrouve dans des monuments majeurs tels que le Taj Mahal à Agra ou le tombeau d'Humayun à Delhi."},{"page_url":"https://fr.wikipedia.org/wiki/Jardin_botanique","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Pamplemousses_041.jpg","page_title":"Jardin botanique","context_page_description":"Un jardin botanique est un territoire aménagé par une institution publique, privée, ou associative qui a pour but la présentation d'espèces et variétés végétales.\\nLes nombreuses espèces et variétés de plantes sauvages et/ou horticoles présentes sont strictement identifiées et réunies en collections. Elles sont cultivées et étudiées pour satisfaire quatre objectifs principaux : la conservation, la recherche scientifique, l'éducation et l’enseignement, tout en restant compatible avec le tourisme. Mondialement, les plus importants jardins botaniques, en superficie et en taille de la collection, sont les Jardins botaniques royaux de Kew suivis par le Jardin botanique de Montréal."},{"page_url":"https://eu.wikipedia.org/wiki/Juri_Gidzenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Soyuz_TM-33_patch.png","page_title":"Juri Gidzenko","context_page_description":"Juri Pavlovitx Gidzenko Ukrainiar jatorria duen kosmonauta errusiarra da. Sobietar Batasuneko Heroia, Errusiako Aireko Indarraren koronela da gaur egun. Halaber, kosmonautak prestatzeko Gagarin Zentroan lan egiten du."},{"page_url":"https://bar.wikipedia.org/wiki/Salvator_am_Wienerfeld_(Favoritn)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Neilreichgasse_16.JPG","page_title":"Salvator am Wienerfeld (Favoritn)","context_page_description":"Salvator am Wienerfeld is a remisch-katholische Kiach'n im 10. Weana Beziak Favoritn. Se steht aun da Eck'n Neilreichgåss'n/Wienerfeldgåss'n aum Raund von da Wienerfeldsiedlung aum Südhaung vom Wienerberg."},{"page_url":"https://no.wikipedia.org/wiki/Athis-Mons","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/91_Communes_Essonne_Athis-Mons.png","page_title":"Athis-Mons","context_page_description":"Athis-Mons er en kommune i departementet Essonne i regionen Île-de-France, og er en av de sørlige forstedene til Paris. Kommunen ligger 16,5 km fra sentrum av Paris, og innbyggerne kalles for Athégiens.\\nEn liten del av Orly lufthavn ligger i kommunen."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_la_Haute-Marne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Si%C3%A8ge_de_st-Dizier_C_Chastillon.jpg","page_title":"Histoire de la Haute-Marne","context_page_description":"Histoire de la Haute-Marne."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%98%9F%E8%99%AB%E5%8A%A8%E7%89%A9%E9%97%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kilaw.jpg","page_title":"星虫动物门","context_page_description":"星蟲動物是海洋底棲的對稱無環節動物，分布與生活環境及生活方式與螠類相似。根據不同的分類或估計方式，現時物種從144到300種不等。比較知名的物種有：土釘蟲和方格星蟲。 星蟲動物的學名Sipuncula的意思就是「小型的虹管」。\\n最初被認為是動物界的一個門，現時基於分子生物學的研究，可能會放到環節動物門之下成為一個「亞門」。"},{"page_url":"https://it.wikipedia.org/wiki/Dolomiti_di_Fiemme","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Cima_cardinal_2481m_-_panoramio.jpg","page_title":"Dolomiti di Fiemme","context_page_description":"Le Dolomiti di Fiemme sono un massiccio montuoso delle Dolomiti e sono collocate in Trentino-Alto Adige e, in parte minima, in Veneto. La vetta più alta è la Vezzana con i suoi 3.192 m s.l.m.. Prendono il nome dalla Val di Fiemme che si inserisce al loro interno."},{"page_url":"https://fr.wikipedia.org/wiki/Citro%C3%ABn_C5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Citro%C3%ABn_C5_CrossTourer_HDi_200_%28II%2C_Facelift%29_%E2%80%93_Frontansicht%2C_30._Juni_2014%2C_D%C3%BCsseldorf.jpg","page_title":"Citroën C5","context_page_description":"La Citroën C5 est une automobile du constructeur français Citroën appartenant à la catégorie des familiales routières, produite dans l'usine PSA de Rennes de 2000 à 2008 pour la première génération, et depuis 2008 pour la C5 II, dont la carrière, arrêtée en Europe en 2017, se poursuit en Chine après un profond restylage. La troisième génération devrait être commercialisée en 2021.\\nLes deux premières générations sont déclinées en deux carrosseries, berline tricorps ou break, qui est appelée \\"Tourer\\" pour la C5 II.\\nCes modèles sont les héritiers de la tradition Citroën initiée par la DS, car ils sont équipés d'une suspension hydropneumatique, sauf l'entrée de gamme de la Citroën C5 II. La troisième génération abandonne en revanche cette suspension, jugée trop coûteuse. Elle est remplacée par le nouveau programme Citroën Advanced Comfort, caractérisé par des sièges à mousse plus confortable et à mémoire de forme, par une nouvelle technique de collage structurel et par une nouvelle technologie d'amortisseur, qui possèdent chacun deux butées hydrauliques progressives."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%DB%8C%DA%A9%D9%88%D8%AA%DB%8C%D9%86%E2%80%8C%D8%A2%D9%85%DB%8C%D8%AF_%D8%A2%D8%AF%D9%86%DB%8C%D9%86_%D8%AF%DB%8C%E2%80%8C%D9%86%D9%88%DA%A9%D9%84%D8%A6%D9%88%D8%AA%DB%8C%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/NAD%2B_phys.svg","page_title":"نیکوتین‌آمید آدنین دی‌نوکلئوتید","context_page_description":"نیکوتین‌آمید آدنین دی‌نوکلئوتید بیر شیمیایی ماده. آغ، تۇز حالتینده تاپیلار."},{"page_url":"https://it.wikipedia.org/wiki/Zh%C5%8Dnggu%C3%B3_R%C3%A9nm%C3%ADn_Ji%C4%9Bf%C3%A0ngj%C5%ABn_H%C7%8Eij%C5%ABn_H%C3%A1ngk%C5%8Dngb%C4%ABng","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Xian_H-6M.jpg","page_title":"Zhōngguó Rénmín Jiěfàngjūn Hǎijūn Hángkōngbīng","context_page_description":"L'Aviazione di Marina dell'Esercito Popolare di Liberazione è la componente aerea della Zhongguo Renmin Jiefangjun Haijun, la marina militare della Cina."},{"page_url":"https://es.wikipedia.org/wiki/Facultad_de_Ingenier%C3%ADa_de_la_Universidad_de_Concepci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/FI_Udec.JPG","page_title":"Facultad de Ingeniería de la Universidad de Concepción","context_page_description":"La Facultad de Ingeniería es una de las 19 facultades de la Universidad de Concepción, y una de las facultades presentes desde la fundación de dicha casa de estudios. Se ubica en la Ciudad Universitaria de Concepción."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Holmes_(condado_de_Crawford,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Holmes_Township_farmsteads_from_US_30.jpg","page_title":"Municipio de Holmes (condado de Crawford, Ohio)","context_page_description":"El municipio de Holmes es un municipio ubicado en el condado de Crawford en el estado estadounidense de Ohio. En el año 2010 tenía una población de 1339 habitantes y una densidad poblacional de 14,71 personas por km².​"},{"page_url":"https://nl.wikipedia.org/wiki/Muhammad_Shah_(Mogolkeizer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Mu%E1%B8%A5ammad_Sh%C3%A1h.jpg","page_title":"Muhammad Shah (Mogolkeizer)","context_page_description":"Raushan-Akhtar Muhammad Shah was padishah van het Mogolrijk tussen 1720 en 1748. Tijdens zijn regering verloren de Mogols de laatste resten van hun macht over de westelijke Deccan, Malwa, Gujarat aan de Maratha's. De gouverneurs van Bengalen, Haiderabad, Sindh en Avadh erkenden de Mogolkeizer feitelijk alleen nog in naam. In 1739 volgde een verder dieptepunt, toen de Perzische veldheer Nadir Shah de Mogols versloeg en de keizer gevangen nam. De Perzische troepen plunderden de Mogolhoofdstad Delhi. Al het gebied ten westen van de Indus werd aan de Perzen afgestaan. Muhammad Shah lijkt volstrekt de verkeerde man geweest te zijn voor het moment. Hij wordt door tijdgenoten beschreven als een zachtaardige man die weinig interesse toonde in politiek, hoewel dat een maskerade kan zijn geweest om geen ruzie met de moordzuchtige hovelingen te krijgen. Hij was geïnteresseerd in de kunsten en aan zijn hof kwamen muziek, schilderkunst en dichtkunst weer tot bloei, na de sobere periode onder Aurangzeb. Muhammad Shah verving in 1723 het Perzisch als hoftaal door het Urdu, de taal van de bevolking van Hindoestan."},{"page_url":"https://fr.wikipedia.org/wiki/Yeadon_(%C3%89tats-Unis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Yeadon%2C_Delaware_County%2C_Pennsylvania.png","page_title":"Yeadon (États-Unis)","context_page_description":"Yeadon est un borough en Pennsylvanie, dans le comté de Delaware, aux États-Unis."},{"page_url":"https://hu.wikipedia.org/wiki/Pl%C3%B6%C3%9Fberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/PloessbergSchlossNebengeb_01.JPG","page_title":"Plößberg","context_page_description":"Plößberg település Németországban, azon belül Bajorországban. Lakosainak száma 3250 fő. +/-"},{"page_url":"https://fr.wikipedia.org/wiki/Cochleosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Cochleosaurus.jpg","page_title":"Cochleosaurus","context_page_description":"Cochleosaurus est un genre éteint de tétrapodes temnospondyles, connu via les espèces fossiles C. bohemicus découverte en nombre en République tchèque et C. florensis. Il a vécu à la fin du Carbonifère, au Moscovien, il y a environ 310 millions d'années de cela."},{"page_url":"https://es.wikipedia.org/wiki/Motor_el%C3%A9ctrico","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Oceanvolt_sd8.6_electric_saildrive_motor.jpg","page_title":"Motor eléctrico","context_page_description":"El motor eléctrico es un dispositivo que convierte la energía eléctrica en energía mecánica de rotación por medio de la acción de los campos magnéticos generados en sus bobinas. Son máquinas eléctricas rotatorias compuestas por un estator y un rotor.\\nAlgunos de los motores eléctricos son reversibles, ya que pueden convertir energía mecánica en energía eléctrica funcionando como generadores o dinamo. Los motores eléctricos de tracción usados en locomotoras o en automóviles híbridos realizan a menudo ambas tareas, si se diseñan adecuadamente.\\nSon utilizados en infinidad de sectores tales como instalaciones industriales, comerciales y particulares. Su uso está generalizado en ventiladores, vibradores para teléfonos móviles, bombas, medios de transporte eléctricos, electrodomésticos, esmeriles angulares y otras herramientas eléctricas, unidades de disco, etc.\\nLos motores eléctricos pueden ser impulsados por fuentes de corriente continua, y por fuentes de corriente alterna.\\nLa corriente directa o corriente continua proviene de las baterías, los paneles solares, dínamos, fuentes de alimentación instaladas en el interior de los aparatos que operan con estos motores y con rectificadores."},{"page_url":"https://fr.wikipedia.org/wiki/Dean_Leacock","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/DeanLeacock01_%28cropped%29.jpg","page_title":"Dean Leacock","context_page_description":"Dean Leacock est un footballeur anglais qui évolue au club de Crawley. Il joue en défense, plus précisément arrière droit.\\nLors de la saison 2007-2008, Dean Leacock a joué défenseur central pour combler les vides dus à de nombreuses blessures."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_M%C3%BCnchner_U-Bahnh%C3%B6fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/U-Bahnhof_Sendlinger_Tor_01.jpg","page_title":"Liste der Münchner U-Bahnhöfe","context_page_description":"Die Liste der Münchner U-Bahnhöfe ist eine Auflistung aller bestehenden, in Bau befindlichen und offiziell geplanten Stationen des Münchner U-Bahn-Systems. Das Netz umfasst acht Linien mit 100 Stationen bei einer Gesamtstreckenlänge von 100,8 Kilometern. Der durchschnittliche Stationsabstand beträgt damit rund 1018 Meter.\\nDas 1971 eröffnete Schnellbahnnetz ist in drei Stammstrecken gegliedert, die auf ihren zentralen Abschnitten von je zwei Linien bedient werden. Von den 25 Münchner Stadtbezirken sind bis auf Pasing-Obermenzing, Aubing-Lochhausen-Langwied und Allach-Untermenzing alle an das Netz angeschlossen, hinzu kommt die nördlich von München gelegene Stadt Garching bei München. Geplant sind Erweiterungen nach Pasing und zu der Gemeinde Planegg südlich von München.\\nDie folgende Tabelle gibt eine Zusammenfassung über die wichtigsten Liniendaten. Der Punkt Eröffnung nennt das Datum der Einrichtung der Linie, nicht das der Eröffnung des ältesten bedienten Bahnhofs."},{"page_url":"https://no.wikipedia.org/wiki/Johan_Nygaardsvold","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Nygaardsvold_Cabinet.jpg","page_title":"Johan Nygaardsvold","context_page_description":"Johan Nygaardsvold, også kjent som «Gubben», var en norsk arbeiderpartipolitiker, parlamentarisk leder for Arbeiderpartiets stortingsgruppe 1932–1935 og statsminister i perioden 1935 til 1945. Han opprettet den andre norske regjering med basis i Det norske Arbeiderparti 20. mars 1935, etter at partiet hadde inngått det såkalte kriseforliket med Bondepartiet. Etter at regjeringen ble tvunget til å forlate Norge i juni 1940, ledet Nygaardsvold eksilregjeringen i London frem til våren 1945.\\nSom reformpolitiker før andre verdenskrig og som regjeringssjef ved krigsutbruddet er Nygaardsvolds ettermæle todelt. Han fikk gjennomført viktige velferdsordninger, men forsømte landets militære forsvar. Under krigen ble han, sammen med kong Haakon 7, likevel en samlende skikkelse i norsk motstandskamp."},{"page_url":"https://az.wikipedia.org/wiki/Ettore_Buqatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Ettore_Bugatti_in_1932.jpg","page_title":"Ettore Buqatti","context_page_description":"Ettore Buqatti — italyan avtomobil mühəndisi və dizayneri"},{"page_url":"https://no.wikipedia.org/wiki/Redningsvest","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Azores_Picture_352_%282888976321%29.jpg","page_title":"Redningsvest","context_page_description":"Redningsvest eller flytevest er et flyteplagg som blir brukt i forbindelse med aktiviteter ved og på vann og sjø for å holde personer flytende dersom de skulle falle i vannet. Flyteplagg og -vester kan ha ulik utforming; de kan være små og store, med og uten krager og belter, laget for å blåses opp eller ha faste flyteelementer. Det er også flytejakker og -drakter."},{"page_url":"https://pt.wikipedia.org/wiki/Equipamento_do_Ex%C3%A9rcito_Portugu%C3%AAs","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/M-548_Ej%C3%A9rcito_Espa%C3%B1ol_%282%29.JPG","page_title":"Equipamento do Exército Português","context_page_description":"Segue-se uma lista de equipamento no ativo do Exército Português:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%A5%D0%9B_%D0%B2_%D1%81%D0%B5%D0%B7%D0%BE%D0%BD%D0%B5_2008/2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/2008_NHL_Entry_Draft_Fun_Fest.JPG","page_title":"НХЛ в сезоне 2008/2009","context_page_description":"92-й сезон Национальной хоккейной лиги начался 4 октября 2008 года «Европейской премьерой», как называют в НХЛ первые матчи регулярного чемпионата, сыгранные в Старом Свете, в Праге и Стокгольме, и продлился до 12 апреля 2009 г. «Дома» чемпионат НХЛ начался 9 октября, когда в Детройте на льду «Джо Луис Арены» местный «Ред Уингз» принимал «Торонто Мэйпл Лифс».\\nЭто первый сезон со времён локаута 2004-05 годов, в котором каждая команда играла друг с другом, по крайней мере один раз в течение сезона, в отличие от трех последних сезонов, когда команды разных конференций могли ни разу не сыграть между собой. К примеру, в прошлом сезоне клубы Атлантического дивизиона Восточной конференции не играли с командами Центрального дивизиона Западной конференции, а в трёх прошедших сезонах команды встречались с клубами только двух дивизионов другой конференции.\\nВ этом сезоне команда «Монреаль Канадиенс» отмечала своё столетие.\\nВ новом сезоне руководство НХЛ увеличило потолок зарплат на $6,4 млн. Нижний предел суммарной годовой зарплаты команды в лиге равен $40,7 млн.\\nОбладателем Кубка Стэнли стал «Питтсбург Пингвинз»."},{"page_url":"https://pl.wikipedia.org/wiki/Henryk_Dul%C4%99ba","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Henryk_Dul%C4%99ba.JPG","page_title":"Henryk Dulęba","context_page_description":"Henryk Teodor Dulęba – działacz socjalistyczny i robotniczy, ślusarz."},{"page_url":"https://nl.wikipedia.org/wiki/Internationale_Socialisten","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/RotterdamGWBurgerPlein060502.png","page_title":"Internationale Socialisten","context_page_description":"De Internationale Socialisten zijn een Nederlandse uit het trotskisme voortkomende revolutionair socialistische organisatie, die actief is sinds 1988. De IS richten zich vooral op activisme. Hun denkbeelden richten zich tegen het kapitalisme, imperialisme, fascisme, oorlog, racisme, seksisme en homofobie. De IS zijn actief in de bewegingen tegen oorlog, sociale afbraak en de neoliberale mondialisering. Zij staan in de traditie van socialisme van onderaf. De IS maken deel uit van een internationale stroming van revolutionair socialistische organisaties, de International Socialist Tendency, waartoe ook de Britse Socialist Workers' Party behoort."},{"page_url":"https://it.wikipedia.org/wiki/Klamelisaurus_gobiensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Klamelisaurus.jpg","page_title":"Klamelisaurus gobiensis","context_page_description":"Il klamelisauro è un dinosauro erbivoro appartenente ai sauropodi. Visse all'inizio del Giurassico superiore e i suoi resti sono stati ritrovati in Cina."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B4%D0%B8%D0%BB%D1%8C%D1%94%D1%80%D0%B0-%D0%9F%D1%80%D0%B5%D0%B1%D0%B5%D1%82%D1%96%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/La_Sagra.jpg","page_title":"Кордильєра-Пребетіка","context_page_description":"Кордильєра-Пребетіка — система гірських хребтів, яка є північно-східним продовженням системи Кордильєра-Бетіка на півдні Піренейського півострова. Найвища точка — гора Ла-Сагра.\\nКордильєра-Пребетіка проходить по східній частині внутрішньої Андалусії, через Мурсію і досягає середземноморського берега на півдні Валенсії.\\nПівденніше Пребетіки розташовані гори Кордильєра-Суббетіка, в деяких джерелах обидві системи об'єднуються в одну, або Пребетіка вважається підсистемою Суббетіки. Ла-Сагра і деякі інші вершини відносяться до обох гірських систем."},{"page_url":"https://en.wikipedia.org/wiki/Philadelphia_Register_of_Historic_Places","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Belgravia_Philly.JPG","page_title":"Philadelphia Register of Historic Places","context_page_description":"The Philadelphia Register of Historic Places is a register of historic places by the Philadelphia Historical Commission. Buildings, structures, sites, objects, interiors and districts can be added to the list."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AF%D8%A7%D9%84%D9%89_%D8%A7%D9%84%D9%83%D8%B3%D9%86%D8%AF%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Dale_Alexander_%28R316%29.jpg","page_title":"دالى الكسندر","context_page_description":"دالى الكسندر كان لاعب بيسبول من امريكا."},{"page_url":"https://en.wikipedia.org/wiki/Tyler_Perry%27s_House_of_Payne_(season_3)","image_url":"https://upload.wikimedia.org/wikipedia/en/f/f8/House_of_payne_season_3.jpg","page_title":"Tyler Perry's House of Payne (season 3)","context_page_description":"The third season of the Tyler Perry's House of Payne began airing on March 5, 2008, and concluded on April 23, 2008. It stars Keshia Knight Pulliam who joins the cast as Miranda, Cassi Davis as Ella Payne, LaVan Davis as Curtis Payne, Allen Payne as CJ Payne, Lance Gross as Calvin Payne, Demetria McKinney as Janine Payne, Larramie \\"Doc\\" Shaw as Malik Payne, China Anne McClain as Jazmine Payne, and Denise Burse as Claretha Jenkins. The season contained 16 episodes."},{"page_url":"https://sv.wikipedia.org/wiki/Eupackardia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Eupackardia_calleta.jpg","page_title":"Eupackardia","context_page_description":"Eupackardia är ett släkte av fjärilar. Eupackardia ingår i familjen påfågelsspinnare.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://sv.wikipedia.org/wiki/M%C3%B6klinta_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Dopfunten_M%C3%B6klinta_kyrka_01.jpg","page_title":"Möklinta kyrka","context_page_description":"Möklinta kyrka är en kyrkobyggnad som tillhör Möklinta församling i Västerås stift. Kyrkan ligger i Möklinta i Sala kommun."},{"page_url":"https://de.wikipedia.org/wiki/Margaretha_Kratz_von_Scharfenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Freinsheim_Nagelscher_Hof_Wappenstein_Ausschnitt_Kratz_von_Scharfenstein.jpg","page_title":"Margaretha Kratz von Scharfenstein","context_page_description":"Margaretha Kratz von Scharfenstein war eine Adelige aus dem Geschlecht der Kratz von Scharfenstein und 82 Jahre Oberin des Klosters Maria Engelport."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%B1%D0%BE%D0%BA_%D0%90%D0%B7%D1%96%D1%97_%D0%B7_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_2007","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Shah_Alam_Stadium.JPG","page_title":"Кубок Азії з футболу 2007","context_page_description":"Кубок Азії з футболу 2007 року — футбольне змагання Азії, яке проводилося вперше відразу в чотирьох державах — Малайзії, Таїланді, Індонезії та В'єтнамі — в період з 7 липня по 29 липня 2007 року. Країни-організатори отримали путівки на Кубок Азії автоматично. Інші 12 учасників були відібрані за підсумками кваліфікаційного раунду, в якому взяло участь 24 команди. Крім того ще став перший турнір, в якому взяла участь збірна Австралії, перейшовши до АФК.\\nКубок Азії починаючи з 1956 року проводився кожні 4 роки і останній до цього Кубок пройшов у Китаї в 2004 році. Однак, через Літні Олімпійські ігри і чемпіонати Європи з футболу, що також проводяться в тих же роках, що і Кубок Азії, АФК вирішила змінити свою традицію і провести турнір в 2007 році, після чого проводити турнір кожні чотири роки з цієї дати."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%AE%89%E6%8F%90%E8%AB%BE%E7%83%8F%E6%96%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Antinous_Ecouen_Louvre_Ma1082_n3.jpg","page_title":"安提諾烏斯","context_page_description":"安提诺乌斯，是古罗马皇帝哈德良的男宠，或同性情人。安提诺乌斯死后被人神化，在东方的希腊和西方的拉丁地区被奉为一位神祇去崇拜，有时则仅称他是一位英雄。"},{"page_url":"https://vi.wikipedia.org/wiki/Onthophagus_schwaneri","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Onthophagus_%28%3DProagoderus%29_schwaneri_Vollenhoven%2C_1864_male_%284199179609%29.jpg","page_title":"Onthophagus schwaneri","context_page_description":"Onthophagus schwaneri là một loài bọ cánh cứng trong họ Bọ hung."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Wei%C3%9Fensee","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Parkstra%C3%9Fe_64_%26_65_%28Berlin-Wei%C3%9Fensee%29.jpg","page_title":"Liste der Kulturdenkmale in Berlin-Weißensee","context_page_description":"In der Liste der Kulturdenkmale von Weißensee sind die Kulturdenkmale des Berliner Ortsteils Weißensee im Bezirk Pankow aufgeführt."},{"page_url":"https://en.wikipedia.org/wiki/Zamalek_SC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Zamalek1938-39.jpg","page_title":"Zamalek SC","context_page_description":"Zamalek Sporting Club, commonly referred to as Zamalek, is an Egyptian sports club based in Giza, Egypt. The club is mainly known for its professional football team, which currently plays in the Egyptian Premier League, the top tier of the Egyptian football league system.\\nThe club was founded on 5 January 1911 as Qasr El Nile Club and was first headed by the Belgian lawyer George Marzbach. The name was changed, two years later, to Cairo International Sports Club, commonly abbreviated as C.I.S.C., which was colloquially translated to the Arabic name Nady El Qāhirah El Mokhtalat or simply Nady El Mokhtalat. The club was named in 1941 after King Farouk of Egypt and became known as Nady Farouk El Awal, meaning Farouk I Club. Following the 1952 Egyptian revolution, the club name was once again changed to its current name.\\nZamalek established itself as a major force in Egyptian football during the 1920s, becoming the first Egyptian team to ever win a title which was the Sultan Hussein Cup in 1921, the first team to ever win Egypt Cup in 1922, and the first team to ever win Cairo League in 1922/1923."},{"page_url":"https://jv.wikipedia.org/wiki/Paus_Eleutherius","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Eleuterus.jpg","page_title":"Paus Eleutherius","context_page_description":"Paus Santo Eleutherius, asma wiyosan Eleuterus/Eleutherius, inggih punika Paus Gréja Katulik Roma wiwit taun ±174 dumugi taun ±189.\\nPanjenenganipun wujud siswanipun Paus Anisetus ingkang gadhah peran minangka diakon salaminipun kapausan Aniesetus. Ing wekdal kapausanipun, Panjenenganipun mbisak sapérangan kuwajiban adat Yahudi perkawis karam utawi halalipun dhaharan. Ing wekdal puniku dumados pambantaian ageng ingkang dipunjaraken kémawon déning Markus Aurelius. Kanggé negesaken bilih umat Kristen boten tumut cawé-cawé, panjenenganipun ngintunaken serat kathahipun kaping sekawan dhumateng kaisar.\\nPaus Eleuterus tilar donya nalika taun 189 minangka martir."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%AD%D8%B3%D9%86_%D9%82%D9%85%D8%B5%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Mohsen_Qamsari_2019-02-02.jpg","page_title":"محسن قمصری","context_page_description":"محسن قمصری، اقتصاددان، دیپلمات و مدیر ارشد اجرایی ایرانی است، که در حال حاضر بعنوان مدیر امور بین‌الملل و عضو اصلی هیئت مدیره شرکت ملی نفت ایران فعالیت می‌کند.\\nمحسن قمصری فعالیت خود را بعنوان تحلیل‌گر اقتصادی وزارت امور خارجه از سال ۱۳۶۰ آغاز نمود. وی در سال ۱۳۶۳ به وزارت نفت وارد شد. قمصری نخستین بار در سال ۱۳۷۵ توسط بیژن نامدار زنگنه به عنوان مدیر امور بین‌الملل شرکت ملی نفت ایران منصوب شد. وی توسط دو وزیر دیگر؛ کاظم وزیری هامانه و غلامحسین نوذری نیز بعنوان مدیر امور بین‌الملل ابقا شد و تا سال ۱۳۸۸ در این جایگاه فعالیت نمود. قمصری در فاصله سال‌های ۱۳۸۹ تا ۱۳۹۱ مدیرعامل شرکت ملی صادرات گاز ایران بود. در سال ۱۳۹۰ با حفظ سمت مدیرعاملی شرکت ملی صادرات گاز ایران، بار دیگر به مدیریت امور بین‌الملل منصوب گردید. با روی کار آمدن مسعود میرکاظمی در وزارت نفت، قمصری نیز در شمار ۲۵۰ مدیر ارشد نفتی بود، که از بدنه صنعت نفت، کنار گذاشته شد. وی در سال ۱۳۹۲ با پیشنهاد بیژن نامدار زنگنه، بعنوان مدیر امور بین‌الملل و عضو اصلی هیئت مدیره شرکت ملی نفت ایران منصوب گردید. بعلت فعالیت بیش از دو دهه قمصری در رأس امور بین‌الملل صنایع نفت و گاز ایران، از وی در رسانه‌ها بعنوان مسئول فروش نفت ایران یاد می‌شود."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%D9%88%D8%A6%DB%8C%D8%B3_%D8%B3%D8%A7%D9%87%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Louis_Saha_Sportsfile_%28Web_Summit%29.jpg","page_title":"لوئیس ساها","context_page_description":"لوئیس ساها بیر فوتبالیست. هوجومچو موقعیتینده اوْیناییب."},{"page_url":"https://vi.wikipedia.org/wiki/H%C6%B0%C6%A1u_Sitka","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Sitka_black_tailed_deer_with_fireweed.jpg","page_title":"Hươu Sitka","context_page_description":"Hươu Sitka hoặc Hươu đuôi đen Sitka là một phân loài của hươu la và tương tự như phân loài hươu đuôi đen Columbia. Tên của chúng bắt nguồn từ địa danh Sitka, Alaska."},{"page_url":"https://es.wikipedia.org/wiki/Convento_de_Santa_Isabel_(Sevilla)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Convento_de_Santa_Isabel_%28Sevilla%29._Interior_de_la_iglesia.jpg","page_title":"Convento de Santa Isabel (Sevilla)","context_page_description":"El Convento de Santa Isabel se encuentra en el número 2 de la calle Hiniesta, dando su fachada sur a la plaza Santa Isabel, en Sevilla.\\nFue fundado en 1490, por la viuda de Gonzalo Farfán de los Godos, Isabel de León, dedicándolo a la Visitación de Santa Isabel y a San Juan Bautista, como sede para alojar a las religiosas de la Orden Hospitalaria de San Juan de Jerusalén.\\nUna gran parte de este conjunto conventual fue transformado y reutilizado después de la desamortización, siendo usado como cárcel de mujeres, después como Casa de Arrepentidas, y más adelante como centro docente. Desde mediados del siglo XIX el convento quedó regentado por la Congregación de Religiosas Filipenses Hijas de María Dolorosa, fundada por Dolores Márquez Romero y Onoro, cuyo cuerpo se encuentra enterrado en el coro bajo, junto con el del otro promotor de la congregación, el sacerdote Francisco García Tejero."},{"page_url":"https://no.wikipedia.org/wiki/Kiosk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Olden_%2861%29.jpg","page_title":"Kiosk","context_page_description":"Kiosk er en liten bygning eller butikk der det blir solgt aviser, blader, iskrem, godteri, tobakk og liknende.\\nOrdet stammer fra det tyrkiske köşk som betyr «lysthus» eller «hagepaviljong». Det tyrkiske ordet kommer i sin tur fra kurdisk کۆشک.\\nKiosk kan på norsk også brukes om små bygninger til andre formål enn småhandel, som for eksempel skilderhusliknende telefonkiosker og transformatorkiosker."},{"page_url":"https://it.wikipedia.org/wiki/Illuminismo_in_Spagna","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Elisabetta_Farnese1.jpg","page_title":"Illuminismo in Spagna","context_page_description":"L'Illuminismo in Spagna può essere convenzionalmente considerato iniziato nel XVIII secolo con l'ascesa al trono spagnolo di re Filippo V, il primo sovrano della dinastia dei Borbone. Dopo la crisi economica e burocratica che il paese aveva attraversato negli ultimi anni della dinastia asburgica, nel XVIII secolo i Borbone inaugurarono una politica di riforme e di \\"dispotismo illuminato\\" finalizzato a modernizzare le istituzioni e le infrastrutture del paese.\\nLo slancio riformatore culminò con il regno di Carlo III, e con l'opera del ministro José Moñino, conte di Floridablanca.\\nIl secolo iniziò con la guerra di successione spagnola, causata dall'ascesa al trono di Filippo V, nipote di Luigi XIV di Francia e finì con le guerre napoleoniche, in cui la Spagna si trasformò in un campo di battaglia. I successori di Carlo III, assieme a guerra, interventi stranieri, ribellioni nelle colonie, corruzione nella macchina statale e paura per le riforme, ebbero da governare un paese sempre più instabile. Il peggioramento della situazione politica ebbe come conseguenza anche le guerre carliste nel XIX secolo."},{"page_url":"https://en.wikipedia.org/wiki/Batajnica","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/%D0%91%D0%B0%D1%82%D0%B0%D1%98%D0%BD%D0%B8%D1%87%D0%BA%D0%B0_%D1%86%D1%80%D0%BA%D0%B2%D0%B0_2006._%D0%B3%D0%BE%D0%B4%D0%B8%D0%BD%D0%B5.jpg","page_title":"Batajnica","context_page_description":"Batajnica is an urban neighborhood of Belgrade, the capital of Serbia. It is located in Belgrade's municipality of Zemun."},{"page_url":"https://en.wikipedia.org/wiki/Etihad_Airways","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Etihad_Airways_aircraft_interiors_demo_ITB_2017_%2806%29.JPG","page_title":"Etihad Airways","context_page_description":"Etihad Airways is the second-largest airline and flag carrier of the UAE, after Emirates. Its head office is in Khalifa City, Abu Dhabi, near Abu Dhabi's International Airport. Etihad commenced operations in November 2003.\\nThe airline operates more than 1,000 flights per week to over 120 passenger and cargo destinations in the Middle East, Africa, Europe, Asia, Australia, and North America, with a fleet of 102 Airbus and Boeing aircraft as of February 2020.\\nIn 2015, Etihad carried 14.8 million passengers, a 22.3% increase from the previous year, delivering revenues of US$9.02 billion and net profits of US$103 million. Its main base is Abu Dhabi International Airport.\\nIn addition to its core activity of passenger transportation, Etihad also operates Etihad Holidays and Etihad Cargo. Etihad established its airline alliance, Etihad Airways Partners, in October 2015 which was disbanded in 2018 after several of its members fell into financial difficulties. Etihad Airways holds minority equity investments in the participating airlines, as well as holding a stake in Virgin Australia, which is not officially listed as an Etihad Airways Partner."},{"page_url":"https://en.wikipedia.org/wiki/38th_Signal_Battalion","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/38th_Signal_Battalion_Coat_of_Arms-vector.svg","page_title":"38th Signal Battalion","context_page_description":"The 38th Signal Battalion is a unit of the United States Army. It was last active from 17 January 1986 to 15 June 1991."},{"page_url":"https://fr.wikipedia.org/wiki/Venus_Mobile_Explorer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Venus-mobile-explorer-exploded-view.png","page_title":"Venus Mobile Explorer","context_page_description":"Venus Mobile Explorer est un projet de sonde spatiale de la NASA étudié en 2009 dont l'objectif était l'analyse in situ de la surface de Vénus. Cette mission de type Flagship répondait à certains des objectifs définis par le groupe de travail Venus Exploration Analysis Group. Le projet n'a pas été concrétisé par la suite. La mission devait permettre une étude de la composition et de la minéralogie du sol dans les hautes terres de la planète en deux endroits distincts et de réaliser des photos aériennes au cours d'un survol de 3 à 4 heures à une altitude de 3 km."},{"page_url":"https://es.wikipedia.org/wiki/Saab_39_Gripen","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Gripen_dropping_flares.jpg","page_title":"Saab 39 Gripen","context_page_description":"El Saab 39 Gripen, designado JAS 39 Gripen por la Fuerza Aérea Sueca, es un caza polivalente ligero, monomotor, desarrollado en los años 1980 por el consorcio de empresas suecas IG-JAS, liderado por la compañía aeroespacial Saab. Su fin perseguía —y consiguió— equipar a la Fuerza Aérea de Suecia con un caza, un avión de ataque y un avión de reconocimiento aéreo, para sustituir a los Saab 37 Viggen y eventualmente, a los Saab 35 Draken y al entrenador SK 60.​ El aparato debía lograr un nivel de prestaciones similar al del F-16 estadounidense​ y los objetivos de diseño debían satisfacer el conjunto de requerimientos del gobierno sueco; pero con una manifiesta intención, desde su contratación, de ser un modelo para la exportación, bordeando o incluso infringiendo las estrictas leyes de exportación suecas para armamento. Por este motivo, se convirtió en el proyecto de ventas más grande de la industria de armamento sueco.​\\nEl nombre Gripen, «grifo» en sueco, cuya silueta forma parte del logotipo de Saab, fue seleccionado en concurso público fallado en 1982.​ Realizó su primer vuelo en 1988 y presentó serios problemas iniciales que pusieron en peligro su continuidad.​"},{"page_url":"https://bar.wikipedia.org/wiki/Westgate-on-Sea","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Westgate%27s_West_Bay.jpg","page_title":"Westgate-on-Sea","context_page_description":"Westgate-on-Sea is a Seebod mid uma 6600 Eihwohna im Noadostn vo da englischn Grofschoft Kent. Es ghead zum District Thanet und grenzt on's greßare Seebod Margate und des Doaf Birchington-on-Sea. Sei beidn Sondstrända - West Bay und St. Mildred's Bay - san seit da Entwicklung vo da Stod aus oam kloan Baueandoaf a beliabts Ausflugszui."},{"page_url":"https://vi.wikipedia.org/wiki/Chu%E1%BB%99t_ch%C3%B9_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Hill%27s_Shrew_area.png","page_title":"Chuột chù Hill","context_page_description":"Chuột chù Hill, tên khoa học Crocidura hilliana, là một loài động vật có vú trong họ Chuột chù, bộ Soricomorpha. Loài này được Jenkins & Smith miêu tả năm 1995. Chúng được tìm thấy ở Lào và Thái Lan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Connewitz,_L%E2%80%93Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Leipzig_Connewitz%2C_M%C3%BChlholzgasse%2C_2004.jpg","page_title":"Liste der Kulturdenkmale in Connewitz, L–Z","context_page_description":"Die Liste der Kulturdenkmale in Connewitz enthält die Kulturdenkmale des Leipziger Stadt- und Ortsteils Connewitz, die in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand 2017 erfasst wurden.\\nAus Platzgründen ist diese Liste geteilt. In dieser Liste sind die Kulturdenkmale in den Straßen mit den Anfangsbuchstaben L–Z erfasst. Die Kulturdenkmale in den Straßen A–K sind in der Liste der Kulturdenkmale in Connewitz, A–K aufgeführt."},{"page_url":"https://pl.wikipedia.org/wiki/Francesco_di_Giorgio_Martini","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Liberale_da_Verona_-_The_Chess_Players_-_The_Metropolitan_Museum_of_Art.jpg","page_title":"Francesco di Giorgio Martini","context_page_description":"Francesco di Giorgio Martini – włoski malarz ze szkoły sieneńskiej, rzeźbiarz, architekt i inżynier. Zaprojektował około siedemdziesięciu fortyfikacji dla księcia Urbino."},{"page_url":"https://zh.wikipedia.org/zh-cn/1929%E5%B9%B411%E6%9C%881%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/SE2092Feb07A.png","page_title":"1929年11月1日日食","context_page_description":"1929年11月1日日食是一次日环食，发生于1929年11月1日。新月当天，地球上观测到月球和太阳的角距离极小，此时月球如果恰好在月球交点附近，穿过太阳和地球之间，与地球、太阳接近一直线，则会出现日食。月球穿过太阳和地球之间，但距地球较远，本影未能接触地表，而使伪本影覆盖的区域内看到月球的角直径小于太阳，就形成日环食，同时在伪本影两侧数千公里的半影范围内形成日偏食。此次日环食经过了西属撒哈拉、法属西非、英属黄金海岸、法属多哥兰、葡属圣多美和普林西比、法属赤道非洲、比属刚果、北罗得西亚、英属坦噶尼喀、英属塞舌尔，日偏食则覆盖了欧亚大陆西南部、整个非洲及周边部分地区。"},{"page_url":"https://no.wikipedia.org/wiki/Kefallinia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Lixouri_Philharmonic_Orchestra_1836.JPG","page_title":"Kefallinia","context_page_description":"Kefallinia, også kalt Kefalonia eller Kefallonia, er den største av De joniske øyer i vestlige Hellas med et areal på 781 km². Kefallinia var en del av prefekturet Kefallinia og Ithaka, men er i dag en adskilt regional enhet innenfor regionen De joniske øyer og den eneste kommunen i den regionale enheten. Hovedstaden er Argostoli.\\nFolketallet på øya er i overkant av 35 000 innbyggere. Rundt en tredel av innbyggerne bor i hovedstaden Argostoli. Oliven, vin og annet jordbruk er hovednæringer. Øya er gjort kjent gjennom romanen Kaptein Corellis mandolin av Louis de Bernières. Den ble filmatisert i 2001 med blant annet Nicolas Cage i hovedrollen."},{"page_url":"https://vi.wikipedia.org/wiki/No_Doubt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/NoDoubtAtWorcester.jpg","page_title":"No Doubt","context_page_description":"No Doubt là nhóm nhạc Rock nổi tiếng của Mỹ được thành lập năm 1986. Album kim cương của nhóm: Tragic Kingdom đã bán được hơn 16 triệu bản trên thế giới. Single Don't speak từ album đã lập một kỉ lục khi đứng hạng nhất 16 tuần liên tiếp trên bảng xếp hạng Billboard Hot 100 Airplay. Nhóm đến nay đã có 5 album và bán được 25 triệu bản ghi âm"},{"page_url":"https://en.wikipedia.org/wiki/Kohala,_Hawaii","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Kohala-Landsat.jpg","page_title":"Kohala, Hawaii","context_page_description":"Kohala is the name of the northwest portion of the island of Hawaiʻi in the Hawaiian Archipelago. In ancient Hawaii it was often ruled by an independent High Chief called the Aliʻi Nui. In modern times it is divided into two districts of Hawaii County: North Kohala and South Kohala. Locals commonly use the name Kohala to refer to the census-designated places of Halaʻula, Hāwī, and Kapaʻau collectively. The dry western shore is commonly known as the Kohala Coast, which has golf courses and seaside resorts."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%85%D8%AC%D8%AF_%D9%85%D8%B9%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Amjad_mualla.jpg","page_title":"أمجد معلا","context_page_description":"أمجد معلا إعلامي أردني من مواليد مدينة رام الله، مسلم، له ثلاث بنات سارة وروتانا وليمار، درس صحافة واعلام في جامعة بلغراد-يوغوسلافيا، أثناء الدراسة ألف قاموس ترجمة من اليوغسلافية إلى العربية."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%83%D9%88%D8%AA_%D8%A8%D8%B1%D8%A7%D8%AF%D9%84%D9%8A_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D8%A9_%D9%82%D8%A7%D8%B9%D8%AF%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/1983_Nashville_Scott_Bradley.jpg","page_title":"سكوت برادلي (لاعب كرة قاعدة)","context_page_description":"سكوت برادلي ‏ هو لاعب كرة قاعدة أمريكي، ولد في 22 مارس 1960 في غلن ريدج في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/William_R._Walker_%26_Son","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Cumberland_Town_Hall_RI.jpg","page_title":"William R. Walker & Son","context_page_description":"William R. Walker & Son was an American architectural firm in Providence, Rhode Island, active during the years 1881 to 1938. It included partners William Russell Walker, William Howard Walker, and later, William Russell Walker II.\\nWilliam R. Walker began his architectural practice in 1864. Between 1876 and 1881 he partnered with Thomas J. Gould in Walker & Gould. In 1881, the two parted ways to start independent firms. Walker took his son William H. Walker into partnership to form the firm of William R. Walker & Son. William R. Walker died in 1905. William H. Walker died in 1922, at which point his son William R. Walker II took charge until his own death in 1936.\\nThroughout the firm's history, it was known for its educational buildings. All of the Walkers had important political connections, enabling them to obtain the commissions for these and other civic structures. The part of the Walker legacy that is most commonly passed over is their residential and commercial commissions. Prominent commercial commissions include Providence's Lederer Building, Attleboro's Bronson Building, and the Washington Building in Providence."},{"page_url":"https://hu.wikipedia.org/wiki/Jean_Bodin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Jean_Bodin.jpg","page_title":"Jean Bodin","context_page_description":"Jean Bodin a 16. század második felének neves francia politikai gondolkodója.\\nKortársa, Michel de Montaigne, aki a dicséretekkel meglehetősen fukarul bánik, Bodinről azt mondta: a 16. század néhány jó szerzőjének egyike. Mégis a 19. századig alig-alig adták ki műveit, sőt volt olyan, amely 1984-ig csak kéziratban létezett. Mivel Bodin az abszolutizmus ideológusa, a francia forradalmi korszakban – René Descartes és egyéb felvilágosultak hatására – Bodin gyakorlatilag elavulttá vált, és csak a 19. század végén kezdtek felfigyelni arra, hogy Bodin Montesquieu előfutárának tekinthető. Sőt abszolutistának nevezett megközelítése ellenére Bodin nem az uralkodóról, hanem az államról beszél, és a szuverénnel szemben annyi korlátot és tilalmat állít fel, hogy már XIV. Lajos alatt is jobbnak látták megfeledkezni róla, semmint elveit alkalmazni. Az 1984-ig kéziratban lévő Kollokvium viszont türelme és toleranciája révén került süllyesztőbe. A Réponse 1608 után csak 1932-ben került új kiadásra.\\nBodin munkásságának megítélése ellentmondásos. A vele foglalkozók között csak abban van megegyezés, hogy a magántulajdon feltétlen híve volt, de a többi konklúzió már mindig más és más."},{"page_url":"https://de.wikipedia.org/wiki/Pinner-Reaktion","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Pinner_%C3%9Cbersicht_Version_2.svg","page_title":"Pinner-Reaktion","context_page_description":"Die Pinner-Reaktion ist eine Namensreaktion der organische Chemie. Die Hauptanwendung der Pinner-Reaktion ist die Herstellung von Carbonsäuren, Estern, Thioestern und Amiden. Sie ist nach dem deutschen Chemiker Adolf Pinner benannt."},{"page_url":"https://vi.wikipedia.org/wiki/Gda%C5%84sk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Gda%C5%84sk_ulica_Tobiasza_9_%E2%80%93_Hotel_Admira%C5%82.JPG","page_title":"Gdańsk","context_page_description":"Gdańsk, tên trước kia bằng tiếng Đức là Danzig, là một thành phố bên bờ biển Baltic, thuộc miền bắc Ba Lan, ở giữa vùng đô thị lớn thứ tư của đất nước.\\nGdańsk là hải cảng chính của Ba Lan và cũng là thủ phủ của tỉnh Pomorskie. Về mặt lịch sử, nó cũng là thành phố lớn nhất vùng người Kashubia. Thành phố nằm gần sát biên giới trước kia giữa vùng người Slav phía tây và châu Âu German và có một lịch sử phức tạp, trong đó có các thời kỳ thuộc Ba Lan và các thời kỳ thuộc Đức cùng 2 thời kỳ là thành phố trực tiếp dưới quyền cai trị của hoàng đế đế quốc La Mã Thần thánh. Từ năm 1945, nó thuộc về Ba Lan.\\nThành phố nằm trên bờ phía nam vịnh Gdańsk, trong một đô thị liên hợp với thành phố có suối khoàng Sopot, thành phố Gdynia và các cộng đồng ngoại ô, cùng nhau tạo thành một vùng đô thị gọi là Ba thành phố, với số dân hơn 800.000. Riêng Gdańsk có 470.907 cư dân, là thành phố lớn nhất trong vùng bắc Ba Lan.\\nGdańsk nằm ở cửa sông Motława, nối với sông Leniwka, một nhánh của châu thổ sông Wisła gần đó, mà hệ thống nước cung cấp 60% cho khu vực Ba Lan và nối Gdańsk với thủ đô Warszawa. Điều này mang lại lợi thế độc đáo cho thành phố như một trung tâm mậu dịch biển của Ba Lan."},{"page_url":"https://af.wikipedia.org/wiki/Renaissance","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Florenz_weitwinkel.jpg","page_title":"Renaissance","context_page_description":"Die term renaissance verwys na die periode in die geskiedenis wat ná die Gotiek van die Middeleeue aanvang en in die barok afsluit, en dit omspan rofweg die 14de, 15de en 16de eeue. Die Franse term is afgelei van die Italiaanse rinascimento wat vanaf die 19de eeu gebruik is om na die kulturele herlewing van die Griekse en Romeinse Oudheid in die 14de tot 17de eeuse Europa te verwys. Sedert hierdie periode is die ontwikkeling van die wetenskappe, kuns en samelewing in teenstelling met die Middeleeue deur 'n groter individuele vryheid van die mens gekenmerk.\\nDie term het 'n meer spesifieke betekenis as een van die periodes in die kunsgeskiedenis, maar word ook algemeen gebruik om na die hergeboorte van sekere waardes, geboue, 'n historiese tydperk of waardestelsel te verwys."},{"page_url":"https://de.wikipedia.org/wiki/Ellerton_Priory","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Ellerton_Priory_%281%29.jpg","page_title":"Ellerton Priory","context_page_description":"Ellerton Priory war ein Priorat der Zisterzienserinnen nahe Richmond in Großbritannien. Die Klosterruine ist als Kulturdenkmal der Kategorie Grade II eingestuft."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%DA%A9%DB%8C%D8%B1%DA%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Neunkirch_162.JPG","page_title":"نکیرک","context_page_description":"شهر نکیرک در ایالت شفوزان در کشور سوئیس واقع شده‌است که ۱٬۷۰۰ نفر جمعیت دارد."},{"page_url":"https://ru.wikipedia.org/wiki/Myrmica_specioides","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Myrmica_specioides_casent0172730_profile_1.jpg","page_title":"Myrmica specioides","context_page_description":"Myrmica specioides — вид мелких муравьёв рода Myrmica.\\nВключён в списки редких и охраняемых животных в нескольких европейских странах: Великобритания, Германия, Норвегия, Польша, Швеция."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%A6%99%E6%B8%AF%E7%B8%BD%E7%9D%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/MacDougall_4.jpg","page_title":"香港總督","context_page_description":"香港总督，简称港督，民间俗称“督爷”，尊称督宪或督宪阁下，前身为香港行政官，是香港殖民地时期，由英国派驻香港的英国君主代表，共历28任，当中第26任港督尤德爵士是唯一一位在任期间逝世的港督。\\n早期港督都是由英国殖民地部的官员出任，1971年以后港督大多是外交官出身，麦理浩勋爵是第一位；而最后一任港督彭定康则是国会议员出身，曾任保守党主席。\\n香港在英治时期共28位总督中，除第1至2、3至4任以外，其余每个正任总督的交接时间皆不是完美交接，而是中间隔着一至两位署理总督。署理总督早期则由香港副总督暂代，该职位是由香港驻军司令担任；1870年代香港战略地位减退，故此于1870年至1902年该职位为非常设职位，1902年后香港副总督的职位正式被撤销。自此，署理总督多由辅政司担任。"},{"page_url":"https://lb.wikipedia.org/wiki/Kierch_D%C3%A9ifferdeng","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Kierch_D%C3%A9ifferdeng.jpg","page_title":"Kierch Déifferdeng","context_page_description":"D'Kierch Notre-Dame des Douleurs vun Déifferdeng war eng Kierch am moderne Stil, déi am Joer 1954 no de Pläng vum Architekt René Fournelle gebaut gouf, den 18. Dezember 1955 vum Bëschof Léon Lommel geweit an 2012 ofgerappt ginn ass."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Nocera","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/EpigrafeTeoctistos.jpg","page_title":"Storia di Nocera","context_page_description":"La storia delle due Nocera della Campania è la storia di un'unica città separatasi in due amministrazioni nel 1860, per una scelta dei proprietari terrieri dell'epoca. È l'antica Nuceria Alfaterna, divenuta poi Nuceria Costantia, Nuceria Christianorum e Nocera dei Pagani."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88%D9%81%DB%8C%D8%A7_%DA%A9%D9%88%D8%B1%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Sofia_Corban.jpg","page_title":"سوفیا کوربان","context_page_description":"سوفیا کوربان قایقران روئینگ اهل رومانی بود.\\nوی در مسابقات کشوری و بین‌المللی در مجموع برندهٔ ۱ مدال طلا، ۳ مدال برنز شده‌است."},{"page_url":"https://pl.wikipedia.org/wiki/Hugo_(Oklahoma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Hugo_March_2016_41_%28Broadway_Street%29.jpg","page_title":"Hugo (Oklahoma)","context_page_description":"Hugo – miasto w Stanach Zjednoczonych, w stanie Oklahoma, w hrabstwie Choctaw."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%8B%D0%BD%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%A2%D1%8B%D0%BD%D0%B4%D0%B0%2C_%D0%90%D0%BC%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C_%283%29.JPG","page_title":"Тында","context_page_description":"Ты́нда — город в Амурской области России, административный центр Тындинского района, образует городской округ город Тында. «Столица БАМа».\\nРаспоряжением Правительства РФ от 29.07.2014 N 1398-р «Об утверждении перечня моногородов», включён в список моногородов Российской Федерации с риском ухудшения социально-экономического положения."},{"page_url":"https://en.wikipedia.org/wiki/Idaho%27s_at-large_congressional_district","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/WillisSweet.jpg","page_title":"Idaho's at-large congressional district","context_page_description":"From its admittance as a state in 1890 to 1913 Idaho was represented in the United States House of Representatives by one at-large representative. After the 1910 census Idaho was awarded a second seat starting with the 63rd Congress in 1913. However both seats continued to be elected at-large on a general ticket until the election of 1918. Since that year the state has allocated two districts for its representatives."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%B5%D1%80%D0%B5%D0%BC%D0%BE%D0%B6%D1%86%D1%96%D0%B2_%D1%82%D1%83%D1%80%D0%BD%D1%96%D1%80%D1%96%D0%B2_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B3%D0%BE_%D1%88%D0%BB%D0%B5%D0%BC%D0%B0_%D1%81%D0%B5%D1%80%D0%B5%D0%B4_%D1%87%D0%BE%D0%BB%D0%BE%D0%B2%D1%96%D0%BA%D1%96%D0%B2_%D0%B2_%D0%BE%D0%B4%D0%B8%D0%BD%D0%BE%D1%87%D0%BD%D0%BE%D0%BC%D1%83_%D1%80%D0%BE%D0%B7%D1%80%D1%8F%D0%B4%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Andre_Agassi_2005_US_Clay_Court.jpg","page_title":"Список переможців турнірів Великого шлема серед чоловіків в одиночному розряді","context_page_description":"У Спи́ску перемо́жців турні́рів Вели́кого шле́ма се́ред чоловікі́в в одино́чному розря́ді перераховано усіх 160 тенісистів, які ставали переможцями на турнірах Великого шлема в одиночному розряді. Останнім до цього переліку приєднався Марин Чилич після перемоги на Відкритому чемпіонаті США 2014.\\nЗа історію проведення цих турнірів відбувалися численні зміни."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%82%E0%B8%95%E0%B8%9B%E0%B8%81%E0%B8%84%E0%B8%A3%E0%B8%AD%E0%B8%87%E0%B8%95%E0%B8%99%E0%B9%80%E0%B8%AD%E0%B8%87%E0%B8%A3%E0%B8%B0%E0%B8%94%E0%B8%B1%E0%B8%9A%E0%B8%88%E0%B8%B1%E0%B8%87%E0%B8%AB%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%8A%E0%B8%99%E0%B8%8A%E0%B8%B2%E0%B8%95%E0%B8%B4%E0%B9%80%E0%B8%81%E0%B8%B2%E0%B8%AB%E0%B8%A5%E0%B8%B5%E0%B8%AB%E0%B8%A2%E0%B8%B1%E0%B8%99%E0%B9%80%E0%B8%9B%E0%B8%B5%E0%B8%A2%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Yanji_city_in_2010.jpg","page_title":"เขตปกครองตนเองระดับจังหวัดชนชาติเกาหลีหยันเปียน","context_page_description":"หยันเปียน หรือ ย็อนบย็อน หรือ เย็นบเย็น เป็นเขตปกครองตนเองระดับจังหวัดแห่งหนึ่งในมณฑลจี๋หลิน ประเทศจีน ตอนเหนือติดมณฑลเฮย์หลงเจียง ตะวันตกติดนครไป๋ซานและจี๋หลิน ทางใต้ติดจังหวัดฮัมกย็องเหนือ ประเทศเกาหลีเหนือ ทิศตะวันออกติดดินแดนปรีมอร์สกี ประเทศรัสเซีย หยันเปียนถูกกำหนดให้เป็นเขตปกครองตนเองระดับจังหวัดชนชาติเกาหลี เนื่องจากมีชาวเกาหลีอาศัยอยู่ในบริเวณดังกล่าวเป็นจำนวนมาก มีเมืองหลวงชื่อเมืองหยันจี๋ หรือย็อนกิล และพื้นที่ทั้งหมด 42,700 ตารางกิโลเมตร ถือเป็นเขตปกครองตนเองชนชาติเกาหลีหนึ่งในสองแห่ง อีกแห่งหนึ่งคือเขตปกครองตนเองระดับเทศมณฑลชนชาติเกาหลีฉางไป๋\\nในจังหวัดหยันเปียนมีโบราณสถานยุคพัลแฮจำนวนมาก เช่น สุสานโบราณที่ภูเขาหลงโถว รวมไปถึงสุสานเจ้าหญิงจ็องฮโย"},{"page_url":"https://sk.wikipedia.org/wiki/Brusnica_%C4%8Du%C4%8Doriedkov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/KrivanskaMalaFatraHole.jpg","page_title":"Brusnica čučoriedková","context_page_description":"Brusnica čučoriedková alebo čučoriedka je poloker z čeľade vresovcovité. Kvitne v máji až v júni, plody dozrievajú v auguste."},{"page_url":"https://en.wikipedia.org/wiki/1954_United_States_Senate_election_in_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Charles_R._Howell_%28New_Jersey_Congressman%29.jpg","page_title":"1954 United States Senate election in New Jersey","context_page_description":"The 1954 United States Senate election in New Jersey was held on November 2, 1954. Republican U.S Representative Clifford P. Case defeated Democratic U.S. Representative Charles R. Howell with 48.66% of the vote.\\nThis election was decided by the fewest votes and narrowest percentage margin in New Jersey history."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%B8%E0%B8%A3%E0%B8%B4%E0%B8%A2%E0%B8%B8%E0%B8%9B%E0%B8%A3%E0%B8%B2%E0%B8%84%E0%B8%B2_27_%E0%B8%A1%E0%B8%81%E0%B8%A3%E0%B8%B2%E0%B8%84%E0%B8%A1_%E0%B8%9E.%E0%B8%A8._2636","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/SE2093Jan27T.png","page_title":"สุริยุปราคา 27 มกราคม พ.ศ. 2636","context_page_description":"สุริยุปราคาเต็มดวงจะเกิดขึ้นในวันที่ 27 มกราคม พ.ศ. 2636 สุริยุปราคาเกิดขึ้นเมื่อดวงจันทร์ โคจรผ่านระหว่างโลกและดวงอาทิตย์ โดยวิธีนั้นจะเห็นสุริยุปราคาแบบเต็มดวงและแบบบางส่วนเมื่อมองจากโลก สุริยุปราคาเต็มดวงเกิดขึ้นเมื่อขนาดเชิงมุมของดวงจันทร์ มีขนาดใหญ่กว่าดวงอาทิตย์ โดยจะบดบังแสงโดยตรงทั้งหมดจากดวงอาทิตย์ ทำให้เวลากลางวันเข้าสู่ความมืด สุริยุปราคาแบบเต็มดวงเกิดขึ้นในแนวแคบผ่านบนพื้นผิวโลก และสุริยุปราคาบางส่วนสามารถมองเห็นได้เหนือบริเวณรอบ ๆ ภูมิภาคนั้นกว้างหลายพันกิโลเมตร"},{"page_url":"https://en.wikipedia.org/wiki/Philippine_Sports_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/JfCiudadINC29PhilArenaStadiumfvf.JPG","page_title":"Philippine Sports Stadium","context_page_description":"The Philippine Sports Stadium, also known as New Era University Stadium, is a football and track stadium at Ciudad de Victoria, a 140-hectare tourism enterprise zone in the towns of Bocaue and Santa Maria, Bulacan, Philippines. The stadium was built right next to the Philippine Arena, the world's largest indoor arena. The stadium is the largest football stadium in the Philippines with a maximum seating capacity of 25,000. Its seating capacity is more than twice the seating capacity of the Rizal Memorial Stadium, the national stadium of the country which has a seating capacity of 12,000.\\nPWP Landscape Architecture is responsible for the landscaping work on the area around the stadium dubbed as the Stadium Gardens.\\nIn December 2016, it was reported that the track and field team of the University of the Philippines is a tenant of the stadium."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D1%81%D1%83%D0%BD%D1%8C-%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%BD%D0%B0_%D0%B1%D1%96%D0%B1%D0%BB%D1%96%D0%BE%D1%82%D0%B5%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/%D0%95%D0%BC%D0%B1%D0%BB%D0%B5%D0%BC%D0%B0_%D0%B1%D1%96%D0%B1%D0%BB%D1%96%D0%BE%D1%82%D0%B5%D0%BA%D0%B8.jpg","page_title":"Корсунь-Шевченківська центральна районна бібліотека","context_page_description":"Корсунь — Шевченківська центральна бібліотека- головна книгозбірня району, сучасний, потужний, інформаційний, культурно-просвітницький, методичний центр.\\nРозташована бібліотека в м. Корсунь-Шевченківський Черкаської області.\\nКорсунь — Шевченківська центральна районна бібліотека має свою емблему:"},{"page_url":"https://en.wikipedia.org/wiki/Castleton,_Scottish_Borders","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Newcastleton_Square.jpg","page_title":"Castleton, Scottish Borders","context_page_description":"Castleton is a civil parish in the Scottish Borders area of Scotland, in the former Roxburghshire, in the extreme south of the Borders area. It is bounded by Northumberland, Dumfries and Galloway, and the parishes of Hobkirk, Southdean and Teviothead.\\nThe village of Castleton was commenced in 1793. It was built as a result of the land clearances in the 1790s when people were forced to move from Old Castleton village. While the parish retained the name Castleton, the village later became identified as New Castleton or Newcastleton. The parish is also known by its older name Liddesdale\\nThe inhabited part of the parish runs alongside the banks of Liddel Water and the Hermitage Water. In the upper Hermitage valley is Hermitage Castle, a massive H-shaped fortress of enormous strength, one of the oldest surviving castles in Scotland. It stands on a hill overlooking Hermitage Water. It was built in 1244 by Nicholas de Soulis, and was captured by the English in David II's reign. It was retaken by Sir William Douglas, who received a grant of it from the king.\\nBy the Liddel, upstream from Newcastleton, is the settlement of Riccarton. Nearby is the disused Riccarton Junction railway station."},{"page_url":"https://eu.wikipedia.org/wiki/Glyptothorax_lonah","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Glyptothorax_lonah_Day.jpg","page_title":"Glyptothorax lonah","context_page_description":"Glyptothorax lonah Glyptothorax generoko animalia da. Arrainen barruko Sisoridae familian sailkatzen da."},{"page_url":"https://ca.wikipedia.org/wiki/Eleccions_legislatives_portugueses_de_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Andr%C3%A9_Silva%2C_PAN.jpg","page_title":"Eleccions legislatives portugueses de 2015","context_page_description":"Les eleccions legislatives portugueses de 2015 van ser celebrades el diumenge 4 d’octubre de 2015 per renovar els 230 diputats de l'Assemblea de la República, el parlament unicameral de Portugal.\\nEn aquesta elecció, el PSD i el CDS-PP, els dos partits polítics de la dreta parlamentària, van concórrer les eleccions a la coalició anomenada Portugal al Davant i van quedar en primera posició. No obstant, els partits de l'esquerra parlamentària sumaven majoria absoluta. Quatre setmanes després de les eleccions, PàF va formar govern per encàrrec del president de la República, però al cap de pocs dies, després de l'aprovació d'una moció de censura recolzada per les esquerres, el president va manar formar govern al Partit Socialista."},{"page_url":"https://sv.wikipedia.org/wiki/Notopogon_fernandezianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Notopogon_fernandezianus_SI.jpg","page_title":"Notopogon fernandezianus","context_page_description":"Notopogon fernandezianus är en fiskart som först beskrevs av Delfin, 1899. Notopogon fernandezianus ingår i släktet Notopogon och familjen Centriscidae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9F%B3%E6%88%B8%E5%A4%A7%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Ondo_no_seto_%E9%9F%B3%E6%88%B8%E3%81%AE%E7%80%AC%E6%88%B8_%282396495734%29.jpg","page_title":"音戸大橋","context_page_description":"音戸大橋は、広島県呉市の本土と倉橋島を結ぶ道路橋。\\nなお、昭和年代にかけられた「音戸大橋」と平成年代にかけられた「第二音戸大橋」の2つのアーチ橋があり、ここでは双方共に記載する。"},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Haseloff_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/J%C3%B6rg_Felgner_%28Martin_Rulsch%29_4.jpg","page_title":"Kabinett Haseloff II","context_page_description":"Das Kabinett Haseloff II bildet seit dem 25. April 2016 die Landesregierung von Sachsen-Anhalt. Das Kabinett wird getragen von den Landtagsfraktionen der CDU, der SPD und Bündnis 90/Die Grünen. Damit sind zum ersten Mal seit der Wiederherstellung des Landes Sachsen-Anhalt im Jahr 1990 drei Parteien aktiv an der Landesregierung beteiligt."},{"page_url":"https://lv.wikipedia.org/wiki/Vecborne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Vecbornes_mui%C5%BEas_kungu_m%C4%81ja_2000-10-15.jpg","page_title":"Vecborne","context_page_description":"Vecborne ir ciems Krāslavas novada Kaplavas pagastā. Izvietojies pagasta rietumu daļā, valsts reģionālā autoceļa Skrudaliena— Kaplava—Krāslava labajā pusē. Ietilpst īpaši aizsargājamajās dabas teritorijās Augšdaugavas aizsargājamo ainavu apvidū un Daugavas loku dabas parkā.\\nVecborne izveidojusies no Vecbornes muižas. Ciemā ir Bornes luteriskā baznīca, bijušās Vecbornes sākumskolas ēka. Skola pastāvēja līdz 2005. gadam, tajā ir izveidota piemiņas vieta kordiriģentam Pēterim Paulam Jozuusam. Darbojas kokapstrādes rūpnīca \\"Vārpa\\".\\nVecornes muižas parks ir kultūrvēsturisks objekts. Muižas kompleksā ir saglabājusies kungu māja, bija arī 1537.gadā celtā vecā Vecbornes luteriskā baznīca, kuru 1936. gadā pārveda uz Latvijas Etnogrāfisko brīvdabas muzeju. Blakus ciemam atrodas Bakšu kapsēta.\\nUz ziemeļiem no ciema atrodas Veckaplava, uz dienvidrietumiem Kaplavas pilskalns, aiz kura sākas Salienas pagasts."},{"page_url":"https://vi.wikipedia.org/wiki/N%E1%BB%99i_c%C3%A1c_L%C3%BD_Hi%E1%BB%83n_Long_th%E1%BB%A9_n%C4%83m","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/GraceFu-2010SummerYouthOlympics-20090426-02.jpg","page_title":"Nội các Lý Hiển Long thứ năm","context_page_description":"Nội các Lý Hiển Long thứ năm của Chính phủ Singapore được công bố vào ngày 25 tháng 7 năm 2020 sau cuộc tổng tuyển cử 2020 vào ngày 10 tháng 7 năm 2020, và có hiệu lực từ ngày 27 tháng 7 năm 2020.\\nCó bảy thành viên nội các mới, trong đó sáu người là những nghị viên mới được bầu:\\nTan See Leng – Bộ trưởng.\\nGan Siow Huang – Quốc vụ khanh.\\nAlvin Tan – Quốc vụ khanh từ 1 tháng 9 năm 2020.\\nDesmond Tan – Quốc vụ khanh.\\nTan Kiat How – Quốc vụ khanh.\\nEric Chua – Thứ trưởng Chính vụ.\\nRahayu Mahzam – Thứ trưởng Chính vụ từ 1 tháng 9 năm 2020.\\nNgoài ra, có sáu thành viên nội các cũ mãn nhiệm là:\\nKhaw Boon Wan – cựu Bộ trưởng điều phối.\\nNg Chee Meng – cựu Bộ trưởng.\\nLam Pin Min – cựu Quốc vụ khanh cấp cao.\\nSam Tan – cựu Quốc vụ khanh.\\nAmrin Amin – cựu Thứ trưởng Chính vụ cấp cao.\\nTan Wu Meng – cựu Thứ trưởng Chính vụ cấp cao."},{"page_url":"https://en.wikipedia.org/wiki/Matra_MS120","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Matra_MS120D_2008_Silverstone_Classic.jpg","page_title":"Matra MS120","context_page_description":"The Matra MS120 was the fifth and final Formula One car produced by Matra."},{"page_url":"https://eo.wikipedia.org/wiki/Levantenia_Foiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/PikiWiki_Israel_29190_Events_in_Israel.jpg","page_title":"Levantenia Foiro","context_page_description":"La Levantenia Foiro estis internacia foiro okazigita proksime de la Haveno Tel-Aviv en 1930. Ĝi estas ankaŭ la kromnomo de la ejo kie la foiro estis okazigita."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_Alpes-Maritimes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Breil-sur-Roya_-_Chapelle_des_P%C3%A9nitents_blancs_de_Pi%C3%A8ne-Haute_-1.JPG","page_title":"Liste des monuments historiques des Alpes-Maritimes","context_page_description":"La liste qui suit présente les édifices du département des Alpes-Maritimes protégés au titre des monuments historiques et répertoriés dans la base Mérimée du ministère français de la Culture, à l'exception de ceux des communes de Nice et Grasse présentés respectivement dans la liste des monuments historiques de Nice et dans la liste des monuments historiques de Grasse. Les édifices de la commune de Cannes sont également présentés dans la liste des monuments historiques de Cannes."},{"page_url":"https://ceb.wikipedia.org/wiki/Tachlovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Tachlovice_PZ_CZ.png","page_title":"Tachlovice","context_page_description":"Lungsod ang Tachlovice sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Středočeský kraj, sa sentro nga bahin sa nasod, 15 km sa habagatan-kasadpan sa Prague ang ulohan sa nasod. 360 metros ibabaw sa dagat kahaboga ang nahimutangan sa Tachlovice, ug adunay 513 ka molupyo.\\nAng yuta palibot sa Tachlovice kay patag sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang kabungtoran. Kinahabogang dapit sa palibot ang Vysoký Újezd, 428 ka metros ni kahaboga ibabaw sa dagat, 3.5 km sa habagatan-kasadpan sa Tachlovice. Dunay mga 192 ka tawo kada kilometro kwadrado sa palibot sa Tachlovice medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Prague, 15.2 km sa amihanan-sidlakan sa Tachlovice. Hapit nalukop sa kaumahan ang palibot sa Tachlovice. Sa rehiyon palibot sa Tachlovice, kapuloan talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 20 °C, ug ang kinabugnawan Enero, sa -6 °C. Ang kasarangang pag-ulan 941 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 126 milimetro nga ulan, ug ang kinaugahan Marso, sa 36 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Georgia_Institute_of_Technology","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Brittain_Dining_Hall%2C_Georgia_Institute_of_Technology%2C_Atlanta%2C_Georgia.jpg","page_title":"Georgia Institute of Technology","context_page_description":"Das Georgia Institute of Technology ist eine renommierte Technische Hochschule in Atlanta im US-Bundesstaat Georgia. Sie wurde am 13. Oktober 1885 als Georgia School of Technology gegründet. Sie ist Teil des University System of Georgia und gilt neben dem MIT, California Institute of Technology und der Universität Berkeley als eine der besten Hochschulen für Ingenieurwissenschaften in den USA. Sie wurde 2016 im U.S. News & World Report als siebtbeste Engineering School gewertet und ist Mitglied der Association of American Universities, einem Verbund führender forschungsintensiver nordamerikanischer Universitäten. Anders als bei den meisten anderen US-Colleges werden die Abschlüsse der Georgia Tech in Deutschland ohne Zusatz anerkannt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%82%A4%E3%82%B1%E3%83%AB%E3%83%BB%E3%83%AD%E3%83%BC%E3%82%BC%E3%83%B3%E3%83%90%E3%82%A6%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Michael_Rosenbaum_at_the_BE_Blow_Out.jpg","page_title":"マイケル・ローゼンバウム","context_page_description":"マイケル・オーウェン・ローゼンバウムは、アメリカ合衆国の俳優、声優。\\nアメコミ作品との関わりが深く、『ヤング・スーパーマン』でのレックス・ルーサー役やアニメ版『ジャスティス・リーグ』のフラッシュ役として知られる。"},{"page_url":"https://pl.wikipedia.org/wiki/Los_Angeles_Lakers","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Los_angeles_memorial_sports_arena1.jpg","page_title":"Los Angeles Lakers","context_page_description":"Los Angeles Lakers – amerykański klub koszykarski, mający siedzibę w Los Angeles, w stanie Kalifornia. Występują w Dywizji Pacyficznej, Konferencji Zachodniej w National Basketball Association. Swoje domowe spotkania Lakers rozgrywają w Staples Center, którą dzielą z lokalnym rywalem z NBA, Los Angeles Clippers, z Los Angeles Kings z ligi NHL i drużyną Los Angeles Sparks występującą w WNBA. Lakers są jedną z najbardziej utytułowanych drużyn w historii NBA. Mają na swoim koncie 16 tytułów mistrzowskich, a ostatnie z nich zdobyli w 2010 roku. W 2012 roku Lakers zostali wybrani przez magazyn Forbes najdroższą drużyną NBA, a ich wartość wyszacowano na 900 milionów dolarów. Rok później magazyn Forbes oszacował ich wartość na miliard dolarów, jednakże kwota ta dała im dopiero drugie miejsce za New York Knicks. W 2018 dziennikarze magazynu Forbes wycenili wartość klubu na 3,3 mld dolarów.\\nPoczątki zespołu sięgają 1947 roku, gdy zakupiono rozwiązany klub Detroit Gems. Nowa drużyna miała swoją siedzibę w Minneapolis, w stanie Minnesota, i przyjęła nazwę Lakers, na cześć przydomku stanu, w którym grali – „Kraina 10 000 Jezior”."},{"page_url":"https://pt.wikipedia.org/wiki/Furac%C3%A3o_Fausto_(2008)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Fausto_2008_track.png","page_title":"Furacão Fausto (2008)","context_page_description":"O furacão Fausto foi o sexto ciclone tropical dotado de nome e o terceiro furacão da temporada de furacões no Pacífico de 2008. Fausto formou-se de uma onda tropical em 16 de Julho e intensificou-se gradualmente, tornando-se um furacão em 18 de Julho e atingindo seu pico de intensidade em 21 de Julho com ventos máximos sustentados de 150 km/h antes de encontrar águas mais frias e se enfraquecer rapidamente, deixando de ser um ciclone tropical no dia seguinte.\\nFausto não causou nenhum dano ou impacto por se manter distante de regiões costeiras durante todo o seu ciclo de vida, embora seus ventos tenham afetado as ilhas Socorro e Clarion. Nestas ilhas, também não foi relatado qualquer tipo de dano ou impacto."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8E%83%E6%A1%BF%E5%9F%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Hong_Kong_So_Kon_Po_Recreation_Ground.JPG","page_title":"掃桿埔","context_page_description":"掃桿埔，又名掃管莆，舊稱箒管莆，是香港一個小山谷，名稱源自該處從前盛產作帚用的樹木。掃桿埔位於香港島灣仔區，鄰近大坑，渣甸山，北望加路連山，西接跑馬地。當地主要設施有香港大球場、奧運大樓、掃桿埔遊樂場、印度遊樂會、東華東院、萬靈塔、馬場先友公墓、正民村、衛斯理村及咖啡園墳場等。\\n1918年，跑馬地馬場發生大火，死難者安葬於掃桿埔一帶。至二戰結束後，港英政府將掃桿埔的白骨墳冢遷往雞籠灣並進行清理工作後，在原址興建政府大球場，於1955年啟用，至於咖啡園墳場則獲得保留。"},{"page_url":"https://zh.wikipedia.org/zh-tw/MiG-19","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/MiG-19_armament.jpg","page_title":"米格-19战斗机","context_page_description":"米格-19戰鬥機是蘇聯米高揚-古列維奇飛機設計局於20世紀50年代研製的一種雙發噴氣式超音速戰鬥機。是蘇聯第二代噴氣式戰鬥機，20世紀60－70年代蘇聯國土防空部隊的主要裝備，也是蘇聯第一種量產的超音速戰鬥機。北約代號農夫。中華人民共和國仿製的米格－19稱為殲-6。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B7%D1%91%D1%80_%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Wagin_Lake_panorama.jpg","page_title":"Список озёр Австралии","context_page_description":"Ниже представлен список озёр Австралии. В этой стране естественных пресных озёр сравнительно мало в связи с засушливым климатом, почти полным отсутствием ледников и тектонической активности. Тем не менее в Австралии довольно много водохранилищ, но они в данный список не включены, см. Список плотин и водохранилищ Австралии.\\nБольшинство озёр Австралии делятся на пять типов:\\nПрибрежные озёра и лагуны, в том числе perched lakes.\\nВнутренние озёра, находящиеся на значительном удалении от океанов. Зачастую они являются пересыхающими.\\nГлавный Хребет содержит пять ледниковых озёр континентальной Австралии. На острове Тасмания имеется много небольших ледниковых озёр на Центральном плато, значительная часть из которых были расширены, углублены и переделаны для гидроэнергетических нужд.\\nПересыхающие минеральные бессточные озёра в плоской пустынной части континента.\\nОзёра, образовавшиеся в остатках вулканических кратеров."},{"page_url":"https://de.wikipedia.org/wiki/Marquitos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Marcos_Alonso_Imaz_%281963%29.jpg","page_title":"Marquitos","context_page_description":"Marquitos war ein spanischer Fußballspieler. Er wurde mit Real Madrid fünfmal spanischer Meister und gewann ebenso oft den Europapokal der Landesmeister."},{"page_url":"https://de.wikipedia.org/wiki/Bengalkatze","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Distribution_Prionailurus_bengalensis_and_javanensis.png","page_title":"Bengalkatze","context_page_description":"Die Bengalkatze oder Leopardkatze, im englischen Sprachraum als Asian Leopard Cat bezeichnet, ist eine wilde Katze Süd- und Ostasiens. Seit 2002 wird die Bengalkatze in der Roten Liste gefährdeter Arten der Weltnaturschutzunion IUCN als nicht gefährdet geführt, da sie weit verbreitet ist. In einem Teil ihres Verbreitungsgebietes ist sie jedoch durch Habitatverlust und Jagd bedroht."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%9F%E4%BD%90%E5%B8%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Iozan_Kiyotakiji_04.JPG","page_title":"土佐市","context_page_description":"土佐市は、高知県中部に位置し、県内11市の中で面積最小の市。ちなみに自治体として旧国名「土佐」を名乗ったのは同県にある土佐郡土佐町の方が先である。"},{"page_url":"https://en.wikipedia.org/wiki/Yitzhak_Rabin_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/%D7%9E%D7%A8%D7%9B%D7%96_%D7%99%D7%A6%D7%97%D7%A7_%D7%A8%D7%91%D7%99%D7%9F_%D7%9E%D7%9B%D7%99%D7%95%D7%95%D7%9F_%D7%94%D7%97%D7%A0%D7%99%D7%94_%D7%9E%D7%93%D7%A8%D7%95%D7%9D.jpg","page_title":"Yitzhak Rabin Center","context_page_description":"The Yitzhak Rabin Center is a library and research center in Tel Aviv, Israel, built in memory of assassinated Israeli prime minister Yitzhak Rabin.\\nThe Yitzhak Rabin Center, designed by the Israeli architect, Moshe Safdie, sits on a hill commanding a panoramic view of Hayarkon Park and Tel Aviv, near the Eretz Israel Museum, the Palmach Museum, Tel Aviv University and Beth Hatefutsoth. The inauguration ceremony took place in November 2005, on the tenth anniversary of Rabin's assassination."},{"page_url":"https://lv.wikipedia.org/wiki/Opole","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Ratusz_w_Opolu_-_calosc.jpg","page_title":"Opole","context_page_description":"Opole ir pilsēta Polijas dienvidos, Opoles vojevodistes centrs Odras krastos. Upes osta un dzelzceļa mezgls. Cementa, metālizstrādājumu un mēbeļu rūpniecība. Polijas dziesmu tradicionālais festivāls.\\nSena poļu apmetne, no 1163.gada līdz 1532.gadam — Pjastu dinastijas Opoles hercogistes centrs. 1241.gadā Opoli gandrīz pilnīgi nopostīja mongoļi-tatāri. Pēc iebrukuma pilsētā sāka ieplūst vācu iedzīvotāji. 1532.gadā kļuva par Hābsburgu īpašumu, bet no 1762.gada Opole bija Prūsijas sastāvā. No 1919.gada līdz 1945.gadam tā ir Vācijas Augšsilēzijas provinces centrs. 1945.gada 24.janvārī pilsētu ieņēma Padomju karaspēks. 1945.gadā, pamatojoties uz Jaltas un Potsdamas konferences lēmumiem, Opole tika piešķirta Polijai. Gandrīz visi Opoles vācu iedzīvotāji tika padzīti no pilsētas.\\nPolitiķa Gžegoža Shetinas, vācu ārsta un dabaspētnieka Eduarda Šnicera un vācu futbolista Miroslava Klozes dzimtā pilsēta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B0%D1%8F_%D0%BC%D0%BE%D0%BD%D0%B6%D0%B8%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Xolmis_cinereus_-Fazenda_Campo_de_Ouro%2C_Piraju%2C_Sao_Paulo%2C_Brasil-8.jpg","page_title":"Серая монжита","context_page_description":"Серая монжита — вид птиц из семейства тиранновых. Выделяют два подвида."},{"page_url":"https://ms.wikipedia.org/wiki/Athens","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Port_of_Piraeus_Panoramic_View.JPG","page_title":"Athens","context_page_description":"Athens ialah ibu kota serta bandar raya terbesar negara Yunani dan tempat asal demokrasi. Kota yang dinamai sempena nama dewi Athena berdasarkan mitologi ini ialah salah sebuah bandar raya yang tertua di dunia, dengan sejarah tercatat sekurang-kurang 3,000 tahun. Pada hari ini, ibu kota ini merupakan sebuah metropolis kosmopolitan yang sibuk, dengan jumlah penduduk bandar sebanyak 3.1 juta orang dan jumlah penduduk metropolitan sebanyak 3.7 juta. Kawasan metropolitan Athens merupakan pusat ekonomi, kewangan, perindustrian, kebudayaan, dan politik di Yunani. Dengan cepatnya, bandar raya ini juga telah menjadi sebuah pusat perdagangan yang utama di dalam Kesatuan Eropah. Keluasan kawasan bandar raya yang betul-betul adalah 39 km², manakala aglomerasi bandar Athens ialah 412 km².\\nAthens Kuno merupakan sebuah negara kota yang sangat kuat serta pusat pembelajaran yang terkenal, dan adalah tempat asal Akademi Plato dan Lyceum Aristotle. Ia dirujuk secara meluas sebagai tempat bermulanya peradaban Barat, disebabkan sebahagian besar oleh kesan pencapaian kebudayaan dan politiknya semasa abad ke-5 SM dan ke-4 SM pada Benua Eropah yang diketahui pada masa itu."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D6%80%D5%B8%D5%A6%D5%A5_(%D4%B7%D5%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Crozet_%2801%29_-_Mairie.JPG","page_title":"Կրոզե (Էն)","context_page_description":"Կրոզե, Կոմունա Արևելյան Ֆրանսիայում, Էն գավառում։ Տեղակայված է Յուռա լեռների լանջին, գտնվում է ժնևից 15, իսկ Ֆրանսիական Լիոն քաղաքից 150 կմ հեռավորության վրա։ Մոտ է ժնևի միջազգային օդանավակայանին ։\\nՏեսարժան վայրերից հայտնի Է Կրոզեի ճոպանուղին, որն ամռանը ծառայում է լեռնագնացներին, իսկ ձմռանը՝ լեռնադահուկորդներին։\\nՀամայնքն ունի որոշ սպորտային ակումբներ։"},{"page_url":"https://pl.wikipedia.org/wiki/Ravascletto","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Ravasclettomunicipio.jpg","page_title":"Ravascletto","context_page_description":"Ravascletto – miejscowość i gmina we Włoszech, w regionie Friuli-Wenecja Julijska, w prowincji Udine.\\nWedług danych na rok 2004 gminę zamieszkiwały 642 osoby, 24,7 os./km²."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E4%BA%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Natsume_Soseki_photo.jpg","page_title":"日本人","context_page_description":"日本人是指擁有日本國籍者或日本列島的各民族與族群。日本主體民族為大和民族，其他組成民族包括朝鮮族、滿族、蒙古族、漢族和西伯利亞的通古斯族，此外還包括阿伊努人、琉球人，和其他南島的原住民。阿伊努人是北海道及庫頁島一帶的土著，琉球人則是在沖繩群島上的土著。如今，國籍上的日本人與民族上的日本人基本傾向於相同，但有時「日本人」一詞專指「大和民族」。"},{"page_url":"https://no.wikipedia.org/wiki/Nes_kirke_(Ringerike)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Kirketype%2C_Grosch.jpg","page_title":"Nes kirke (Ringerike)","context_page_description":"Nes kirke på Nes i Ådal i Ringerike kommune er en oktogonal sentralkirke i laftet tømmer fra 1860. Kirken har plass til 250 personer og er tegnet av arkitekt Christian Heinrich Grosch."},{"page_url":"https://ca.wikipedia.org/wiki/Aldealengua","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Aldealengua%2C_Iglesia_de_Santiago.jpg","page_title":"Aldealengua","context_page_description":"Aldealengua és un municipi de la província de Salamanca a la comunitat autònoma de Castella i Lleó. Limita al Nord amb Moriscos, a l'Est amb Aldearrubia, al Sud amb Calvarrasa de Abajo i a l'Oest amb Cabrerizos."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_presidenciales_de_Estados_Unidos_en_Illinois_de_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/President_Barack_Obama%2C_2012_portrait_crop.jpg","page_title":"Elecciones presidenciales de Estados Unidos en Illinois de 2012","context_page_description":"Las elecciones presidenciales de 2012 en Estados Unidos en Illinois se llevaron a cabo el 6 de noviembre de 2012, como parte de las Elecciones presidenciales de Estados Unidos de 2012 en las cuales los 50 estados más Distrito de Columbia participó. Los votantes de Illinois eligieron 20 electores para representarlos en el Colegio Electoral a través de un voto popular que enfrenta a titular Demócrata Presidente Barack Obama y su compañero de fórmula, Vicepresidente Joe Biden, contra el Republicano retador y ex Gobernador de Massachusetts Mitt Romney y su compañero de fórmula, Congresista Paul Ryan. El boleto de Obama / Biden ganó Illinois con 57.60% del voto popular para el 40.73% de Romney / Ryan, ganando así los 20 votos electorales del estado por un margen de 16.87%.\\nDatos: Q60969591"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%BF%D0%BE%D1%80_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D1%8C%D0%BA%D0%BE-%D0%9A%D1%80%D0%B8%D0%B2%D0%BE%D1%80%D1%96%D0%B7%D1%8C%D0%BA%D0%BE%D1%97_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D1%96%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/%D0%9F%D1%80%D0%B0%D0%BF%D0%BE%D1%80_%D0%94%D0%9A%D0%A0.png","page_title":"Прапор Донецько-Криворізької Республіки","context_page_description":"Пра́пор Доне́цько-Криворі́зької Респу́бліки — міфічний державний символ Донецько-Криворізької Республіки. Наразі невідомо жодного документу про затвердження прапора даного державного утворення. Проте у мережі Інтернет поширюються кілька версій прапора."},{"page_url":"https://de.wikipedia.org/wiki/Baum-Wei%C3%9Fling","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Baumweissling.jpg","page_title":"Baum-Weißling","context_page_description":"Der Baum-Weißling ist ein Schmetterling aus der Familie der Weißlinge. Das Artepitheton leitet sich von den Pflanzenarten der Gattung Crataegus ab, deren Blätter eine Nahrung der Raupen darstellen."},{"page_url":"https://sco.wikipedia.org/wiki/Beta_vulgaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Beta_vulgaris_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-167.jpg","page_title":"Beta vulgaris","context_page_description":"Beta vulgaris is a plant which is includit in Betoideae subfaimily in the Amaranthaceae faimily. It is the economically maist important crop o the lairge order Caryophyllales."},{"page_url":"https://simple.wikipedia.org/wiki/List_of_prime_ministers_of_Japan","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Osachi_Hamaguchi_posing_cropped.jpg","page_title":"List of prime ministers of Japan","context_page_description":"This is a list of prime ministers of Japan:"},{"page_url":"https://en.wikipedia.org/wiki/AMC_Theatres","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Amcpromenade16.jpg","page_title":"AMC Theatres","context_page_description":"AMC Entertainment Holdings, Inc. is an American movie theater chain headquartered in Leawood, Kansas, and the largest movie theater chain in the world. Founded in 1920, AMC has the largest share of the U.S. theater market ahead of Regal and Cinemark Theatres.\\nAfter acquiring Odeon Cinemas, UCI Cinemas, and Carmike Cinemas in 2016, it became the largest movie theater chain in both the world and the United States. It has 2,200 screens in 244 theatres in Europe and over 8,200 screens in 661 theatres in the United States.\\nThe company is listed on the New York Stock Exchange; from 2012 to 2018, the Chinese conglomerate Wanda Group owned a majority stake in the company. Private equity firm Silver Lake Partners made a $600 million investment in AMC in September 2018, but the voting power of AMC shares is structured in such a way that Wanda Group still controls the majority of AMC's board of directors.\\nAs of March 18, 2020, all AMC theaters were temporarily closed because of the COVID-19 pandemic, however, the company reopened a majority of its theaters on August 20, 2020."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%83%BD%E7%94%BA%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Nomachi-station-platform.jpg","page_title":"能町駅","context_page_description":"能町駅は、富山県高岡市能町にある西日本旅客鉄道・日本貨物鉄道の駅である。\\n氷見線と、貨物専用の新湊線の2路線が接続している。"},{"page_url":"https://fr.wikipedia.org/wiki/Hyrcan_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Hasmoneese_rijk.PNG","page_title":"Hyrcan II","context_page_description":"Hyrcan II ou Jean Hyrcan II est un grand-prêtre du Temple de Jérusalem et un roi appartenant à la dynastie des Hasmonéens. Il est le fils d'Alexandre Jannée et de Salomé Alexandra. Il joue un rôle dans la prise du contrôle du royaume de Judée par les Romains en 63 av. J.-C. Puis il permet à Hérode le Grand de devenir roi en 37 av. J.-C.\\nSa vie peut être reconstituée à partir des Antiquités judaïques de Flavius Josèphe."},{"page_url":"https://ast.wikipedia.org/wiki/Georg_Friedrich_von_J%C3%A4ger","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Georg_Friedrich_von_J%C3%A4ger%2C_Portr%C3%A4t.jpg","page_title":"Georg Friedrich von Jäger","context_page_description":"Georg Friedrich von Jaeger foi un médicu, botánicu, algólogo, paleontólogu, y zoólogu alemán.\\nEstudió medicina en Tubinga, graduándose en 1808. En 1809 viaxó per Francia y Suiza; pa depués trabayar como médicu en Stuttgart.\\nDe 1817 a 1856, foi direutor nel \\"Real Gabinete de Historia Natural de Stuttgart. Dende 1822, profesor de química y de ciencies naturales na Escuela Secundaria Cimera en Stuttgart. Dende 1841 Obermedizinalrat. Describió dinosaurios y mamíferos fósiles."},{"page_url":"https://hu.wikipedia.org/wiki/Bogarak","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Ocypus_olens_qtl1.jpg","page_title":"Bogarak","context_page_description":"A bogarak az ízeltlábúak törzsének és a rovarok osztályának egyik rendje. Tudományos elnevezésük az ógörög eredetű κολεός és πτερόν szavakból származik. Innen ered régi magyar elnevezésük a fedelesszárnyúak is. A bogarak rendjének valóban egyik legfeltűnőbb sajátossága, hogy elülső pár szárnyuk megvastagodott és megkeményedett szárnyfedőt alkot, amely védi egyrészt a nyugalmi állapotban alá behajtogatott második pár hártyás szárnyakat, másrészt a gyengébben kitinizált potrohot. A kemény szárnyfedők megléte és a mai élő bogarak egységes morfológiai megjelenése miatt sokáig monofiletikus csoportnak tartották a bogarak rendjét, azonban egyre több - főként molekuláris biológiai - bizonyíték szól amellett, hogy legalább egy alrendjük, a ragadozó bogarak külön fejlődési ágat képvisel.\\nJellemző rájuk az alábbi tulajdonságok együttes megléte:\\na két pár szárny közül az első pár kemény, kitines szárnyfedővé módosult, a hátulsó pedig hártyás;\\nelőtoruk szabadon áll, a közép- és utótoruk azonban egymással és a potrohhal is összenőtt;\\naz ivarszervek a potrohba behúzottak;\\na kifejlett egyedek csápja 11 ízű.\\nTeljes átalakulással fejlődnek; a fajok túlnyomó többségének rágó szájszervei vannak."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%88%D8%AA%D8%A7_%D8%A7%D9%8A%D8%A8%D9%88%D8%B4%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/KotaIbushi.JPG","page_title":"كوتا ايبوشى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكوتا ايبوشى لاعب كاراتيه و مصارع محترف من اليابان."},{"page_url":"https://no.wikipedia.org/wiki/Ciaran_Clark","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/FIFA_WC-qualification_2014_-_Austria_vs_Ireland_2013-09-10_-_Ciaran_Clark_04.JPG","page_title":"Ciaran Clark","context_page_description":"Ciaran Clark er en engelskfødt irsk fotballspiller som spiller for den engelske klubben Newcastle United FC."},{"page_url":"https://pl.wikipedia.org/wiki/Sydney_Olympic_Park_Athletic_Centre","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sydney_Olympic_Park_Athletic_Centre.jpg","page_title":"Sydney Olympic Park Athletic Centre","context_page_description":"Sydney Olympic Park Athletic Centre – wielofunkcyjny stadion w Homebush, w aglomeracji Sydney. Został otwarty w 1994 roku. Może pomieścić 15 000 widzów, z czego 5000 miejsc jest siedzących. Obiekt położony jest tuż obok ANZ Stadium. W 1996 roku rozegrano na nim 6. edycję Mistrzostw Świata Juniorów w lekkiej atletyce."},{"page_url":"https://fr.wikipedia.org/wiki/Patrick_Hausding","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Patrick_Hausding_bei_der_Olympia-Einkleidung_Hannover_2016_%28Martin_Rulsch%29_01.jpg","page_title":"Patrick Hausding","context_page_description":"Patrick Hausding est un plongeur allemand."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D8%A7%D9%86_%D8%AA%D9%88%D8%AF%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Jean_Todt_%28Official%29.png","page_title":"جيان تودت","context_page_description":"جيان تودت ‏ هو رئيس فرنسي، وهو عضوٌ في معهد السلام الدولي."},{"page_url":"https://ast.wikipedia.org/wiki/Monte_Sanqinq","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/SanQingShan8.jpg","page_title":"Monte Sanqinq","context_page_description":"El monte Sanqing o monte de San Qing ye un monte taoísta alcontrada a 80 kilómetros al norte de Yushan, Jiangxi provincia de China. Etimológicamente San Qing significa en mandarín los trés distintes al tar formáu'l monte por trés pináculos: Los montes Yujing, Yushui y Yuhua,\\nEl monte catalogóse como parque natural. Ye conocíu pol so particular fisonomía y pola variedá d'especies animales y vexetales que se desenvuelven nella. Asina se catalogaron alredor de 1.000 especies de flora y 80 tipos de fauna. L'área total del monte componer de 2200 km². En 2008 la Unesco proclamar Patrimoniu de la Humanidá."},{"page_url":"https://fi.wikipedia.org/wiki/Strykniinip%C3%A4hkin%C3%A4kasvit","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Gardneria_spp_EP-IV2-022.png","page_title":"Strykniinipähkinäkasvit","context_page_description":"Strykniinipähkinäkasvit on runsaat 400 lajia käsittävä kasviheimo koppisiemenisten Gentianales-lahkossa."},{"page_url":"https://az.wikipedia.org/wiki/Bak%C4%B1_real_m%C9%99kt%C9%99binin_binas%C4%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Baku_realni_school.jpg","page_title":"Bakı real məktəbinin binası","context_page_description":"Bakı real məktəbinin binası — 1901-1904-cü illərdə mülki mühəndis Dmitri Buynovun layihəsi ilə Bakı real məktəbi üçün tikilmiş bina. Hazırda binada Azərbaycan Dövlət İqtisad Universiteti fəaliyyət göstərir."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%82%AE%E3%83%B3%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Begijnhofleuven2005okt2.jpg","page_title":"ベギン会","context_page_description":"ベギン会は、中世ヨーロッパで発生した半聖半俗の姉妹団である。修道会とは異なる。その専用居住集落たるベギン会修道院は、中世においては、現在のベルギーの主要都市のほとんどすべてに存在し、隆盛をほこったが、フランス革命時、革命防衛軍の進攻によって接収され、資産を没収されたことなどを契機に衰退にむかった。ベルギー、オランダでは、その跡地が現在も保存されており、うち、ベルギーの13箇所は、世界遺産に指定されている。\\nベギンは修道女とは異なる。13世紀に生まれたベギン会は女性達の互助組織として、独自の共同体を形成していた。結婚か、修道院に入る以外に人生の選択肢があまりなかった時代にあって、教育、執筆、看護、織布関連産業などの多様な分野での活動の機会を生み出し、さまざまな境遇の女性のつどう場となっていた。また、ベギンホフをでれば結婚も可能であったといわれるが、かならずしも推奨されていなかったとみられる時代、地域もある。\\nベギン会の組織としての性格であるが、広域的なネットワークをもつ統一的な組織は形成せず、共通の指導者、会則、創始者なども存在しておらず、会の実態は、地域毎の婦人会のようなもので、ひとつの都市に複数の会が存在する状態であった。その生活様式は両親との同居や仲間数人との共同生活のほかに単独居住なども含んでいた。現在のベルギーにあたる地域では13世紀中頃にベギン専用居住区たるベギンホフが形成され、その外に住む女性は、ベギン風の生活をしており、ベギン風の衣装をまとっていても、ベギンとみなされるべきではないとされた。\\nこの女性たちの動向は、そのため、会というより、自然発生的な運動とみなす研究が２０世紀なかごろまでに主流となった。女性のベギンに対して、半聖半俗の生活をおくる男性は、ベガルドとよばれたが、その数は、ベギンにくらべると問題にならないほど少なかった。男性の場合は安全な住居の確保の必要性が薄かったためとかんがえられる。\\nベギンの出身階層は、貴顕のものから、下層民まですべての階層にわたり、ドイツで、その数、20万と14世紀初頭の史料にはある。15世紀後半ケルンに106軒、ストラスブールに85軒、マインツに28軒、バーゼルに22軒のベギン会の家があった。宿舎の収容能力は普通、10人以下、多くても20人どまりであったが、リューベックには100人以上を収容できる宿舎が5軒存在していた。ベギンは当初、主に都市の上・中階層と地方の貴族階層の出身者であったが、次第に下層階級出身の女性たちが増えるようになった。しかし、聖俗の公権力によって禁止命令や圧迫を受け、会の数は減少したが、宗教改革後は活性化し、17世紀にはブリュッセルのベギンの家に約1000人の女性が生活していた。\\n女性の集団であるため偏見にさらされることも多かった。"},{"page_url":"https://de.wikipedia.org/wiki/Bucht_von_Baku","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Bay%C4%B1l_liman%C4%B1.jpg","page_title":"Bucht von Baku","context_page_description":"Die Bucht von Baku ist ein Naturhafen des Kaspischen Meeres, der sich an der Südküste der Halbinsel Abşeron in Aserbaidschan befindet. An der Bucht liegen der Internationale Seehandelshafen von Baku, der Marinestützpunkt der aserbaidschanischen Seestreitkräfte und der örtliche Jachtklub."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_aan_de_Herengracht_(Amsterdam,_Noordwest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Amsterdam_-_Herengracht_48.JPG","page_title":"Lijst van rijksmonumenten aan de Herengracht (Amsterdam, Noordwest)","context_page_description":"Een overzicht van de 423 rijksmonumenten aan de Herengracht in Amsterdam.\\nHet overzicht is opgesplitst in drie delen. Dit is het noordwestelijk deel vanaf de Brouwersgracht tot de Raadhuisstraat. Dit zijn de nummers 1 t/m 211 aan de oneven zijde en 2 t/m 184 aan de even zijde.\\nZie ook de lijst van het zuidwestelijk gedeelte vanaf de Raadhuisstraat tot de Leidsestraat. Dat zijn de nummers 213 t/m 433 aan de oneven zijde en 186 t/m 424 aan de even zijde.\\nZie ook de lijst van het zuidelijke gedeelte vanaf de Leidsestraat tot de Amstel. Dat zijn de nummers 435 t/m 627 aan de oneven zijde en 426 t/m 598 aan de even zijde."},{"page_url":"https://lt.wikipedia.org/wiki/Etelbertas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/%C3%86thelberht_-_MS_Royal_14_B_VI.jpg","page_title":"Etelbertas","context_page_description":"Etelbertas – nuo 858 m. Kento, o nuo 860 m. ir Vesekso karalius iki savo mirties 865 m. Etelvulfo ir Osburgos sūnus, Etelbaldo brolis.\\n858 metais Etelbertas paveldėjo savo tėvo Etelvulfo rytų dalies karalystę, o po brolio mirties 860 m. vėl sujungė šalį. Jo valdymo laikais danai, vadovaujami Ragnaro Lodbroko, išgrobė Kentą ir Nortumbriją, ir netgi nuėjo iki Vinčesterio.\\nEtelbertas mirė 865 metų rudenį, nevedęs. Sostą paveldėjo jo jaunesnysis brolis Etelredas I."},{"page_url":"https://fr.wikipedia.org/wiki/Dumuzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Dieu_mort.jpg","page_title":"Dumuzi","context_page_description":"Dumuzi, aussi appelé Dumuzid ou, en babylonien, Tammuz est un dieu de l'abondance de la Mésopotamie antique dont les premières traces écrites apparaissent au IIIᵉ millénaire av. J.‑C.\\nIl figure dans la Liste royale sumérienne comme « Dumuzi le berger », roi de Bad-Tibira, cinquième roi de la première dynastie archaïque sumérienne de la période légendaire d'avant le Déluge. Il est par ailleurs repris sous le nom de « Dumuzi le pêcheur », roi de la ville d'Uruk Kulaba.\\nÀ la suite de son mariage, symbolisé par le rituel du Mariage sacré, avec la déesse Inanna, il devient le berger du peuple et rapproche ainsi le roi de Sumer de l'état divin. Mais son épouse, au retour d'un séjour qu'elle passe aux Enfers, le choisit pour l'y remplacer. Il meurt donc et est alors considéré comme une divinité infernale. Sa mort symbolise l'arrivée de l'été brûlant, de la sécheresse et de la pénurie de nourriture ; elle inspire l'écriture de nombreux textes de lamentations. Il ressuscite, cependant, au début de chaque printemps et est remplacé aux Enfers par sa sœur Geshtinanna. Son retour symbolise le renouveau de la vie et la réapparition de l’abondance.\\nÀ partir du XVIIIᵉ siècle av."},{"page_url":"https://eu.wikipedia.org/wiki/Vydrany","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Nemesh%C3%B3dos_templom_1a.JPG","page_title":"Vydrany","context_page_description":"Vydrany Eslovakiako udalerri bat da, Dunajská Stredako barrutian kokatuta. 16,05 km²ko azalera du eta 1703 biztanle 2017ko datuen arabera."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CE%AD%CF%81%CE%BD%CE%B5%CF%81_%CE%9A%CE%AD%CE%B3%CE%BA%CE%B9_(%CE%B9%CF%83%CF%84%CE%BF%CF%81%CE%B9%CE%BA%CF%8C%CF%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Kaegi1977.jpg","page_title":"Βέρνερ Κέγκι (ιστορικός)","context_page_description":"Ο Βέρνερ Κέγκι ήταν Ελβετός ιστορικός."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B7%D0%B8%D0%B4%D0%B5%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B8%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D1%96%D0%B2_%D0%91%D1%83%D0%BA%D0%BE%D0%B2%D0%B8%D0%BD%D0%B8_%D1%96_%D0%94%D0%B0%D0%BB%D0%BC%D0%B0%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/%D0%9F%D0%B0%D1%80%D0%BA_%D1%82%D0%B0_%D0%BF%D0%B0%D1%80%D0%BA%D0%BE%D0%B2i_%D1%81%D0%BF%D0%BE%D1%80%D1%83%D0%B4%D0%B8_%28%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B2%D1%86%D1%96%29.JPG","page_title":"Резиденція митрополитів Буковини і Далмації","context_page_description":"Резиде́нція митрополи́тів Букови́ни і Далма́ції — пам'ятка архітектури, розташована у місті Чернівці. Комплекс збудований у 1864—1882 роках. Архітектор — Йозеф Главка. Після Другої світової війни його будівлі використовує Чернівецький національний університет імені Юрія Федьковича.\\nЗ 24 серпня 1963 року є пам'яткою архітектури національного значення.\\n28 червня 2011 року на 35-й сесії комітету ЮНЕСКО архітектурний ансамбль резиденції включили до списку Світової спадщини.\\nЗа підсумками загальнонаціональної акції «Сім чудес України: замки, фортеці, палаци» 2010—2011 року, митрополича резиденція потрапила до першої сімки."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%A9nus_de_Milo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Venus_de_Milo%2C_4_July_2014_002.jpg","page_title":"Vénus de Milo","context_page_description":"La Vénus de Milo est une statue en marbre représentant vraisemblablement la déesse Aphrodite, retrouvée sans ses bras dans l'île grecque de Milos en 1820. C'est une œuvre de l'époque hellénistique, créée vers 150-130 av. J.-C.\\nSon exposition au musée du Louvre en 1821 a fait sensation : c'était la première statue venue de Grèce dans les collections, et la première à être montrée incomplète. Sa célébrité est due à la grande beauté de son corps à demi dénudé, mais aussi aux polémiques suscitées par son identité et la position de ses bras. Parmi les nombreuses propositions pour restituer son attitude, les archéologues en privilégient deux, celle où la Vénus de Milo tient la pomme du jugement de Pâris ou celle où elle se regarde dans le bouclier d'Arès."},{"page_url":"https://gl.wikipedia.org/wiki/Cruceiro_Alfonso_XII","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Havana%27s_Floating_Dock_and_the_Alfonso_XII_%281898%29.jpg","page_title":"Cruceiro Alfonso XII","context_page_description":"O Alfonso XII foi un cruceiro non protexido da Armada española que permaneceu activo desde 1892 ata 1908. Recibía o seu nome en honra ao rei Afonso XII, foi o segundo dos tres compoñentes da Clase Reina Cristina."},{"page_url":"https://pl.wikipedia.org/wiki/Rude_Se%C5%82o","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Branitsky%27s_Palace_in_Rude_Selo.jpg","page_title":"Rude Seło","context_page_description":"Rude Seło – wieś na Ukrainie, w obwodzie kijowskim, w rejonie wołodarskim."},{"page_url":"https://pl.wikipedia.org/wiki/Gertruda_Babili%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Gertruda_Babilinska_tree.jpg","page_title":"Gertruda Babilińska","context_page_description":"Gertruda Babilińska – polska nauczycielka, niania, Sprawiedliwa Wśród Narodów Świata."},{"page_url":"https://de.wikipedia.org/wiki/O-Bahn_Adelaide","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/OBahnEntrance.jpg","page_title":"O-Bahn Adelaide","context_page_description":"Die O-Bahn Adelaide ist ein Spurbussystem in Adelaide im Süden von Australien, welches das Stadtzentrum mit den nordöstlichen Vororten verbindet. Auf einer zwölf Kilometer langen Trasse verkehren die Busse spurgeführt; anschließend können sie die Spur verlassen und verschiedene Ziele bedienen."},{"page_url":"https://sv.wikipedia.org/wiki/R%C3%B6schenz","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Karte_Gemeinde_R%C3%B6schenz_2007.png","page_title":"Röschenz","context_page_description":"Röschenz är en ort och kommun i distriktet Laufen i kantonen Basel-Landschaft, Schweiz. Kommunen har 1 863 invånare."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%B8%D5%A3%D5%A5%D5%A6%D5%B6%D5%A5%D6%80_(%D5%A4%D5%A5%D5%BA%D5%A1%D6%80%D5%BF%D5%A1%D5%B4%D5%A5%D5%B6%D5%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Chaume_Ferchmuss_et_route_des_cr%C3%AAtes%2C_vus_du_Rainkopf._27-06-08.jpg","page_title":"Վոգեզներ (դեպարտամենտ)","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Վոգեզներ\\nՎոգեզներ, դեպարտամենտ Ֆրանսիայի արևելքում։\\nՎոգեզներ դեպարտամենտի կարգային թիվն է՝ 88։"},{"page_url":"https://ca.wikipedia.org/wiki/Tercera_Rep%C3%BAblica_Francesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Gaston_Doumergue_1924.jpg","page_title":"Tercera República Francesa","context_page_description":"La Tercera República Francesa, és el període que cobreix els governs que van regir França des de 1870, amb la captura de Napoleó III durant la Guerra Francoprussiana i l'esfondrament del Segon Imperi Francès, fins a 1940, quan la derrota de la Tercera República Francesa per part de l'Alemanya nazi en va provocar la substitució pel Govern de Vichy.\\nEn altres fonts també és freqüent que es consideri que aquesta etapa no s'inicia fins a l'establiment definitiu del govern i la constitució de 1875.\\nTot i això, la Tercera República va durar una setantena d'anys, de manera que va esdenevir el sistema de govern més durador a França des de la caiguda de l'Antic Règim el 1789."},{"page_url":"https://eo.wikipedia.org/wiki/Distriktoj_de_Kantono_Turgovio","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Diessenhofen-Blazono.png","page_title":"Distriktoj de Kantono Turgovio","context_page_description":"Ĝis la 31-a de de cembro 2010 Kantono Turgovia konsistas el 8 distriktoj, kiuj nomiĝis same kiel iliaj respektivaj ĉeflokoj. Per nova turgovia leĝo pri la komunumo tiu nombro kun efiko de la 1-a de januaro 2011 estis reduktita al 5."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8D%E3%82%BB%E3%83%90%E3%83%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Nessebar_St_Jean-Baptiste.jpg","page_title":"ネセバル","context_page_description":"ネセバル、あるいはネセブルは、ブルガリアの古代都市であり、現在では海岸沿いのリゾート地となっているブルガス州の町、およびそれを中心とした基礎自治体。トラキア語での名称はメネブリア 、現代ギリシャ語ではメシンヴリア 、かつての名称はメセンブリア である。ネセバルは3千年紀を超える長い歴史に裏付けられた、豊かな都市博物館である。\\nネセバルは黒海で最も有名な観光地であり、リゾート地である。ネセバル付近には多くのリゾート拠点があるが、その中で最大のものは町のすぐ北に位置しているサニー・ビーチである。\\nネセバルの古代都市は、細長い人工の地峡によって大陸部とつながった半島の上に築かれ、その地形ゆえに多くの異なる文明による征服から逃れてきた。その豊富な歴史的建造物の存在により、ネセバルは1983年にUNESCOの世界遺産に登録された。"},{"page_url":"https://hu.wikipedia.org/wiki/Pusztai_%C3%B6lyv","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Adlerbussard.jpg","page_title":"Pusztai ölyv","context_page_description":"A pusztai ölyv a madarak osztályának vágómadár-alakúak rendjébe, ezen belül a vágómadárfélék családjába tartozó faj."},{"page_url":"https://la.wikipedia.org/wiki/Caenorhabditis_elegans","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Adult_Caenorhabditis_elegans.jpg","page_title":"Caenorhabditis elegans","context_page_description":"Caenorhabitis elegans est Nematodum quod, circa 1 mm longum, in sòlo regionum climatis temperati vivit."},{"page_url":"https://sk.wikipedia.org/wiki/Milan_%C5%A0tiavnick%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Milan_%C5%A1tiavnick%C3%BD.jpg","page_title":"Milan Štiavnický","context_page_description":"Ing. Milan Štiavnický bol vyštudovaný inžinier, externý pedagóg, medzinárodný rozhodca, tréner a choreograf, zakladateľ prvého krúžku spoločenských tancov, zakladateľ prvého skutočného klubu súťažného spoločenského tanca, prvý predseda Slovenského tanečného zväzu, prvý čestný prezident SZTŠ. Mal zásluhu na formovaní dnešného tanečného športu a zväzu tanečného športu na Slovensku."},{"page_url":"https://no.wikipedia.org/wiki/Yngve_Holm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Yngve_Holm.jpg","page_title":"Yngve Holm","context_page_description":"Yngve Holm var en svensk seiler som deltok i de olympiske leker 1920 i Antwerpen.\\nHolm ble olympisk mester i seiling under sommer-OL 1920 i Antwerpen. Han vant sammen med Tore Holm, Axel Rydin og Georg Tengvall olympisk gull i 40m²-klassen med den svenske båten «Sif». Det var kun to båter i denne klassen, begge svenske de het «Sif» og «Elise»."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B8%D0%B2%D0%B0%D1%82%D0%B0%D1%98%D0%B8%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Giv%27atayim_Panorama.jpg","page_title":"Гиватајим","context_page_description":"Гиватајим је град у Израелу у округу Тел Авив. Према процени из 2007. у граду је живело 49.600 становника."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BB%A3%E5%B7%9E%E5%B8%82_(%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/1946%E5%B9%B4%E5%B9%BF%E5%B7%9E%E5%B8%82%E4%BD%8D%E7%BD%AE%E5%9B%BE.png","page_title":"廣州市 (中華民國)","context_page_description":"廣州市，通稱廣州，簡稱「穗」，是中華民國在兩岸分治前所設置的12院轄市之一，亦是中華民國政府遷台前華南地區唯一的直轄市。是南部地區交通樞紐中心，亦是嶺南政治、經濟、文化中心。"},{"page_url":"https://hu.wikipedia.org/wiki/Metazolamid","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Methazolamide_structure.png","page_title":"Metazolamid","context_page_description":"A metazolamid a szemnyomás csökkentésére használt gyógyszer. A magas szemnyomás károsítja a szem idegeit, ami akár a látás teljes elveszítésével is járhat.\\nNyílt zugú zöldhályog ellen nem javasolt a hosszú idejű használata.\\nA metazolamidot kutyák zöldhályogjának gyógyítására is adják az állatgyógyászatban."},{"page_url":"https://en.wikipedia.org/wiki/Changing_room","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Changeroom_symbol_on_sign_close_up.jpg","page_title":"Changing room","context_page_description":"A changing room, locker room, dressing room or changeroom is a room or area designated for changing one's clothes. Changing rooms are provided in a semi-public situation to enable people to change clothes with varying degrees of privacy.\\nSeparate changing rooms may be provided for men and women, or there may be a non-gender-specific open space with individual cubicles or stalls, as with unisex public toilets. Many changing rooms include toilets, sinks and showers. Sometimes a changing room exists as a small portion of a restroom/washroom. For example, the men's and women's washrooms in Toronto's Dundas Square each include a change area which is a blank counter space at the end of a row of sinks. In this case, the facility is primarily a washroom, and its use as a changing room is minimal, since only a small percentage of users change into bathing suits. Sometimes a person may change his or her clothes in a toilet cubicle of a washroom.\\nLarger changing rooms are usually found at public beaches, or other bathing areas, where most of the space is for changing, and minimal washroom space is included. Beach-style changing rooms are often large open rooms with benches against the walls."},{"page_url":"https://en.wikipedia.org/wiki/Portuguese_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/NRP_Escorpiao_P1152_20090731.JPG","page_title":"Portuguese Navy","context_page_description":"The Portuguese Navy is the naval branch of the Portuguese Armed Forces which, in cooperation and integrated with the other branches of the Portuguese military, is charged with the military defense of Portugal.\\nOn 12 December 2017, the Portuguese Navy commemorated the 700th anniversary of its official creation by King Denis of Portugal. Tracing its origins back to the 12th century, it is the oldest continuously serving navy in the world.\\nThe Navy played a key role at the beginning and during the great voyages of the Age of Discoveries in the 15th and 16th centuries. The resulting of this technical and scientific discoveries led Portugal to develop advanced ships, including the caravel, new and more sophisticated types of carracks for interoceanic travel and the oceanic galleon, and to find the sea route to the East and routes to South America and Northern North America.\\nBartolomeu Dias rounded the southern tip of Africa and Vasco da Gama reached India, linking Europe and Asia for the first time by ocean route, as well as the Atlantic and the Indian oceans."},{"page_url":"https://hu.wikipedia.org/wiki/Kir%C3%A1lyhelmec","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Kir%C3%A1lyhelmec007.JPG","page_title":"Királyhelmec","context_page_description":"Királyhelmec város Szlovákiában, a Kassai kerület Tőketerebesi járásában. A Bodrogköz legjelentősebb városa."},{"page_url":"https://en.wikipedia.org/wiki/2019_Yuen_Long_District_Council_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Yuen_Long_District_Council_%282019%29.svg","page_title":"2019 Yuen Long District Council election","context_page_description":"The 2019 Yuen Long District Council election was held on 24 November 2019 to elect all 39 elected members to the 45-member Yuen Long District Council.\\nThe pro-Beijing and rural domination was turned over in the historic landslide victory where the pro-democrats were took over all the urban constituencies and a few rural constituencies amid the massive pro-democracy protests. As a results, the pro-democrats took 33 of the 39 elected seats and seized control of the 45-member council for the first time."},{"page_url":"https://it.wikipedia.org/wiki/Cattedrali_in_Inghilterra_e_Galles","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Cathedral_of_the_Holy_Trinity%2C_Gibraltar.jpg","page_title":"Cattedrali in Inghilterra e Galles","context_page_description":"Questa è una lista delle cattedrali dell'Inghilterra e del Galles:"},{"page_url":"https://en.wikipedia.org/wiki/Samshvilde","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/%E1%83%A1%E1%83%90%E1%83%9B%E1%83%A8%E1%83%95%E1%83%98%E1%83%9A%E1%83%93%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%9D%E1%83%9C%E1%83%98.jpg","page_title":"Samshvilde","context_page_description":"Samshvilde is a ruined fortified city and archaeological site in Georgia, in the country's south, near the homonymous modern-day village in the Tetritsqaro Municipality, Kvemo Kartli region. The ruins of the city, mostly medieval structures, stretch for a distance of 2.5 km in length and 400 metres in width in the Khrami river valley. Some of the most recognizable monuments are the Samshvilde Sioni church and a citadel erected on a rocky river promontory.\\nSamshvilde features in the medieval Georgian annals as one of the oldest cities of ancient Kartli, dating back to the 3rd century BC. In the Middle Ages, it was an important stronghold as well as a lively commercial and industrial city. Samshvilde changed hands several times. At the end of the 10th century, it became capital of the Armenian kings of Tashir-Dzoraget and was incorporated in the Kingdom of Georgia in 1064. From the mid-13th century on, as fortunes of the medieval Georgian monarchy faded, Samshvilde went into decline and was reduced to a peripheral military outpost. By the end of the 18th century, it was in ruins."},{"page_url":"https://en.wikipedia.org/wiki/Florida_Attorney_General","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Bob_Butterworth.jpg","page_title":"Florida Attorney General","context_page_description":"The Florida attorney general is an elected cabinet official in the U.S. state of Florida. The attorney general serves as the chief legal officer of the state and is head of the Florida Department of Legal Affairs.\\nThe office is one of Florida's three elected state cabinet posts, along with the chief financial officer and agriculture commissioner. The current attorney general is Republican Ashley Moody, who took office on January 8, 2019."},{"page_url":"https://en.wikipedia.org/wiki/Hardinge_Circle,_Mysore","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Arugatu.Mansoor_Dargah.jpg","page_title":"Hardinge Circle, Mysore","context_page_description":"Hardings Circle or Jayachamarajendra Wadiyar Circle or Arugatu is an intersection of six major roads in Mysore city of Karnataka state, India."},{"page_url":"https://en.wikipedia.org/wiki/Zurzyce","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/2014-08_Zurzyce_%2805%29_Wjazd.JPG","page_title":"Zurzyce","context_page_description":"Zurzyce is a village in the administrative district of Gmina Kamiennik, within Nysa County, Opole Voivodeship, in south-western Poland.\\nBefore 1945 the area was part of Germany."},{"page_url":"https://en.wikipedia.org/wiki/Athletics_at_the_1993_Central_American_and_Caribbean_Games","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Inside_of_Paquito_Montaner_Stadium_in_Ponce%2C_Puerto_Rico_%28IMG_3367%29.jpg","page_title":"Athletics at the 1993 Central American and Caribbean Games","context_page_description":"The track and field competition at the 1993 Central American and Caribbean Games was held in November at the Estadio Francisco Montaner in Ponce, Puerto Rico."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E9%96%8B%E7%9A%87%E4%B9%8B%E6%B2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Sui_Wendi_Tang.jpg","page_title":"開皇之治","context_page_description":"開皇之治是中國隋文帝在位二十多年時間開創的治世，當時社會民生富庶、人民安居樂業、政治安定。"},{"page_url":"https://lb.wikipedia.org/wiki/Charles-Mathieu-Pad","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Veianen_Buerg_05.jpg","page_title":"Charles-Mathieu-Pad","context_page_description":"De Charles-Mathieu-Pad, offiziell sentier pédestre national Charles-Mathieu, ass ee vun den nationale Wanderweeër zu Lëtzebuerg. En gouf nom Charles Mathieu, dem fréieren Deputéierten a Buergermeeschter vun der Stad Wolz genannt."},{"page_url":"https://af.wikipedia.org/wiki/Kantonees","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Guangdonghua-vector.svg","page_title":"Kantonees","context_page_description":"Kantonees, Standaard Kantonees of Yue, is 'n Sino-Tibettaanse taal of 'n dialek van Chinees wat in die Volksrepubliek China, Hongkong, Macau, Singapoer en Maleisië gepraat word. Die taal het sowat 63 miljoen sprekers, veral in die Suid-Chinese provinsie Guangdong en die outonome streek Guangxi, rondom die Pêrelrivierdelta, en is daarmee die derde mees verspreide dialek van Chinees naas Mandaryns en Wu. Die naam van dié taal is afgelei van die provinsie Guangdong, wat soms Kanton of Yue genoem word.\\nKantonees is een van die amptelike tale van die Volksrepubliek China se spesiale administratiewe streke Hongkong en Macau.\\nKantonees is tradisioneel die mees gebruikte Chinese dialek binne Chinese oorsese gemeenskappe in Suidoos-Asië en die westelike wêreld, vernaamlik Australië, Kanada, Wes-Europa en die Verenigde State.\\nSoos die ander Chinese tale word Kantonees met Chinese karakters geskryf. Kantonees is veral bekend as moedertaal van Bruce Lee."},{"page_url":"https://de.wikipedia.org/wiki/Westerheim_(W%C3%BCrttemberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Westerheim_Weihnachtsmarkt.jpg","page_title":"Westerheim (Württemberg)","context_page_description":"Westerheim ist eine Gemeinde im Alb-Donau-Kreis in Baden-Württemberg. Westerheim ist mit seiner gesamten Gemarkung Teil des Biosphärengebiets Schwäbische Alb und des UNESCO Geoparks Schwäbische Alb."},{"page_url":"https://it.wikipedia.org/wiki/Monte_Cinto_(Colli_Euganei)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Monte_cinto.JPG","page_title":"Monte Cinto (Colli Euganei)","context_page_description":"Il Monte Cinto, situato nel comune di Cinto Euganeo, è una piccola elevazione posta nella sezione sud dei Colli Euganei.\\nIl colle è famosa per i ritrovamenti fossili scoperti nella Cava Bomba e per il Museo Geopaleontologico adibito all'interno di un'ex fornace. Il sentiero escursionistico n.11 porta fino alla cima del Monte Cinto e permette di visitare alcuni dei luoghi più conosciuti dei Colli Euganei, come il Buso dei Briganti."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0_%D0%B3%D1%80%D0%B8%D0%B2%D0%BD%D0%B0%D2%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/1_hryvnia_2005_back.jpg","page_title":"Украина гривнаһы","context_page_description":"Гри́вна, ҡайһы берҙә гри́вня — Украинаның милли валютаһы, көмөш ҡойолмаһы рәүешендәге аҡса берәмеге булған боронғо рус гривнаһы хөрмәтенә аталған.\\nГривна 100 тингә бүленә. Валютаның ISO 4217 стандартындағы хәрефле коды — UAH, һанлы коды — 980. Рәсми билдәһе — ₴."},{"page_url":"https://ro.wikipedia.org/wiki/Insurec%C8%9Bia_de_la_10_august_1792","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Jean-paul_marat_3.jpg","page_title":"Insurecția de la 10 august 1792","context_page_description":"Ziua de 10 august 1792, zi decisivă pentru Revoluția Franceză, a fost, după cea de 14 iulie 1789, cea mai importantă din perioada revoluționară. Mare parte din istorici consideră această insurecție a fi a doua revoluție. Pregătirea acestei zile, plină de consecințe pentru viitorul Franței și al revoluției, a fost organizată și pusă în aplicare de către Comuna insurecțională din Paris și de către secțiunile revoluționare pariziene; după mai multe asalturi, poporul a cucerit palatul Tuileries, centrul puterii executive. Dar a fost și prima oară, de la începutul Revoluției, când acțiunile revoluționare au fost îndreptate în egală măsură împotriva Adunării Naționale. Această zi revoluționară a consemnat prăbușirea monarhiei constituționale. Pregătirea sa este prea complexă pentru ca responsabilitatea sa să poată fi atribuită unei singure persoane sau facțiuni.\\nAcesta a fost și începutul primei Terori, al cărei punct culminant au fost masacrele din septembrie. Această primă perioadă avea să se încheie cu reuniunea primei sesiuni a Convenției Naționale la 20 septembrie 1792 și cu victoria de la Valmy, obținută în aceeași zi și aflată la Paris a doua zi."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89mile_Beaussier","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Ponte-Vecchio.jpg","page_title":"Émile Beaussier","context_page_description":"Émile, Marius, Beaussier est un peintre français, né le 31 décembre 1874 à Avignon et mort le 18 octobre 1943 à Lyon.\\nIl s'est particulièrement illustré dans la peinture de marines et de paysages ensoleillés."},{"page_url":"https://de.wikipedia.org/wiki/Mbalax","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Cheikh_L%C3%B4_%28de_sjeik_zelf%29.jpg","page_title":"Mbalax","context_page_description":"Mbalax ist eine in Westafrika, vor allem im Senegal und Gambia populäre Musikrichtung.\\nMbalax mischt viele verschiedene regionale Einflüsse mit schnellem Rhythm and Blues und beispielsweise Soca. Den Rhythmus prägen oft schnelle Läufe der Trommelgruppe, zu der die Sanduhrtrommel tama und die größere Standtrommel sabar gehören. Sabar bedeutet zugleich eine alte Tanzmusiktradition der Wolof, die sich auf den Mbalax ausgewirkt hat. Hinzu kommt eine helle, funkähnliche Rhythmusgitarre.\\nDie Texte im Mbalax nehmen oft einen religiösen Bezug auf Akteure des westafrikanischen Sufismus, der im Senegal mit den drei Orden Tidschānīya, Muridiyya und Qādirīya verbreitet ist. In ihrer Balladenform erinnern sie an Lobgesänge von Griots. Die Sprache ist Wolof.\\nVor der Mbalax-Mode war der senegalesische Popmusik-Geschmack bis in die 1970er Jahre auch stark lateinamerikanisch geprägt. Seit den 1990er Jahren tritt neben den Mbalax die originäre Hip-Hop-Kultur der Metropole Dakar, die Senerap genannt wird."},{"page_url":"https://lmo.wikipedia.org/wiki/Sigriswil","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Karte_Gemeinde_Sigriswil_2007.png","page_title":"Sigriswil","context_page_description":"Sigriswil a l'è un cumün svizzer del circol aministrativ de Thun, region aministrativa del Oberland Bernes, in de la part del Canton Berna a magioranza linguistega todèsca. La süperfiss del teritori del cumün l'è de 55.34 km² e in del Dicember 2010 al gh'eva una popolazion de 4598 abitant.\\nEl cumün de Sigriswil al se tröva a una altitüden de 810 meter sura al livel del mar e l'è tacaa ai cumün de Beatenberg, Heiligenschwendi, Horrenbach-Buchen, Krattigen, Leissigen, Oberhofen am Thunersee, Spiez, Teuffenthal."},{"page_url":"https://en.wikipedia.org/wiki/Cycadales","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Cycas_revoluta_seeds.jpg","page_title":"Cycadales","context_page_description":"Cycadales is an order of seed plants that includes all the extant cycads. These plants typically have a stout and woody trunk with a crown of large evergreen leaves. They usually have pinnate leaves. The individual plants are either all male or all female. Cycads vary in size from having trunks only a few centimeters to several meters tall. They typically grow very slowly and live very long, with some specimens known to be as much as 1,000 years old. Because of the superficial resemblance, they are sometimes confused with and mistaken for palms or ferns, but are only distantly related to either.\\nCycadales are found across much of the subtropical and tropical parts of the world. They are found in South and Central America, Mexico, the Antilles, southeastern United States, Australia, Melanesia, Micronesia, Japan, China, Southeast Asia, India, Sri Lanka, Madagascar, and southern and tropical Africa, where at least 65 species occur. Some can survive in harsh semidesert climates, others in wet rain forest conditions, and some in both. Some can grow in sand or even on rock, some in oxygen-poor, swampy, bog-like soils rich in organic material, and some in both."},{"page_url":"https://cy.wikipedia.org/wiki/Ebenezer_Richard","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Portrait_of_Revd._Ebenezer_Richard%2C_Tregaron%2C_Cardiganshire_%284671915%29.jpg","page_title":"Ebenezer Richard","context_page_description":"Gweinidog o Gymru oedd Ebenezer Richard.\\nCafodd ei eni yn Nhrefin yn 1781. Cofir am Richard yn bennaf fel un o brif drefnwyr y Methodistiaid Calfinaidd yn nechrau'r 19eg ganrif.\\nMae gan y Llyfrgell Genedlaethol Cymru casgliad archifau am y person yma."},{"page_url":"https://pt.wikipedia.org/wiki/Batalh%C3%A3o_de_Patrulha_Escolar_Comunit%C3%A1ria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Viatura_porto_barreiro_policia_militar.jpg","page_title":"Batalhão de Patrulha Escolar Comunitária","context_page_description":"O Batalhão de Patrulha Escolar Comunitária é uma Organização Policial Militar da Polícia Militar do Paraná, especializada na aplicação do policiamento comunitário escolar para todo o Estado do Paraná."},{"page_url":"https://de.wikipedia.org/wiki/Aguntum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Aussichtsturm_Aguntum_1.JPG","page_title":"Aguntum","context_page_description":"Aguntum war eine römische Siedlung, die unter Kaiser Claudius im 1. Jh. n. Chr. zur autonomen Stadt, zum „Municipium Claudium Aguntum“, erhoben wurde. Die Ruinen von Aguntum liegen in Osttirol etwa vier Kilometer östlich von Lienz in der Gemeinde Dölsach. Die Ausgrabungsfläche beträgt 30.000 m²."},{"page_url":"https://ro.wikipedia.org/wiki/1931","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Amza_Pellea.jpg","page_title":"1931","context_page_description":"1931 a fost un an obișnuit al calendarului gregorian, care a început într-o zi de joi."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%9F%D0%B0%D0%BD%D1%82%D0%B5%D0%BB%D0%B5%D1%98%D0%BC%D0%BE%D0%BD%E2%80%9C_-_%D0%92%D0%B5%D0%BB%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Master_Builder_Andrey_Damyanov%27s_insignia.jpg","page_title":"Црква „Св. Пантелејмон“ - Велес","context_page_description":"„Св. Пантелејмон“ се наоѓа во Велес. Црквата е изградена во 1840. Воедно таа е и соборен храм на Повардарската епархија при МПЦ. Нејзината изградба била извршена од познатиот македонски неимар и градител на цркви во Македонија и низ Балканот, Андреја Дамјанов со своите браќа, од велешкото село Папрадиште. Во близина на црквата се наоѓа гробот на славниот и опеан македонски револуционер Миле Поп Јорданов."},{"page_url":"https://it.wikipedia.org/wiki/Scipione_Riva_Rocci","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Almese_municipio_lapide_scipione_riva_rocci.jpg","page_title":"Scipione Riva Rocci","context_page_description":"Scipione Riva Rocci è stato un medico e accademico italiano, specializzato dapprima in medicina interna e pediatria e successivamente pioniere nella lotta contro la tubercolosi.\\nPerfezionò lo sfigmomanometro a mercurio e diede un grande contributo alla ricerca cardiovascolare e alla pratica clinica."},{"page_url":"https://fr.wikipedia.org/wiki/Surduc","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/DN1H%2C_Surduc_%281%29.jpg","page_title":"Surduc","context_page_description":"Surduc est une commune roumaine du județ de Sălaj, dans la région historique de Transylvanie et dans la région de développement du Nord-ouest."},{"page_url":"https://hu.wikipedia.org/wiki/Frankenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/2012-08-20_Fire_brigade_of_the_Freiwillige_Feuerwehr_Wei%C3%9Fenburg_with_TLF-A_and_KLF-A.jpg","page_title":"Frankenfels","context_page_description":"Frankenfels település Ausztriában, Alsó-Ausztria tartományban, a Sankt Pölten-Land járásban. Tengerszint feletti magassága 464 méter, területe 56,11 km². Lakosainak száma 2023 fő. Frankenfels Sankt Georgen an der Leys, Texingtal, Puchenstuben, Sankt Anton an der Jeßnitz, Kirchberg an der Pielach, Loich és Schwarzenbach an der Pielach településekkel határos."},{"page_url":"https://es.wikipedia.org/wiki/Myslibo%C5%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Myslibor_-_2.JPG","page_title":"Mysliboř","context_page_description":"Mysliboř es una localidad del distrito de Jihlava en la región de Vysočina, República Checa, con una población estimada a principio del año 2018 de 207 habitantes.\\nSe encuentra ubicada en el centro-sur de la región, cerca de la orilla del río Jihlava y de la frontera con la región de Bohemia Meridional.​"},{"page_url":"https://es.wikipedia.org/wiki/Elda_Mara_C%C3%A1rdenas_Ruz","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Lunarasolo.jpg","page_title":"Elda Mara Cárdenas Ruz","context_page_description":"'Lunara, ​ seudónimo de la diseñadora y artista plástica naíf mexicana Elda Mara Cárdenas Ruz."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D1%80%D1%83%D0%BF%D0%BD%D0%B5%D0%B9%D1%88%D0%B8%D1%85_%D0%BF%D0%BE%D1%80%D1%82%D0%BE%D0%B2_%D0%BC%D0%B8%D1%80%D0%B0_(2013)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/TCG_Gemlik_%28F-492%29_docked_at_the_port_in_Colombo..jpg","page_title":"Список крупнейших портов мира (2013)","context_page_description":"Список крупнейших портов мира 2013 года составлен по данным Американской ассоциации портовых властей. Общий грузооборот портов показан в метрических тоннах, фрахтовых тоннах и регистровых тоннах, а грузооборот контейнерных терминалов — в TEU."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_Changsha","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Huangxing_Town_of_Changsha_County.jpg","page_title":"Condado de Changsha","context_page_description":"Changsha léase Chang-Shá es un condado rural bajo la administración directa de la ciudad-prefectura de Changsha. Se ubica al este de la provincia de Hunan, sur de la República Popular China. Su área es de 1756 km² y su población total para 2015 fue de 916000 habitantes."},{"page_url":"https://de.wikipedia.org/wiki/Herrliberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Herrliberg05.jpg","page_title":"Herrliberg","context_page_description":"Herrliberg ist eine politische Gemeinde in der Schweiz. Sie liegt am unteren rechten Zürichseeufer an der sogenannten Goldküste im Bezirk Meilen im Kanton Zürich. Zur Gemeinde zählt auch der Weiler Wetzwil."},{"page_url":"https://es.wikipedia.org/wiki/Cavnic","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Cavnic_jud_Maramures.jpg","page_title":"Cavnic","context_page_description":"Cavnic es una ciudad de Rumania en el distrito de Maramureș."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Bolivar_(Tennessee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Bolivar_tennessee_square_bw.jpg","page_title":"Bolivar (Tennessee)","context_page_description":"Bolivar sī Bí-kok Tennessee chiu Hardeman kūn ê chi̍t ê chng-thâu."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D6%80%D5%A3%D5%A1%D6%80%D5%A5%D5%BF_%D4%B1%D5%A3%D5%B6%D5%A5%D5%BD_%D4%B2%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Margaret_Agnes_Bunn-3.jpg","page_title":"Մարգարետ Ագնես Բան","context_page_description":"Մարգարետ Ագնես Բան, բրիտանացի դերասանուհի:"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9D%92%E5%B2%9B%E5%B8%82%E5%8E%86%E5%8F%B2%E4%BC%98%E7%A7%80%E5%BB%BA%E7%AD%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/%E9%9D%92%E5%B2%9B%E9%BB%84%E5%8F%B0%E8%B7%AF47%E5%8F%B7_2020-03-05.jpg","page_title":"青岛市历史优秀建筑","context_page_description":"青島市歷史優秀建築為青島市境內經青島市人民政府許可對外公布，受《山東省歷史文化名城保護條例》、《青島市城市風貌保護條例》、《青島市歷史建築保護管理辦法》等法律法規保護的一部分歷史建築，至今已公布兩批，共313處，其中包括部分各級文物保護單位。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Gemeindeverb%C3%A4nde_im_D%C3%A9partement_Deux-S%C3%A8vres","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Gemeindeverb%C3%A4nde_im_D%C3%A9partement_Deux-S%C3%A8vres_2019.png","page_title":"Liste der Gemeindeverbände im Département Deux-Sèvres","context_page_description":"Das Département Deux-Sèvres liegt in der Region Nouvelle-Aquitaine in Frankreich. Es untergliedert sich in acht Gemeindeverbände.\\nSiehe auch: Liste der Gemeinden im Département Deux-Sèvres"},{"page_url":"https://de.wikipedia.org/wiki/Spitzenstein_(Hunsr%C3%BCck)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Aussichtsturm_Spitzenstein.jpg","page_title":"Spitzenstein (Hunsrück)","context_page_description":"Der Spitzenstein ist ein 417 m ü. NHN hoher Berg im Hunsrück, wo dieser als Südöstlicher Rheinhunsrück steil ins Obere Mittelrheintal bei St. Goar abfällt. Er erhebt sich östlich von Urbar und nördlich von Niederburg, die beide als Ortsgemeinde der Verbandsgemeinde Sankt Goar-Oberwesel im Rhein-Hunsrück-Kreis angehören.\\nAuf dem Gipfel finden sich Überreste einer Telegrafenstation, die hier Ende des 18. Jahrhunderts errichtet wurde. Sie war Teil einer 700 km langen Telegrafenlinie zwischen Berlin und Trier, die aus insgesamt 61 Stationen bestand. Daneben wurde 2003 ein 21 m hoher Aussichtsturm aus Douglasienholz errichtet. Er war frei zugänglich und bot eine umfassende Rundschau. Im Herbst 2015 wurde der Turm wegen Schwammpilzbefall gesperrt, der Abriss erfolgte im April 2018. Im Jahr 2020 wurde ein neuer Aussichtsturm aus Stahl fertiggestellt, der an der Spitze über den Nachbau eines Flügeltelegraphen verfügt. Die Eröffnung des Turms verzögert sich durch die Corona-Pandemie."},{"page_url":"https://sl.wikipedia.org/wiki/%C4%8Coln","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Pletna_at_Lake_Bled_%282%29.jpg","page_title":"Čoln","context_page_description":"Čóln je manjše vodno plovilo, namenjeno prevozu oseb in tovora po vodi. Splošno sprejeta velikostna meja za čolne je definirana z definicijo ladje ali bolje bruto tonaže, ki ga predpisujejo države na osnovi mednarodnih predpisov ter je povsod nad 500 BT.\\nPrimer takšne kratke definicije je: “ladja je, ladja, katere bruto tonaža je večja od 500, moč strojnega kompleksa večja od 750 kW, v skladu s STCW konvencijo”, kar v tem primer pomeni, da so po definiciji vse drugo čolni.\\nDrugi primer je od Westlawn Institute of Marine Technology, ki je povzel Lloyd: “Čoln je vsako plovilo ali transportno sredstvo, ki plava na vodi ali deluje na vodi in je pod 197 čevljev skupne dolžine. Čoln se lahko uporablja za zabavo, komercialne ali stanovanjske namene. Čoln je sinonim za majhna plovila v uporabi na morju.\\nLadja je vsako plovilo ali transportno sredstvo, ki plava na vodi ali deluje po vodi in je enaka ali večja od 197 čevljev. Ladja se lahko uporablja za zabavo, komercialne ali stanovanjske namene.\\nMejna velikost med čolnom in ladjo je nujno poljubna; vendar Lloydov oddelek za mala plovila obravnava plovila, manjša od 60 metrov."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B2%E0%A5%87%E0%A4%B6%E0%A4%BE%E0%A4%A8_%E0%A4%95%E0%A5%87_%E0%A4%B5%E0%A4%BF%E0%A4%B6%E0%A4%BE%E0%A4%B2_%E0%A4%AC%E0%A5%81%E0%A4%A6%E0%A5%8D%E0%A4%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Leshan_giant_buddha_tour.jpg","page_title":"लेशान के विशाल बुद्ध","context_page_description":"लेशान के विशाल बुद्ध तांग वंश के शासन के दौरान बनाई गयी गौतम बुद्ध की 71-मीटर ऊँची विशाल प्रतिमा है। इस प्रतिमा को लाल बलुआ पत्थर की चट्टान एमी पर्वत को तराश कर बनाया गया है। यह चीन के दक्षिण में स्थित सिचुआन प्रांत के शहर लेशान में मिनजियांग, दादु और किंग्यी नदी के संगम पर स्थित है। यह दुनिया में सबसे ऊँची पत्थर की प्रतिमा है और इसके निर्माण के समय तो यह दुनिया में बुद्ध की सबसे ऊँची मूर्ति थी।\\nलेशान की विशाल बुद्ध प्रतिमा सन 1996 के बाद से यूनेस्को विश्व धरोहर स्थल के रूप में सूचीबद्ध है। सन 2008 में सिचुआन में आये भूकंप से यह क्षतिग्रस्त नहीं हुई है।"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E7%94%A3%E8%87%AA%E5%8B%95%E8%BB%8A%E3%81%AE%E8%BB%8A%E7%A8%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Nissan_Sunny_California.JPG","page_title":"日産自動車の車種一覧","context_page_description":"日産自動車の車種一覧では、日産自動車から発売されている車種、今後発売予定の車種、以前発売していた車種について記述する。なお本項では、日産自動車の前身であるダット自動車製造の車種と、1966年に日産自動車に吸収合併されたプリンス自動車工業の車種についても述べる。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%BF%D0%B0%D0%BF%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Pope_Alexander_II.jpg","page_title":"Списък на папи","context_page_description":"Това е списък на списък на папите на Римокатолическата църква. Римският папа в духовно отношение е глава и върховен суверенен йерарх на Църквата, а в международно право – суверенно лице с изключителни пълномощия, защото едновременно притежава три неразделни функции на властта: 1 глава и суверен на Светия престол; 2 наследник на Свети Петър и глава на Католическата църква и неин върховен йерарх, и 3 абсолютен суверен на града-държава Ватикана.\\nНай-популярни папски имена са: Йоан, Григорий (XVI), Бенедикт (XVI), Климент (XIV), Инокентий и Лъв (XIII)."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B5-%D0%9B%D1%83%D1%80%D1%83-%D0%91%D0%B5%D0%BA%D0%BE%D0%BD%D0%BD%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/LourouxTiKer.JPG","page_title":"Ле-Луру-Беконне","context_page_description":"Ле-Луру́-Беконне́ — муніципалітет у Франції, у регіоні Пеї-де-ла-Луар, департамент Мен і Луара. Населення — 2901 осіб.\\nМуніципалітет розташований на відстані близько 290 км на південний захід від Парижа, 65 км на північний схід від Нанта, 26 км на захід від Анже."},{"page_url":"https://en.wikipedia.org/wiki/Shafin_Ahmed","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Shafin_Ahmed_Miles_Legend.jpg","page_title":"Shafin Ahmed","context_page_description":"Shafin Ahmed is a Bangladeshi rock bassist, singer-songwriter, record producer and politician. He is the lead singer, songwriter and bassist for the Bangladeshi rock band Miles, where he and his elder brother Hamin Ahmed joined, in 1984.\\nBorn in the city of Kolkata, Ahmed is the youngest son of Indian classical music singer Kamal Dasgupta and Bangladeshi singer Firoza Begum. Their family was traditionally a musical family. He started his musical career at the age of 9. They moved to Dhaka in the late 60s. He was exposed to rock and roll music in the late 70s, when he went to London for higher education. He joined Miles in 1986, as the lead singer and bassist."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%88%D9%8A%D8%AA%D9%88%D8%A7%D8%AA%D8%B1_(%D9%86%D9%88%D9%84%D8%A7%D9%86,_%D8%AA%D9%83%D8%B3%D8%A7%D8%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Sweetwater_Texas_Municipal_Building.jpg","page_title":"سويتواتر (نولان, تكساس)","context_page_description":"سويتواتر مدينه امريكيه اداريا بتتبع مقاطعه نولان, تكساس."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A5%8B%E0%A4%B9%E0%A4%AE%E0%A5%8D%E0%A4%AE%E0%A4%A6_%E0%A4%85%E0%A4%B2%E0%A5%80_%E0%A4%B0%E0%A4%9C%E0%A4%BE%E0%A4%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Portrait_of_Mohammad-Ali_Rajai.jpg","page_title":"मोहम्मद अली रजाई","context_page_description":"मुहम्मद अली रजाई ईरान के दूसरे राष्ट्रपति थे जिन्होनें २ से ३० अगस्त तक राष्ट्रपति के ओहदे पर काम किया। इस से पहले वे अबोल-हसन बनि-सद्र के नीचे प्रधान मंत्री रह चुके थे। ३० अगस्त १९८१ को उनपर एक जानलेवा हमला हुआ जिसमें वे और उनके प्रधान मंत्री मुहम्मद-जवाद बाहोनर दोनों मारे गए। जून १९८१ में बनिसद्र को राष्ट्रपति-पद से बेदख़ल कर दिया गया था जिस से देशभर में रोष फैला। इस माहौल में मोजाहेदीन-ए-ख़ल्क़ नामक संगठन ने अपने हज़ारों समर्थकों के साथ एक विद्रोह आयोजित किया। कम-से-कम १०० राजनैतिक नेता इस विद्रोह में मारे गए, जिनमें रजाई शामिल थे।"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_beffrois_du_Nord-Pas-de-Calais","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Town_hall_of_Dunkerque-7585.jpg","page_title":"Liste des beffrois du Nord-Pas-de-Calais","context_page_description":"La région Nord-Pas-de-Calais comporte plusieurs beffrois.\\nDix-sept sont inscrits dans les Beffrois de Belgique et de France. Le beffroi le plus haut est celui de la mairie de Lille, avec une hauteur totale de 104 mètres. Cette hauteur lui confère la caractéristique d'être le plus haut beffroi du Nord de l'Europe."},{"page_url":"https://sl.wikipedia.org/wiki/Avtocestni_predor_Karavanke","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Baustelle_Karawankentunnel_29._Aug_2019_Nr_1.jpg","page_title":"Avtocestni predor Karavanke","context_page_description":"Predor Karavanke je avtocestni predor med Slovenijo in Avstrijo. Poteka pod istoimenskim gorovjem in povezuje slovensko avtocesto A2 z avstrijsko A11. Dolžina predora je 8019 metrov med portaloma, rudarska dolžina pa znaša 7864 metrov, s katero so Karavanke najdaljši cestni predor v Sloveniji. Zgrajen je bil v letih 1986 do 1991, s čimer sta bili razbremenjeni edini dotedanji cestni povezavi med severozahodno Slovenijo in Avstrijo, Ljubelj in Korensko sedlo.\\nPredor Karavanke upravljajo z obeh strani meje iz nadzornih centrov, in sicer izmenično: ko en mesec predor nadzira in upravlja z njim slovenska stran, je avstrijska v pripravljenosti, in obratno."},{"page_url":"https://de.wikipedia.org/wiki/Leopold_Winarsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Winarsky-Hof_Winarksystrasse.jpg","page_title":"Leopold Winarsky","context_page_description":"Leopold Winarsky war ein österreichischer Politiker und Reichsratsabgeordneter."},{"page_url":"https://en.wikipedia.org/wiki/Ephraim_Stern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ephraim_shatran.jpg","page_title":"Ephraim Stern","context_page_description":"Ephraim Stern was an Israeli archaeologist and professor at the Hebrew University of Jerusalem. He specialized in the archaeology of ancient Israel and Judah and Phoenicia, and was known for his excavations at Tel Dor.\\nHe received the EMET Prize in 2005."},{"page_url":"https://uz.wikipedia.org/wiki/Oprah_Winfrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Oprah_in_2014.jpg","page_title":"Oprah Winfrey","context_page_description":"Opra Gayl Uinfri — amerikalik taniqli aktrisa, teleboshlovchi yulduz. U bir necha yillardan beri dunyoning eng kuchli teleboshlovchisidir. Forbes maʼlumotiga koʻra, uning boyligi 2.8 milliard dollardan ziyod. Oʻzining shaxsiy telekanali, radiosi, internet manbasi, kinostudiyasi, jurnali bor."},{"page_url":"https://de.wikipedia.org/wiki/Meersalat%C3%A4hnliche_Wasser%C3%A4hre","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Aponogeton_Ulvaceus.png","page_title":"Meersalatähnliche Wasserähre","context_page_description":"Die Meersalatähnliche Wasserähre ist eine amphibisch lebende Pflanze aus der Familie der Wasserährengewächse."},{"page_url":"https://nn.wikipedia.org/wiki/Rivertonprisen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Tor%C3%85geBringsv%C3%A6rd_H%C3%B8len2006-06-17.JPG","page_title":"Rivertonprisen","context_page_description":"Rivertonprisen – «Den gyldne revolver» – vert delt ut årleg av Rivertonklubben, og skal gå til forfattaren av årets beste norske kriminallitterære arbeid. Prisen er eit samarbeid mellom Rivertonklubben, Bokhandlerforeningen, Den norske Forleggerforening og De norske Bokklubbene. Det er Rivertonklubben eigne jury som utnemner vinnaren. Sjølve prisen er ein forgylt Nagantrevolver.\\nFram til 2001 kunne ein person ikkje få prisen meir enn ei gong. I dag kan forfattarar få prisen ei andre gong, for eit arbeid som vert vurdert som eit klart høgdepunkt i karrieren, eller for eit markant come-back. To forfattarar har motteke prisen to gonger, Gunnar Staalesen i 1975 og 2002, og Jon Michelet i 1981 og 2001 — begge for markante come-back. Torolf Elster er den einaste som både har fått den ordinær prisen, og æresprisen."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%AE%D9%88%DA%95%D8%AE%D9%88%DA%95%DB%95%D8%8C_%D8%B3%DB%95%D9%82%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Khvor_Khvoreh%2C_Saqqez_2014_spring_2.JPG","page_title":"خوڕخوڕە، سەقز","context_page_description":"خوڕخوڕە دێیەکە لە ناوچەی زێویەی شارستانی سەقز. ژمارەی دانیشتووانی لە سەرژمێریی ساڵی ٢٠٠٦دا ٢٦٣ کەس لە ٥٦ بنەماڵەدا بووە."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BA%D1%81%D0%B0,_%D0%A4%D1%80%D0%B0%D0%BD%D1%82%D0%B8%D1%88%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Franti%C5%A1ek_Lexa_%281876-1960%29.jpg","page_title":"Лекса, Франтишек","context_page_description":"Франтишек Лекса — чешский и чехословацкий египтолог, педагог, доктор философии, профессор египтологии Карлова университета, один из инициаторов создания Чехословацкого египтологического института, первый директор института египтологии при Карловом университете в Праге в 1958—1960 годах.\\nОсновоположник египтологии в Чехословакии. Член Академии наук Чехословакии."},{"page_url":"https://fr.wikipedia.org/wiki/Si%C3%A8ge_de_Derry","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/George_Folingsby_Relief_of_Derry.jpg","page_title":"Siège de Derry","context_page_description":"Le siège de Derry est le premier événement important des guerres williamites en Irlande. Les portes de la ville furent fermées le 7 décembre 1688, mais le siège lui-même ne débuta qu'en avril 1689. Le siège dure trois mois et demi, prenant fin le 30 juillet 1689, quand des navires de la marine anglaise, remontant l'estuaire de la rivière Foyle, forcent le barrage flottant établi par l'armée jacobite, apportant des vivres et des munitions.\\nCe siège, qui a coûté la vie à 8 000 habitants de Derry, est commémoré chaque année par la fraternité protestante des Apprentice Boys of Derry. Il demeure un élément constitutif de la culture protestante unioniste d'Irlande du Nord, aux côtés de la bataille de la Boyne et de la bataille de la Somme."},{"page_url":"https://pl.wikipedia.org/wiki/Kagu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Kagu_Rhynchetos_jubatus_detail.JPG","page_title":"Kagu","context_page_description":"Kagu – gatunek ptaka zamieszkującego Nową Kaledonię, będącego jedynym przedstawicielem rodziny kagu z rzędu słonecznicowych. Uważany jest za bardzo stary gatunek, najbliżej spokrewniony z występującą w międzyzwrotnikowej strefie Ameryk słonecznicą, z którą został sklasyfikowany w odrębny rząd."},{"page_url":"https://en.wikipedia.org/wiki/Effects_unit","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/MXR_M-101_Phase_90_modified.jpg","page_title":"Effects unit","context_page_description":"An effects unit or effects pedal is an electronic device that alters the sound of a musical instrument or other audio source.\\nCommon effects include distortion/overdrive, often used with electric guitar in electric blues and rock music; dynamic effects such as volume pedals and compressors, which affect loudness; filters such as wah-wah pedals and graphic equalizers, which modify frequency ranges; modulation effects, such as chorus, flangers and phasers; pitch effects such as pitch shifters; and time effects, such as reverb and delay, which create echoing sounds and emulate the sound of different spaces.\\nMost modern effects use solid-state electronics or computer chips. Some effects, particularly older ones such as Leslie speakers and spring reverbs, use mechanical components or vacuum tubes. Effects are often used as stompboxes, typically placed on the floor and controlled with footswitches. They are also built into amplifiers, some instruments, tabletop units designed for DJs and record producers, and rackmounts, and are widely used as software plugins in such common formats as VST, AAX, and AU."},{"page_url":"https://sv.wikipedia.org/wiki/S21_Flygplatsmotorv%C3%A4gen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Airport_Expressway_Dashanzi_Jul2004.jpg","page_title":"S21 Flygplatsmotorvägen","context_page_description":"S21 Flygplatsmotorvägen eller Airport Expressway är en motorväg i Peking i Kina. Flygplatsmotorvägen förbinder Pekings internationella flygplats i Shunyidistriktet nordost om centrum med centrala Peking. Vägen är en av Pekings mest trafikerade motorvägar, och är knappt 20 km lång. Hastighetsbegränsningen är 120 km/h för vänsterfilen och 100 km/h för övriga filer."},{"page_url":"https://en.wikipedia.org/wiki/List_of_RNLI_stations","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Aberystwyth_Lifeboat_Station_-_geograph.org.uk_-_512404.jpg","page_title":"List of RNLI stations","context_page_description":"Royal National Lifeboat Institution stations are the bases for the RNLI's fleet of search and rescue lifeboats that cover the coastal waters around the entire British Isles, as well as major inland waterways.\\nThe service was established in 1824 and is operated largely by volunteers. Its headquarters are at Poole, Dorset and it is a registered charity in both the United Kingdom and Republic of Ireland."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Z%C3%BCrich/Kreis_1_(West)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Z%C3%BCrich_Zeughauskeller.jpg","page_title":"Liste der Kulturgüter in Zürich/Kreis 1 (West)","context_page_description":"Die Liste der Kulturgüter in Zürich/Kreis 1 (West) enthält alle Objekte im westlichen Teil des Kreises 1 der Stadt Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nDie Liste umfasst Kulturgüter links der Limmat. Objekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://io.wikipedia.org/wiki/Union,_Alabama","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/ALMap-doton-Union.PNG","page_title":"Union, Alabama","context_page_description":"Union esas urbeto en la komtio Greene, Alabama, Usa. Segun la demografiala kontado di 2000, ol havis 227 habitanti."},{"page_url":"https://la.wikipedia.org/wiki/Remaisnil","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Map_commune_FR_insee_code_80666.png","page_title":"Remaisnil","context_page_description":"Remaisnil est commune Francicum 39 incolarum praefecturae Samara in provincia Picardia."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_Wolverhampton","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Statue_of_Sir_Jack_Hayward_at_The_Molineux_in_Wolverhampton_%2847467413961%29.jpg","page_title":"List of public art in Wolverhampton","context_page_description":"This is a list of public art in Wolverhampton, in the West Midlands, England. This list applies only to works of public art accessible in an outdoor public space. For example, this does not include artwork visible inside a museum."},{"page_url":"https://sh.wikipedia.org/wiki/3-Nitrobenzojeva_kiselina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/3-Nitrobenzoic-acid-3D-balls.png","page_title":"3-Nitrobenzojeva kiselina","context_page_description":"3-Nitrobenzojeva kiselina je organsko jedinjenje, koje sadrži 7 atoma ugljenika i ima molekulsku masu od 167,119 Da."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Flintbek","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Meilenstein_Voorde.jpg","page_title":"Liste der Kulturdenkmale in Flintbek","context_page_description":"In der Liste der Kulturdenkmale in Flintbek sind alle Kulturdenkmale der schleswig-holsteinischen Gemeinde Flintbek und ihrer Ortsteile aufgelistet."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B4%DA%AF%D8%A7%D9%87_%D9%81%D9%88%D8%AA%D8%A8%D8%A7%D9%84_%DB%8C%D9%88%D9%88%D9%86%D8%AA%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Supercoppaitaliana.png","page_title":"باشگاه فوتبال یوونتوس","context_page_description":"باشگاه فوتبال یوونتوس که با نام‌های یوونتوس یا یووه نیز شناخته می‌شود، نام یک باشگاه فوتبال حرفه‌ای است که در شهر تورین، در کشور ایتالیا قرار دارد. یوونتوس سومین باشگاه قدیمی فوتبال ایتالیا بعد از جنوا و اودینزه محسوب می‌شود. این باشگاه به جز فصل ۰۷–۲۰۰۶ که بخاطر مسائل کالچو پولی به سری بی تبعید شد، همواره در تاریخ خود در سری آ که بالاترین سطح فوتبال ایتالیا به‌شمار می‌رود، حضور داشته‌است.\\nاین باشگاه در سال ۱۸۹۷ توسط چند دانشجوی تورینی و با نام باشگاه ورزشی یوونتوس بنیان‌گذاری شد. یوونتوس از سال ۱۹۲۳ توسط خانواده آنیلی اداره می‌شود و یکی از پرافتخارترین باشگاه‌های فوتبال در ایتالیا و جهان است.\\nباشگاه یوونتوس در ایتالیا موفق شده ۳۶ مرتبه سری آ را بالای سر ببرد، ۱۳ بار فاتح جام حذفی ایتالیا و ۸ بار فاتح سوپر جام ایتالیا شود."},{"page_url":"https://ca.wikipedia.org/wiki/Sarah_Michelle_Gellar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Sarah_Michelle_Gellar_2012.jpg","page_title":"Sarah Michelle Gellar","context_page_description":"Sarah Michelle Gellar —nom de casada: Sarah Michelle Prinze— és una actriu i productora estatunidenca. Un agent la va descobrir en un restaurant de Nova York i la va fer debutar en un telefilm. La fama li va arribar amb la seva participació en les pel·lícules de terror I Know What You Did Last Summer i Scream 2, però especialment per ser la protagonista de la sèrie de televisió Buffy the Vampire Slayer treball pel que, el 2001, fou nominada al Globus d'Or a la millor actriu en sèrie de televisió dramàtica."},{"page_url":"https://pl.wikipedia.org/wiki/Phillips_Collection","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/The_Phillips_Collection.JPG","page_title":"Phillips Collection","context_page_description":"The Phillips Collection – prywatna galeria sztuki w Waszyngtonie, założona w 1921 przez Duncana Phillipsa jako Phillips Memorial Art Gallery położona w obrębie Dupont Circle na przedmieściach Waszyngtonu. Specjalnością galerii są dzieła sztuki nowoczesnej."},{"page_url":"https://sv.wikipedia.org/wiki/Gryta_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/GrytaKyrka1907.jpg","page_title":"Gryta kyrka","context_page_description":"Gryta kyrka är en medeltida kyrkobyggnad som är belägen cirka två kilometer nordost om Örsundsbro. Kyrkan ligger i en flack dalgång längs den gamla kungliga Eriksgatan i Lagunda församling i Uppsala stift. Länsväg C 589 leder fram till kyrkan."},{"page_url":"https://tr.wikipedia.org/wiki/Valiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Samsonite_Pro-DLX_4_Rolling_Tote_16.4_Inch_Black.jpg","page_title":"Valiz","context_page_description":"Valiz bir bagaj şeklidir. Genellikle, yuvarlak, yuvarlak köşeli, metal, sert plastik veya şeklini az çok koruyan bez, vinil veya deriden yapılmış bir şekilde yassı, dikdörtgen şeklinde bir çantadır. Vinil, deri veya kumaş valizlerin metal bir çerçevesi olabilir. Bir tarafında taşıma tutamağı vardır ve özellikle seyahatler sırasında giysi, tuvalet malzemeleri ve diğer küçük eşyaları taşımak için kullanılır. Valizler anahtar veya bir kombinasyonla kilitlenebilir.\\nBaşlangıçta, valizler yün veya ketenden yapılmıştır. Deri aynı zamanda bavullar için popüler bir malzeme haline geldi. Tahta valizleri örtmek için ya da sadece katlanabilir valizler için kullanıldı. Valizlerden yapılan tüm malzemeleri belgelemek zordur. Üretilen tüm tüketim malları gibi, valiz yapmak için seçilen malzemeler de zamanlarının bir ürünüdür. Yün, ahşap, deri, metal, plastik, fiber kompozit, hatta geri dönüştürülmüş malzemeler bile genel bavul malzemelerdir.\\nEn sağlam valizler genellikle naylon gibi polimerlerden yapılır ve oyuklara ve sıvının içeri girmesini önleyen bir kaplamaya sahiptir. Dikişler birbirine tutturulabilir veya güçlü naylon ipliklerle dikilebilir."},{"page_url":"https://en.wikipedia.org/wiki/Marshal_of_Poland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Marshal_Rydz-Smigly_LOC_hec_27123.jpg","page_title":"Marshal of Poland","context_page_description":"Marshal of Poland is the highest rank in the Polish Army. It has been granted to only six officers. At present, this rank is equivalent to a Field Marshal or General of the Army in other NATO armies."},{"page_url":"https://it.wikipedia.org/wiki/Martin_Hansen_(calciatore)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Martin_Hansen_%282015%29.jpg","page_title":"Martin Hansen (calciatore)","context_page_description":"Martin Hamsen è un calciatore danese, portiere dell'Hannover 96."},{"page_url":"https://en.wikipedia.org/wiki/List_of_named_corners_of_the_Snaefell_Mountain_Course","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ramsey_Hairpin_-_geograph.org.uk_-_469730.jpg","page_title":"List of named corners of the Snaefell Mountain Course","context_page_description":"The Snaefell Mountain Course, a motorsport racing circuit that was once part of Grand Prix motorcycle racing, has more than 60 named corners, bends, straightaways, and other features. Unlike the closed-circuit race tracks now used in all Grand Prix championship races, the course runs 37.73 miles almost entirely along public roads of the Isle of Man.\\nThis list includes prominent corners and other landmarks along the course, with names that are used in media coverage and by racers, spectators, and administrators.\\nThe number of turns in the course is debatable – writing in his 1974 book, TT racer and motorcycle journalist Ray Knight mentioned that the Guinness Book of Records quoted 264, echoed by a 2011 report. Some of the curves, S-bends, turns at crossroads, and other features in the course would not seem significant to car drivers in public traffic, but they are very significant for high-speed racers. 135.452 mph is the highest average speed that has been attained over one lap of the course, by Peter Hickman on 8 June 2018 when he won the Senior TT. At jumps where most race machines rise clear off the ground, drivers of cars at slow speeds might not even notice a bump."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E4%B8%AD%E5%B8%82%E5%BF%AB%E6%8D%B7%E5%B7%B4%E5%A3%AB%E8%97%8D%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/%E5%8F%B0%E4%B8%AD%E5%B8%82%E5%85%AC%E8%BB%8A771-U5.JPG","page_title":"臺中市快捷巴士藍線","context_page_description":"█ 臺中市快捷巴士藍線是臺中市快捷巴士系統中唯一營運過的路線。原本的最終規劃路線為屯區藝文中心至臺中港旅客服務中心；唯一營運過的路段為優先路段，2013年8月8日動工，2014年7月27日通車，2015年7月7日中止營運，轉換為臺中市優化公車專用道。路線全程除臺灣大道一段及秋紅谷站－福安站間外，均設有專用道，僅限BRT車輛及緊急車輛通行。臺中市快捷巴士藍線採用雙節式大客車，是台灣第一條也是當時唯一一條的雙節式大客車路線。"},{"page_url":"https://en.wikipedia.org/wiki/R%C4%B1za_Nur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Lausanne_2.jpg","page_title":"Rıza Nur","context_page_description":"Rıza Nur was a Turkish surgeon, politician and writer. He was prominent in the years immediately after the First World War, where he served as a cabinet minister but was subsequently marginalised, and became a critic of the new regime."},{"page_url":"https://de.wikipedia.org/wiki/Haakon_Jarl_(Schiff)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/DS_Haakon_Jarl.jpg","page_title":"Haakon Jarl (Schiff)","context_page_description":"Die Haakon Jarl war ein 1879 in Dienst gestelltes Passagierschiff der norwegischen Reederei Det Nordenfjeldske Dampskibsselskab, das ab 1905 Passagiere und Fracht auf den Hurtigruten entlang der norwegischen Küste transportierte. Am 17. Juni 1924 sank die Haakon Jarl im Vestfjord nach einer Kollision mit der Kong Harald. 17 Menschen kamen dabei ums Leben."},{"page_url":"https://pl.wikipedia.org/wiki/Diagram_Tanabe-Sugano","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/D4_Tanabe-Sugano_diagram.png","page_title":"Diagram Tanabe-Sugano","context_page_description":"Diagram Tanabe-Sugano – w spektroskopii i chemii koordynacyjnej, wykres przedstawiający zależność energii termów, od wielkości rozszczepienia orbitalu d. Nazwa pochodzi od nazwiska japońskich naukowców Yukito Tanabe i Satoru Sugano. Podobnym wykresem jest diagram Orgela."},{"page_url":"https://eu.wikipedia.org/wiki/Purita_Campos","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Purita_Campos_%282010%29.jpg","page_title":"Purita Campos","context_page_description":"Purificación Campos Sánchez Purita edo Pura Campos bezala ezagunagoa, komikigile, marrazkilari eta margolari ezaguna izan zen, batez ere XX. mendeko nazioarteko komiki munduan. Arte Ederren Merituaren Urrezko Domina eman zioten 2009an."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D9%86%DA%AF%D9%84_%D9%88%DB%8C%D9%84%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/The_Forest_of_Anderida_during_the_Roman_Occupation_of_Britain.jpg","page_title":"جنگل ویلد","context_page_description":"جنگل ویلد نام منطقه‌ای است در جنوب شرقی انگلستان و از نظر موقعیت جغرافیایی میان یک دیواره گچ فرنگی در شمال منطقه ساوت دانز جنوبی قرار گرفته است. گستردگی این جنگل در بخش‌های ساسکس همپشر، کنت و ساری است. جنگل ویلد دارای سه بخش جداگانه ماسه‌سنگی در ارتفاع بالا در مرکز جنگل، خاک رس در بخش پایینی و چمن زار که تا پیرامون منطقه شمالی و غربی جنگل ویلد کشیده شده است و بلندترین جایگاه‌های جنگل را دربرگرفته است.\\nدشت ویلد در زمانی پوشیده از جنگل بود. نام اصلی آن در انگلیسی باستان درخت زار بوده است. این اصطلاح همچنان در مناطق روستایی و کشتزارهای دور افتاده که ویلد نامیده می شوند رایج است."},{"page_url":"https://en.wikipedia.org/wiki/USS_Staff_(AM-114)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Staff_%28MSF_114%29.jpg","page_title":"USS Staff (AM-114)","context_page_description":"USS Staff (AM-114) was an Auk-class minesweeper acquired by the United States Navy for the dangerous task of removing mines from minefields laid in the water to prevent ships from passing.\\nStaff was laid down on 28 November 1941 by the American Ship Building Company at Cleveland, Ohio; launched on 17 June 1942; and commissioned on Veterans Day 1942, Lt. Comdr. R. T. McDaniel, USNR, in command."},{"page_url":"https://ca.wikipedia.org/wiki/Santa_Mar%C3%ADa_la_Blanca","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/RoyLindmanSantaMarialaBlancaToledo_005.jpg","page_title":"Santa María la Blanca","context_page_description":"Santa María la Blanca és un temple a la ciutat espanyola de Toledo. Construït l'any 1180 com a sinagoga i, havent funcionat com a tal durant 211 anys, va ser expropiada i transformada en església com a conseqüència del pogrom de 1391. Avui dia l'edifici pertany a l'Església catòlica, però no es realitza culte en ell. Es troba obert al públic i funciona com a museu o centre on es desenvolupen activitats tant culturals com a educatives."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%AC%EA%B1%80%EB%B2%84%EC%84%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/2015-08-19_Amanita_hemibapha_%28Berk._%26_Broome%29_Sacc_591749.jpg","page_title":"달걀버섯","context_page_description":"달걀버섯은 주름버섯목 광대버섯과에 속하는 버섯이다."},{"page_url":"https://hu.wikipedia.org/wiki/Jada_Pinkett_Smith","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jada_Pinkett_Smith_at_NY_PaleyFest_2014_for_Gotham.jpg","page_title":"Jada Pinkett Smith","context_page_description":"Jada Koren Pinkett Smith amerikai színésznő, táncosnő, énekes-dalszerző és üzletasszony.\\nMiután 1990-ben vendégszerepelt a True Colors című sorozatban, 1991 és 1993 között Bill Cosby A Different World című szituációs komédiájában játszott. 1993-ban debütált a filmvásznon a Veszélyes elemek című filmdrámában. 1994-ben a Tintatartó című romantikus vígjáték-drámában tűnt fel, ezt követte a Bölcsek kövére, Eddie Murphy oldalán. További filmjei közé tartozik A nagy dobás, a Sikoly 2., az Ali, a Mátrix – Újratöltve és a Mátrix – Forradalmak, valamint a Rossz anyák. Szinkronszínészként hangját kölcsönözte a 2005-ös Madagaszkár című filmben és annak több folytatásában. A 2010-es évek közepén a Gotham című televíziós sorozatban töltött be fontosabb szerepet.\\nZenei karrierje 2002-ben indult a Wicked Wisdom nevű metálzenekarral, melyben énekes-dalszerző feladatkört tölt be.\\n1997 óta a színész és zenész Will Smith felesége. Két közös gyermekük született, Jaden és Willow."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wegekreuze_und_Bildst%C3%B6cke_im_Bonner_Ortsteil_Limperich","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Limperich-wegekreuz-kreuzherrenstrasse-eichendorffstrasse-03.jpg","page_title":"Liste der Wegekreuze und Bildstöcke im Bonner Ortsteil Limperich","context_page_description":"Die folgende Liste enthält die Wege-, Grabkreuze und Bildstöcke, die auf dem Gebiet des Bonner Ortsteils Limperich im Stadtbezirk Beuel nachgewiesen sind."},{"page_url":"https://sl.wikipedia.org/wiki/Richard_von_Mises","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Richard_von_Mises.jpeg","page_title":"Richard von Mises","context_page_description":"Richard Edler von Mises, avstrijski fizik in matematik, * 19. april 1883, Lemberg, Avstro-Ogrska, † 14. julij 1953, Boston, Massachusetts, ZDA.\\nVon Mises je deloval na področju mehanike trdnin, mehanike tekočin, aerodinamike, aeronavtike, statistike in verjetnostnega računa. Od leta 1944 je bil Gordon-McKayjev profesor aerodinamike in uporabne matematike na Univerzi Harvard."},{"page_url":"https://pt.wikipedia.org/wiki/Sorvete_de_mochi","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Mochi_Ice_Cream.jpg","page_title":"Sorvete de mochi","context_page_description":"Sorvete de mochi é um tipo de doce japonês feito de mochi recheado com sorvete. Foi criado pela empresária e ativista nipo-americana Frances Hashimoto."},{"page_url":"https://en.wikipedia.org/wiki/Heinrich_Sch%C3%BCtz_House,_Bad_K%C3%B6stritz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Bad_Koestritz_Heinrich-Schuetz-Haus-01.jpg","page_title":"Heinrich Schütz House, Bad Köstritz","context_page_description":"Heinrich Schütz House is a cultural site in Bad Köstritz, in Thuringia, Germany. The composer Heinrich Schütz was born here; the house is now a museum about his life and work."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%BE%D5%BD%D5%BF%D6%80%D5%AB%D5%A1%D5%B5%D5%AB_%D5%AC%D5%B3%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Wolfgangsee_-_Evening.JPG","page_title":"Ավստրիայի լճերի ցանկ","context_page_description":"Սա Ավստրիայի լճերի ցանկ է։\\nԱխենզե — սա ամենամեծ և ամենակենդանաշատ լիճն է ալպիական լճերից և գտնվում է Ավստրիայում, Տիրոլ բնակավայրում: Այն շրջապատված է լեռների կտրուկ զառիթափներով, որոնց բարձրությունը հասնում է մինչև 2000 մ: Այս լճի երկարությունը հասնում է 8 կմ, լայնությունը 1 - 2 կմ է, իսկ խորությունը հասնում է 133 կմ: Լիճը առանձնանում է իր վառ կապույտ գույնով, իսկ ջուրը համարվում է խմելի, պարզ, զուլալ է մոտ տասը մետր ջրային տարածք: Ջրի ջերմաստիճանը երբեմն գերազանցում է 20 °C -ն: Իր մեծ չափերի և հաճախակի քամիների առկայության շնորհիվ լիճը հարմար է սահելու և վինդսյորֆինգով զբաղվելու համար:\\nԱլմզե — լիճ, որը գտնվում է Վերին Ավստրիայում, Ալպերում, լեռնային զանգվածի հյուսիսային վերջավորությունում Տոտես-Գեբիրգե: Լիճը գտնվում է ծովի մակարդակից 589 մետր բարձրության վրա, Գրյունաուից 14 կմ հարավ: Լճից դուրս է հոսում Ալմ գետը, որը պատկանում է Դունայավազանին: Ջրի մակարդակը հասնում է 2,1 կմ³, մակերեսը — 0,85 կմ², իսկ ամենաշատ խորությունը — 5 մ: Ջրի ցածր ջերմաստիճանի պատճառով լճում լողանալը սահմանափակված է: Այնուամենայնիվ, հարակից տարածքը օգտագործվում է արշավների համար: Ձմռանը Ալզմեն ամբողջովին սառցակալում է և դառնում է չմշկավազքի հիանալի սառցադաշտ:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Des_Moines_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Jagger-Churchill_House_1_-_Burlington_Iowa.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Des Moines County","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Des Moines County in Iowa führt die Bauwerke und historischen Stätten im Des Moines County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://ceb.wikipedia.org/wiki/Xanthichthys_mento","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Stamps_of_Ecuador%2C_2003-29.jpg","page_title":"Xanthichthys mento","context_page_description":"Espesye sa isda nga una nga gihulagway ni Jordan ug Gilbert ni adtong 1882 ang Xanthichthys mento. Ang Xanthichthys mento sakop sa kahenera nga Xanthichthys sa kabanay nga Balistidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%AF%D9%88%D8%A7%D8%B1%D8%AF_%D8%A2%D8%AF%D8%B1%DB%8C%D8%A7%D9%86_%D9%88%DB%8C%D9%84%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Edward_Wilson_Cheltenham.jpg","page_title":"ادوارد آدریان ویلسون","context_page_description":"ادوارد آدریان ویلسون یک سیاح، پرنده‌شناس و نقاش اهل بریتانیا بود. وی که از اولین مکتشفان قطب جنوب بوده به همراه رابرت فالکون اسکات در سال‌های ۱۹۰۱ تا ۱۹۰۴ به قطب جنوب سفر کرده‌است\\nویلسون در تاریخ ۱ نوامبر ۱۹۱۱ به همراه تیم اکتشاف گروه اعزامی ترا نووا به سمت قطب جنوب حرکت کرده و در ۱۸ ژانویه ۱۹۱۲ به مقصد رسیده، آن‌ها در حین عملیات تحقیقاتی با حادثه و کمبود غذا روبه‌رو شدند که باعث مرگ ادگار اونز از افسران تیم و سپس کاپیتان لارنس اوتس شد، وی در حالی که به سمت کمپ اصلی در حرکت بود در ۱۴۸ مایلی آن در طوفان برف گرفتار شد و در تاریخ ۲۹ مارس ۱۹۱۲ به همراه رابرت فالکون اسکات و هنری رابرتسون باورز درگذشت.\\nفیلم اسکات از قطب جنوب براساس اتفاقات زندگی وی و تیم همراه در قطب جنوب ساخته شده‌است."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%9C%D7%9E%D7%94_%D7%92%D7%95%D7%A8%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%D7%94%D7%A8%D7%A6%D7%99%22%D7%94_%D7%94%D7%A8%D7%91_%D7%90%D7%91%D7%A8%D7%94%D7%9D_%D7%A9%D7%A4%D7%99%D7%A8%D7%90_%D7%95%D7%94%D7%A8%D7%91_%D7%A9%D7%9C%D7%9E%D7%94_%D7%92%D7%95%D7%A8%D7%9F.jpg","page_title":"שלמה גורן","context_page_description":"הרב שלמה גורן היה הרב הצבאי הראשי מקום המדינה ועד תשל\\"א. שימש למשך תקופה קצרה הרב הראשי של תל אביב-יפו ולאחר מכן הרב הראשי לישראל בשנים תשל\\"ג – תשמ\\"ג. מחבר ספרים רבים, חתן פרס ישראל לספרות תורנית בתשכ\\"א, ופרס הרב קוק בתש\\"ג בעבור השנים תש\\"א–תש\\"ג ובתשמ\\"ה."},{"page_url":"https://de.wikipedia.org/wiki/BMW_F12","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/BMW_640i_Cabriolet_%286158071625%29.jpg","page_title":"BMW F12","context_page_description":"Der BMW 6er des deutschen Automobilherstellers BMW ist die dritte Generation der 6er-Reihe.\\nDiese 6er-Reihe basiert auf dem bis 2017 gebauten Modell der 5er-Reihe und teilt sich daher einen Großteil der Technik und Ausstattungsmöglichkeiten."},{"page_url":"https://vi.wikipedia.org/wiki/G%C3%B6zs%C3%BCzce,_Bozyaz%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Gozsuzce.jpg","page_title":"Gözsüzce, Bozyazı","context_page_description":"Gözsüzce là một xã thuộc huyện Bozyazı, tỉnh Mersin, Thổ Nhĩ Kỳ. Dân số thời điểm năm 2011 là 173 người."},{"page_url":"https://es.wikipedia.org/wiki/S%C3%A3o_Bartolomeu_dos_Galegos","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Sao_Bartolomeu_Dos_Galegos.JPG","page_title":"São Bartolomeu dos Galegos","context_page_description":"São Bartolomeu dos Galegos es una freguesia portuguesa del concelho de Lourinhã, con 12,52km² km² de superficie y 1.041 habitantes. Su densidad de población es de 83,2 hab/km²."},{"page_url":"https://ms.wikipedia.org/wiki/Zunheboto","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Zunheboto_Town.jpg","page_title":"Zunheboto","context_page_description":"Zunheboto ialah sebuah bandar pusat perdagangan dalam daerah Zunheboto di negeri Nagaland, India."},{"page_url":"https://fi.wikipedia.org/wiki/Vuoremi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Vuoreija_%28Vuoremi%2C_Vard%C3%B6%29%3B_loisto_kalliolla_l%C3%A4hikuvassa_%2826738465396%29.jpg","page_title":"Vuoremi","context_page_description":"Vuoremi oli Petsamossa Vuoremivuonon itärannalla sijainnut kalastajakylä, joka kuului Suomelle vuosina 1920–1944. Kylä sijaitsi Suomen ja Norjan rajalla Vuoremijoen suulla. Vuonon länsirannalla on norjalainen Grense Jakobselvin kylä. Vuoremiin ei ollut maantieyhteyttä, mutta kylästä oli viikottainen laivayhteys Kirkkoniemeen ja Liinahamariin.\\nVuoremissa oli pieni Nikolaos Ihmeidentekijälle pyhitetty rukoushuone. Talvisodan aikana sen irtaimisto evakuoitiin Norjaan. Hieman kylän pohjoispuolella oli loisto, joka on edelleen toiminnassa.\\nNoin 25 kilometrin päässä Vuoremijoen yläjuoksulla oli venäläisten rakentama Vuoremi-niminen sotilasasema, joka sijaitsi Salmijärveltä Petsamonvuonolle kulkevan reitin varrella. Myöhemmin paikalla oli Jäämerentien varrella toiminut Vuoremin majatalo."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D9%88%D9%86%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Villn%C3%B6%C3%9F-Valley1960s.jpg","page_title":"فونس","context_page_description":"فونس ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۱۱۳۲ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا 2552 نفر ایمیش."},{"page_url":"https://it.wikipedia.org/wiki/Arabesque_(danza_classica)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Arabesque_Blasis_2.png","page_title":"Arabesque (danza classica)","context_page_description":"Nella danza il termine arabesque si riferisce ad una fra le più note figure del balletto, in cui una gamba è en air all'indietro e le braccia sono distese in direzioni opposte.\\nComparso in Francia, culla della danza classica, verso la fine del XVIII secolo, il termine ha subito un'evoluzione, passando via via a designare:\\nuno stile di danza classica\\nuna figura coreografica composta da più ballerini\\nuna posa del singolo ballerino"},{"page_url":"https://sl.wikipedia.org/wiki/Mooney_Aviation_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/MooneyM-18CMiteN4057.jpg","page_title":"Mooney Aviation Company","context_page_description":"Mooney Aviation Company, Inc. je ameriški proizvajalec visokosposobnih športnih letal. Podjetje je ustanovil Albert Mooney skupaj z njegovim bratom Arthurjem leta 1929. Sedež podjetja je v kraju Kerrville v zvezni državi Teksas. Podjetje je v preteklosti večkrat bankrotiralo in spremenilo lastnike, trenutno je v lasti kitajskega Soaring America Corporation.\\nMooneyevo letalo M20TN Acclaim Type S je s hitrostjo 242 vozlov najhitrejše civilno enomotorno batnognano letalo.\\nMooney je znan po aerodinamičnih in hitrih letalih."},{"page_url":"https://sk.wikipedia.org/wiki/Old_Vic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Old_Vic.jpg","page_title":"Old Vic","context_page_description":"Old Vic je divadlo nachádzajúce sa v Londýne, južne od stanice Waterloo, na rohu ulíc The Cut a Waterloo Road. To isté meno niesol aj herecký súbor, z ktorého neskôr v roku 1963 vznikol Súbor Národného divadla."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Colm%C3%A9ry","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Map_commune_FR_insee_code_58081.png","page_title":"Colméry","context_page_description":"Colméry sī ūi-tī Hoat-kok Bourgogne toā-khu Nièvre koān ê chi̍t ê commune."},{"page_url":"https://sv.wikipedia.org/wiki/Forntid_i_nutid","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Stone_age_projekt_in_Sweden_8.jpg","page_title":"Forntid i nutid","context_page_description":"Forntid i Nutid var ett omfattande projekt vars syfte var att förmedla och levandegöra arkeologiska resultat rörande den skånska stenåldern. Projektet, som startade 1980 och varade några år, var ett samarbete mellan Lunds universitet, Malmö museum, Lärarhögskolan i Malmö, olika studieförbund i Skåne och Skånes djurpark. En jägarestenåldersmiljö med sommarboplats och vinterboplats återskapades, så också ett långhus samt en långdös, båda från bondestenåldern."},{"page_url":"https://hu.wikipedia.org/wiki/Bernina-h%C3%A1g%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Bernina-h%C3%A1g%C3%B3.jpg","page_title":"Bernina-hágó","context_page_description":"A Bernina-hágó 2328 méter magas alpesi hágó a svájci Graubünden kanton területén. Vízválasztó: tőle északra a Fekete-tenger, délre az Adriai-tenger vízgyűjtője található. Ugyanilyen elválasztó határt képez a rétoromán és az olasz nyelvterületek között is.\\nFontos közlekedési útvonal: itt halad át a 29. sz. főközlekedési út, valamint a közvetlen közelében a Bernina-vasút, melyek kapcsolatot teremtenek északon Pontresina, délen pedig Poschiavo között."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Marin_County,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Fort_Baker_%28Sausalito%2C_CA%29.jpg","page_title":"National Register of Historic Places listings in Marin County, California","context_page_description":"This is a list of the National Register of Historic Places listings in Marin County, California.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Marin County, California, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in an online map.\\nThere are 52 properties and districts listed on the National Register in the county, including 4 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://pt.wikipedia.org/wiki/Toluca_Lake","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/TolucaLake-Est1923.png","page_title":"Toluca Lake","context_page_description":"Toluca Lake é um distrito do vale de São Fernando, região da cidade de Los Angeles, no estado da Califórnia. Situa-se no sudeste do vale, entre a cidade de Burbank, o distrito de Los Angeles North Hollywood e a área da Universal City. O perímetro da zona histórica são Cahuenga Boulevard, Clybourn Avenue, Camarillo Street e do rio Los Angeles. Fritz Coleman é o prefeito honorário de Toluca Lake.\\nVários condomínios complexos e apartamentos estão localizados em Toluca Lake, juntamente com Riverside Drive e Moorpark Way. O primeiro condomínio complexo a ser construído está na 10470 Riverside Drive, erguido em 1974. Marcada pela tranquilidade de seus bairros, Toluca Lake está a 12 milhas ao norte do centro de Los Angeles, favorecida pelos profissionais de Hollywood por estarem \\"fora da cidade\\", enquanto ainda residem dentro dos limites de Los Angeles. Está entre dois grandes estúdios, Universal Studios, ao sul e Warner Bros, ao leste.\\nAs montanhas de Santa Mônica rodeiam as calmas e pitorescas ruas e oferecem muitas oportunidades recreativas. Com terreno de seis hectares, Toluca Lake oferece pesca, natação e canoagem."},{"page_url":"https://it.wikipedia.org/wiki/Marcus_Garvey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Marcus_Garvey_1924-08-05.jpg","page_title":"Marcus Garvey","context_page_description":"Marcus Mosiah Garvey è stato un sindacalista e scrittore giamaicano."},{"page_url":"https://sv.wikipedia.org/wiki/Chester_Bowles","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Chester_Bowles_%28Connecticut_Governor_and_Congressman%29.jpg","page_title":"Chester Bowles","context_page_description":"Chester Bliss Bowles, född 5 april 1901, död 25 maj 1986, var en amerikansk diplomat och politiker från Connecticut och var guvernör i sin hemstat."},{"page_url":"https://ca.wikipedia.org/wiki/Erythrophleum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Erythrophleum_suaveolens_Taub75b.png","page_title":"Erythrophleum","context_page_description":"Erythropheleum és un gènere de la planta amb flors de la familia de les fabàcies. Aquest gènere té tretze espècies. Majoritàriament són espècies frondoses tropicals, d'Àfrica i Àsia, molt valorades per ser la font de la fusta d'Elondo, de gran qualitat i molt apreciada pels fusters. La seua fusta es tracta normalment amb vernissos de Lausure i es gasten tant a mobles de gran qualitat com per a terras de parquet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%B3%D1%85%D0%B0%D0%BD%D1%82%D0%B5%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/%D0%98%D0%B7%D0%BE%D0%BD%D0%B8%D0%B0%D0%B7%D0%B8%D0%B4_%D0%B2_%D1%82%D0%B0%D0%B1%D0%BB%D0%B5%D1%82%D0%BA%D0%B0%D1%85.JPG","page_title":"Догхантеры","context_page_description":"Догха́нтеры — самоназвание лиц, которые по собственной инициативе занимаются отстрелом или отравлением безнадзорных собак в населённых пунктах.\\nПо сведениям «Радио Свобода», движение догхантеров, которые через соцсети договаривались об организации облав на бродячих собак, впервые возникло в России в 2006 году, одним из его идеологов был профессор, заведующий кафедрой социальной работы и социального управления московского РГУТиС, доктор философских наук Владислав Добрынин, выступавший в сети под ником «Пожилой велосипедист». Газета The Moscow Times сообщала о росте популярности движения догхантеров в 2011—2012 годах. По данным СМИ, догхантеры действуют во многих городах России, а также на Украине и в Болгарии. Причинами появления догхантеров называются неспособность муниципальных властей решать проблему безнадзорных животных: ликвидация служб безвозвратного отлова и внедрение экспериментальной программы «отлов-стерилизация-возврат в места прежнего обитания».\\nДеятельность догхантеров имеет неоднозначную оценку в обществе, как с этической, так и с правовой точек зрения и осуждается российской зоозащитной общественностью и деятелями культуры, требующими наказания для догхантеров."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%83%E4%BA%BA%E5%88%B6%E6%A9%84%E6%AC%96%E7%90%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Rugby_Sevens_Melbourne_2006.jpg","page_title":"七人制橄欖球","context_page_description":"七人制橄榄球，是橄榄球运动的一种新兴玩法，场地、规则与传统15人制橄榄球大致相同，但因人数少，比赛节奏较快而且平均得分较高，普遍受到欢迎，现为世界运动会的正式竞技项目。2016年夏季奥运成为正式比赛项目，首面金牌分别由斐济赢得男子项目、澳洲赢得女子项目。由此可知大洋洲表现较为出色。"},{"page_url":"https://en.wikipedia.org/wiki/G%C3%BCl%C3%A7i%C3%A7ek_Hatun","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Arolsen_Klebeband_01_451_3.jpg","page_title":"Gülçiçek Hatun","context_page_description":"Gülçiçek Hatun was the first wife of Ottoman Sultan Murad I and Valide Hatun to their son Bayezid I."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D6%80%D5%B5%D5%B8%D6%82%D5%B6%D5%B8%D5%AC%D6%86_%D4%B2%D5%AC%D5%B8%D6%82%D5%B4%D5%AF%D5%BE%D5%AB%D5%BD%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/K%C3%A4pp%C3%A4r%C3%A4n_pieni_kappeli_2.jpg","page_title":"Բրյունոլֆ Բլումկվիստ","context_page_description":"Յուհան Բրյունոլֆ Բլումկվիստ շվեդ.՝ Johan Brynolf Blomqvist, մարտի 4, 1855, Սվեաբորգ, Suomenlinna - հունվարի 31, 1921, Վիբորգ, Ֆինլանդիա), շվեդական ծագման ֆինն ճարտարապետ, որը ներկայացնում է էկլեկտիկական ուղղությունը (հիմնականում՝ նեոռենեսանս ոճով):"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_culturels_d%27importance_nationale_dans_le_canton_de_Zurich","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Eglisau02.jpg","page_title":"Liste des biens culturels d'importance nationale dans le canton de Zurich","context_page_description":"Cette liste présente les biens culturels d'importance nationale dans le canton de Zurich. Cette liste correspond à l'édition 2009 de l'Inventaire Suisse des biens culturels d'importance nationale pour le canton de Zurich. Il est trié par commune et inclus : 204 bâtiments séparés, 66 collections, 50 sites archéologiques et trois cas particuliers."},{"page_url":"https://de.wikipedia.org/wiki/Schw%C3%A4bischer_Chorverband","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Konrad_Kocher_SSB.jpg","page_title":"Schwäbischer Chorverband","context_page_description":"Der Schwäbische Chorverband e. V. ist ein Dachverband zur Pflege des Chorgesanges. Sein Sitz ist Stuttgart."},{"page_url":"https://bs.wikipedia.org/wiki/Joseph_Haydn","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/The_Haydn_hall.jpg","page_title":"Joseph Haydn","context_page_description":"Joseph Haydn bio je austrijski kompozitor i dirigent,\\nte jedan od najplodnijih i najistaknutijih kompozitora klasičnog perioda u muzici.\\nTokom njegovog dugotrajnog plodnog muzičkog djelovanja bio je u središtu uspostavljanja bečkog klasičnog stila, obuhvatajuċi kasni barok i rani period romantizma. Rodio se u vrijeme dok je Johann Sebastian Bach bio zadužen za komponovanje liturgijske muzike u Katedrali Svetog Tome u Leipzigu, a umro je kad je Ludwig van Beethoven tek objavio svoju Pastoralnu simfoniju.\\nUpravo je Haydn bio taj koji je svojom originalnošċu i naizgled neiscrpnim bogatstvom muzičkih otkriċa bio most između dva veċ navedena muzička perioda. Odgovoran je za kreiranje i standardizaciju onoga što danas smatramo gudačkim kvartetom iz klasičnog perioda, a u nešto manjoj mjeri i klasičnoj simfoniji, kao i njegovom značajnom doprinosu i razvoju drugih muzičkih žanrova iz njegovog vremena kao na primjer klavirskog tria i sonatnog oblika.\\nDugogodišnji stanovnik Austrije, Haydn je proveo najveċi dio svoje dugotrajne karijere kao dvorski muzičar kod bogate mađarske aristokratske porodice Esterházy na njihovom udaljenom imanju."},{"page_url":"https://fi.wikipedia.org/wiki/Erkki_Sakari_Heinonen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/R_heinonen.jpg","page_title":"Erkki Sakari Heinonen","context_page_description":"Erkki Tuomas Sakari Heinonen, taiteilijanimeltään Erkki Sakari Heinonen, oli suomalainen taidemaalari ja taidegraafikko, joka tunnetaan yhteiskunnallisesti kantaa ottavista grafiikoistaan ja maalauksistaan, joita on luonnehdittu surrealistisiksi."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%97%D0%B5%D0%BB%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%9A%D0%BE%D1%88%D0%B5%D0%B2%D0%BE%D0%B9%2C_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%97%D0%B5%D0%BB%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9.jpg","page_title":"Владимир Зеленский","context_page_description":"Владимир Александрович Зеленский нь Украины театр, киноны жүжигчин юм."},{"page_url":"https://es.wikipedia.org/wiki/Arte_y_cultura_en_el_franquismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Andr%C3%A9s_Segovia_%281963%29_by_Erling_Mandelmann.jpg","page_title":"Arte y cultura en el franquismo","context_page_description":"Arte y cultura en el franquismo, arte y cultura del franquismo o arte y cultura franquista son denominaciones historiográficas con poco uso más allá de la ubicación cronológica o la identificación política.​ Usadas de forma genérica, no implican una calificación ideológica o estética de todo el arte y la cultura de la época franquista, que solo sería adecuada para el arte y la cultura más identificados con el régimen de Franco —o, con expresiones a veces usadas, arte y cultura fascista en España, arte y cultura falangista o arte y cultura nacional-católica—, ​ a pesar de lo diferentes que puedan ser entre sí.\\nMás aún, buena parte de la producción artística y cultural española de la época fue realizada por autores ideológicamente opuestos o indiferentes, o con criterios estéticos completamente ajenos a una estética fascista."},{"page_url":"https://eo.wikipedia.org/wiki/Ni%C4%B5nij_Lomov","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Flag_of_Nizhny_Lomov_%28Penza_oblast%29.png","page_title":"Niĵnij Lomov","context_page_description":"Niĵnij Lomov estas urbo en Penza provinco en Rusio.\\nKodo de OKATO de la urbo estas 56251501.\\nLa urbo estis fondita en jaro 1636 kiel fortikaĵo.\\nĜi havas statuson de urbo ekde jaro 1780.\\nLa interurba telefona kodo estas 84154, la enurbaj telefonnumeroj estas kvinciferaj.\\nLa loka tempo estas la sama kiel moskva tempo.\\nGeografiaj koordinatoj de la urbo estas 53°32′N 43°41′O.\\nLa urbo estas ĉe rivero Lomov.\\nEn la urbo estas fervoja stacio kaj flughaveno.\\nEn jaro 1959 la urbo havis 13,9 mil loĝantojn.\\nEn jaro 2002 la urbo havis 24,2 mil loĝantojn."},{"page_url":"https://lv.wikipedia.org/wiki/Alvaro_Arveloa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Arbeloa2012.jpg","page_title":"Alvaro Arveloa","context_page_description":"Alvaro Arveloa Koka ir bijušais spāņu futbolists, spēlēja aizsarga pozīcijā, Spānijas futbola izlases dalībnieks.\\nJaunieša gados spēlēja Zaragoza un Real Madrid jaunatnes komandu sastāvos. Profesionāļa karjeru uzsāka 2003. gadā Real Madrid B sastāva komandā. Pēc tam divas spēles aizvadīja Real Madrid pirmā sastāva komandā, taču 2006. gadā pārgāja uz citu La Liga klubu Deportivo La Coruña. Pēc pussezonas A. Arveloa pārgāja uz Anglijas Premjerlīgas klubu Liverpool, kā sastāvā spēlēja 2007. gada UEFA Čempionu līgas finālā. Kopš 2009. gada atkal pārstāv Real Madrid.\\nSpānijas izlases sastāvā spēlējis 2008. gada Eiropas čempionātā un 2010. gada FIFA Pasaules kausā, abos turnīros Spānijas izlase kļuva par čempioniem."},{"page_url":"https://ceb.wikipedia.org/wiki/Chicago","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Chicago_montage1.jpg","page_title":"Chicago","context_page_description":"Ang Chicago mao ang kinadak-ang dakbayan sa estado sa Illinois, nahimutang sa Midwest Coast sa Tinipong Bansa base sa populasyon, ug ang ikaduhang pinakadaghang tawo nga dakbayan sa tibuok Estados Unidos, human sa Dakbayan sa New York y Dakbayan sa Los Angeles. Sobra sa 2.71 ka milyon ang iyang populasyon.\\nOfficial website"},{"page_url":"https://la.wikipedia.org/wiki/Petiville_(Calva_Dorsa)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Petiville_01.jpg","page_title":"Petiville (Calva Dorsa)","context_page_description":"Petiville est commune Francicum 511 incolarum praefecturae Calvorum Dorsorum in regione Normannia Inferiori."},{"page_url":"https://pl.wikipedia.org/wiki/Hawajka_cienkodzioba","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Hemignathus_obscurus1.jpg","page_title":"Hawajka cienkodzioba","context_page_description":"Hawajka cienkodzioba – gatunek średniej wielkości ptaka z rodziny łuszczakowatych. Występował endemicznie na wyspie Hawaiʻi.\\nDla Europejczyków gatunek został odkryty w 1779 podczas trzeciej podróży Jamesa Cooka; naukowo opisał go Johann Friedrich Gmelin w 1788. Długość ciała wynosiła około 17 cm. Hawajki cienkodziobe wyróżniały się długim, zagiętym dziobem. Ich upierzenie było głównie oliwkowe; występowała niewielka różnica między upierzeniem samców i samic. Hawajki cienkodziobe zamieszkiwały lasy wyspy Hawaiʻi. Żywiły się bezkręgowcami i nektarem. Znany jest tylko jeden opis gniazda; znajdowało się w nim jedno młode, drugie przebywało obok. Pod koniec lat 90. XIX wieku hawajki cienkodziobe były jeszcze pospolite na wyspie. W 1902 H.W. Henshaw odnotował, że miejscami ich liczebność zaczęła spadać. Moment rozpoczęcia i przebieg wymierania zostały słabo udokumentowane. Ostatnie osobniki odłowiono w 1903, wtedy też miała miejsce ostatnia pewna obserwacja. Niepotwierdzone doniesienia pochodzą z 1937 i 1940. Gatunek uznany za wymarły."},{"page_url":"https://es.wikipedia.org/wiki/Kim_Seong-kon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Kim_receives_a_medal_from_H.E._Alena_Hanakova%2C_Minister_of_Culture_of_the_Czech_Republic.JPG","page_title":"Kim Seong-kon","context_page_description":"Kim Seong-kon, conocido también como Seong-kon Kim es un prestigioso académico, crítico literario y escritor de Corea del Sur.\\nKim es el presidente de LTI Korea, un organismo público que pertenece al Ministerio de Cultura, Deporte y Turismo de Corea del Sur. Fue nombrado por el gobierno surcoreano en febrero de 2015 para dirigir dicho Instituto durante otros tres años.​ Fue asimismo designado coeditor de Korea Journal, de la Comisión Nacional de Corea para la UNESCO, y es profesor emérito de la Universidad Nacional de Seúl, donde fue galardonado en 7 ocasiones con el Premio a la Excelencia Investigadora.​\\nHa impartido clases como profesor invitado en la Universidad Estatal de Pennsylvania, en la Universidad de California, en Berkeley, y en la Universidad Brigham Young; e investigador invitado en el Harvard-Yenching Institute, Universidad de Oxford y en la Universidad de Toronto. Premiado como crítico literario, fue el artífice de los primeros debates sobre el posmodernismo literario en Corea a finales de la década de los 70 y principios de los 80."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%99%8D%EB%8C%80_(%EC%A7%80%EB%AA%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Hongdae_area_cityscape.jpg","page_title":"홍대 (지명)","context_page_description":"홍대는 서울특별시 마포구 서울 지하철 2호선 홍대입구역과 홍익대학교 정문을 잇는 지역 및 이 일대에 있는 번화가를 말한다. '홍대'는 홍익대학교의 한국어 약칭으로 이 지역의 정식 지명이 아닌 통용 명칭이며, 홍익대학교와 구분하기 위하여 홍대입구, 홍대거리라고도 부른다."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A7%D0%B0%D0%BD_%D0%A7%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Chanchan_pelicans_detail.JPG","page_title":"Чан Чан","context_page_description":"Чан Чан е археолошко наоѓалиште во Перу кое се наоѓа во регионот Ла Либертад на околу 5 километри западно од Трухиљо. Чан Чан зафаќа површина од околу 20 км² и имал доста густо населен урбан центар со околу 6 км². Градот бил изграден од Кралството Чимор од народот Чиму во околу 850 година и функционирал сè до освојувањето на кралството од страна на Тавантинсују во 1470 година. Чан Чан бил главен град на Чимор додека кралството опстојувало и се проценува дека имал околу 30.000 жители.\\nВо 1986 година Чан Чан бил ставен на списокот на светско културно наследство на УНЕСКО. Градот подлежал на торнада од Ел Нињо, при што имало силно дождови и поплави во регионот. Чан Чан се наоѓа во плоден регион богат со вода. Покрај поплавите, рушевините претрпеле оштетувања и од земјотреси."},{"page_url":"https://pl.wikipedia.org/wiki/Boza","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Bulgarian_boza.jpg","page_title":"Boza","context_page_description":"Boza, także buza – lekko sfermentowany napój bezalkoholowy, charakterystyczny dla kuchni krajów bałkańskich. Jest znany i produkowany w Bułgarii, Macedonii Północnej, Albanii i Turcji. W Turcji boza jest przyrządzana ze sfermentowanej kukurydzy, zaś w Bułgarii z pszenicy lub prosa. Ma on gęstą konsystencję i bardzo niską zawartość alkoholu, oraz lekko kwaśny, słodkawy smak.\\nW Macedonii boza jest delikatniejsza, jaśniejsza i bardziej rozrzedzona oraz nieco słodsza.\\nW Turcji jest podawana z cynamonem i pieczoną ciecierzycą, a spożywana jest głównie w zimie. Osmanowie byli znani z pojenia armii bozą, jako że jest bogata w węglowodany i witaminy.\\nW Bułgarii jest częścią tradycyjnego śniadania banica i boza.\\nW Albanii najczęściej jest produkowana i sprzedawana w północnej części kraju; można ją łatwo znaleźć w cukierniach i lodziarniach w stolicy, Tiranie.\\nW Serbii boza jest produkowana i sprzedawana w obrębie całego kraju.\\nOdmiana tego napoju popularna w Rumunii nazywa się bragă, i jest słodsza niż w Turcji i Bułgarii, ale gęstsza i ciemniejsza niż w Macedonii.\\nDo Polski napój przywędrował wraz z macedońskimi imigrantami i jest nazywany buzą."},{"page_url":"https://sv.wikipedia.org/wiki/Cussy","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Map_commune_FR_insee_code_14214.png","page_title":"Cussy","context_page_description":"Cussy är en kommun i departementet Calvados i regionen Normandie i norra Frankrike. Kommunen ligger i kantonen Bayeux som ligger i arrondissementet Bayeux. År 2009 hade Cussy 139 invånare."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%84%DA%A9%D8%B3%D8%A7%D9%86%D8%AF%D8%B1_%D9%85%D8%A7%D9%86%D8%AA%D8%A7%D8%B4%DB%8C%D8%A7%D9%86%D8%AA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Alex_Mantashyants_Yerevan.jpg","page_title":"آلکساندر مانتاشیانتس","context_page_description":"آلکساندر مانتاشف یک کارآفرین صنعت نفتی، صنعتگر، سرمایه‌گذار، و نیکوکار ارمنی بود. وی همچنین برندهٔ جوایزی همچون لژیون دونور شده‌است. وی در پانتئون ارمنیان تفلیس به خاک سپرده شد."},{"page_url":"https://ceb.wikipedia.org/wiki/Ptychadena_superciliaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Ptychadena_superciliaris.jpg","page_title":"Ptychadena superciliaris","context_page_description":"Espesye sa baki nga una nga gihulagway ni Günther ni adtong 1858 ang Ptychadena superciliaris. Ang Ptychadena superciliaris sakop sa kahenera nga Ptychadena sa kabanay nga Ptychadenidae. Giklaseklase sa IUCN ang espesye sa duolang mibahad. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/Helm%C3%A1ntico_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/CFSHelmantico.jpg","page_title":"Helmántico Stadium","context_page_description":"Estadio Helmántico is a football stadium in Salamanca, Spain where Salamanca CF played home matches. The stadium holds 17,341 and was built in 1970. It is located in the municipality of Villares de la Reina, on the outskirts of the city.\\nThe Stadium also has a mini-stadium where the team usually trains and once a year hosts an international athletic championship. They are officially called \\"Javier Sotomayor\\", for Javier Sotomayor who set the world record in high jump there, but they are popularly called \\"Pistas del Helmántico\\". This second stadium hosts the matches of Unionistas de Salamanca CF.\\nIn addition, there are also some swimming pools and tennis courts.\\nAfter the dissolution of UD Salamanca in 2013, the stadium went up for auction, finally being acquired by Desarrollos Empresariales Deportivos S.L., that allowed its use to CF Salmantino.\\nNowadays, it hosts the local games of the Club de Fútbol Salmantino."},{"page_url":"https://id.wikipedia.org/wiki/Great_Rift_Valley,_Kenya","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/LakeBaringo.jpg","page_title":"Great Rift Valley, Kenya","context_page_description":"Great Rift Valley adalah bagian dari sistem punggung pegunungan intra-benua yang membentang dari utara ke selatan Kenya. GRV adalah bagian dari Gregory Rift, cabang timur dari East African Rift, yang dimulai dari selatan Tanzania terus ke utara hingga ke Etiopia. Terbentuk dari pembalikan massa air \\"Kubah Kenya\\" akibat dari interaksi tiga tektonik utama: lempeng Arab, Nubia, dan Somalia. Di masa lalu, GRV dianggap sebagai bagian dari \\"Lembah Celah Besar\\" yang membentang dari Madagaskar hingga Suriah. Sebagian besar wilayah GRV berada di dalam bekas Provinsi Lembah Rift.\\nGRV meliputi Perbukitan Cherang'any dan rantai gunung berapi, beberapa di antaranya masih aktif.\\nIklimnya ringan, dengan suhu biasanya di bawah 28 °C. Hujan kebanyakan turun selama periode Maret – Juni dan Oktober – November. Bukit Tugen di sebelah barat Danau Baringo berisi fosil-fosil yang diawetkan dalam aliran lava dari periode 14 hingga 4 juta tahun yang lalu. Banyak benda-benda peninggalan hominid, leluhur manusia, ditemukan di sini."},{"page_url":"https://pl.wikipedia.org/wiki/Twierdzenie_Abela-Ruffiniego","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Ruffini_-_Teoria_generale_delle_equazioni%2C_1799_-_1366896.jpg","page_title":"Twierdzenie Abela-Ruffiniego","context_page_description":"Twierdzenie Abela-Ruffiniego – głosi, że pierwiastki równania algebraicznego stopnia wyższego niż 4 nie dają się wyrazić w ogólnej postaci za pomocą czterech działań algebraicznych i pierwiastkowania poprzez współczynniki równania w skończonej liczbie kroków.\\nMówiąc krótko, nie istnieją ogólne wzory na rozwiązania takiego równania.\\nTwierdzenie Abela-Ruffiniego nie stwierdza, że równanie stopnia wyższego niż 4 nie ma rozwiązań, a jedynie, że nie ma ogólnej metody na dokładne wyrażenie rozwiązań.\\nNa przykład rozwiązania równania kwadratowego postaci dla wyrażają się wzorami:\\nAnalogiczne, choć bardziej złożone, wzory można podać dla równania stopnia 3 i stopnia 4. Twierdzenie Abela-Ruffiniego mówi, że dla równań stopnia wyższego niż 4 wzory takie nie istnieją.\\nJest jasne, że w szczególnych przypadkach rozwiązania dają się znaleźć w postaci dokładnej, natomiast w sytuacji ogólnej można obliczać je z dowolną dokładnością za pomocą metod przybliżonych, na przykład metody Newtona-Raphsona.\\nPrzykładem równania stopnia 5, które nie może być rozwiązane w opisany w twierdzeniu sposób, jest równanie"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B2%D0%B5%D1%80%D0%BD,_%D0%9B%D0%BE%D1%80%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Lauren_Laverne.jpg","page_title":"Лаверн, Лорен","context_page_description":"Ло́рен Лаве́рн, настоящее имя — Ло́рен Сеси́лия Го́фтон — британская журналистка и телеведущая."},{"page_url":"https://nn.wikipedia.org/wiki/Gavi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Gavi01.jpg","page_title":"Gavi","context_page_description":"Gavi er ei lita øy i Tyrrenhavet utanfor vestkysten av Italia og ho er ein del av Dei pontinske øyane. Med ei lengd på 700 meter er ho den minste i øygruppa og ligg 120 meter nord for Ponza. Øya er forholdsvis kupert og ikkje busett. Øya er eit naturreservat og har mellom anna firfisler som berre finst her, i tillegg til mus, kanin og skorpionar."},{"page_url":"https://no.wikipedia.org/wiki/Rosendalsbanen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Brandbu_lower_secondary_school%2C_Gran%2C_Oppland%2C_Norway.jpg","page_title":"Rosendalsbanen","context_page_description":"Rosendalsbanen eller Brandbu stadion er et kombinert idrettsanlegg for fotball, friidrett og skøyter i Brandbu i Oppland. Anlegget ble etablert i 1960/61 for hurtigløp på skøyter. I 2011 ble anlegget bygget ut med en ny friidrettsbane. Den nye løpebanen fikk det røde kunststoffdekket polytan fordelt på seks løpebaner i rundbaner og åtte på den østlige-langsiden. På den gamle banen blir det hvert år lagt skøyteis, og på indre bane er det ishockey-aktivitet om vinteren.\\nDet ligger en fotballbane av grus og en av gress inntil den gamle banen.\\nAnlegget er hjemmebane for Brandbu Idrettsforening og tidligere Gran Idrettslag. Gran Idrettslag har fått ny hjemmebane på Gran idrettspark.\\nNord for banen ligger nye Brandbu barneskole som bruker banen i undervisningen. I tilknytning til stadion ligger også Granshallen. Garderobene i hallen fungerer også som garderober for stadion. Nedenfor stadion ligger nye Brandbu ungdomsskole som skoleåret 2016/2017 er stengt for oppussing, men som ellers også bruker stadion i undervisningen.\\nBanemester er Bjørn Egge."},{"page_url":"https://sk.wikipedia.org/wiki/Boulevard_Voltaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/202_Bd_Voltaire-_Two_putti.JPG","page_title":"Boulevard Voltaire","context_page_description":"Boulevard Voltaire je bulvár v Paríži. Nachádza sa v 11. obvode. Tvorí jednu z hlavných osí, ktoré vznikli počas prestavby Paríža za vlády Napoleona III. Pretože spája dve námestia významné pre dejiny francúzskej ľavice, sú tu často poriadané pochody či demonštrácie."},{"page_url":"https://it.wikipedia.org/wiki/Piero_Torrigiani","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Piero_Torrigiani2.png","page_title":"Piero Torrigiani","context_page_description":"Piero Torrigiani è stato un politico italiano.\\nFu senatore del Regno d'Italia nella XVI legislatura e sindaco di Firenze nella seconda metà dell'Ottocento."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%9F%93%E7%9F%B3%E6%B3%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Han_Sek-choan_1960.jpg","page_title":"韓石泉","context_page_description":"韩石泉，号南阳，台南人，台湾医学家、社会活动家。战后曾任台南市参议员。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%B6%AF%E6%AD%8C%E7%A2%A7%E9%BE%8D%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/%E9%B6%AF%E6%AD%8C%E7%A2%A7%E9%BE%8D%E5%AE%AE%E7%A5%9E%E9%BE%9C%E7%9F%B3%E9%BE%9C%E9%A6%96.jpg","page_title":"鶯歌碧龍宮","context_page_description":"莺歌碧龙宫，全称莺山岩碧龙宫，俗称龟公庙，是位于台湾新北市莺歌区建德里牛灶坑山的庙宇，建庙原因是供奉一颗状似龟壳的石头。"},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D1%86%D1%8F%D0%B3_%D0%A7%D0%B0%D1%80%D0%BD%D0%B0%D0%B3%D0%BE%D1%80%D1%8B%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Flag_of_Montenegro_%281905%E2%80%931918%2C_1941%E2%80%931944%29.svg","page_title":"Сьцяг Чарнагорыі","context_page_description":"Сьцяг Чарнагорыі уяўляе сабой прастакутнае палотнішча чырвонага колеру з залатымі бакамі, з суадносінамі бакоў 1:2, у цэнтры якога выява гербу Чарнагорыі.\\nСьцяг Чарнагорыі да згубы незалежнасьці ў 1918 г. уяўляў сабой палотнішча з трыма гарызантальнымі палосамі, зьверху ўніз — чырвонага, сіняга і белага колераў, і зьмешчаным у цэнтры дзяржаўным гербам. Сьцяг быў прыняты па аналёгіі з расейскім сьцягам; больш таго, ваенна-марскі сьцяг Чарнагорыі ўяўляў сабой Андрэеўскі сьцяг, гэта значыць копію расейскага ваенна-марскога сьцягу.\\nУ 1918—1945 гг. Чарнагорыя не мела ўласнага сьцягу. Падчас нямецкай акупацыі выкарыстоўваўся чырвоны сьцяг з выявай арла і льва, гэта значыць ваенны сьцяг чарнагорскага войску да 1918 г.\\nСьцяг Сацыялістычнай рэспублікі Чарнагорыя меў тыя жа колеры, але замест герба ў яго цэнтры была намаляваная чырвоная зорка.\\nПасьля атрыманьня незалежнасьці, у 1993—2004 гг. уяўляў сабой прастакутнае палотнішча з суадносінамі бакоў 1:3, якое складаецца з трох роўнавялікіх палос — верхняй чырвонай, сярэдняй блакітнай і ніжняй белай. Традыцыйны сіні колер сярэдняй паласы быў зьменены на блакітны, каб адрозьніваць сьцяг ад сьцягу Сэрбіі.\\nПа меры таго, як лідэр Чарнагорыі М."},{"page_url":"https://en.wikipedia.org/wiki/Canyon_Ranch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Canyon_Ranch_black.jpg","page_title":"Canyon Ranch","context_page_description":"Canyon Ranch is a luxury wellness lifestyle brand that operates two destination health spa resorts and one retreat property in the United States. Canyon Ranch resorts are located in Tucson, Arizona, and Lenox, Massachusetts; its retreat property is located in Woodside, California. Canyon Ranch also operates Spa + Fitness locations with primarily day spa facilities. These are located at The Venetian and the Palazzo hotels in Las Vegas, and on cruise lines including Cunard Line, Regent Seven Seas, Oceania and Celebrity."},{"page_url":"https://da.wikipedia.org/wiki/D%C3%B8de_i_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Richard_M%C3%B8ller_Nielsen_2010-10-01.JPG","page_title":"Døde i 2014","context_page_description":"Døde i 2014 er en liste over notable personer, der er afgået ved døden i 2014."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%A7%DA%A9%D9%84%D9%88%D9%81%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Baclofen_ball-and-stick_model.png","page_title":"باکلوفن","context_page_description":"باکلوفن بیر شیمیایی بیلشیک دواء. بۇ دواءنین مول جرمیسی مول/قرم ۲۱۳٫۶۶۱ دیر. نیمه عمر یا یاریلانما سۆرعتی ۱٫۵- ۴ ساعات زامان آپاریر."},{"page_url":"https://en.wikipedia.org/wiki/Eric_Louw","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Eric_Louw.jpeg","page_title":"Eric Louw","context_page_description":"Eric Hendrik Louw was a South African diplomat and politician. He served as the Minister of Finance from 1954 to 1956, and as the Minister of Foreign Affairs from 1955 to 1963."},{"page_url":"https://en.wikipedia.org/wiki/Lew_Riggs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Lew_Riggs_Reds.jpg","page_title":"Lew Riggs","context_page_description":"Lewis Sidney Riggs born in Caswell County, North Carolina was a third baseman for the St. Louis Cardinals, Cincinnati Reds and Brooklyn Dodgers.\\nHe helped the Cardinals win the 1934 World Series, the Reds win the 1939 National League pennant and 1940 World Series and the Dodgers win the 1941 NL pennant. He was named to the 1936 National League All-Star team.\\nHis eighth-inning pinch single off Red Ruffing scored teammate Cookie Lavagetto in the opening game of the 1941 World Series, before Ruffing and the New York Yankees held on for a 3-2 victory.\\nRiggs never quite achieved the same level in his baseball career after leaving the Dodgers in 1942 in order to serve his country in the Army Air Force during World War II.\\nIn 10 seasons he played in 760 Games and had 2,477 At Bats, 298 Runs, 650 Hits, 110 Doubles, 43 Triples, 28 Home Runs, 271 RBI, 22 Stolen Bases, 181 Walks, .262 Batting Average, .317 On-base percentage, .375 Slugging Percentage, 930 Total Bases and 37 Sacrifice Hits.\\nHe died of cancer in Durham, North Carolina at the age of 65. He was survived by his wife of 30 years, Nellie Dace Hornaday Riggs."},{"page_url":"https://pl.wikipedia.org/wiki/Wybory_generalne_w_Chile_w_latach_2009%E2%80%932010","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Candidatos_presidenciales_Chile_2009.jpg","page_title":"Wybory generalne w Chile w latach 2009–2010","context_page_description":"Wybory generalne w Chile w latach 2009–2010 – wybory prezydenckie i parlamentarne w Chile zorganizowane w grudniu 2009 i styczniu 2010. W I turze wyborów prezydenckich z 13 grudnia 2009 zwycięstwo odniósł kandydat obozu prawicowego, Sebastián Piñera, przed kandydatem lewicy, Eduardo Freiem. W II turze wyborów 17 stycznia 2010 pokonał on ponownie Freia, zdobywając 51,6% głosów. Piñera został pierwszym prawicowym prezydentem kraju od czasu rządów generała Augusto Pinocheta.\\nW wyborach parlamentarnych, prawicowa Koalicja na rzecz Zmiany zdobyła 58 mandatów w Izbie Deputowanych, o jeden więcej niż lewicowa koalicja Concertación. W Senacie obie koalicje zdobyły po 9 miejsc."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Brno%E2%80%93%C4%8Cesk%C3%A1_T%C5%99ebov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%C3%96sterreichische_Bundesbahnen_Brno_hlavn%C3%AD_n%C3%A1dra%C5%BE%C3%AD.JPG","page_title":"Bahnstrecke Brno–Česká Třebová","context_page_description":"Die Bahnstrecke Brno–Česká Třebová ist eine zweigleisige, elektrifizierte Hauptbahn in Tschechien, die ursprünglich als Teil der k.k. Nördlichen Staatsbahn erbaut und betrieben wurde. Sie verläuft in Mähren von Brünn nach Česká Třebová. Die Strecke ist Teil des Paneuropäischen Verkehrskorridors IV und des TEN-Korridors Nr. 22."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BD%8F%E5%90%89%E7%A5%9E%E7%A4%BE_(%E5%A3%B1%E5%B2%90%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Sumiyoshi-jinja_%28Iki%29%2C_haiden.jpg","page_title":"住吉神社 (壱岐市)","context_page_description":"住吉神社は、長崎県壱岐市芦辺町住吉東触にある神社。式内社、旧社格は国幣中社で、現在は神社本庁の別表神社。"},{"page_url":"https://de.wikipedia.org/wiki/Johann_III._von_Trautson","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/WP_Georg_von_Frundsberg.jpg","page_title":"Johann III. von Trautson","context_page_description":"Johann III. von Trautson, seit 1541 Freiherr zu Sprechenstein, Herr auf Matrei, Schrofenstein, Bideneck etc. in Tirol und Herr auf Poysbrunn, Laa an der Thaya etc. in Niederösterreich, war ein Adliger aus Tirol und ein österreichischer Staatsmann, der in Tirol als Landeshauptmann an der Etsch, Burggraf zu Tirol und Hauptmann zu Rovereto und darüber hinaus in 60 Jahren drei Kaisern aus dem Haus Österreich diente: Ferdinand I., Maximilian II. und Rudolf II. Davon 49 Jahre als Mitglied des Geheimen Rates, aber auch als Hofmarschall und als Obersthofmeister. Er wurde 1541 zum erbländischen Freiherrn zu Sprechenstein erhoben, erwarb bedeutenden Besitz in Tirol als auch im heutigen Niederösterreich und war der nähere Stammvater seines inzwischen erloschenen Hauses, das 1599 in den Reichsgrafenstand und 1711 in den Reichsfürstenstand aufstieg."},{"page_url":"https://de.wikipedia.org/wiki/KkStB_106","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/264_141_Rakovnik.png","page_title":"KkStB 106","context_page_description":"Die Dampflokomotivreihe kkStB 106 war eine Schnellzug-Schlepptenderlokomotivreihe der k.k. österreichischen Staatsbahnen und der Südbahn."},{"page_url":"https://it.wikipedia.org/wiki/Festa_del_Santissimo_Crocifisso_(Castroreale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Castroreale_23_08_2017_20.jpg","page_title":"Festa del Santissimo Crocifisso (Castroreale)","context_page_description":"La festa del Cristo Lungo nella ricorrenza del 23 - 24 - 25 agosto è un evento religioso popolare tipico finalizzato a rievocare e commemorare, quale forma di ringraziamento, l'estinzione dei focolai dell'epidemia di colera del 1854."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E7%93%A6%E5%88%A9%E5%85%8B%E5%B1%B1%E8%84%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Kalimpongtown.jpg","page_title":"西瓦利克山脈","context_page_description":"西瓦利克山脉，亦称外喜马拉雅山脉、锡瓦利克山脉、什瓦利克山脉。位于南亚北部、喜马拉雅山南麓。自印度锡金邦蒂斯塔河向西北方向延伸，全长约1,000哩。海拔约3,000－4,000呎。\\n主要由第三纪砂、页岩组成。山体自西北而东南行，绵延于克什米尔、印度和尼泊尔，森林茂密。曾发现类人猿化石，称“西瓦古猿”。其他化石则包括懒熊的早期祖先、西瓦鹿及阿特拉斯象龟。"},{"page_url":"https://sv.wikipedia.org/wiki/Stend%C3%B6rrens_naturreservat","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Stend%C3%B6rren%2C_fotogenhuset%2C_aug_2019.jpg","page_title":"Stendörrens naturreservat","context_page_description":"Stendörrens naturreservat är ett naturreservat i Nyköpings kommun, vid Södermanlandskusten öster om Nyköping. Området som omfattar 923 hektar land och vatten och bildades 1972 för att säkerställa ett rörligt friluftsliv i den sörmländska skärgården. Förvaltare är Länsstyrelsen i Södermanlands län. Naturreservatet ingår i det Europeiska nätverket Natura 2000 för värdefulla naturområden."},{"page_url":"https://en.wikipedia.org/wiki/Myriam_Boyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Miriam_Boyer_Cannes_2017.jpg","page_title":"Myriam Boyer","context_page_description":"Myriam Boyer is a French actress. She appeared in more than eighty films and television shows since 1970. At the age of 18, she married Roger Cornillac with whom she had a son, Clovis Cornillac. From 1975 until his death in 1999 she was married to John Berry with whom she had one son, Arny Berry."},{"page_url":"https://es.wikipedia.org/wiki/Lingulodinium_polyedra","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Lingulodinium_polyedrum.jpg","page_title":"Lingulodinium polyedra","context_page_description":"Lingulodinium polyedra ​ es una especie de microalga unicelular fotosintética motil, de la clase de los dinoflagelados. Aunque tradicionalmente se los ha estudiado como algas actualmente se los considera dentro de la categoría del plancton, más concretamente del fitoplancton, ya que son organismos autótrofos y viven dispersos en el agua. ​\\nL. polyedra es habitualmente la causa de las mareas rojas, y de las exhibiciones bioluminiscentes en las playas y zonas neríticas de agua caliente durante la noche.​"},{"page_url":"https://en.wikipedia.org/wiki/University_of_Delhi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Anshu_Jain_World_Economic_Forum_2013.jpg","page_title":"University of Delhi","context_page_description":"The University of Delhi, informally known as Delhi University, is a collegiate public central university, located in New Delhi, India. It was founded in 1922 by an Act of the Central Legislative Assembly. As a collegiate university, its main functions are divided between the academic departments of the university and affiliated colleges. Consisting of three colleges, two faculties, and 750 students at its founding, the University of Delhi has since become India's largest institution of higher learning and among the largest in the world. The university has 16 faculties and 86 departments distributed across its North and South campuses. It has 77 affiliated colleges and 5 other institutes. The Vice-President of India serves as the University's chancellor."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%95%D0%A1_%D0%91%D0%B5%D0%BB%D1%8C%D0%B2%D1%96%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Centrale_Nucl%C3%A9aire_de_Belleville-sur-Loire-2.jpg","page_title":"АЕС Бельвіль","context_page_description":"АЕС Бельвіль — атомна електростанція, розташована на території комуни Бельвіль-сюр-Луар в департаменті Шер і Сюрі-пре-Лере, навпроти Неві-сюр-Луар в департаменті Ньєвр, на березі Луари між Невером і Орлеаном.\\nАЕС має 4 енергоблоки, оснащених водо-водяними реакторами P4 компанії Areva електричною потужністю 1363 МВт. Технічне водопостачання здійснюється з Луари.\\nПерсонал АЕС становить близько 620 співробітників. Експлуатуючою організацією станції є L'électricité de France."},{"page_url":"https://nl.wikipedia.org/wiki/Pomona_(planeto%C3%AFde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/32Pomona_%28Lightcurve_Inversion%29.png","page_title":"Pomona (planetoïde)","context_page_description":"Pomona is een planetoïde in de planetoïdengordel, tussen de banen van de planeten Mars en Jupiter. Pomona heeft een diameter van ongeveer 80 km en voltooit in 4,16 jaar een omloop rond de zon. Haar baan is slechts licht ellipsvormig. De minimale afstand tot de zon tijdens een omloop is 2,373 AE, de maximale afstand 2,803 AE."},{"page_url":"https://sk.wikipedia.org/wiki/Stredn%C3%A1_r%C3%AD%C5%A1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Statue_of_Amenemhet_III._%281840-1800BC%29.jpg","page_title":"Stredná ríša","context_page_description":"Stredná ríša je obdobím dejín starovekého Egypta, ktorá začínalo zjednotením Egypta faraónmi z 11. dynastie, končilo 12. dynastiou a trvalo od roku 2030 pred Kr. do roku 1640 pred Kr.\\nSo zaradením dynastii do Strednej ríše majú egyptológovia ťažkosti, jednak preto, že časť vládcov 11. dynastie nevládla nad celým Egyptom, a teda spadá ešte do predošlého Prechodného obdobia, jednak preto, že počínajúc 13. dynastiou sa začínajú do Egypta sťahovať kmene z Blízkeho východu, ktoré krajinu ovládli počas nasledujúceho Druhého prechodného obdobia ako Hyksósovia. Faraóni 13. dynastie postupne strácali vládu nad celým Egyptom, takže panovníci 14. dynastie už vládli len nad nílskou deltou. Kniežatá Hyksósovi sami založili 15. a neskôr 16. dynastiu."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B2%88%E5%AE%B6%E7%A5%A0%E5%A0%82_(%E5%98%89%E5%AE%9A)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/The_Ancestral_Hall_of_the_Shens.jpg","page_title":"沈家祠堂 (嘉定)","context_page_description":"沈家祠堂，位于中华人民共和国上海市嘉定区江桥镇星火村，是当地保存完整的一个祠堂。它也是上海市文物保护单位。"},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_6_du_m%C3%A9tro_de_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/MTA_NYC_Subway_6-express_train_passing_Elder_Ave.jpg","page_title":"Ligne 6 du métro de New York","context_page_description":"La 6 Lexington Avenue Local et la <6> Lexington Avenue Local and Pelham Express sont deux lignes du métro de New York. Leur couleur est le vert étant donné qu'elles circulent sur l'IRT Lexington Avenue Line sur la majorité de leur tracé à Manhattan. Elles sont issues du réseau de l'ancienne Interborough Rapid Transit Company et rattachées à la Division A.\\nLa ligne 6 fonctionne 24 heures sur 24 dans le Bronx et Manhattan. Elle fonctionne en omnibus sur tout son parcours, entre Parkchester dans le Bronx et la station de Brooklyn Bridge – City Hall dans le sud de Manhattan. Le service 6 compte 29 stations dans sa desserte express, et 38 dans sa desserte omnibus.\\nDes dessertes spéciales sont prévues pour les mi-journées et les heures de pointe, avec une circulation en express uniquement dans la direction la plus empruntée. En direction du Bronx, les trains qui circulent en omnibus s'arrêtent à Parkchester, alors que les trains express continuent jusqu'au terminus de Pelham Bay Park, situé plus au nord."},{"page_url":"https://bs.wikipedia.org/wiki/Koncentracijski_logor_Mauthausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Bundesarchiv_Bild_192-364%2C_KZ_Mauthausen%2C_sowjetische_Kriegsgefangene.jpg","page_title":"Koncentracijski logor Mauthausen","context_page_description":"Koncentracioni logor Mauthausen bio je najveći nacistički koncentracioni logor za vrijeme Drugog svjetskog rata na području današnje Austrije. Nalazio se u Mauthausenu, 15 km istočno od Linza i postojao je od 8. augusta 1938. godine do oslobađanja od strane američke vojske 5. maja 1945. godine. Sastojao se od glavnog logora i preko pedeset sporednih logora. Danas je dio bivšeg logora spomenik."},{"page_url":"https://it.wikipedia.org/wiki/Parablennius_sanguinolentus","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Parablennius_sanguinolentus-16-01-09.jpg","page_title":"Parablennius sanguinolentus","context_page_description":"Parablennius sanguinolentus è un pesce marino della famiglia dei Blenniidae."},{"page_url":"https://he.wikipedia.org/wiki/%D7%91%D7%99%D7%AA_%D7%92%27%D7%9E%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Beitgemal3.jpg","page_title":"בית ג'מאל","context_page_description":"בית גִ'מָאל הוא כפר ומנזר קתולי של הקונגרגציה הסלזיאנית האיטלקית הנמצא בשיפולי הרי יהודה, סמוך לצידה הדרומי של העיר בית שמש.\\nהמנזר נמצא על גבעה בגובה 370 מטר מעל פני הים ובמרחק של 35 קילומטר מזרחית לקו החוף. בשטח המנזר ישנם שלושה מבנים: מנזר לנשים, כנסיית סטפנוס הקדוש ומנזר לגברים."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%8A%AC%E7%B3%B8%E7%8A%B6%E8%99%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Microfilaria.jpg","page_title":"犬糸状虫","context_page_description":"犬糸状虫はフィラリアの一種で、蚊の吸血によって媒介されイヌを終宿主とする寄生性線虫。イヌのみならず、ネコ、イタチ、アシカ、また稀にはヒトにも感染し、犬糸状虫症を引き起こす。"},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Saarbr%C3%BCcken","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Saarbr%C3%BCcker_SchlossK%C3%B6llnerPlanL1040168_%282%29.JPG","page_title":"Schloss Saarbrücken","context_page_description":"Das Schloss Saarbrücken, auch „Saarbrücker Schloss“ genannt, ist ein barockes Schloss in der saarländischen Landeshauptstadt Saarbrücken. Es befindet sich im Stadtteil Alt-Saarbrücken am linken Ufer der Saar. Vorgängerbauten am Standort waren eine mittelalterliche Burg und ein Renaissance-Schloss.\\nDas Schloss dient heute als Verwaltungssitz des Regionalverbands Saarbrücken. Im Gewölbekeller und einem Anbau befinden sich die Ausstellungsräume des Historischen Museums Saar. Unter dem Schlossplatz wurden Teile der Burganlage mit den Kasematten freigelegt. Nach umfangreichen Ausgrabungen zwischen 2003 und 2007 sind die Kasematten vom Historischen Museum aus für Besucher zugänglich."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen,_Pl%C3%A4tze_und_Br%C3%BCcken_in_Hamburg-Billwerder","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Feldhofe_%28Billwerder%29.jpg","page_title":"Liste der Straßen, Plätze und Brücken in Hamburg-Billwerder","context_page_description":"Die Liste der Straßen, Plätze und Brücken in Hamburg-Billwerder ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Billwerder vorhandenen Straßen, Plätze und Brücken. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://hr.wikipedia.org/wiki/%C5%BDeljezni%C4%8Dki_vagoni_u_Hrvatskoj","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Vagon_H%C5%BD_Bt.jpg","page_title":"Željeznički vagoni u Hrvatskoj","context_page_description":"U inventarnom parku Hrvatskih željeznica nalazi se više vrsta vagona.\\nU nastavku slijedi prikaz serija vagona koje nose oznake Hrvatskih željeznica i koji prometuju ili su prometovali u Hrvatskoj."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Wuppertaler_Wohnquartier_Friedrich-Engels-Allee","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Friedrich-Engels-Allee_185%2C_Wuppertal_4.jpg","page_title":"Liste der Baudenkmäler im Wuppertaler Wohnquartier Friedrich-Engels-Allee","context_page_description":"Die Liste der Baudenkmäler im Wuppertaler Wohnquartier Friedrich-Engels-Allee enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Wuppertal-Friedrich-Engels-Allee in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Wuppertal eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://en.wikipedia.org/wiki/MatriKiran_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/MatriKiran_School_Fish_Pond_ICSE_School.jpg","page_title":"MatriKiran School","context_page_description":"MatriKiran School is an ICSE affiliated English medium, co-educational school for Grades Pre-Nursery to 12. It is located in Gurgaon in Haryana. The 8.25 acre campus is spread over two locations – the Junior School, Sohna Road, on 2 acres, and the Senior School, Sector 83, on 6.25 acres. The Junior School from Pre-Nursery to Grade 5 started its first academic session on 4 April 2011, whereas the High School commenced on 4 April 2016. It is managed by The Auro Education Society, the educational arm of the Vatika Group,"},{"page_url":"https://it.wikipedia.org/wiki/H%C3%B4tel_de_Ville_(Parigi)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/H%C3%B4tel_de_Ville_de_Paris_1.JPG","page_title":"Hôtel de Ville (Parigi)","context_page_description":"L'Hôtel de Ville de Paris è il municipio di Parigi cittadino; si trova nel IV arrondissement, vicino alla Senna. È classificato come Monumento storico di Francia.\\nIl consiglio municipale di Parigi risale al 1246, istituito da Luigi IX. Poiché era presieduta dalla corporazione dei mercanti d'acqua, il loro sigillo divenne quello dell'amministrazione e in seguito della città stessa, che prese anche il motto di Fluctuat nec mergitur.\\nLa sede dell'assemblea fu costruita una prima volta nel 1357 e riedificata tra il 1533 e il 1628, ma l'edificio odierno è frutto di una pesante ricostruzione dopo il disastroso incendio del 1871.\\nParteciparono al progetto diverse centinaia di artisti, che diedero la vistosa decorazione corredata da numerose sculture. Il salone delle feste è alto tredici metri e rappresenta l'ambiente più bello all'interno del palazzo.\\nA Parigi si trovano altri 20 municipi, uno per ogni arrondissement, sede dei rispettivi consigli circoscrizionali. Per evitare ambiguità solo quello centrale va chiamato Hôtel de Ville, gli altri essendo semplicemente Mairies. Ad esempio Mairie du 9e indica il municipio del IX rione."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Moldavian_ruhtinaista","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/033_-_Bogdan_cel_Orb%2C_Stefanita%2C_Petru_Rares.jpg","page_title":"Luettelo Moldavian ruhtinaista","context_page_description":"Tämä on luettelo Moldavian ruhtinaista ensimmäisistä maininnoista keskiajalla vuoteen 1859, jolloin Moldavia ja Valakia yhdistyivät personaaliunionissa muodostaen pohjan nykyiselle Romanian valtiolle."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%BA%D0%B0_%D0%B7%D0%B0_%D0%90%D0%BD%D1%86%D0%B8%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Landing_at_Anzio.jpg","page_title":"Битка за Анцио","context_page_description":"Битка за Анцио је започела 22. јануара 1944. савезничким амфибијским десантом познатим као операција Шингл на Италијанском фронту против немачких снага у области Анција и Нетуна у Италији. Операцијом је командовао амерички генерал-мајор Џон П. Лукас, а њоме је планирано да се заобиђу немачке снаге на Густавовој линији и да се омогући напад на Рим. Немци су били затечени почетком акције, па је искрцавање изведено успешно. Но, упркос успеху инвазије, операција ће се претворити у тактичку катастрофу. Заповедник америчког 6. корпуса генерал Лукас је оклевао је с продором у унутрашњост пуних десет дана, фокусирајући се на утврђивање мостобрана. Тако није искоришћена почетна иницијатива, а Немцима је остављено време за довлачење појачања и за противнапад.\\nУспех амфибијској искрцацања на овој локацији, терену који значајним делом састоји исушених мочвара и окружен планинама, који је у потпуности завиосио од фактора изненађења и брзине којом су нападачи могли да делују у зависности од реацкије бранилаца. Свако одуговлачење је могло резултовати запоседањем планина од стране браилаца и упадањем нападача у клопку."},{"page_url":"https://ro.wikipedia.org/wiki/NGC_491","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/NGC491-HST-R190GB190.jpg","page_title":"NGC 491","context_page_description":"NGC 491 este o galaxie spirală barată situată în constelația Sculptorul. A fost descoperită în 25 septembrie 1834 de către William Herschel."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Lithuanian_soldiers_of_XVI_century.PNG","page_title":"Драб","context_page_description":"Драб — рядовий воїн найманої піхоти, що була на службі Великого князівства Литовського і Корони Польської наприкінці XV–XVI століть. У іншому значенні — обідранець, босяк. Також вживається у кличній формі як лайливе слово.\\nНа українських землях кількість драбів була незначною. Драби розташовувалися невеликими ротами по 50–100 осіб у найголовніших містах краю. Київський гарнізон налічував 200—300 драбів.\\nЗазвичай, драби у роті ділилися на дві рівні частини, одна з яких була озброєна вогнепальною зброєю, інша — холодною. Кожен драб мав меч або шаблю.\\nДраби добре зарекомендували себе у війнах із Молдавським князівством і Московською державою. Під час татарських нападів унаслідок своєї нечисленності й малорухомості вони використовувалися для оборони замків."},{"page_url":"https://pl.wikipedia.org/wiki/Armata_6-funtowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/QF-6-pounder-batey-haosef-1.jpg","page_title":"Armata 6-funtowa","context_page_description":"Armata sześciofuntowa to brytyjskie działo przeciwpancerne kalibru 57 mm z okresu II wojny światowej zaprojektowane jako następca armaty dwufuntowej. Po raz pierwszy użyte bojowo w Afryce Północnej w kwietniu 1942.\\nIstniały także inne wersje tej armaty, okrętowa – QF 6-pdr 10 cwt oraz przeciwlotnicza – QF 6-pdr 6 cwt. Oznaczenie „cwt” to angielska miara wagi wynosząca 112 funtów i w przypadku tej armaty określała masę lufy."},{"page_url":"https://de.wikipedia.org/wiki/Kochhart","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Kochharttal_vom_Kirchberg_aus.jpg","page_title":"Kochhart","context_page_description":"Der Kochhart ist der mit fast 16 Kilometern auf dem Hauptstrang längste Nebenbach des Neckarzuflusses Ammer im mittleren Baden-Württemberg. Er wird auch als Kochhartgraben oder Kochenhartgraben bezeichnet und mündet nach einem Lauf in südöstlicher bis ostnordöstlicher Richtung in Reusten von rechts in die Ammer."},{"page_url":"https://en.wikipedia.org/wiki/Essad_Pasha_Toptani","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Esat_Pasha_Selanik.jpg","page_title":"Essad Pasha Toptani","context_page_description":"Essad Pasha Toptani or Esad Pasha Toptani, mainly known as Essad Pasha, was an Ottoman army officer who served as the Albanian deputy in the Ottoman Parliament. He was a prominent politician in early 20th-century Albania. Toptani cooperated with the Balkan League after the Balkan Wars and established a state in central Albania, based in Durrës, called the Republic of Central Albania."},{"page_url":"https://fr.wikipedia.org/wiki/Oxymonacanthus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Oxymonacanthus_longirostris_R%C3%A9union.jpg","page_title":"Oxymonacanthus","context_page_description":"Oxymonacanthus est un genre de poissons marins de la famille des Monacanthidae."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%8B%E7%AB%8B%E5%8B%9E%E5%8B%95%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/%E5%8C%A1%E4%BA%92%E7%94%9F.jpg","page_title":"國立勞動大學","context_page_description":"國立勞動大學的前身即為上海大學。"},{"page_url":"https://hu.wikipedia.org/wiki/Ettringen_(Wertach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Ettringen_-_Kirche_v_SW.JPG","page_title":"Ettringen (Wertach)","context_page_description":"Ettringen település Németországban, azon belül Bajorországban. Lakosainak száma 3433 fő. +/-"},{"page_url":"https://en.wikipedia.org/wiki/Cornelis_Benjamin_Biezeno","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Cornelis_Benjamin_Biezeno.jpg","page_title":"Cornelis Benjamin Biezeno","context_page_description":"Cornelis Benjamin Biezeno was a Dutch applied mathematician and scientist in engineering mechanics. He was a professor at TU Delft."},{"page_url":"https://en.wikipedia.org/wiki/Colvend_and_Southwick","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Houses_in_Caulkerbush_-_geograph.org.uk_-_1484627.jpg","page_title":"Colvend and Southwick","context_page_description":"Colvend and Southwick is a community council area and civil parish within the Stewartry area of Dumfries and Galloway, Scotland. It is also part of the Church of Scotland parish of Colvend, Southwick and Kirkbean. It is in the historic county of Kirkcudbrightshire.\\nColvend Church was designed by architect Peter MacGregor Chalmers in 1911.\\nSouthwick Church designed by Peddie & Kinnear 1891.\\nSouthwick House, C18th/19th mansion house, home of Sir Mark McTaggart-Stewart MP, Baronet, MP for Wigtown Burghs from 1874–80 Kirkcudbrightshire between 1885 and 1910."},{"page_url":"https://ca.wikipedia.org/wiki/Teatre_de_la_il%C2%B7lustraci%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Foire_saint-laurent.jpg","page_title":"Teatre de la il·lustració","context_page_description":"El teatre de la Il·lustració són aquelles produccions teatrals que es van realitzar durant el període conegut com a Il·lustració."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%B8-%D0%B4%D1%8E-%D0%A1%D0%B0%D0%BB%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Salies_du_Salat-%C3%89glise_Notre_Dame_de_la_Piti%C3%A9-20130425.jpg","page_title":"Сали-дю-Салат","context_page_description":"Сали́-дю-Сала́т — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Верхняя Гаронна. Административный центр кантона Сали-дю-Салат. Округ коммуны — Сен-Годенс.\\nКод INSEE коммуны — 31523."},{"page_url":"https://sv.wikipedia.org/wiki/Cupressus_arizonica","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Cupressus_arizonica_Chiricahua.jpg","page_title":"Cupressus arizonica","context_page_description":"Cupressus arizonica är en cypressväxtart som beskrevs av Edward Lee Greene. Cupressus arizonica ingår i släktet cypresser, och familjen cypressväxter. IUCN kategoriserar arten globalt som livskraftig.\\nDetta träd blir upp till 23 meter högt och diametern i brösthöjd är ofta lite större än en meter. Kronan liknar antingen en kon i formen eller den har ingen geometrisk form. Trädets barr är korta och spetsiga. Nära vattendrag kan stammen ha en diameter av två meter. Hos underarten C. a. glabra är barken rosa till rödbrun.\\nDet naturliga utbredningsområdet ligger i Arizona och New Mexico samt i angränsande områden av Mexiko. Det ligger 750 till 2000 meter över havet. Cupressus arizonica hittas vanligen i halvtorra skogar tillsammans med andra träd. Arten är vanlig i djupa dalgångar."},{"page_url":"https://en.wikipedia.org/wiki/Scheduled_monuments_in_Dumfries_and_Galloway","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Cruggleton_Castle.jpg","page_title":"Scheduled monuments in Dumfries and Galloway","context_page_description":"A scheduled monument in Scotland is a nationally important archaeological site or monument which is given legal protection by being placed on a list maintained by Historic Environment Scotland. The aim of scheduling is to preserve the country's most significant sites and monuments as far as possible in the form in which they have been inherited.\\nThe process of scheduling is governed by the Ancient Monuments and Archaeological Areas Act 1979, which aims \\"to make provision for the investigation, preservation and recording of matters of archaeological or historical interest\\". The term \\"scheduled monument\\" can apply to the whole range of archaeological sites which have been deliberately constructed by human activity but are not always visible above ground. They range from prehistoric standing stones and burial sites, through Roman remains and medieval structures such as castles and monasteries, to later structures such as industrial sites and buildings constructed for the World Wars. Some buildings or structures which were both scheduled and listed have had their listing designations removed to reduce the duplication.\\nIn 2017 there were 8238 scheduled monuments in Scotland."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%AA%E3%83%BC%E3%83%89%E3%83%AA%E3%83%921%E4%B8%96_(%E3%82%AA%E3%83%BC%E3%82%B9%E3%83%88%E3%83%AA%E3%82%A2%E5%85%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Herzog_Friedrich_I._der_Christliche.jpg","page_title":"フリードリヒ1世 (オーストリア公)","context_page_description":"フリードリヒ1世は、バーベンベルク家のオーストリア公。レオポルト5世とハンガリー王ゲーザ2世の娘イロナの長男。レオポルト6世の兄。"},{"page_url":"https://nn.wikipedia.org/wiki/Hammersborgtunnelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Hammersborgtunnelen_%C3%B8st_2220a.JPG","page_title":"Hammersborgtunnelen","context_page_description":"Hammerborgtunnelen er ein 220 meter lang aust-vestgåande tunnel i to løp i gatesystemet Ring 1 i Oslo, mellom dei delane av Pilestredet i vest og Hammersborggata i aust som høyrer til Ring 1.\\nTunnelen vart bygd i open byggjegrop, og vart opna for trafikk i januar 1990. Han går under eit område med fleire kontorblokker, og under Akersgata, og har den austre munningen liggjande under det «lokket» som utgjer Arne Garborgs plass i Regjeringskvartalet framfor Deichmanske bibliotek. Frå det austgåande løpet i tunnelen er det samband til eit stort parkeringshus i fleire høgder under gateplanet.\\nTunnelen har namn etter stroket Hammersborg, som ligg nord for den austre tunnelmunningen."},{"page_url":"https://es.wikipedia.org/wiki/Tongyong_pinyin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%E9%AB%98%E9%9B%84%E6%8D%B7%E9%81%8B%E5%B0%8F%E6%B8%AF%E7%AB%99_%282330729579%29.jpg","page_title":"Tongyong pinyin","context_page_description":"El tongyong pinyin era un sistema de romanización del chino mandarín, desarrollado en Taiwán como una versión alternativa al sistema hanyu pinyin, habitualmente abreviado como pinyin, y que es el oficial en la República Popular China."},{"page_url":"https://de.wikipedia.org/wiki/Marsflagge","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Terraforming_Mars_transition_horizontal.jpg","page_title":"Marsflagge","context_page_description":"Die Marsflagge oder die Flagge des Mars ist eine Trikolore der Mars Society, die den Planeten Mars repräsentiert."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B5%D6%80%D5%A5%D6%84_%D5%A1%D5%BD%D5%BF%D5%B2%D5%AB_%D5%B7%D6%84%D5%A1%D5%B6%D5%B7%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Triju_Zvaig%C5%BE%C5%86u_ordenis_III_class_D.JPG","page_title":"Երեք աստղի շքանշան","context_page_description":"Երեք աստղի շքանշան, Լատվիայի Հանրապետության պետական բարձրագույն պարգև, երկրի քաղաքացիական առաջին շքանշանը: Առաջին անգամ հաստատվել է 1924 թվականի մարտի 24-ին՝ ի նշանավորումն Լատվիայի Հանրապետության հիմնադրման: Երկրորդ անգամ հաստատվել է 1994 թվականի հոկտեմբերի 25-ին նախագահ Գունտիս Ուլմանիսի հրամանգրով: Երեք աստղի շքանշանով պարգևատրվում են մշակույթի, գիտության, մարզական, տնտեսական ոլորտներում գործունեության համար, ինչպես նաև դիվանագիտական արարողակարգի շրջանակներում:"},{"page_url":"https://en.wikipedia.org/wiki/Mercedes-Benz_CLS-Class_(W218)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cd/Mercedes-Benz_CLS_350_BlueEFFICIENCY_Edition_1_%28C_218%29_%E2%80%93_Frontansicht_%282%29%2C_16._April_2011%2C_D%C3%BCsseldorf.jpg","page_title":"Mercedes-Benz CLS-Class (W218)","context_page_description":"The W218 Mercedes-Benz CLS is the second generation of the Mercedes CLS-Class range of four-door\\nfastbacks. The model shares the chassis and most of the technology with the W212 Mercedes E-class and was produced from 2010 to 2018. The body styles of the range are:\\n4-door fastback\\n5-door shooting brake\\nUnlike its predecessor, the C218/ X218 CLS can be optioned with all-wheel drive 4MATIC on all models including CLS63 AMG variants. Mercedes also introduced a new five-door estate version to the CLS lineup, called the CLS Shooting Brake.\\nThe W218 CLS-Class was succeeded by the Mercedes-Benz CLS-Class in 2018."},{"page_url":"https://ko.wikipedia.org/wiki/MAN_SE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Wzwz_munich-ungerer_manse_1.jpg","page_title":"MAN SE","context_page_description":"아우크스부르크-뉘른베르크 기계공장 유럽회사, 약칭 엠아엔 에스에는 독일 바이에른주 뮌헨에 본사가 있는 독일의 기업으로 유럽 내 산업 장비와 상용차를 제조 및 공급하는 회사이다."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B2%D0%B0%D0%BD%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Zambezi_River_at_junction_of_Namibia%2C_Zambia%2C_Zimbabwe_%26_Botswana.jpg","page_title":"Квандо","context_page_description":"Ква́ндо — річка в Центральній Африці, притока Замбезі, найпотужніша з її правих приток. Довжина річища 731 км, площа басейну 97 778 км².\\nКвандо починається в центральній Анголі на плоскогір’ї Біє і тече порожистим річищем на південний схід. В середній течії протягом 225 км її русло пролягає вдовж кордону Анголи з Замбією. Незадовго до кінця своєї течії річка досягає кордону Анголи з Намібією біля Конголи і повертає на південь, перетинаючи Смугу Капріві — східній виступ намібійської території, який тягнеться до самої Замбезі. Місцеве населення називає її тут Лін’янті. Ще 10 000 років тому Квандо продовжувала текти звідси на південь і вливалася в озеро Макгадікгаді, яке тоді існувало на місці дельти Окаванго, але зараз вона робить різкий заворот на схід, утворюючі південній кордон Смуги Капріві з Ботсваною. На цьому завороті Квандо приймає до себе одне зі східних відгалужень дельти Окаванго, яким води Окаванго досягають Квандо лише під час надзвичайно високих повеней.\\nНа території Смуги Капріві річка розливається численними рукавами, заболочуючи довколишню місцевість і створюючи так звані болота Лін’янті площею 1 425 км²."},{"page_url":"https://en.wikipedia.org/wiki/Isle_of_Arran","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/MapOfAyrshire.png","page_title":"Isle of Arran","context_page_description":"The Isle of Arran or simply Arran is an island off the coast of Scotland. It is the largest island in the Firth of Clyde and the seventh largest Scottish island, at 432 square kilometres. Historically part of Buteshire, it is in the unitary council area of North Ayrshire. In the 2011 census it had a resident population of 4,629. Though culturally and physically similar to the Hebrides, it is separated from them by the Kintyre peninsula. Often referred to as \\"Scotland in Miniature\\", the island is divided into highland and lowland areas by the Highland Boundary Fault and has been described as a \\"geologist's paradise\\".\\nArran has been continuously inhabited since the early Neolithic period. Numerous prehistoric remains have been found. From the 6th century onwards, Goidelic-speaking peoples from Ireland colonised it and it became a centre of religious activity. In the troubled Viking Age, Arran became the property of the Norwegian crown, until formally absorbed by the kingdom of Scotland in the 13th century. The 19th-century \\"clearances\\" led to significant depopulation and the end of the Gaelic language and way of life."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_nejvy%C5%A1%C5%A1%C3%ADch_budov_v_Brn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Brno%2C_Kr%C3%A1lovo_Pole%2C_Purky%C5%88ova%2C_Eden_%2801%29.jpg","page_title":"Seznam nejvyšších budov v Brně","context_page_description":"Seznam nejvyšších budov v Brně je seřazen podle výšky. První v seznamu, AZ Tower, byla dokončena koncem března 2013 a stala se současně nejvyšší budovou v Česku."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Aniva","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Aniva_01.jpg","page_title":"Aniva","context_page_description":"Aniva sī Lō͘-se-a Sakhalin Chiu ê chi̍t ê siâⁿ-chhī."},{"page_url":"https://et.wikipedia.org/wiki/Salatsi_piirkond","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Flag_of_Salacgr%C4%ABvas_novads.png","page_title":"Salatsi piirkond","context_page_description":"Salatsi piirkond on 1. järgu haldusüksus Lätis. Piirneb põhjas Eestiga.\\nPiirkond moodustati 2009. aastal Salatsi ja Heinaste linnast ning Liepupe vallast. Hiljem moodustati piirkonnas veel Salatsi vald ja Heinaste vald. Piirkonna keskus on Salatsi linn.\\nArvestuslikel andmetel oli 1. jaanuaril 2011 Salatsi piirkonna elanikest lätlasi 89,9%, venelasi 5,0%, ukrainlasi 1,5% ja teistest rahvustest inimesi 3,6%."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%B9%D0%BD%D0%B8%D0%BD%D0%B3-%D0%A1%D1%82%D0%BE%D1%80%D0%BC,_%D0%93%D1%83%D0%BD%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Breuning_Storm_kvartetten_1945.jpg","page_title":"Бройнинг-Сторм, Гунна","context_page_description":"Гунна Бройнинг-Сторм — датская скрипачка и преподавательница музыки, руководитель музыкального квартета."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E5%BE%B7%E9%87%8C%E5%AE%89%C2%B7%E9%A6%AC%E9%87%8C%E4%BA%9E%E6%9F%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Adrian_Mariappa_2_%28cropped%29.jpg","page_title":"阿德里安·馬里亞柏","context_page_description":"阿德里安·約瑟夫·馬里亞柏是一名職業足球員，司職後衛，現效力於英超俱樂部瓦特福。"},{"page_url":"https://hu.wikipedia.org/wiki/Heinrich_Karl_Eichst%C3%A4dt","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Kirchbuch_Oschatz_1771_Eichstaedt.png","page_title":"Heinrich Karl Eichstädt","context_page_description":"Heinrich Karl Abraham Eichstädt német klasszika-filológus."},{"page_url":"https://gl.wikipedia.org/wiki/Pandemia_por_coronavirus_de_2019-2020","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ukraine_evacuates_Ukrainian_and_foreign_citizens_from_Wuhan_16.jpg","page_title":"Pandemia por coronavirus de 2019-2020","context_page_description":"A pandemia por coronavirus de 2019–2020 é unha pandemia global actual de doenza do coronavirus 2019 causada polo coronavirus 2 da síndrome respiratoria aguda severa. O virus foi identificado por vez primeira en Wuhan, na provincia chinesa de Hubei, en decembro de 2019, estendéndose finalmente a cada provincia do país. O 11 de marzo de 2020, a Organización Mundial da Saúde declarou o abrocho como unha pandemia. A data do 13 de agosto, máis de 20 millóns de casos foron confirmados en máis de 200 países e territorios, co maior número de casos nos Estados Unidos, Brasil, a India, Rusia, Suráfrica, o Perú, México, Colombia, Chile, España, Irán e o Reino Unido. Máis de 13 millóns de persoas conseguiron recuperarse da doenza e máis de 750 000 morreron.\\nA transmisión do virus entre as persoas é semellante á da gripe, a través das vías respiratorias por tusir ou esbirrar. O tempo entre a exposición e a aparición dos primeiros síntomas é polo xeral de cinco días, mais pode variar dende os dous ós catorce días. Os síntomas máis comúns son febre, tose e falta de alento. As complicacións poden incluír pneumonía e síndrome de dificultade respiratoria aguda."},{"page_url":"https://en.wikipedia.org/wiki/Bourg-la-Reine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Bourg-la-Reine_le_23_juillet_2012_-_01.jpg","page_title":"Bourg-la-Reine","context_page_description":"Bourg-la-Reine is a commune in the southern suburbs of Paris, France. It is located 9.1 km from the center of Paris. The inhabitants are called Réginaburgiens."},{"page_url":"https://en.wikipedia.org/wiki/Baton_Rouge_Police_Department","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/BatonRougeBadge.JPG","page_title":"Baton Rouge Police Department","context_page_description":"The Baton Rouge Police Department is the primary law enforcement agency in the city of Baton Rouge, Louisiana. The Chief of Police, as of March 8, 2018, was Murphy Paul.\\nThe Baton Rouge Police Department has been accredited by the Commission on Accreditation for Law Enforcement Agencies since 1996."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%89%8E%E5%9B%A0%E4%BB%A3%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Khajou_Bridge.jpg","page_title":"扎因代河","context_page_description":"扎因代河，是伊朗的河流，位於該國中部，是伊朗高原的最大河流，發源自札格羅斯山脈，河道全長400公里，流域面積41,500平方公里，平均流量每秒38立方米。"},{"page_url":"https://de.wikipedia.org/wiki/Rosay_(Seine-Maritime)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Rosay-76-mairie.JPG","page_title":"Rosay (Seine-Maritime)","context_page_description":"Rosay ist eine französische Gemeinde mit 267 Einwohnern im Département Seine-Maritime in der Region Normandie; sie gehört zum Arrondissement Dieppe und ist Teil des Kantons Neufchâtel-en-Bray. Die Einwohner werden Bolhardais genannt."},{"page_url":"https://vec.wikipedia.org/wiki/Saint-Pierre-sur-Doux","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Notre_Dame_des_Sapins_%28Saint_Pierre_sur_Doux%29.jpg","page_title":"Saint-Pierre-sur-Doux","context_page_description":"Saint-Pierre-sur-Doux el xé on comun de 107 abitanti del departemento de Ardèche che el fa parte del rejon Alvergna-Rodano-Alpe in Fransa."},{"page_url":"https://cs.wikipedia.org/wiki/Jan_Stloukal_(1942)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Brat%C5%99i_Stloukalov%C3%A9.jpg","page_title":"Jan Stloukal (1942)","context_page_description":"Jan Stloukal je bývalý český fotbalový záložník. V letech 1962–1964 reprezentoval Československo v juniorské kategorii.\\nNejvyšší fotbalovou soutěž si zahráli i jeho otec Jan, bratr Miloš a strýc Vilém."},{"page_url":"https://fr.wikipedia.org/wiki/Louise_Seidler","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Vogel_von_Vogelstein_-_Louise_Seidler_in_Rom.jpg","page_title":"Louise Seidler","context_page_description":"Louise Seidler est une peintre allemande de la cour des ducs de Weimar, conservatrice de leur collection d'art et une amie proche du poète Goethe et du peintre Georg Friedrich Kersting."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%9F%E0%A9%8B%E0%A8%95%E0%A9%80%E0%A8%93_%E0%A8%A1%E0%A8%BF%E0%A8%9C%E0%A8%BC%E0%A8%A8%E0%A9%80%E0%A8%B2%E0%A9%88%E0%A8%82%E0%A8%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Tokyo_Disneyland_logo.svg","page_title":"ਟੋਕੀਓ ਡਿਜ਼ਨੀਲੈਂਡ","context_page_description":"ਟੋਕੀਓ ਡਿਜ਼ਨੀਲੈਂਡ ਟੋਕੀਓ ਡਿਜ਼ਨੀ ਰਿਜ਼ੋਰਟ ਦਾ 115 ਏਕੜ ਖੇਤਰ ਵਿੱਚ ਤਿਆਰ ਕੀਤਾ ਗਿਆ ਥੀਮ ਪਾਰਕ ਹੈ। ਟੋਕੀਓ ਡਿਜ਼ਨੀ ਰਿਜ਼ੋਰਟ ਦਾ ਪਤਾ ਓਰਾਯਸੁ, ਚੀਬਾ, ਜਪਾਨ, ਨਜਦੀਕ ਟੋਕੀਓ। ਇਸਦਾ ਮੁੱਖ ਦਰਬਾਜਾ ਮਾਇਹਮਾ ਸਟੇਸ਼ਨ ਅਤੇ ਟੋਕੀਓ ਡਿਜ਼ਨੀਲੈਂਡ ਸਟੇਸ਼ਨ ਦੇ ਨਾਲ ਲਗਦਾ ਹੈ। ਇਹ ਪਹਿਲਾਂ ਅਜਿਹਾ ਪਾਰਕ ਸੀ ਜਿਹੜਾ ਯੂਨਾਇਟਿਡ ਸਟੇਟ ਤੋ ਬਾਹਰ ਬਣਾਇਆ ਗਿਆ ਸੀ ਜਿਸਨੂੰ 15 ਅਪ੍ਰੈਲ 1983 ਨੂੰ ਲੋਕਾਂ ਵਾਸਤੇ ਖੋਲ ਦਿੱਤਾ ਗਿਆ। ਇਸ ਪਾਰਕ ਦੀ ਉਸਾਰੀ ਦਾ ਕੰਮ ਵਾਲਟ ਡਿਜ਼ਨੀ ਇਮੇਜਨਰਿੰਗ ਨੇ ਕੀਤਾ। ਬਣਤਰ ਅਨੁਸਾਰ ਇਹ ਪਾਰਕ ਕੈਲਿਫੋਰਨੀਆ ਦੇ ਡਿਜ਼ਨੀਲੈਂਡ ਅਤੇ ਫਲੋਰਿਡਾ ਦੇ ਮੈਜਿਕ ਕਿੰਗਡਮ ਨਾਲ ਹੁਬਹੁ ਮਿਲਦਾ ਹੈ। ਡਿਜ਼ਨੀਲੈਂਡ ਦੀ ਮਾਲਕ ਕੰਪਨੀ ਦੀ ਓਰੀਏਂਟਲ ਲੈਂਡ ਕੰਪਨੀ ਹੈ, ਜਿਸਨੇ ਇਸਦਾ ਲਸੰਸ ਦੀ ਵਾਲਟ ਡਿਜ਼ਨੀ ਕੰਪਨੀ ਤੋਂ ਲਿਆ ਸੀ। ਇਸ ਖੇਤਰ ਦੇ ਕੁਝ ਜਾ ਸਾਰੇ ਹਿੱਸਾ ਉਪਰ ਹੀ ਵਾਲਟ ਡਿਜ਼ਨੀ ਕੰਪਨੀ ਦੀ ਮਾਲਕੀ ਨਹੀ ਹੈ, ਟੋਕੀਓ ਡਿਜ਼ਨੀਲੈਂਡ ਅਤੇ ਇਸ ਨਾਲ ਜੁੜੇ ਪਾਰਕ, ਟੋਕੀਓ ਡਿਜ਼ਨੀਸੀ ਵਾਲਾ ਖੇਤਰ ਹੀ ਡਿਜ਼ਨੀ ਪਾਰਕ ਦਾ ਹਿੱਸਾ ਹੈ।\\nਪਾਰਕ ਵਿੱਚ ਸੱਤ ਮੁੱਖ ਥਾਂਵਾਂ ਹਨ, ਵਰਲਡ ਬਜ਼ਾਰ; ਡਿਜ਼ਨੀਲੈਂਡ ਵਿੱਚ ਏਡਵੇਂਚਰਲੈਂਡ, ਵੇਸਟਰਨਲੈਂਡ, ਫੈਨਸੀਲੈਂਡ ਅਤੇ ਟੁਮੋਰੋਲੈਂਡ ਚਾਰ ਮੁੱਖ ਥਾਵਾਂ ਦੇ ਨਾਲ ਨਾਲ ਦੋ ਮਿਨੀ ਲੈਂਡ ਕ੍ਰੀਟਰ ਕੰਟ੍ਰੀ ਅਤੇ ਮਿੱਕੀਸ ਟੂਨਟਾਊਨ ਵੀ ਹਨ। ਬਹੁਤ ਸਾਰੀਆਂ ਖੇਡਾਂ ਅਤੇ ਚੰਡੋਲ ਅਮੇਰਿਕਨ ਡਿਜ਼ਨੀਲੈਂਡ ਦੀ ਹੀ ਨਕਲ ਹਨ ਜਿਹੜੇ ਡਿਜ਼ਨੀ ਫਿਲਮ ਅਤੇ ਕਾਲਪਨਿਕ ਹਨ। ਫੈਂਟੇਸੀਲੈਂਡ ਵਿੱਚ ਸ਼ਾਮਿਲ ਹਨ ਪੀਟਰ ਪਾਨ ਫਲਾਇਟ, ਸਨੋ ਵਾਇਟ ਸਕੇਰੀ ਏਡਵੇਂਚਰਸ, ਡੁਮਬੋ ਦੀ ਫਲਾਇੰਗ ਏਲਿਫ਼ੇਂਟ ਅਤੇ ਬਹੁਤ ਕੁਝ ਡਿਜ਼ਨੀ ਫਿਲਮ ਅਤੇ ਉਸਦੇ ਪਾਤਰਾਂ ਨਾਲ ਸੰਬੰਧਿਤ ਹੈ।"},{"page_url":"https://de.wikipedia.org/wiki/Flughafen_Mehamn","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Mehamn-lufthavn.jpg","page_title":"Flughafen Mehamn","context_page_description":"Der Flughafen Mehamn ist ein nordnorwegischer Flughafen in der Provinz Troms og Finnmark.\\nEr befindet sich an der Küste der Barentssee, rund einen Kilometer südwestlich des zur Kommune Gamvik gehörenden Ortes Mehamn und ist der nördlichste Flughafen auf dem skandinavischen Festland.\\nBetreiber des Flughafens ist das norwegische Staatsunternehmen Avinor.\\nDer Flughafen wird nur von der norwegischen Regionalfluggesellschaft Widerøe angeflogen.\\nDirekte Linienflugverbindungen gibt es nach Alta, Berlevåg, Båtsfjord, Hammerfest, Honningsvåg, Kirkenes, Sørkjosen, Tromsø und Vadsø."},{"page_url":"https://fy.wikipedia.org/wiki/Ids_Willemsma","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Wetterweagen.JPG","page_title":"Ids Willemsma","context_page_description":"Ids Willemsma is in Frysk byldhouwer en tekener."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%BD%D0%B8%D1%82%D0%BD%D1%8B%D0%B9_%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/%D0%97%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5_%D1%84%D0%B8%D1%80%D0%BC%D1%8B_%D0%A5%D0%B0%D0%B0%D0%BA%D0%BC%D0%B5%D0%BD_%D0%B8_%D0%9A_%28_%D0%9B%D0%B5%D0%BD.%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C%2C_%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D0%B3%2C_%D0%9F%D0%BE%D0%B4%D0%B3%D0%BE%D1%80%D0%BD%D0%B0%D1%8F_%D1%83%D0%BB%D0%B8%D1%86%D0%B0%2C_%D0%B4.14%2C_%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D1%8B%D0%B9_%D0%B2%D0%B0%D0%BB%2C_%D0%B4.5%29.JPG","page_title":"Гранитный дворец","context_page_description":"«Гранитный дворец» — бывшее здание главной конторы фирмы «Хакман и К°» в Выборге, построенное в 1907—1908 годах по проекту архитекторов Уно Ульберга и Акселя Гюльдена в стиле национального романтизма. Здание, ставшее одним из наиболее известных памятников архитектуры в городе, получило повреждения во время советско-финских войн, и отремонтировано в послевоенные годы с отступлениями от первоначального проекта. Угловое здание имеет два адреса: Улица Северный Вал, дом 5, и Подгорная улица, дом 14."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_Nalezen%C3%AD_svat%C3%A9ho_K%C5%99%C3%AD%C5%BEe_(Fr%C3%BDdlant)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Fr%C3%BDdlant%2C_kostel_Nalezen%C3%AD_sv._K%C5%99%C3%AD%C5%BEe%2C_kaple_01.jpg","page_title":"Kostel Nalezení svatého Kříže (Frýdlant)","context_page_description":"Děkanský kostel Nalezení svatého Kříže se nachází v areálu ve středu města Frýdlant jihozápadně od náměstí T.G. Masaryka na severním břehu říčky Smědé. Součástí tohoto areálu je kostel s náhrobníky, kaple Krista v žaláři, kříž, socha sv. Heleny, sloup se sochou Panny Marie a fara s hospodářskou budovou. Až do roku 1710, kdy byl zrušen, se kolem kostela rozprostíral starý městský hřbitov, který byl ohrazen dodnes stojící kamennou zdí, v níž se částečně zachoval soubor zastavení křížové cesty. Areál je součástí městské památkové zóny. Je chráněn jako kulturní památka České republiky."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_races_ovines_du_Royaume-Uni","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Rough_Fell.jpg","page_title":"Liste de races ovines du Royaume-Uni","context_page_description":"Liste des principales races de moutons connues du Royaume-Uni :"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B5%D9%86%D8%B9%D8%AA_%D9%85%D8%A7%D9%87%DB%8C%DA%AF%DB%8C%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Fishing%2C_C%C3%A0_Mau.jpg","page_title":"صنعت ماهیگیری","context_page_description":"ماهی‌گیری، یکی از مهم‌ترین صنعت‌های جهان است. هر سال، حدود ۱۰۰ میلیون تن، آبزیان صید می‌شود. کشورهای ژاپن، آمریکا، چین، نروژ، هندوستان، شیلی، ایران و کشورهایی که در گذشته بخشی از اتحاد جماهیر شوروی بودند، بیشترین صید را دارند. انسان از دوران پیش از تاریخ، ماهیگیری می‌کرده؛ اما صید ماهی به روش‌های تجاری، تا قرن هفدهم رایج نبود."},{"page_url":"https://et.wikipedia.org/wiki/Issaak_Levitani_maalide_loend","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/%D0%9B%D0%B5%D0%B2%D0%B8%D1%82%D0%B0%D0%BD_%D0%A3_%D0%B1%D0%B5%D1%80%D0%B5%D0%B3%D0%B0_%D0%BC%D0%BE%D1%80%D1%8F._%D0%9A%D1%80%D1%8B%D0%BC.jpg","page_title":"Issaak Levitani maalide loend","context_page_description":"Tabelis on esitatud vene maalikunstniku Issaak Levitani maalide loend."},{"page_url":"https://it.wikipedia.org/wiki/Dinastia_Fitz-Gerald","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Carrigafoyle_Castle_Ireland.jpg","page_title":"Dinastia Fitz-Gerald","context_page_description":"I Fitz-Gerald furono un'importante famiglia dinastica Anglo-Irlandese o Cambro-Irlandese. Il progenitore fu Gerald de Windsor, castellano di Pembroke. I FitzgGerald acquisirono fin dalla prima invasione inglese grandi porzioni di territorio in Irlanda. La dinastia ricoprì un importante ruolo nella storia irlandese e strinse così tanti rapporti matrimoniali con i nativi irlandesi che gli studiosi usano la definizione \\"più irlandesi degli irlandesi stessi\\" per indicare l'elevata assimilazione culturale avvenuta tra invasori e invasi. I membri della dinastia vengono chiamati Giraldini, dall'inglese Geraldines.\\nLa dinastia si suddivide in due rami:\\nI FitzGerald di Kildare\\nI FitzGerald di Desmond"},{"page_url":"https://nl.wikipedia.org/wiki/Hayange","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Map_commune_FR_insee_code_57306.png","page_title":"Hayange","context_page_description":"Hayange is een gemeente in het Franse departement Moselle en telt 15.227 inwoners. De plaats maakt deel uit van het arrondissement Thionville-West."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B8%94%EB%A1%9D_(%EA%B1%B4%EC%84%A4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Parpaing_construction.jpg","page_title":"블록 (건설)","context_page_description":"블록은 시멘트와 모래로 네모지게 만들어서 벽면 따위를 쌓는 데 쓰는 건축 자재를 말한다."},{"page_url":"https://id.wikipedia.org/wiki/Kecepatan_angin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Weather_Station_at_Feilding_Waste_Water_Treatment_Plant.JPG","page_title":"Kecepatan angin","context_page_description":"Kecepatan angin, atau velositas gelombang angin, adalah sebuah kuantitas atmosterik fundamental. Kecepatan angin disebabkan oleh pergerakan angin dari tekanan tinggi ke tekanan rendah, biasanya karena perubahan suhu."},{"page_url":"https://it.wikipedia.org/wiki/Sonia_Evans","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Sonia_Evans_in_2008_%28background_edited%29_%28crop%29.jpg","page_title":"Sonia Evans","context_page_description":"Sonia Evans, nota semplicemente come Sonia, è una cantante britannica."},{"page_url":"https://de.wikipedia.org/wiki/Dietrich_Klagges","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Braunschweig_Brunswick_Boehme_%282006%29.jpg","page_title":"Dietrich Klagges","context_page_description":"Dietrich Klagges war ein Politiker der NSDAP und in der Zeit des Nationalsozialismus 1933 bis 1945 ernannter Ministerpräsident des Freistaates Braunschweig."},{"page_url":"https://eu.wikipedia.org/wiki/Castrocalb%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Castrocalb%C3%B3n_20081231_416.jpg","page_title":"Castrocalbón","context_page_description":"Castrocalbon Leongo Tierra de La Bañeza eskualdean dagoen udalerria da. 2007an 1.163 biztanle zituen."},{"page_url":"https://es.wikipedia.org/wiki/Opabinia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Opabinia_smithsonian.JPG","page_title":"Opabinia","context_page_description":"Opabinia es un animal extinto, cuyos fósiles se han encontrado en depósitos correspondientes al periodo Cámbrico, en la formación Lutitas de Burgess, Columbia Británica. Fue un animal marino, de pequeño tamaño y aspecto peculiar, con cinco ojos y una larga probóscide frontal. Su única especie es Opabinia regalis. Un posible pariente fue Myoscolex, cuyos fósiles se han encontrado en el sur de Australia. El descubridor de Opabinia, Charles Doolittle Walcott, la llamó así debido al pico Opabin, en la parte canadiense de las Montañas Rocosas. Se conocen menos de veinte ejemplares."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%80%A3%E9%82%A6%E3%82%A8%E3%83%B3%E3%82%BF%E3%83%BC%E3%83%97%E3%83%A9%E3%82%A4%E3%82%BA%E3%82%A2%E3%83%BC%E3%82%AD%E3%83%86%E3%82%AF%E3%83%81%E3%83%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Architectural_Levels_and_Attributes.jpg","page_title":"連邦エンタープライズアーキテクチャ","context_page_description":"連邦エンタープライズアーキテクチャ はアメリカ合衆国連邦政府のエンタープライズアーキテクチャフレームワークである。それは、連邦政府における情報技術の取得、利用、及び廃止のための共通の方法論を提供する。\\nエンタープライズアーキテクチャはビジネス性能を改善し、そして行政機関が彼らの中核事業をより良く実行することを助ける、資源の調整のためのマネジメントの実践である。EAは、機関の現在及び将来の状態を記述し、現在状態から望ましい将来状態へ移行する計画をレイアウトする。FEAはこれらの目標を達成させる過程で働く。\\n米国FEAはClinger-Cohen法に準じて米国連邦政府における情報技術取得のための共通の方法論を提供するため、行政管理予算局で始められた。それは、連邦機関を横断し、コストを縮減し、そして市民サービスを向上させる、情報と資源の容易に共有するため設計された。"},{"page_url":"https://sv.wikipedia.org/wiki/Il_sogno_di_Scipione","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Wolfgang-amadeus-mozart_1.jpg","page_title":"Il sogno di Scipione","context_page_description":"Il sogno di Scipione är en opera i en akt med musik av Wolfgang Amadeus Mozart och libretto av Pietro Metastasio efter Ciceros Somnium Scipionis om den romerske fältherren Publius Cornelius Scipio Aemilianus."},{"page_url":"https://ca.wikipedia.org/wiki/Tipus_de_pila","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/PP9-PP3-batteries.JPG","page_title":"Tipus de pila","context_page_description":"Aquest article enumera les mides, les formes i les característiques generals d'alguns tipus de piles primàries i secundàries habituals en ús domèstic i industrial.\\nHistòricament el terme \\"bateria\\" es referia a un conjunt de piles electroquímiques connectades en sèrie, no obstant això, en l'actualitat, el terme ha arribat a referir-se a qualsevol conjunt de piles empaquetades en un contenidor comú amb connexions externes que es subministren com a font d'energia per a dispositius elèctrics. Aquest fet porta a la varietat de factors de forma normalitzats disponibles actualment.\\nLa llarga història de piles seques d'un sol ús va fer que s'utilitzessin molts estàndards diferents tant a nivell nacional com del fabricant per a normalitzar les mides de les piles, molt abans que s'acordessin normes internacionals. Les normes tècniques per a mides i tipus de bateries són publicades per Organismes de normalització com la International Electrotechnical Commission i l'American National Standards Institute."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%86%E0%AE%95%E0%AF%8D%E0%AE%9A%E0%AE%BF%E0%AE%9A%E0%AE%A9%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Symptoms_of_oxygen_toxicity.png","page_title":"ஆக்சிசன்","context_page_description":"ஆக்சிசன் அல்லது ஒட்சிசன், நாம் வாழும் நில உலகத்தில் யாவற்றினும் மிக அதிகமாகக் கிடைக்கும் தனிம வேதிப் பொருள். வேதியியலில் இதற்கான குறியீடு O ஆகும். ஓர் ஆக்சிசன் அணுவின் கருவினுள்ளே 8 நேர்மின்னிகளும் அதற்கு இணையாக கருவைச்சுற்றி 8 எதிர்மின்னிகளும் பல்வேறு சுழல் பாதைகளில் சுழன்றும் வருகின்றன. எனவே ஆக்சிசனின் அணு எண் 8. ஆகும். அணுக்கருவினுள் நேர்மின்னிகள் அன்றி 8 நொதுமிகளும் உள்ளன.\\nஇது தனிம அட்டவணையில் நெடுங்குழு 16 தனிமங்கள் குழுவின் அங்கமாகும். உயரிய வினையாற்றும் அலோக தனிமமும் ஆக்சிசனேற்றியுமான ஆக்சிசன் பெரும்பாலான தனிமங்களுடன் எளிதாக சேர்மங்களை உருவாக்குகின்றது. திணிவின் அடிப்படையில், அண்டத்தில் மிகவும் செழுமையாக உள்ள வேதித் தனிமங்களில் நீரியம், ஈலியம் அடுத்து மூன்றாவதாக உள்ளது. திட்ட வெப்ப அழுத்தத்தில், இத்தனிமத்தின் இரு அணுக்கள் பிணைந்து டையாக்சிசன் என்ற ஈரணு மூலக்கூற்று வளிமமாக விளங்குகின்றது; இந்நிலையில் இதற்கு வண்ணம், வாசனை, சுவை எதுவும் இல்லை. இந்நிலையின் வேதியியல் குறியீடு O\\n₂ ஆகும்.\\nவளி மண்டலக் காற்றில் நைட்ரசனுக்கு அடுத்து செழிப்புற்றிருப்பது ஆக்சிசன். இது பெரும்பாலும் பிற தனிமங்களோடு இணைந்த நிலையிலேயே நில உலகத்தில் கிடைக்கின்றது. இதன் செழுமை 20.95 விழுக்காடு. நீர் மண்டலப் பகுதியில் ஆக்சிசனின் செழுமை 85.89 விழுக்காடு."},{"page_url":"https://is.wikipedia.org/wiki/Grikkjaeinir","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Juniperus_excelsa_bark_Bulgaria.jpg","page_title":"Grikkjaeinir","context_page_description":"Grikkjaeinir er tegund af einiættkvísl. Hann vex í kring um Miðjarðarhaf og austur til Kákasusfjalla."},{"page_url":"https://eu.wikipedia.org/wiki/M%C3%A4rkisch_Buchholz","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/M%C3%A4rkisch_Buchholz_in_LDS.png","page_title":"Märkisch Buchholz","context_page_description":"Märkisch Buchholz Alemaniako udalerria da. Brandenburgo estatuan kokatuta dago, Dahme-Spreewald barrutian. 2014an 769 biztanle zituen 24,86 kilometro koadrotan banatuta."},{"page_url":"https://id.wikipedia.org/wiki/Ebed-Melekh","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Book_of_Jeremiah_Chapter_38-2_%28Bible_Illustrations_by_Sweet_Media%29.jpg","page_title":"Ebed-Melekh","context_page_description":"Ebed-Melekh disebutkan dalam Kitab Yeremia pasal 38 sebagai seorang abdi Etiopia di istana raja Zedekiah dari Yehuda pada masa Pengepungan Yerusalem. Namanya memiliki artinya Abdi/Budak Raja, dan bukanlah nama sebenarnya namun gelar warisan. Teks tersebut menyatakan bahwa ia adalah orang Kush dan kasim.\\nEbed-Melekh dikenal karena menyelamatkan nabi Yeremia dari perigi dimana ia bakal ditahan sampai mati. Kemudian, Yeremia mendapatkan pesan Allah yang menyatakan bahwa Ebed-Melekh \\"takkan jatuh oleh pedang\\" pada Kejatuhan Yerusalem oleh Babilonia karena ia percaya akan Allah. Menurut beberapa legenda di luar Alkitab, Ebed-Melekh tak pernah sekarat, dan sebagai gantinya ikut dalam sekelompok kecil orang suci yang memasuki Surga dalam keadaan hidup.\\nTerdapat kemiripan antara kisah Ebed-Melekh dengan kisah sida-sida dari Etiopia dari Kisah Para Rasul."},{"page_url":"https://en.wikipedia.org/wiki/RAF_Halton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/RAF_Halton-Geograph-135448-by-Jarvis-Docherty.jpg","page_title":"RAF Halton","context_page_description":"Royal Air Force Halton, or more simply RAF Halton, is one of the largest Royal Air Force stations in the United Kingdom. It is located near the village of Halton near Wendover, Buckinghamshire. The site has been in use since the First World War but is due to close by 2025.\\nThe Duchess of Cornwall is the Honorary Air Commodore of RAF Halton."},{"page_url":"https://de.wikipedia.org/wiki/Gebietsreform_Th%C3%BCringen_2018_und_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/VG_Buttst%C3%A4dt_in_S%C3%96M.png","page_title":"Gebietsreform Thüringen 2018 und 2019","context_page_description":"Die Gebietsreform in Thüringen ist ein Regierungsvorhaben der von Bodo Ramelow geführten rot-rot-grünen Landesregierung. Es sollte die Thüringer Verwaltungs-, Landkreis- und Gemeindestrukturen vergrößern, aus Sicht der Regierung, um dem demografischen Wandel entgegenzuwirken. Am 30. November 2017 teilte die Landesregierung mit, dass es eine von oben angeordnete Gemeinde- und Kreisgebietsreform nicht geben werde. Freiwillige Zusammenschlüsse auf Kreis- und Gemeindeebene sind jedoch weiterhin möglich.\\nDie Reform wurde aufgrund der durch Vergrößerungen von Gebietskörperschaften abnehmenden Bürgernähe kritisiert."},{"page_url":"https://tr.wikipedia.org/wiki/Calhoun_County,_Alabama","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ef/Calhoun_County%2C_Alabama_Courthouse.JPG","page_title":"Calhoun County, Alabama","context_page_description":"Calhoun County Amerika Birleşik Devletleri'nin Alabama eyaletinde yer alan bir county.\\nCalhoun County'nin adı John C. Calhoun'dan gelmektedir. Calhoun County'nin merkezi Anniston şehridir.\\nCalhoun County'nin nüfusu 2010 yılı itibarıyla 11,572'dir."},{"page_url":"https://gl.wikipedia.org/wiki/Maurits_Cornelis_Escher","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Denhaag_relief_houtrustweg2.jpg","page_title":"Maurits Cornelis Escher","context_page_description":"Maurits Cornelis Escher, nado en Leeuwarden o 17 de xuño de 1898 e finado en Laren o 27 de marzo de 1972, foi un artista neerlandés, coñecido polos seus gravados en madeira, en pedra e a media tinta, que trataban de representar construcións imposibles, a exploración do infinito, e as combinacións de motivos que se transforman gradualmente en formas totalmente diferentes."},{"page_url":"https://tr.wikipedia.org/wiki/Casa_Presei_Libere","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Casa_Presei_IMG_6413.JPG","page_title":"Casa Presei Libere","context_page_description":"Casa Presei Libere, Bükreş'in kuzeyinde mimar Horia Maicu tarafından inşa edilmiş 1956 tarihli Stalinist mimari tarzındaki büyük yapı.\\n91.6 m yüksekliğindeki bina, 1956 ve 2007 yılları arasında Bükreş'in en yüksek binası unvanına sahipti. 1905 yılında, at yarışlarının yapıldığı bir alan olarak kullanılan arazi üzerinde 1952-1956 arasında inşa edildi. 1989'a kadar Romanya Komünist Partisi'nin resmi yayın organı Scînteia gazetesinin merkezi olarak kullanıldı. Bina halen ülkenin yayınevlerinin merkezidir ancak güney kanadında Bükreş Menkul Kıymetler Borsası bulunur."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%87%D0%BA%D0%B5%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Batalla_Ichkeria.jpg","page_title":"Ичкеринское сражение","context_page_description":"Ичкеринское сражение — сражение в мае-июне 1842 года в Ичкеринском лесу, на возвышенности Кожалг-Дук — селения Шуани в Чечне, между русскими войсками под командованием генерала Павла Граббе и чеченскими войсками под командованием ичкерийских генералов Шуайба Центороевского и Уллубий-Муллы Ауховского."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B4%9B%E6%9D%89%E7%9F%B6%E8%AD%A6%E5%AF%9F%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Parkercenter_LAPD.jpg","page_title":"洛杉矶警察局","context_page_description":"洛杉磯警察局是美國加利福尼亞州洛杉磯的警察部門。該局有近9,900名警官和逾3,000名文職人員，轄區面積達1,230平方千米，覆蓋人口超過380萬，這也使其成為美國第三大的執法機關。洛杉磯警察局從建立之初至今，頻繁在電影和電視作品中出現。該局還因為種族仇恨以及警官腐敗問題，陷入爭論焦點。2020年，因為喬治·弗洛伊德之死，洛杉磯警察局長期存在的濫用職權，過度執法和警察暴力問題成為輿論焦點。"},{"page_url":"https://en.wikipedia.org/wiki/Eurasian_(mixed_ancestry)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Nancy_Kwan_-_1971.jpg","page_title":"Eurasian (mixed ancestry)","context_page_description":"A Eurasian is a person of mixed Asian and European ancestry."},{"page_url":"https://eu.wikipedia.org/wiki/Xiaomi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Xiaomi_M365_Scooter.jpg","page_title":"Xiaomi","context_page_description":"Xiaomi Inc. Txinako enpresa bat da, telefono adimendunak, aplikazioak eta beste produktu elektroniko batzuk diseinatzen, garatzen eta saltzen dituena. 2011ko abuztuan bere lehen telefono adimenduna kaleratu zuenetik, Xiaomik merkatu kuota irabazi du Txinan eta bere produktuak beste gailu elektroniko batzuetara zabaldu ditu.\\n2013an, enpresak Xiaomi Mi 2s Txinako mugikorrik erosiena bihurtzea lortu zuen, Samsung Galaxy S4 eta iPhone 5en aurretik. 2013 urtearen erdialdean, Xiaomi Inc. enpresak Hugo Barra brasildarra kontratatu zuen, Google enpresa estatubatuarreko presidenteordea. 2013ko urrian, Xiaomik Mi3 modeloa jarri zuen salgai, eta lehen 100.000 unitateak Internet bidez saltzeko 86 segundo behar izan zituzten."},{"page_url":"https://fr.wikipedia.org/wiki/Saibara_Seit%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Seito_Saibara.jpg","page_title":"Saibara Seitō","context_page_description":"Saibara Seitō, né le 11 octobre 1861 dans la province de Tosa au Japon et décédé à l'âge de 78 ans le 11 avril 1939 à Webster au Texas, est un agriculteur, politicien, missionnaire et colon japonais qui contribua à l'introduction de la culture du riz dans le Sud des États-Unis."},{"page_url":"https://de.wikipedia.org/wiki/Stalindenkmal_(Berlin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Fotothek_df_roe-neg_0006549_013_Sowjetische_Ehrenwache_mit_einer_PPSch-41_vor_ei.jpg","page_title":"Stalindenkmal (Berlin)","context_page_description":"Das Berliner Stalindenkmal war ein überlebensgroßes Bronzestandbild des sowjetischen Diktators Josef Stalin, ein unsigniertes Werk des sowjetischen Bildhauers Nikolai Tomski. Enthüllt wurde das Denkmal am 3. August 1951 von Walter Ulbricht, dem Generalsekretär der Sozialistischen Einheitspartei Deutschlands. Der Standort, die Stalinallee im Ost-Berliner Bezirk Friedrichshain, hatte seinen Namen bereits im Dezember 1949 erhalten. Aufgestellt gegenüber der Deutschen Sporthalle, gehörte das Monument zum Schauplatz zentraler Kundgebungen und Demonstrationen, bis es die SED-Führung in der Nacht vom 13. zum 14. November 1961 abräumen ließ. An seiner Stelle entstand eine Grünanlage. Die Stalinallee bekam am selben Tag vom Alexanderplatz bis zum Frankfurter Tor den Namen Karl-Marx-Allee. Das Material der eingeschmolzenen Skulptur diente der Herstellung von Bronzefiguren für den Tierpark Berlin."},{"page_url":"https://sk.wikipedia.org/wiki/Lud%C4%9Bk_%C4%8Cajka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Busta_Lu%C4%8Fka_%C4%8Cajky.jpg","page_title":"Luděk Čajka","context_page_description":"Luděk Čajka bol československý hokejový obranca.\\n5. januára 1990 v 32. kole ligového ročníka 1989/90 narazil 122 sekúnd, pred koncom zápasu VSŽ Košice - Zlín v súboji s košickým hráčom Antonom Bartanusom pri dochádzaní puku hlavou na mantinel a zostal ležať v bezvedomí. Protihráč Anton Bartanus na zranení neniesol žiadnu vinu. Podľa názoru Dušana Skačániho, hlavného rozhodcu zápasu, Čajka pravdepodobne narazil do ryhy v ľade a následkom bol nekoordinovaný pád. Jeho dôsledkom boli fraktúry prvého a druhého krčného stavca s vážnym poškodením miechy. Po 40 dňoch v košickej nemocnici svojmu zraneniu podľahol.\\nBol ženatý, s manželkou Renatou mali dcéru Markétu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B0%D0%BD%D1%8C%D0%B8_(%D0%9F%D0%B0-%D0%B4%D0%B5-%D0%9A%D0%B0%D0%BB%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Oignies_-_Fosse_n%C2%B0_9_-_9_bis_des_mines_de_Dourges_%28117%29.JPG","page_title":"Уаньи (Па-де-Кале)","context_page_description":"Уаньи́ — коммуна во Франции, регион О-де-Франс, департамент Па-де-Кале, округ Ланс, кантон Энен-Бомон-1. Город расположен в 14 км к северо-востоку от Ланса и в 21 км к югу от Лилля, в 2 км от автомагистрали А1 \\"Нор\\", на берегу канала Дёль.\\nНаселение — 9 669 человек."},{"page_url":"https://nl.wikipedia.org/wiki/Verberie","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Map_commune_FR_insee_code_60667.png","page_title":"Verberie","context_page_description":"Verberie is een gemeente in het Franse departement Oise en telt 3283 inwoners. De plaats maakt deel uit van het arrondissement Senlis."},{"page_url":"https://pl.wikipedia.org/wiki/Starszy_chor%C4%85%C5%BCy_sztabowy_marynarki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Czapka_starszychor%C4%85%C5%BCysztabowymarynarki_m.PNG","page_title":"Starszy chorąży sztabowy marynarki","context_page_description":"Starszy chorąży sztabowy marynarki – wojskowy stopień podoficerski w polskiej Marynarce Wojennej, odpowiadający starszemu chorążemu sztabowemu w Wojskach Lądowych i Siłach Powietrznych. Jego odpowiedniki znajdują się także w marynarkach wojennych innych państw."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%BC%E3%82%B6%E3%83%BC%E3%83%AD%E3%83%BC%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Iserlohn-Aloysiuskirche3-Asio.JPG","page_title":"イーザーローン","context_page_description":"イーザーローン は、ドイツ連邦共和国ノルトライン＝ヴェストファーレン州アルンスベルク行政管区のメルキッシャー郡に属す都市である。人口約92,000人のこの街は、同郡およびザウアーラント最大の都市である。ライン＝ルール大都市圏に属し、中級中心都市に格づけられている。イザーローン、イゼルローンなどとも表記される。\\nこの街の名前は、中低ドイツ語の îsen-lô、すなわち「鉄の森」に由来する。市域内で最初の定住跡は1000年以上前のもので、都市の建設は770年にまで遡る。18世紀から19世にかけてイーザーローンは金属工業によって経済的繁栄を謳歌し、数十年間にわたってミュンスターに次いでヴェストファーレンで2番目に大きな都市であった。現在は金属工業の他に、特に化学工業、製薬業やサービス業が盛んである。\\nイーザーローンは、アイスホッケークラブ「イーザーローン・ルースターズ」、鍾乳洞、民営ブルワリー・イーザーローンのビールで知られている。この街は大学の所在地であり、学生によって組織された国際経済カンファレンス「キャンパス・シンポジウム」のホスト都市である。市内に広大な森があることからイーザーローンは「ヴァルトシュタット」のニックネームを有している。"},{"page_url":"https://en.wikipedia.org/wiki/Maurice_Gibb","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Maurice_Gibb_1968.jpg","page_title":"Maurice Gibb","context_page_description":"Maurice Ernest Gibb CBE was a British musician, singer, songwriter and record producer who achieved fame as a member of the Bee Gees. Although his elder brother Barry Gibb and fraternal twin brother Robin Gibb were the group's main lead singers, most of their albums included at least one or two songs featuring Maurice's lead vocals, including \\"Lay It on Me\\", \\"Country Woman\\" and \\"On Time\\". The Bee Gees were one of the most successful rock-pop groups of all time.\\nBorn on the Isle of Man, Gibb started his music career in 1955 in Manchester, England, joining the skiffle-rock and roll group the Rattlesnakes, which later evolved into the Bee Gees in 1958 when they moved to Australia. They returned to England, where they achieved worldwide fame. In 2002, the Bee Gees were appointed as CBEs for their \\"contribution to music\\". Following Gibb's death in 2003, his son collected his award at Buckingham Palace in 2004.\\nGibb's earliest musical influences included the Everly Brothers, Cliff Richard, and Paul Anka; the Mills Brothers and the Beatles were significant later influences."},{"page_url":"https://ca.wikipedia.org/wiki/Toni_(pel%C2%B7l%C3%ADcula)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Pin%C3%A8de_mart%C3%A9gale.JPG","page_title":"Toni (pel·lícula)","context_page_description":"Toni és una pel·lícula dramàtica dirigida per Jean Renoir l'any 1935, amb els personatges principals interpretats per Charles Blavette, Celia Montalván, Jenny Hélia i Eduard Delmont.\\nPodem situar aquest film a l'època del Front Popular, època en la qual també va realitzar Una partida de camp uns anys més tard. Tot i dividir el seu cinema en períodes, el realisme poètic francès sempre és present a les obres de Renoir. Tot i no tractar-se d'una de les pel·lícules més famoses de Renoir, va rebre bones crítques, ja que juntament amb La regla del joc, Renoir va potenciar la relació amb el cine i ell mateix. Utilitza els avatars socials per posar en evidència les veritats morals, el realisme per a ell és experimentar i provar la permanència dels problemes dels homes."},{"page_url":"https://es.wikipedia.org/wiki/Bah%C3%ADa_de_los_Nodales","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Playa_punta_medanosa.jpg","page_title":"Bahía de los Nodales","context_page_description":"La bahía de los Nodales es un cuerpo de agua ubicado en la costa centro-norte de la Provincia de Santa Cruz. Se halla aproximadamente a 30 km en línea recta al sur de la ciudad de Puerto Deseado, inmediatamente al sur de la bahía del Oso Marino. Se encuentra aproximadamente en la posición geográfica 48°01′00″S 65°53′50″O\\nSe trata de una amplia bahía cuyo límite norte se encuentra en Punta Pozos, y el límite sur es Punta Medanosa. Se caracteriza por la presencia de afloramientos porfíricos de la formación Bahía Laura en varios puntos de su extensión costera. Estos se alternan con mantos medanosos, en especial en la parte norte y sur. En la parte sur, antes de que comience la punta Medanosa existe una marisma llamada Ensenada Ferrer.\\nLa costa de la bahía está formada por numerosos escalones constituidos por sucesivos cordones de playa de cantos rodados con mezclas de cascajos de conchilla. Por detrás de los planos superiores se encuentran restos de antiguas terrazas marinas más antiguas, de origen pleistocénico.​​"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%BF%CF%8D%CF%83%CE%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Rusenska-opera.jpg","page_title":"Ρούσε","context_page_description":"Η Ρούσε είναι η πέμπτη μεγαλύτερη πόλη της Βουλγαρίας. Βρίσκεται στο βορειοανατολικό τμήμα της χώρας, στή δεξιά όχθη του Δούναβη, απέναντι από τη Ρουμανική πόλη Τζιούρτζιου, 300 χλμ. από την πρωτεύουσα Σόφια και 200 χλμ. από τη Βουλγαρική Ακτή της Μαύρης Θάλασσας Είναι το σημαντικότερο ποτάμιο λιμάνι της Βουλγαρίας, λειτουργώντας ως σημαντικός παράγων του διεθνούς εμπορίου της χώρας. Είναι γνωστό για τη Νεομπαρόκ και Νεοροκοκό αρχιτεκτονική του, του 19ου και 20ού αιώνα, που προσελκύει πολλούς τουρίστες. Συχνά ονομάζεται Μικρή Βιέννη. Η Γέφυρα Φιλίας Ρούσε - Τζιούρτζιου, μέχρι τις 14 Ιουνίου 2013 η μόνη στο τμήμα του Δούναβη που μοιράζονται η Βουλγαρία και η Ρουμανία, διασχίζει εδώ τον ποταμό.\\nΤο Ρούσε είναι αδελφοποιημένο με το Περιστέρι."},{"page_url":"https://de.wikipedia.org/wiki/Hans_Kruzwicki","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Hans_Kruzwicki_%22Komposition%22_%C3%96lgem%C3%A4lde_Ende_1960er.jpg","page_title":"Hans Kruzwicki","context_page_description":"Johannes Kruzwicki war ein deutscher Maler der klassischen Moderne. Er gehörte zu den progressiven, dem Rheinischen Expressionismus zugeneigten Malern. In der Nachkriegszeit, insbesondere ab den sechziger Jahren, tendierten seine Werke zunehmend zur Abstraktion, und zum Ende seiner Schaffenszeit finden sich expressiv-abstrakte religiöse Motive in seinem Œuvre."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D1%81%D1%82%D0%B8_(%D0%B4%D0%B0%D0%B9%D0%B2%D1%96%D0%BD%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/SwimFins_02.jpg","page_title":"Ласти (дайвінг)","context_page_description":"Ласти — пристосування для плавання у формі плавника чи весла. Надягають на ноги.\\nУ підводному плаванні використовується два варіанти:\\nЗвичайні ласти, по одному на кожну ногу\\nМоноласта — це два ласта, «зрощенні» в один. Зазвичай Моноласта має більшу площу, ніж дві звичайних ласти. Унаслідок того, що обидві ноги кріпляться разом, стиль плавання в моноласті нагадує дельфіна чи рибу: просування вперед здійснюється за рахунок хвилеподібних рухів всього тіла."},{"page_url":"https://nl.wikipedia.org/wiki/Newton_(metrostation)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Mrt_lrt_rail_map_2.png","page_title":"Newton (metrostation)","context_page_description":"Newton is een metrostation van de metro van Singapore aan de North South Line en de Downtown Line. Het station ligt in de wijk Newton in het Centraal Gebied van Singapore. Vlak bij het metrostation is het Newton Food Centre een hawker centre of voedselmarkt met kraampjes met gekookt voedsel. De stations op de twee metrolijnen zijn, hoewel aangrenzend, toch volledig van elkaar gescheiden. Reizigers die wensen over te stappen dienen het ene station uit te gaan en het andere terug in te gaan, en als ze dit binnen de 15 minuten doen wordt het als een transfer gerekend."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B3%D0%B4%D0%B5%D0%B1%D1%83%D1%80%D0%B7%D1%8C%D0%BA%D0%B0_%D0%B4%D1%96%D0%BE%D1%86%D0%B5%D0%B7%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Otto_the_Great%2C_Letter%2C_968.jpg","page_title":"Магдебурзька діоцезія","context_page_description":"Магдебурзька діоцезія — діоцезія Римо-католицької церкви у складі митрополії Падерборна в Німеччині. Наступниця історичного Магдебурзького архієпископства. Очолюється єпископами Магдебурзькими. Катедра розташована в місті Магдебург в соборі Святого Себастьяна. До юрисдикції входять 186 парафій у землях Бранденбург, Саксонія та Саксонія-Ангальт. Всі парафії об'єднано в 10 деканатів. Клір — 256 священиків, 31 диякон, 39 ченців, 228 черниць. Голова — єпископ Герхард Файге. Почесний єпископ — Леопольд Новак."},{"page_url":"https://en.wikipedia.org/wiki/George_Dickel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/George-Dickel-cascade-ad-argus-1915.jpg","page_title":"George Dickel","context_page_description":"George Dickel is a brand of Tennessee whiskey owned by Diageo PLC produced in Cascade Hollow, Tennessee. The brand was introduced in 1964. Its distillery is part of the American Whiskey Trail and offers tours to the public. A George Dickel rye whiskey is also sold.\\nThe brand's labels use the traditional Scottish spelling of whisky, as opposed to whiskey, although the latter spelling is more common in American English. According to the company, this is because Dickel believed his product to be as smooth and high in quality as the best Scotch whiskies."},{"page_url":"https://en.wikipedia.org/wiki/MVG_Class_C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/C2_611_Neuperlach_S%C3%BCd_U5.jpg","page_title":"MVG Class C","context_page_description":"The MVG Class C is an electric multiple unit train type operated by the Münchner Verkehrsgesellschaft on the Munich U-Bahn system since 2002. It is the first type of rolling stock on the Munich U-Bahn that consists of more than two cars and features gangways between the individual cars."},{"page_url":"https://no.wikipedia.org/wiki/Italias_historie_under_monarkiet_og_f%C3%B8rste_verdenskrig","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Flag_of_Italy_%281861%E2%80%931946%29.svg","page_title":"Italias historie under monarkiet og første verdenskrig","context_page_description":"Italias historie under monarkiet og første verdenskrig er den perioden hvor Kongedømmet Italia er et konstitusjonelt monarki, og perioden strekker seg fra Italias samling og fram til den fascistiske maktovertakelsen i 1922 som innleder den fascistiske perioden hvor landet fortsatt formelt er et monarki, men ikke lenger et konstitusjonelt monarki."},{"page_url":"https://en.wikipedia.org/wiki/James_Irwin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Col._James_Benson_Irwin_%2818974687520%29.jpg","page_title":"James Irwin","context_page_description":"Col. James Benson Irwin, USAF was an American astronaut, aeronautical engineer, test pilot, and a United States Air Force pilot. He served as Apollo Lunar Module pilot for Apollo 15, the fourth human lunar landing. He was the eighth person to walk on the Moon and the first, and youngest, of those astronauts to die."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A5%9E%E9%BB%84%E8%B1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Cassia_nodosa_3_hatem_moushir.JPG","page_title":"神黄豆","context_page_description":"神黃豆又名節果決明，為豆科阿勒勃屬的植物，是粉花決明的亞種。分布在中南半島、中國大陸的廣州、廣西、雲南以及夏威夷群島等地，生長於海拔600米至1,800米的地區，多生在山地林中，目前尚未由人工引種栽培。"},{"page_url":"https://nl.wikipedia.org/wiki/Ch%C3%A2teau_de_Surmont","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Overgebleven_ru%C3%AFne_Ch%C3%A2teau_de_Surmont_te_Kortrijk_omgeven_door_bomen_%28aug_2018%29.jpg","page_title":"Château de Surmont","context_page_description":"Het kasteel van Surmont werd in zijn glorietijd château de Surmont genoemd en ligt in West-Vlaanderen in de gemeente Kortrijk. Ten zuidoosten van de Kapel ter Bede liggen, omgeven door autosnelwegen en kantoorgebouwen, de ruïne van het kasteel Surmont en van de hofstede Goed ter Bede'. Wat generaties lang het buitengoed was van vooraanstaande en adellijke families is in een korte periode van slechts een halve eeuw lang gedegradeerd tot een troosteloze ruïne. De plunderingen tijdens en het verlaten van het kasteel na de Tweede Wereldoorlog, de aanleg van de E17 dwars door het domein in 1966-1967 en de leegstand van de hofstede sinds 2001 hebben elk hun deel bijgedragen tot het trieste einde van een interessante en eeuwenoude geschiedenis van een stukje Kortrijk."},{"page_url":"https://hu.wikipedia.org/wiki/Agave_parrasana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/MCBG_Agave_parrasana.jpg","page_title":"Agave parrasana","context_page_description":"Az Agave parrasana az egyszikűek osztályának spárgavirágúak rendjébe, ezen belül a spárgafélék családjába tartozó faj."},{"page_url":"https://fr.wikipedia.org/wiki/The_Beverly_Hilton","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Beverly_Hilton_hotel_ballroom_%284505374337%29.jpg","page_title":"The Beverly Hilton","context_page_description":"The Beverly Hilton est un hôtel situé à Beverly Hills en banlieue de Los Angeles, aux États-Unis. Cet hôtel a accueilli certaines cérémonies et conventions tels que les Golden Globes et les Daytime Emmy Awards.\\nC'est Conrad Hilton qui ouvre le Beverly Hilton en 1955. L’hôtel est conçu par l'architecte Welton Becket."},{"page_url":"https://de.wikipedia.org/wiki/Nordviertel_(Aachen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/AachenTrafostationBluecherplatzStreetart_s5953.jpg","page_title":"Nordviertel (Aachen)","context_page_description":"Das Nordviertel ist ein Stadtgebiet von Aachen, das wegen seiner besonderen problematischen Sozialstruktur und seiner historischen Industrieansiedlung sowie den gewachsenen Arbeitervierteln in das Förderprogramm Soziale Stadt für die Dekade 2010 bis 2019 aufgenommen wurde. In diesem Viertel wohnen circa 15.500 Einwohner und es umfasst eine Fläche von rund 300 Hektar. Es liegt geografisch zwischen dem Grünen Weg im Nordwesten, dem Prager Ring im Nordosten an der Grenze zum Stadtteil Haaren, der Autobahn und dem Ostviertel im Südosten, dem Adalbertsteinweg mit dem angrenzenden Frankenberger Viertel im Süden sowie dem Alleenring und der Passstraße im Westen. Das Viertel ist ein heterogener Stadtteil und das Ergebnis von Stadterweiterungen ab Mitte des 19. Jahrhunderts. Er gliedert sich in drei Teilgebiete: in das Industriegebiet mit der zentralen Achse Jülicher Straße, in das Wohngebiet bestehend aus dem Rehm- und Ungarnviertel sowie den Quartieren Feldstraße, Liebigstraße und Wiesental, und ferner in die Wurmauen rund um Gut Kalkofen."},{"page_url":"https://en.wikipedia.org/wiki/Sail_twist","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Asso6.jpg","page_title":"Sail twist","context_page_description":"Sail twist is a phenomenon in sailing where the head of the sail is at a different angle of incidence from the foot of the sail in order to change the lift distribution with height. Twist is measured by comparing the angle of a straight line between the leading edge and trailing edge with that of the boom. Some twist is desirable, but too much can induce weather helm or ruin the slot between the mainsail and jib.\\nThree sail shape controls which control the leech tension, and therefore sail twist, are the mainsheet, the boom vang and the traveler. The mainsheet pulls the boom primarily inwards at lower points of sail and downwards at higher points of sail. Manipulation of the traveler can counteract this because it always pulls the boom laterally. The vang on the other hand does the opposite, it always changes the height of the boom.\\nComputer cut sails can produce the amount of twist specified by the sailmaker, and in different conditions, different amounts of twist may be desirable. Less twist is generally desirable in light air conditions and slackening the luff tension will tighten the leech of the sail."},{"page_url":"https://fr.wikipedia.org/wiki/Live_by_Night","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Live_by_Night_set_1.jpg","page_title":"Live by Night","context_page_description":"Live by Night ou Ils vivent la nuit au Québec est un film américain écrit et réalisé par Ben Affleck, sorti en 2017. Ce long métrage a été un cuisant échec commercial."},{"page_url":"https://sh.wikipedia.org/wiki/Brskovo_(Mojkovac)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Brskovo_pozicija_tvrdjave_1.svg","page_title":"Brskovo (Mojkovac)","context_page_description":"Brskovo je naselje u opštini Mojkovac u Crnoj Gori. Prema popisu iz 2003. bilo je 276 stanovnika."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_prot%C3%A9g%C3%A9s_en_1840","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Palais_Galien-panoramique.jpg","page_title":"Liste des monuments historiques protégés en 1840","context_page_description":"Cet article recense les monuments historiques de France classés en 1840, la première protection de ce type dans le pays."},{"page_url":"https://es.wikipedia.org/wiki/Duane_James","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Duane_James.jpg","page_title":"Duane James","context_page_description":"Duane Anthony James es jugador de baloncesto profesional nacido en el barrio del Bronx el 30 de enero de 1983. Juega de Alero y ha desarrollado su carrera en España mayoritariamente pasando por Guadalajara, Oviedo, Canoe, Quintanar o Cáceres, equipo con el que ha estado a punto de ascender a LEB Oro.​ Actualmente juega en el Fundación CB Granada en la Liga Española de Baloncesto Plata y en la liga ACB de Nicaragua con el equipo Los Trini's"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%9B%D7%A4%D7%9C%D7%AA_%D7%94%D7%99%D7%AA%D7%95%D7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/AmalgamationProduct.png","page_title":"מכפלת היתוך","context_page_description":"בתורת החבורות, מכפלת היתוך היא מושג קרוב למכפלה חופשית של חבורות, בה משתתפות שלוש חבורות ושתי העתקות. היא מהווה פתרון לבעיה אוניברסלית כפי שיתואר בהמשך. למכפלת היתוך תפקיד מרכזי בטופולוגיה אלגברית במשפט ואן קמפן."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D8%B2%D8%A7%D8%A8%DB%8C%D9%84%D8%A7_%D8%A7%D9%88%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Isabel_la_Cat%C3%B3lica_01b.jpg","page_title":"ازابیلا اول","context_page_description":"تاج قشتالہ کی ملکہ 1469ء میں تاج اراغون کے بادشاہ فردلند سے شادی کی اور اس کی شریک سلطنت بنی۔ 1492ء میں غرناتا پر قبضہ کیا اور مسلمانوں کے ساتھ یہودیوں کو بھی سپین سے نکال باہر کیا۔ کولمبس اسی کے زیر سرپرستی 1492ء میں نئی دنیا کی کھوج میں نکلا تھا۔"},{"page_url":"https://ro.wikipedia.org/wiki/St%C3%A2lpu,_Buz%C4%83u","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Stalpu_jud_Buzau.png","page_title":"Stâlpu, Buzău","context_page_description":"Stâlpu este o comună în județul Buzău, Muntenia, România, formată numai din satul de reședință cu același nume."},{"page_url":"https://vi.wikipedia.org/wiki/Karl_Landsteiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/LandsteinerWS.jpg","page_title":"Karl Landsteiner","context_page_description":"Karl Landsteiner ForMemRS là một thầy thuốc, nhà sinh học người Áo. Ông nổi tiếng từ năm 1900 do phát hiện hệ thống máu mới ở người: Hệ thống nhóm máu ABO, giải thích cơ chế ngưng kết tố trong máu. Năm 1930 ông đã nhận giải Nobel trong lĩnh vực Sinh Lý và Y học. Năm 1937, cùng với Alexander S. Wiener ông đã tìm ra yếu tố Rh xác định một hệ thống nhóm máu khác. Ông nhận giải thưởng Lasker năm 1946."},{"page_url":"https://az.wikipedia.org/wiki/Yuxar%C4%B1_Provans_Alplar%C4%B1_departamentinin_kommunalar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Le_Castellard-M%C3%A9lan.JPG","page_title":"Yuxarı Provans Alpları departamentinin kommunaları","context_page_description":"Yuxarı Provans Alpları — Fransanın Provans-Alp-Kot-d'Azur regionun departamentlərindən biri. İnzibati mərkəzi — Din-le-Ben. 2012-ci il siyahıyaalınmasına görə departamentin 161 241 nəfər əhalisi var idi. 2015-ci ilə qədər Yuxarı Provans Alp dağlarının ərazisi 4 dairəyə bölündü, 15 kanton və 200 kommuna. 2012-ci ilin siyahıyaalınmasına görə, departamentdə 10,000 nəfərdən çox əhalisi olan yalnız 2 şəhər var — Manosk və Din-le-Ben. 1982-ci ildə Mutye-Sent-Mari, Fransanın ən gözəl kəndinin işarəsi ilə qeyd olundu. Siyahıda əlifba sırası ilə departamentin kommunaları göstərilmişdir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%83%D0%BD%D1%82%D0%B0-%D0%A1%D0%B0%D0%BD-%D0%92%D0%B8%D0%B4%D0%B6%D0%B8%D0%BB%D0%B8%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Garda_-_S_Vigilio_-_Chiesa.jpg","page_title":"Пунта-Сан-Виджилио","context_page_description":"Пунта-Сан-Виджилио — местечко в коммуне Гарда, носящей название тамошнего озера.\\nСобственность графа Гваренти из Брендзоне, имеет форму полуострова, прикрывающего северо-западный залив озера. Там имеются вилла, маленький храм, историческая гостиница, пристань для яхт, бухта Сирены.\\nСан-Виджилио, носящий имя св. Вигилия, издавна был местом посещения знаменитых особ: здесь бывали Мария-Луиза Австрийская, графиня Пармы, король Неаполя, российский император Александр I, Уинстон Черчилль, Отто Ган с супругой, художница Edith Junghans, Лоренс Оливье, Вивьен Ли Чарльз, принц Уэльский."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_c%C3%ADrkevn%C3%ADch_pam%C3%A1tek_v_Kraji_Vyso%C4%8Dina","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Jaromerice_nR_bonov_kaple.jpg","page_title":"Seznam církevních památek v Kraji Vysočina","context_page_description":"Seznam církevních památek v Kraji Vysočina, roztříděných podle typu stavby:"},{"page_url":"https://fr.wikipedia.org/wiki/Liqueur","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Liqueurs_fran%C3%A7aises.JPG","page_title":"Liqueur","context_page_description":"Une liqueur est une boisson spiritueuse contenant au moins 100g de sucre par litre résultant de l'aromatisation d'une base alcoolique à l'aide de fruits, de plantes ou de produits laitiers par différents procédés dont la macération ou l'infusion. L'alcool agit comme un solvant et capte le goût, la couleur et le parfum des produits agricoles.\\nAu Canada francophone, une liqueur désigne une boisson gazeuse non alcoolisée."},{"page_url":"https://cs.wikipedia.org/wiki/Hlavn%C3%AD_po%C5%A1ta_(U%C5%BEhorod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/U%C5%BEhorod%2C_budova_po%C5%A1ty.jpg","page_title":"Hlavní pošta (Užhorod)","context_page_description":"Hlavní pošta sídlí na adrese Poštova 4, na rozhraní historického centra města a čtvrti Malé Galago. Funkcionalistická budova v centru města vznikla během existence První československé republiky v roce 1930 a jejím architektem je Josef Gočár."},{"page_url":"https://vi.wikipedia.org/wiki/B%E1%BB%8D_ng%E1%BB%B1a_ch%C3%A2u_%C3%82u","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Mantid_August_2007-2.jpg","page_title":"Bọ ngựa châu Âu","context_page_description":"Bọ ngựa châu Âu ở châu Âu và nơi khác gọi loài này bằng tên Bọ ngựa cầu nguyện, là một trong những loài bọ ngựa được biết nhiều nhất và rộng rãi nhất trong bộ Bộ Bọ ngựa."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%83%D1%81%D0%BD%D1%96%D0%BD%D0%BA%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Musninkai_center.jpg","page_title":"Муснінкай","context_page_description":"Муснінкай — місто в південно-східній частині Литви, входить до складу Ширвінтського району Вільнюського повіту.\\nЦе невелике містечко. У Муснікаї розташовані Троїцька церква разом з каплицею і дзвіницею, побудовані в 1861 році; середня школа; музей, дитячий садок, будинок культури, бібліотека, німецьке військове кладовище, поштове відділення."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%D9%83_%D9%87%D9%88%D9%81%D9%84%D8%A7%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Mads_Eriksen_at_Rootsfestivalen_in_Br%C3%B8nn%C3%B8ysund.jpg","page_title":"فرانك هوفلاند","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nفرانك هوفلاند ملحن مزيكا من النرويج."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Westerlo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Dorpsvilla%27s%2C_Zoerledorp_11_en_13_in_Zoerle-Parwijs.jpg","page_title":"Lijst van onroerend erfgoed in Westerlo","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Westerlo. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://nl.wikipedia.org/wiki/Seabourn_Legend","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Seabourn_Legend_in_St._Tropez.jpg","page_title":"Seabourn Legend","context_page_description":"De Seabourn Legend is een cruiseschip welke eigendom was van Seabourn Cruise Line Ltd. en vanaf april 2015 van Windstar.\\nDe Seabourn Legend had destijds drie identieke zuster-schepen: de Seabourn Spirit en de Seabourn Pride van Seabourn Cruises en de Prinsendam, voorheen: Seabourn Sun, van de Holland-Amerika Lijn."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_and_structures_in_London","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Walkie-Talkie_-_Sept_2015.jpg","page_title":"List of tallest buildings and structures in London","context_page_description":"St Paul's Cathedral, built in 1710, was the tallest building in London at 111 metres until it was overtaken in 1963 by the Millbank Tower at 118 metres, which in turn was overtaken by the BT Tower which topped out at 177 metres tall in 1964. In the 1960s and 1970s several high-rise buildings were built, located sporadically, mostly in the western side of Central London with some in the City of London. The first true \\"skyscrapers\\" to be built in London were the NatWest Tower which was completed in 1980 in the City of London at 183 metres tall and One Canada Square which was completed in 1991 at 235 metres and formed the centrepiece of the Canary Wharf development. The 2000s saw a boom in skyscraper building, mostly in the City of London and Canary Wharf. However, since 2010, the tallest building in London has been The Shard at London Bridge, which was topped out at 309.6 metres in 2012. There are more tall buildings planned for the City and Canary Wharf, but there are also clusters emerging in other districts of London including: Stratford, the South Bank, Elephant and Castle, Vauxhall, Nine Elms, Islington as well as in places in Outer London such as Croydon."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BB%D0%B0%D1%83%D1%80%D0%B5%D0%B0%D1%82%D0%BE%D0%B2_%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D0%B8_%D0%BF%D0%BE_%D1%8D%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D0%B8%D0%BA%D0%B5_%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%B8_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4%D0%B0_%D0%9D%D0%BE%D0%B1%D0%B5%D0%BB%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Robert_C._Merton.jpg","page_title":"Список лауреатов премии по экономике памяти Альфреда Нобеля","context_page_description":"Премия Шведского государственного банка по экономическим наукам памяти Альфреда Нобеля, также известная как Нобелевская премия по экономике, — самая престижная премия в области экономических наук, основанная банком Швеции в 1968 году по случаю своего 300-летия. Премия впервые была присуждена в 1969 году.\\nЕжегодно в октябре Шведская королевская академия наук объявляет имя лауреата премии, предварительно выбрав его из кандидатур, представленных Комитетом присуждения премии по экономике памяти Альфреда Нобеля. Награждение лауреата премии происходит вместе с лауреатами в других отраслях в годовщину смерти Альфреда Нобеля 10 декабря. Каждому лауреату вручается медаль, диплом и денежное вознаграждение.\\nПервыми лауреатами Нобелевской премии по экономике стали Рагнар Фриш из Норвегии и Ян Тинберген из Нидерландов.\\nВсего с 1969 по 2019 год премия присуждалась 51 раз, а её лауреатами становились 84 ученых. Расхождение между количеством премий и её лауреатами обусловлена тем, что одна премия может присуждаться сразу нескольким лицам. Так из 51 премий 27 раз её получал один учёный, 18 раз — двое, 7 раз — сразу трое исследователей. В 2003 году было 2 лауреата."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Sierra","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ford_Sierra_2.8i_V6_engine_%28XR4i%29.jpg","page_title":"Ford Sierra","context_page_description":"The Ford Sierra is a mid-size car or large family car that was built by Ford Europe from 1982 to 1993. It was designed by Uwe Bahnsen, Robert Lutz and Patrick le Quément. The code used during development was \\"Project Toni\\". Its name came from the Spanish word for mountain range.\\nThe Ford Sierra was first unveiled on 22 September 1982 at the British International Motor Show hosted at the NEC in Birmingham. with sales beginning on 15 October 1982, replacing the Ford Cortina. Its aerodynamic styling was ahead of its time and as such, many conservative buyers did not take fondly to the Cortina's replacement.\\nIt was mainly manufactured in Germany, Belgium, and the United Kingdom, although Sierras were also assembled in Ireland, Argentina, Venezuela, South Africa and New Zealand."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B4%E3%83%A8%E3%82%B1%E3%83%95%E3%82%A1%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Goyocephalebcn1.JPG","page_title":"ゴヨケファレ","context_page_description":"ゴヨケファレは白亜紀後期に現在のモンゴルに生息した堅頭竜類恐竜の属の一つである。\\n体重は10-40 kgと推定される。タイプ種Goyocephale lattimorei は1982年にアルタンゲレル・ペルレ、テレサ・マリアンスカ、およびハルツカ・オスモルスカにより不完全な頭骨、下顎骨および断片的な頭部以外の部分の化石に基づいて命名、記載された。頭骨はホマロケファレ・カラトケロスやプレノケファレ・プレネスのホロタイプとほぼ同じ大きさであり、ホマロケファレとは多くの点で特徴を共有している。しかし、各部の比率がゴヨケファレとホマロケファレとでは異なっている。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%95%B5%E6%93%8A%E5%8A%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Glamdring.jpg","page_title":"敵擊劍","context_page_description":"在托爾金奇幻小說的中土大陸裡，敵擊劍格蘭瑞是精靈王特剛在第一紀元鑄造的一口劍。在之後的數千年，敵擊劍一直不知所終，直至《哈比人歷險記》時期，甘道夫在食人妖的巢穴發現了敵擊劍。甘道夫將敵擊劍收為己用。在《魔戒》裡，甘道夫也一直使用此劍，他在對抗炎魔的時候、亦是使用此劍。\\n敵擊劍又名「破敵之物」，半獸人稱敵擊劍為「打劍」。敵擊劍有「粉碎敵人」之意，格蘭瑞之名則來自精靈語，為「喧囂的軍隊」之意。\\n敵擊劍及獸咬劍都被形容為擁有美麗的劍鞘和鑲嵌著寶石的劍柄。愛隆曾說貢多林的國王曾持有敵擊劍。\\n第三紀元末，甘道夫似乎攜同敵擊劍離開了中土大陸，前往海外仙境。\\n敵擊劍上刻有精靈語的咒文，是以辛達林語所寫的，但是，托爾金在後期的著作裡卻清楚說明特剛在貢多林重振昆雅語。奇怪的是，從《哈比人歷險記》裡可得知甘道夫是不懂這些咒語，而愛隆則懂得，推測這些咒語可能是以一些甘道夫不知道的特殊字體刻下，又或這是一處矛盾，這符合《哈比人歷險記》並非刻意依據《精靈寶鑽》而寫的。精靈的語言在特剛的時代發生轉變，而愛隆是經歷過第一紀元的人物，故他懂得這些咒文，而甘道夫則是在第三紀元中才離開阿門洲前往中土大陸，所以甘道夫不懂這些咒文。\\n與其他精靈的劍一樣，當半獸人靠近時，敵擊劍會發出白色或藍色的光芒，佛羅多的刺針及索林·橡木盾的獸咬劍都有這個特性。"},{"page_url":"https://it.wikipedia.org/wiki/Rozen_Maiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Rozen_Maiden_logo.png","page_title":"Rozen Maiden","context_page_description":"Rozen Maiden è un manga scritto e illustrato nel 2002 dalla coppia di autrici PEACH-PIT, trasposto in seguito in forma di anime da Nomad. Narrando la storia di Jun Sakurada, un ragazzo crollato sotto il peso dello stress, la serie tratta il problema della pressione psicologica che grava su molti ragazzi giapponesi. La serie narra del graduale recupero mentale di Jun attraverso l'esperienza con le Rozen Maiden, bambole incantate col misterioso obiettivo di vincere il Gioco di Alice."},{"page_url":"https://ceb.wikipedia.org/wiki/Pseudosermyle_phalangiphora","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Pseudosermyle_phalangiphora.jpg","page_title":"Pseudosermyle phalangiphora","context_page_description":"Espesye sa insekto nga una nga gihulagway ni Rehn, J.A.G ang Pseudosermyle phalangiphora. ni adtong 1907. Ang Pseudosermyle phalangiphora sakop sa kahenera nga Pseudosermyle sa kabanay nga Diapheromeridae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%82%B5%E3%82%B4%E7%9B%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Oxylebius_pictus_2.jpg","page_title":"カサゴ目","context_page_description":"カサゴ目は、硬骨魚類の分類群の一つ。7亜目26科279属で構成され、カサゴ・メバル・オニオコゼ・ホウボウ・コチ・アイナメなど底生性の海水魚を中心に、およそ1,477種が含まれる。眼下骨棚と呼ばれる骨格上の特徴を唯一の根拠としてまとめられた一群であり、所属する魚類の形態ならびに生態は多様性に富んでいる。カジカ目とも呼ばれる。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BA%D0%B2%D0%B0%D1%80%D1%96%D1%83%D0%BC%D0%BD%D1%96_%D1%80%D0%B8%D0%B1%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Phenacogrammus_interruptus_%28aka%29.jpg","page_title":"Акваріумні риби","context_page_description":"Акваріумні риби — збірна назва таксономічно різнорідних риб, яких утримують у акваріумах з декоративною метою."},{"page_url":"https://de.wikipedia.org/wiki/Iwan_Petrowitsch_Martos","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Moscow_05-2017_img07_Monument_to_Minin_and_Pozharsky.jpg","page_title":"Iwan Petrowitsch Martos","context_page_description":"Iwan Petrowitsch Martos war russischer Bildhauer."},{"page_url":"https://de.wikipedia.org/wiki/Alsenztalbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bahn%C3%BCbergang_beim_Bahnhof_Alsenz_2014.jpg","page_title":"Alsenztalbahn","context_page_description":"Die Alsenztalbahn – auch Alsenzbahn genannt – ist eine Hauptbahn in Rheinland-Pfalz. Sie verläuft von Hochspeyer über Winnweiler und Alsenz nach Bad Münster am Stein. Die Strecke folgt ab Enkenbach bis Bad Münster dem Fluss Alsenz, den sie mehrmals überquert. Sie wurde in erster Linie in Konkurrenz zur rechtsrheinischen Verbindung über Frankfurt als kürzeste Transit- und Fernverkehrsstrecke von den Nordseehäfen in Belgien und den Niederlanden und den Kohlerevieren am Niederrhein nach Süddeutschland, der Schweiz und Italien gebaut. Diese Funktion hatte sie allerdings schon seit dem Ende des Ersten Weltkriegs durch den Heimfall des Elsass an Frankreich eingebüßt."},{"page_url":"https://en.wikipedia.org/wiki/Neacoryphus_bicrucis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Neacoryphus_bicrucis_P1200442a.jpg","page_title":"Neacoryphus bicrucis","context_page_description":"Neacoryphus bicrucis is a species in the family Lygaeidae, in the order Hemiptera. The species is known generally as the \\"whitecrossed seed bug\\" or \\"ragwort seed bug\\".\\nThe distribution range of Neacoryphus bicrucis includes Central America, North America, Oceania, and South America."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%9B%E1%83%98%E1%83%9C%E1%83%98%E1%83%A1%E1%83%A2%E1%83%A0%E1%83%9D%E1%83%A1_%E1%83%9B%E1%83%94%E1%83%9D%E1%83%A0%E1%83%94_%E1%83%A1%E1%83%90%E1%83%AE%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/%D0%94%D0%BE%D0%BC_%D0%92%D1%82%D0%BE%D1%80%D0%BE%D0%B9_%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_02.JPG","page_title":"სამინისტროს მეორე სახლი","context_page_description":"სამინისტროს მეორე სახლი — ისტორიული შენობა პეტერგოფში. აგებულია 1836-1841 წლებში. შენობა არის ფედერალური მნიშვნელობის კულტურული მემკვიდრეობის ობიექტი. მდებარეობს გაყრისის ქუჩაზე, სახლი 3, სამხრეთიდან ესაზღვრება გაყრის მოედანი."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%DB%8C%D8%AA%D8%B1_%DA%AF%DB%8C%D9%84%D9%85%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Baphosimb.svg","page_title":"پیتر گیلمور","context_page_description":"پیتر هاوارد گیلمور در تاریخ ۲۴ مه ۱۹۵۸ در نیویورک متولد شد. او در سال ۲۰۰۱ توسط موبده کلیسای شیطان بلانچ بارتون به عنوان کاهن اعظم کلیسای شیطان تعیین شد.\\nوی هم‌اکنون به عنوان کاهن اعظم شیطان‌گرایان، در کلیسای شیطان فعالیت می‌کند.\\nگیلمور دارای کارشناسی ارشد رشته موسیقی از دانشگاه نیویورک است."},{"page_url":"https://it.wikipedia.org/wiki/Neuberg_im_Burgenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Wappen_Neuberg_im_Burgenland.png","page_title":"Neuberg im Burgenland","context_page_description":"Neuberg im Burgenland è un comune austriaco di 954 abitanti nel distretto di Güssing, in Burgenland. Abitato anche da croati del Burgenland, è un comune bilingue; il suo nome in croato è Nova Gora."},{"page_url":"https://sv.wikipedia.org/wiki/Adenviken_ME03","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/HMS_Carlskrona_%28P04%29.jpg","page_title":"Adenviken ME03","context_page_description":"ME03 var det tredje svenska förbandet i Sveriges bidrag till EU-operationen EU NAVFOR - Operation Atalanta. I mitten av mars 2013 avseglade HMS Carlskrona till insatsen i Adenviken för att från april till augusti delta i EU:s marina insats. Den 25 augusti anlöpte HMS Carlskrona hamnen i Karlskrona igen. Även under ME03 medverkade fartygsbaserade helikoptrar, bestående av två Hkp 15 i styrkebidraget Operation Atalanta|EU NAVFOR - Operation Atalanta. Under ME03 medverkade även F17 med att upprätta och drifthålla den sambandstekniska infrastrukturen, i form av delar av Kommunikationsnät flygbas, för de stödsystem som logistikenheten i Djibouti nyttjar."},{"page_url":"https://hu.wikipedia.org/wiki/A_Ming-dinasztia_csal%C3%A1df%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/%E6%98%8E%E5%A4%AA%E7%A5%96.jpg","page_title":"A Ming-dinasztia családfája","context_page_description":"Az alábbi családfa a Ming-dinasztia uralkodóit tartalmazza.\\nKis évszámok jelentése a személyeknél:\\nHa 2 van: 1. születés – 2. halál\\nHa 3 van: 1. születés – 2. trónralépés – 3. halál\\nHa 4 van: 1. születés – 2. trónralépés – 3. trónfosztás/lemondás – 4. halál"},{"page_url":"https://fr.wikipedia.org/wiki/1962_en_musique_classique","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Gaston_Blanquart.jpg","page_title":"1962 en musique classique","context_page_description":"16 février : la Symphonie nᵒ 12 « La Rurale » de Darius Milhaud, créée à Davis.\\n29 mai : King Priam, opéra de Michael Tippett, créé au Théâtre de Coventry sous la direction de John Pritchard.\\n30 mai : le War Requiem de Benjamin Britten, créé dans la cathédrale reconstruite de Coventry sous la direction de Meredith Davies et du compositeur.\\n14 juin : première représentation télévisuelle de The Flood drame biblique d'Igor Stravinsky.\\n22 septembre : Igor Stravinsky se rend pour la première fois depuis 52 ans à Moscou où il est accueilli triomphalement et est reçu en audience privée par Khrouchtchev.\\n24 septembre : le Concerto pour piano de Barber créé au Lincoln Center for the Performing Arts à Manhattan, avec John Browning comme soliste et l'Orchestre symphonique de Boston dirigé par Erich Leinsdorf.\\n4 octobre : la Symphonie nᵒ 8 de William Schuman, créée au Lincoln Center for the Performing Arts par l'Orchestre philharmonique de New York sous la direction de Leonard Bernstein.\\n8 octobre : Puppenspiel de Franco Donatoni, créé au Festival de Palerme.\\n25 octobre : l’Opéra de poussière de Marcel Landowski, créé à Avignon sous la direction du compositeur."},{"page_url":"https://en.wikipedia.org/wiki/Suomi_NPP","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Delta_II_and_NPP_after_service_structure_rollback.jpg","page_title":"Suomi NPP","context_page_description":"The Suomi National Polar-orbiting Partnership or Suomi NPP, previously known as the National Polar-orbiting Operational Environmental Satellite System Preparatory Project and NPP-Bridge, is a weather satellite operated by the United States National Oceanic and Atmospheric Administration. It was launched in 2011 and continues to operate.\\nSuomi was originally intended as a pathfinder for the NPOESS program, which was to have replaced NOAA's Polar Operational Environmental Satellites and the U.S. Air Force's Defense Meteorological Satellite Program. Suomi was launched in 2011 after the cancellation of NPOESS to serve as a stop-gap between the POES satellites and the Joint Polar Satellite System which will replace them. Its instruments provide climate measurements that continue prior observations by NASA's Earth Observing System.\\nThe satellite is named after Verner E. Suomi, a meteorologist at the University of Wisconsin–Madison. The name was announced on January 24, 2012, three months after the satellite's launch.\\nThe satellite was launched from Space Launch Complex 2W at Vandenberg Air Force Base in California by a United Launch Alliance Delta II 7920-10C on October 28, 2011."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B6%81%EA%B7%B9%EC%97%AC%EC%9A%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Alopex_lagopus_stretching.jpg","page_title":"북극여우","context_page_description":"북극여우는 북극지방에 서식하는, 여우의 한 종류이다."},{"page_url":"https://lt.wikipedia.org/wiki/Springfildas_(Masa%C4%8Dusetsas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Springfield_Skyline%2C_MA.jpg","page_title":"Springfildas (Masačusetsas)","context_page_description":"Springfildas – miestas JAV, Masačusetso valstijos pietuose. Įsikūręs ant rytinio Konektikuto upės kranto. Tai trečias didžiausias miestas pagal gyventojų sk. valstijoje ir ketvirtas Naujojoje Anglijoje, 2010 m. duomenimis, turintis per 153 tūkst. gyv. Visoje metropolinėje zonoje gyvena per 698 tūkst. žmonių. Apie 38 km į pietus yra valstijos sostinė Hartfordas. Yra oro uostas, keletas universitetų, 5 muziejai."},{"page_url":"https://hu.wikipedia.org/wiki/Ryback","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Rybaxel_May_2014.jpg","page_title":"Ryback","context_page_description":"Ryback Allen Reeves, ismertebb nevén Ryback, amerikai pankrátor. Egyike volt annak a nyolc embernek, aki bekerült a Tough Enough 4. szériájának döntőjébe. Később szerződést kötött a World Wrestling Entertainment-el, majd a különböző fejlődési területein birkózott: Deep South Wrestling-nél, Ohio Valley Wrestling-nél, a Florida Championship Wrestling-nél; 2010-ben pedig részt vett az NXT első évadában. Egyszer lett az OVW nehézsúlyú bajnoka, valamint egyszer szerezte meg a WWE interkontinentális bajnoki övét."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D9%86_%D8%AF%D8%A8%D9%84%D9%8A%D9%88._%D8%A8%D8%A7%D8%B1%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/USACE_John_W_Barlow.jpg","page_title":"جون دبليو. بارلو","context_page_description":"جون دبليو. بارلو ‏ هو عسكري أمريكي، ولد في 26 يونيو 1838 في مقاطعة وايومينغ في الولايات المتحدة، وتوفي في 27 فبراير 1914 في القدس في إسرائيل."},{"page_url":"https://de.wikipedia.org/wiki/Peter_Philipp_von_Dernbach","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Dernbach_007.png","page_title":"Peter Philipp von Dernbach","context_page_description":"Peter Philipp von Dernbach gen. Graul, latinisiert auch Petrus Philippus a Dernbach, war Fürstbischof des Bistums Bamberg und Bistums Würzburg."},{"page_url":"https://kk.wikipedia.org/wiki/Chevrolet_Camaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Chevrolet_Camaro_45th_Anniversary_Edition_-_Flickr_-_Alexandre_Pr%C3%A9vot.jpg","page_title":"Chevrolet Camaro","context_page_description":"Chevrolet Camaro — американдық GM корпорациясының Chevrolet бөлімшесі өндіріетін спорттық автокөлік. Көліктің өндірісі 1966 жылдан 2002 жылға дейін жүргізілді және 2009 жылдан бастап жаңа техникалық базада қайтадан басталды. Camaro атауы француз тілідегі camarade - дос деген сөзден туынды болып табылады."},{"page_url":"https://sv.wikipedia.org/wiki/Henri-Georges_Clouzot","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Henri-Georges_and_Vera_Clouzot_1953.jpg","page_title":"Henri-Georges Clouzot","context_page_description":"Henri-Georges Clouzot, född 20 november 1907 i Niort, död 12 januari 1977 i Paris, var en fransk filmregissör, manusförfattare och filmproducent. Hans kanske mest kända filmer är Fruktans lön och De djävulska."},{"page_url":"https://de.wikipedia.org/wiki/Ostricourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Ostricourt_-_Town_hall_-_1.jpg","page_title":"Ostricourt","context_page_description":"Ostricourt ist eine französische Gemeinde mit 5.372 Einwohnern im Département Nord in der Region Hauts-de-France. Ostricourt gehört zum Arrondissement Lille und zum Kanton Annœullin."},{"page_url":"https://en.wikipedia.org/wiki/August_Faller_GmbH_%26_Co._KG","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/August_Faller_KG_Historie.jpg","page_title":"August Faller GmbH & Co. KG","context_page_description":"August Faller GmbH & Co. KG is a German manufacturer and system supplier of pharmaceutical secondary packaging headquartered in Waldkirch, in Baden-Württemberg. With 1147 employees in 6 different locations across Europe, the company produces 2.1 billion folding cartons, 1.6 billion leaflets and 1 billion adhesive labels per year. August Faller GmbH & CO. KG is one of the market leading companies in the field of pharmaceutical secondary packaging in the German-Speaking region."},{"page_url":"https://en.wikipedia.org/wiki/August_Faller_GmbH_%26_Co._KG","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/August_Faller_KG_Historie.jpg","page_title":"August Faller GmbH & Co. KG","context_page_description":"August Faller GmbH & Co. KG is a German manufacturer and system supplier of pharmaceutical secondary packaging headquartered in Waldkirch, in Baden-Württemberg. With 1147 employees in 6 different locations across Europe, the company produces 2.1 billion folding cartons, 1.6 billion leaflets and 1 billion adhesive labels per year. August Faller GmbH & CO. KG is one of the market leading companies in the field of pharmaceutical secondary packaging in the German-Speaking region."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D8%AF%D9%88%D8%AC%D8%8C_%D9%86%D8%A8%D8%B1%D8%A7%D8%B3%DA%A9%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Dodge_County%2C_Nebraska_courthouse_from_NE_1.JPG","page_title":"شهرستان دوج، نبراسکا","context_page_description":"شهرستان دوج، نبراسکا یک سکونتگاه مسکونی در ایالات متحده آمریکا است که در نبراسکا واقع شده‌است."},{"page_url":"https://vi.wikipedia.org/wiki/Acropora_polystoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Acropora_polystoma_Maldives.JPG","page_title":"Acropora polystoma","context_page_description":"Acropora polystoma là một loài san hô trong họ Acroporidae. Loài này được Brook mô tả khoa học năm 1891."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%8F%E0%A4%AA%E0%A5%87%E0%A4%B2%E0%A4%A1%E0%A5%89%E0%A4%B0%E0%A5%8D%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Wapenapeldoorn.JPG","page_title":"एपेलडॉर्न","context_page_description":"एपेलडॉर्न एक नीदरलैंड में नगर पालिका है। एपेलडॉर्न भी नगर पालिका का सबसे बड़ा शहर का नाम है। एपेलडॉर्न ने देश के पूर्व में स्थित है। एपेलडॉर्न Gelderland के प्रान्त में स्थित है और लगभग 161.000 निवासियों की है।\\nक्षेत्र के संदर्भ में, एपेलडॉर्न नीदरलैंड की तीसरी सबसे बड़ी नगर पालिका है। जनसंख्या में, एपेलडॉर्न बारहवें सबसे बड़ी है। एपेलडॉर्न Veluwe के इस सबसे बड़े शहर है। एपेलडॉर्न हमेशा डच शाही परिवार के एक आवास दिया गया है। रिश्ते अब भी मजबूत हैं।"},{"page_url":"https://it.wikipedia.org/wiki/Zack_Ryder","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Internet_ChampionZack_Ryder.jpg","page_title":"Zack Ryder","context_page_description":"Matthew Brett Cardona è un wrestler statunitense sotto contratto con la All Elite Wrestling, dove lotta con il ring-name Matt Cardona.\\nÈ principalmente ricordato per i suoi trascorsi tra il 2007 e il 2020 nella WWE, dove si esibiva con il ring-name di Zack Ryder. In WWE ha vinto una volta l'Intercontinental Championship, una volta lo United States Championship e due volte il Raw Tag Team Championship."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B2%A0%E9%98%BB%E7%89%B9%E6%80%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Current-driven_neg_resistor_graph.svg","page_title":"負阻特性","context_page_description":"負阻特性也稱為負微分電阻特性，是指一些電路或電子元件在某特定埠的電流增加時，電壓反而減少的特性。一般的電阻在電流增加時，電壓也會增加，負阻特性恰好與電阻的特性相反。電壓隨電流變化的情形可以用微分電阻r表示：\\n沒有一個單一的電子元件，可以在所有工作範圍都呈現負阻特性，不過有些二極體在特定工作範圍下會有負阻特性。 圖一用共振隧道二極體說明其負阻特性。有些氣體在放電時也會出現負阻特性。而一些硫族化物的玻璃、有機半導體及導電聚合物也有類似的負阻特性。負阻元件在電子學中可製作雙穩態的切換電路及頻率接近微波頻率的震盪電路。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B8%95%E5%BE%B7%E5%8D%9A%E6%81%A9/%E5%88%A9%E6%99%AE%E6%96%BD%E5%A1%94%E7%89%B9%E6%9C%BA%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Airport_PAD_Abflughalle.jpg","page_title":"帕德博恩/利普施塔特机场","context_page_description":"帕德博恩/利普施塔特機場是德國北萊茵-威斯伐倫州的一座商用機場，坐落於帕德博恩縣比倫，分別距離帕德博恩西南15公里及利普施塔特東南20公里。"},{"page_url":"https://sv.wikipedia.org/wiki/Cynometra_iripa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Starr-091104-9123-plant-Cynometra_iripa.jpg","page_title":"Cynometra iripa","context_page_description":"Cynometra iripa är en ärtväxtart som beskrevs av Vincenz Franz Kosteletzky. Cynometra iripa ingår i släktet Cynometra, och familjen ärtväxter. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B7%A8%E5%B9%B4%E6%97%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/London_Eye_NYE.jpg","page_title":"西曆除夕","context_page_description":"跨年日，又稱作元旦前日，不少國家在元旦前一天的夜晚，均有舉行迎接新年的活動，而由跨年日橫跨至元旦的慶祝活動稱為元旦倒數、跨年倒數或跨年。跨年之夜是在陽曆或新曆的12月31日夜晚，而過年除夕則在農曆十二月二十九或三十。近年來流行於元旦前一晚進行跨年節日倒數，以慶祝新的一年的來臨。很多西方國家也稱元旦前一天為聖西爾維斯特日。\\n跨年前夕活動在很多國家會被視為與元旦不同的節慶。於21世紀的西方文化，最流行的慶祝活動是橫跨午夜的派對，多數亦會開香檳作為慶祝。世界上很多大城市於跨年夜會舉行大型煙火匯演慶祝新一年的到來。跨年日在澳大利亞、阿根廷、巴西、墨西哥、希臘、紐西蘭、菲律賓及委內瑞拉被列為公眾假期。香港怡和午炮及蘇格蘭愛丁堡城堡均會發放子夜禮炮來迎接新的一年來臨。"},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Sant%27Anna_dei_Pompetti","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Chiesa_di_Sant%27Anna_dei_Pompetti_-_Sant%27Anna_e_la_Madonna_Bambina.jpg","page_title":"Chiesa di Sant'Anna dei Pompetti","context_page_description":"La chiesa di Sant'Anna dei Pompetti o dè Pompetti si trova nella città di Teramo, in Abruzzo, nel cuore del centro storico ed archeologico di piazza Sant'Anna. L'edificio religioso, addossato al bastione della Torre Bruciata, è molto vicino alla chiesa di Santa Caterina. Entrambe le chiese in origine facevano parte del complesso dell'Antica cattedrale di Santa Maria Aprutiensis ed ora appartengono alla locale parrocchia della chiesa di Sant'Antonio. La costruzione si compone di quanto è sopravvissuto ed è stato conservato del corpo di fabbrica dell'Antica cattedrale. Questa identificazione dell'attuale struttura con una porzione del primo centro liturgico e spirituale della città è stata svelata dagli scavi e dagli studi che Francesco Savini condusse nell'area archeologica dall'anno 1896 e che si protrassero fino ai primi anni del XX secolo. Dal 1902 è stata inclusa nell'elenco dei Monumenti nazionali italiani."},{"page_url":"https://fi.wikipedia.org/wiki/Juri_Glazkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/USSR_stamp_Soyuz-24_1977_10k.jpg","page_title":"Juri Glazkov","context_page_description":"Juri Glazkov oli neuvostoliittolainen kosmonautti.\\nGlazkov valmistui Harkovan sotilaskoulusta vuonna 1962 insinööriksi. Hän toimi Neuvostoliiton ilmavoimissa insinööriupseerina yleten kenraalimajuriksi.\\nHän valittiin kosmonauttikoulutukseen 23. lokakuuta 1965. Glazkov lensi Sojuz 24 -avaruusaluksella. Hän väitteli tekniikan tohtoriksi vuonna 1974. Hän siirtyi eläkkeelle 26. tammikuuta 1982, ja toimi vuosina 1989–2000 Gagarinin kosmonauttikoulutuskeskuksen varajohtajana.\\nGlazkov oli naimisissa ja perheessä oli kaksi lasta."},{"page_url":"https://de.wikipedia.org/wiki/Bahnb%C3%B6gengalerie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Bahnb%C3%B6gengalerie_23.jpg","page_title":"Bahnbögengalerie","context_page_description":"Die Bahnbögengalerie ist eine Serie von 40 Wandbildern im Stadtzentrum von Dresden. Das großangelegte Streetart-Werk, ausgeführt per Graffiti-Technik, entstand von 2005 bis 2007 anlässlich der 2006 begangenen 800-Jahr-Feier der sächsischen Landeshauptstadt. Es erstreckt sich über eine Länge von knapp 750 Metern, allerdings mit mehreren Unterbrechungen. Die Wandbilder der Galerie liegen entlang der nordwestlichen Straßenseite der Könneritzstraße, eines Teils des 26er Rings, in der Wilsdruffer Vorstadt. Sie befinden sich auf den Fassaden zugemauerter Bögen mehrerer langgestreckter Bogenbrücken, die Teil der Bahnstrecke Děčín–Dresden-Neustadt in ihrem höhergelegten innenstädtischen Abschnitt zwischen Dresden Hauptbahnhof und Bahnhof Dresden-Neustadt und damit Eigentum der Deutschen Bahn sind. Dabei handelt es sich um die jeweils mehr als 100 Meter langen Stadtviadukte I, II und III, die als „stadtentwicklungsgeschichtlich bedeutend“ gelten und deshalb als technische Denkmale in Dresden unter Schutz stehen.\\nVon den 40 Wandbildern haben 16 einen Bezug zu Dresden und 10 zu anderen sächsischen Orten, die teils im Dresdner Umland liegen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B5%AB%E5%B0%94%E6%9B%BC%C2%B7%E8%8C%83%E9%BE%99%E4%BD%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Herman_Van_Rompuy_675.jpg","page_title":"赫尔曼·范龙佩","context_page_description":"赫爾曼·范龍佩，比利時伯爵，首任歐洲理事會常任主席，前比利時首相。"},{"page_url":"https://fi.wikipedia.org/wiki/Paharpur","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Paharpur_Terracotta_by_Farhana_1.jpg","page_title":"Paharpur","context_page_description":"Paharpur on rauniokaupunki Bangladeshissa. Mahayana-buddhalaiset asuttivat kaupunkia 700-luvulta 1200-luvulle. Paharpur on erityisen arvokas muistomerkki buddhalaisesta arkkitehtuurista, jonka esimerkkiä seurattiin ympäri Etelä-Aasiaa. Se on ollut Etelä-Aasian suurin yksittäinen buddhalaisluostari ja huomattava buddhalaisen tiiliarkkitehtuurin saavutus. On ajateltu sen olleen mallina 400 vuotta myöhemmin Kaakkois-Aasiaan tehdylle Angkor Watille.\\nKaupungin arkeologisesti merkittävin rakennus on suuri luostari, Sompur Bihara. Palan kuningaskunnan hallitsija Dharmapala rakensi luostarin 700-luvulla aasialaiseksi oppimis- ja pyhiinvaelluskeskukseksi. Luostarikompleksin pinta-ala on 85 000 m² ja se koostuu 177 luostarikammiosta, useista stupista ja temppeleistä sekä lukuisista sivurakennuksista. Luostarin koristellut terrakottalaatat esittävät jumalia, kasveja, eläimiä, miehiä ja naisia. Vuonna 1985 luostari valittiin Unescon maailmanperintöluetteloon.\\nLuostarista erillään on Paharpurin keskuspyhäkkö, joka on keskiaikaisen insinööritaidon ihme, sillä se on rakennettu kokonaan tiilistä ilman savilaastia. Tiileen oli turvauduttava, sillä alueella ei juurikaan ole kiviä."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D0%B2%D0%B8%D1%99%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Treviglio_View.jpg","page_title":"Тревиљо","context_page_description":"Тревиљо град је у северној Италији. То је други по величини и значају град округа Бергамо у оквиру италијанске покрајине Ломбардија.\\nТревиљо називају и „градом трактора“, по великом предузећу за његову производњу, које је овде смештено."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BD_%D0%A7%D0%B6%D1%83%D0%BD_%D0%A5%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Bong_Joon-ho_FilmFest_Muenchen_04Jul2019.jpg","page_title":"Пон Чжун Хо","context_page_description":"Пон Чжун Хо — южнокорейский кинорежиссёр и сценарист. Лауреат четырёх премий «Оскар» за один год. Получил приз южнокорейской кинопромышленности 2003 года за свой фильм «Воспоминания об убийстве», в котором осветил тему нераскрываемых преступлений. Бывший активист студенческого движения, член Новой демократической партии."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%81%D8%B1%DB%8C%D9%86%DA%A9_%D9%84%D8%A7%D8%A6%DB%8C%DA%88_%D8%B1%D8%A7%D8%A6%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Oak_Park_Il_Thomas_Gale_House2.jpg","page_title":"فرینک لائیڈ رائٹ","context_page_description":"فرینک لائیڈ رائٹ امریکہ دا اک آرکیٹکٹ سی۔"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9B%B4%E8%B4%A1%E6%A2%AF%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Drigung_monastery11.jpg","page_title":"直贡梯寺","context_page_description":"直贡梯寺，位于西藏自治区拉萨市墨竹工卡县门巴乡，是一座藏传佛教直贡噶举派寺院，也是直贡噶举派的主寺。"},{"page_url":"https://nl.wikipedia.org/wiki/Johann_Gabriel_Seidl","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Johann_Gabriel_Seidl.jpg","page_title":"Johann Gabriel Seidl","context_page_description":"Johann Gabriel Seidl was een Oostenrijks archeoloog, dichter, schrijver van verhalen en toneelschrijver. Hij schreef de tekst van \\"Gott erhalte, Gott beschütze unsern Kaiser, unser Land!\\", de versie uit 1854 van het volkslied van het Oostenrijkse keizerrijk, op muziek van Joseph Haydn.\\nJohann Gabriel Seidl werd geboren in Wenen en was de zoon van een advocaat. Hij studeerde zelf ook rechten. Vanaf 1829 gaf hij les aan een gymnasium in Celje, Slovenië. In 1840 werd hij curator aan het Münz- und Antikenkabinett in Wenen. Van 1856 tot 1871 was hij verantwoordelijk voor de financiën. Hij bracht het grootste deel van zijn leven door in Wenen en overleed er in 1875.\\nNaast zijn wetenschappelijk werk gaf Seidl diverse gedichten en korte verhalen uit, waaronder de eerste gedichten van Nikolaus Lenau in het tijdschrift Aurora. Verschillende van zijn eigen gedichten werden op muziek gezet door Franz Schubert en Carl Loewe. Hij schreef niet alleen gedichten in standaard-Duits, maar ook in Oostenrijks dialect."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A2%D7%99%D7%9F_%D7%A1%D7%95%D7%9B%D7%95%D7%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Ein_Sukkot_spring.JPG","page_title":"עין סוכות","context_page_description":"עין סוכות הוא כינוי רווח למעיין שכבה הנובע מזרחית לכביש 90, בסמוך לגדר הגבול באזור שבין מחולה לשדמות מחולה. מי המעיין מתנקזים לתוך בריכה טבעית בקוטר של כ-20 מטר ומוקפת קנה מצוי.\\nתושבי שדמות מחולה הציבו ליד הבריכה שולחנות פיקניק וסככה. בנוסף הוצבו במרכז הבריכה עזרי ציפה."},{"page_url":"https://et.wikipedia.org/wiki/Malnava_vald","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Malnavas_pagasts_LocMap.png","page_title":"Malnava vald","context_page_description":"Malnava vald on vald Lätis Kārsava piirkonnas.\\nVald piirneb sama piirkonna Kārsava linnaga ja Mežvidi, Goliševa, Mērdzene ning Salnava vallaga. Kirdes piirneb vald Venemaaga.\\nValla pindala on 164 km². 2016. aasta seisuga elas seal 1246 inimest. Aastal 2011 elas vallas 1063 lätlast, 198 venelast, 6 valgevenelast, 17 ukrainlast, 2 poolakat ja 1 leedulane. Valla keskus on Malnava küla. Vallavanem on Irēna Kaupuže."},{"page_url":"https://en.wikipedia.org/wiki/Revolution_Square,_Moscow","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Wiki_Metropol_Hotel_Moscow_Main.jpg","page_title":"Revolution Square, Moscow","context_page_description":"Revolution Square is a square located in the center of Moscow, in Tverskoy District, northwest of Red Square. The square has the shape of an arc running from the southwest to the north and is bounded by Manezhnaya Square to the southwest, Okhotny Ryad to the north, and the buildings separating it from Nikolskaya Street to the south and to the east. It is one of the Central Squares of Moscow. The continuation of the Revolution Square north behind Okhotny Ryad is Teatralnaya Square.\\nThere are three Moscow Metro stations located under the square, all of them having at least one exit at the square: Ploshchad Revolyutsii, named after the square, Teatralnaya, and Okhotny Ryad. All these stations are transfer stations, with Teatralnaya being connected with the other two."},{"page_url":"https://fr.wikipedia.org/wiki/Couvent_des_Minimes_d%27Ornans","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ornans%2C_Couvent_des_Minimes.jpg","page_title":"Couvent des Minimes d'Ornans","context_page_description":"Le couvent des Minimes d'Ornans est un ancien couvent dont les bâtiments sont protégés par les monuments historiques. Il est situé à Ornans dans le département français du Doubs."},{"page_url":"https://en.wikipedia.org/wiki/Serpentine_National_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Serpentine_Falls%2C_Serpentine_National_Park%2C_Western_Australia.jpg","page_title":"Serpentine National Park","context_page_description":"The Serpentine National Park is a national park located on the Darling Scarp, approximately 55 kilometres southeast of Perth in Western Australia in Australia. The depth of the falls has been undetermined, and is shrouded with conspiracy and enigmatism."},{"page_url":"https://az.wikipedia.org/wiki/Callicarpa_cathayana","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Callicarpa_cathayana_floraison2.jpg","page_title":"Callicarpa cathayana","context_page_description":"Callicarpa cathayana — dalamazkimilər fəsiləsinin callicarpa cinsinə aid bitki növü."},{"page_url":"https://ru.wikipedia.org/wiki/I_%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%B5%D0%B4%D0%B8%D0%BD%D0%BE%D0%B2%D0%B5%D1%80%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Edinover_Moscow_1912.jpg","page_title":"I Всероссийский единоверческий съезд","context_page_description":"I Всероссийский единоверческий съезд — съезд единоверческих клириков и мирян Русской православной церкви, проходивший с 22 по 30 января 1912 года в Санкт-Петербурге под председательством архиепископа Волынского и Житомирского Антония. В работе съезда приняли участие более 256 делегатов и 20 архиереев, а также гости собора — всего более 350 человек.\\nСобор пересмотрел правила единоверия, обсудил вопросы богослужения в единоверческих церквах, затронул темы, касавшиеся организации единоверческих общин и общего управления единоверием в России. Также речь шла о клятвах московских Соборов XVII века на старообрядцев. Обсуждалась проблема привлечения в лоно Православной Церкви на основе единоверия старообрядцев-беглопоповцев и представителей других согласий.\\n31 января 1912 года делегация депутатов съезда была принята императором Николаем II. На этой встрече митрополитом Антонием был поднят вопрос об официальном наименовании единоверцев «православными старообрядцами»."},{"page_url":"https://sv.wikipedia.org/wiki/Gatti%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Gatti%C3%A8res.jpg","page_title":"Gattières","context_page_description":"Gattières är en kommun i departementet Alpes-Maritimes i regionen Provence-Alpes-Côte d'Azur i sydöstra Frankrike. Kommunen ligger i kantonen Carros som ligger i arrondissementet Grasse. År 2009 hade Gattières 4 069 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/Abbaye_de_Port-Royal_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Pary%C5%BC_port-royal.JPG","page_title":"Abbaye de Port-Royal de Paris","context_page_description":"L’abbaye de Port-Royal de Paris a été fondée au XVIᵉ siècle pour décongestionner l'abbaye de Port-Royal des Champs. Elle a été fermée en 1790. Le bâtiment est inscrit comme monument historique français depuis 1928.\\nElle longe le boulevard de Port-Royal."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%A7%D8%B1%D9%86_%DA%A9%D8%B1%DB%8C%D8%B3%D8%AA%D9%88%D9%81%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Warren_Christopher.jpg","page_title":"وارن کریستوفر","context_page_description":"وارن کریستوفر آمریکالی سیاستچی و دموکرات حزبینین عوضوو ایدی. اسکرانتون شهرینده دۆنیایا گؤز آچیب. لوس‌آنجلس شهرینده دۆنیاسین دَییشیب."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A4%BE%E0%A4%87%E0%A4%95%E0%A5%8D%E0%A4%B0%E0%A5%8B%E0%A4%AB%E0%A5%8B%E0%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Oktava319vsshuresm58.png","page_title":"माइक्रोफोन","context_page_description":"एक माइक्रोफोन एक ध्वनिक-से-वैद्युत ट्रांसड्यूसर या संवेदक होता है, जो ध्वनि को विद्युतीय संकेत में रूपांतरित करता है। 1876 में, एमिली बर्लिनर ने पहले माइक्रोफोन का आविष्कार किया, जिसका प्रयोग टेलीफोन स्वर ट्रांसमीटर के रूप में किया गया। माइक्रोफोनों का प्रयोग अनेक अनुप्रयोगों, जैसे टेलीफोन, टेप रिकार्डर, कराओके प्रणालियों, श्रवण-सहायता यंत्रों, चलचित्रों के निर्माण, सजीव तथा रिकार्ड की गई श्राव्य इंजीनियरिंग, FRS रेडियो, मेगाफोन, रेडियो व टेलीविजन प्रसारण और कम्प्यूटरों में आवाज़ रिकार्ड करने, स्वर की पहचान करने, VoIP तथा कुछ गैर-ध्वनिक उद्देश्यों, जैसे अल्ट्रासॉनिक परीक्षण या दस्तक संवेदकों के रूप में किया जाता है।\\nवर्तमान में प्रयोग किये जाने वाले अधिकांश माइक्रोफोन यांत्रिक कंपन से एक विद्युतीय आवेश संकेत उत्पन्न करने के लिये एक विद्युतचुंबकीय प्रवर्तन, धारिता परिवर्तन, पाइज़ोविद्युतीय निर्माण या प्रकाश अधिमिश्रण का प्रयोग करते हैं।"},{"page_url":"https://en.wikipedia.org/wiki/Epidemiological_transition","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Zimbabwe-GBD-Compare.jpg","page_title":"Epidemiological transition","context_page_description":"In demography and medical geography, epidemiological transition is a theory which \\"describes changing population patterns in terms of fertility, life expectancy, mortality, and leading causes of death.\\" For example, a phase of development marked by a sudden increase in population growth rates brought by improved food security and innovations in public health and medicine, can be followed by a re-leveling of population growth due to subsequent declines in fertility rates. Such a transition can account for the replacement of infectious diseases by chronic diseases over time due to increased life span as a result of improved health care and disease prevention. This theory was originally posited by Abdel Omran in 1971."},{"page_url":"https://de.wikipedia.org/wiki/Lohn-Ammannsegg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/2017-Lohn-Ammannsegg-Ref-Kirche.jpg","page_title":"Lohn-Ammannsegg","context_page_description":"Lohn-Ammannsegg ist eine politische Gemeinde im Bezirk Wasseramt des Kantons Solothurn in der Schweiz. Die Gemeinde entstand 1993 durch die Fusion der früher selbständigen Gemeinden Lohn und Ammannsegg."},{"page_url":"https://ast.wikipedia.org/wiki/Heliconius_sara","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Heliconius_sara_butterfly.jpg","page_title":"Heliconius sara","context_page_description":"Heliconius sara ye una especie de lepidópteru perteneciente a la familia Nymphalidae. Atópase dende Méxicu a la Cuenca del Amazones y sur de Brasil."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%99%D7%92%27%D7%95_208","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Peugeot_208_e-HDi_FAP_115_Stop_%26_Start_Allure_%E2%80%93_Frontansicht%2C_23._September_2012%2C_Hilden.jpg","page_title":"פיג'ו 208","context_page_description":"פיג'ו 208 היא מכונית סופרמיני המיוצרת על ידי יצרנית הרכב הצרפתית פיג'ו. המכונית נחשפה לראשונה בתערוכת הרכב בז'נבה במרץ 2012. פיג'ו 208 מחליפה את פיג'ו 207 אשר נשאה את דגל הסופרמיני של פיג'ו במשך כשש שנים. עיצובה של פיג'ו 208 הופקד בידי המעצב פייר אוטייר כשסילבן הנרי מתפקד כמעצב החיצוני."},{"page_url":"https://fr.wikipedia.org/wiki/J._Warren_Kerrigan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Jack-Kerrigan.jpg","page_title":"J. Warren Kerrigan","context_page_description":"J. Warren Kerrigan est un acteur, réalisateur et scénariste américain, né à Louisville le 25 juillet 1879 et mort d'une broncho-pneumonie à Balboa Beach le 9 juin 1947."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BA%94%E8%A3%82%E5%8F%89%E8%95%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Tectaria_quinquefida_1.jpg","page_title":"五裂叉蕨","context_page_description":"五裂叉蕨為叉蕨科叉蕨屬下的一個種。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A6%8F%E5%B7%9E%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/CRH2A-2454%40FZS_%2820190510200740%29.jpg","page_title":"福州站","context_page_description":"福州站位於中國福建省福州市晉安區，為南昌局集團五個直屬車站之一，客運一等站。溫福鐵路、峰福鐵路、福馬鐵路、昌福鐵路和合福鐵路及建設中的福平鐵路均經由此站。福州站於1958年啟用，後經重建、擴建等工程，現有南北兩站房，共計5個候車廳和12個檢票口。\\n由於車站地處福州城區北面，且臨近汽車北站，福州站亦常被當地民眾稱作「福州火車北站」。"},{"page_url":"https://en.wikipedia.org/wiki/Charles-Fran%C3%A7ois_Dupuis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Charles-Fran%C3%A7ois_Dupuis.JPG","page_title":"Charles-François Dupuis","context_page_description":"Charles François Dupuis was a French savant, a professor of rhetoric at the Collège de Lisieux, Paris, who studied for the law in his spare time and was received as avocat in 1770. He also ventured into the field of mathematics and served on the committee that developed the French Republican Calendar.\\nAlong with Constantin François Chassebœuf de Volney Dupuis was known for developing the Christ myth theory, which argued that Christianity was an amalgamation of various ancient mythologies and that Jesus was a mythical character."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%B1%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Karres_im_Bezirk_IM.png","page_title":"کارس","context_page_description":"کارس یک منطقهٔ مسکونی در اتریش است که در ناحیه ایمست واقع شده‌است. کارس ۷٫۵۲ کیلومتر مربع مساحت دارد ۸۳۰ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://tr.wikipedia.org/wiki/Emanullah_Han","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Atat%C3%BCrk_ve_Amanullah_Han.jpg","page_title":"Emanullah Han","context_page_description":"Emanullah Han, ülkesinin Birleşik Krallık'ın etkisinden kurtarılarak bağımsızlığa kavuşmasına önderlik eden ve 1919-1929 yılları arasında hükmetmiş Afganistan Emiri.\\nEmir Habibullah Han'ın oğluydu. Babasının 1919'da öldürülmesinden bir hafta sonra amcasını tahttan indirip, müebbet hapse mahkûm ettirerek 28 Şubat 1919'da tahta çıktı. Tahta çıkma töreninde yaptığı konuşmada Afganistan'ın bağımsızlığını ilan etti. İngilizler duruma müdahale etmelerine rağmen, I. Dünya Savaşı'ndan yıpranmış olarak çıkan İngiliz-Hint ordusu ile fazla etkili olamayan Afgan ordusu arasında ufak çaplı birkaç çatışma dışında bir olay yaşanmadı. 8 Ağustos 1919'da Ravalpindi'de Afganistan'ın bağımsızlığını tanıyan Ravalpindi Antlaşması imzalandı. Bu antlaşmanın neticesi olarak 19 Ağustos 1919'da bağımsızlık ilan edildi.\\n1921'de SSCB ve Türkiye ile dostluk, 1922'de İran'la saldırmazlık antlaşması yaptı. 1921 Türkiye Anayasası'nı örnek alarak hazırlattığı Afgan Anayasası, 1923'te yürürlüğe girdi."},{"page_url":"https://de.wikipedia.org/wiki/Ponte_Novu","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Castello-di-Rostino_Pont_de_Ponte_Novu_RN_193_sur_le_Golo.jpg","page_title":"Ponte Novu","context_page_description":"Die Ponte Novu ist die Ruine einer Brücke auf Korsika über den Fluss Golo beim Weiler Ponte Novu auf dem Gebiet der Gemeinde Castello-di-Rostino. Die ehemals fünfbögige Steinbogenbrücke wurde wahrscheinlich im 17. Jahrhundert von den Genuesern errichtet. Sie war 1769 Schauplatz der Schlacht bei Ponte Novu, die das Ende der jungen Korsischen Republik und den Beginn der französischen Herrschaft bedeutete. Im Zweiten Weltkrieg wurde die Brücke von abrückenden deutschen Truppen 1943 zerstört.\\nDie Brücke ist seit 1993 als Monument historique eingestuft.\\nRund um die Brückenruine gestalten die Einwohner von Ponte Novu an jedem Jahrestag der Schlacht eine Gedenkzeremonie.\\nWenige Meter flussabwärts wurde für die Landstraße Route territoriale 20 ein neues Brückenbauwerk errichtet."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%82%D0%B8%D0%BD_%D0%9B%D0%B0%D0%BD%D0%B4%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Martin_Landau-Mission-1968.jpg","page_title":"Мартин Ландау","context_page_description":"Мартин Ландау, е американски филмов, телевизионен и театрален актьор, роден през 1928 година."},{"page_url":"https://fr.wikipedia.org/wiki/La_Celette","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Croix_de_la_Preugne.jpg","page_title":"La Celette","context_page_description":"La Celette est une commune française située dans le département du Cher en région Centre-Val de Loire."},{"page_url":"https://it.wikipedia.org/wiki/Incisioni_rupestri_della_Val_Camonica","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Roccia_al_Coren_de_le_fate_-_Sonico_%28Foto_Luca_Giarelli%29.jpg","page_title":"Incisioni rupestri della Val Camonica","context_page_description":"Le incisioni rupestri della Val Camonica si trovano in provincia di Brescia e costituiscono una delle più ampie collezioni di petroglifi preistorici del mondo. L'arte rupestre è segnalata su circa 2 000 rocce in oltre 180 località comprese in 24 comuni, con una particolare concentrazione nelle municipalità di Capo di Ponte, Ceto, Cimbergo e Paspardo, Sonico, Sellero, Darfo Boario Terme, Ossimo dove esistono 8 parchi attrezzati per la visita. Si tratta del primo Patrimonio dell'umanità riconosciuto dell'UNESCO in Italia, che ha riconosciuto oltre 140 000 figure, anche se nuove ininterrotte scoperte ne hanno progressivamente aumentato il numero complessivo portandole fino a duecentomila se non trecentomila."},{"page_url":"https://de.wikipedia.org/wiki/Kastell_Gerulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Rusovce_09_02.jpg","page_title":"Kastell Gerulata","context_page_description":"Das Kastell Gerulata war Bestandteil der Festungskette am mittleren Donaulimes auf dem Gebiet der heutigen Slowakei. Seine Überreste befinden sich in Rusovce, einem Stadtteil der slowakischen Hauptstadt Bratislava. Das Reiterlager war vermutlich vom 1. bis ins 4. Jahrhundert n. Chr. durchgehend mit römischen Truppen belegt.\\nNeben dem am linken Donauufer gelegenen Iža, ist Gerulata das bisher einzige bekannte Limeskastell auf dem Gebiet der Slowakei. Ein Ausstellungsgebäude des Städtischen Museums Bratislava befindet sich direkt beim einstigen Lagerstandort."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%BE%D1%80%D0%B5%D0%BB%D1%8C%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/GTAA_LINK_train_clip.JPG","page_title":"Монорельс","context_page_description":"Моноре́льс — разновидность рельсового транспорта. Хотя формально под выражением монорельс понимается железная дорога, в которой используется один несущий рельс, в отличие от обычной железной дороги, где их два, в существующей практике под монорельсом понимаются различные формы внедорожного транспорта, где рельса как такового может и не быть вообще. Как правило, монорельсом называется любая форма эстакадного транспорта, где подвеска выполнена нетрадиционным способом — то есть без двух несущих рельсов."},{"page_url":"https://ro.wikipedia.org/wiki/Guvernoratul_Liban_de_Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/North_in_Lebanon.svg","page_title":"Guvernoratul Liban de Nord","context_page_description":"Libanul de Nord este unul dintre guvernoratele Libanului, iar capitala sa este orașul Tripoli."},{"page_url":"https://en.wikipedia.org/wiki/Phaleria_clerodendron","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/Phaleria_clerodendron_fruit.jpg","page_title":"Phaleria clerodendron","context_page_description":"Phaleria clerodendron is an ornamental flowering evergreen plant from the rainforests of Queensland in northeastern Australia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Bergen_und_Erhebungen_in_Polen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Che%C5%82miec_%28szczyt%29-widok.jpg","page_title":"Liste von Bergen und Erhebungen in Polen","context_page_description":"Diese Liste von Bergen und Erhebungen in Polen nennt, der Höhe nach geordnet, die höchsten Berge in Polen. Aufgelistet sind hier die 10 höchsten Berge des Landes, das sind alle Berge über 2300 Meter, sowie die höchsten Erhebungen der 16 Woiwodschaften. Des Weiteren ist für die 28 polnischen Gebirge und Gebirgszüge jeweils der höchste Gipfel angegeben.\\nDa sich einige Berge auf der Staatsgrenze befinden, ist die Höhe auf polnischem Staatsgebiet angegeben. Angegeben ist die Höhe über dem Meeresspiegel, bezogen auf den Kronstädter Pegel."},{"page_url":"https://it.wikipedia.org/wiki/Beni_culturali_d%27importanza_nazionale_nel_canton_Ticino_ISOS","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Gentilino_SAbbondio_20110719_20.jpg","page_title":"Beni culturali d'importanza nazionale nel canton Ticino ISOS","context_page_description":"Questa lista contiene tutti gli insediamenti svizzeri da proteggere di importanza nazionale del canton Ticino ricavato dall'Inventario dei beni culturali svizzeri d'importanza nazionale e regionale. È ordinato per comune.\\nLe coordinate geografiche fornite sono nel Sistema di coordinate svizzere."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%89%BE%E9%9B%B7%E6%8B%89%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Herrerasaurus_DB.jpg","page_title":"艾雷拉龍屬","context_page_description":"艾雷拉龙属，又称黑瑞拉龙、埃雷拉龙、黑瑞龙或赫勒拉龙，是已知最早的肉食性恐龙之一。所有已知的标本都是发现于阿根廷巴塔哥尼亚西北部的三叠纪中后期地层，属于卡尼阶晚期，约2亿3140万年前。模式种是伊斯基瓜拉斯托艾雷拉龙，是在1963年由阿根廷古生物学家奥斯瓦尔多·雷格叙述、命名，且是此属的唯一种。伊斯龙、富伦格里龙则普遍被认为是艾雷拉龙的异名。\\n自发现以来，有很长的一段时间艾雷拉龙的分类都不清楚，原因是它最初只有一些化石碎片。它曾被认为是基础兽脚亚目恐龙、基础蜥脚形亚目恐龙、基础蜥臀目恐龙、或者不是恐龙。但是，随着1988年发现了大部分完整的骨骼及头颅骨后，艾雷拉龙在至少五个关于兽脚亚目演化的研究中，被分类为早期的兽脚亚目、或早期蜥臀目恐龙，但也有研究人员选择暂时性地将艾雷拉龙列为兽脚亚目的最原始物种。艾雷拉龙是中型的双足恐龙，属于艾雷拉龙下目，这群外表相似的动物，是最早期的恐龙演化扩散结果。"},{"page_url":"https://no.wikipedia.org/wiki/Charles_Guthrie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/General_Guthrie.jpg","page_title":"Charles Guthrie","context_page_description":"Charles Ronald Llewelyn Guthrie er en britisk offiser. Han var hærsjef fra 1994 til 1997 og forsvarssjef fra 1997 til han fikk avskjed i nåde i 2001.\\nHans militære karriere inkluderte tjeneste i Welsh Guards og Special Air Service; han var dypt involvert i militære operasjoner i Nord-Irland og gav råd til den britiske regjeringen under Bosnia-krigen og Kosovo-krigen.\\nEtter at han fikk avskjed fra British Army ble han utnevnt til life peer som baron Guthrie av Craigiebank i juni 2001."},{"page_url":"https://en.wikipedia.org/wiki/Mike_Smith_(record_producer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Mike_Smith_2019.jpg","page_title":"Mike Smith (record producer)","context_page_description":"Mike Smith is a Cuban American recording artist, record and television producer. He is a Number 1 Billboard charting artist. He is best known for being one of the stars and main judge on BET's original programming series One Shot. He is also well known for numerous hit singles including the Top 5 Billboard hit \\"Beautiful Day\\" and Billboard Top 40 hits \\"Hardworking Man\\" and \\"You're My Kind Of Beautiful\\".\\nSmith has worked with many artists, including DJ Khaled, T.I., Juicy J, Royce Da 5'9', Remy Ma, and Gilby Clarke of Guns N' Roses."},{"page_url":"https://de.wikipedia.org/wiki/Ara_Pacis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Ara_Pacis_Relief_Pax.jpg","page_title":"Ara Pacis","context_page_description":"Die Ara Pacis Augustae ist ein Monument in Rom. Es wurde 13 v. Chr. vom römischen Senat in Auftrag gegeben und dem siegreichen Kaiser Augustus gewidmet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%BD%AE%E6%B1%95%E5%9C%B0%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/%E6%B8%85%E6%BD%AE%E5%B7%9E%E5%BA%9C%E5%9B%BE.jpg","page_title":"潮汕地區","context_page_description":"潮汕地區，簡稱潮汕，別稱嶺東，是粵東沿海地區，潮州、揭陽、汕頭等地級市區域的俗稱。今潮州、汕頭、揭陽等市轄域，歷史上屬於潮州府，原包含現屬梅州的大埔、豐順兩縣。"},{"page_url":"https://en.wikipedia.org/wiki/Petitcodiac_River_Campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Petitcodiac-watershed-map.jpg","page_title":"Petitcodiac River Campaign","context_page_description":"The Petitcodiac River Campaign was a series of British military operations from June to November 1758, during the French and Indian War, to deport the Acadians that either lived along the Petitcodiac River or had taken refuge there from earlier deportation operations, such as the Ile Saint-Jean Campaign. Under the command of George Scott, William Stark's company of Rogers Rangers, Benoni Danks and Gorham's Rangers carried out the operation.\\nAccording to one historian, the level of Acadian suffering greatly increased in the late summer of 1758. Along with campaigns in Cape Sable Campaign, the Gulf of St. Lawrence and the St. John River Campaign, the British targeted the Petitcodiac River."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A7%D0%B5%D0%B3%D1%80%D1%82%D1%83%D1%88%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Gadwall_Nest.jpg","page_title":"Чегртуша","context_page_description":"Чегртуша честа је врста патака из подрода Mareca, која не зарања целим телом у потрази за храном. Чегртуша се гнезди у северним деловима Европе, Азије и Северне Америке. У Србији се гнезди само у североисточном делу Србије, и то у јужном Банату, Подунављу око Сребрног језера и ушћа реке Пек, као и Кључу и Неготинској крајини. Бројност популације је порасла за око 2,5 % у последњих 49 година. Тренутни популациони трен је растући. У Србији је процењена бројност на 200—340 гнездећих парова, са умереним популационим растом. Чегртуша је, поред глуваре и крџе, најловљенија врста патака, са око 1,7 милиона одстрељених годишње."},{"page_url":"https://pt.wikipedia.org/wiki/T%C3%BA_o_nadie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Tu_o_nadie.jpg","page_title":"Tú o nadie","context_page_description":"Tú o nadie foi uma telenovela mexicana produzida por Ernesto Alonso para a Televisa e exibida pelo Canal de las Estrellas entre 11 de fevereiro a 26 de julho de 1985, substituindo La pasión de Isabela e antecedendo Vivir un poco, em 120 capitulos.\\nFoi protagonizada por Lucía Méndez e Andrés García e antagonizada por Salvador Pineda e Úrsula Prats."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_cycliste_Euskadi_Basque_Country-Murias","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Isbergues_-_Grand_Prix_d%27Isbergues%2C_20_septembre_2015_%28B032%29.JPG","page_title":"Équipe cycliste Euskadi Basque Country-Murias","context_page_description":"L'équipe cycliste Euskadi Basque Country-Murias est une équipe cycliste espagnole active entre 2015 et 2019. Durant son existence, elle court avec une licence d'équipe continentale professionnelle. Elle participe aux épreuves de l'UCI Europe Tour, ainsi qu'à des courses du World Tour pour lesquelles elle bénéficie d'invitations."},{"page_url":"https://cy.wikipedia.org/wiki/Bachadain_brin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sabra_harpagula.jpg","page_title":"Bachadain brin","context_page_description":"Gwyfyn sy'n perthyn i urdd y Lepidoptera yw bachadain brin, sy'n enw benywaidd; yr enw lluosog ydy bachadenydd prin; yr enw Saesneg yw Scarce Hook-tip, a'r enw gwyddonol yw Sabra harpagula. Mae i'w ganfod ledled Ewrop.\\n25–35 mm ydy lled yr adenydd agored ac mae'n hedfan o Fehefin i Awst, yn ddibynol ar ei leoliad.\\nPrif fwyd y lindys ydy Tilia cordata."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%BA%97%E6%98%9F%E9%83%B5%E8%BC%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Star_Pisces_at_Ocean_Terminal%2C_Hong_Kong%2C_from_ferry_pier_2.jpg","page_title":"麗星郵輪","context_page_description":"丽星邮轮，云顶香港旗下的子公司之一，是全世界第十五大的邮轮公司，主要是以亚太地区作为经营领域。作为亚太区领导船队，丽星邮轮以发展亚太区成为国际邮轮目的地为理念，旗下四艘邮轮“双子星号”、“宝瓶星号”、“双鱼星号”及“大班”带领世界各地旅客畅游亚太区景点，并提供亚洲式贴心服务。整个集团的航线遍及亚太区。"},{"page_url":"https://fi.wikipedia.org/wiki/William_Yarrell","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/William_Yarrell._Photograph_by_Maull_%26_Polyblank._Wellcome_V0027361.jpg","page_title":"William Yarrell","context_page_description":"William Yarrell oli englantilainen kirjakauppias ja luonnontieteilijä.\\nYarrellin syntymäkoti oli Duke Streetillä, keskellä Lontoota, jossa hänen isänsä ja setänsä omistivat uutistoimiston. Hän opiskeli Ealingissa ja ryhtyi serkkunsa kanssa hoitamaan isänsä liikeasioita.\\nLuonto oli aina kiinnostanut häntä ja vuonna 1817 hän liittyi Royal Institutioniin. 1825 hän julkaisi ensimmäisen kirjoituksensa On the Occurrence of some Rare British Birds. Kirjoitus julkaistiin Zoological Journalissa, jonka toimittajana hän myohemmin toimi ja hänet valittiin Linnean Societyn jäseneksi. Hänen päätyönsä olivat The History of British Fishes ja The History of British Birds. Jälkimmäinen teos oli aikansa klassikko, josta otettiin useita uusintapainoksia, ja joka oli kokonaisen brittiornitologisukupolven perusteos. Yarrell kuvaili ensimmäisenä pikkujoutsenen.\\nYarrell oli eräs Zoological Society of Londonin perustajista ja toimi seuran sihteerinä 1836–1838. Vuonna 1833 hän oli perustamassa yhdistystä, josta sittemmin tuli Royal Entomological Society of London. Yarrellin kunniaksi on nimetty brasilianvihervarpunen, tarhakolibri ja västäräkin alalaji."},{"page_url":"https://hu.wikipedia.org/wiki/Claude_Monet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Claude_Monet_-_Sailing_Boat%2C_Evening_Effect.jpg","page_title":"Claude Monet","context_page_description":"Claude Oscar Monet francia impresszionista festő."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B8%D1%82%D0%BD%D0%B0_%D0%B2%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Shipot.jpg","page_title":"Питна вода","context_page_description":"Питна вода — вода, в якій бактеріологічні, органолептичні показники та показники токсичних хімічних речовин перебувають в межах норм питного водопостачання:\\nОсновна вимога до органолептичних властивостей води — відсутність неприємного запаху, смаку, кольору.\\nМінералізація води згідно з нормативними вимогами не повинна перевищувати 1 г/дм³, але може бути 1,5 г/дм³ — за погодженням з головним санітарним лікарем відповідної адміністративної території України. В той же час, за показником фізіологічної повноцінності мінерального складу води — оптимальною є мінералізація 0,2-0,5 г/дм³. Для посушливих районів світу вода може вважатися доброю при мінералізації до 1 г/дм³, задовільною — від 1 до 2 г/дм³, допустимою для пиття — від 2 до 2,5 г/дм³, допустимою для пиття в крайніх випадках — від 2,5 до 3,0 г/дм³.\\nТвердість води не повинна перевищувати 7 ммоль/дм³ кількості речовини еквівалента,\\nЗначення рН повинні бути в межах 6,5-8,5,\\nКонцентрація нітратного йону не повинна перевищувати 45-50 мг/дм³.\\nВажливе значення має характеристика мікробіологічного стану П.в."},{"page_url":"https://en.wikipedia.org/wiki/Joni_Mitchell","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Joni_Michtell_pets_Buddy_in_the_oval_office.jpg","page_title":"Joni Mitchell","context_page_description":"Roberta Joan \\"Joni\\" Mitchell CC is a Canadian singer-songwriter. Drawing from folk, pop, rock, and jazz, Mitchell's songs often reflect social and environmental ideals as well as her feelings about romance, confusion, disillusionment, and joy. She has received many accolades, including nine Grammy Awards and induction into the Rock and Roll Hall of Fame in 1997. Rolling Stone called her \\"one of the greatest songwriters ever\\", and AllMusic has stated, \\"When the dust settles, Joni Mitchell may stand as the most important and influential female recording artist of the late 20th century\\".\\nMitchell began singing in small nightclubs in Saskatoon, Saskatchewan, and throughout western Canada, before busking in the streets and nightclubs of Toronto, Ontario. In 1965, she moved to the United States and began touring. Some of her original songs were covered by other folk singers, allowing her to sign with Reprise Records and record her debut album, Song to a Seagull, in 1968. Settling in Southern California, Mitchell, with popular songs like \\"Big Yellow Taxi\\" and \\"Woodstock\\", helped define an era and a generation."},{"page_url":"https://pl.wikipedia.org/wiki/Bozeman","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bozeman_Flag.png","page_title":"Bozeman","context_page_description":"Bozeman - miasto w Stanach Zjednoczonych, w stanie Montana, w hrabstwie Gallatin. Według danych z 2000 roku, miasto miało 27509 mieszkańców."},{"page_url":"https://es.wikipedia.org/wiki/Stephanie_Waring","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Stephanie_Waring.jpg","page_title":"Stephanie Waring","context_page_description":"Stephanie Waring es una actriz inglesa, más conocida por interpretar a Cindy Cunningham en la serie Hollyoaks."},{"page_url":"https://pl.wikipedia.org/wiki/Dortmund_M%C3%B6llerbr%C3%BCcke","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/IMG_6495-Moellerbruecke.JPG","page_title":"Dortmund Möllerbrücke","context_page_description":"Dortmund Möllerbrücke – przystanek kolejowy w Dortmundzie, w kraju związkowym Nadrenia Północna-Westfalia, w Niemczech. Znajdują się tu 2 perony. Według klasyfikacji Deutsche Bahn posiada 5 kategorię."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Lengenwang","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Lengenwang_-_Enisried_-_Kapelle_v_S.JPG","page_title":"Liste der Baudenkmäler in Lengenwang","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Gemeinde Lengenwang zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://pl.wikipedia.org/wiki/Lachine","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Lachine_StsAnges1_tango7174.jpg","page_title":"Lachine","context_page_description":"Lachine – jedna z dziewiętnastu dzielnic Montrealu. Została utworzona w 2002 roku poprzez włączenie do Montrealu miasta Lachine.\\nLiczba mieszkańców Lachine wynosi 41 391. Język francuski jest językiem ojczystym dla 60,4%, angielski dla 21,8% mieszkańców."},{"page_url":"https://pl.wikipedia.org/wiki/Tawu%C5%82ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Astilbe_thunbergii_%C3%96BG_09-07-16_01.jpg","page_title":"Tawułka","context_page_description":"Tawułka – rodzaj roślin należący do rodziny skalnicowatych. Obejmuje 21 gatunków występujących we wschodniej Azji oraz jeden gatunek rosnący we wschodniej Ameryce Północnej w Appalachach. Wiele gatunków i mieszańców między nimi w licznych odmianach uprawianych jest jako rośliny ozdobne."},{"page_url":"https://en.wikipedia.org/wiki/Carex_comans","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Carex_comans_-_Botanischer_Garten%2C_Dresden%2C_Germany_-_DSC08402.JPG","page_title":"Carex comans","context_page_description":"Carex comans is a plant species in the sedge family, Cyperaceae, endemic to New Zealand. It is used as an ornamental plant, growing in clumps of bluish green leaves with heights of 25–35 centimetres."},{"page_url":"https://de.wikipedia.org/wiki/Tempel_des_Ramses_II._von_Abydos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Abydos_Tempel_Ramses_II._24.JPG","page_title":"Tempel des Ramses II. von Abydos","context_page_description":"Der Tempel des Ramses II. von Abydos ist ein im 13. Jahrhundert v. Chr. durch König Ramses II. in der altägyptischen Stadt Abydos errichtetes Millionenjahrhaus, ein vor allem der gottähnlichen Erhebung des Königs dienender Kultbau. Die Ruinen des Tempels befinden sich am Südwestrand des heutigen Siedlungsgebietes von Arāba el-Madfūna und etwa 270 Meter nordwestlich des Totentempels Sethos’ I., des Vaters Ramses’. Die altägyptische Stätte Abydos liegt im Gouvernement Sauhadsch, etwa 45 Kilometer südöstlich des Verwaltungszentrums Sohag und 90 Kilometer nordwestlich von Luxor. Der Tempel Ramses’ II. war der abydenischen Triade, den Göttern Osiris, Isis und Horus, sowie einigen Gastgöttern und dem Königskult gewidmet."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%BD%E5%85%8B%E8%B5%AB%E8%90%8A%E5%85%8B%E5%B1%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Stuhleck.jpg","page_title":"施克赫萊克山","context_page_description":"施克赫莱克山，是奥地利的山峰，位于该国东部，由施泰尔马克州负责管辖，属于拉克斯-施内山脉的一部分，距离特拉滕科格尔山1.8公里，海拔高度1,535米。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A8%E1%83%94%E1%83%93%E1%83%90%E1%83%93%E1%83%98%E1%83%90%E1%83%9C%E1%83%94%E1%83%91%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Shaddadid.gif","page_title":"შედადიანები","context_page_description":"შედადიანები — ქურთული წარმოშობის ფეოდალური დინასტია არანსა და სომხეთში. დააარსა მუჰამად იბნ შედადმა, რომელიც დვინში გაბატონდა. განძაში შედადიანების ძირითადი შტო მართავდა ქვეყანას X საუკუნის 70-იანი წლებიდან 1075 წლამდე, ვიდრე სელჩუკები დაიპყრობდნენ. 1199 წელს ანისის საქართველოსთან შეერთების შემდეგ, შედადიანების დინასტიამ არსებობა შეწყვიტა."},{"page_url":"https://en.wikipedia.org/wiki/G%C3%A9nissac","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Genissac_Mairie.JPG","page_title":"Génissac","context_page_description":"Génissac is a commune in the Gironde department in southwestern France."},{"page_url":"https://pl.wikipedia.org/wiki/Lanquetot","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Lanquetot_%28Seine-Mar.%29_mairie.jpg","page_title":"Lanquetot","context_page_description":"Lanquetot – miejscowość i gmina we Francji, w regionie Normandia, w departamencie Sekwana Nadmorska.\\nWedług danych na rok 1990 gminę zamieszkiwało 1000 osób, a gęstość zaludnienia wynosiła 196 osób/km²."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D9%86%D8%A7%D8%AB%D8%A7%D9%86_%D9%81%D8%B1%D9%8A%D9%85%D8%A7%D9%86_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D8%A9_%D9%82%D8%AF%D9%85_%D8%A3%D8%B3%D8%AA%D8%B1%D8%A7%D9%84%D9%8A%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Jono_Freeman_2019.1.jpg","page_title":"جوناثان فريمان (لاعب كرة قدم أسترالية)","context_page_description":"جوناثان فريمان ‏ هو لاعب كرة قدم أسترالية أسترالي، ولد في 27 أبريل 1994."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%90%E1%83%A0%E1%83%A5%E1%83%94%E1%83%9B%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/07._Camel_Profile%2C_near_Silverton%2C_NSW%2C_07.07.2007.jpg","page_title":"არქემი","context_page_description":"არქემი — მანკორალი ბჟაშუმუეფიშ გვარიშ ჩხოლარი არქემიშობურეფიშ ფანიაშე.\\nსულხან-საბა ორბელიანი ეთმენწყუნს გეჸვენჯიშობურო:\\nჩინებული რე არქემიშ ჟირი გვარობა:\\nდრომედარი — ართპუხუამი არქემი.\\nბაქტრიანი — ჟირპუხუამი არქემი.\\nტყარ ორთას ხვალე ჟირპუხუამი არქემი რე ასქილადირი. არქემი ხვალე ტიოზიშ დო სქირე სტეპიშ ზონეფს რე გოფაჩილი. თი ჩანარეფს ჭკომუნს, ნამუეფსჷთ შხვა მანკორალეფი ვაჭკომჷნან. შუნს ჭიჭე წყარს, კანკალეშა ჯიმუამს ხოლო. დიდხანს შეულებუ უწყარეთ გარზება. არქემიშ პუხუს იშაყარუ ოხაზჷრე ციმუ, მუსჷთ ჩხოლარი ოჭკომალიშ ნარკულობას გჷმირინუანს. რსხულიშ ნორთეფი, ნამუშჷთ ნჯირაშ ბორჯის დიხას ოხჷნ, ფორილი აფჷ სქელი კორძახით. თეშ გეშა არქემს შეულებჷ გოვარვალაფირ დიხას უნებელო ნჯირა. რსხული ოპონჷ ფართე ლიბუ თვათეფს, ნამუთ ქვიშას ყარაფის ულექინანს. მიარე აბანს არქემი დოჭყანაფილი რე დო გიმორინაფილი რე ოფუტე-ომეურნე ჩხოლარო. ძინათებული არქემიშ მასა 500-800 კილოგრამიე. ართპუხუამი არქემიშ მაკობა იგჷნძორებუ 13 თუთას, ჟირპუხუამიშ — 14. ხანს ართ კოზაკის. არქემი ჭყანიერი ოზაპანე დო ასქუაფალი ჩხოლარი რე. შეულებჷ ოჭიშით იღას დორხველური წონაშ 50%-შახ ორზოლი, თირხონით შეულებჷ ართ დღას 100 კილომეტრაშახ იდასჷნ. თელარენს 35-40 წანას. ოხანდეთ გიმირინუანა 4-25 წანაშ ხანს. ირზენს ბჟას, ხორცის, მონტყორს."},{"page_url":"https://pt.wikipedia.org/wiki/Lachin","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Azerbaijan-Lachin.png","page_title":"Lachin","context_page_description":"Lachin é um dos cinquenta e nove rayones nos que subdivide politicamente a República do Azerbaijão. A capital se encontra na cidade de Lachin."},{"page_url":"https://de.wikipedia.org/wiki/Alcoba%C3%A7a_(Portugal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Alcobaca_%28freguesia%29.png","page_title":"Alcobaça (Portugal)","context_page_description":"Alcobaça ist eine Stadt in Portugal mit 5699 Einwohnern. Sie liegt in der Unterregion Oeste und gehört zur historischen Provinz Estremadura.\\nObgleich etwa 10 km entfernt vom Atlantik liegend, durchfließt der Fluss Alcoa die Stadt nur in Höhe von wenigen Metern über dem Meeresspiegel, noch im frühen Mittelalter reichte das Meer als Lagune von Pederneira bis zu den Toren Alcobaças bei Fervenca. Die Stadt hat eine Fläche von 3,1 km². Alcobaça ist Sitz des gleichnamigen Kreises mit 56.688 Einwohnern und einer Fläche von 408,2 km², die sich zwischen dem Atlantik und dem bis zu 613 m hohen Gebirge Serra de Candeeiros erstreckt. Dieses Gebiet entspricht zusammen mit dem von ihm umschlossenen Nachbarkreis Nazaré sowie Teilen des südlich angrenzenden Kreises Caldas da Rainha der historischen Schenkung des ersten Königs Portugals Afonso Henriques an den Zisterzienser-Abt Bernhard von Clairvaux im Jahre 1153, aus der die Königliche Abtei von Alcobaça mit den Coutos de Alcobaça als ihrem weltlichen Herrschaftsgebiet entstanden sind.\\nAlcobaça erhielt das moderne Stadtrecht im Jahre 1995."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_hidr%C3%B3geno","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Hidrogenera_Zaragoza_6.jpg","page_title":"Estación de hidrógeno","context_page_description":"Una estación de hidrógeno, hidrogenera\\no hidrolinera ​ es una estación de servicio o almacenamiento para el hidrógeno que lo dispensa, ya sea en pilas de combustible o como materia prima, usualmente localizada a las orillas de carreteras y/o autopistas. Los vehículos de hidrógeno lo usan como combustible de diferentes maneras, incluyendo en celdas de combustible o directamente por combustión. Este es surtido por kilogramos a través de un surtidor de hidrógeno.​\\nEs un concepto relativamente nuevo, ​ puesto que las pilas de hidrógeno parecen ser la fuente de energía alternativa al petróleo. Se pretende que cuando los medios de transporte usen pilas de combustible en sustitución del gasóleo o gasolina puedan surtirse de hidrógeno en hidrogeneras.\\nHoy en día es casi un concepto futurista, pero dado que las nuevas tecnologías energéticas están a la orden del día, resulta que se está haciendo un término más usado. Se espera que las estaciones de servicio vayan poco a poco reemplazando los combustibles fósiles basados en el petróleo por el hidrógeno para las pilas de combustible."},{"page_url":"https://en.wikipedia.org/wiki/Government_of_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Cleveland_City_Hall_in_2012.jpg","page_title":"Government of Ohio","context_page_description":"The government of the U.S. state of Ohio consists of the executive, judicial, and legislative branches. Its basic structure is set forth in the Constitution and law of Ohio."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8A%A0%E8%96%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Flickr_-_Israel_Defense_Forces_-_Gaza_Buildings_%281%29.jpg","page_title":"加薩","context_page_description":"加沙是加沙地带以及巴勒斯坦人地区的最大城市，同时也是巴勒斯坦国加沙省的首府。面积74平方公里，人口449,221人，周边人口160万。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1977","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/AyhanAkman.jpg","page_title":"Lijst van personen geboren in 1977","context_page_description":"Dit is een lijst van personen die geboren zijn in 1977.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B8%D0%BB%D0%B4%D0%B8%D0%BD_%D0%BA%D0%BB%D1%83%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Gilda%27s_Club_Seattle.jpg","page_title":"Гилдин клуб","context_page_description":"Гилдин клуб непрофитна је хуманитарна организација за особе оболеле од рака, њихове породице и пријатеље, са седиштем у САД. Локални огранци организације пружају оболелима од рака, њиховим породицама и пријатељима места за дружење, где могу да се упознају са другима који имају сличне проблеме и тако буду емотивна и социјална подршка једни другима, поред стандардне медицинске неге. Бесплатна и непрофитна организација за пружање помоћи Гилдин клуб има своје огранке којима се пружа подршка и омогућава умрежавање заједница људи, одржавање предавања, вођење радионица и организовање друштвених манифестација у неформалном окружењу налик дому. Клуб је добио име у част оригиналног члана глумачке поставе у забавном шоуу Уживо суботом увече — комичарке и глумице Гилде Раднер, која умрла од рака јајника. Организација је позната и под именом Заједница за подршку оболелима од рака, осим у Канади где су локални огранци задржали оригинално име Гилдин клуб."},{"page_url":"https://en.wikipedia.org/wiki/Bowlditch_Quarry","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Bowlditch_quarry.jpg","page_title":"Bowlditch Quarry","context_page_description":"Bowlditch Quarry is a 0.25 hectare geological Site of Special Scientific Interest near the village of Clandown, Bath and North East Somerset, notified in 1952.\\nThe site provides a remarkable attenuated and broken succession stretching from the top of the Rhaetian to the lowest Pliensbachian periods. This Lias section provides a good example of biostratigraphic principles."},{"page_url":"https://no.wikipedia.org/wiki/Olav_Gurvin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/OlavGurvin-OB.F05895b.jpg","page_title":"Olav Gurvin","context_page_description":"Olav Gurvin var en norsk musikkviter, som ble Norges første professor i musikkvitenskap."},{"page_url":"https://fr.wikipedia.org/wiki/Anime_Expo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Cosplayers_of_Saint_Seiya_at_Anime_Expo_2016-07-01.jpg","page_title":"Anime Expo","context_page_description":"Anime Expo, en abrégé AX, est une convention d'anime américaine organisée à Los Angeles, en Californie, par la société à but non lucratif Society for the Promotion of Japanese Animation. À de rares exceptions près, la convention a traditionnellement lieu le premier week-end de juillet, qui coïncide généralement avec le 4 juillet, et dure quatre jours. Par le passé, l'Anime Expo a déjà eu lieu à Anaheim, San José, New York et Tokyo, mais se déroule à l'heure actuelle au Los Angeles Convention Center. Elle est la plus grande convention d'anime nord-américaine en 2017."},{"page_url":"https://fr.wikipedia.org/wiki/Anime_Expo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Cosplayers_of_Saint_Seiya_at_Anime_Expo_2016-07-01.jpg","page_title":"Anime Expo","context_page_description":"Anime Expo, en abrégé AX, est une convention d'anime américaine organisée à Los Angeles, en Californie, par la société à but non lucratif Society for the Promotion of Japanese Animation. À de rares exceptions près, la convention a traditionnellement lieu le premier week-end de juillet, qui coïncide généralement avec le 4 juillet, et dure quatre jours. Par le passé, l'Anime Expo a déjà eu lieu à Anaheim, San José, New York et Tokyo, mais se déroule à l'heure actuelle au Los Angeles Convention Center. Elle est la plus grande convention d'anime nord-américaine en 2017."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B9%E0%B2%B3%E0%B2%A6%E0%B2%BF%E0%B2%97%E0%B2%B2%E0%B3%8D%E0%B2%B2%E0%B2%A6_%E0%B2%95%E0%B2%B3%E0%B3%8D%E0%B2%B3%E0%B2%BF%E0%B2%AA%E0%B3%80%E0%B2%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/MeropsApiasterGould.jpg","page_title":"ಹಳದಿಗಲ್ಲದ ಕಳ್ಳಿಪೀರ","context_page_description":"ಹಳದಿಗಲ್ಲದ ಕಳ್ಳಿಪೀರ ವು ಬೀ-ಈಟರ್ ಕುಟುಂಬ ಮೆರೊಪಿಡೆ ಗೆ ಸೇರಿದ ಹಕ್ಕಿಯಾಗಿದೆ. ಇದು ದಕ್ಷಿಣ ಯೂರೋಪ್ನಲ್ಲಿ ಮತ್ತು ಉತ್ತರ ಆಫ್ರಿಕಾ ಮತ್ತು ಪಶ್ಚಿಮ ಏಷ್ಯಾದ ಕೆಲವು ಭಾಗಗಳಲ್ಲಿ ಸಂತಾನೊತ್ಪತ್ತಿ ಮಾಡುತ್ತದೆ. ಇದು ಉಷ್ಣವಲಯದ ಆಫ್ರಿಕಾಕ್ಕೆ ಚಳಿಗಾಲದ ವಲಸೆಗಾರ. ಮತ್ತು ವಾಯುವ್ಯ ಯುರೋಪ್ನಲ್ಲಿ ಸಾಂದರ್ಭಿಕ ಸಂತಾನವೃದ್ಧಿ ಮಾಡುವುದು ಕಂಡುಬಂದಿದೆ."},{"page_url":"https://fr.wikipedia.org/wiki/Mercedes-Benz_Classe_M","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/AA_Vision.jpg","page_title":"Mercedes-Benz Classe M","context_page_description":"La Mercedes-Benz Classe M est un SUV développé par Mercedes-Benz de 1997 à 2015."},{"page_url":"https://es.wikipedia.org/wiki/Niangoloko_(departamento)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Niangoloko_Forest_Fluss_WP30_SDr9659.JPG","page_title":"Niangoloko (departamento)","context_page_description":"Niangoloko es un departamento de la provincia de Comoé, en la región Cascades, Burkina Faso. A 1 de julio de 2018 tenía una población estimada de 86 217 habitantes.​\\nSe encuentra ubicado en la zona suroccidental del país, cerca de la frontera con Malí y Costa de Marfil."},{"page_url":"https://cs.wikipedia.org/wiki/Pardubice","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Tyr%C5%A1ovy_sady_07.JPG","page_title":"Pardubice","context_page_description":"Pardubice jsou univerzitní a statutární město na východě Čech, metropole Pardubického kraje s výraznou správní, obytnou, obslužnou a výrobní funkcí pardubicko-hradecké aglomerace. Leží ve východní části Polabí na soutoku řek Labe a Chrudimky, přibližně 100 kilometrů východně od Prahy a 20 km jižně od Hradce Králové v nadmořské výšce přibližně 220 metrů.\\nPardubice mají přibližně 92 tisíc obyvatel a jsou tak desátým největším městem Česka, jsou také největším městem Pardubického kraje i okresu Pardubice. Výměra území města je 82,7 km². Pardubice se dělí na 8 samosprávných městských obvodů a 20 katastrálních území. První dochovaná zmínka o existenci Pardubic pochází z roku 1295, k roku 1340 jsou už připomínány jako město. Největší rozkvět prodělaly za pánů z Pernštejna. Na konci 16. století a v 17. století nastal úpadek. Nový rozvoj města přišel od poloviny 19. století s připojením města na železnici. Vznikla zde řada průmyslových podniků jako lihovar, cukrovar, továrna na mlýnské stroje, Fantova rafinérie minerálních olejů a další. Po druhé světové válce došlo k masivní výstavbě nových čtvrtí především na okraji města a počet obyvatel se rychle zdvojnásobil."},{"page_url":"https://de.wikipedia.org/wiki/Harald_Haacke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Skulptur_Unter_den_Linden_4_%28Mitte%29_Mutter_mit_totem_Sohn%26K%C3%A4the_Kollwitz%261993.jpg","page_title":"Harald Haacke","context_page_description":"Harald Haacke war ein deutscher Bildhauer, Medailleur. Er war auf Nachschöpfungen im Dienst der Denkmalpflege spezialisiert."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BE%D0%B1%D1%87%D0%B0%D1%82%D0%B8%D0%B9_%D0%B7%D0%BC%D1%96%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Hargrave-demo.jpg","page_title":"Коробчатий змій","context_page_description":"Коробчатий змій — повітряний змій, побудований у вигляді коробки. Винайдений австралійським інжннером і винахідником Лоуренсом Харгрейвом у 1895 році.\\nМоделі цього типу зміїв зазнали розвитку на рубежі XIX і XX століть, ставши прототипами пізніших конструкцій."},{"page_url":"https://it.wikipedia.org/wiki/Nearco_(ceramista)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Terracotta_aryballos_%28oil_flask%29_MET_DP218738.jpg","page_title":"Nearco (ceramista)","context_page_description":"Nearco è stato un ceramografo e ceramista greco antico, attivo nel quartiere del Ceramico tra il 570 e il 555 a.C. circa. Ci restano otto esemplari della sua firma che lo indicano sia come vasaio sia come ceramografo.\\nÈ contemporaneo di Kleitias, ma nonostante la tendenza al particolare minuto e alla precisione del dettaglio, Nearco predilige le grandi dimensioni e la monumentalità dello stile rappresentativo che prepara al lavoro di Exekias nel terzo quarto del VI secolo a.C. La sua attività verrà portata avanti dai figli Tleson e Ergotiles, che firmeranno soprattutto piccole coppe nello stile dei Piccoli maestri, dei quali Tleson fu uno degli esponenti maggiori."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_d%27Estouteville","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/200506_-_Mont_Saint-Michel_12.JPG","page_title":"Louis d'Estouteville","context_page_description":"Louis d’Estouteville, né avant 1400 et mort en 1464, seigneur de Valmont sieur d’Ausebecq, est un militaire français, qui fut capitaine du Mont-Saint-Michel et gouverneur de Normandie."},{"page_url":"https://en.wikipedia.org/wiki/Demographics_of_the_Czech_Republic","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Hradschin_Prag.jpg","page_title":"Demographics of the Czech Republic","context_page_description":null},{"page_url":"https://en.wikipedia.org/wiki/Limes_(Roman_Empire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Fossatum.png","page_title":"Limes (Roman Empire)","context_page_description":"Limes is a modern term used primarily for the Germanic border defence or delimiting system of Ancient Rome marking the Borders of the Roman Empire, but it was not used by the Romans for this purpose. The term has been extended to refer to the frontier defences in other parts of the empire, such as in the east and in Africa.\\nThe Limes is often associated with Roman forts, but the concept could apply to any adjoining area the Romans exercised loose control with military forces."},{"page_url":"https://de.wikipedia.org/wiki/Altes_Brauhaus_(Rothenburg_ob_der_Tauber)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Brauhaus_.jpg","page_title":"Altes Brauhaus (Rothenburg ob der Tauber)","context_page_description":"Das Alte Brauhaus ist ein historisches Gebäude im Stadtkern von Rothenburg ob der Tauber."},{"page_url":"https://pl.wikipedia.org/wiki/Kr%C3%B3lowe_Kastylii_i_Le%C3%B3nu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/D._Constan%C3%A7a_de_Portugal%2C_Rainha_Consorte_de_Castela_-_The_Portuguese_Genealogy_%28Genealogia_dos_Reis_de_Portugal%29.png","page_title":"Królowe Kastylii i Leónu","context_page_description":"Dalsze królowe Kastylii i Leónu zobacz: Hiszpańskie królowe."},{"page_url":"https://de.wikipedia.org/wiki/Tischfernsprecher_W_48","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Grundplatte_W48_mT_Sz.jpg","page_title":"Tischfernsprecher W 48","context_page_description":"Der Tischfernsprecher W 48 war – nach dem vom Hersteller SABA nur kurz produzierten Tischfernsprecher W 46 – das zweite deutsche Nachkriegstelefon, das 1948 für die Deutsche Post in den westlichen Besatzungszonen entwickelt und in sehr großen Stückzahlen gefertigt wurde.\\nWie auch bei den Vorgängermodellen Modell 36 und dem Tischfernsprecher W 38 waren Siemens & Halske maßgeblich an seiner Konstruktion beteiligt. Prinzipiell ist der W 48 lediglich eine Weiterentwicklung des W 38 der Deutschen Reichspost. Der W 48 ist heute für viele Sammler und Liebhaber zum Klassiker unter den deutschen Fernsprechern und zum Inbegriff des „alten Fernsprechers“ geworden."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_klokkenstoelen_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Idzega_Klokkenstoel_0485.JPG","page_title":"Lijst van klokkenstoelen in Nederland","context_page_description":"Lijst van klokkenstoelen in Nederland geeft een overzicht van vrijstaande klokkenstoelen in Nederland.\\nKlokkenstoelen als vrijstaand bouwwerk worden ingedeeld in twee typen:\\nKlokkenstoel als open constructie\\nKlokhuis, een dicht bouwwerk."},{"page_url":"https://no.wikipedia.org/wiki/Voll_kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Voll_kirke_interi%C3%B8r.jpg","page_title":"Voll kirke","context_page_description":"Voll kirke ligger i Måndalen i Rauma kommune. Den er en del av Den norske kirke og hører til Indre Romsdal prosti i Møre bispedømme.\\nKirken ble bygd i 1896 og restaurert i 1964.\\nI 2013 ble det gjennomført en ny, omfattende, utvendig renovering av kirken."},{"page_url":"https://de.wikipedia.org/wiki/Timmendorfer_Strand","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/2018-06_Jazz_Baltica_01.jpg","page_title":"Timmendorfer Strand","context_page_description":"Timmendorfer Strand ist eine Gemeinde im Kreis Ostholstein in Schleswig-Holstein. Neben dem Hauptort gibt es die beiden Dorfschaften Groß Timmendorf mit den Wohnplätzen Groß Timmendorf und Oeverdiek sowie Hemmelsdorf mit den Wohnplätzen Hemmelsdorf, Hainholz und Nothweg. Zur Gemeinde gehört außerdem der Ortsteil Niendorf.\\nAls deutsches Seebad hat Timmendorfer Strand heute etwa 1.500.000 Übernachtungen pro Jahr und gilt als eines der mondänsten Ostseebäder mit großem touristischem Angebot."},{"page_url":"https://sl.wikipedia.org/wiki/Grad_v_Hunedoari","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Burg_Vajad_Hunyad_%28Rumaenien%29.jpg","page_title":"Grad v Hunedoari","context_page_description":"Grad v Hunedoari, znan tudi kot Hunyadijev ali Korvinov grad, je gotsko-renesančni grad v Hunedoari v Romuniji. Je eden največjih gradov v Evropi in na seznamu sedmih čudes Romunije."},{"page_url":"https://en.wikipedia.org/wiki/Shelina_Zadorsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Shelina_Zadorsky_2016_Olympics_%28cropped%29.jpg","page_title":"Shelina Zadorsky","context_page_description":"Shelina Laura Zadorsky is a Canadian soccer player who plays as a defender for Tottenham Hotspur in the English FA Women's Super League, on loan from NWSL team Orlando Pride, and the Canada women's national soccer team. She previously played for Australian W-League club Perth Glory and Swedish top-division club Vittsjö GIK. Zadorsky won a bronze medal with Canada at the 2016 Rio Olympics."},{"page_url":"https://pl.wikipedia.org/wiki/Ludovic_Stewart","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Ludovic2ndDukeOfLenox.jpg","page_title":"Ludovic Stewart","context_page_description":"Ludovic Stewart, 2. książę Lennox i 1. książę Richmond, szkocki arystokrata, najstarszy syn Esmé Stewarta, 1. księcia Lennox, i Catherine de Balsac, córki Guillaume de Balsaca, pana d'Entragues et Marcoussins.\\nPo śmierci ojca w 1583 r. został parem Szkocji jako 2. książę Lennox. Był jednym z najbliższych współpracowników króla Jakuba VI, od 1603 r. króla Anglii Jakuba I. Pod jego nieobecność Lennox sprawował władzę w Szkocji. Za jego rządów stłumiono opozycję, uporano się z rozbójniczymi klanami Armstrongów i MacGregorów, i poddano władzy królewskiej niespokojną północ, przywracając po raz kolejny podległość Hebrydów i Orkadów koronie. Sytuacja w Szkocji została na dłuższy czas uspokojona.\\nKról odwdzięczał się Lennoxowi nadawaniem mu różnych godności. W 1613 r. Lennox został parem Anglii jako hrabia Richmond. W 1623 r. tytuł ten został podniesiony do rangi księcia. Od 1617 r. książę był Custos Rotulorum Kentu, a od 1620 r. Lordem Namiestnikiem Kentu. W 1607 r. był Lordem Wysokim Komisarzem przy Parlamencie Szkocji. Uczestniczył również w kolonizacji Maine w Ameryce Północnej."},{"page_url":"https://fr.wikipedia.org/wiki/Barrage","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Givet_-_Barrage_%C3%A0_vannes_clapet_-1.jpg","page_title":"Barrage","context_page_description":"Un barrage est un ouvrage d'art construit en travers d'un cours d'eau et destiné à en réguler le débit et/ou à stocker de l'eau, notamment pour le contrôle des crues, l'irrigation, l'industrie, l'hydroélectricité, la pisciculture, une réserve d'eau potable, etc. Dans la nature, il existe aussi des barrages de castors."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%80%86%E8%8B%B1%E8%99%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Illustrated_London_News_-_1_April_1848.jpg","page_title":"耆英號","context_page_description":"耆英号是中国清朝时期的一艘中国帆船，原为一艘往来于广州与南洋之间贩运茶叶的商船。后于1846年至1848年期间，曾经从香港出发，经好望角及美国东岸到达英国，创下中国帆船航海最远的纪录。耆英号以柚木制成，有三面帆，排水量达800吨。耆英号以时任两广总督耆英命名。它引起了西方很大注意，因为它向工业化刚刚起步的西方展示了中国当时的航海及造船能力。\\n耆英号在1846年由一位英国商人秘密购买，这打破了当时中国有关不得出售中国船只予外国人的法律。该船船员包括30名中国人及12名英国水手，并由英国船长查尔斯·阿尔佛雷德·奥克兰·凯勒特指挥。船上还有一位自称四品官员的中国人希生，从油画上观察此人为金顶蓝雀补子估计为九品笔帖式或捐官县主簿衔。\\n耆英号于1846年12月6日驶离香港。\\n1847年3月抵达好望角。\\n1847年4月16日于圣赫勒拿岛停留。\\n1847年7月抵达纽约。\\n1847年11月访问波士顿。\\n1848年4月到达英国。\\n自2005年9月起位于香港赤柱的香港海事博物馆有其大尺寸模型船展出，于2013年2月26日香港海事博物馆迁移至中环8号码头。"},{"page_url":"https://en.wikipedia.org/wiki/SEAT_128","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/SEAT_128.jpg","page_title":"SEAT 128","context_page_description":"The SEAT 128 is a 3-door hatchback coupé from the Spanish automaker SEAT launched in 1976. Being essentially the three-door hatchback version of the Fiat 128, it was available with two engine options in Spain, the 1.2L and the more powerful and well-known 1430 engine. The design of the SEAT 128 was made in Spain by SEAT engineers, and was marketed as \\"Three Times SEAT\\" in order to underline its triple combination ability of sportiness, versatility and design. The car was aimed at rich, young drivers, however, the 128 never enjoyed great commercial success, since in a period of economic recession and transition in Spain most people opted for the smaller, less expensive SEAT 127."},{"page_url":"https://de.wikipedia.org/wiki/Maserati_GranCabrio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/2010_Maserati_GranCabrio_-_yellow_-_fvr.jpg","page_title":"Maserati GranCabrio","context_page_description":"Das Maserati GranCabrio ist ein Cabriolet des italienischen Automobilherstellers Maserati. Auf der Internationalen Automobil-Ausstellung im September 2009 in Frankfurt am Main hatte es seine Weltpremiere."},{"page_url":"https://ceb.wikipedia.org/wiki/Menticirrhus","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Menticirrhus_americanus2.jpg","page_title":"Menticirrhus","context_page_description":"Henero sa mga isda ang Menticirrhus. Ang Menticirrhus sakop sa kabanay nga Sciaenidae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://en.wikipedia.org/wiki/Lower_Post","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Girl_in_jacket_-_Kaska_-_Lower_Post_BC_1945.jpg","page_title":"Lower Post","context_page_description":"Lower Post is an aboriginal community in northern British Columbia, Canada, located on Highway 97, the Alaska Highway, approximately 15 miles southeast of Watson Lake, Yukon. Its historical mile designation is Mile 620. It is located near the confluence of the Dease and Liard Rivers."},{"page_url":"https://hu.wikipedia.org/wiki/Paulini_B%C3%A9la","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Baj057.JPG","page_title":"Paulini Béla","context_page_description":"Paulini Béla János magyar író, újságíró, illusztrátor."},{"page_url":"https://eu.wikipedia.org/wiki/Kadmio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Cadmium-crystal_bar.jpg","page_title":"Kadmio","context_page_description":"Kadmioa elementu kimiko bat da, Cd ikurra eta 48 zenbaki atomikoa dituena. Trantsizio-metal arraro samarra da, biguna eta urdin-zurixka. Bateriatan eta pigmentuetan erabiltzen da, esaterako produktu plastikoetan. Minbizia eragiten du.\\nIngurugiroan zinkari, kobreari eta berunari asoziaturik eta forma naturalean aurki daiteke metal astun hau. Toxikotasunaren aldetik, kadmioa industriako substantzia kutsatzaile garrantzitsuenetakoa da, urteak pasa ahala gehiago zabaldu dena eta horrez gain osasunean lesio larriak eragiteko gaitasuna duena, gure gorputzaren iraizteko gaitasun ezagatik. Substantzia toxikoen eta gaixotasunen miaketan lan egiten duen Estatu Batuetako agentzia batek berunarekin, merkurioarekin eta artsenikoarekin batera konposatu arriskutsuenen artean sailkatu du, bostgarren postuan sailkatuz. Hori dela eta garrantzia toxikologikodun minerala da.\\nAirearen bidez isuri den lekutik distantzia handiak egin ditzake, organismo ezberdinentan pilatuz."},{"page_url":"https://it.wikipedia.org/wiki/Corona_della_regina_Maria","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/KingGeorgeV_QueenMary_Coronation1911.png","page_title":"Corona della regina Maria","context_page_description":"Testo in grassetto\\nLa corona della regina Maria è una corona realizzata nel 1911 per Maria di Teck, regina consorte del re Giorgio V del Regno Unito.\\nLa corona, prodotta da Garrard & Co. a Londra, contiene circa 2.200 diamanti. Conteneva anche il celebre diamante Koh-i-Noor ed i diamanti Cullinan III e Cullinan IV. Nel 1914 sono stati sostituiti da repliche in cristallo."},{"page_url":"https://en.wikipedia.org/wiki/Polmak_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Polmak_kirke.JPG","page_title":"Polmak Church","context_page_description":"Polmak Church is a parish church of the Church of Norway in Deatnu-Tana Municipality in Troms og Finnmark county, Norway. It is located in the village of Polmak, just east of the border with Finland. It is one of the churches for the Tana parish which is part of the Indre Finnmark prosti in the Diocese of Nord-Hålogaland. The white, wooden church was built in a long church style in 1853 by the architect J.H. Nebelong. The church seats about 120 people.\\nIn 2014, the former parish of Polmak was merged into the parish of Tana. Prior to that time, Polmak parish was made up of one church, after the merger, the new Tana parish included three churches."},{"page_url":"https://pl.wikipedia.org/wiki/Albert_Bouts","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Albert_bouts-cristo.jpg","page_title":"Albert Bouts","context_page_description":"Albert Bouts lub Aelbrecht Bouts – niderlandzki malarz.\\nPochodził z rodziny o tradycjach artystycznych. Był synem malarza Dirka Boutsa i młodszym bratem innego malarza, Dirka Boutsa młodszego, którego syn Jan Bouts również wykonywał ten sam zawód. Po śmierci ojca Dirka Boutsa starszego jego warsztat przejął Dirk młodszy, a Albert w 1475 roku wyjechał na naukę, prawdopodobnie do pracowni Hugo van der Goesa w Gandawie, a następnie założył własną pracownię w rodzinnym Leuven. W dokumentach z 1524 roku Bouts wymieniany jest jako przewodniczący miejscowej gildii malarzy.\\nRozwinął własny styl charakteryzujący się mocnymi kolorami, bogatą teksturą, dbałością o szczegóły i typowo niderlandzkim realizmem. Specjalizował się głównie w niewielkich obrazach o tematyce religijnej, przeznaczonych do małych prywatnych ołtarzy donatorów. Jednym z częstszych podejmowanych przez niego tematów była scena ze św. Hieronimem pogrążonym w modlitwie lub przedstawionym jako penitent – klęczący pustelnik z krucyfiksem.\\nBył dwukrotnie żonaty. W 1481 roku poślubił Marię Coocx, a w 1491 Elisabeth Nausnyders."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%83%8F%E5%AD%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Migration_route_of_Wusun_in_Western_Han_Dynasty.png","page_title":"烏孫","context_page_description":"乌孙国是西汉时由游牧民族乌孙在西域建立的行国，位于巴尔喀什湖东南、伊犁河流域，立国君主是猎骄靡。\\n乌孙国首领称为“昆莫”或“昆弥”。西汉文帝时，被匈奴击溃的月氏攻击乌孙的牧地，乌孙族大败，昆莫难兜靡被杀害。匈奴冒顿单于收留乌孙余部，孙儿军臣单于约于前113年指派猎骄靡率领乌孙远征伊犁河、楚河流域的大月氏，乌孙军大获全胜，随后猎骄靡在那里建立了一个国家，以族名命名为乌孙国。匈奴通过乌孙间接控制了从伊犁河流域西抵伊朗高原的交通线。虽然军臣单于死后，乌孙国便“不肯复事匈奴”，但是很长时间内一直羁属匈奴。乌孙国曾经是西域最强大的国家，后来与西汉建交，西汉宣帝时分裂为二，5世纪为柔然所灭。\\n前苏联学者认为乌孙文化是操印欧语系的塞人文化的继承和发展，并称塞－乌孙文化，乌孙文化时期是前300年－300年。亦有其他外国学者进行考古研究时为塞克文化及乌孙文化定下时限。中国新疆社会科学院历史研究所的学者推断在先秦时期乌孙自号“昆”，是一个古老的西戎部落，春秋战国时代与月氏游牧于河西走廊。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%A9%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/DorsetCresentGarden_FicusMicrocarpa_KC1.jpg","page_title":"義德","context_page_description":"義德，JP，香港保險業商人，1908年至1924年間任廣州於仁保險公司總司理，曾於1911年、1913年和1924年三度暫任立法局非官守議員，另在1922年和1924年兩度暫任行政局非官守議員。位於九龍塘的花園城市，最先由義德主持下於1920年代開發。\\n義德在1884年至1924年間任職於於仁保險，在1908年出任總司理前，曾先後在香港、上海、華北和日本橫濱各地的分行任職，在華期間，他曾經在1900年至1902年、以及在1903年至1904年，兩度出任上海公共租界工部局董事，此外又嘗任兩江總督和四川督軍的私人顧問。\\n義德在1908年出任於仁保險總司理後定居香港，在港期間曾參與創辦香港大學，是港大的創校校董之一。他在香港最為後人熟知的事蹟，是在1920年代於九龍塘主持建造英式花園城市。工程在1922年展開，目標投放300萬港元，在80英畝土地上建造約250所花園洋房和其他像遊樂場和學校的配套設施。然而，工程在義德於1925年病逝後陷入困難，最後經港府和富商何東爵士等人出資介入下，工程才於1930年竣工。港府後來為紀念義德對開發九龍塘立下的貢獻，把區內一條道路命名為義德道。"},{"page_url":"https://ca.wikipedia.org/wiki/Armand_de_Gramont","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Portrait_painting_of_Guy_Armand_de_Gramont_Count_of_Guiche_by_an_unknown_artist.jpg","page_title":"Armand de Gramont","context_page_description":"Armand de Gramont, comte de Guiche fou un militar francès, era fill del també militar Antoni III de Gramont i germà del polític Antoni Charles.\\nFou desterrat de la cort pels seus regals a Enriqueta d'Anglaterra, esposa del germà de Lluís XIV"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BB%D0%B0%D0%B2%D0%B8%D1%87%D0%B5%D0%BA,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Antonin_Slavicek_-_cervnovy_den_%281898%29.jpg","page_title":"Славичек, Антонин","context_page_description":"Антонин Славичек — чешский художник."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%96%B0%E5%B1%B1%E4%B8%9C%E9%83%A8%E7%96%8F%E6%95%A3%E5%A4%A7%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Food_court_%28malaysia%29.jpg","page_title":"新山东部疏散大道","context_page_description":"新山東部疏散大道，即EDL，簡稱新山東疏大道或東疏大道，是馬來西亞柔佛新山的一條高速公路。8.1 km長的高速公路銜接南北大道南段的班蘭至市中心的蘇丹依斯干達移民與關稅局大廈。這條高速公路讓民眾可以在不使用地不佬高速公路的情況下前往蘇丹依斯干達大廈。2014年8月1日，這條大道開始收費，一直到2018年1月1日。這項工程是新山整體規劃的一部分，並且與馬來西亞依斯干達經濟特區工程有關，目的是推動該地區成為現代化的經濟強區。這條高速公路耗資10億令吉。\\n2012年8月，馬來西亞政府決定從馬資源手中收購新山東部疏散大道。\\n大道的0公里處位於靠近蘇丹依斯干達大廈的蘇丹依斯干達大廈交界處。"},{"page_url":"https://vi.wikipedia.org/wiki/Erymophyllum_tenellum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Erymophyllum_tenellum_-_Flickr_-_Kevin_Thiele.jpg","page_title":"Erymophyllum tenellum","context_page_description":"Erymophyllum tenellum là một loài thực vật có hoa trong họ Cúc. Loài này được Paul G.Wilson mô tả khoa học đầu tiên năm 1989."},{"page_url":"https://en.wikipedia.org/wiki/Burgers_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Burgers_Park%2C_Pretoria.JPG","page_title":"Burgers Park","context_page_description":"Burgers Park is a park located in the center of Pretoria, South Africa. Founded in the 1870s as a botanical garden, it covers four acres and has been declared a South African National Monument. It is named for Thomas François Burgers, fourth president of the South African Republic. A statue of President Burgers stands in the park. There is also a statue to the South African Scottish Regiment of the Second World War."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Cher","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Saint-Jeanvrin_Nef.jpg","page_title":"Liste des monuments historiques du Cher","context_page_description":"Cet article recense les monuments historiques du Cher, en France."},{"page_url":"https://ca.wikipedia.org/wiki/Ratpenats","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Goya-El_sue%C3%B1o_de_la_raz%C3%B3n.jpg","page_title":"Ratpenats","context_page_description":"Els ratpenats o voliacs són un ordre de mamífers. Amb aproximadament 1.100 espècies, els ratpenats representen aproximadament un 20% de totes les espècies de mamífers, cosa que els converteix en el segon ordre més gran d'aquesta classe per darrere dels rosegadors. Són els únics mamífers capaços de volar, s'han estès gairebé arreu del món i han ocupat una varietat de nínxols ecològics diferents. Els ratpenats tenen un rol ecològic vital com a pol·linitzadors de flors i també tenen un paper important en la dispersió de llavors. Moltes plantes tropicals depenen completament dels ratpenats. Els ratpenats tenen les potes anteriors transformades en ales i alguns es guien i cacen per ecolocalització. Els ratpenats poden ser frugívors, insectívors o alimentar-se d'ocells i altres petits vertebrats. Alguns, com els vampirs, són hematòfags.\\nLa seva mida varia des de 29–33 mm de longitud i 2 g de pes en el ratpenat de nas porcí fins a més d'1,5 m i 1,2 kg de pes en la guineu voladora de les Filipines."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%91%84%E5%BD%B1%E5%8D%9A%E5%AE%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/BlogAbelsonInfo.png","page_title":"摄影博客","context_page_description":"摄影博客 是以博客的形式分享、发布图片一种形式。 与博客的不同，图片博客的主要内容是博主发布的图片而非文字。 随着移动博客和具有摄影功能的手机的出现， 摄影博客在2000年初得到了发展。"},{"page_url":"https://pl.wikipedia.org/wiki/Volturino","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Volturino_%282009%29_38_%28RaBoe%29.jpg","page_title":"Volturino","context_page_description":"Volturino – miejscowość i gmina we Włoszech, w regionie Apulia, w prowincji Foggia.\\nWedług danych na rok 2004 gminę zamieszkiwało 1989 osób, 34,9 os./km²."},{"page_url":"https://eu.wikipedia.org/wiki/Udarik_gabeko_urtea","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/1000_Year_Temperature_Comparison.png","page_title":"Udarik gabeko urtea","context_page_description":"Udarik gabeko urtea 1816. urtean Europa eta Ameriketako Estatu Batuetako udako klima arraroa definitzeko erabiltzen den esaera da. Klimaren aldaketa azkar hori, urtebete lehenago Indonesiako Tanbora sumendiaren erupzioak atmosferara jaurtitako errautsak eragin zuen, eguzkiaren indarra gutxitu eta planetako tenperatura jaitsiaraztean.\\n1816ko maiatzeko bat-bateko izotzaldiak, uztak deuseztatu zituen, eta janari gabezia Europa eta Ameriketako Estatu Batuetan hedatu zen. Janari gabezi hark, gosea eragin zuen, eta gosearen ondorioz ehundaka pertsona hil ziren."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_Saint-Jean_du_Liget","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Chapelle_Saint-Jean-du-Liget-2.JPG","page_title":"Chapelle Saint-Jean du Liget","context_page_description":"La chapelle Saint-Jean du Liget, ou chapelle Saint-Jean-du-Liget ou chapelle du Liget, est une ancienne chapelle située sur la commune de Sennevières, dans le département d'Indre-et-Loire, en France.\\nElle est probablement construite vers le milieu du XIIᵉ siècle bien qu'à quelques décennies près cette datation soit encore discutée, ce qui entretient l'incertitude sur l'ordre monastique, bénédictin ou cartusien, qui l'a fondée. De même, sa dédicace à saint Jean, pouvant s'appliquer à un autre monument, est contestée. Elle est rattachée à la chartreuse du Liget jusqu'à la Révolution française ; c'est alors que, déjà ruinée, elle est vendue à des propriétaires privés puis à l'État. Ce dernier en entreprend la restauration dans les années 1860 après qu'elle est classée au titre des monuments historiques en 1862. La chapelle est la propriété de la commune de Sennevières depuis 2007.\\nSon plan initial assez peu courant, rotonde précédée d'une nef, la rapproche de l'église du Saint-Sépulcre de Jérusalem telle que les premiers croisés la découvrent."},{"page_url":"https://lv.wikipedia.org/wiki/Latvijas_Republikas_augst%C4%81k%C4%81s_izgl%C4%ABt%C4%ABbas_un_zin%C4%81tnes_valsts_ministru_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/MK_balva_2009_%284109367562%29.jpg","page_title":"Latvijas Republikas augstākās izglītības un zinātnes valsts ministru uzskaitījums","context_page_description":"Šajā uzskaitījumā apkopoti Latvijas Republikas augstākās izglītības un zinātnes valsts ministri, kas bija Latvijas Republikas Ministru kabineta locekļi. Šis amats pastāvēja no 1995. līdz 1999. gadam."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A1%CE%B5%CE%BD%CE%AD_%CE%9F%CF%85%CE%AF%CE%B3%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Erasmusprijs_1966%2C_uitreiking_in_Ridderzaal_te_Den_Haag_prins_reikt_prijs_uit_aa%2C_Bestanddeelnr_919-2923.jpg","page_title":"Ρενέ Ουίγκ","context_page_description":"Ο Ρενέ Ουίγκ ήταν Γάλλος συγγραφέας του οποίου το κύριο έργο μελέτης ήταν η ψυχολογία και η φιλοσοφία της τέχνης. Επίσης διετέλεσε έφορος της πινακοθήκης στο μουσείο του Λούβρου, καθηγητής στο Κολέγιο της Γαλλίας, και μέλος της Γαλλική Ακαδημίας. Ήταν ο πατέρας του συγγραφέα Φρανσουά-Μπερνάρ Ουίγκ."},{"page_url":"https://eo.wikipedia.org/wiki/Pend%C4%9Dardenoj_de_Babilono","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Hanging_Gardens_of_Babylon.jpg","page_title":"Pendĝardenoj de Babilono","context_page_description":"La Pendĝardenoj de Babilono kaj la muroj de Babilono estis konsiderataj kiel unu el la sep mirindaĵoj de la antikva mondo. Ili estis ambaŭ laŭlegende konstruita de Nebukadnecar la 2-a ĉirkaŭ 600 a.K. Li verŝajne postulis la konstruadon de la ĝardenoj por plaĉigi sian edzinon Amjitis de Media kiu sopiris la arbojn kaj belajn plantojn de sia hejmlando. La densa Pendĝardenoj estis amplekse priskribita de helenaj historiistoj kiel Strabo kaj Diodoro Sicila, sed krom tiuj rakontoj tre malmulte da pruvmaterialoj ekzistas. Fakte, neniaj ajn babilonaj priskribaĵoj pri la pendĝardenoj ekzistas.\\nIuj eblaj arkeologiaĵoj de la elkavigado de la palaco de Babilono estis trovitaj, sed nenio tute pruvas ĝiajn fantaziajn priskribojn. Tra la epokoj, la loko eble estis konfuzita kun la ĝardenoj tie ekzistintaj ĉe Nineve, tial tabuletoj de tie klare montras ĝardenojn. Skribado en ĉi tiuj tabuletoj priskribas la eblan uzon de io simila al Arkimeda Ŝraŭbo por levi akvon al la bezona alteco."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A7%8B%E0%A6%B9%E0%A6%BE%E0%A6%AE%E0%A7%8D%E0%A6%AE%E0%A6%A6_%E0%A6%86%E0%A6%AC%E0%A7%81_%E0%A6%AC%E0%A6%95%E0%A6%B0_%E0%A6%B8%E0%A6%BF%E0%A6%A6%E0%A7%8D%E0%A6%A6%E0%A6%BF%E0%A6%95%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Furfura_Mazar.jpg","page_title":"মোহাম্মদ আবু বকর সিদ্দিকি","context_page_description":"মোহাম্মদ আবু বকর সিদ্দিকি ফুরফুরার সিদ্দিকী বংশের উজ্জ্বলতম নক্ষত্র। মোজাদ্দেদে জামান ও আমিরুস শরিয়ত হিসেবে সমগ্র বিশ্বে তিনি বিশেষ খ্যাতি লাভ করেছিলেন। আরবের বাদশাহকেও তিনি হেদায়েতী পত্র লিখেছিলেন। যার উত্তর আজও সযত্নে রক্ষিত আছে। বাংলা ভারতের প্রত্যন্ত অঞ্চলে ওয়াজ-নসিহত, হাজার হাজার মাদ্রাসা প্রতিষ্ঠা, পত্রপত্রিকা প্রকাশ ও শিক্ষা বিস্তারে তার অবদান ইসলামী বিশ্বকোষে বর্ণিত হয়েছে।\\nখলিফাগনঃ আল্লামা নেসার উদ্দিন, প্রফেসর আব্দুল খালেক, মোহাম্মদ শহীদুল্লাহ, হাফেজ আব্দুর রহমান হানাফি"},{"page_url":"https://hr.wikipedia.org/wiki/Leopard_ma%C4%8Dka","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Leopard_Cat_area.png","page_title":"Leopard mačka","context_page_description":"Leopard mačka je divlja mala mačka južne i istočne Azije.\\nNije ugrožena, jer je široko rasprostranjena, ali prijete joj lov i gubitak staništa u nekim dijelovima njenog rasprostiranja. Postoji dvanaest podvrsti leopard mačke, koje se razlikuju po izgledu. Ime „leopard mačka“ dolazi od krzna sličnog leopardu, ali nije u bliskom srodstvu s leopardom."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%9E%E5%B8%B8%E5%8F%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/B767-346_Emagency_Exit_ja.jpg","page_title":"非常口","context_page_description":"非常口とは、何らかの非常事態が発生した場合に備えて設置された出口の事である。日本の消防法においては避難口と呼ばれる。"},{"page_url":"https://hu.wikipedia.org/wiki/Capoeira","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Capoeira_Dance.jpg","page_title":"Capoeira","context_page_description":"A capoeira egy brazil harcművészeti kultúra, aminek része egy sajátos akrobatikus mozgás és zene. A 16. századtól a 19. századig a főként Közép-Nyugat Afrikából Brazíliába hurcolt rabszolgák alakítottak ki.\\nFürge, trükkös mozdulatok jellemzik; gyakran közel a földhöz, vagy kézen-/fejen állva művelik, mindig zenére mozognak\\n. Egyes verzióiban sok akrobatikus elem található. A capoeira szónak számos jelentése létezik, ezek egyike a Brazília belsejében található erdős területekre utal, feltehetőleg azokra a helyekre, ahol a szökött rabszolgák próbáltak elrejtőzni. Az 1970-es években megjelenő break tánc számos mozdulata nagyon hasonló, ezért sokak szerint a capoeirából származik. Két fő stílusirányzat létezik a capoeirán belül: az egyiket a lassabb, földközeli mozdulatsorok, valamint a hagyományok és rítusok tiszteletben tartása jellemzi, ez a Capoeira Angola. A másik stílus az ún. Capoeira Regional, amelyben folyamatos, akrobatikus mozgáskombinációk dominálnak. Itt a technikán és a stratégián van a hangsúly. Mindkét stílusra jellemzőek a cselek, a színlelt támadások, a lendületes rúgások, illetve az ellenfél egyensúlyból való kimozdítását célzó mozdulatok."},{"page_url":"https://en.wikipedia.org/wiki/Castle_of_Terena","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Castelo_de_Terena1206.jpg","page_title":"Castle of Terena","context_page_description":"The Castle of Terena is a castle in the civil parish of Terena in the municipality of Alandroal in the Portuguese subregion of Alentejo Central. Since 1946, it has been listed as a National monument."},{"page_url":"https://es.wikipedia.org/wiki/Gum_Wall","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Seattle_Victor_Grigas_December_2011-7.jpg","page_title":"Gum Wall","context_page_description":"El Market Theater Gum Wall es una pared de ladrillo cubierto de chicle usado, situada en un callejón en el centro de Seattle. Está localizado en Post Alley bajo el Mercado de Pike Place. Similar al Bubblegum Alley de San Luis Obispo, California, es una atracción turística local. Partes de la pared están recubiertas por varios centímetros de grosor, de unos 4,5 metros de alto a lo largo de 15 metros.​\\nLa pared se sitúa cerca de la taquilla del Market Theater, y la tradición comenzó alrededor de 1993 los asistentes a las producciones de teatro de Unexpected Productions' de Seattle pegaban goma de mascar en la pared introduciendo monedas en su interior, mientras hacían cola.​ Los empleados del teatro retiraron los chicles hasta dos veces, pero finalmente desistieron​ después de que los jefes del mercado consideraran la pared de chicle como una atracción turística cerca de 1999.​ Algunas personas han creado pequeñas obras de arte con goma de mascar.​\\nFue nombrada como una de las cinco atracciones turísticas más contaminadas por gérmenes en 2009, después de la Piedra de la elocuencia.​​​ Su ubicación da comienzo a un tour nocturno, ​​ y es un lugar popular para tomarse fotos de boda.​"},{"page_url":"https://ceb.wikipedia.org/wiki/Dafang_Xian","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Azaleas_Area.JPG","page_title":"Dafang Xian","context_page_description":"Gatos ang Dafang Xian sa Pangmasang Republika sa Tśina. Nahimutang ni sa prepektura sa Bijie Diqu ug lalawigan sa Guizhou Sheng, sa habagatang bahin sa nasod, 1,700 km sa habagatan-kasadpan sa Beijing ang ulohan sa nasod. Adunay 776,324 ka molupyo. Ang populasyon sa naglangkob sa 372,461 ka babae ug 403,863 ka lalaki. Mga anak ubos sa edad nga 15 mao ang 28.0%, ang mga hamtong nga nag-edad 15-64 63%, ug mga tigulang labaw sa 65 8.0%.\\nDafang Xian may sa mosunod nga mga subdibisyon:\\n大方镇\\n双山镇\\n猫场镇\\n马场镇\\n羊场镇\\n黄泥塘镇\\n六龙镇\\n达溪镇\\n瓢井镇\\n长石镇\\n东关乡\\n竹园彝族苗族乡\\n响水白族彝族仡佬族乡\\nWenge\\n绿塘乡\\n鼎新彝族苗族乡\\nNiuchang\\n高店乡\\n小屯乡\\n理化苗族彝族乡\\n鸡场乡\\n凤山彝族蒙古族乡\\n安乐彝族仡佬族乡\\n核桃彝族白族乡\\nBabu\\nXinglong\\n果瓦乡\\n大山苗族彝族乡\\n雨冲乡\\n黄泥彝族苗族滿族乡\\n大水彝族苗族布依族乡\\n沙厂彝族乡\\n普底彝族苗族白族乡\\n百纳彝族乡\\n三元彝族苗族白族乡\\n星宿苗族彝族仡佬族乡\\nAng klima kasarangan. Ang kasarangang giiniton 15 °C. Ang kinainitan nga bulan Agosto, sa 20 °C, ug ang kinabugnawan Enero, sa 6 °C. Ang kasarangang pag-ulan 1,181 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 211 milimetro nga ulan, ug ang kinaugahan Enero, sa 21 milimetro."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%D9%86%D8%A8%D9%82%DB%8C%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Giradino_dell%27iris_2.JPG","page_title":"زنبقیان","context_page_description":"زَنبَقیان تیره‌ای از مارچوبه‌سانان است با انواع ساقه‌های زیرزمینی و برگهای خطی یا نواری که گُل‌پوش شش‌قطعه‌ای و خامهٔ سه‌قسمتی و سه پرچم دارند و میوهٔ آنها پوشینه است.\\nزنبقیان تیره‌ای از گیاهان گل‌دار است که حدود ۱۵۰۰ گونه در ۶۰ جنس را در بر می‌گیرد. پراکنش این تیره به طوری است که در نواحی مختلف کره زمین دیده می‌شوند. زنبق معمولاً در خاک‌های خنثی یا قلیایی و سبک و قابل نفوذ رشد می‌نماید."},{"page_url":"https://fr.wikipedia.org/wiki/Causses-et-Veyran","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Causses_et_Veyran_construction_groupe_scolaire_et_mairie_1893_-_Archives_d%C3%A9partementales_de_l%E2%80%99H%C3%A9rault_-_FRAD034-2O-61-2-7-00001.jpg","page_title":"Causses-et-Veyran","context_page_description":"Causses-et-Veyran est une commune française située dans le département de l'Hérault, en région Occitanie."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%81%D9%88%D8%AC%DB%8C_%D8%AA%D9%84%D9%88%DB%8C%DA%98%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Fuji_Television_HQ_Building%2C_Tokyo.jpg","page_title":"فوجی تلویژن","context_page_description":"فوجی تلویژن بیر شیرکت دیر."},{"page_url":"https://de.wikipedia.org/wiki/C-_und_D-Klasse_(Royal_Navy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/HMS_Kempenfelt_%28I18%29.jpg","page_title":"C- und D-Klasse (Royal Navy)","context_page_description":"Die C- und D-Klasse war eine Schiffsklasse von Zerstörern der Royal Navy im Zweiten Weltkrieg. Sie bestand aus zwei Gruppen bzw. Unterklassen. Je ein Schiff war als Flottillenführer ausgerüstet. Die vierzehn Schiffe der beiden Gruppen wurden zu Beginn der 1930er-Jahre in verschiedenen britischen Werften gebaut.\\nAlle fünf Schiffe der C-Gruppe wurden bis 1939 an Kanada übergeben, später folgten noch zwei Zerstörer der D-Gruppe. Neun Schiffe gingen im Krieg verloren, die verbliebenen vier Einheiten in Kanada und der bei der Royal Navy noch vorhandene Flottillenführer Duncan wurden nach Kriegsende verschrottet. Ihr Entwurf basierte auf der J-Klasse, jedoch waren ihre Baukosten geringer und ihre Handhabung weniger komplex."},{"page_url":"https://hu.wikipedia.org/wiki/Csernyivci","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/%D0%90%D1%80%D1%85%D1%96%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%BD%D0%B8%D0%B9_%D0%B0%D0%BD%D1%81%D0%B0%D0%BC%D0%B1%D0%BB%D1%8C_%D0%A2%D0%B5%D0%B0%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D1%97_%D0%BF%D0%BB%D0%BE%D1%89%D1%96.Jpg","page_title":"Csernyivci","context_page_description":"Csernyivci város Ukrajna délnyugati részén, a Csernyivci terület székhelye. A város a Prut folyó partján, Bukovina északi részén fekszik. A város lakossága 2011. augusztus 1-jei állapot szerint 253 762 fő."},{"page_url":"https://ca.wikipedia.org/wiki/Principat_de_Catalunya","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Cortes_Catalanas.jpg","page_title":"Principat de Catalunya","context_page_description":"El Principat de Catalunya, per antonomàsia el Principat o també Catalunya, fou l'estat creat per la unió de tots els comtats catalans que estaven sota la jurisdicció del rei Alfons I el Trobador o el Cast des del 1162. Els sobirans del Principat de Catalunya tenen la dignitat de comtes de Barcelona.\\nCatalunya fou definida inicialment com «la terra que va des de Salses fins a Tortosa i Lleida» i la seva definitiva configuració territorial no es completà fins al 1491, amb la incorporació del comtat de Pallars Sobirà. Políticament, l'heterogeni grup de comtats agrupats sota la denominació unitària de Catalunya fou cohesionat mitjançant tres documents de caràcter legislatiu, jurídic i cultural: els Usatici Barchinonae, el Liber domini regis, i la Gesta Comitum Barchinonensium, documents que configuraren Catalunya com un estat medieval, amb unes fronteres definides, un corpus legislatiu i judicial unificat, i uns referents culturals comuns."},{"page_url":"https://fr.wikipedia.org/wiki/Sanctuaire_de_Notre-Dame_de_B%C3%A9tharram","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Betharram_-_Santuario_Nostra_Signora_di_Betharram_%282007%29.jpg","page_title":"Sanctuaire de Notre-Dame de Bétharram","context_page_description":"Le sanctuaire Notre-Dame de Bétharram est un sanctuaire marial sis à Lestelle-Bétharram, commune du département des Pyrénées-Atlantiques en France."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%82%A4%ED%94%84%EB%A1%9C%EC%8A%A4%EC%9D%98_%EC%9E%AC%EC%99%B8%EA%B3%B5%EA%B4%80_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Birger_Jarlsgatan_37.JPG","page_title":"키프로스의 재외공관 목록","context_page_description":"키프로스의 재외공관 목록은 키프로스 주재 대사관 및 고등판무관 사무소를 각국에 상주시켜 놓는 것을 의미하며, 키프로스의 재외공관을 나열한 목록이다."},{"page_url":"https://en.wikipedia.org/wiki/Brockway_Mountain_Drive","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Brockway_Mountain_Drive_Panorama.jpg","page_title":"Brockway Mountain Drive","context_page_description":"Brockway Mountain Drive is an 8.883-mile scenic roadway just west of Copper Harbor in the Upper Peninsula of Michigan in the United States. Drivers can access the road from state highway M-26 on either end near Eagle Harbor to the west or Copper Harbor to the east in the Keweenaw Peninsula. The drive runs along the ridge of Brockway Mountain on the Keweenaw Fault and climbs to 1,320 feet above sea level, 720 feet above the surface of Lake Superior. Several viewpoints along the route allow for panoramas of Copper Harbor, Lake Superior, and undeveloped woodland. On a clear day, Isle Royale is visible approximately 50 miles in distance from the top of the mountain.\\nBrockway Mountain was named for Daniel D. Brockway, one of the pioneer residents of the area. The road was constructed by the county road commission with funding through Depression-era work programs in 1933. It was briefly used as a connection for the parallel state highway after it opened. Since it opened, Brockway Mountain Drive has been recognized nationally and locally in several media outlets for its picturesque qualities, usually in profiles of Keweenaw County, the Upper Peninsula or other scenic drives."},{"page_url":"https://it.wikipedia.org/wiki/Agust%C3%ADn_Barboza","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Agust%C3%ADn_Barboza.JPG","page_title":"Agustín Barboza","context_page_description":"Agustín Pio Barboza è stato un cantautore, chitarrista e compositore paraguaiano."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%BC%D0%B1%D0%B0%D1%80%D0%B4%D0%B8%D1%80%D0%BE%D0%B2%D1%89%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Boeing_Model_299_b299-2a.jpg","page_title":"Бомбардировщик","context_page_description":"Бомбардиро́вщик — военный самолёт, предназначенный для поражения наземных, подземных, надводных, подводных объектов средствами бомбового и/или ракетного вооружения."},{"page_url":"https://hr.wikipedia.org/wiki/Popis_guvernera_ameri%C4%8Dkih_saveznih_dr%C5%BEava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Andrew_Cuomo_by_Pat_Arnow_cropped.jpeg","page_title":"Popis guvernera američkih saveznih država","context_page_description":"Prikazan je popis trenutnih guvernera saveznih država i teritorija SAD. Trenutno ima 33 republikanska, 16 demokratskih i jedan nezavisni guverner. Osim toga, na povezanim i zavisnim teritorijama SAD dužnosti obavljaju dva guvernera iz Demokratske stranke, dva republikanska i dva nezavisna guvernera. Također je naveden i guverner Distrikta Columbia, iz Demokratske stranke."},{"page_url":"https://eu.wikipedia.org/wiki/Gerrhonotus_liocephalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Gerrhonotus_liocephalus_distribution.png","page_title":"Gerrhonotus liocephalus","context_page_description":"Gerrhonotus liocephalus Gerrhonotus generoko animalia da. Narrastien barruko Anguidae familian sailkatuta dago."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D8%B1%D9%8A_(%D8%A8%D8%A7%D8%AF_%D9%83%D8%A7%D9%84%D9%8A%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Mory_-_Mairie.JPG","page_title":"موري (باد كاليه)","context_page_description":"موري، باد كاليه ‏ هي بلدية تقع في إقليم باد كاليه من منطقة نور با دو كاليه في شمال فرنسا. تبلغ مساحة هذه المدينة 7.39، وترتفع عن سطح البحر 90 م، يبلغ عدد سكانها 346 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Joël Vasseur البلدية خلال فترة."},{"page_url":"https://en.wikipedia.org/wiki/Mont_Ham","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Mont-Ham_%28Qu%C3%A9bec%29.jpg","page_title":"Mont Ham","context_page_description":"Mont Ham is a mountain in the southern Notre Dame Mountains in Quebec, Canada. Its primary summit lies at an elevation of 713 m, with a prominence of 358 m. Marked trails on the mountain permit visitors a 360 degree view of the surrounding landscape. The park in which it is situated is open year-round and offers hiking, scrambling, snowshoeing, cross-country skiing, disc golf, and camping. In 2014, the park became the first in the Eastern Townships to gain \\"regional park\\" status, along with a $1,367,250 grant for expansion and improvements."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AD%D9%85%D9%84%D9%87_%D8%A8%D8%B2%D8%B1%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Greek_soldiers_retreat%2C_1922.jpeg","page_title":"حمله بزرگ","context_page_description":"حمله بزرگ نام بزرگترین و نهایی‌ترین عملیات نظامی جنگ استقلال ترکیه در مبارزه بین نیروهای مسلح ترکیه وفادار به دولت ملی مجلس بزرگ و پادشاهی یوناندر جنگ یونان و ترکیه بود. حمله در ۲۶ اوت سال ۱۹۲۲ با نبرد دوملوپینار آغاز شد. ترک‌ها در حدود ۱۰۴۰۰۰ نفر جمع کرده بودند، که بیشترین تعداد از زمان شروع جنگ بود. هدف حمله، راندن قوای اشغالگر یونانی بود که بیش از ۲۰۰۰۰۰ نفر بوند. واحدهای ترک در راهپیمایی به مدت ۱۰ روز فاصله ۳۰۰ کیلومتر را، در حالی که با سربازان یونانی مبارزه می‌کردند، طی کردند. ارتش ترکیه فاقد وسایل نقلیه موتوری بود؛ این قوا نیروهای متشکل از پیاده‌نظام و سواره نظام و پشتیبانی لجستیکی خود را با استفاده از گاو و چرخ دستی تأمین می‌کرد. نیروهای ترکیه در ۹ سپتامبر به دریا رسید و بعد از پس گرفتن ازمیر، این عملیات در ۱۸ سپتامبر سال ۱۹۲۲ با آزادی اردک و بیگا به پایان رسید. این شکست عظیم یونان باعث مخالفت در ارتش یونان و به‌طور کلی منجر به از دست دادن روحیه و عدم تمایل برای ادامه مبارزه از طرف یونان شد. علاوه بر این واحدهای یونانی متعددی محاصره و نابود شدند و قوای یونانی قابلیت تهاجمی مؤثر را از دست داد و دبگر قادر به سازماندهی یک عقب‌نشینی کنترل شده نبود. در این نبرد تعداد زیادی یونانی به عنوان اسرای جنگی گرفتار شدند."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E8%90%8A_(%E6%BE%B3%E5%A4%A7%E5%88%A9%E4%BA%9E%E5%9C%8B%E6%9C%83%E9%81%B8%E5%8D%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Division_of_Calare_2010.png","page_title":"卡萊 (澳大利亞國會選區)","context_page_description":"卡莱选区是澳大利亚新南威尔士州的下议院选区，位于该州首府悉尼以西拉克兰河上游，选区名也是此河在澳大利亚原住民当中的称呼。面积30,526平方公里。\\n选区始于1906年。是工党和国家党竞争的选区。自2007年起当区议员是国家党的约翰·科布。"},{"page_url":"https://eo.wikipedia.org/wiki/Kultiva_vicio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Vicia_sativa_subsp._segetalis_seeds%2C_vergeten_wikke_zaden.jpg","page_title":"Kultiva vicio","context_page_description":"Kultiva vicio estas planto el la genro vicio el la legumenacoj. Tiu specio troviĝas sur agroj, flanke de vojoj kaj sur digoj. La planto grimpas per ĉiroj laŭ aliaj plantoj supren. Tiumaniero ĝi povas atingi altecon de pli ol unu metro.\\nOni distingas la sekvajn subspeciojn:\\nVicia sativa subsp. nigra, sinonimo: Vicia sativa subsp. angustifolia\\nVicia sativa subsp. segetalis,\\nVicia sativa subsp. sativa."},{"page_url":"https://lb.wikipedia.org/wiki/Gemeng_Steesel","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Steseler_Kierch.JPG","page_title":"Gemeng Steesel","context_page_description":"D'Gemeng Steesel läit am Kanton Lëtzebuerg an ass eng vun den 102 lëtzebuergesche Gemengen. De Chef-lieu vun der Gemeng ass d'Uertschaft Steesel vun där se och hiren Numm huet."},{"page_url":"https://war.wikipedia.org/wiki/Fusconaia_cor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Naturalis_Biodiversity_Center_-_RMNH.MOL.326264_-_Fusconaia_cor_%28Conrad%2C_1834%29_-_Unionidae_-_Mollusc_shell.jpeg","page_title":"Fusconaia cor","context_page_description":"Fusconaia cor in uska species han Bivalvia nga syahan ginhulagway ni Conrad hadton 1834. An Fusconaia cor in nahilalakip ha genus nga Fusconaia, ngan familia nga Unionidae. Ginklasipika han IUCN an species komo nangangarat-an duro. Waray hini subspecies nga nakalista."},{"page_url":"https://nn.wikipedia.org/wiki/Planimeter","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Planimeter.png","page_title":"Planimeter","context_page_description":"Eit planimeter eller ein flatemålar er eit instrument til finne flateinnhaldet til plane figurar. Oppmålinga skjer som regel ved at omrisset til figuren vert følgd av ein stift, medan ei rulle som kviler på papiret er knytt til stiften og vil dreie på grunn av friksjonen. Rørsla til rullen kan lesast av på eit teljeverk og gjev målet for arealet til figuren."},{"page_url":"https://ca.wikipedia.org/wiki/Nasireddin_(cr%C3%A0ter)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Orontius_%2B_St%C3%B6fler_-_LROC_-_WAC.JPG","page_title":"Nasireddin (cràter)","context_page_description":"Nasireddin és un cràter d'impacte que es troba en el terreny accidentat de la part sud de la cara visible de la Lluna. Aquest cràter se superposa a dues formacions més antigues, penetrant en el cràter Miller cap al nord i en Huggins cap a l'oest. A l'est de Nasireddin es localitza la plana emmurallada del cràter molt més gran Stöfler.\\nAquest cràter és una formació més recent que els dos cràters als quals se superposa, particularment al desgastat Huggins a l'oest. Aquest cràter conserva molts detalls, incloent una paret interna terraplenada i una vora afilada al sud i a l'est, on la paret interna s'ha desplomada. El sòl interior és relativament pla, però rugós. Presenta alguns pics centrals baixos prop del punt central de l'interior, i alguns craterets minúsculs que marquen la superfície.\\nNasireddin va rebre aquest nom en memòria de Nasir al-Din al-Tusi, un notable escriptor medieval persa, considerat com el més gran dels últims erudits perses. Va ser un científic d'amplis interessos, destacant com a arquitecte, astrònom, biòleg, químic, matemàtic, filòsof, metge, físic i teòleg."},{"page_url":"https://en.wikipedia.org/wiki/Ortac","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Ortac_from_above_Clonque_Bay.jpg","page_title":"Ortac","context_page_description":"Ortac is a small uninhabited islet about 5 kilometres west of the coast of Alderney near to the islet of Burhou. It measures roughly 50 by 70 metres, and rises 24 metres above the sea level.\\nA.H. Ewen surmised that the rock's name meant \\"large rock at the edge\\" from the Norman language or + etac. Alexander Deschamps said that the French formerly knew it as \\"the Eagle's Nest\\"."},{"page_url":"https://hu.wikipedia.org/wiki/Racib%C3%B3rz","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Cmentarz_ewangelicki_Raciborz_-_nagrobek_2.jpg","page_title":"Racibórz","context_page_description":"Racibórz – város Lengyelország déli részén a Sziléziai vajdaságban, a Racibórzi járásban. 1950–1975 között a város az Opolei, míg 1975–1998 között a Katowicei vajdasághoz tartozott. 2006. február 28-ai adatok szerint a város lakossága 60 218 főt számlált."},{"page_url":"https://en.wikipedia.org/wiki/Formula_One_drivers_from_Switzerland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Buemi_Canada_GP_2010.jpg","page_title":"Formula One drivers from Switzerland","context_page_description":"As of 2020, there have been 32 drivers from Switzerland who have entered Formula One World Championship Grands Prix motor races, with 22 of them having started a race."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bahnh%C3%B6fe_und_Haltepunkte_in_Sachsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Gro%C3%9FbothenBf1.JPG","page_title":"Liste der Bahnhöfe und Haltepunkte in Sachsen","context_page_description":"Die Liste der Bahnhöfe und Haltepunkte in Sachsen führt alle Eisenbahnbetriebsstellen des öffentlichen Verkehrs auf, die auf dem Territorium des 1990 neu begründeten Freistaats Sachsen bestehen. Enthalten sind auch alle aufgelassenen und abgebauten Stationen."},{"page_url":"https://nl.wikipedia.org/wiki/Simoedosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Champsosaurus_and_Simoedosaurus_JWArtwork.png","page_title":"Simoedosaurus","context_page_description":"Simoedosaurus is een geslacht van uitgestorven reptielen behorend tot de orde Choristodera uit het Paleoceen en Eoceen. Fossielen van Simoedosaurus zijn gevonden in Europa en Noord-Amerika."},{"page_url":"https://en.wikipedia.org/wiki/Contingent_vote","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Preferential_ballot.svg","page_title":"Contingent vote","context_page_description":"The contingent vote is an electoral system used to elect a single representative in which a candidate requires a majority of votes to win. It is a variation of instant-runoff voting. Under the contingent vote, the voter ranks the candidates in order of preference, and the first preference votes are counted. If no candidate has a majority, then all but the two leading candidates are eliminated and the votes received by the eliminated candidates are distributed among the two remaining candidates according to voters preferences. This ensures that one candidate achieves a majority and is declared elected.\\nThe contingent vote differs from IRV which allows for many rounds of counting, eliminating only one weakest candidate each round. The contingent vote can also be considered a compressed form of the two-round system, in which both 'rounds' occur without the need for voters to go to the polls twice.\\nToday, a special variant of the contingent vote is used to elect the President of Sri Lanka. Another variant, called the supplementary vote, is used to pick directly elected mayors and police and crime commissioners in England."},{"page_url":"https://de.wikipedia.org/wiki/Sprengboot","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/ShinyoBoat.jpg","page_title":"Sprengboot","context_page_description":"Ein Sprengboot oder auch Sprengschiff ist ein schnelles, leichtes Motorboot, das, mit Sprengstoff gefüllt, gegen ein auf dem Wasser oder am Ufer befindliches Ziel gesteuert werden kann, um dieses durch die eigene Explosion zu zerstören oder so zu beschädigen, dass es unbrauchbar wird."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E8%88%87%E5%B7%B4%E5%B8%83%E4%BA%9E%E7%B4%90%E5%B9%BE%E5%85%A7%E4%BA%9E%E9%97%9C%E4%BF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Australian_War_Memorial_099921.jpg","page_title":"中華民國與巴布亞紐幾內亞關係","context_page_description":"中華民國與巴布亞紐幾內亞關係是指中華民國與巴布亞紐幾內亞獨立國之間的關係。兩國於1995年相互承認國家地位、1999年有正式外交關係，但只維持17天即斷交，目前在對方首都互設具大使館性質的代表機構。"},{"page_url":"https://en.wikipedia.org/wiki/Dimension_(data_warehouse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Dimension_estrella.png","page_title":"Dimension (data warehouse)","context_page_description":"A dimension is a structure that categorizes facts and measures in order to enable users to answer business questions. Commonly used dimensions are people, products, place and time.\\nIn a data warehouse, dimensions provide structured labeling information to otherwise unordered numeric measures. The dimension is a data set composed of individual, non-overlapping data elements. The primary functions of dimensions are threefold: to provide filtering, grouping and labelling.\\nThese functions are often described as \\"slice and dice\\". A common data warehouse example involves sales as the measure, with customer and product as dimensions. In each sale a customer buys a product. The data can be sliced by removing all customers except for a group under study, and then diced by grouping by product.\\nA dimensional data element is similar to a categorical variable in statistics.\\nTypically dimensions in a data warehouse are organized internally into one or more hierarchies. \\"Date\\" is a common dimension, with several possible hierarchies:\\n\\"Days Months Years\\",\\n\\"Days Weeks Years\\"\\n\\"Days Months Quarters Years\\"\\netc."},{"page_url":"https://sv.wikipedia.org/wiki/Wouter_Weylandt","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Wouter_Weylandt_-_Tour_de_Romandie_2010%2C_Stage_3.jpg","page_title":"Wouter Weylandt","context_page_description":"Wouter Weylandt, född 27 september 1984 i Gent, Belgien, död 9 maj 2011 i Mezzanego, Ligurien, Italien, var en belgisk tävlingscyklist. Han körde för UCI Pro Tour-laget Quick Step och senare för Leopard Trek. Hans första stora seger kom 2008 när han vann en etapp av Vuelta a España. Han vann även den tredje sträckan vid Giro d’Italia 2010."},{"page_url":"https://sv.wikipedia.org/wiki/Staffangymnasiet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Staffangymnasiet_3.jpg","page_title":"Staffangymnasiet","context_page_description":"Staffangymnasiet, Staffanskolan, är en gymnasieskola i Söderhamns kommun. På gymnasiet finns 12 nationella program samt individuella programmet. Staffangymnasiet har totalt omkring 800 elever och omkring 105 medarbetare."},{"page_url":"https://it.wikipedia.org/wiki/Vincenzo_Gennaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Scillato._Piazza_Aldo_Moro.jpg","page_title":"Vincenzo Gennaro","context_page_description":"Vincenzo Gennaro è uno scultore e docente italiano."},{"page_url":"https://sv.wikipedia.org/wiki/Mamoru_Shigemitsu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Shigemitsu_Mamoru.jpg","page_title":"Mamoru Shigemitsu","context_page_description":"Mamoru Shigemitsu, född 29 juli 1887 i Bungo-ōno, Oita, Japan, död 26 januari 1957 i Yugawara, Kanagawa, Japan, var en japansk diplomat och politiker."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_von_nationaler_Bedeutung_im_Kanton_Uri","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Eidg._Getreidelager_Altdorf_18_11.jpg","page_title":"Liste der Kulturgüter von nationaler Bedeutung im Kanton Uri","context_page_description":"Diese Liste enthält alle national bedeutenden Kulturgüter im Kanton Uri, die in der Ausgabe 2009 des Schweizerischen Inventars der Kulturgüter von nationaler und regionaler Bedeutung vermerkt sind. Sie ist nach politischen Gemeinden sortiert; enthalten sind 41 Einzelbauten, drei Sammlungen und zwei archäologische Fundstellen."},{"page_url":"https://fr.wikipedia.org/wiki/Architecture_californienne_moderne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Case_Study_House_22_%285902489690%29.jpg","page_title":"Architecture californienne moderne","context_page_description":"L'architecture californienne moderne est un style d'architecture moderne californienne avant-gardiste des années 1950 d'après-guerre, inspiré du style international, de l'architecture moderne des années 1920, et du style mid-century modern d'après guerre..."},{"page_url":"https://nn.wikipedia.org/wiki/Cowal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Cowal_peninsula_landsat.png","page_title":"Cowal","context_page_description":"Cowal er ei halvøy i Argyll and Bute i Dei skotske høglanda."},{"page_url":"https://en.wikipedia.org/wiki/National_Historical_Museum_(Argentina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Flickr_-_bastique_-_front_of_El_Museo_Historico_National.jpg","page_title":"National Historical Museum (Argentina)","context_page_description":"The Argentine National Historical Museum is located in Buenos Aires, Argentina, and is a museum dedicated to the history of Argentina, exhibiting objects relating to the May Revolution and the Argentine War of Independence."},{"page_url":"https://ko.wikipedia.org/wiki/1996%EB%85%84_%ED%83%9C%ED%92%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Niki_1996_track.png","page_title":"1996년 태풍","context_page_description":"1996년에는 2월 29일에 제1호 열대저기압이 발생한 것을 시작으로, 연말까지 총 26개의 태풍이 발생하였다. 평균적으로 1년 동안 태풍 발생 개수가 26.7개인 것과 비교하면 비슷한 수치이다. 그리고 1999년까지는 미국 합동태풍경보센터에서 이름을 지었기 때문에, SSHS로 열대저기압인것은 이름을 붙이지 않았다."},{"page_url":"https://hr.wikipedia.org/wiki/Toma%C5%A1evac","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Toma%C5%A1evac%2C_Orthodox_Church.jpg","page_title":"Tomaševac","context_page_description":"Tomaševac je naselje u Banatu u Vojvodini u sastavu općine Zrenjanin."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Sixte_(Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Saint_Sixte_%28Loire%29.jpg","page_title":"Saint-Sixte (Loire)","context_page_description":"Saint-Sixte est une commune française située dans le département de la Loire en région Auvergne-Rhône-Alpes, et faisant partie de Loire Forez Agglomération."},{"page_url":"https://es.wikipedia.org/wiki/Campamento_base_Patriot_Hills","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Patriot_Hills_Tunnels.jpg","page_title":"Campamento base Patriot Hills","context_page_description":"El Campamento Base Patriot Hills fue un aeródromo privado de la Antártida ocupado estacionalmente entre noviembre y enero. Se encuentra cerca de los montes Patriot de la cordillera Heritage en las montañas Ellsworth.\\nEl campamento estaba a cargo de la empresa privada estadounidense basada en Salt Lake City Adventure Network International, luego denominada Antarctic Logistics & Expeditions LLC.​ Es una empresa que proporciona vuelos de apoyo logístico a los programas antárticos nacionales y otros proyectos de investigación, a expediciones y visitas al interior de la Antártida.​ Fue construido en 1987​ y se utilizaba durante los meses de verano, de noviembre a enero.​ Patriot Hills fue una escala para muchos aventureros y exploradores entre Punta Arenas en Chile y el interior de la Antártida. El tiempo de vuelo desde Punta Arenas es alrededor de 4,5 horas.​\\nEn los meses de verano la temperatura sube en el lugar a -15 °C. La temperatura en los meses de invierno se estima en alrededor de -40 °C, pero hasta ahora nadie ha pasado el invierno en las montañas Ellsworth.​"},{"page_url":"https://war.wikipedia.org/wiki/Baggao","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Ph_locator_cagayan_baggao.png","page_title":"Baggao","context_page_description":"An Baggao usa nga syahan nga klase nga bungto ha lalawigan han Cagayan, Pilipinas. Sumala han census han tuig 2000, mayda ini populasyon nga 66,264 ka tawo ha 13,039 nga mga panimalay."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%82%E0%B8%A3%E0%B8%87%E0%B9%80%E0%B8%A3%E0%B8%B5%E0%B8%A2%E0%B8%99%E0%B8%AA%E0%B8%A7%E0%B8%99%E0%B8%81%E0%B8%B8%E0%B8%AB%E0%B8%A5%E0%B8%B2%E0%B8%9A%E0%B8%A7%E0%B8%B4%E0%B8%97%E0%B8%A2%E0%B8%B2%E0%B8%A5%E0%B8%B1%E0%B8%A2_%E0%B8%99%E0%B8%99%E0%B8%97%E0%B8%9A%E0%B8%B8%E0%B8%A3%E0%B8%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Ford_Sobchai.JPG","page_title":"โรงเรียนสวนกุหลาบวิทยาลัย นนทบุรี","context_page_description":"โรงเรียนสวนกุหลาบวิทยาลัย นนทบุรี เป็นโรงเรียนมัธยมศึกษาขนาดใหญ่พิเศษ ประเภทสหศึกษา ในเครือสวนกุหลาบวิทยาลัย ลำดับที่สอง สังกัดสำนักงานเขตพื้นที่การศึกษามัธยมศึกษา เขต 3 สำนักงานคณะกรรมการการศึกษาขั้นพื้นฐาน กระทรวงศึกษาธิการ\\nโดยกรมสามัญศึกษา ได้รับบริจาคที่ดิน จากนายผาสุก และนางเง็ก มณีจักร สองสามีภรรยา คหบดีชาวอำเภอปากเกร็ด ที่มีความประสงค์ให้สร้างโรงเรียนในเครือสวนกุหลาบวิทยาลัย บนพื้นที่ดังกล่าว จึงเกิดการประสานงานจัดตั้งขึ้น เมื่อวันที่ 30 มีนาคม พ.ศ. 2521 เดิมให้ชื่อไว้ว่า “โรงเรียนสวนกุหลาบวิทยาลัย ๒ ” และมอบหมายให้ผู้อำนวยการโรงเรียนสวนกุหลาบวิทยาลัย รักษาราชการในตำแหน่งอาจารย์ใหญ่ของโรงเรียน จนถึงปลายปีถัดมา จึงเปลี่ยนชื่อโรงเรียน เป็นชื่อที่ใช้อยู่ในปัจจุบัน และในปีเดียวกัน นางอัมพา แสนทวีสุข ได้รับการแต่งตั้งให้เป็นอาจารย์ใหญ่คนแรก และเลื่อนฐานะขึ้นเป็นผู้อำนวยการคนแรกของโรงเรียนฯ ในเวลาต่อมา\\nโรงเรียนสวนกุหลาบวิทยาลัย นนทบุรี ได้รับพระมหากรุณาธิคุณจาก สมเด็จพระกนิษฐาธิราชเจ้า กรมสมเด็จพระเทพรัตนราชสุดาฯ สยามบรมราชกุมารี เสด็จพระราชดำเนินทรงเปิด อาคารเรียน “สธ ๑, สธ ๒ และ สธ ๓” เมื่อกลางปี พ.ศ. 2525 และปลายปี พ.ศ. 2529 ตามลำดับ รวมทั้งพระบรมราชานุสาวรีย์ พระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว เมื่อกลางปี พ.ศ."},{"page_url":"https://io.wikipedia.org/wiki/Lobito","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Bras%C3%A3o_do_lobito2.jpg","page_title":"Lobito","context_page_description":"Lobito esas urbo en Angola. Segun statistiki dil yaro 2014, ol havis 324 050 habitanti. Entote ol havas 3648 km². Fondita en 1905, ol jacas an litoro di Atlantiko."},{"page_url":"https://pl.wikipedia.org/wiki/Mennica_w_Cieszynie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/3_krajcary_Cieszyn_1597.jpg","page_title":"Mennica w Cieszynie","context_page_description":"Mennica w Cieszynie – mennica Księstwa Cieszyńskiego-Oświęcimskiego działająca w Cieszynie, w której:\\nbito halerze,\\nKazimierz II bił w latach 1503–1504 halerze,\\nWacław III Adam bił:\\nkrajcary,\\ntalary,\\nna wzór polski:\\nhalerze,\\ntrzeciaki,\\npółgrosze,\\ngrosze,\\ntrojaki,\\nczworaki,\\nAdam Wacław bił:\\nhalerze,\\ntrzeciaki,\\n2 krajcary,\\n3 krajcary, między innymi wzorowane na polskich,\\ntrojaki typu polskiego,\\npółtalarowe klipy,\\ntalary,\\nFryderyk Wilhelm bił:\\ngroszyki,\\n3 krajcary,\\n12 krajcarów,\\n24 krajcary,\\ntalary,\\ntrojaki typu polskiego,\\nElżbieta Lukrecja biła:\\nobole,\\ngroszyki,\\nkrajcary,\\n3 krajcary,\\ntalary,\\nFerdynand IV bił:\\nobole,\\ngroszyki,\\n3 krajcary."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_Palencia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Quintanilla_de_la_Cueza_Villa_romana_Tejada_Habitaci%C3%B3n_17_Mosaico_Sv%C3%A1sticas_002.jpg","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh Palencia","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở Palencia."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%AE%D9%84%D8%A9_%D8%A7%D9%84%D8%AA%D9%85%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Date_fruits.JPG","page_title":"نخلة التمر","context_page_description":"النَخْلَةُ أو نَخلة التَمْر أو نَخلة البَلَح ‏ هي شجرة تنتمي إلى الفصيلة الفوفلية، وهي شجرة معمرة، لها ساق غليظة وأكثر ارتفاع مسجل لها وصل م، تتوجها أوراق ريشية كبيرة، والنخل نبات ثنائي المسكن فهناك نخل ذكري وآخر أنثوي، كلاهما يخرجان العراجين، وقد يحدث التلقيح طبيعياً، إلا أنه لضمان الكمية والنوعية والجودة يتوجب نقل بعض من العراجين الذكرية لرش طلعها على العراجين الأنثوية للتلقيح، وذلك عقب انشقاق الإغريض الحاوي على العراجين الأنثوية وبروزها منه، وبعد التلقيح يثمر العرجون عن أول طور من أطوار الثمر الخمسة والمسمى بالحَصَل، فالبَلَح، فالبُسْر، فالرُطب، وآخره التَمْر.\\nولا يعلم أصل موطن النخل، إلا أن العالم الإيطالي أدواردو بيكاري يدعي بأن موطن النخل الأصلي هو الخليج العربي، بينما يقول العالم دو كاندول بأنه \\" نشأ نخل التمر منذ عصور ما قبل التاريخ في المنطقة الشبه حارة الجافة التي تمتد من إلى حوض، وتنحصر غالباً بين خطي عرض 15 ْ، 30 ْ. وقد نشاهد نماذج منه مزروعة شمال هذه المنطقة لأسبابٍ غير اعتياديةٍ\\". وتعد المناطق التي أشار إليها دو كاندول من أكثف مناطق زرع نخل التمر منذ اكتشافه وإلى الوقت الحاضر.\\nإن زراعة نخل التمر بدأت في بلاد ما بين النهرين نحو 4000 ق.م. وفي مصر حوالي 3000-2000 ق."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B5%D0%B9%D0%BB%D0%BE%D1%80%D1%81-%D0%A4%D0%BE%D0%BB%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Taylors_Falls_Minnesota_downtown_looking_north_MN95_St_Croix_Scenic_Byway.jpg","page_title":"Тейлорс-Фолс","context_page_description":"Тейлорс-Фолс — місто в США, в окрузі Чисаго штату Міннесота. Населення — 976 осіб."},{"page_url":"https://en.wikipedia.org/wiki/American_Horror_Story:_Coven","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Sarah_Paulson_12_Years_a_Slave_55_cropped.jpg","page_title":"American Horror Story: Coven","context_page_description":"American Horror Story: Coven is the third season of the FX horror anthology television series American Horror Story, created by Ryan Murphy and Brad Falchuk. It premiered on October 9, 2013, and concluded on January 29, 2014. The season takes place in 2013, in New Orleans, and follows a coven of witches descended from Salem as they fight for survival. It also features flashbacks to 1692 during the infamous Salem Witch Trials, the 1830s, 1910s, 1960s, 1970s, and 1990s.\\nReturning cast members from the previous seasons of the series include Sarah Paulson, Taissa Farmiga, Frances Conroy, Evan Peters, Lily Rabe, Denis O’Hare, Jessica Lange, Jamie Brewer, Alexandra Breckenridge, and Robin Bartlett, along with new cast members Angela Bassett, Emma Roberts, Kathy Bates, and Gabourey Sidibe\\nLike its predecessors, Coven was met with both positive reviews and strong ratings, with the premiere episode attracting a series high of 5.54 million viewers, which at the time was the most viewed episode of the series."},{"page_url":"https://eu.wikipedia.org/wiki/Sidney_Lumet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Sydneylumet.jpg","page_title":"Sidney Lumet","context_page_description":"Sidney Lumet Ameriketako Estatu Batuetako zinema zuzendaria izan zen. 2005ean, bizitza osoko lorpenengatik Oscar saria jaso zuen."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D0%B0%D1%80_%D0%94%D0%B8%D0%BC%D0%B0_(%D1%81%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Jeannine_d%27Hauterive_n%C3%A9e_Dumas.jpg","page_title":"Александар Дима (син)","context_page_description":"Александар Дима (син) – француски романописец и драматург, најпознат по романот „Дамата со камелии“. Син е Александар Дима, исто така романописец и драматург."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%A5%87%E6%96%AF%E7%88%BE%E8%B5%AB%E6%96%AF%E7%89%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Royal_Parade_-_geograph.org.uk_-_1530906.jpg","page_title":"奇斯爾赫斯特","context_page_description":"奇斯爾赫斯特是英國英格蘭倫敦東南部郊區的一個地區，也是一個較為富裕的地區。在行政區劃上，奇斯爾赫斯特屬於布倫來倫敦自治市。奇斯爾赫斯特位於查令十字東南10.5英里處。當地的奇斯爾赫斯特洞在二戰期間曾被用作防空洞。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3%D0%B8_%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Flag_of_Smolninskoe_%28St_Petersburg%29.png","page_title":"Флаги Санкт-Петербурга","context_page_description":"Флаги муниципальных образований города Санкт-Петербурга Российской Федерации.\\nНа 1 января 2018 года в Санкт-Петербурге насчитывалось 111 муниципальных образований."},{"page_url":"https://vo.wikipedia.org/wiki/Trempealeau","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/WIMap-doton-Trempealeau.png","page_title":"Trempealeau","context_page_description":"Trempealeau binon zif in komot: Trempealeau, in tat: Wisconsin, in Lamerikän."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%B3%E3%83%AA%E3%83%BC%E3%83%BB%E3%83%9B%E3%83%96%E3%82%BD%E3%83%B3%E3%83%BB%E3%83%AA%E3%83%81%E3%83%A3%E3%83%BC%E3%83%89%E3%82%BD%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Ames_Free_Library_%28North_Easton%2C_MA%29_-_oblique_view.JPG","page_title":"ヘンリー・ホブソン・リチャードソン","context_page_description":"ヘンリー・ホブソン・リチャードソンは、19世紀アメリカ合衆国の著名な建築家であり、数多くの建築物を手掛けた中でもボストン、ピッツバーグ、オールバニおよびシカゴに重要な影響を残した。"},{"page_url":"https://ca.wikipedia.org/wiki/Maebashi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Maebashi20080227.jpg","page_title":"Maebashi","context_page_description":"Maebashi, en japonès:前橋市 Maebashi-shi, és una ciutat del Japó i la capital de la prefectura de Gunma. Ocupa una superfície de 241,22 km² i té 325.813 habitants.\\nAquesta ciutat va ser fundada l'1 d'abril de 1890. El 5 de desembre de 2004 l'antic poble d'Ogo i les viles de Kasukawa i Miyagi s'uniren a aquesta ciutat.\\nMaebashi va ser la seu del Campionat del Món d'atletisme en pista coberta de 1999."},{"page_url":"https://nl.wikipedia.org/wiki/Gediminas_Bagdonas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/MaillotLituania.PNG","page_title":"Gediminas Bagdonas","context_page_description":"Gediminas Bagdonas is een voormalig Litouws wielrenner die reed voor AG2R La Mondiale. Hij behaalde enkele overwinningen in Belgische wielerkoersen en was tevens succesvol op diverse Litouwse nationale kampioenschappen: hij werd in 2007, 2011 en 2018 nationaal kampioen tijdrijden en in 2012 en 2018 nationaal kampioen op de weg."},{"page_url":"https://es.wikipedia.org/wiki/Eva_Solla","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Eva_Solla_BNG.png","page_title":"Eva Solla","context_page_description":"Eva Solla Fernández es una enfermera y política española. Es militante y dirigente de Esquerda Unida y del Partido Comunista de Galicia. Es cabeza de lista de Galicia en Común - ANOVA Mareas por la provincia de Pontevedra en las elecciones al Parlamento de Galicia del 12 de julio."},{"page_url":"https://en.wikipedia.org/wiki/Suffolk_County_Sheriff%27s_Office","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Unit_376.JPG","page_title":"Suffolk County Sheriff's Office","context_page_description":"The Suffolk County Sheriff's Office is the oldest law enforcement agency in Suffolk County, New York, having been established in 1683. The Sheriff's Office currently employs over 1200 people, including 898 correction officers, 288 deputy sheriffs, and 130 civilian personnel. Its Office and Business Operations are located at the Riverhead Correctional Facility, 100 Center Drive South in Riverhead.\\nThe Sheriff of Suffolk County is the highest ranking Law Enforcement Officer in Suffolk County and is elected to the term of four years. In 2012, the Sheriff's Office became a New York State Accredited Law Enforcement Agency."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Rochefort-sur-S%C3%A9ran","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Chateau_de_Rochefort_sur_S%C3%A9ran_-_1.JPG","page_title":"Château de Rochefort-sur-Séran","context_page_description":"Le château de Rochefort est un ancien château fort, du XIIIᵉ siècle, centre de la seigneurie de Rochefort, dont les vestiges se dressent sur la commune de Cressin-Rochefort dans le département de l'Ain en région Auvergne-Rhône-Alpes."},{"page_url":"https://pt.wikipedia.org/wiki/Conus_pictus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Conus_pictus_1.jpg","page_title":"Conus pictus","context_page_description":"Conus pictus é uma espécie de gastrópode do gênero Conus, pertencente à família Conidae."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BD%D1%8E%D0%BA%D0%BE%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/RU_COA_Venjukov_VIII-25.jpg","page_title":"Венюковы","context_page_description":"Венюковы — древний русский дворянский род.\\nРод занесён в VI часть дворянских родословных книг: Курской, Московской и Рязанской губерний."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%B8_%D1%81%D0%BF%D0%BE%D0%BC%D0%B5%D0%BD%D0%B8%D1%86%D0%B8_%D0%BD%D0%B0_%D1%81%D0%B5%D0%BE%D1%81%D0%BA%D0%BE%D0%BC_%D0%B3%D1%80%D0%BE%D0%B1%D1%99%D1%83_%D1%83_%D0%91%D1%80%D0%B5%D0%B7%D0%BD%D0%B8_(%D0%BE%D0%BF%D1%88%D1%82%D0%B8%D0%BD%D0%B0_%D0%93%D0%BE%D1%80%D1%9A%D0%B8_%D0%9C%D0%B8%D0%BB%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Brezna_kraj_Gornjeg_Milanovca%2C_Kova%C4%8Devi%C4%87a_groblje_%2847%29.jpg","page_title":"Стари споменици на сеоском гробљу у Брезни (општина Горњи Милановац)","context_page_description":"Стари споменици на сеоском гробљу у Брезни (општина Горњи Милановац) представљају значајне споменичке целине и важан извор података за проучавање генезе становништва овог места."},{"page_url":"https://nl.wikipedia.org/wiki/Harry_K%C3%BCmel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Harry_K%C3%BCmel.jpg","page_title":"Harry Kümel","context_page_description":"Harry Kümel is een Belgisch filmregisseur."},{"page_url":"https://pl.wikipedia.org/wiki/Carabus_syrus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Carabus_syrus.JPG","page_title":"Carabus syrus","context_page_description":"Carabus syrus – gatunek chrząszcza z rodziny biegaczowatych i podrodziny Carabinae.\\nGatunek ten został opisany w 1898 roku przez Hansa Roeschke.\\nChrząszcz o ciele długości od 32 do 39 mm. Warga górna podzielona na dwa płaty. Bródka szeroka i o ściętym wierzchołku. Brzegi przedplecza bez punktów szczeciowych. Pokrywy gładkie. Samce o trzech członach stóp przednich rozszerzonych. Edeagus z zaokrąglonym wierzchołkiem środkowego płata.\\nPreferuje otwarte i półotwarte siedliska, zwłaszcza batha, rzadziej spotykany w lasach i zadrzewieniach.\\nWykazany z Libanu, Jordanii i północnego Izraela.\\nWyróżnia się 7 podgatunków tego biegacza:\\nCarabus syrus cheikensis Deuve, 1992\\nCarabus syrus eidae Deuve, 2002\\nCarabus syrus lecordieri Deuve, 1992\\nCarabus syrus moukarzelae Deuve, 2002\\nCarabus syrus pseudopinguis Heinz & Staven, 2000\\nCarabus syrus saidaensis Deuve, 1992\\nCarabus syrus syrus Roeschke, 1898"},{"page_url":"https://fr.wikipedia.org/wiki/Jour_de_la_Constitution_(Norv%C3%A8ge)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Barnetog_17mai.jpg","page_title":"Jour de la Constitution (Norvège)","context_page_description":"Le jour de la Constitution, plus couramment nommé syttende mai ou Nasjonaldagen en Norvège, est la fête nationale norvégienne.\\nElle est célébrée depuis 1814 le 17 mai, jour de l'adoption de la Constitution de Norvège. Ce jour-là, la Norvège acquit son indépendance par rapport au Danemark, et la Constitution fut signée. Les Norvégiens descendent dans la rue vêtus de costumes traditionnels. Ils font flotter les drapeaux et partagent des repas. Les enfants défilent devant le chateau du roi et de la reine."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%84%D8%A8%D8%B1%D9%88%D9%86_%D8%A8%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/CH_IT_Albrunpass_pano.jpg","page_title":"ألبرون باس","context_page_description":"ألبرون باس ‏ هو أحد جبال سلسلة جبال الألب ليبونتيني وجزء من القمة الأم يقع في بييمونتي, إيطاليا وكانتون فاليز, سويسرا. يبلغ ارتفاع الجبل حوالي 2409 متر، بينما يبلغ ارتفاع نتوء الجبل متر."},{"page_url":"https://en.wikipedia.org/wiki/Swarm_robotics","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/IRobot_Create_team.jpg","page_title":"Swarm robotics","context_page_description":"Swarm robotics is an approach to the coordination of multiple robots as a system which consist of large numbers of mostly simple physical robots. It is supposed that a desired collective behavior emerges from the interactions between the robots and interactions of robots with the environment. This approach emerged on the field of artificial swarm intelligence, as well as the biological studies of insects, ants and other fields in nature, where swarm behaviour occurs."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%B3%A8%E5%B4%99%E5%BB%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/%E5%B3%A8%E5%B4%99%E5%BB%9F%E6%98%AD%E5%92%8C%E5%9B%9B%E5%B9%B4%E9%8A%85%E9%90%98%E5%B1%80%E9%83%A8.jpg","page_title":"峨崙廟","context_page_description":"峨仑庙，是位于台湾苗栗县卓兰镇新厝里的三山国王庙，为该镇的信仰中心。"},{"page_url":"https://en.wikipedia.org/wiki/Den_Danske_Vitruvius","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Den_danske_Vitruvius_1_tab024_-_General_Grundtegning_af_Rosenborg_Slott_og_Have.jpg","page_title":"Den Danske Vitruvius","context_page_description":"Den Danske Vitruvius is a richly illustrated 18th-century architectural work on Danish monumental buildings of the period, written by the Danish Baroque architect Lauritz de Thurah. It was commissioned by Christian V in 1735 and published in two volumes between 1746 and 1749. The title refers to the Roman architect and engineer Vitruvius, who published De architectura in the 1st century AD, an authoritative treatise on the architecture of the time. The direct inspiration for de Thurah's Den Danske Vitruvius was Colen Campbell's Vitruvius Britannicus.\\nWith its numerous illustrations, Den Danske Vitruvius is a valuable source of information on the many Danish buildings of the mid-18th century, which have since been demolished, rebuilt or lost in fires.\\nA facsimile edition published in 1966–67 includes a third volume, based on an until then unpublished manuscript kept at the Royal Danish Library. It covers buildings completed later than 1749."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D1%82%D1%8E%D0%BA_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%90%D0%BD%D0%B4%D1%80%D1%96%D0%B9%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/2019-06-26_1st_FIG_Artistic_Gymnastics_JWCH_Men%27s_Training_26_June_Morning_1_Pommel_horse_%28Martin_Rulsch%29_094.jpg","page_title":"Костюк Володимир Андрійович","context_page_description":"Володимир Андрійович Костюк — український гімнаст. Майстер спорту"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%B2%D0%BE%D0%B4%D1%8B_%D1%80%D0%B0%D1%81%D1%81%D1%83%D0%B4%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Pers-brock-11.jpg","page_title":"Доводы рассудка","context_page_description":"«До́воды рассу́дка» — короткий бытовой роман Джейн Остин, написанный в 1816 году и опубликованный посмертно под одной обложкой с «Нортенгерским аббатством». Часть действия обеих книг происходит в курортном Бате. Роман четырежды экранизировался английским телевидением — в 1960, 1971, 1995 и 2007 годах."},{"page_url":"https://pl.wikipedia.org/wiki/Granica_polsko-czeska","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Granica_polsko-czeska.png","page_title":"Granica polsko-czeska","context_page_description":"Granica czesko-polska – granica międzypaństwowa pomiędzy Republiką Czeską a Rzeczpospolitą Polską.\\nCzechy są jednym z siedmiu państw graniczących obecnie z Polską. Stan ten utrzymuje się od 1 stycznia 1993 roku, gdy doszło do rozpadu Czechosłowacji. Obecna granica z Czechami stanowiła część granicy z Czechosłowacją i miała identyczny przebieg."},{"page_url":"https://en.wikipedia.org/wiki/Pietra_dura","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Pietradura_Compi%C3%A8gne.jpg","page_title":"Pietra dura","context_page_description":"Pietra dura or pietre dure, called parchin kari or parchinkari in the Indian Subcontinent, is a term for the inlay technique of using cut and fitted, highly polished colored stones to create images. It is considered a decorative art. The stonework, after the work is assembled loosely, is glued stone-by-stone to a substrate after having previously been \\"sliced and cut in different shape sections; and then assembled together so precisely that the contact between each section was practically invisible\\". Stability was achieved by grooving the undersides of the stones so that they interlocked, rather like a jigsaw puzzle, with everything held tautly in place by an encircling 'frame'. Many different colored stones, particularly marbles, were used, along with semiprecious, and even precious stones. It first appeared in Rome in the 16th century, reaching its full maturity in Florence. Pietra dura items are generally crafted on green, white or black marble base stones. Typically, the resulting panel is completely flat, but some examples where the image is in low relief were made, taking the work more into the area of hardstone carving."},{"page_url":"https://en.wikipedia.org/wiki/Kizhakkekallada","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Sreedurgadevetemple.jpg","page_title":"Kizhakkekallada","context_page_description":"Kizhakkekallada is a village in Kollam district in the state of Kerala, India.\\nEast Kallada or popularly known as Kizhakkekallada is a village located about 20 km north-east of Kollam."},{"page_url":"https://fr.wikipedia.org/wiki/A%C3%A9roport_de_Londres-Heathrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Looking_to_Terminal_2_at_Heathrow.jpg","page_title":"Aéroport de Londres-Heathrow","context_page_description":"L'aéroport d'Heathrow, également connu sous le nom de Londres Heathrow, est un aéroport international majeur à Londres, au Royaume-Uni. Heathrow est le deuxième aéroport le plus fréquenté au monde par le trafic international de passagers, ainsi que l'aéroport le plus fréquenté d'Europe par le trafic de passagers, et le septième aéroport le plus fréquenté au monde par le trafic total de passagers. C'est l'un des six aéroports internationaux desservant la région de Londres. En 2019, il a accueilli un record de 80,8 millions de passagers, soit une augmentation de 0,9% par rapport à 2018 ainsi que 475 861 mouvements d'aéronefs, soit une diminution de 1 743 par rapport à 2018. L'installation aéroportuaire appartient à Heathrow Airport Holdings et est exploitée par elle.\\nHeathrow se trouve à 14 miles à l'ouest du centre de Londres, et a deux est-ouest pistes parallèles ainsi que quatre terminaux opérationnels sur un site qui couvre 12,27 kilomètres carrés. L'aéroport est le hub principal de British Airways et la principale base d'exploitation de Virgin Atlantic."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D6%80%D6%87%D5%B8%D6%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Tr%C3%A9voux-%C3%A9glise_cot%C3%A9_ouest.JPG","page_title":"Տրևու","context_page_description":"Անվան այլ կիրառումների համար տե՛ս՝ Տրևու\\nՏրևու, ոչ մեծ քաղաք և համայնք Ֆրանսիայում, Ռոն Ալպեր մարզի Էն գավառում։ Գավառի կենտրոնը Տրևուն է։ Հանդիսանում է Բուրակ ան Բրես շրջանի օկրուգը։\\nՀամայնքի INSEE կոդ՝ 01427։"},{"page_url":"https://en.wikipedia.org/wiki/Zweibr%C3%BCcker","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Landgest%C3%BCt_Zweibr%C3%BCcken.jpg","page_title":"Zweibrücker","context_page_description":"The Zweibrücker is a type of German warmblood horse bred in Rhineland-Palatinate and Saarland. Traditionally, the breeding of Zweibrücken was centered on the onetime Principal Stud of Zweibrücken but since 1977 has been under the jurisdiction of the Horse Breeders' Association of Rhineland-Palatinate-Saar. The modern Zweibrücker is an elegant, large-framed, correct sport horse with powerful, elastic gaits suitable for dressage, show jumping, eventing and combined driving."},{"page_url":"https://en.wikipedia.org/wiki/Hospitality","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Bringing_in_the_Boar%27s_Head.jpg","page_title":"Hospitality","context_page_description":"Hospitality is the relationship between a guest and a host, wherein the host receives the guest with goodwill, including the reception and entertainment of guests, visitors, or strangers. Louis, chevalier de Jaucourt describes hospitality in the Encyclopédie as the virtue of a great soul that cares for the whole universe through the ties of humanity. Hospitality is also the way people treat others, that is the service of welcoming receiving guests for example in hotels. Hospitality plays a fundamental role to augment or decrease the volume of sales of an organization hence every business should master it.\\nHospitality ethics is a discipline that studies this usage of hospitality."},{"page_url":"https://eo.wikipedia.org/wiki/Gyula_Prinz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Prinz_Gyula1.jpg","page_title":"Gyula Prinz","context_page_description":"Gyula Prinz [djula princ], laŭ hungarlingve kutima sinsekvo Prinz Gyula estis hungara geologo, geografo, vojaĝisto, etnografo, profesoro, membro de Hungara Scienca Akademio.\\nGyula Prinz naskiĝis la 11-an de januaro 1882 en Rábamolnári. Li mortis la 31-an de decembro 1973 en Budapeŝto."},{"page_url":"https://en.wikipedia.org/wiki/Timber_framing","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Half-timbered_tudor_buildings%2C_High_Holborn.JPG","page_title":"Timber framing","context_page_description":"Timber framing and \\"post-and-beam\\" construction are traditional methods of building with heavy timbers, creating structures using squared-off and carefully fitted and joined timbers with joints secured by large wooden pegs. It is commonplace in wooden buildings through the 19th century. If the structural frame of load-bearing timber is left exposed on the exterior of the building it may be referred to as half-timbered, and in many cases the infill between timbers will be used for decorative effect. The country most known for this kind of architecture is Germany. Timber framed houses are spread all over the country except in the southeast.\\nThe method comes from working directly from logs and trees rather than pre-cut dimensional lumber. Hewing this with broadaxes, adzes, and draw knives and using hand-powered braces and augers and other woodworking tools, artisans or framers could gradually assemble a building.\\nSince this building method has been used for thousands of years in many parts of the world, many styles of historic framing have developed."},{"page_url":"https://hu.wikipedia.org/wiki/Langelsheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Heimatmuseum_Langelsheim.jpg","page_title":"Langelsheim","context_page_description":"Langelsheim település Németországban, azon belül Alsó-Szászország tartományban. Lakosainak száma 11 361 fő. +/- Langelsheim Hahausen és Lutter am Barenberge községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/Electoral_system_of_Turkey","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Electoral_districts_of_Turkey_2015.png","page_title":"Electoral system of Turkey","context_page_description":"The Electoral system of Turkey varies for general, presidential and local elections that take place in Turkey every five years. Turkey has been a multi-party democracy since 1950, with the first democratic election held on 14 May 1950 leading to the end of the single-party rule established in 1923. The current electoral system for electing Members of Parliament to the Grand National Assembly has a 10% election threshold, the highest of any country.\\nA brief summary of the electoral systems used for each type of election is as follows:\\nGeneral elections: The D'Hondt method, a party-list proportional representation system, to elect 600 Members of Parliament to the Grand National Assembly from 87 electoral districts that elect different numbers of MPs depending on their populations.\\nLocal elections: Metropolitan and District Mayors, Municipal and Provincial Councillors, neighbourhood presidents and their village councils elected through a First-past-the-post system, with the winning candidate in each municipality elected by a plurality."},{"page_url":"https://it.wikipedia.org/wiki/Potenziometria","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Potentiometrics_meas_1st_2nd_deriv-with-legend.JPG","page_title":"Potenziometria","context_page_description":"La potenziometria è generalmente l'insieme dei metodi analitici che si basano sulla misura della differenza di potenziale di una cella galvanica in condizione di assenza di corrente. La tipica strumentazione utilizzata in potenziometria comprende un elettrodo di riferimento, il cui potenziale deve essere noto, costante nel tempo e indipendente dalla composizione della soluzione contenente l'analita in cui è immerso, un elettrodo di lavoro, la cui risposta dipende dalla concentrazione dell'analita, e infine un dispositivo per la misura del potenziale che può essere rappresentato da un potenziometro di Poggendorf o un moderno voltmetro elettronico."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B8%D1%82%D0%B8%D1%85%D0%BE%D0%B2%D0%B8%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Litichovice%2Cmunicipal_office.jpg","page_title":"Литиховице","context_page_description":"Литиховице је насељено мјесто са административним статусом сеоске општине у округу Бенешов, у Средњочешком крају, Чешка Република."},{"page_url":"https://fi.wikipedia.org/wiki/Laivakronometri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Henry_Sully_clock_with_escapement_and_suspension_mechanism.jpg","page_title":"Laivakronometri","context_page_description":"Laivakronometri on erikoisvalmisteinen, hyvin tarkkakäyntinen kello, jota käytetään laivoissa astro­nomiseen navigointiin pituusasteen määrittämiseksi merellä. Kun sellainen 1700-luvulla saatiin kehitetyksi, se oli suuri tekninen saavutus, sillä pitkillä meri­matkoilla ajan tarkka mittaus oli navigoinnin vuoksi välttämätöntä. Ensimmäinen todellinen krono­metri oli yhden keksijän, John Harrisonin elämäntyö, jota hän kehitteli 31 vuotta tehden kokeita. Kun hän lopulta sai sen käyttö­kelpoiseksi ja hyväksytyksi, se mullisti merenkulun ja vauhditti osaltaan tutkimus­matkoja sekä myös siirto­maiden valloituksia.\\nNimitys kronometri on muodostettu kreikan kielen aikaa tarkoittavasta sanasta khronos sekä mittaamista tarkoittavasta sanasta metros. Tiettävästi ensimmäisenä sitä käytti saksalainen professori Matthias Wassmut vuonna 1684 eräässä teoreettisessa tutkielmassaan. Nykyään kronometrilla tarkoitetaan testattua ja sertifioitua kelloa, joka täyttää säädetyt tarkkuus­vaatimukset. Sveitsissä voimassa olevien säädösten mukaan sana chronometer saa olla merkittynä Sveitsin virallisen kronometrien testaus­instituutin sertifioimiin kelloihin."},{"page_url":"https://nl.wikipedia.org/wiki/Marshall_Eriksen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/JasonSegelHWOFSept2011.jpg","page_title":"Marshall Eriksen","context_page_description":"Marshall Eriksen is een personage uit de Amerikaanse tv-serie How I Met Your Mother, bedacht door Carter Bays en Craig Thomas. De rol wordt vertolkt door Jason Segel."},{"page_url":"https://is.wikipedia.org/wiki/Eris_(dvergreikistjarna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/2006-16-a-full-1-.jpg","page_title":"Eris (dvergreikistjarna)","context_page_description":"Eris, reikistirnisnafn: 136199 Eris, er massamesta dvergreikistjarnan á sporbaug um sólu og níunda massamesta fyrirbærið í sólkerfinu. Hún er talin hafa þvermálið 2.326 km og vera 27% þyngri en Plútó eða um það bil 0,27% af massa jarðarinnar.\\nTeymi sem starfaði undir stjórn Mike Brown í Palomar-stjörnuathugunarstöðinni fann Eris í janúar 2005 og tilvist hennar var staðfest síðar það ár. Hún er útstirni handan brautar Neptúnusar og tilheyrir einnig flokki dreifstirna sem eru útstirni sem ganga um sólina eftir mjög ílöngum brautum. Eina þekkta tungl hennar er Dysnómía. Árið 2011 var Eris stödd 96,6 stjarnfræðieiningar frá sólinni eða þrisvar sinnum fjær sólu en Plútó. Ef frá eru taldar sumar halastjörnur þá eru Eris og Dysnómía fjarlægustu þekktu fyrirbæri sólkerfisins.\\nÞar sem Eris virtist vera stærri en Plútó þá lýstu uppgötvarar hennar og NASA henni í fyrstu sem tíundu reikistjörnunni. Vegna þessa og vegna vaxandi líka á því að fleiri áþekkir hnettir myndu finnast ákvað Alþjóðasamband stjarnfræðinga að skilgreina í fyrsta skiptið hugtakið „reikistjarna“."},{"page_url":"https://de.wikipedia.org/wiki/Salvatore_Di_Giacomo","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Salvatore_Di_Giacomo.jpg","page_title":"Salvatore Di Giacomo","context_page_description":"Salvatore Di Giacomo war ein italienischer Dichter, Dramatiker und Essayist.\\nEr war einer der führenden Textdichter der „Goldenen Ära“ der „Canzone napoletana“\\nDer Sohn eines Arztes und einer Musikerin begann auf Wunsch des Vaters ebenfalls Medizin zu studieren, gab aber das Studium 1886 auf und wurde Journalist beim Corriere del Mattino, dann beim Corriere di Napoli, Pro Patria und der Gazzetta. Ab 1893 war der lokalhistorisch interessierte Autor als Bibliothekar verschiedener kultureller Institutionen tätig. Di Giacomo gilt als einer der Erneuerer der neapolitanischen Mundartdichtung. Viel beklatscht wurde seine Beziehung zu Sängerin Emilia Persico. Politisch unterstützte der Dichter ab 1925 den Faschismus, was ihm einige Ehrungen und Würden eintrug."},{"page_url":"https://lv.wikipedia.org/wiki/Merkurs_(plan%C4%93ta)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Mariner10.gif","page_title":"Merkurs (planēta)","context_page_description":"Merkurs ir Saulei tuvākā un mazākā Saules sistēmas planēta. Merkurs apriņķo Sauli 88 dienās, tā arī ir planēta ar lielāko orbītas ekscentritāti. Merkuram nav pavadoņu. Merkurs ir arī mazāks par Saules sistēmas lielākajiem pavadoņiem — Jupitera pavadoni Ganimēdu un Saturna pavadoni Titānu. Merkurs pie debesīm ir samērā spožs, taču, tā kā tas atrodas netālu no Saules, to ir grūti novērot Saules spožuma dēļ — vislabāk Merkurs saskatāms agros rītos vai vēlos vakaros, pirms saullēkta vai pēc saulrieta. Salīdzinot ar citām Saules sistēmas planētām, par Merkuru ir zināms diezgan maz — to pētījis tikai daži zinātniskie aparāti, un ar teleskopiem no Zemes iespējams novērot tikai apgaismoto Merkura daļu. Merkurs bijis zināms arī senajām kultūrām — senākās dokumentētās ziņas par Merkura novērojumiem datētas ar pirmo gadu tūkstoti pirms mūsu ēras."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%83%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D1%85_%D1%81%D0%BF%D0%BE%D1%80%D1%82%D1%81%D0%BC%D0%B5%D0%BD%D1%96%D0%B2_%E2%80%94_%D1%83%D1%87%D0%B0%D1%81%D0%BD%D0%B8%D0%BA%D1%96%D0%B2_%D0%9E%D0%BB%D1%96%D0%BC%D0%BF%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D1%85_%D1%96%D0%B3%D0%BE%D1%80_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Natalya_Fokina-Semenova.jpg","page_title":"Список українських спортсменів — учасників Олімпійських ігор 2016","context_page_description":"Літні олімпі́йські і́гри — універсальне пансвітове міжнародне спортивне змагання з багатьох видів олімпійських видів та підвидів спорту за участю атлетів, які представляють національні олімпійські комітети, які проводяться кожні чотири роки під егідою Міжнародного олімпійського комітету.\\nУкраїнські спортсмени — учасники Олімпійських ігор 2016 — виключно ті українські спортсмени, що брали участь у змаганнях чи перебували у заявці на найпрестижніших спортивних змаганнях — літніх Олімпійських іграх 2016 року, та мають безпосередній стосунок до України, зокрема власне представники України, а також спортсмени, що представляли інші збірні до прийняття українського громадянства чи після того, як стали громадянами інших держав, уродженці України, що представляли інші національні команди на час участі в Олімпійських іграх, що відбуваються у Ріо-де-Жанейро, Бразилія з 3 по 21 серпня 2016 року, вихованці українського спорту, що народилися поза межами України та уродженці України, що представляли інші національні команди на час участі на цій Олімпіаді, а також етнічні українці та особи українського походження, що народилися поза межами України та представляли інші збірні."},{"page_url":"https://ceb.wikipedia.org/wiki/Bellardia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Bellardia.pandia.-.lindsey.jpg","page_title":"Bellardia","context_page_description":"Henero sa mga langaw ang Bellardia. Ang Bellardia sakop sa kabanay nga Calliphoridae."},{"page_url":"https://sl.wikipedia.org/wiki/Podzemska_svinjka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Aardvark_area.png","page_title":"Podzemska svinjka","context_page_description":"Podzemska svinjka, znana tudi po afrikanskem imenu aardvark, je vrsta sesalcev iz reda cevozobcev, ki živi v podsaharski Afriki. Ta nenavadna, nočno aktivna žival, ki je edini še živeči predstavnik cevozobcev, po telesni zgradbi nekoliko spominja na križanca med prašičem in mravljinčarjem, vendar je podobnost z njima zgolj navidezna, saj je najbolj sorodna afriškim rilčastim skakačem ter tenrekom.\\nKljub svojim posebnostim, med katerimi je najizrazitejša specializiranost na prehranjevanje s termiti in mravljami, je razmeroma številčna in široko razširjena, zato ne velja za ogroženo. Najpogostejša je v odprti krajini, izogiba pa se puščavam, gostim deževnim gozdovom in območjem s kamnitim površjem."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_staatlichen_Orden_und_Medaillen_der_Ukraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Orden-danilo-galitsky.jpg","page_title":"Liste der staatlichen Orden und Medaillen der Ukraine","context_page_description":"Die Liste der staatlichen Orden und Medaillen der Ukraine führt die Verdienstorden und Verdienstmedaillen auf, die durch die Ukraine verliehen werden.\\nDie Staatspreise der Ukraine sind die höchste Form der Ehrung sowohl für ukrainischen Bürger als auch für Ausländer, für herausragende Leistungen bei der Entwicklung von Wirtschaft, Wissenschaft, Kultur, soziale Dienste, Heimatschutz, Schutz der verfassungsmäßigen Rechte und Freiheiten, Staatsaufbau und sozialen Aktivitäten und andere Leistungen in der Ukraine in Übereinstimmung mit dem Gesetz der Ukraine über „Staatliche Auszeichnungen der Ukraine“ Nr. 1549, III vom 16. März 2000."},{"page_url":"https://sv.wikipedia.org/wiki/Henrik_Svalander","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Henrik_Svalander_.jpg","page_title":"Henrik Svalander","context_page_description":"Henrik Otto Svalander, född 7 mars 1980, är en svensk skådespelare och har sedan 2008 jobbat på Malmö stadsteaters."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B7%D0%BC%D0%B0%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ruined_dolmen_near_Mezmay1.jpg","page_title":"Мезмай","context_page_description":"Мезмай — посёлок в Апшеронском районе Краснодарского края России. Административный центр Мезмайского сельского поселения."},{"page_url":"https://ast.wikipedia.org/wiki/Archaeopteryx","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Archeopteryx_color.jpg","page_title":"Archaeopteryx","context_page_description":"Archaeopteryx ye un xéneru estinguíu d'aves primitives, con calteres entemedios ente los dinosaurio emplumaos y les aves modernes. El nome deriva del griegu antiguu ἀρχαῖος que significa «antiguu», y πτέρυξ, que significa «pluma» o «nala». N'español suel acastellanase como arqueópterix. Dende'l SIEGLU|XIX||s}} foi xeneralmente aceptáu polos paleontólogos, y señaláu nes obres de consulta como l'ave más antigua conocida. Sicasí, identificáronse aviales potencialmente más antiguos, incluyendo a Anchiornis, Xiaotingia y Aurornis.\\nArchaeopteryx vivió nel periodu Xurásicu Cimeru fai unos 150 millones d'años, no que güei ye'l sur d'Alemaña, mientres un momentu en que Europa yera un archipiélagu d'islles nun mar tropical templáu pocu fondu, muncho más cerca del ecuador de lo que ta agora. Similar en forma a una pega europea, con individuos más grandes, posiblemente, algamaren el tamañu d'un cuervu. Archaeopteryx podría crecer a alredor de 0,5 m de llargor. A pesar del so pequeñu tamañu, presentaba amplies ales y l'habilidá inferida de volar o entamar, Archaeopteryx tien más de mancomún con otros pequeños dinosaurios del Mesozoicu que coles aves modernes."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D9%85%D8%B1%DB%8C%DA%A9%DB%8C_%D8%B9%D8%A7%D9%84%D9%85%DB%8C_%D8%AB%D9%82%D8%A7%D9%81%D8%AA%DB%8C_%D9%88%D8%B1%D8%AB%DB%81_%D9%85%D9%82%D8%A7%D9%85%D8%A7%D8%AA_%DA%A9%DB%8C_%D9%81%DB%81%D8%B1%D8%B3%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Baja_California_Sur.jpg","page_title":"امریکی عالمی ثقافتی ورثہ مقامات کی فہرست","context_page_description":"یہ یونیسکو کے عالمی ثقافتی ورثہ کی ایک فہرست ہے جس میں شمالی امریکا، وسطی امریکہ، جنوبی امریکا اور کیریبین شامل ہیں۔ گرین لینڈ کے یورپ کے ساتھ ثقافتی اور سیاسی تعلق کے باوجود یہاں شمالی امریکا کے حصہ کے طور پر شامل کیا گیا ہے۔"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC1%E9%99%8D%E4%B8%8B%E7%8C%9F%E5%85%B5%E5%B8%AB%E5%9B%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Bundesarchiv_Bild_141-0864%2C_Kreta%2C_Landung_von_Fallschirmj%C3%A4gern.jpg","page_title":"第1降下猟兵師団","context_page_description":"第1降下猟兵師団は、第二次世界大戦時のドイツ空軍の精鋭パラシュート降下部隊である。当時のドイツ国防軍の空挺兵の師団は降下猟兵師団という用語で呼ばれ、元々は第7航空師団として編成された部隊が1943年に第1降下猟兵師団に改称された。"},{"page_url":"https://it.wikipedia.org/wiki/Giada","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Nephrite_jordanow_slaski.jpg","page_title":"Giada","context_page_description":"La giada è una pietra dura mineralogicamente appartenente ai silicati. Con il nome di giada si indicano di solito la nefrite, un silicato di calcio e magnesio, e la giadeite, un silicato di sodio e alluminio. La nefrite si trova in Turkestan orientale e in Siberia, nella zona del lago Baikal; mentre la giadeite proviene dalla Birmania e giunge in Cina attraverso le Province di Yunnan e Guangdong solo nelle seconda metà del XVIII secolo. Perciò tutta la giada antica è esclusivamente nefrite. Spesso presenta un tono verde/verdastro per effetto della presenza del cromo."},{"page_url":"https://ca.wikipedia.org/wiki/Eleccions_generals_espanyoles_de_1898","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/USSMaine.jpg","page_title":"Eleccions generals espanyoles de 1898","context_page_description":"Les eleccions generals espanyoles de 1898 foren convocades el 27 de març de 1898 sota sufragi universal masculí. En total foren escollits 401 diputats, endemés dels 16 de Puerto Rico i 30 de Cuba. La legislatura fou marcada per l'esclat de la Guerra Hispano-estatunidenca, que suposà la derrota de les tropes espanyoles i la pèrdua de les darreres colònies americanes.\\nVencé per majoria el Partit Liberal, dirigit per l'incombustible Práxedes Mateo Sagasta. Quan als conservadors, trasbalsats per l'assassinat del seu líder Cánovas del Castillo, es presentaren amb el seu nou cap Francisco Silvela, encara que un petit sector no el reconegué i es presentà encapçalat pel duc de Tetuán. Quan als republicans, es presentaren novament amb la Fusión Republicana liderada per Nicolás Salmerón, però no va poder comptar amb el Partit Republicà Progressista ni amb el Partit Republicà Democràtic Federal, que demanaren l'abstenció.\\nFou elegit president del Congrés el liberal Antonio Aguilar y Correa, marqués de la Vega de Armijo, i com a president del Senat Eugenio Montero Ríos. El cap de govern fou Práxedes Mateo Sagasta."},{"page_url":"https://sv.wikipedia.org/wiki/Archontophoenix_alexandrae","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Archontophoenix_alexandrae.jpg","page_title":"Archontophoenix alexandrae","context_page_description":"Archontophoenix alexandrae är en enhjärtbladig växtart som först beskrevs av Ferdinand von Mueller, och fick sitt nu gällande namn av Hermann Wendland och Carl Georg Oscar Drude. Archontophoenix alexandrae ingår i släktet Archontophoenix och familjen Arecaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Fahrzeugkran","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Terex-Demag_AC60_1.jpg","page_title":"Fahrzeugkran","context_page_description":"Ein Fahrzeugkran oder Mobilkran ist ein fahrbarer Auslegerkran auf einem Rad- oder Kettenfahrwerk.\\nDie ersten leistungsfähigen Fahrzeugkrane wurden in den 1960er Jahren entwickelt. Sie verfügten bereits über dieselelektrische und dieselhydraulische Antriebe und konnten mit einem Teleskopausleger schwere Lasten schnell und sicher bewegen. Im Laufe der darauffolgenden Jahrzehnte wurden die Reichweite und die maximal mögliche Traglast stetig verbessert."},{"page_url":"https://en.wikipedia.org/wiki/No%C3%ABl_P%C3%A9ri","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Noel_Peri.jpg","page_title":"Noël Péri","context_page_description":"Noël Péri was a French Catholic priest. A missionary and author, he was responsible for translating the Gospels into Japanese and published the first research journal devoted to Japanese topics. He read and wrote broadly about Japanese culture, including studies of Buddhist history and mythology, and as a result came into conflict with some members of the Catholic missionary community. A trained musician, he also taught Western music in Japan and wrote early Western works on Japanese opera and music theory, and Noh drama."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_localit%C4%83%C8%9Bi_din_jude%C8%9Bul_Gorj","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/RO_GJ_Turcinesti_2018_%281%29.jpg","page_title":"Listă de localități din județul Gorj","context_page_description":"Lista de mai jos cuprinde toate localitățile din județ în ordine alfabetică.\\nAceastă listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://en.wikipedia.org/wiki/Le_R%C5%93ulx","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/0_Le_Roeulx_-_Grand%27Place_%281%29.JPG","page_title":"Le Rœulx","context_page_description":"Le Rœulx is a Walloon municipality located in the Belgian province of Hainaut. On January 1, 2006, Le Rœulx had a total population of 7,977. The total area is 42.80 km² which gives a population density of 186 inhabitants per km².\\nThe municipality consists of the following sub-municipalities: Le Rœulx proper, Gottignies, Mignault, Thieu, and Ville-sur-Haine.\\nThe Château du Rœulx, a family seat of the Comtes de Croÿ-Rœulx, is situated near the town."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_de_Bobadilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Col%C3%B3n_encadenado_en_La_Gorda.png","page_title":"Francisco de Bobadilla","context_page_description":"Francisco Fernández de Bobadilla fue un oficial castellano de la Casa Real y un caballero de la Orden de Calatrava, hermano de doña Beatriz Fernández de Bobadilla, marquesa de Moya y Peñalosa, protectora esta de Cristóbal Colón, dama y gran amiga de Isabel la Católica. Fue enviado como juez a la isla de La Española, donde arrestó a Colón por supuestas irregularidades en su gobierno. Ejerció el cargo de gobernador general de las Indias desde 1500 hasta 1502. Falleció en el mar, cuando una tempestad destruyó el barco donde navegaba."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D9%84%D8%A7%D9%8A%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Talayuela.png","page_title":"تالايلا","context_page_description":"بلدية تالايلا، هي بلدية تقع في مقاطعة قصرش والتي تقع في منطقة إكستريمادورا، غرب إسبانيا.\\nيبلغ عدد سكانها 9.582 نسمة وفقاً لإحصائية سنة.، وتبلغ مساحتها 229 كم2،و بذلك تكون الكثافة السكانية 41,84 نسمة/كم2. يبلغ ارتفاعها 287 م عن سطح البحر."},{"page_url":"https://pl.wikipedia.org/wiki/Ford_Model_T","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/1908_Ford_Model_T.jpg","page_title":"Ford Model T","context_page_description":"Ford T – samochód osobowy produkowany pod amerykańską marką Ford w latach 1908 – 1927."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%88%B9%E8%88%B6%E5%B7%A5%E5%AD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Z-Drive_side_view.PNG","page_title":"船舶工学","context_page_description":"船舶工学とは、船舶に関する工学である。特に設計理論や造船工作に関わる領域を指して造船学とも言う。\\n本項目では水上船舶の工学について説明する。潜水艦やホバークラフト、水上での表面効果を利用した航空機などは別記事を参照のこと。"},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B1%8A%E7%94%B0%E5%B8%82%E3%81%AE%E5%9F%8B%E8%94%B5%E6%96%87%E5%8C%96%E8%B2%A1%E3%81%AE%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Hirai-Otsuka_Kofun_03%2C_Hirai-cho_Toyota_2019.jpg","page_title":"豊田市の埋蔵文化財の一覧","context_page_description":"豊田市の埋蔵文化財の一覧は、愛知県豊田市内における埋蔵文化財に関する一覧である。"},{"page_url":"https://nn.wikipedia.org/wiki/Fylkesveg_255_i_Akershus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Fylkesvei_255.JPG","page_title":"Fylkesveg 255 i Akershus","context_page_description":"Fylkesveg 255 i Akershus går mellom Smestua og Arteidmoen i Sørum kommune. Vegen er 3,9 km lang."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%DB%8C%DA%A9%D9%88%D9%84_%D8%A8%D9%87%D8%A7%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Nicole_Beharie_SDCC_2014_%28cropped%29.jpg","page_title":"نیکول بهاری","context_page_description":"|اؤلوم تاریخ =\\n|اؤلوم یئر =\\n|مزارلیقی=\\n|اؤلوم سببی=\\n|حیات یوْلداشی=\\n|اۇشاقلاری=\\n|ایمضا=\\n| وب‌سایت =\\n}}\\nنیکول بهاری آمریکالی موغنی و اوْیونچو ۲۰۰۸–گۆنوموز ایللر آراسیندا سینما ساحه‌سینده چالیشیب."},{"page_url":"https://en.wikipedia.org/wiki/Desevio_Payne","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Desevio_Payne_USA-Columbia%2C_FIFA_U20_World_Cup_%2818498009079%29_%28cropped%29.jpg","page_title":"Desevio Payne","context_page_description":"Desevio Ilan Payne is an American soccer player who plays as a defender for FC Emmen in the Eredivisie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Arnstein_(Sachsen-Anhalt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Dorfkirche_Alterode.JPG","page_title":"Liste der Kulturdenkmale in Arnstein (Sachsen-Anhalt)","context_page_description":"In der Liste der Kulturdenkmale in Arnstein (Sachsen-Anhalt) sind alle Kulturdenkmale der Gemeinde Arnstein und ihrer Ortsteile aufgelistet. Grundlage ist das Denkmalverzeichnis des Landes Sachsen-Anhalt, das auf Basis des Denkmalschutzgesetzes vom 21. Oktober 1991 durch das Landesamt für Denkmalpflege und Archäologie Sachsen-Anhalt erstellt und seither laufend ergänzt wurde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wien/D%C3%B6bling/Grinzing%E2%80%93Neustift_am_Wald","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Heiligenstadt_%28Wien%29_-_Nepomukstatue%2C_Eroicagasse.JPG","page_title":"Liste der denkmalgeschützten Objekte in Wien/Döbling/Grinzing–Neustift am Wald","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wien-Döbling enthält die denkmalgeschützten, unbeweglichen Objekte des 19. Wiener Gemeindebezirks Döbling.\\nDieser Teil der Liste enthält die 202 Objekte in den Katastralgemeinden Grinzing, Heiligenstadt, Josefsdorf, Kahlenbergerdorf und Neustift am Wald. Für die anderen Katastralgemeinden siehe Liste der denkmalgeschützten Objekte in Wien/Döbling/Nussdorf–Untersievering."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8B%89%E8%BF%AA%E5%A7%86%E8%AF%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Radymno_Centrum.jpg","page_title":"拉迪姆诺","context_page_description":"拉迪姆诺是波兰喀尔巴阡山省的一个镇。"},{"page_url":"https://es.wikipedia.org/wiki/Piripiri","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Piaui_Municip_Piripiri.svg","page_title":"Piripiri","context_page_description":"Piripiri es un municipio del estado de Piauí, Brasil. El área es de 1. 408.928 km ²​aproximadamente. La ciudad tiene cerca de 61 840 hab.​ Piripiri puede ser clasificada como la cuarta ciudad más poblada del estado de Piauí, siendo superado solo por Teresina, Parnaiba y Picos. La Ciudad posee Tropical llegando a registrar temperaturas de 26°C a 38°C.​\\nPiripiri se destaca económicamente por ser la segunda mayor industria de confección del estado, produciendo cerca de 300 unidades de fibra, todas en micro y medianas empresas. Además de eso la ciudad se destaca en el turismo con varias atracciones como la \\"Presa Calderón\\".\\nOtros de las atracciones es El Santuário de Nossa Senhora dos Remédios, que tiene una enorme estatua."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bamberg/Kaulberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Bamberg%2C_Sutte_1%2C_20150927%2C_001.jpg","page_title":"Liste der Baudenkmäler in Bamberg/Kaulberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen kreisfreien Stadt Bamberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Teilliste enthält die Denkmäler im Gebiet der ehemaligen Immunität Kaulberg mit Sutte und Matern gemäß der Aufteilung der Buchreihe Die Kunstdenkmäler von Bayern."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D0%B8%D1%98%D0%B0%D0%BC_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Silver_penny_of_William_II_%28YORYM_2000_2062%29_obverse.jpg","page_title":"Вилијам II","context_page_description":"Вилијам II бил крал на Англија во периодот од 1087 до 1100 година. Тој е втор син на Вилијам I. Познат е како Вилијам Црвениот.\\nТочната дата на неговото раѓање денеска е сѐ уште непозната, но се смета дека е помеѓу 1056 до 1060 година. По заземањето на англискиот трон од страна на неговиот татко, Вилијам I ги распоредил дел од своиите имоти на своите деца. Тоа била причината да се создаде конфликт помеѓу нив. Најголемиот син, Роберт, ја добил Нормандија, Вилијам ја добил Англија, а Хенри добил 5.000 фунти злато.\\nПоголемиот дел од норманските барони пристапиле на страната на Роберт, главно поради големата алчност на Вилијам. Но неговиот прв обид да ја заземе Англија завршил со неуспех. Во 1096 година, Роберт се договорил со својот брат да ја преземе контролата над Нормандија, а наспроти тоа да добие 10.000 марки, пари кои му биле потребни за финансирање на Првата крстоносна војна. По смртта на Вилијам II, Роберт повторно ја зазел Нормандија.\\nВилијам II од Англија ги продолжил реформите на својот татко. Тој бил решен да го зголеми целосно своето богатство, воведувајќи големи даноци, конфискација казни. Тој вовел и посебни даноци за црквата."},{"page_url":"https://pt.wikipedia.org/wiki/N%C3%BAmero_complexo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Carl_Friedrich_Gauss.jpg","page_title":"Número complexo","context_page_description":"O fato de um número negativo não ter raiz quadrada parece ter sido claro para os matemáticos que se depararam com esta questão, até a concepção do modelo dos números complexos. Um número complexo é um número que pode ser escrito na forma, sendo e números reais e denota a unidade imaginária. Esta tem a propriedade sendo que e são chamados respectivamente parte real e parte imaginária de.\\nO conjunto dos números complexos, denotado por, contém o conjunto dos números reais. Munido de operações de adição e multiplicação obtidas por extensão das operações de mesma denominação nos números reais, adquire uma estrutura algébrica denominada corpo algebricamente fechado, sendo que esse fechamento consiste na propriedade que tem o conjunto de possuir todas as soluções de qualquer equação polinomial com coeficientes naquele mesmo conjunto. O conjunto dos números complexos também pode ser entendido por seu isomorfismo com um espaço vetorial sobre, o conjunto dos reais.\\nAlém disso, a cada número complexo podemos atribuir um número real positivo chamado módulo, dado por:\\nO módulo de z, visto como uma norma no espaço vetorial, conduz a um espaço normado topologicamente completo."},{"page_url":"https://en.wikipedia.org/wiki/Linda_Gray","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Larry_Hagman_and_Linda_Gray.jpg","page_title":"Linda Gray","context_page_description":"Linda Ann Gray is an American film, stage and television actress, director, producer and former model, best known for her role as Sue Ellen Ewing, the long-suffering wife of Larry Hagman's character J.R. on the CBS television drama series Dallas, for which she was nominated for the 1981 Primetime Emmy Award for Outstanding Lead Actress in a Drama Series. The role also earned her two Golden Globe Award nominations.\\nGray began her career in the 1960s in television commercials. In the 1970s, she appeared in numerous TV series before landing the role of Sue Ellen Ewing in 1978. After leaving Dallas in 1989, she appeared opposite Sylvester Stallone in the 1991 film Oscar. From 1994 to 1995, she played a leading role in the Fox drama series Models Inc., and also starred in TV movies, including Moment of Truth: Why My Daughter? and Accidental Meeting. She went on to reprise the role of Sue Ellen in Dallas: J.R. Returns, Dallas: War of the Ewings, and in the TNT series Dallas, which continued the original series.\\nOn stage, Gray starred as Mrs. Robinson in The Graduate in the West End of London in 2001, then on Broadway the following year."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%AF%D0%BA%D0%BE_%D0%AF%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Nauka_kristianska_za_kristianete_od_filibeliskata_Darxiava_by_Jakovsky_.png","page_title":"Яко Яковски","context_page_description":"Яко Яковски или Яков Яковски е католически духовник, автор на първите български печатни книги за католиците в Южна България, енорийски свещеник, просветител и учител."},{"page_url":"https://ro.wikipedia.org/wiki/Teodor_Boti%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Teodor_Botis.png","page_title":"Teodor Botiș","context_page_description":"Teodor Botiș a fost un deputat în Marea Adunare Națională de la Alba Iulia, organismul legislativ reprezentativ al „tuturor românilor din Transilvania, Banat și Țara Ungurească”, cel care a adoptat hotărârea privind Unirea Transilvaniei cu România, la 1 decembrie 1918."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E5%9B%BD%E9%99%86%E5%86%9B%E7%8E%B0%E5%BD%B9%E4%B8%AD%E5%B0%86%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Lt._Gen._Andrew_P._Poppas.jpg","page_title":"美国陆军现役中将列表","context_page_description":"按照美國法典第10卷第32章第525節之規定，陸軍內部最多可配備上將7位、少將以上45位，目前陸軍內部實際配備上將6位，因此中將最多可配39位，目前陸軍內部實際配備中將為34名，另有聯合職位中將16名。註：同時兼任陸軍職位和聯合職位的陸軍將領，在本列表中算入陸軍內部，如美國第八軍團司令同時兼任駐韓聯合國軍參謀長。"},{"page_url":"https://it.wikipedia.org/wiki/Parco_Giovanni_Palatucci","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/ParcoGiovanniPalatucci3.JPG","page_title":"Parco Giovanni Palatucci","context_page_description":"Il parco Giovanni Palatucci, noto anche come parco Tor Tre Teste - Alessandrino, è un parco di Roma nel quartiere Alessandrino, nel territorio amministrato dal Municipio Roma V."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%89%98%E6%96%AF%E5%8D%A1%E7%BA%B3%E5%A4%A7%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Chimera_di_Arezzo.jpg","page_title":"托斯卡纳大区","context_page_description":"托斯卡尼，也譯為托斯卡納、塔斯卡尼，是義大利一個大區，拉吉歐位於其南，溫布利亞位於其東，艾米利亞-羅馬涅和利古里亞在其北，西瀕第勒尼安海。它經常被評價為義大利的最美麗的部分。其首府為佛羅倫斯。\\n托斯卡尼以其美麗的風景和豐富的藝術遺產而著稱。已有6處被列為世界遺產：佛羅倫斯歷史中心、比薩主教座堂廣場、聖吉米尼亞諾歷史中心、西恩納歷史中心、皮恩扎歷史中心和瓦爾道爾契亞。\\n托斯卡尼實質上是義大利文藝復興的發源地，它的藝術遺產包括建築學、繪畫及雕塑、被許多的博物館收藏，而最知名的博物館是位於佛羅倫斯的烏菲茲美術館，而很多小城市亦有這些博物館。托斯卡尼是李奧納多·達·文西、米開朗基羅及但丁的出生地。托斯卡尼也以釀酒著名，境內並有120受保護地區。\\n托斯卡尼最著名的旅遊熱點包括佛羅倫斯、西恩納、比薩、盧卡、里窩那、馬薩、科雷特-色內西地區、盧尼芝安和加法那拿地區及厄爾巴島。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/UA026-17.jpg","page_title":"Знаки поштової оплати України 2017","context_page_description":"Знаки поштової оплати України 2017 — перелік поштових марок, введених в обіг Укрпоштою у 2017 році.\\nЗ 20 січня по 22 грудня 2017 року було випущено 78 поштових марок, у тому числі 70 пам'ятних, 8 стандартних дев'ятого випуску та сувенірний марковий аркуш стандартних поштових марок незалежної України восьмого випуску. Тематика комеморативних марок охопила ювілеї визначних дат, подій, пам'яті видатних діячів культури та інши. До обігу надійшли знаки поштової оплати номіналом від 2,40 до 12,80 гривні, а також додатковий тираж восьмого випуску стандартних марок із літерним номіналом «Є», «Ж», «F», «G», «H», «L», «M», «N», «P», «T», «V», «X».\\nПерелік відсортований за датою введення."},{"page_url":"https://sv.wikipedia.org/wiki/Caterina_Cornaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Lotto_Adoration_of_the_Child_%28detail%29.jpg","page_title":"Caterina Cornaro","context_page_description":"Caterina Cornaro, född 25 november 1454 i Venedig i republiken Venedig, död där 10 juli 1510, var kungadömet Cyperns sista monark och regerande drottning från 1474 till 1489. Hon var ursprungligen drottning av Cypern genom giftermål med kung Jakob II av Cypern, och regent under sin omyndige son Jakob III av Cypern 1473–1474. Hon avsattes då kungadömet annekterades av republiken Venedig, där hon fick ställningen \\"dotter av venetianska republiken\\" och suverän härskare av Asolo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%82%AA%E3%83%80%E3%82%A4%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/CaodaismSymbol.PNG","page_title":"カオダイ教","context_page_description":"カオダイ教は、ベトナムの新宗教。1919年、ゴ・ミン・チェウとレ・ヴァン・チャウンによって唱えられた。五教の教えを土台にしたことから、カオダイ＝高臺と名付けられた。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%9E%D0%BB%D1%8C%D0%B3%D0%B8_%D0%9A%D0%BE%D0%B1%D0%B8%D0%BB%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%BE%D1%97_(%D0%A7%D0%B5%D1%80%D0%BD%D1%96%D0%B2%D1%86%D1%96)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Chernivtsi_Kobylianska_4.jpg","page_title":"Вулиця Ольги Кобилянської (Чернівці)","context_page_description":"Ву́лиця О́́льги Кобиля́нської — одна з центральних вулиць Чернівців. Розташована у Першотравневому районі міста. Починається з Центральної площі і закінчується на перехресті з вулицею Тараса Шевченка. Виникла в 40-50-х рр. 18 ст. Сучасна назва — з 27 листопада 1940 року, на честь видатної української письменниці Ольги Кобилянської."},{"page_url":"https://de.wikipedia.org/wiki/Darwinopterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Darwinopterus_NT.jpg","page_title":"Darwinopterus","context_page_description":"Darwinopterus ist eine Gattung der Flugsaurier aus dem Mitteljura von China.\\nDie Gattung wurde zu Ehren des Begründers der modernen Evolutionstheorie Charles Darwin benannt, dessen zweihundertster Geburtstag im Jahr der wissenschaftlichen Erstbeschreibung 2009 gefeiert wurde. Einzige beschriebene Art der Gattung ist Darwinopterus modularis."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_des_Stortings_(2017%E2%80%932021)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Olaug_Bollestad_%28KrF%29.JPG","page_title":"Liste der Mitglieder des Stortings (2017–2021)","context_page_description":"Diese Liste gibt einen Überblick über alle Mitglieder des Stortings, dem norwegischen Nationalparlament, die bei der Parlamentswahl 2017 gewählt wurden. Die Legislaturperiode dauert bis Herbst 2021 an. Dem Parlament gehören 169 Personen an, die Regierung Solberg regierte zwischenzeitlich mit einer Mehrheit im Parlament, meist allerdings als Minderheitsregierung."},{"page_url":"https://es.wikipedia.org/wiki/London_Business_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/London_Business_School_06.jpg","page_title":"London Business School","context_page_description":"La Escuela de Negocios de Londres, en Londres, Reino Unido es una escuela de negocios internacional y una universidad constitutiva de la universidad de Londres. Ofrece cursos de posgrado en finanzas y gestión empresarial, incluyendo tanto el MBA como otros cursos dirigidos a ejecutivos: Executive MBA, Master en Finanzas o su MBA Global en colaboración con la Columbia Business School. Está situada en Londres, a un costado del parque Regent´s Park y fue establecida en el año 1965 como parte de la Universidad de Londres.\\nCerca de 800 alumnos, provenientes de 70 países, se gradúan de la escuela cada año de sus diferentes programas. Más del 80% de los estudiantes y 70% de la facultad, vienen de fuera del Reino Unido. Con más de 5,000 ejecutivos atendiendo a los programas ejecutivos de la escuela cada año. La escuela tiene más de 27,000 ex-alumnos en más de 120 países, organizados a través de los 60 clubs de ex-alumnos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BD%D0%BD%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D1%82%D1%80%D0%BE%D0%BB%D0%BB%D0%B5%D0%B9%D0%B1%D1%83%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Ziy5vinnitsia.jpg","page_title":"Винницкий троллейбус","context_page_description":"Винницкий троллейбус был открыт 18 февраля 1964 года. По состоянию на 2020 год имеется 15 маршрутов, 86,6 км сети и 167 машин."},{"page_url":"https://en.wikipedia.org/wiki/Greek_literature","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Adamantios_Korais.jpg","page_title":"Greek literature","context_page_description":"Greek literature dates back from the ancient Greek literature, beginning in 800 BC, to the modern Greek literature of today.\\nAncient Greek literature was written in an Ancient Greek dialect, literature ranges from the oldest surviving written works until works from approximately the fifth century AD. This time period is divided into the Preclassical, Classical, Hellenistic, and Roman periods. Preclassical Greek literature primarily revolved around myths and include the works of Homer; the Iliad and the Odyssey. The Classical period saw the dawn of drama and history. Three philosophers are especially notable: Socrates, Plato, and Aristotle. During the Roman era, significant contributions were made in a variety of subjects, including history, philosophy, and the sciences.\\nByzantine literature, the literature of the Byzantine Empire, was written in Atticizing, Medieval and early Modern Greek. Chronicles, distinct from historics, arose in this period. Encyclopedias also flourished in this period.\\nModern Greek literature is written in common Modern Greek. The Cretan Renaissance poem Erotokritos is one of the most significant works from this time period."},{"page_url":"https://en.wikipedia.org/wiki/Sharp_Zaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Sharp_Zaurus_SL-C1000_--_open_1280x960.jpg","page_title":"Sharp Zaurus","context_page_description":"The Sharp Zaurus is the name of a series of personal digital assistants made by Sharp Corporation. The Zaurus was the most popular PDA during the 1990s in Japan and was based on a proprietary operating system. The first Sharp PDA to use the Linux operating system was the SL-5000D, running the Qtopia-based Embedix Plus. The Linux Documentation Project considers the Zaurus series to be \\"true Linux PDAs\\" because their manufacturers install Linux-based operating systems on them by default. The name derives from the common suffix applied to the names of dinosaurs."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%B0%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Moravsk%C3%A1_orlice.jpg","page_title":"Морави","context_page_description":"Мора́ви — Чехин шира регион. Моравийн даймохк."},{"page_url":"https://nl.wikipedia.org/wiki/Koninklijk_Theater_Carr%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Koninklijk_Nederlands_Circus_Oscar_Carr%C3%A9.jpg","page_title":"Koninklijk Theater Carré","context_page_description":"Koninklijk Theater Carré is een theater in Amsterdam en is gelegen aan de Amstel. Het heette oorspronkelijk Circus Carré en is gebouwd in de classicistische stijl. Het werd eind 19e eeuw opgericht door Oscar Carré."},{"page_url":"https://fr.wikipedia.org/wiki/Grottes_d%27%C3%89l%C3%A9phanta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Elephanta_Caves_Gangadhara.jpg","page_title":"Grottes d'Éléphanta","context_page_description":"Les grottes d'Éléphanta sont un groupe de temples excavés dans une falaise et conservant un ensemble monumental de sculptures. Elles sont situées sur l'île d'Éléphanta, une île de la mer d'Arabie, à 11 km. au large de Bombay, en Inde. Le site est inscrit au patrimoine mondial depuis 1987 sous le nom de « grottes d'Elephanta »."},{"page_url":"https://sk.wikipedia.org/wiki/1982","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Aksel_Lund_Svindal_Hinterstoder_2011.jpg","page_title":"1982","context_page_description":"2. apríl – Argentína obsadila Falklandy, Južnú Georgiu a Južné Sandwichské ostrovy, začiatok Vojny o Falklandy\\n16. september – masaker v Sabre a Šatíle, 328 až 3 500 civilistov – palestínskych Arabov prišlo o život\\n25. september – demonštrácia v Tel Avive, 400 000 ľudí požadovalo odstúpenie predsedu vlády Menachema Begina\\n1. október – Helmut Kohl sa stal spolkovým kancelárom Nemecka\\n30. november – Michael Jackson vydal album Thriller, ktorý je najpredávanejším hudobným albumom v histórii\\n10. december – v jamajskom Montego Bay bol podpísaný Dohovor Organizácie Spojených národov o morskom práve"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9C%E0%A6%BE%E0%A6%AE%E0%A7%87%E0%A6%B0_%E0%A6%AE%E0%A6%BF%E0%A6%A8%E0%A6%BE%E0%A6%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Ghor_Province_Afghanistan_Jam_Village.jpg","page_title":"জামের মিনার","context_page_description":"জামের মিনার পূর্ব আফগানিস্তানে অবস্থিত ইউনেস্কো কর্তৃক ঘোষিত একটি বিশ্ব ঐতিহ্যবাহী স্থান। এটি হারি নদীর তীরে ঘোর রাজ্যের সাহরাক জেলায় অবস্থিত। ২৪০০ মিটার পর্যন্ত উচু পাহার বেস্টিত ৬৫ মিটার উচু এই মিনার, সম্পূর্ণ পোড়া মাটির ইট দিয়ে ১১৯০ সালে নির্মিত হয়েছে। মিনারটি তার জটিল ইট, আস্তর এবং পালিশ করা টালি সজ্জার জন্য প্রসিদ্ধা, যার মধ্যে বিভিন্ন ক্যালিগ্রাফি যেমন কুফিক, নাস্খ, বিভিন্ন জ্যামিতিক আকার এবং কুরআনের আয়াত খোদাই করা রয়েছে।"},{"page_url":"https://vo.wikipedia.org/wiki/Weldon_Spring","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/St._Charles_County_Missouri_Incorporated_and_Unincorporated_areas_Weldon_Spring_Highlighted.svg","page_title":"Weldon Spring","context_page_description":"Weldon Spring binon zif in komot: St. Charles, in tat: Missouri, in Lamerikän."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%8A%D8%A7%D9%84%D9%89_%D8%B4%D8%A7%D9%85%D9%8A%D8%AA%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/20160714_EL_Austria_vs_Kukesi_1588.jpg","page_title":"يالى شاميتى","context_page_description":"يالى شاميتى لاعب كورة قدم من البانيا."},{"page_url":"https://sco.wikipedia.org/wiki/Leet_o_ceeties_in_Turkey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Atakent_Susano%C4%9Flu_Mersin_Province.JPG","page_title":"Leet o ceeties in Turkey","context_page_description":"This is a leet o ceeties in Turkey bi population, which includes ceeties that are provincial caipitals or hae a population o at least 7,000."},{"page_url":"https://es.wikipedia.org/wiki/Eddelak","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Eddelak_in_HEI.PNG","page_title":"Eddelak","context_page_description":"Eddelak es un municipio situado en el distrito de Dithmarschen, en el estado federado de Schleswig-Holstein, con una población a finales de 2016 de unos 1363 habitantes.​\\nSe encuentra ubicado al oeste del estado, cerca del mar del Norte y a poca distancia al norte del canal de Kiel."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radebeul-Niederl%C3%B6%C3%9Fnitz_(M%E2%80%93Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Radebeul_Haus_Salem_Nebengeb%C3%A4ude.JPG","page_title":"Liste der Kulturdenkmale in Radebeul-Niederlößnitz (M–Z)","context_page_description":"Die Liste der Kulturdenkmale in Radebeul-Niederlößnitz (M–Z) gibt eine Übersicht über die Kulturdenkmale im Stadtteil Niederlößnitz der sächsischen Stadt Radebeul anhand des Stands der Denkmalliste vom 24. Mai 2012. Aufgrund der Größe der Liste wurden die Straßen auf zwei Teile verteilt.\\nEine weitere Liste zeigt ehemalige Bau-/Kulturdenkmale dieses Stadtteils.\\nEinen Überblick über die Radebeuler Kulturdenkmale gibt die Liste der Kulturdenkmale in Radebeul, eine Zusammenfassung aller Adressen mit Kulturdenkmalen gibt die Liste der Kulturdenkmaladressen in Radebeul. Die Zuordnung der Straßen zum Stadtteil findet sich in der Liste der Straßen und Plätze in Radebeul-Niederlößnitz.\\nGrundlage der Auflistung sind die angegebenen Quellen. Diese Angaben ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://it.wikipedia.org/wiki/Bellegarde-en-Marche","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Bellegarde-en-Marche_tour_Horloge_%283%29.jpg","page_title":"Bellegarde-en-Marche","context_page_description":"Bellegarde-en-Marche è un comune francese di 441 abitanti situato nel dipartimento della Creuse nella regione della Nuova Aquitania."},{"page_url":"https://cs.wikipedia.org/wiki/Nep%C3%A1lsk%C3%A1_vlajka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Pre_1962_Flag_of_Nepal.png","page_title":"Nepálská vlajka","context_page_description":"Vlajka Nepálu je tvarem naprosto výjimečná vlajka, která se skládá ze dvou nestejně vysokých karmínových, modře lemovaných pravoúhlých trojúhelníků položených nad sebou. V horním trojúhelníku se nachází stylizovaná bílá silueta Měsíce s osmi paprsky, v dolním pak silueta Slunce s dvanácti paprsky. K poslední změně vlajky došlo v roce 1962, kdy byly vypuštěny kresby tváří ze symbolů Měsíce a Slunce."},{"page_url":"https://nn.wikipedia.org/wiki/Assyria","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Human-headed_winged_bull_Khorsabad_profile_-_Louvre_02b.jpg","page_title":"Assyria","context_page_description":"Assyria var eit oldtidsrike ved Tigris i Mesopotamia, i eit område som no hovudsakleg ligg i nordlege Irak. Det utvikla seg på 1000-talet f.Kr. til eit omfattande rike, og blei i løpet av det første hundreåret f.Kr., under Det nyassyriske riket, til det største imperiet som hadde vore i Levanten.\\nRiket oppstod rundt den gamle hovudstaden Assur. På 700-talet f.Kr. blei hovudstaden flytta til Ninive. Begge byane låg i eit trekanta kjerneområde mellom den øvre delen av Tigris og Vesle Zab.\\nAssyria og Babylonia var rivalar som hadde stor påverknad på kvarandre. Det assyriske landområdet blei utvida mot sør då dei fekk overtaket på babylonarane, medan Babylonia blei utvida mot nord då babylonarane fekk overtaket. I 721 f.Kr. erobra assyrarane Samaria og gjorde Nord-riket av Israel til ein assyrisk provins. Dei klarte ikkje å hærta hovudstaden i Juda, Jerusalem.\\nI 609 f.Kr. blei Assyria overvunne av Det nybabylonske riket då Ninive fall for den babylonske erobringshæren. Assyria heldt fram med å vera ein provins i dei påfølgjande rika: Babylonia, Medarriket, Akaemenidane, Seleucidane, Partia, Romarriket og Sassanidane fram til 600-talet, då Det arabiske riket erobra området."},{"page_url":"https://fr.wikipedia.org/wiki/San_(lettre_grecque)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/San_%28%CF%BA%CF%BB%29.png","page_title":"San (lettre grecque)","context_page_description":"San est une lettre archaïque de l'alphabet grec, notant probablement une sonorité proche de [s]. D'une graphie similaire à un Μ moderne, elle est une alternative au sigma dans certains alphabets grecs archaïques, où elle est placée entre le pi et le koppa. Il est possible qu'elle descende de la lettre Sade, de l'alphabet phénicien."},{"page_url":"https://ht.wikipedia.org/wiki/Burns_Flat,_Oklahoma","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/OKMap-doton-BurnsFlat.PNG","page_title":"Burns Flat, Oklahoma","context_page_description":"Burns Flat se yon vil nan eta Oklahoma, nan Etazini."},{"page_url":"https://de.wikipedia.org/wiki/Wiener_Bezirkszeitung","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/BZ_Logo_ab2018_RGB.jpg","page_title":"Wiener Bezirkszeitung","context_page_description":"Die bz-Wiener Bezirkszeitung, kurz \\"bz\\", ist eine wöchentlich erscheinende Gratiszeitung in Wien. Die bz ist in 23 Bezirksausgaben gegliedert, die in der Struktur der Wiener Gemeindebezirke in Wiener Haushalten erscheinen.\\nDie bz-Wiener Bezirkszeitung GmbH ist seit 2009 unter dem Dach der Regionalmedien Austria AG, die als 50/50 Joint Venture von der Styria Media Group AG und der Moser Holding AG gegründet wurde."},{"page_url":"https://ro.wikipedia.org/wiki/Huleaipole","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/%D0%93%D1%83%D0%BB%D1%8F%D0%B9%D0%BF%D1%96%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B0_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%BD%D0%B0_%D1%80%D0%B0%D0%B4%D0%B0_01.JPG","page_title":"Huleaipole","context_page_description":"Huleaipole este orașul raional de reședință al raionului Huleaipole din regiunea Zaporijjea, Ucraina. În afara localității principale, mai cuprinde și satele Marfopil, Vesele, Zatîșșea și Zelenîi Hai."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_d%27agermanaments_de_municipis_valencians","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Albalat~Mozac.jpg","page_title":"Llista d'agermanaments de municipis valencians","context_page_description":"Açò és una llista d'agermanaments de municipis valencians, ordenats alfabèticament per nom del municipi: els agermanaments d'Altea, pertanyents al Douzelage, apareixen marcats en blau.\\nNo s'hi inclouen altres agermanaments, com els de la Província de València amb la província de l'Havana i la província de Buda, o el del País Valencià amb Mie Ken.\\nDe tots els agermanaments amb comunes de la República Francesa, quaranta-nou són amb viles d'Occitània, entre les quals capitals com Menton, Niça, Sisteron o Tolosa."},{"page_url":"https://nl.wikipedia.org/wiki/Zigeunervervolging","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Bundesarchiv_Bild_183-S72707%2C_Heinrich_Himmler_Recolored.jpg","page_title":"Zigeunervervolging","context_page_description":"De zigeunervervolging is de vervolging van Roma tijdens de Tweede Wereldoorlog. Het is het Roma-equivalent van de Holocaust.\\nPorajmos betekent in het Romani: 'de verslinding'. Deze reeds eerder door de Roma gebruikte term werd pas begin jaren negentig in de wetenschappelijke literatuur geïntroduceerd door Roma-wetenschapper Ian Hancock. Andere Roma-woorden die voor de genocide worden gebruikt zijn Samudaripen en Pharrajimos."},{"page_url":"https://en.wikipedia.org/wiki/List_of_prime_ministers_of_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Manuel_Aza%C3%B1a_1933_%28cropped%29.jpg","page_title":"List of prime ministers of Spain","context_page_description":"The Prime Minister of Spain is the head of government of Spain. There is no specific date when the office of Prime Minister first appeared as the role was not created, but rather evolved over a period of time through merger of duties. Modern historians have not managed to agree who the first Prime Minister of Spain was. However, Francisco Martinez de la Rosa was the first Prime Minister recognized by a constitutional law and Felipe González the longest-serving Prime Minister to have been officially referred to as such.\\nIn the current modern Spain, the first Prime Minister of the Kingdom of Spain since the approval of the Constitution was Adolfo Suárez. Due to the gradual evolution of the post of Prime Minister, the title is applied to early Prime Ministers only retrospectively and so this list includes those who have been referred to with various titles. Since the reign of Philip V, the Prime Ministers have received several titles such as Secretary of State, President of the Council of Ministers, President of the Executive Power or President of the Government, among others."},{"page_url":"https://gl.wikipedia.org/wiki/Morfolox%C3%ADa_(biolox%C3%ADa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Gegenbaur.jpg","page_title":"Morfoloxía (bioloxía)","context_page_description":"En bioloxía, a morfoloxía é a disciplina encargada do estudo da forma e estrutura dun organismo ou sistema. A morfoloxía é unha ciencia biolóxica que trata da forma e transformacións dos seres orgánicos."},{"page_url":"https://pl.wikipedia.org/wiki/Cynamonowiec","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Canelle_Cinnamomum_burmannii_Luc_Viatour.jpg","page_title":"Cynamonowiec","context_page_description":"Cynamonowiec – rodzaj roślin z rodziny wawrzynowatych. Obejmuje ok. 250 gatunków, które pierwotnie występowały tylko we wschodniej i południowo-wschodniej Azji. Obecnie uprawiane w całej strefie klimatu subtropikalnego. Wszystkie gatunki zawierają gruczołki, w których zbierają się olejki eteryczne. Gruczołki te znajdują się w całych roślinach. Gatunkiem typowym jest Cinnamomum verum J. S. Presl."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BB%A3%E7%94%B0%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Hong_Shui_Court_%28better_contrast%29.jpg","page_title":"廣田邨","context_page_description":"廣田邨，前名「藍田南邨」，是香港的一個公共屋邨，位於香港九龍觀塘區藍田碧雲道160－172號，於1989-90年動工，1992年落成入伙。\\n康栢苑及康瑞苑均是居者有其屋屋苑，在廣田邨旁邊，分別在1993年及1999年落成，有七座及一座樓宇。"},{"page_url":"https://de.wikipedia.org/wiki/Museum_des_Warschauer_Aufstandes","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Budynek_Muzeum_Powstania_Warszawskiego_2017.jpg","page_title":"Museum des Warschauer Aufstandes","context_page_description":"Das Museum des Warschauer Aufstandes ist ein Geschichtsmuseum in Warschau. Es thematisiert die Ereignisse des Warschauer Aufstandes, der vom 1. August bis zum 2. Oktober 1944 dauerte. Das Museum war das erste multimediale Museum Polens.\\nEs wurde am Vortag des 60. Jahrestags des Ausbruchs des Warschauer Aufstandes, am 31. Juli 2004 im Gebäude des stillgelegten Straßenbahn-Elektrizitätswerkes an der Ulica Grzybowska 79 im Stadtteil Wola, vom damaligen Warschauer Stadtpräsidenten Lech Kaczyński feierlich eröffnet.\\nDie Dauerausstellung würdigt zum einen den Einsatz der Aufständischen für ein freies Polen und legt zum anderen einen Schwerpunkt auf das Engagement der Zivilgesellschaft und auf die demokratischen Strukturen, die sich in diesem zwei Monate lang existierenden unabhängigen polnischen „Staat“ etablieren konnten. Neben dem Aufstand selbst werden die Grauen der vorhergehenden Besatzung, der internationale Kontext des Aufstandes sowie das Schicksal der Aufständischen in der polnischen Volksrepublik thematisiert.\\nDas Museum versteht sich auch als kulturelle Institution und führt wissenschaftliche und pädagogische Projekte zu Themen des Warschauer Aufstandes und zu Warschau durch."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E6%96%B9%E6%96%AF%E7%92%B0%E7%A4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Alphonse_Group.png","page_title":"阿方斯環礁","context_page_description":"阿方斯環礁是東非國家塞席爾的環礁，屬於阿方斯群島的一部分，位於聖弗朗索瓦環礁以北3公里，土地面積1.74平方公里，潟湖面積約6平方公里，島上有機場設施，人口少於300。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Baumschulenweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Neuk%C3%B6lln_Bweg_JohCh-FannyZobelBr%C3%BCcke_P8250034_%283%29.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Baumschulenweg","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Baumschulenweg beschreibt das Straßensystem im Berliner Ortsteil Baumschulenweg mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze. Seit dem Groß-Berlin-Gesetz 1920 gehört Baumschulenweg offiziell zu Berlin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D0%BB%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Distribution_of_Languages_and_Religious_groups_of_Sri_Lanka_1981.jpg","page_title":"Ларакалла","context_page_description":"Ларакалла, мавры — народ Шри-Ланки.\\nЛаракалла, проживающие на Шри-Ланке, населяют прибрежные города. Численность составляла 1 404 534 к 2005 году.\\nНазвание «мавры» впервые было дано португальцами. Распространение ислама относится к VIII веку."},{"page_url":"https://en.wikipedia.org/wiki/Roberto_Abbondanzieri","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Roberto_Abbondanzieri.jpg","page_title":"Roberto Abbondanzieri","context_page_description":"Roberto Carlos \\"Pato\\" Abbondanzieri is an Argentine former footballer who played as a goalkeeper. He spent most of his career at Boca Juniors in his homeland, as well as Getafe of La Liga and Internacional of Brazil. He is currently the assistant manager of Pachuca.\\nAbbondanzieri earned 49 caps for the Argentina national football team from 2004 to 2008, playing at two Copa America tournaments and the 2006 FIFA World Cup."},{"page_url":"https://nl.wikipedia.org/wiki/Burg_Kniphausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Burg_Kniphausen_-_Wilhelmshaven_07.jpg","page_title":"Burg Kniphausen","context_page_description":"Burg Kniphausen is een kasteel in Fedderwarden, gemeente Wilhelmshaven, in Nedersaksen in Duitsland, dat in 1438 gebouwd werd. In 1666 werd het kasteel uitgebreid.\\nMomenteel is het Oost-Friese kasteel in particulier bezit."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Lohhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Lohhof_Kreuzgang.jpg","page_title":"Kloster Lohhof","context_page_description":"Das Kloster Lohhof liegt in Lohhof, einem Ortsteil von Mindelheim an der Bundesstraße 16."},{"page_url":"https://fi.wikipedia.org/wiki/Kuullottaminen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Valkosipulia_kuullotetaan_neitsytoliivi%C3%B6ljyss%C3%A4.jpg","page_title":"Kuullottaminen","context_page_description":"Kuullottaminen eli freesaus on ruoka-aineen kuumentamista ja pehmentämistä vähässä rasvassa siten, että siihen tulee hiukan väriä, mutta niin ettei se ruskistu. Kuullotus tehdään kattilassa, padassa tai paistinpannussa. Sipulit kuullotetaan läpikuultaviksi, jauhot jätetään vaaleiksi ja kasvikset saadaan nopeasti kuumiksi."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%99%D0%B5%D0%B2%D0%B8%D0%BD%D0%B0_%D0%91%D0%BE%D1%85%D0%B5%D0%BC%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Germans_in_western_Austro-Hungaria.gif","page_title":"Краљевина Бохемија","context_page_description":"Краљевина Бохемија, позната и као Чешко краљевство, била је краљевина на подручју данашње Чешке и историјске покрајине Бохемије."},{"page_url":"https://ca.wikipedia.org/wiki/Llenguatge_regular","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Chomsky-hierarchy.svg","page_title":"Llenguatge regular","context_page_description":"En matemàtiques, lògica i complexitat computacional un llenguatge formal és un llenguatge regular si es pot expressar usant expressions regulars.\\nTambé es pot definir un llenguatge regular com aquell que reconeix un autòmat finit. L'equivalència entre les expressions regulars i autòmats finits es demostra al teorema de Kleene, Aquest tipus de llenguatges s'etiqueten com de tipus 3 en la jerarquia de Chomsky dels llenguatges formals.\\nEls llenguatges regulars son força útils en l'anàlisi d'entrades i el disseny de llenguatges de programació."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%B0%D0%BA%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cibkecathedral.jpg","page_title":"Буаке","context_page_description":"Буа́ке́ — город в Кот-д’Ивуаре. Город является административным центром области Валле-дю-Бандама и департамента Буаке. Население — около 536 189 чел. Является штаб-квартирой с/х исследовательского института Африканский центр риса. Центр римско-католической архиепархии Буаке."},{"page_url":"https://uz.wikipedia.org/wiki/Darxonariq","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/%D0%9A%D0%B0%D0%BD%D0%B0%D0%BB%D1%8B_%D0%90%D0%BA%D0%BA%D1%83%D1%80%D0%B3%D0%B0%D0%BD_%D0%B8_%D0%94%D0%B0%D1%80%D1%85%D0%B0%D0%BD.JPG","page_title":"Darxonariq","context_page_description":"Darxonariq — Toshkent viloyati va shahridan oʻtuvchi Salor kanalining hozirgi temir yoʻl koʻprigidan yuqoriroqda oʻng qirgʻogʻidan boshlanuvchi kanal. 1950-y.lar oxirida yuqori oʻzani tekislab yuborilgach, qolgan qismi Oqqoʻrgʻon kanalining chap shoxobchasiga aylantirildi. Asosan shim.-sharkdan jan.-gʻarbga tomon oqadi. Bosh qismi Oqqoʻrgʻon koʻchasi boʻylab oʻtgan. Uz. 3,1 km. Suv sarfi 0,155 m3/sek. Mirzo Ulugʻbek shahar tumani hududi orqali oʻtadi. 1972 y. taʼmirlandi. Suvi oqovalar bilan ifloslangan. D.da 3 qaynama, 7 quvur-koʻprik, 9 tarmoq bor."},{"page_url":"https://it.wikipedia.org/wiki/Presidenza_di_John_Adams","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/1_dollar_John_Adams.jpg","page_title":"Presidenza di John Adams","context_page_description":"La presidenza di John Adams ebbe inizio il 4 marzo del 1797 con la cerimonia d'inaugurazione e relativo insediamento del presidente degli Stati Uniti d'America e si concluse il 4 marzo del 1801. Adams, che aveva servito in qualità di Vicepresidente nel corso della presidenza di George Washington, assunse l'incarico di 2º Presidente degli Stati Uniti d'America dopo aver vinto le elezioni presidenziali del 1796.\\nUnico membro del Partito Federalista ad aver assunto l'alto incarico, la sua amministrazione si concluderà dopo un solo mandato a causa della sconfitta subita alle successive elezioni presidenziali del 1800. Gli succederà il Vice Thomas Jefferson, esponente di punta del Partito Democratico-Repubblicano.\\nQuando Adams entrò in carica le guerre rivoluzionarie francesi stavano causando gravi difficoltà ai mercanti americani in alto mare suscitando al contempo un'intensa partecipazione partigiana tra i contendenti delle diverse correnti politiche a livello nazionale. Il suo mandato fu caratterizzato da uno stato di \\"quasi-guerra\\", una belligeranza non dichiarata contro la Prima Repubblica francese combattuta principalmente nel teatro costituito dall'Arcipelago dei Caraibi."},{"page_url":"https://pl.wikipedia.org/wiki/Domen_Prevc","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/2017-09-30_COC_Klingenthal_Domen_Prevc.jpg","page_title":"Domen Prevc","context_page_description":"Domen Prevc – słoweński skoczek narciarski, reprezentant klubu SK Triglav Kranj. Drużynowy srebrny medalista Mistrzostw Świata w Lotach Narciarskich 2018, srebrny indywidualnie i złoty w drużynie mieszanej medalista mistrzostw świata juniorów, srebrny medalista indywidualny i złoty w drużynie z Zimowego Olimpijskiego Festiwalu Młodzieży Europy 2015.\\nBrat skoczków narciarskich Petera i Cene."},{"page_url":"https://en.wikipedia.org/wiki/Government_by_Judiciary","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Panorama_of_United_States_Supreme_Court_Building_at_Dusk.jpg","page_title":"Government by Judiciary","context_page_description":"Government by Judiciary is a 1977 book by constitutional scholar and law professor Raoul Berger which argues that the U.S. Supreme Court has interpreted the Fourteenth Amendment of the U.S. Constitution contrary to the original intent of the framers of this Amendment and that the U.S. Supreme Court has thus usurped the authority of the American people to govern themselves and decide their own destiny. Berger argues that the U.S. Supreme Court is not actually empowered to rewrite the U.S. Constitution--including under the guise of interpretation--and that thus the U.S. Supreme Court has consistently overstepped its designated authority when it used its powers of interpretation to de facto rewrite the U.S. Constitution in order to reshape it more to its own liking."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%86%D8%A7%D9%8A%DA%A4%D8%A7%DA%86%D9%88_%D8%A8%D8%A7%D9%83%D8%A8%D9%88%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Austria_U-18_vs._Netherlands_U-18_2017-03-23_%28057%29.jpg","page_title":"نايڤاچو باكبورد","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nنايڤاچو باكبورد لاعب كورة قدم من مملكة نيديرلاند."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%89%AB%E6%8F%8F%E7%94%B5%E5%AD%90%E6%98%BE%E5%BE%AE%E9%95%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Onion_flake._Cells._SEM-BSE.jpg","page_title":"扫描电子显微镜","context_page_description":"掃描電子顯微鏡，簡稱掃描電鏡，是一種電子顯微鏡，其通過用聚焦電子束掃描樣品的表面來產生樣品表面的圖像。\\n電子與樣品中的原子交互作用，產生包含關於樣品的表面測繪學形貌和組成的資訊的各種信號。電子束通常以光柵掃描圖案掃描，並且光束的位置與檢測到的信號組合以產生圖像。掃描電子顯微鏡可以實現解析度優於1奈米。樣品可以在高真空，低真空，濕條件以及寬範圍的低溫或高溫下觀察到。\\n最常見的掃描電子顯微鏡模式是檢測由電子束激發的原子發射的二次電子。可以檢測的二次電子的數量，取決於樣品測繪學形貌，以及取決於其他因素。通過掃描樣品並使用特殊檢測器收集被發射的二次電子，創建了顯示表面的形貌的圖像。它還可能產生樣品表面的高解析度圖像，且圖像呈三維，鑑定樣品的表面結構。"},{"page_url":"https://pt.wikipedia.org/wiki/Blesle","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Blesle13.JPG","page_title":"Blesle","context_page_description":"Blesle é uma comuna francesa na região administrativa de Auvérnia, no departamento do Alto Loire. Estende-se por uma área de 29,29 km². Em 2010 a comuna tinha 634 habitantes.\\nPertence à rede das As mais belas aldeias de França."},{"page_url":"https://es.wikipedia.org/wiki/Moustapha_Akkad","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/%D9%85%D8%B5%D8%B7%D9%81%D9%89_%D8%A7%D9%84%D8%B9%D9%82%D8%A7%D8%AF.jpg","page_title":"Moustapha Akkad","context_page_description":"Moustapha Akkad, fue un productor de cine y director nacido en Alepo, Siria, pero que desarrolló su carrera principalmente en Estados Unidos. Es conocido por producir la serie de Halloween y como director de las películas El mensaje y El león del desierto. Tras haber dedicado una gran parte de su carrera a intentar explicar el Islam a Occidente, fue asesinado en 2005 en Ammán, Jordania por un atentado suicida de Al-Qaeda."},{"page_url":"https://pt.wikipedia.org/wiki/Pietro_Grasso","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Pietro_Grasso_-_Festa_Unit%C3%A0_Roma_2012.JPG","page_title":"Pietro Grasso","context_page_description":"Pietro Grasso é um político italiano. Foi presidente interino de seu país, em 2015. Assumiu após a renúncia do presidente títular Giorgio Napolitano."},{"page_url":"https://simple.wikipedia.org/wiki/Complex_plane","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Complex_conjugate_picture.svg","page_title":"Complex plane","context_page_description":"In algebra and calculus, the complex plane is used to help visualize complex numbers. The vertical line is called the imaginary axis, and the horizontal line is called the real axis. Any complex number can be written as a+bi. In the complex plane, you go a spaces on the real axis, and b spaces on the imaginary axis. The complex plane can also be expressed in the form of polar coordinates, in which the size of the line is equal to the square root of a squared plus b squared, and the direction is an angle.\\nThe complex plane can be used to draw the graphs of some functions, called complex functions, that can be used to study all kinds of things, like cars, airplanes, atoms and electricity."},{"page_url":"https://en.wikipedia.org/wiki/SPRITE_(spacecraft)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Venus-real_color.jpg","page_title":"SPRITE (spacecraft)","context_page_description":"SPRITE was a proposed Saturn atmospheric probe mission concept. SPRITE is a design for an atmospheric entry probe that would travel to Saturn from Earth on its own cruise stage, then enter the atmosphere of Saturn, and descend taking measurements in situ."},{"page_url":"https://pt.wikipedia.org/wiki/Marcelo_Gon%C3%A7alves_de_Oliveira","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Piracaia.png","page_title":"Marcelo Gonçalves de Oliveira","context_page_description":"Marcelo Gonçalves de Oliveira, conhecido como Piracaia, é um futebolista brasileiro que atua como meia-atacante. Atualmente defende o MuSa-2, além de acumular a função de auxiliar-técnico. Também possui cidadania finlandesa."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Kreikan_p%C3%A4%C3%A4ministereist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Nikolaos_Kalogeropoulos.jpg","page_title":"Luettelo Kreikan pääministereistä","context_page_description":"Tämä on luettelo Kreikan pääministereistä, ja käsittää nykyisen Kreikan valtion pääministerit ja hallitukset valtion perustamisesta nykypäiviin saakka."},{"page_url":"https://fr.wikipedia.org/wiki/La_Chapelle-des-Buis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Cadastres_de_Besan%C3%A7on_-_1834.jpg","page_title":"La Chapelle-des-Buis","context_page_description":"La Chapelle des Buis est un hameau situé au sud de Besançon, à cheval sur trois communes. La partie bisontine est administrativement rattachée au quartier de La Boucle. Établi sur une crête au-dessus de la colline Saint-Étienne, le secteur a été une voie de passage fréquentée, un site militaire stratégique. Il est devenu un haut-lieu spirituel, et un espace environnemental exceptionnel. La Chapelle des Buis, malgré son isolement et sa démographie réduite, jouit d'un riche patrimoine environnemental et architectural, avec son épaisse forêt, ses lieux de culte et ses innombrables statues."},{"page_url":"https://pt.wikipedia.org/wiki/Enfermeiro-mor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Francisco_de_Mello_e_Castro%2C_6.%C2%BA_Conde_das_Galveias.png","page_title":"Enfermeiro-mor","context_page_description":"Enfermeiro-mor foi a designação dada a partir de 1564, com a passagem da administração do Hospital Real de Todos os Santos para a Santa Casa da Misericórdia de Lisboa, ao dirigente máximo dos hospitais reais de Lisboa, anteriormente designados pelo título de provedor. O cargo, que por vezes era em parte honorífico, manteve-se em uso até 1913, ano da criação dos Hospitais Civis de Lisboa e da consequente extinção do cargo de enfermeiro-mor. O enfermeiro-mor, que em geral não era um profissional de saúde, era a máxima autoridade nos hospitais, com funções que na atualidade se aproximam das exercidas pelo administrador geral ou presidente do conselho de administração.\\nEm 1913, com a reforma do sistema hospitalar, a primeira figura do hospital passou a chamar-se diretor, mas em 1927 o cargo de enfermeiro-mor foi restabelecido, mantendo-se durante alguns anos."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%83%E9%9A%8E%E6%AD%A3%E6%96%B9%E5%BD%A2%E9%91%B2%E5%B5%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Uniform_tiling_74-t01.png","page_title":"七階正方形鑲嵌","context_page_description":"在幾何學中，七階正方形鑲嵌是由正方形組成的雙曲面正鑲嵌圖，每七個正方形共用一個頂點。在施萊夫利符號用{4,7}表示。七階正方形鑲嵌即每個頂點皆為七個正方形的公共頂點，頂點周圍包含了七個不重疊的正方形，一個正方形內角90度，七個正方形超過了360度，因此無法因此無法在平面作出，但可以在雙曲面上作出。"},{"page_url":"https://ast.wikipedia.org/wiki/Illana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Pil%C3%B3n_e_iglesia_de_Nuestra_Se%C3%B1ora_de_la_Asunci%C3%B3n_%28Illana_-_Guadalajara%29.jpg","page_title":"Illana","context_page_description":"Illana ye un conceyu español de la provincia de Guadalaxara, perteneciente a la comunidá autónoma de Castiella-La Mancha y asitiáu en la Alcarria. Tien una población de 702 habitantes partíos ente'l nucleu principal y lasi urbanizaciones. Tien una estensión de 93,3 km² y atópase a 750 msnm."},{"page_url":"https://es.wikipedia.org/wiki/Zool%C3%B3gico_de_B%C3%BAfalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Indian_Rhinoceros_-_Buffalo_Zoo.jpg","page_title":"Zoológico de Búfalo","context_page_description":"El zoológico de Búfalo o Buffalo Zoo, localizado en Búfalo, fue fundado en 1875, por lo que es el tercer zoológico más antiguo de los Estados Unidos. Cada año, el Buffalo Zoo atrae aproximadamente 400 000 visitantes y es la segunda atracción turística más importante en el oeste de Nueva York, solo por detrás de las Cataratas del Niágara. Localizado en 9,5 hm² del Buffalo Delaware Park, el zoológico exhibe una diversa colección de animales salvajes y exóticos y más de 320 especies de plantas. Abierto todo el año, el zoo sirve como un recurso de la conservación, educación y recreación para el oeste de Nueva York."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_Cuatro_Caminos","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Madrid_Metro_204.jpg","page_title":"Estación de Cuatro Caminos","context_page_description":"Cuatro Caminos es una estación de las líneas 1, 2 y 6 del Metro de Madrid situada bajo la glorieta de Cuatro Caminos, en el límite entre los distritos de Chamberí y Tetuán.\\nLa estación tiene la particularidad de ser la estación más profunda del Metro de Madrid: los andenes de la línea 6 se encuentran a 45 m por debajo del nivel de la calle. En términos de profundidad absoluta no es la más profunda de la red, otras estaciones de la línea 6 se encuentran a menor altitud sobre el nivel del mar."},{"page_url":"https://hr.wikipedia.org/wiki/Majdanpek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Lepenski_Vir%2C_muzej_15.jpg","page_title":"Majdanpek","context_page_description":"Majdanpek je grad u sjeveroistočnoj Srbiji, a administrativno pripada borskom okrugu. Grad je poznat po vrlo bogatom nalazištu bakra i zlata, s rudarskom tradicijom prisutnom mnogo prije prodora Rimljana u ove krajeve u 1. stoljeću pr. Kr."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D9%84%D8%A7%DB%8C%D8%AA_%D8%BA%D8%B2%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Snow_covered_mountains_in_Ghazni.jpg","page_title":"ولایت غزنی","context_page_description":"ولایت غزنی به مرکزیت شهر «غزنی» یکی از سی و چهار ولایت در جنوب افغانستان است. این ولایت از شمال شرقی با ولایت‌های پکتیکا، لوگر و وردک؛ از شمال و شمال غربی با ولایت‌های کابل و بامیان و از طرف غرب و جنوب با ولایت‌های ارزگان، و زابل همسایه است. این ولایت از لحاظ مدیریت اداری به شانزده ولسوالی تقسیم شده‌است. از لحاظ ساختار جمعیت غزنی را می‌توان یک ولایت چند قومی خواند، چون این ولایت داری ترکیب متعادلی از تمام اقوام افغانستان است: هزاره، پشتون، تاجیک و دیگر اقلیت‌های همچون سیک و قزلباش در این ولایت ساکن هستند."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D0%B1%D0%B5%D1%80%D1%82_%D0%A2%D0%BE%D0%BD%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Bundesarchiv_Bild_102-10547%2C_Berlin%2C_Goebbels_und_G%C3%B6ring.jpg","page_title":"Альберт Тонак","context_page_description":"Альберт Тонак — німецький офіцер, гауптштурмфюрер СС."},{"page_url":"https://en.wikipedia.org/wiki/East_Row_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Newport_Kentucky_East_Row_Historic_District_765291651.jpg","page_title":"East Row Historic District","context_page_description":"East Row Historic District is the second largest Historic District in the Commonwealth of Kentucky. It is located in Newport, Kentucky. The East Row was created by joining two of Newport's Historic Neighborhoods; Mansion Hill and Gateway.\\nGeneral James Taylor Jr. pioneered Newport in the 1790s on 1,500 acres inherited from his father. His father, James Taylor Sr., bought 2,700 acres of land in Northern Kentucky from his friend George Muse, which was part of the land Muse had been awarded for his military service in the French and Indian War.\\nJames Taylor Jr. brought to Newport his wealthy new wife Keturah Moss Leitch.\\nWell-connected with Washington politics, The Taylor family had two cousins, James Madison and Zachary Taylor, who later become presidents of the United States. The Taylors brought colonial culture to Northern Kentucky.\\nTaylor choose a high hill overlooking the Ohio River to build his large home in the Greek Revival style. At his death in 1848, James Taylor Jr. was said to be one of the wealthiest men in the state of Kentucky, with an estate valued at more than $4 million.\\nIn the mid-19th century, Newport became a hub for trade, industry and culture."},{"page_url":"https://nl.wikipedia.org/wiki/Circumpolair","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Precesion.png","page_title":"Circumpolair","context_page_description":"Sterren en sterrenbeelden die het gehele jaar zichtbaar zijn aan de hemel noemt men circumpolair. Weliswaar worden sterren overdag overstraald door de zon, maar het gaat erom dat hun min of meer dagelijkse banen helemaal boven de horizon liggen. Normaal heeft het begrip circumpolair betrekking op de Aarde, maar een ster kan ook circumpolair zijn ten opzichte van een waarnemer op een ander hemellichaam. Of een object circumpolair is, hangt af van de breedtegraad van de waarnemer.\\nEen sterrenbeeld of nevel kan op het laagste punt van zijn baan gedeeltelijk achter de horizon schuilgaan. Zo'n object wordt gedeeltelijk circumpolair genoemd. Ten opzichte van de Benelux is bijvoorbeeld Andromeda deels circumpolair."},{"page_url":"https://et.wikipedia.org/wiki/Kassari","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Aino_ja_Oskar_Kallase_suvemaja.jpg","page_title":"Kassari","context_page_description":"Kassari on Hiiumaaga tammteedega ühendatud ning kokku kasvanud saar Väinameres. Looduskaitseregistris teda eraldi saareks enam ei loeta.\\nSaare pindala on 19,3 km³. Kassari on suuruselt Eesti 5. saar napilt Naissaare ees. Hiiumaa kagurannikust eraldab Kassarit roogu kasvanud Käina laht. Kassarist läänes on Jausa laht, kirdes Õunaku laht. Üle 56 kilomeetri pikkune rannajoon on väga liigestunud: läänes on Orjaku, kirdes Vesimaa poolsaar, kagus Tagaküla poolsaar, lõunas Piibunina ja edelas Orjaku säär, mis tipneb Sääretirbiga. Taimkattes valdavad kadastikud, pärisaru- ja rannaniidud.\\nPõhjast lõunasse läbib Kassarit oos, mis moodustab lõuna pool Sääretirbi ja jätkub vee allgi. Kassari kõrgeimas kohas ulatub oos 15 meetri kõrgusele merepinnast.\\nEsimesena kerkis merest vallseljaku kõrgem osa mitu tuhat aastat tagasi. Tuhande aasta eest oli Kassari kohal kaks saart: Kassari idas ja Orjaku läänes. Need saared ühinesid umbes viiesaja aasta eest. Paari viimase aastasaja jooksul on Orjaku külge kasvanud veel Puulaid ja Reigi saar.\\nKassaris elab kolmsada inimest neljas külas: Esiküla, Kassari, Orjaku, kuhu 19. sajandi alguses sadam ehitati, ja Taguküla.\\nKassari on tuntud suvituspiirkond."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D1%8D%D1%86%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%88%D0%B5%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Nile_River_and_delta_from_orbit.jpg","page_title":"Суэцкий перешеек","context_page_description":"Суэ́цкий переше́ек — соединяет Азию и Африку. Отделяет Красное море на юге от Средиземного на севере, минимальное расстояние между морями составляет 116 км. Перешеек занимают песчаные и каменистые пустыни, почти лишённые растительности. Низины занимают солончаки и солёные озёра, самым крупным из которых является Большое Горькое озеро. Естественных источников пресной воды нет. В 1869 году на перешейке был сооружён Суэцкий канал."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%81%D0%B5%D0%B2%D0%B4%D0%BE%D1%82%D1%81%D1%83%D0%B3%D0%B0_%D0%9C%D0%B5%D0%BD%D0%B7%D1%96%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Pseudotsuga_menziesii_MHNT.BOT.2010.6.77.jpg","page_title":"Псевдотсуга Мензіса","context_page_description":"Псевдотсуга Мензіса, або псевдотсуга тисолиста, або дугласія тисолиста — вид псевдотсуги, вічнозелена хвойна рослина, батьківщиною якої є прибережні та гірські райони західної Північної Америки від західної Британської Колумбії до центральної Каліфорнії та до Альберти і Нью-Мексико углиб материка. Входить до складу родини соснових."},{"page_url":"https://cs.wikipedia.org/wiki/Jaroslav_Jare%C5%A1_(mal%C3%AD%C5%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Jaroslav_Jare%C5%A1_signatura.jpg","page_title":"Jaroslav Jareš (malíř)","context_page_description":"Jaroslav Jareš, křtěný Jaroslav Antonín, byl český malíř, sochař, ilustrátor, scénograf, uměleckoprůmyslový výtvarník a publicista. Patřil k tvůrcům státní vlajky a znaku Československa z roku 1918."},{"page_url":"https://de.wikipedia.org/wiki/Bohdanovce_(Ko%C5%A1ice-okolie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Bohdanovce01.JPG","page_title":"Bohdanovce (Košice-okolie)","context_page_description":"Vajkovce ist eine Gemeinde im Osten der Slowakei mit 1130 Einwohnern, die zum Okres Košice-okolie, einem Teil des Košický kraj, gehört."},{"page_url":"https://de.wikipedia.org/wiki/%C3%89vora_Monte","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Evora_Monte1.jpg","page_title":"Évora Monte","context_page_description":"Évora Monte ist ein kleiner befestigter Ort und eine Gemeinde im Alentejo in Portugal. Auf einer Anhöhe in 470 m über NN leben in dem Ort 569 Einwohnern auf einer Fläche von 99,4 km². Der alternative Ortsname von Évora Monte ist Santa Mara. Die Gemeinde gehört zum Landkreis von Estremoz."},{"page_url":"https://fr.wikipedia.org/wiki/Alfred_Naccache","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Alfred_Naqqache.jpg","page_title":"Alfred Naccache","context_page_description":"Alfred Naccache était un homme politique libanais ; il a occupé les postes de Premier ministre et de Président de la République durant le mandat français au Liban.\\nIl fut nommé président de la République en 1941, à la suite de la démission de son prédécesseur Émile Eddé.\\nPersonnalité maronite, une importante rue de Beyrouth porte aujourd’hui son nom."},{"page_url":"https://cs.wikipedia.org/wiki/Finsk%C3%A1_hymna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/V%C3%A5rt_land_-_front_page.jpg","page_title":"Finská hymna","context_page_description":"Finská hymna má dvě jazykové verze – finskou Maamme a švédskou Vårt land.\\nPůvodní text hymny byl napsán švédsky J. L. Runebergem, který je Finy považován za národního básníka. V tisku se ukázal v roce 1846 jako báseň předcházející sbírku 35 povídek o hrdinech z dob války proti Rusku. Soudí se, že báseň byla inspirována \\"druhou\\" maďarskou hymnou Szózat autora Mihálye Vörösmartyho z roku 1836. Obliba básně vzrostla, když ji o dva roky později Paavo Cajander přeložil do finštiny. Skladba s hudbou Němce Fredrika Pacia byla poprvé veřejně předvedena 13. května 1848 během slavností v Gumtaktu. Na stejnou melodii vznikla později i estonská hymna.\\nNěkteří hudební kritici upozorňují, že hudba sama není nijak zvlášť hudebně kvalitní a jedná se vlastně jen o přepracování staré německé pijácké písně. Podobně je terčem kritiky i fakt, že Pacius byl Němec a slova byla Runebergem napsána nejprve švédsky. Také fakt, že za svou považují píseň i Estonci, vedl v minulosti k návrhům, aby se finskou hymnou stala Sibeliova Finlandia. K ní slova napsal na sklonku 30. let 20. století básník Veikko Antero Koskenniemi.\\nNení bez zajímavosti, že píseň Maamme není oficiálně potvrzenou hymnou Finska."},{"page_url":"https://vi.wikipedia.org/wiki/B%E1%BA%BFp_n%C4%83ng_l%C6%B0%E1%BB%A3ng_M%E1%BA%B7t_Tr%E1%BB%9Di","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Solar-Panel-Cooker-in-front-of-hut.jpg","page_title":"Bếp năng lượng Mặt Trời","context_page_description":"Bếp năng lượng Mặt Trời là một thiết bị giữ các tia nắng và dùng năng lượng này để đun nấu các loại thực phẩm hoặc đun nước sôi.\\nMột trong các thiết kế là gồm một cái thau bằng nhôm, được cách ly tốt đặt trong một hộp gỗ. Một tấm kiếng đậy trên miệng thau có gắn với một tấm phản chiếu ở phía sau.\\nCác thiết kế dùng gương hay thấu kính Fresnel để hội tụ ánh nắng vào điểm cần đun nấu có thể được dùng. Các bếp này có thể đạt công suất vài trăm Watt và nhiệt độ tới 200°C."},{"page_url":"https://cs.wikipedia.org/wiki/Skalenka_pol%C3%A9hav%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Loiseleuria_procumbens_fruits.jpg","page_title":"Skalenka poléhavá","context_page_description":"Skalenka poléhavá je rostlina z čeledi vřesovcovité. Je to vytrvalý stálezelený keřík nízkého vzrůstu. Byla nazvána po francouzském botanikovi Jean Louis Auguste Loiseleur-Deslongchamps. Tento druh se vyvinul zřejmě již v třetihorách. Dříve byla řazena do samostatného rodu Loiseleuria, v současné taxonomii je zařazena do rodu Kalmia."},{"page_url":"https://uk.wikipedia.org/wiki/FGM-148_Javelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Norwegian_javelin.jpg","page_title":"FGM-148 Javelin","context_page_description":"FGM-148 «Джавелін» — переносний протитанковий ракетний комплекс виробництва американських підприємств Raytheon та Lockheed Martin. Перший серійний ПТРК третього покоління, якому властивий принцип «вистрілив-забув» — оператор ракетного комплексу не має супроводжувати і коригувати політ ракети, поки вона наближається до цілі.\\n«Джавелін» призначений для ураження бронетехніки, укріплень на землі, а також деяких літальних об'єктів, що переміщуються на низькій висоті й швидкості — гелікоптерів або БПЛА.\\nРозроблявся з 1986 року, прийнятий на озброєння армії США в 1996 році. Успішно використовувався в Іраку. Постачається на експорт у деякі країни світу.\\nЗ 30 квітня 2018 року перші комплекти стали надходити до України. Після одержання комплексу Україною, «Джавелін» став об'єктом уваги російської пропаганди."},{"page_url":"https://sl.wikipedia.org/wiki/Kiparstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Siege_castle_love_Louvre_OA6933.jpg","page_title":"Kiparstvo","context_page_description":"Kiparstvo je veja upodabljajočih umetnosti, ki deluje v treh dimenzijah oziroma oblikuje volumen. Trajni kiparski proces se je prvotno uporabljal za rezljanje in modeliranje v kamnu, kovini, keramiki, lesu in drugih materialih, a je modernizem pripeljal v kiparski proces skoraj popolno svobodo materialov in procesa. Najrazličnejše materiale lahko uporabljajo za odstranjevanje, pri tem pa se uporabljajo tehnologije od rezbarjenja, sestavljanja z varjenjem ali modeliranjem, ulivanja ali litja.\\nKip v kamnu preživi veliko bolje od umetnin iz pokvarljivega materiala in pogosto predstavlja večino ohranjenih del starodavnih kultur, tradicionalne lesene skulpture so izginile skoraj v celoti.\\nKip je bil osrednji verski element v mnogih kulturah in do zadnjih stoletij so bili veliki kipi, predragi za posameznika, običajno ustvarjeni za izražanje vere ali politike. Kulture, katerih kipi so ohranjeni v večjih količinah so kulture starega Sredozemlja, Indije in Kitajske, pa tudi mnogi v Južni Ameriki in Afriki.\\nZahodna tradicija kiparstva se je začela v antični Grčiji in Grčija na splošno velja za proizvajalko velikih mojstrovin v klasičnem obdobju."},{"page_url":"https://fr.wikipedia.org/wiki/Gisors","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Gisors_-_Lavoir.jpg","page_title":"Gisors","context_page_description":"Gisors est une commune française située dans le département de l'Eure, en région Normandie.\\nCette cité ancienne située à la lisière du Vexin normand témoigne par son patrimoine architectural de la lutte acharnée entre souverains Capétiens et Plantagenêt durant une partie du Moyen Âge. Élément important du paysage urbain, son château fort se dresse depuis lors sur une éminence dominant la ville. Principal lieu touristique de l'agglomération, il est également au centre de diverses légendes ayant trait à l'ordre du Temple.\\nLes habitants de Gisors sont appelés les Gisorsiens et les Gisorsiennes."},{"page_url":"https://en.wikipedia.org/wiki/Rochester_Institute_of_Technology","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Rochester_Institute_of_Technology_observatory.jpg","page_title":"Rochester Institute of Technology","context_page_description":"Rochester Institute of Technology is a private research university in the town of Henrietta in the Rochester, New York metropolitan area. The university offers undergraduate and graduate degrees, including doctoral and professional degrees and online masters as well.\\nThe university was founded in 1829 and is the tenth largest private university in the country in terms of full-time students. It is internationally known for its science, computer, engineering, and art programs, as well as for the National Technical Institute for the Deaf, a leading deaf-education institution that provides educational opportunities to more than 1000 deaf and hard-of-hearing students. RIT is known for its Co-op program that gives students professional and industrial experience. It has the fourth oldest and one of the largest Co-op programs in the world.\\nRIT student population is approximately 19,000 students, about 16,000 undergraduate and 3000 graduate. Demographically, students attend from all 50 states in the United States and from more than 100 countries around the world."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%AC%AC%E5%85%AD%E6%89%B9%E6%B2%B3%E5%8C%97%E7%9C%81%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Kacki_Villa_02_2015-09.jpg","page_title":"第六批河北省文物保护单位","context_page_description":"第六批河北省文物保護單位是河北省人民政府於2018年2月14日公布的省級文物保護單位，共計54處。其中含古遺址17處、古墓葬4處、古建築18處、近現代重要史跡和代表性建築15處，另有2處與已公布河北省文物保護單位合併。同時，河北省人民政府對21處原有省級文物保護單位進行了撤銷、消號、合併等調整，其中12處轉為可移動文物或館藏文物，2處變為一般遺存點，6處文物保護單位消失，1處考古研究工作後性質改變。"},{"page_url":"https://hr.wikipedia.org/wiki/Biologija","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Morchella_esculenta_08.jpg","page_title":"Biologija","context_page_description":"Biologija je znanost koja se bavi proučavanjem živoga svijeta, znanost o životu. Biologija proučava svojstva i ponašanje organizama, njihov rast, razvoj i razmnožavanje, kao i interakcije između različitih organizama, te organizama i njihovog okoliša. Biologija obuhvaća široki spektar akademskih područja koja se često smatraju različitim disciplinama. Ove discipline zajedno proučavaju život na različitim razinama.\\nMolekularna biologija, biokemija i molekularna genetika su velikim dijelom preklapajuće discipline koje proučavaju životne procese na molekulskoj i supramolekulskoj razini. Život na razini pojedinačnih stanica proučava stanična biologija. Anatomija, histologija i fiziologija proučavaju građu i funkciju organizama na razini tkiva, organa i organskih sustava.\\nNa Zemlji postoji više od 10 milijuna različitih vrsta.\\nNjihova veličina pokriva raspon od onih koje su mikroskopski male pa do organizama veličine plavog kita.\\nSvi ovi oblici života imaju izvjesne osobine koje ih čine specifičnima i razlikuju od mrtvih tvari.\\nOve osobine su na primjer mogućnost reprodukcije, rasta, ali i mogućnost prilagođavanja okolini."},{"page_url":"https://az.wikipedia.org/wiki/Cerom_Klapka_Cerom","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Dudley_Hardy-To_Day.jpg","page_title":"Cerom Klapka Cerom","context_page_description":"Cerom Klapka Cerom — ingilis dramaturqu, yazıçı-yumorist, məşur “Qayıqda üç kişi ” yumoristik romanın, bundan başqa çoxlu sayda yumoristik və satirik əsərlərin müəllifi, “Panç”, “Avara ”, “Bu gün” kimi məşur satirik jurnalların daimi əməkdaşı."},{"page_url":"https://en.wikipedia.org/wiki/National_debt_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Interest_on_the_federal_debt.png","page_title":"National debt of the United States","context_page_description":"The national debt of the United States is the total debt, or unpaid borrowed funds, carried by the federal government of the United States, which is measured as the face value of the currently outstanding Treasury securities that have been issued by the Treasury and other federal government agencies. The terms \\"national deficit\\" and \\"national surplus\\" usually refer to the federal government budget balance from year to year, not the cumulative amount of debt. A deficit year increases the debt, while a surplus year decreases the debt as more money is received than spent.\\nThere are two components of gross national debt:\\n\\"Debt held by the public\\" – such as Treasury securities held by investors outside the federal government, including those held by individuals, corporations, the Federal Reserve System, and foreign, state and local governments.\\n\\"Debt held by government accounts\\" or \\"intragovernmental debt\\" – is non-marketable Treasury securities held in accounts of programs administered by the federal government, such as the Social Security Trust Fund."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B7%D1%80%D0%B0%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%BE-%D0%BC%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D1%81%D0%BA%D0%B8%D0%B5_%D0%BE%D1%82%D0%BD%D0%BE%D1%88%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Israel-Moldova_Locator.png","page_title":"Израильско-молдавские отношения","context_page_description":"Израильско-молдавские отношения — двусторонние международные дипломатические, политические, экономические, торговые, военные, культурные и иные, исторические и настоящие отношения между Молдавией и Израилем.\\nДипломатические отношения между двумя странами были установлены в 1992 году. У Молдовы есть посольство в Тель-Авиве, а Израиль представлен в Молдавии через своего посла в Киеве, Украина. В настоящее время посол Молдавии в Израиле — Габриела Морару. 23 декабря 2015 года Моран Мано был назначен почётным консулом Молдавии в Ашдоде."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_chr%C3%A1n%C4%9Bn%C3%BDch_%C3%BAzem%C3%AD_v_okrese_Liptovsk%C3%BD_Mikul%C3%A1%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Mn%C3%ADch_%28n%C3%A1rodn%C3%A1_pr%C3%ADrodn%C3%A1_rezerv%C3%A1cia%29.jpg","page_title":"Seznam chráněných území v okrese Liptovský Mikuláš","context_page_description":"Toto je seznam chráněných území v okrese Liptovský Mikuláš aktuální k roku 2017, ve kterém jsou uvedena chráněná území v oblasti okresu Liptovský Mikuláš."},{"page_url":"https://et.wikipedia.org/wiki/Kozmodemjansk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Kozmod_museum.jpg","page_title":"Kozmodemjansk","context_page_description":"Kozmodemjansk ehk Tsikmä on linn Venemaal Mari Eli Vabariigis, Mäemari rajooni keskus. Linn asub Volga kaldal."},{"page_url":"https://pt.wikipedia.org/wiki/Mika%27ela_Fisher","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Mika%27ela_Fisher_Die_Tapferen_Haende_im_Chaos_der_Zeit.jpg","page_title":"Mika'ela Fisher","context_page_description":"Mika'ela Fisher é uma atriz e modelo alemã.\\nEla posou como modelo para as casas de moda Martin Margiela, John Galliano, Hermès, entre outros.\\nFisher ganhou reconhecimento como atriz por seu papel no filme Ne le dis à personne Não Conte a Ninguém Tell No One.\\nEm 2013, ela produziu e dirigiu seu primeiro curta-metragem, Die Tapferen Haende im Chaos der Zeit.Este filme foi indicado nas categorias de melhor diretor e melhor trilha sonora para os Maverick Movie Awards 2013"},{"page_url":"https://en.wikipedia.org/wiki/Jos%C3%A9_Luis_G%C3%B3mez_(actor)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Jos%C3%A9_Luis_G%C3%B3mez_%28RPS_21-11-2019%29_en_el_Paraninfo_de_la_Universidad_de_Alcal%C3%A1.png","page_title":"José Luis Gómez (actor)","context_page_description":"José Luis Gómez García is a Spanish film actor and director. He has appeared in 33 films since 1968. At the 1976 Cannes Film Festival, he won the award for Best Actor in the film Pascual Duarte. Gómez was elected to Seat Z of the Real Academia Española on 1 December 2011; he took up his seat on 26 January 2014."},{"page_url":"https://eu.wikipedia.org/wiki/Olden","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/P1000248Olden.JPG","page_title":"Olden","context_page_description":"Olden Norvegiako hiri txikia da, Stryn udalerriaren barruan dagoena, herrialdearen mendebaldean. Itsasotik barrenera kilometro batzuetara dago Olden, Nordfjord fiordoaren barruko aldean, Innvikfjorden, Nordfjord nagusiaren adar baten, amaieran.\\nOlden hiriak, aurrean, Oldebukta kaia dauka, eta atzean, hegoaldean, Oldevatnet lakua."},{"page_url":"https://pl.wikipedia.org/wiki/Religia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Legenda_mapy_religii.jpg","page_title":"Religia","context_page_description":"Religia – system wierzeń i praktyk określający relację między różnie pojmowaną sferą sacrum i sferą boską a społeczeństwem, grupą lub jednostką. Manifestuje się ona w wymiarze doktrynalnym, w czynnościach religijnych, w sferze społeczno-organizacyjnej i w sferze duchowości indywidualnej.\\nRelacja jednostki do rzeczywistości transcendentnej koncentruje się wokół poczucia świętości, chęci zbliżenia się do sacrum i uczuć z tym związanych np. poczucia lęku, czci, dystansu.\\nW 2012 roku 59% ludzi uważało się za osoby religijne, 23% nie, a 13% deklarowało ateizm.\\nWedług różnych szacunków istnieje od 4200 do 10 000 religii. Samych wyznań chrześcijańskich jest ok. 41."},{"page_url":"https://pt.wikipedia.org/wiki/Juliet_Berto","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Juliet_Berto_1_1972.jpg","page_title":"Juliet Berto","context_page_description":"Juliet Berto, pseudônimo de Annie Lucienne Marie Louise Jamet foi uma atriz e diretora francesa."},{"page_url":"https://ca.wikipedia.org/wiki/Gallup","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/NMMap-doton-Gallup.PNG","page_title":"Gallup","context_page_description":"Gallup —Naʼnízhoozhí en navaho— és una ciutat de l'estat de Nou Mèxic. Segons el cens del 2006 tenia una població de 20.209 habitants."},{"page_url":"https://pl.wikipedia.org/wiki/Blackface","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Minstrel_PosterBillyVanWare.jpg","page_title":"Blackface","context_page_description":"Blackface – styl teatralnego makijażu zapoczątkowany w Stanach Zjednoczonych pod koniec XIX wieku, odwołujący się do stereotypowych wyobrażeń obecnych w społeczeństwie amerykańskim dotyczących osób o czarnym kolorze skóry. Biali ludzie o twarzach mocno pomalowanych utwierdzali pewne stereotypy, przywołując w czasie przedstawień zachowania kojarzone z karykaturą zachowań ludzi czarnoskórych. Tego rodzaju spektakle straciły swą popularność w połowie XX wieku w USA, odbywają się one jednak wciąż w innych częściach świata."},{"page_url":"https://sh.wikipedia.org/wiki/Jaka_nuklearna_sila","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Nuclear_Force_anim_smaller.gif","page_title":"Jaka nuklearna sila","context_page_description":"Jaka nuklearna sila, jaka sila ili jako međudjelovanje je temeljno međudjelovanje kvarkova i gluona koje drži na okupu kvarkove u nukleonu i \\"preostala\\" jaka sila, prenošena mezonima, koja drži na okupu nukleone u atomskoj jezgri. Naime, temeljne sile podvrgnute su takozvanom baždarnomu načelu, to jest određene su lokalnom simetrijom. Gluoni su baždarni bozoni kvantne kromodinamike. Tri naboja, nazvana bojom, izvor su za osam gluona. Budući da i sami gluoni imaju naboj boje, to upućuje na njihovu samointerakciju, koja kvantnu kromodinamiku čini složenijom od elektrodinamike. Svojstvo asimptotske slobode, to jest smanjivanje jakosti međudjelovanja na malim udaljenostima prema nuli omogućuje primjenu računa smetnje kao u elektrodinamici.\\nJaka nuklearna sila je najmoćnija sila u prirodi. Jača je od elektromagnetske i zbog nje se protoni drže zajedno u jezgrama atoma. Djeluje samo na vrlo malim udaljenostima. Kod teških atoma jezgra se raspada jer je elektromagnetska sila koja razdvaja čestice istog naboja ukupan zbroj sila svih prisutnih protona i nadjačava rezidualnu jaku nuklearnu silu koja djeluje samo na susjedne čestice i drži ih skupa."},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A4stindisk_n%C3%A4bbfisk","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Prognathodes_aculeatus_-_pone.0010676.g101.png","page_title":"Västindisk näbbfisk","context_page_description":"Västindisk näbbfisk är en fiskart som först beskrevs av Poey, 1860. Västindisk näbbfisk ingår i släktet Prognathodes och familjen Chaetodontidae. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://cs.wikipedia.org/wiki/ATMACA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Atmaca_F%C3%BCzesi_Sinop%27da_ger%C3%A7ekle%C5%9Fen_deneme_at%C4%B1%C5%9F%C4%B1.png","page_title":"ATMACA","context_page_description":"ATMACA je podzvuková protilodní střela vyvíjená tureckou společností Roketsan. Střelu lze nasadit za každého počasí proti válečným lodí i proti stacionárním cílům na pobřeží. Střela má mít vysokou odolnost proti rušení a schopnost změny cíle během letu. Je to první v Turecku vyvinutá protilodní střela."},{"page_url":"https://fi.wikipedia.org/wiki/SL95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/1-Variobahn_Chemnitz.jpg","page_title":"SL95","context_page_description":"SL95 on matalalattiainen nivelraitiovaunu, jota liikennöi 32 kappaletta Oslon raitioteillä. Sarjan valmisti Ansaldo/Firema, ja raitiovaunut toimitettiin vuodesta 1999 vuoteen 2004. Kahdeksanakselisessa ja kolmiosaisessa kulkuneuvossa on 212 matkustajapaikkaa, joista 88 on istumapaikkoja. Vaunusarja on nimetty tilausvuoden 1995 mukaan. Raitiovaunut oli alunperin tarkoitus toimittaa vuosina 1997 ja 1998, mutta aikaa kului enemmän teknisten vikojen vuoksi. Vikoja olivat korkea melutaso, talviset jäätymisongelmat ja ruostuminen. Vaunut ovat 33,12 metriä pitkiä, 2,6 metriä leveitä ja 3,62 metriä korkeita. Alumiinista valmistetut vaunut painavat 64,98 tonnia ja niiden teho on 840 kW eli 1130 hevosvoimaa.\\nSL95-raitiovaunut liikennöivät linjoilla 13, 17 ja 18 eivätkä ne sovi muille linjoille suuren painonsa ja kääntösäteensä vuoksi. Ne ovat Oslon ainoat kaksisuuntaraitiovaunut, joten niitä tarvitaan linjoilla 17 ja 18 Ullevål Hagebyn radalla. Raitiovaunut maksoivat 20 miljoonaa Norjan kruunua kappaleelta, mutta hinnasta saatiin alennusta myöhästymisten ja teknisten vikojen vuoksi."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%B2%D9%87_%D8%AA%D8%A7%D8%B1%DB%8C%D8%AE_%D8%B7%D8%A8%DB%8C%D8%B9%DB%8C_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Kala_Chakra.jpg","page_title":"موزه تاریخ طبیعی آمریکا","context_page_description":"موزه تاریخ طبیعی آمریکا یکی از مشهورترین موزه‌های ایالات متحده آمریکا و جهان است و در منهتن در شهر نیویورک قرار دارد.\\nاین موزه در ۱۸۶۹ تأسیس شد.\\nدر سال ۲۰۰۹، دانشمندان دانشگاه اسلو پرده از نتایج تحقیقات خود در موزه تاریخ طبیعی آمریکا برداشتند. کشف آنان سنگواره‌ای ۴۷ میلیون ساله در آلمان بود که متعلق به کهن‌ترین نیاکان شناخته شدهٔ نخستی‌سانان امروزی به‌شمار می‌آید."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D1%80%D0%B5%D0%BD_(%D0%90%D1%80%D0%BA%D0%B0%D0%BD%D0%B7%D0%B0%D1%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Bradco_courthouse3.jpg","page_title":"Варрен (Арканзас)","context_page_description":"Варрен — місто в США, в окрузі Бредлі штату Арканзас, адміністративний центр округу. Населення — 6003 особи.\\nЗ 1956 року в місті щорічно проводиться фестиваль томатів."},{"page_url":"https://ru.wikipedia.org/wiki/(5285)_%D0%9A%D1%80%D0%B5%D1%84%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/ru/1/17/%D0%9E%D1%80%D0%B1%D0%B8%D1%82%D0%B0_%D0%B0%D1%81%D1%82%D0%B5%D1%80%D0%BE%D0%B8%D0%B4%D0%B0_5285_%28%D0%BD%D0%B0%D0%BA%D0%BB%D0%BE%D0%BD%29.png","page_title":"(5285) Крефон","context_page_description":"(5285) Крефон — типичный троянский астероид Юпитера, движущийся в точке Лагранжа L₄, в 60° впереди планеты. Астероид был открыт 9 марта 1989 года американскими астрономами Кэролин и Юджином Шумейкер в Паломарской обсерватории и назван в честь одного из героев Троянской войны."},{"page_url":"https://ast.wikipedia.org/wiki/Avenida_Corrientes","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Buenos_Aires_-_Obelisco_%28fachada_norte%29_-_20061212a.jpg","page_title":"Avenida Corrientes","context_page_description":"La avenida Corrientes ye la exa de la vida nocherniega y bohemia de la Ciudá de Buenos Aires. Nos sos chigres y teatros acuñóse'l tangu, y a lo llargo de la so hestoria interpretar nellos les grandes orquestes y cantores, ente ellos l'ídolu popular Carlos Gardel, quien vivió a la so vera. Los sos sumíos teatros Politeama Arxentín, Apolo, Odeón y el vieyu Ópera, fueron escenariu de los más altos esponentes de la llírica mundial, según de la nacencia del consideráu teatru nacional: el drama gauchesco Juan Moreira.\\nEl so nome actual foi-y dau oficialmente en 1822 n'homenaxe a la ciudá arxentina de Corrientes en reconocencia al so fervor pola causa de la Revolución de Mayu.\\nFoi cai angosta hasta qu'en 1931 empezó la so enanche, concluyíu en 1936.\\nEl so primer tramu trescurre nuna zona mayoritariamente financiera, hasta que al cruciar la piatonal cai Florida tresformar nun polu de diversión que tanto los porteños como numberosos turistes percuerren a toa hora entreteniéndose colos sos espectáculos artísticos, culturales, llibreríes d'ufiertes, confiteríes, y pizzerías. Por tou esto'l periodista Roberto Gil popularizaría en los 50 la frase la cai que nunca duerme al referise a ella."},{"page_url":"https://it.wikipedia.org/wiki/Odyssey_(serie_di_console)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Magnavox-Odyssey-2000-FL.jpg","page_title":"Odyssey (serie di console)","context_page_description":"Odyssey era una linea di console di gioco casalinghe di prima generazione vendute tra il 1972 e il 1978 da Magnavox e Philips. La serie comprende la console progenitrice Magnavox Odyssey, entrambe le serie di Magnavox e di Philips delle successive console dedicate Odyssey, e la console basata su CPU e con cartucce Magnavox Odyssey² uscita nel 1978, che appartiene però alla seconda era. Si noti che sul mercato europeo la console Odyssey² fu invece chiamata Philips Videopac."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Ameide","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Back.Kerkstraat.2.Ameide.jpg","page_title":"Lijst van rijksmonumenten in Ameide","context_page_description":"De plaats Ameide telt 47 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://ms.wikipedia.org/wiki/Etnik_Melayu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Hkyt_merong_mahawgsa.jpg","page_title":"Etnik Melayu","context_page_description":"Melayu merujuk kepada kumpulan etnik dari bangsa Austronesia yang sebahagian besarnya mendiami Semenanjung Malaysia termasuk bahagian-bahagian paling selatan Thailand, pantai timur Sumatra, pesisir pantai Borneo, dan pulau-pulau yang lebih kecil yang terletak di antara lokasi-lokasi ini. Kumpulan etnik Melayu berlainan daripada konsep Rumpun Bangsa Melayu, yang merangkumi kumpulan manusia yang lebih luas, termasuk kebanyakan etnik di Indonesia dan Filipina. Bahasa Melayu ialah anggota keluarga bahasa Austronesia."},{"page_url":"https://en.wikipedia.org/wiki/Dongfeng_Fengxing_CM7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Dongfeng_Fengxing_F600_001.jpg","page_title":"Dongfeng Fengxing CM7","context_page_description":"The Dongfeng Fengxing CM7 is an MPV or light commercial, 4-door van produced by Dongfeng Liuzhou Motor under the Dongfeng Fengxing sub-brand. The CM7 debuted on the 2013 Shanghai Auto Show and was launched in the market later in the same year. The styling of the body was heavily inspired by the second generation Hyundai Starex with a front DRG design inspired by the second generation Toyota Alphard.\\nPrices of the Dongfeng Fengxing CM7 ranges from 129,900 yuan to 173,900 yuan in China at launch. Later in the market, the price range was adjusted to a range from 118,900 yuan to 229,900 yuan."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_plantes_oleaginoses","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Poppy_seeds.jpg","page_title":"Llista de plantes oleaginoses","context_page_description":"Les plantes oleaginoses són molt comunes. Els olis són produïts per les plantes a través de processos orgànics i aquest olis són molt diversos. Encara que es pot obtenir oli de diverses parts d'aquestes plantes en la pràctica comercial principalment s'extreuen de les llavors. Els olis i greixos vegetals poden ser comestibles o no ser-ho, per exemple l'oli de ricí no es menja però es fa servir en medicina i la indústria. El terme oli és un concepte una mica vague en la química i els olis científicament són tots ells lípids, un concepte més definit. Les principals funcions del lípids inclouen l'emmagatzemament d'energia, com components estructurals de la membrana cel·lular i com importants molècules de senyal.\\nMalgrat que la majoria de plantes contenen alguna quantitat d'oli, només l'oli de tres o quatre plantes conreades proporcionen la majoria de l'oli vegetal consumit al món complementades per una dotzena de plantes més.\\nEls olis vegetals poden ser classificats de diverses maneres, per exemple:\\nPel seu origen: la majoria dels olis vegetals, però no tots, s'extreuen dels fruits o llavors de les plantes"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B7%9D%E5%B4%8E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Kawasaki_Saikaya.JPG","page_title":"川崎市","context_page_description":"川崎市是位於日本神奈川縣東北端的都市，位處東京、橫濱兩大都市之間，為政令指定都市。其為面積最小的政令指定都市，總人口數則為153萬，2019年5月超過神戶市成為日本人口第6多的城市，同時是日本除都道府縣廳所在地以外人口最多的都市。"},{"page_url":"https://fr.wikipedia.org/wiki/Guus_Hiddink","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Guus_Hiddink_Rusia_-_Azerbaiyan.jpg","page_title":"Guus Hiddink","context_page_description":"Guus Hiddink, né le 8 novembre 1946 à Varsseveld aux Pays-Bas, est un footballeur néerlandais qui évoluait au poste de milieu de terrain, avant de devenir ensuite entraîneur.\\nTrès réputé, il préconise le légendaire « football total » néerlandais.\\nIl a dirigé de nombreux clubs tels le PSV Eindhoven, le Fenerbahçe, le Valence CF, le Real Madrid, ou Chelsea, mais aussi cinq sélections nationales: les Pays-Bas, la Corée du Sud, l'Australie, la Russie et la Turquie."},{"page_url":"https://fr.wikipedia.org/wiki/Asmahan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Asmahan.jpg","page_title":"Asmahan","context_page_description":"Asmahan, de son vrai nom Amal El Atrache, née le 25 novembre 1912 et morte le 14 juillet 1944 en Égypte, est une chanteuse, et actrice syrienne. Elle est la sœur de Farid El Atrache."},{"page_url":"https://it.wikipedia.org/wiki/John_Juanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/John_Juanda_2008.jpg","page_title":"John Juanda","context_page_description":"John Juanda è un giocatore di poker indonesiano con nazionalità statunitense."},{"page_url":"https://fr.wikipedia.org/wiki/Tramway_de_Brunswick","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/100_6771_0756_Rathaus.jpg","page_title":"Tramway de Brunswick","context_page_description":"Le tramway de Brunswick est le réseau de tramways de la ville de Brunswick, en Allemagne. Ouvert en 1879, il compte actuellement 5 lignes."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9D%E3%83%A9%E3%83%A1%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Seoul-metro-742-Boramae-station-entrance-6-20191023-150520.jpg","page_title":"ポラメ駅","context_page_description":"ポラメ駅は大韓民国ソウル特別市銅雀区大方洞にある、ソウル交通公社7号線の駅。駅番号は742。"},{"page_url":"https://es.wikipedia.org/wiki/Avenida_Ruiz_Huidobro","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/La_Esmeralda.jpg","page_title":"Avenida Ruiz Huidobro","context_page_description":"La avenida Ruiz Huidobro es una de las principales avenidas de los barrios de Saavedra y Núñez de la ciudad de Buenos Aires, Argentina.\\nTiene como característica especial que en su tramo como avenida posee un pequeño bulevar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD_III_%D0%90%D1%80%D0%B3%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Miliaresion-Romanus_III-sb1822.jpg","page_title":"Роман III Аргир","context_page_description":"Роман III Аргир — імператор Візантії з 1028 по 1034 роки.\\nРоман III Аргир походив із вірменських землевласників. Був сином Євстафія Аргира. По діду Роману Аргиру був родичем Македонської династії. Обіймав одну з вищих посад — епарха Константинополя. Він зійшов на трон, після того як перед смертю імператор Костянтин VIII фактично примусив його одружитися зі своєю донькою Зоєю.\\nВін пробував проводити незалежну політику, однак усі його починання не закінчувалися успіхом. Спроба зменшити податки завершилась дефіцитом скарбниці. Він видав надто великі суми грошей на будівництво та духовні цілі.\\n1030 року Роман Аргир виступив проти арабів і персонально очолив армію й повів її на Алеппо. Однак у дорозі його перехопив противник і переміг у битві під Азацом біля Антіохії. Хоча він пізніше і здобув перемоги при обороні Едеси та над арабським флотом на Адріатиці, вони не збільшили його популярності.\\nПрипускають його повільне отруєння дружиною. Проте смерть йому заподіяли змовники, прихильники Михайла Пафлагонського, які задушили його 1034 року в лазні."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B5%D1%80%D1%8B%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C-%D1%80%D0%B0%D1%81%D0%BF%D1%80%D0%B5%D0%B4%D0%B5%D0%BB%D0%B8%D1%82%D0%B5%D0%BB%D1%8C_%D0%B7%D0%B0%D0%B6%D0%B8%D0%B3%D0%B0%D0%BD%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/RotorBakelite.jpg","page_title":"Прерыватель-распределитель зажигания","context_page_description":"Прерыватель-распределитель зажигания — механизм, определяющий момент формирования низковольтных импульсов в системе зажигания и используется для распределения высоковольтного электрического зажигания по цилиндрам карбюраторных и ранних инжекторных бензиновых двигателей внутреннего сгорания.\\nДизельные, компрессионные, калильные, а также двигатели с калильной головкой имеют иной принцип воспламенения топливо-воздушной смеси и прерыватель-распределитель им не нужен. Не имеют прерывателя-распределителя и современные бензиновые двигатели с электронной системой управления, так как момент начала искрообразования в них определяется программно, а оснащение каждой свечи индивидуальной катушкой зажигания делает ненужным распределение высокого напряжения.\\nВ классическом виде устройство включает в себя прерыватель тока низкого напряжения, распределитель тока высокого напряжения, центробежный, вакуумный регуляторы опережения зажигания и октан-корректор.\\nКонтакты прерывателя в определённый момент размыкаются, разрывая первичную цепь обмотки катушки зажигания, что вызывает индуцирование тока высокого напряжения в её вторичной обмотке."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2000/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Bundesarchiv_Bild_183-83285-0012%2C_Friedrich_Kind.jpg","page_title":"Lijst van personen overleden in 2000/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2000.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Riverside_Park_(Kamloops)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Kamloops_Riverside_Park.JPG","page_title":"Riverside Park (Kamloops)","context_page_description":"Riverside Park is a park in Kamloops, British Columbia, Canada that encompasses a beach next to a river. The park is bordered by the Thompson River and Landsdowne Street. There is a monument in the park that indicates the height to which four different floods reached throughout the history of the park. Riverside Park also includes a water park. There is an 11 PM curfew at the park, but it is not normally enforced. In 1885, the site that would eventually become the park was used as a campsite by Chinese Canadians from Savona's Ferry working on the Canadian Pacific Railway. When members of the On-to-Ottawa Trek stopped in Kamloops on their way from Vancouver to Ottawa, Ontario in 1935, Mayor W.J. Moffat offered the men an empty hospital to sleep in, but the men declined, many choosing rather to sleep in Riverside Park where they had only one blanket to share between three or four men. In 2011, a parking garage was proposed to be built in the park, but a group called the Friends of Riverside Park gathered signatures from more than 10% of the Kamloops electorate opposing the proposal, thereby forcing a referendum on the subject."},{"page_url":"https://sv.wikipedia.org/wiki/Standardn%C3%A4tverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Helleu_-_Daydream.jpg","page_title":"Standardnätverk","context_page_description":"Standardnätverk, eller inåtriktat nätverk, är inom neurovetenskap det nätverk av kopplade delar av hjärnan som är aktivt i hjärnans standardnätverksläge eller utgångsläge, det tillstånd som hjärnan befinner sig i när en person inte tänker på något särskilt, utan låter tankarna spontant vandra runt. Tillståndet skiljer sig både från de lägen då en person tolkar och bearbetar sinnesintryck och fokuserar på att lösa problem eller då en person befinner sig i sömn.\\nI standardnätverksläge bearbetar hjärnan inte som i uppgiftslösningsläge yttre intryck eller arbetar med att inriktat lösa speciella problem. Hjärnan arbetar i stället utifrån material som redan lagrats i hjärnan med dagdrömmar eller ostrukturerat tänkande, men fortfarande i vakentillstånd. I standardnätverksläge ligger rytmen i det centrala nervsystemet på den låga frekvensen en per tio sekunder.\\nSmåbarn synes ha ofullständigt utvecklade standardnätverk upp till åtminstone ett-två års ålder, eventuellt betydligt längre. Standardnätverket genomgår således förändringar efter utvecklingsstadium. Aktiviteten i standardnätverket försvagas när individen blir äldre."},{"page_url":"https://es.wikipedia.org/wiki/George_Gascoigne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/George_Gascoigne.jpg","page_title":"George Gascoigne","context_page_description":"George Gascoigne fue un poeta inglés. Era hijo mayor de Sir John Gascoigne de Cardington, Bedfordshire.\\nEstudió en el Trinity College de Cambridge, habiendo trabajado como abogado. Estuvo en prisión por deudas. Ingresó en el Parlamento en representación de Bedford, Bedfordshire en 1557-1558 y 1558-1559.\\nSus poemas no se publicaron antes de 1572, pero probablemente circularon en manuscrito antes de esa fecha. El propio autor cuenta que sus compañeros en Gray's Inn le importunaban para que escribiera temas señalados por ellos en latín, y que dos de sus obras se representaron allí. Se casó con una viuda y, a la muerte de ésta, heredó su patrimonio. En 1572 marchó como soldado de fortuna a los Países Bajos. Esta experiencia dio lugar a los relatos The Fruites of Warres y Gascoigne's Voyage into Hollande. En 1575 intervino diseñando mascaradas, publicadas al año siguiente como The Princely Pleasures at the Courte at Kenelworth, que celebraba la visita de la reina al Conde de Leicester.\\nConsideraba que Chaucer era su maestro, discrepando de los poetas de la escuela de Surrey y Wyatt principalmente en la suavidad y dulzura que añadió a sus versos."},{"page_url":"https://fr.wikipedia.org/wiki/Tornado_(catamaran)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Gaebler_catamaran.jpg","page_title":"Tornado (catamaran)","context_page_description":"Le Tornado est une classe de catamaran dessinée en 1966 par l’architecte britannique Rodney March, et mise au point avec l'aide de Terry Pierce et Reg White dans le but de participer à la sélection du modèle international Classe B organisée par la IYRU. Il gagna la sélection ; déclaré série olympique en 1973, il courut ses premiers Jeux olympiques à Montréal, en 1976. C’est encore en 2008 le seul catamaran olympique.\\nDepuis 1996, le Tornado est équipé d’un deuxième trapèze ainsi que d’un spinnaker. Depuis 2005, le mât est non plus en aluminium, mais en carbone. En novembre 2008, il perd son statut olympique pour les Jeux de 2012."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%B3%D1%83%D0%BB%D1%8C%D0%BC%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%B5%D0%B7%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Bugulminskiy-uezd-1912.jpg","page_title":"Бугульминский уезд","context_page_description":"Бугу́льминский уезд — административно-территориальная единица в Российской империи и РСФСР, существовавшая в 1781—1920 годах. Уездный город — Бугульма."},{"page_url":"https://en.wikipedia.org/wiki/Mr._%26_Mrs._Smith_(2005_film)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Centro-Internacional-Bogot%C3%A1.jpg","page_title":"Mr. & Mrs. Smith (2005 film)","context_page_description":"Mr. & Mrs. Smith is a 2005 American action comedy film directed by Doug Liman and written by Simon Kinberg. The film stars Brad Pitt and Angelina Jolie as a bored upper middle class married couple surprised to learn that they are assassins belonging to competing agencies, and that they have been assigned to kill each other.\\nBesides being a box office hit, Mr. & Mrs. Smith also established Pitt and Jolie's relationship."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9F%AD%E6%9F%B1%E9%93%B6%E8%8E%B2%E8%8A%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Anemone_baicalensis_-_Berlin_Botanical_Garden_-_IMG_8651.JPG","page_title":"短柱银莲花","context_page_description":"短柱银莲花是毛茛科银莲花属的植物，是中国的特有植物。分布在中国大陆的四川等地，生长于海拔2,500米的地区，一般生长在山地，目前尚未由人工引种栽培。"},{"page_url":"https://sco.wikipedia.org/wiki/Fran%C3%A7ois_Arago","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Arago_Francois_portrait.jpg","page_title":"François Arago","context_page_description":"Dominique François Jean Arago, kent semply as François Arago, wis a French mathematician, pheesicist, astronomer, freemason, supporter o the carbonari an politeecian."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A5%E0%B9%80%E0%B8%AD%E0%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Flag_Thai_General.svg","page_title":"พลเอก","context_page_description":"พลเอก คือ ยศของเจ้าหน้าที่ระดับสูงในกองทัพบก และในกองทัพเรือและกองทัพอากาศสำหรับบางประเทศ\\nคำว่า \\"General\\" หรือ \\"นายพล\\" ถูกนำมาใช้ได้สองแบบ คือ โดยทั่วไปหมายถึงนายทหารชั้นยศนายพลทั้งหมดตั้งแต่ พลจัตวา ถึง พลเอก และใช้เฉพาะเจาะจงหมายถึงยศพลเอก"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%98%87%E9%96%80%E7%AD%94%E8%87%98%E8%99%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Panthera_tigris_sumatrae_distribution_map_2.png","page_title":"苏门答腊虎","context_page_description":"蘇門打臘虎是生活在印度尼西亞蘇門答臘島上的一個虎的亞種。極度瀕危物種, 估計野外種群大約有441至679隻分布於印度尼西亞的蘇門答臘島, 呈逐年下降趨勢。蘇門答臘虎是除峇里虎和爪哇虎外，生活在印尼境內的第三個虎亞種；由於前者兩個虎亞種均已滅絕，巽他群島群三大虎亞種中唯一倖存的成員, 故它也是目前印尼境內僅存的唯一一個虎亞種。"},{"page_url":"https://nl.wikipedia.org/wiki/Nationaal_park_Kotychi-Strofylia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%CE%92%CE%B9%CF%8C%CF%84%CE%BF%CF%80%CE%BF%CF%82_%CE%A3%CF%84%CF%81%CE%BF%CF%86%CF%85%CE%BB%CE%B9%CE%AC%CF%82_06.jpg","page_title":"Nationaal park Kotychi-Strofylia","context_page_description":"Het Nationaal park Kotychi-Strofylia is een nationaal park in Griekenland aan de noordwestkust van de Peloponnesos. Het park is 22 vierkante kilometer groot en werd gesticht in 2009. Het park omvat naast de lagunes van Araxos, Prokopos en Kotychi ook duinen, wetlands, moerassen, kalksteenheuvels en het Strofylias-bos.\\nDe Kotychi-lagune is met 750 hectare de grootste lagune van de Peloponnesos en is tussen 0,4 en 1 meter diep. Het Strofylias-bos bestaat uit Aleppoden en parasolden en ligt op een smalle landtong tussen de Prokopos-lagune en de Ionische Zee. In het noorden van het park liggen de 'Zwarte Bergen', kalksteenheuvels tot 240 meter hoog. De golvende duinengordel is 200 hectare groot; de duinen zelf zijn 500 meter breed en tot 10 meter hoog. In het duingebied van het park bloeien zeenarcis en helmgras. Op het strand legt de Onechte karetschildpad haar eieren.\\nIn het park leven schildpad, vos, egel, goudjakhals, ijsvogel. Het nationaal park ligt op een trekvogelroute; in het park verblijven reiger, ibis, zwaluw, tortelduif, stern."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D1%8B%D0%B9_(%D0%90%D0%B4%D1%8B%D0%B3%D0%B5%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%D0%A0%D0%BE%D0%B4%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D1%8B%D0%B9_%D0%9C%D0%B0%D0%B9%D0%BA%D0%BE%D0%BF.jpg","page_title":"Родниковый (Адыгея)","context_page_description":"Роднико́вый — посёлок в Республике Адыгея. Входит в состав муниципального образования городской округ «город Майкоп»."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%9A%E3%82%A4%E3%83%B3%E3%81%AE%E3%82%B5%E3%83%83%E3%82%AB%E3%83%BC%E7%AB%B6%E6%8A%80%E5%A0%B4%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Estadio_de_La_Condomina.jpg","page_title":"スペインのサッカー競技場一覧","context_page_description":"以下のリストはスペインに存在するサッカー競技場を収容人数順に並べたものである。収容人数5,000人以上のスタジアムを掲載している。"},{"page_url":"https://fr.wikipedia.org/wiki/Juifs_d%27Allemagne_sous_le_Troisi%C3%A8me_Reich","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Nurembergracechart.jpg","page_title":"Juifs d'Allemagne sous le Troisième Reich","context_page_description":"Cet article traite de la condition des Juifs d'Allemagne sous le Troisième Reich."},{"page_url":"https://sv.wikipedia.org/wiki/Georgiens_vetenskapsakademi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/%E1%83%A1%E1%83%90%E1%83%A5%E1%83%90%E1%83%A0%E1%83%97%E1%83%95%E1%83%94%E1%83%9A%E1%83%9D%E1%83%A1_%E1%83%9B%E1%83%94%E1%83%AA%E1%83%9C%E1%83%98%E1%83%94%E1%83%A0%E1%83%94%E1%83%91%E1%83%90%E1%83%97%E1%83%90_%E1%83%94%E1%83%A0%E1%83%9D%E1%83%95%E1%83%9C%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%90%E1%83%99%E1%83%90%E1%83%93%E1%83%94%E1%83%9B%E1%83%98%E1%83%90.jpg","page_title":"Georgiens vetenskapsakademi","context_page_description":"Georgiens vetenskapsakademi är en akademi i Georgiens huvudstad Tbilisi. Akademin hette Georgiska SSR:s forskningsakademi fram till november 1990. Akademin samverkar vetenskaplig forskning i Georgien och utvecklar relationer mellan akademierna och forskningscentrumen i andra nationer.\\nAkademin grundades år 1941, i Tbilisi. Sedan februari år 2005 är Tamaz Gamkrelidze president över akademin."},{"page_url":"https://nl.wikipedia.org/wiki/Sarah_Rafferty","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Sarah_Rafferty_in_January_2013.jpg","page_title":"Sarah Rafferty","context_page_description":"Sarah Rafferty is een Amerikaanse actrice."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%B3%D8%AA%D9%88%D9%86-%D8%B3%D9%88%D9%BE%D8%B1-%D9%85%D8%A7%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Towton.jpg","page_title":"وستون-سوپر-مار","context_page_description":"وستون-سوپر-مار بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 76143 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://de.wikipedia.org/wiki/Unimog","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Unimog_S_404.1.jpg","page_title":"Unimog","context_page_description":"Der Unimog ist eine Fahrzeugbaureihe von Mercedes-Benz, die von Daimler Trucks, einem Geschäftsfeld der Daimler AG, hergestellt wird. Erfunden wurde er von Albert Friedrich. Konstruiert ist der Unimog als allradgetriebener Geräteträger und Klein-Lkw mit Portalachsen und wird vor allem in Land- und Forstwirtschaft, beim Militär und für kommunale Aufgaben eingesetzt. Einige Unimogmodelle sind klassische Dual-Use-Güter und werden auch für andere Aufgaben in unwegsamem Gelände, z. B. als Bohrfahrzeug oder bei der Katastrophenhilfe verwendet. Die Fahrzeuge sind als „Frontsitztraktor mit Allradantrieb“ klassifiziert. Die seit 1945 entwickelten Fahrzeuge wurden ab 1949 serienmäßig zunächst in Göppingen bei der Gebr. Boehringer GmbH gefertigt. Nach der Übernahme der Produktion durch den bisherigen Motorenlieferanten Daimler-Benz im Jahr 1950 wurde der Unimog ab 1951 im Werk Gaggenau gebaut, bevor 2002 die Produktion ins Mercedes-Benz-Werk Wörth wechselte. In Argentinien wurde der Unimog in Lizenz aus CKD-Sätzen nachgebaut. Das argentinische Unimog-Werk befand sich in González Catán am Stadtrand von Buenos Aires."},{"page_url":"https://de.wikipedia.org/wiki/Elbow_Lake_(Grant_County,_Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Grant_County_Courthouse_2012.jpg","page_title":"Elbow Lake (Grant County, Minnesota)","context_page_description":"Elbow Lake ist eine Kleinstadt und Verwaltungssitz des Grant County im US-amerikanischen Bundesstaat Minnesota. Im Jahr 2010 hatte Elbow Lake 1176 Einwohner."},{"page_url":"https://sl.wikipedia.org/wiki/Viharni_strako%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Lesp1.jpg","page_title":"Viharni strakoš","context_page_description":"Vihárni strákoš je manjša morska ptica iz reda cevonoscev Procellariiformes. Spada v družino strakošev Hydrobatidae, rod, oziroma podružino Oceanodroma.\\nPodoben je strakošu Hydrobates pelagicus, ima pa razločno viličasti rep in tudi noge mu kakor pri strakošu ne segajo prek repa. Gnezdi na težko dostopnih otokih v hladnejših severnih predelih Atlantskega in Tihega oceana. Med gnezdenjem se zadržuje v kolonijah blizu morja v skalnatih razpokah. Leže eno belo jajce."},{"page_url":"https://es.wikipedia.org/wiki/Caracol_Televisi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/LogoCaracolTV2017.png","page_title":"Caracol Televisión","context_page_description":"Caracol Televisión es un canal de televisión abierta colombiano, el cual tiene su origen institucional en la tradicional compañía radiodifusora Caracol, sigla de Cadena Radial Colombiana. El canal tiene como propiedad a los canales de suscripción Novelas Caracol, Canal Época, Caracol Internacional y a los canales de televisión digital terrestre Caracol HD2, Blu Radio y La Kalle. La compañía es propiedad del Grupo Valorem del empresario Alejandro Santo Domingo Dávila.\\nEl centro de producción y emisión de Caracol cuenta con catorce estudios y diez unidades móviles. Además, posee los derechos de transmisión de los torneos de la FIFA para Colombia, como la Copa Mundial de Fútbol, los partidos de la selección nacional de fútbol, de las Grandes Vueltas de ciclismo y los Juegos Olímpicos.\\nEl canal ha realizado producciones de fama internacional, como Desafío, A otro nivel, Yo me llamo, Escobar, el patrón del mal, La reina del flow, Pasión de gavilanes, La Promesa, El cartel, La saga, negocio de familia, Las muñecas de la mafia, Caballo viejo, Pedro el escamoso, La ronca de oro, La niña, Bolívar y Sin tetas no hay paraíso, entre otras."},{"page_url":"https://tt.wikipedia.org/wiki/NGC_7060","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/NGC_7060.jpg","page_title":"NGC 7060","context_page_description":"NGC 7060 — Томанлыклар һәм йолдыз тупланмалары яңа гомуми каталогында теркәлгән галактика."},{"page_url":"https://ca.wikipedia.org/wiki/Tit%C3%AD_de_peus_blancs","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/HapaleLeucopusKeulemans.jpg","page_title":"Tití de peus blancs","context_page_description":"El tití de peus blancs és una espècie de mico de la família dels cal·litríquids que viu a Colòmbia."},{"page_url":"https://pt.wikipedia.org/wiki/Tom%C3%A9_Velho","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Tom%C3%A9_Velho_Portal_Igreja_da_Miseric%C3%B3rdia_Tent%C3%BAgal_IMG_1853.JPG","page_title":"Tomé Velho","context_page_description":"Tomé Velho, foi um arquiteto e escultor português dos séculos XVI-XVII."},{"page_url":"https://en.wikipedia.org/wiki/Acacia_wiseana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Acacia_wiseanaDistMap965.png","page_title":"Acacia wiseana","context_page_description":"Acacia wiseana is a shrub that grows in arid and semi-arid parts of northern Western Australia and the Northern Territory."},{"page_url":"https://en.wikipedia.org/wiki/Mat%C3%ADas_Vargas_(footballer,_born_1997)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Mat%C3%ADas_Vargas_2019.jpg","page_title":"Matías Vargas (footballer, born 1997)","context_page_description":"Martín Matías Ezequiel Vargas, nicknamed Monito is an Argentine professional footballer who plays as a left winger for Spanish club RCD Espanyol."},{"page_url":"https://ro.wikipedia.org/wiki/Quito","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/%28Gu%C3%A1pulo%29_Buena_Vista_black_and_white.JPG","page_title":"Quito","context_page_description":"Quito este capitala Ecuadorului. Este situată la o altitudine de 2850 m, la poalele vulcanului Pichincha, fiind singura capitală din lume amenințată de un vulcan activ.\\nEste capitala cea mai apropiată de Ecuator din lume. Quito este a doua capitală din lume ca altitudine după La Paz."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/%D0%9A%D0%B0%D1%80%D0%BB%D0%B8%D0%BA%D0%BE%D0%B2_%D0%92.%D0%9F..jpg","page_title":"Карликов, Владимир Павлович","context_page_description":"Карликов Владимир Павлович — советский и российский учёный в области механики и педагог высшей школы, доктор физико-математических наук, профессор, заведующий кафедрой гидромеханики механико-математического факультета МГУ, академик РАЕН и АТН РФ."},{"page_url":"https://az.wikipedia.org/wiki/Dilican_Milli_Park%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/%22Dilijan%22_national_park.jpg","page_title":"Dilican Milli Parkı","context_page_description":"Dilican Milli Parkı - Ermənistanın şimal-şərqində, Tavuş mərzində yerləşən milli park. Sahəsi 240 km²-dır. Ən çox təbiəti, biomüxtəlifliyi, müalicəvi bulaq suları, tarixi abidələri ilə tanınır. Ermənistanın iki milli parkından biridir."},{"page_url":"https://no.wikipedia.org/wiki/Vekteren","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Vekteren.jpg","page_title":"Vekteren","context_page_description":"Vekteren er navnet som har vært brukt på flere av båtene til havnepolitiet i Oslo. Dagens Vekteren er i ferd med å fases ut, og erstattes av en ny 50 fots hurtiggående båt til en pris av 15 millioner kroner. Den nye båten skal døpes i januar 2014.\\nVekteren var også navnet på den tidligere patruljebåten til havnepolitiet. Denne var i tjeneste i en lang årrekke fra før den andre verdenskrig. Skroget var malt i den samme mørkegrønne fargen som den gang også var i bruk på politiets kassevogner, mens overbygget var lysegult."},{"page_url":"https://en.wikipedia.org/wiki/Polish_z%C5%82oty","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/5z%C5%82_j%C3%B3zef_orze%C5%82_strzelecki_back.jpg","page_title":"Polish złoty","context_page_description":"The złoty is the official currency and legal tender of Poland. It is subdivided into 100 grosz. The widely recognised English form of the currency is the Polish zloty. It is the most traded currency in Central Europe and ranks 22nd in the foreign exchange market.\\nThe word złoty is a masculine form of the Polish adjective 'golden', which closely relates with its name to the Dutch guilder, whereas the grosz subunit was based on Austrian groschen. It was officially introduced to replace its predecessor, the Polish marka, on 28 February 1919 and began circulation in 1924. The only body permitted to manufacture or mint złoty coins is Mennica Polska, founded in Warsaw on 10 February 1766.\\nAs a result of inflation in the early 1990s, the currency underwent redenomination. Thus, on 1 January 1995, 10,000 old złoty became one new złoty. Since then, the currency has been relatively stable, with an exchange rate fluctuating between 3 and 4 złoty for a United States dollar. Though Poland is a member of the European Union, nearly 60% of Poles are strongly against replacing the złoty with the euro."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Oberstreu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Oberstreu%2C_Mellrichst%C3%A4dter_Stra%C3%9Fe_2%2C_001.jpg","page_title":"Liste der Baudenkmäler in Oberstreu","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Gemeinde Oberstreu zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 7. April 2020 wieder und enthält 65 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/History_of_lute-family_instruments","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Shubha_Mudgal_in_playing_the_Tanpura_%282527339532%29.jpg","page_title":"History of lute-family instruments","context_page_description":"Lutes are stringed musical instruments that include a body and \\"a neck which serves both has a handle and as a means of stretching the strings beyond the body\\".\\nThe lute family includes not only short-necked plucked lutes such as the lute, oud, pipa, guitar, citole, gittern, mandore, rubab, and gambus and long-necked plucked lutes such as banjo, tanbura, bağlama, bouzouki, veena, theorbo, archlute, pandura, sitar, Tanbur, setar, but also bowed instruments such as the Yaylı tambur, rebab, erhu, and entire family of viols and violins.\\nLutes apparently rose in ancient Mesopotamia prior to 3100 B.C. or were brought to the area by ancient Semitic tribes. The lutes were pierced lutes, long-necked lutes with a neck made from a stick that went into a carved or turtle-shell bowl, the top covered with skin, and strings tied to the neck and instrument's bottom.\\nCurt Sachs, a musical historian, placed the earliest lutes at about 2000 B.C. in his 1941 book The History of Musical Instruments. This date was based the archaeological evidence available to him at that time."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E4%BA%AC%E5%9C%B0%E9%93%81%E4%BA%A6%E5%BA%84%E7%BA%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/BJ_Subway_YZ_Seat.JPG","page_title":"北京地铁亦庄线","context_page_description":"北京地铁亦庄线开通于2010年12月30日，是北京地铁的一条线路，途经丰台、朝阳、大兴、通州四个区，连接北京市区和亦庄新城经济技术开发区。这条线路始于宋家庄站，终于亦庄火车站，全长23.3km，共设车站14座，其中有8座高架站，6座地下站。亦庄线可在宋家庄站与 █ 5号线和 █ 10号线换乘，未来可在亦庄火车站则可以换乘京津城际铁路。线路的标志色为桃红色。"},{"page_url":"https://en.wikipedia.org/wiki/Zebbler","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Zebbler_2012_%288266396258%29.jpg","page_title":"Zebbler","context_page_description":"Zebbler is a visual artist, video jockey and the founder of Zebbler Studios, who is known for his work with Shpongle, EOTO, and Zebbler Encanti Experience. Originally from Grodno, Belarus, Berdovsky graduated from Arlington High School in Arlington, Massachusetts in 1999 before completing a degree at Massachusetts College of Art and Design in 2006. Growing up, young Zebbler Peter Berdovsky always had music in his house thanks to a mother who was a music teacher. He quickly got used to being surrounded by balalaikas, drums, cymbals, shakers, pianos, accordions, and bayans as well as the sounds of Abba and the best of 1980s Russian pop blasting on his mum's vinyl record player. His artistic persona is not only a way to honor his roots but also the result of a revelation involving the actor Sean Connery. \\"When I was 13, I decided that I needed a pseudonym. While daydreaming, a visualization of a dragon with the distinct voice of Connery appeared in front of me and said, with a thick Scottish accent, ‘Frae noo oan, son, yer nam shaa be knoon as Zebbler!’ So I took up my foreign-sounding name and embraced it as my own,\\" he recalls."},{"page_url":"https://sv.wikipedia.org/wiki/Slaget_vid_Ulai","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/History_of_Egypt%2C_Chaldea%2C_Syria%2C_Babylonia_and_Assyria_%281903%29_%2814761195044%29.jpg","page_title":"Slaget vid Ulai","context_page_description":"Slaget vid Ulaifloden, även känt som slaget vid Til-Tuba och slaget vid Tulliz var ett slag 653 f.Kr. mellan det assyriska imperiet under kung Ashurbanipal och kungadömet Elam under kung Teumman. Slaget berodde på att Elam allierat sig med Babylon i deras uppror mot Assyrien och resulterade i en avgörande Assyrisk seger. Både Teumman och hans son Tammaritu stupade i slaget."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%80%D0%BD%D1%96%D1%82%D0%BE%D0%BF%D0%BE%D0%B4%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Largestornithopods_scale.png","page_title":"Орнітоподи","context_page_description":"Орнітоподи — група птахотазових динозаврів.\\nВід інших динозаврів їх відрізняв механізм стегнових кісток, який дозволяв тварині пересуватися на задніх ногах. Тобто більшість цих тварин були двоногими рослиноїдними. Англійські вчені XIX в. назвали довгошиїх рослиноїдних «зауроподами», тому що їх ноги нагадували ноги ящірки. Двоногих ж динозаврів, чиї ноги подібні пташиним, вони назвали «орнітоподами». Ми досі користуємося цими термінами."},{"page_url":"https://war.wikipedia.org/wiki/Trifolium_hybridum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Vitkl%C3%B6ver_och_Alsikekl%C3%B6ver.jpg","page_title":"Trifolium hybridum","context_page_description":"An Trifolium hybridum in uska species han Magnoliopsida nga ginhulagway ni Carl von Linné. An Trifolium hybridum in nahilalakip ha genus nga Trifolium, ngan familia nga Fabaceae."},{"page_url":"https://pl.wikipedia.org/wiki/Droga_krajowa_nr_16_(Polska)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/HerbUG.png","page_title":"Droga krajowa nr 16 (Polska)","context_page_description":"Droga krajowa nr 16 – droga krajowa klasy GP przebiegająca z Dolnej Grupy k. Grudziądza do granicy z Litwą w Ogrodnikach. Biegnie równoleżnikowo przez województwa: kujawsko-pomorskie, warmińsko-mazurskie oraz podlaskie. Stanowi główny szlak komunikacyjny na Mazurach. Droga na niektórych odcinkach nie spełnia wymagań kategorii drogi krajowej z powodu małej szerokości jezdni. Miejscami nie ma poboczy, ponieważ przydrożne drzewa rosną tuż przy krawędzi drogi."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BF%84%E7%BE%85%E6%96%AF%E5%AE%97%E6%95%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Seventh-Day_Adventist_church_%28Moscow%29_05.jpg","page_title":"俄羅斯宗教","context_page_description":"俄罗斯的宗教多元，1997年的一项法律将基督宗教、伊斯兰教、犹太教和佛教作为俄罗斯历史上的重要命名。俄罗斯政府指定了四个正式的“传统”宗教：基督正教、伊斯兰教、犹太教和佛教。\\n正教会是俄罗斯的传统且规模最大的宗教教派，大约95％的东正教堂区属于俄罗斯正教会，也有一些较小的正教会教派。自1991年苏联解体以来，整个俄罗斯西伯利亚地区的萨满教有普遍复兴的趋势。\\n自1990年代末和21世纪初以来，俄罗斯当局对宗教自由的尊重已经下降。"},{"page_url":"https://en.wikipedia.org/wiki/Dennis_Aogo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Dennis_Aogo_2019.jpg","page_title":"Dennis Aogo","context_page_description":"Dennis Aogo is a German former professional footballer who played as a left back and left wing-back or midfielder."},{"page_url":"https://it.wikipedia.org/wiki/S%C3%A8te","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Sete_panorama.jpg","page_title":"Sète","context_page_description":"Sète è un comune francese di 43 139 abitanti del dipartimento dell'Hérault, in Occitania.\\nLa grafia attuale del nome è del 1928; prima di quella data era noto come Cette.\\nSète è il secondo porto per importanza della Francia sul Mediterraneo dopo Marsiglia.\\nDa Sète partono navi per la Spagna, il Marocco e la Tunisia."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Wien/Innere_Stadt/Hi%E2%80%93K","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Kaerntnerring12.jpg","page_title":"Liste der denkmalgeschützten Objekte in Wien/Innere Stadt/Hi–K","context_page_description":"Die Liste der denkmalgeschützten Objekte in Wien/Innere Stadt enthält die 791 denkmalgeschützten, unbeweglichen Objekte des 1. Wiener Gemeindebezirks Innere Stadt."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Elliott_Mining_Complex","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/StateLibQld_2_188239_Teacher_and_friends_standing_near_a_dwelling_in_the_mining_town%2C_Mount_Elliott%2C_Queensland.jpg","page_title":"Mount Elliott Mining Complex","context_page_description":"Mount Elliott Mining Complex is a heritage-listed copper mine and smelter at Selwyn, Shire of Cloncurry, Queensland, Australia. It was designed by William Henry Corbould and built in 1908. It is also known as Mount Elliott Smelter and Selwyn. It was added to the Queensland Heritage Register on 16 September 2011."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/S%C3%A9deilhac","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Map_commune_FR_insee_code_31539.png","page_title":"Sédeilhac","context_page_description":"Sédeilhac sī ūi-tī Hoat-kok Midi-Pyrénées tōa-khu Haute-Garonne séng ê chi̍t ê commune."},{"page_url":"https://eu.wikipedia.org/wiki/Steinbach_(Eichsfeld)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Wappen_Steinbach_%28Eichsfeld%29.png","page_title":"Steinbach (Eichsfeld)","context_page_description":"Steinbach (Eichsfeld) Alemaniako udalerria da. Turingia estatuan kokatuta dago, Eichsfeld barrutian. 2014an 549 biztanle zituen 8,48 kilometro koadrotan banatuta."},{"page_url":"https://es.wikipedia.org/wiki/Roman_Reigns","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/WrestleMania_31_2015-03-29_19-53-39_ILCE-6000_9998_DxO_%2818117494711%29.jpg","page_title":"Roman Reigns","context_page_description":"Leati Joseph \\"Joe\\" Anoa'i ​ es un luchador profesional, exjugador profesional de fútbol gridiron y actor estadounidense. Forma parte de la familia Anoa'i samoana, ​ y actualmente trabaja para la WWE, donde compite en la marca SmackDown bajo el nombre de Roman Reigns.\\nEntre sus logros como luchador se destacan cuatro Campeonatos Mundiales, siendo tres veces como Campeón Mundial Peso Pesado de la WWE y una vez Campeón Universal de la WWE. También se destaca un reinado como Campeón de los Estados Unidos de WWE, un reinado como Campeón Intercontinental de WWE, uno como Campeón en Parejas de la WWE junto a Seth Rollins y un reinado como Campeón en Parejas de la FCW junto a Mike Dalton en el territorio en desarrollo de la WWE Florida Championship Wrestling. También fue el ganador de la edición del Royal Rumble del año 2015, y posee el récord de eliminaciones en la edición del año 2014. Reigns se convirtió en el vigésimo octavo Campeón de la Triple Corona y en el decimoséptimo Campeón de Grand Slam, y hasta ahora es el segundo miembro de The Shield en conseguirlo después de Dean Ambrose."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%86%D1%91%D0%BB_%D0%90%D0%B4%D1%88%D1%83%D0%BA%D0%B0%D0%BD%D0%BD%D1%8F_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%B0_%D0%9A%D1%80%D1%8B%D0%B6%D0%B0_%D1%96_%D0%BA%D0%BB%D1%8F%D1%88%D1%82%D0%B0%D1%80_%D0%B1%D0%B5%D1%80%D0%BD%D0%B0%D1%80%D0%B4%D0%B7%D1%96%D0%BD%D1%86%D0%B0%D1%9E_(%D0%93%D1%80%D0%BE%D0%B4%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/%D0%93%D1%80%D0%BE%D0%B4%D0%BD%D0%B0_2015.%D0%9A%D0%B0%D1%81%D1%86%D1%91%D0%BB_%D0%90%D0%B4%D1%88%D1%83%D0%BA%D0%B0%D0%BD%D0%BD%D1%8F_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%B0_%D0%9A%D1%80%D1%8B%D0%B6%D0%B0_%D1%96_%D0%BA%D0%BB%D1%8F%D1%88%D1%82%D0%B0%D1%80_%D0%B1%D0%B5%D1%80%D0%BD%D0%B0%D1%80%D0%B4%D0%B7%D1%96%D0%BD%D1%86%D0%B0%D1%9E.jpg","page_title":"Касцёл Адшукання Святога Крыжа і кляштар бернардзінцаў (Гродна)","context_page_description":"Касцёл Адшукання Святога Крыжа — рымска-каталіцкі храм у цэнтральнай частцы Гродна. Пасля разбурэння савецкімі ўладамі Фары Вітаўта, Пабернардзінскі касцёл з'яўляецца самым старым каталіцкім храмам у Гродне."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%B0%E5%8F%B0%E5%8D%97%E8%B7%AF%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Platform_of_L9_Fengtainanlu_Station_%2820180120154857%29.jpg","page_title":"丰台南路站","context_page_description":"丰台南路站位于北京市丰台区，是北京地铁9号线和建设中的16号线的一座车站。9号线车站于2011年12月31日随9号线南段开通同时启用。"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%85%D9%88%D9%86%D8%AA%D8%A7%D8%A8%D8%A7%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Schloss_Montabaur_013.jpg","page_title":"مونتاباور","context_page_description":"مونتاباور آلمانین راینلاند-فالتس ایالتینده یئر آلان بیر شهردیر و ۲۳۰ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۲۵۳۷ نفر دیر. بۇ شهرین ۳۳٫۶۱ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://en.wikipedia.org/wiki/McDang","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sirichalerm_Svasti.jpg","page_title":"McDang","context_page_description":"Mom Luang Sirichalerm Svasti, who is usually known by his nickname McDang, is a Thai food expert, chef, and writer. He is the only Thai chef to have his own training class at Le Cordon Bleu College of Culinary Arts."},{"page_url":"https://sv.wikipedia.org/wiki/Plymouth,_Massachusetts","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Downtown_Plymouth_MA.JPG","page_title":"Plymouth, Massachusetts","context_page_description":"Plymouth är en kommun i Plymouth County, Massachusetts, nordöstra USA, vid Plymouth Bay, cirka sex mil sydost om Boston. Kommunen hade 2007 ett invånartal på 58 300. Plymouth är administrativ huvudort i Plymouth County tillsammans med orten Brockton."},{"page_url":"https://de.wikipedia.org/wiki/Randens","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Randens_-_Monument_aux_morts.jpg","page_title":"Randens","context_page_description":"Randens ist eine Commune déléguée in der französischen Gemeinde Val-d’Arc mit 816 Einwohnern in den Savoyen in Frankreich. Sie gehört zur Region Auvergne-Rhône-Alpes, zum Département Savoie und zum Arrondissement Saint-Jean-de-Maurienne.\\nDie Gemeinde Randens wurde am 1. Januar 2019 mit Aiguebelle zur neuen Gemeinde Val-d’Arc zusammengeschlossen. Sie gehörte und zum Kanton Saint-Pierre-d’Albigny\\nDer Arc bildete die Grenze zur westlich gelegenen Nachbargemeinde Aiguebelle und zu Bourgneuf im Nordwesten. Die weiteren Nachbargemeinden waren Bonvillaret im Norden und Montsapey im Osten und im Süden."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E4%BB%80%E5%8A%A0%E5%9C%B0%E6%AF%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Abrash.JPG","page_title":"卡什加地毯","context_page_description":"卡什加地毯，又稱為設拉子地毯，據伊朗當地的地毯商人所言是所有波斯地毯中最出名的，且也是最高級的一種。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%A5%E3%83%BC%E3%83%AA%E3%82%AF_(%E8%A3%85%E7%94%B2%E5%B7%A1%E6%B4%8B%E8%89%A6%E3%83%BB%E5%88%9D%E4%BB%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ryurik1889-1904Nagasaki.jpg","page_title":"リューリク (装甲巡洋艦・初代)","context_page_description":"リューリクは、ロシア帝国の保有した装甲巡洋艦。日露戦争ではウラジオストク巡洋艦隊に所属して活発な通商破壊戦を行ったが、蔚山沖海戦で日本軍の主力艦隊の遊撃部隊である第二艦隊に撃沈された。"},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_D%C3%BCren%E2%80%93Heimbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/07.05.90_Untermaubach_212.318_%286802275445%29.jpg","page_title":"Bahnstrecke Düren–Heimbach","context_page_description":"Die Bahnstrecke Düren–Heimbach von Düren nach Heimbach erschließt die Rureifel. Neben der Bedeutung für den öffentlichen Personennahverkehr hat diese Strecke eine große Relevanz für den Tourismus."},{"page_url":"https://simple.wikipedia.org/wiki/Jasper,_Indiana","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Jasper_indiana_square.jpg","page_title":"Jasper, Indiana","context_page_description":"Jasper is a city of Dubois County in the state of Indiana, United States. Jasper is the county seat of Dubois County."},{"page_url":"https://sk.wikipedia.org/wiki/Stre%C5%A1n%C3%BD_svetl%C3%ADk","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/70/Skylight_w_cuppola.jpg","page_title":"Strešný svetlík","context_page_description":"Strešný svetlík je architektonický presvetľovací prvok stavieb. Rieši tiež vetranie cez strechu, kde by klasické okná svoju funkciu plniť nemohli. Kotvia sa do strešného plášťa svetlíkovými obrubami o voliteľnej výške.\\nNevýhodou svetlíkov je zvýšený prestup tepla cez strešnú konštrukciu, vytváranie tepelných mostov a následná kondenzácia vodnej pary."},{"page_url":"https://sv.wikipedia.org/wiki/Coniogramme","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Starr_030405-0343_Coniogramme_pilosa.jpg","page_title":"Coniogramme","context_page_description":"Coniogramme är ett släkte av kantbräkenväxter. Coniogramme ingår i familjen Pteridaceae.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://fr.wikipedia.org/wiki/Vlie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/800nc_ex_leg.jpg","page_title":"Vlie","context_page_description":"La Vlie est l'étendue d'eau qui sépare les îles néerlandaises de Vlieland et de Terschelling. La Vlie était jadis un émissaire du lac Flevo.\\nVers 800, Vlieland et Terschelling étaient plus grandes qu'aujourd'hui. Vlieland s'étendait jusqu'au delà de ce qui est aujourd'hui l'Afsluitdijk et comprenait aussi Eierland. La Vlie coulait jusqu'aux environs de Stavoren et marquait la séparation entre Vlieland et les digues de Frise occidentale à l'ouest et Terschelling et les digues de l'actuelle province de Frise à l'est.\\nLa Vlie avait une fonction importante. C'était une voie navigable entre le lac Flevo et la mer du Nord. La Lex Frisionum distinguait trois différentes variantes de droit frison ; la Vlie formait la limite entre les variantes occidentale et centrale."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D1%83%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Niederlauer_in_NES.svg","page_title":"Нидерлауер","context_page_description":"Нидерлауер општина је у њемачкој савезној држави Баварска. Једно је од 37 општинских средишта округа Рен-Грабфелд. Према процјени из 2010. у општини је живјело 1.787 становника. Посједује регионалну шифру 9673146."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_de_Montcenis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Map_canton_code_71_32.svg","page_title":"Cantón de Montcenis","context_page_description":"El cantón de Montcenis era una división administrativa francesa, que estaba situada en el departamento de Saona y Loira y la región de Borgoña.​"},{"page_url":"https://en.wikipedia.org/wiki/United_Left_(Spain)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Izquierda_Unida_1986.png","page_title":"United Left (Spain)","context_page_description":"United Left is a political coalition that was organized in 1986, bringing together several left-wing and far-left political organizations.\\nIU was founded as an electoral coalition of seven parties, but the Communist Party of Spain is the only remaining integrated member of the IU at the national level. Despite that, IU brings together other regional parties, political organizations, and independents. It currently takes the form of a permanent federation of parties.\\nIU is currently part of the Unidas Podemos coalition and the corresponding parliamentary group in the Congreso de los Diputados. Since January 2020, it participates for the first time in a national coalition government with one minister."},{"page_url":"https://fr.wikipedia.org/wiki/Peter_Philipp_von_Dernbach","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Dembach1683.jpg","page_title":"Peter Philipp von Dernbach","context_page_description":"Peter Philipp Reichsgraf von Dernbach dit Graul est prince-évêque de Bamberg et de Wurtzbourg."},{"page_url":"https://it.wikipedia.org/wiki/Bartolomeo_Bellano","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Bartolomeo_bellano%2C_davide_con_la_testa_di_golia%2C_padova%2C_1470-1480.JPG","page_title":"Bartolomeo Bellano","context_page_description":"Bartolomeo Bellano, noto anche come Vellano da Padova, è stato uno scultore e medaglista italiano."},{"page_url":"https://nl.wikipedia.org/wiki/Louis-Fran%C3%A7ois_de_Bausset-Roquefort","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Chereau1780.jpg","page_title":"Louis-François de Bausset-Roquefort","context_page_description":"Louis-François de Bausset-Roquefort was de laatste bisschop van Alès in het koninkrijk Frankrijk. Hij bekleedde een bestuurspost op het ministerie van Onderwijs tijdens het Eerste Franse Keizerrijk en nadien. Tevens werd hij hertog-pair van Frankrijk, kardinaal en minister van Staat. Omwille van zijn biografieën over prelaten werd hij lid van de Académie française."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE-%D0%BE%D1%80%D0%BA%D0%B5%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D1%81%D0%BB%D1%83%D0%B6%D0%B1%D0%B0_%D0%92%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D1%85_%D0%A1%D0%B8%D0%BB_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Pexota_Kostromatsar.jpg","page_title":"Военно-оркестровая служба Вооружённых Сил Российской Федерации","context_page_description":"Военно-оркестровая служба Вооружённых Сил Российской Федерации — формирование Вооружённых Сил Российской Федерации, призванная содействовать духовному и культурному развитию военнослужащих и гражданского персонала Вооружённых Сил Российской Федерации, готовить квалифицированные кадры военных дирижёров и музыкантов.\\nПодчинена Генеральному штабу Вооружённых Сил Российской Федерации.\\nРанее в вооружённых силах при помощи музыкальных инструментов происходило управление формированиями, в повседневной деятельности и в бою, отдельные элементы этого управления сохранены и сейчас.\\nПраздник — День Военно-оркестровой службы Вооружённых Сил Российской Федерации. Отмечается ежегодно 19 февраля."},{"page_url":"https://ca.wikipedia.org/wiki/Marqu%C3%A8s_d%27Alfarr%C3%A0s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Laberinto_de_Horta_%287992121789%29.jpg","page_title":"Marquès d'Alfarràs","context_page_description":"Marquès de d'Alfarràs és un títol nobiliari concedit per Felip V d'Espanya l'any 1702 a Pere de Ribes-Vallgornera i de Boixadors."},{"page_url":"https://en.wikipedia.org/wiki/Yukihiro_Nozuyama","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Yukihiro_Noduyama_20181003.jpg","page_title":"Yukihiro Nozuyama","context_page_description":"Yukihiro Nozuyama is a Japanese voice actor affiliated with Rush Style. His hometown is in Osaka."},{"page_url":"https://de.wikipedia.org/wiki/Dupatta","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Jaipur-India_n001.jpg","page_title":"Dupatta","context_page_description":"Dupatta ist ein Schleier in der Art eines etwa 2 m langen und ca. 1 m breiten Schals, der von Frauen in vielen Ländern Südasiens, vor allem in Indien und Pakistan, als Teil des Salwar Kamiz getragen wird."},{"page_url":"https://en.wikipedia.org/wiki/Danaus_chrysippus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Plain_tiger_moat.JPG","page_title":"Danaus chrysippus","context_page_description":"Danaus chrysippus, also known as the plain tiger, African queen, or African Monarch, is a medium-sized butterfly widespread in Asia, Australia and Africa. It belongs to the Danainae subfamily of the brush-footed butterfly family Nymphalidae. Danainae primarily consume plants in the genus Asclepias, more commonly called milkweed. Milkweed contains toxic compounds, cardenolides, which are often consumed and stored by many butterflies. Because of their emetic properties, the plain tiger is unpalatable to most predators. As a result, the species' coloration is widely mimicked by other species of butterflies. The plain tiger inhabits a wide variety of habitats, although it is less likely to thrive in jungle-like conditions and is most often found in drier, wide-open areas.\\nD. chrysippus encompasses three main subspecies: D. c. alcippus, D. c. chrysippus, and D. c. orientis. These subspecies are found concentrated in specific regions within the larger range of the entire species.\\nThe plain tiger is believed to be one of the first butterflies depicted in art. A 3500-year-old ancient Egyptian fresco in Luxor features the oldest known illustration of this species."},{"page_url":"https://de.wikipedia.org/wiki/Saint-Pierre-du-Vauvray","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Pont_sur_la_Seine%2C_Saint-Pierre-du-Vauvray_01_09.jpg","page_title":"Saint-Pierre-du-Vauvray","context_page_description":"Saint-Pierre-du-Vauvray ist eine französische Stadt mit 1.291 Einwohnern im Département Eure in der Region Normandie. Sie gehört zum Arrondissement Les Andelys und zum Kanton Louviers."},{"page_url":"https://cs.wikipedia.org/wiki/Lori_%C5%A1t%C3%ADhl%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Red_Slender_Loris_area.png","page_title":"Lori štíhlý","context_page_description":"Lori štíhlý je malý primát z čeledi outloňovitých a nejznámější zástupce rodu lori, který obývá deštné, světlé a lužní lesy na Srí Lance a v jižní Indii. Jeho první název lori pochází z nizozemského slova loeris, což znamená klaun. Lori tento název získal díky svému komickému vzhledu."},{"page_url":"https://de.wikipedia.org/wiki/Hanfzubereitung","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Alice_B._Toklas%2C_by_Carl_Van_Vechten_-_1949.jpg","page_title":"Hanfzubereitung","context_page_description":"Eine Hanfzubereitung ist ein mit Hanf versetztes Lebensmittel. Im englischsprachigen Raum werden solche als Edible bezeichnet. Dieser Begriff hat sich als Jargonausdruck auch im deutschsprachigen Raum durchgesetzt.\\nDie meisten Hanfzubereitungen enthalten eine erhebliche Menge an THC, das bei Verzehr die für die Substanz typischen Erscheinungen wie Entspannung, Euphorie, Appetitsteigerung, aber auch Erschöpfung und Angst auslösen kann. Zubereitungen, in denen THC als Wirkstoff dominiert, werden als Freizeitdroge oder zu medizinischen Zwecken verzehrt. Einige, insbesondere mit Nutzhanf versetzte Hanfzubereitungen enthalten nur kleine Mengen THC und sind stattdessen mit anderen Cannabinoiden versetzt; am häufigsten Cannabidiol."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A1%B0%EC%A7%80%ED%94%84_%EB%A7%90%EB%A1%9C%EB%93%9C_%EC%9C%8C%EB%A6%AC%EC%97%84_%ED%84%B0%EB%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Turner%2C_The_Battle_of_Trafalgar_%281822%29.jpg","page_title":"조지프 말로드 윌리엄 터너","context_page_description":"조지프 말로드 윌리엄 터너는 영국의 화가이다. 런던에서 이발사의 아들로 태어났다.\\n일찍부터 회화에 손을 대어 왕립 미술원에서 그림 수업을 한 뒤, 잠깐 사이에 준회원에서 27세 되던 1802년에 정회원으로 올라갔다. 여러 곳의 풍습과 풍경을 주로 그렸으며, 특히 빛의 묘사에서 획기적인 표현을 남긴 화가이다.\\n후에 문학가 러스킨이 격찬하여 명성이 높아졌으며, 일생 동안 풍경화를 계속 그린 화가로서 17세기 프랑스의 클로드 로랭을 능가하는 것이 그의 생애의 염원이었다. 그런만큼 중기에는 로랭의 영향이 보이나 후반에는 여기에서 벗어나 한층 더 빛의 묘사로 들어간다. 터너는 1819년부터 약 10년마다, 세 번 이탈리아로 여행을 갔는데, 물과 하늘, 그리고 빛나는 남국의 태양은 터너의 꿈이요 시였다. 터너는 풍경의 일체를 빛의 묘사에 집중시켜 빛 속에 용해시켜 갔는데, 그것은 균정이 잡힌 윤곽에서 정중하게 그린, 당시로서는 대담한 창작이었다. 더욱이 그는 다시 창작을 계속하여, 《항구 앞바다의 눈보라》에서 배의 그림자까지 거칠게 불어대는 태풍 속으로 꺼지는 듯 눈보라의 심한 상태를 주제로 잡고, 과거의 회화에 전례없는 동적인 표현을 그려내고 있다. 작품에는 《차일드 해럴드의 순례》, 《전함 테메레이르호》, 《안개 속의 해돋이》, 《비·증기·속력》, 《황금가지》 등이 있는데, 원숙한 빛의 표현이 아름답다. 이상하게도 제자나 후계자가 없는 화가로서 고독한 성격이었으며, 본가 외에 체르시에 은거하면서 이름을 바꾸어 생활을 했기 때문에 아는 사람도 없이 그 곳에서 숨을 거두었다."},{"page_url":"https://de.wikipedia.org/wiki/Satori","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Satori.svg","page_title":"Satori","context_page_description":"Satori bezeichnet das Erlebnis der Erleuchtung im Zen-Buddhismus."},{"page_url":"https://de.wikipedia.org/wiki/Verschneite_D%C3%A4cher","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Gustave_Caillebotte_-_Rooftops_in_the_Snow_%28snow_effect%29_-_Google_Art_Project.jpg","page_title":"Verschneite Dächer","context_page_description":"Verschneite Dächer, auch Blick über Dächer bei Schnee, ist ein im Winter 1878/79 entstandenes Gemälde des französischen Malers Gustave Caillebotte. Das 64,5 cm × 81 cm große, in Öl auf Leinwand gemalte Bild ist Teil einer Serie von sechs Gemälden, die – anders als zuvor vom Künstler gemalte Bilder – nicht die streng geometrisch gegliederten Grands Boulevards zeigen, sondern den Blick auf ungeordnete Dächer und Hinterhöfe der von der Modernisierung unberührt gebliebenen Stadtteile von Paris.\\nVorbilder für solche winterlichen Motive im Stile des Impressionismus finden sich in den Arbeiten seiner Malerfreunde Claude Monet und Camille Pissarro, die sich bereits Jahre zuvor damit befasst haben. Das im Pariser Stadtteil Montmartre entstandene Bild malte Caillebotte nur wenige Wochen nach dem Tod seiner Mutter. Möglicherweise war der Tod der Anlass für die düstere Stimmung. Das Bild kam 1894 als Geschenk seines Bruders Martial Caillebotte in die Kunstsammlung des französischen Staates und wird seit 1986 im Musée d’Orsay ausgestellt."},{"page_url":"https://de.wikipedia.org/wiki/TV_on_the_Radio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/TV_on_the_Radio_live_20040913.jpg","page_title":"TV on the Radio","context_page_description":"TV on the Radio ist eine 2001 gegründete US-amerikanische Avantgarde- und Indie-Rock-Band aus New York City. Ihre Musik besteht aus einem Spektrum von Post-Punk, Jazz über A cappella/Doo Wop, Psychedelia bis hin zu Trip-Hop."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Sch%C3%B6nau_(Gem%C3%BCnden_am_Main)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Kloster-Schoenau-4.jpg","page_title":"Kloster Schönau (Gemünden am Main)","context_page_description":"Das Kloster Schönau ist ein Kloster der Minoriten im Kirchdorf Schönau in der fränkischen Gemeinde Gemünden am Main in der Diözese Würzburg."},{"page_url":"https://es.wikipedia.org/wiki/Keytar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Monster_Ball_Money_Honey.jpg","page_title":"Keytar","context_page_description":"Un keytar es un teclado o sintetizador relativamente ligero que se adapta a una correa alrededor del cuello y los hombros, de forma similar a una guitarra. El keytar permitirá a un tecladista un mayor rango de movimiento en comparación con los teclados convencionales, que se tocan de pie en un sitio fijo. El instrumento tiene un teclado musical para producir las notas y los sonidos, controles para cambiar de tono, producir vibrato, pitch."},{"page_url":"https://sv.wikipedia.org/wiki/Prinsessan_Leonore","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Princess_Leonore%2C_Princess_Madeleine_and_Christopher_O%E2%80%99Neill_2014.jpg","page_title":"Prinsessan Leonore","context_page_description":"Leonore Lilian Maria, född den 20 februari 2014 i New York i USA, är en svensk prinsessa och hertiginna av Gotland. Hon är dotter till prinsessan Madeleine och Christopher O'Neill. Familjen är sedan 2018 bosatt i Florida.\\nPrinsessan Leonore har plats nummer åtta i den svenska tronföljden, efter sin mor och före sin bror prins Nicolas."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B4%D8%A7%D8%B1%D9%84%D9%8A%D9%81%D9%8A%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/StateLibQld_1_214388_War_memorial_at_Charleville%2C_ca._1939.jpg","page_title":"تشارليفيل","context_page_description":"تشارليفيل هي بلدة، في أستراليا، تقع في كوينزلاند، هي عاصمة Shire of Murweh، بلغ عدد سكانها 3,335 نسمة وذلك حسب إحصائيات سنة 2016، رمزها البريدي هو 4470."},{"page_url":"https://eo.wikipedia.org/wiki/Stacio_Suzaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Suzaki_stn._%281%29.JPG","page_title":"Stacio Suzaki","context_page_description":"Stacio Suzaki estas fervoja stacio en Niŝinomija, Gubernio Hjogo, Japanio. La stacio servas 1 linion de Elektra Fervojo Hanshin: Linio Hanshin-Mukogawa."},{"page_url":"https://sv.wikipedia.org/wiki/Encyclia_ceratistes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Encyclia_Ceratistes_-_Bulbos.JPG","page_title":"Encyclia ceratistes","context_page_description":"Encyclia ceratistes är en orkidéart som först beskrevs av John Lindley, och fick sitt nu gällande namn av Rudolf Schlechter. Encyclia ceratistes ingår i släktet Encyclia och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/Transferrina","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Protein_TF_PDB_1a8e.png","page_title":"Transferrina","context_page_description":"Transferrina ou siderofilina é uma glicoproteína plasmática do sangue que transporta o ferro. Sua função fundamental é ceder ferro às células da medula, baço, fígado e músculo. Grande parte é sintetizada pelo fígado, mas existem outros locais de síntese. A transferrina humana é codificada pelo gene TF. As glicoproteínas de transferrina se ligam avidamente ao ferro, porém de forma reversível. Embora o ferro ligado à transferrina seja inferior a 0,1% do ferro total do corpo, forma o pool de ferro mais vital com a maior taxa de renovação. A transferrina tem um peso molecular de cerca de 80 kDa e contém dois locais específicos de ligação de Fe (III) de alta afinidade. A afinidade da transferrina por Fe (III) é extremamente alta mas diminui progressivamente com a diminuição do pH abaixo da neutralidade.\\nQuando não ligada ao ferro, a transferrina é conhecida como \\"apotransferrina\\"."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%99%E9%9B%BB%E7%99%BA%E9%9B%BB%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Bennet%27s_Doubler_of_Electricity.png","page_title":"静電発電機","context_page_description":"静電発電機もしくは起電機とは発電機の一種で、静電気もしくは高電圧・低電流の電気を生成するものである。\\n静電気の存在は文明の黎明期から知られていたが、その性質を説明する理論は数千年にわたって確立されず、磁気との区別もあいまいであり、好奇心をそそる奇妙な現象でしかなかった。17世紀末までに自然科学の研究者は、摩擦によって静電気を作る実用的な方法を発見した。18世紀になると機械的な静電発電機が作製され始め、電気学という新しい学問の研究に不可欠な実験器具になった。\\n静電発電機は人力などの動力を利用して力学的な仕事を電気エネルギーに変換する装置である。電気的な力で誘起した電荷を、金属板・円筒・ベルトなどに載せて高電位電極まで運ぶ仕事により、二つの導体に逆符号の静電電荷を蓄積していく。電荷を発生する方法には摩擦帯電および静電誘導の2種類がある。"},{"page_url":"https://sl.wikipedia.org/wiki/Vulkanska_bomba","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Volcanic_bombs_in_Japan.jpg","page_title":"Vulkanska bomba","context_page_description":"Vulkanska bomba je piroklast s premerom več kot 64 mm, ki se balistično izstreli v vulkanskem izbruhu. Ima zaobljene oblike; zunanja oblika in površina označujeta, da se je piroklast med tvorbo in transportom stopil. V starejši literaturi se vsak piroklast, ki je bil izvržen na balističen način, obravnava kot bomba. V sodobni literaturi pa so mnogokotni piroklasti tega velikostnega razreda imenovani vulkanski bloki.\\nPiroklastične kamnine, ki so sestavljene iz več kot 75% vulkanskih bomb, se imenujejo vulkanski aglomerati."},{"page_url":"https://it.wikipedia.org/wiki/Mercatel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Mercatel_%C3%A9glise.JPG","page_title":"Mercatel","context_page_description":"Mercatel è un comune francese di 622 abitanti situato nel dipartimento del Passo di Calais nella regione dell'Alta Francia."},{"page_url":"https://es.wikipedia.org/wiki/San_Clemente_(Chile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/San_Clemente%2C_VII_Regi%C3%B3n%2C_Chile_-_panoramio_%282%29.jpg","page_title":"San Clemente (Chile)","context_page_description":"San Clemente es una ciudad y una de las comunas más grandes de la región del Maule, ubicada en el sector oriente - alto de la provincia de Talca.\\nLa comuna de San Clemente limita con las siguientes comunas: al norte con Molina, Río Claro y Pelarco, al oeste con Talca y Maule, al sur con Yerbas Buenas y Colbún y al este con Argentina.\\nIntegra junto con las comunas de Constitución, Curicó, Curepto, Empedrado, Hualañé, Licantén, Maule, Molina, Pencahue, Pelarco, Rauco, Río Claro, Romeral, Sagrada Familia, San Rafael, Talca, Teno y Vichuquén el Distrito Electoral N° 17, y pertenece a la 9ª Circunscripción Senatorial de la Región del Maule."},{"page_url":"https://sq.wikipedia.org/wiki/Aillon-le-Vieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Aillon-le-Vieux_%28Savoie%29.JPG","page_title":"Aillon-le-Vieux","context_page_description":"Aillon-le-Vieux është një komunë në Francë. Aillon-le-Vieux bën pjesë në departamentin [[Savoie]] të rajonit [[Rhône-Alpes]]. Komuna ka një popullsi prej 176 banorë dhe sipërfaqe prej 21.63 km²."},{"page_url":"https://en.wikipedia.org/wiki/1927_Grand_Prix_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Materassi-1927-bugatti_T_35c.jpg","page_title":"1927 Grand Prix season","context_page_description":"The 1927 Grand Prix season was the third AIACR World Manufacturers' Championship season and the second run to a 1.5-litre engine limit. In a dominant display, the championship was won by Delage, with team driver Robert Benoist winning four of the five Grand Prix.\\nThe championship opened with the Indianapolis 500 – once again a contest between Duesenberg and Miller engines. Previous year's winner Frank Lockhart started on pole position and led for over half the race until his car suffered a broken con-rod. Rookie George Souders, driving Peter DePaolo’s 1925 race-winning Duesenberg, came through and took a comfortable victory with an eight lap margin. DePaolo went on to secure the season's AAA Championship with three wins and four second places.\\nAfter major re-working over the close season to sort out the chronic exhaust and heating issues, the Delages proved unbeatable. They were the only manufacturer to enter the requisite three races to qualify for the championship. Bugatti and Talbot challenged them at the next Grand Prix, in France, but then the Talbot team was shut down."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%A8%82%E5%AF%8C%E5%BB%A3%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Lok_Fu_Plaza_Level_1_2014.jpg","page_title":"樂富廣場","context_page_description":"乐富广场位于香港九龙黄大仙区乐富联合道198号，共分二期、总共有389,616 平方呎零售面积、停车场车位数目共793个，是领展目前最具规模的重点商场。\\n乐富广场与乐富邨一并于1984至85年落成，为现时九龙城区内第一最大的广场之一。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A7%CF%81%CE%BF%CE%BD%CE%BF%CE%BB%CF%8C%CE%B3%CE%B9%CE%BF_%CF%84%CE%B7%CF%82_%CE%93%CE%B1%CE%BB%CE%BB%CE%B9%CE%BA%CE%AE%CF%82_%CE%95%CF%80%CE%B1%CE%BD%CE%AC%CF%83%CF%84%CE%B1%CF%83%CE%B7%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Women%27s_March_on_Versailles01.jpg","page_title":"Χρονολόγιο της Γαλλικής Επανάστασης","context_page_description":"Κύριο λήμμα: Γαλλική Επανάσταση"},{"page_url":"https://fr.wikipedia.org/wiki/Anc%C3%B4ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Ancona_-_Rocca_di_Bolignano.jpg","page_title":"Ancône","context_page_description":"Ancône est une ville d'environ 101 100 habitants, capitale des Marches et chef-lieu de la province d'Ancône en Italie.\\nAncienne ville fortifiée d'Italie centrale au riche passé gréco-romain et religieux médiéval, Ancône est une ville d’art, une station balnéaire et possède un port très actif sur la mer Adriatique.\\nSes activités sont essentiellement liées aux activités portuaires et de constructions navales, à la pêche, à l'agriculture intensive et à l'artisanat diversifié de son arrière-pays."},{"page_url":"https://eu.wikipedia.org/wiki/La_Ni%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Sea_Surface_Temperature_-_November_2007.jpg","page_title":"La Niña","context_page_description":"La Niña Ozeano Bareko erdialdeko eta ekialdeko gainazaleko uraren hozte ziklikoa da. El Niño fenomenoaren kontrakoa da. Ekialdean presio altuak mantentzen dira denbora luzez, mendebaldean presio baxuak sortzen diren bitartean. Gainera, alisio haizeak biziagotzen dira eta ondorioz, El Niñoren kontrako fenomenoa gertatzen da: aire masa hezeak mendebalderantz higitzen dira eta prezipitazio gogorrak Asia hego-ekialdean eta Ozeanian gertatzen dira."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8B%9C%EC%96%BC%EC%B9%98_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Changping_Line_platform%2C_Xi%27erqi_station.jpg","page_title":"시얼치 역","context_page_description":"시얼치 역은 베이징 시 하이뎬 구에 위치한 베이징 지하철 13호선, 베이징 지하철 창핑 선의 역이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%89%E3%83%A9%E3%82%A4%E3%82%B8%E3%83%BC%E3%83%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Draisine1817.jpg","page_title":"ドライジーネ","context_page_description":"ドライジーネとは、19世紀にドイツで発明された人力二輪車「Laufmaschine」の一般的な呼称。車輪を駆動しないため「自転車」ではないが、後の自転車の礎となる。"},{"page_url":"https://eu.wikipedia.org/wiki/Sindikalismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Marx_and_Engels.jpg","page_title":"Sindikalismo","context_page_description":"Sindikalismoa Sindikatuen mugimendua da; sindikatuen gizarte-dotrina. Ekoizpen bideak antolaturiko langile taldeen kontrolpean edukitzearen aldekoa den dotrina ekonomikoa eta politikoa. Sindikalismoak langileriaren interesak gordetzea eta haien alde egitea du helburu. Sindikatuen higikundea industria iraultzaren ondorioz sortu zen, produkzio modu kapitalistak ezarritako lan baldintzei erantzun gisa. Ideologia politiko desberdinen eraginez multzo horietan laburbildu daitezkeen sindikalismo joerak sortu izan dira: sindikatu anarkosindikalistak, estatuaren ordez gizartean oinarrizko talde izango liratekeen sindikatuak ezartzearen aldekoak; komunistak, sindikatuak langileriaren diktadura ezartzeko tresnatzat hartzen dituztenak; sozialistak, ekoizpen bideak sozializatzearen aldekoak; kristauak, enpresaren baitan langileen eta enpresarien arteko elkarlana bultzatzearen aldekoak; eta Estatu Batuetan diren sindikatuak, sindikatu korporatibista deituak, sistema kapitalista onartzen dutenez, lanbide bereko langileak elkartzea beste baino helbururik ez dutenak."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B8%D0%BC%D0%B1%D0%BB%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%83%D1%80%D0%BD%D0%B8%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Hoad_Rosewall_Wimbledon.jpg","page_title":"Уимблдонский турнир","context_page_description":"Уимблдо́нский турни́р — международный теннисный турнир, один из четырёх турниров Большого шлема, с 1877 года проводящий большинство своих матчей на травяных кортах Всеанглийского клуба лаун-тенниса и крокета. Основные сетки соревнования традиционно проводятся в двухнедельный отрезок в конце июня — начале июля, выявляя победителей в пяти разрядах у взрослых, четырёх — у старших юниоров и четырёх — у инвалидов-колясочников.\\nОрганизатор турнира — британская Ассоциация лаун-тенниса. C 1988 года Уимблдон является единственным турниром серии Большого шлема, проводящимся на травяных кортах. Общий призовой фонд с 2014 года превышает 25 миллионов фунтов стерлингов, победители в одиночных разрядах в 2016 году получили по 2 миллиона фунтов стерлингов.\\nУимблдонский турнир представляет собой международный культурный феномен. Его розыгрыши ежегодно транслируют 80 телевещательных компаний, в освещении турнира участвуют более 3000 теле-, радио- и газетных журналистов и фотографов, во время его проведения разворачивается действие ряда произведений художественной литературы и кинофильмов."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Seifhennersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Gro%C3%9Fer_M%C3%BChlweg_16.jpg","page_title":"Liste der Kulturdenkmale in Seifhennersdorf","context_page_description":"In der Liste der Kulturdenkmale in Seifhennersdorf sind die Kulturdenkmale der sächsischen Stadt Seifhennersdorf verzeichnet, die bis Februar 2019 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://es.wikipedia.org/wiki/GI","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/SC180577t.jpg","page_title":"GI","context_page_description":"GI es un término que describe a los miembros de las fuerzas armadas de Estados Unidos, sus elementos o sus equipos. Puede ser usado como sustantivo o como adjetivo. El término se utiliza ahora como una sigla de \\"Government Issue\\", ​ pero originalmente refería a galvanized iron. Las letras \\"G.I.\\" se usaban para designar a los equipos hechos a partir de hierro galvanizado, tales como botes de basura de metal, en los inventarios del Ejército de EE. UU. y los registros de abastecimiento.\\n​​ Durante la Primera Guerra Mundial, los soldados de EUA se referían con sorna a los proyectiles alemanes que caían como \\"GI cans\\". En esa misma época, \\"G.I.\\" comenzó a ser interpretado como \\"Government Issue\\" y pasó a ser adjetivo de cualquier cosa que tenga que ver con el Ejército.​"},{"page_url":"https://en.wikipedia.org/wiki/Linkage_(mechanical)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/4_bar_linkage_animated.gif","page_title":"Linkage (mechanical)","context_page_description":"A mechanical linkage is an assembly of bodies connected to manage forces and movement. The movement of a body, or link, is studied using geometry so the link is considered to be rigid. The connections between links are modeled as providing ideal movement, pure rotation or sliding for example, and are called joints. A linkage modeled as a network of rigid links and ideal joints is called a kinematic chain.\\nLinkages may be constructed from open chains, closed chains, or a combination of open and closed chains. Each link in a chain is connected by a joint to one or more other links. Thus, a kinematic chain can be modeled as a graph in which the links are paths and the joints are vertices, which is called a linkage graph.\\nThe movement of an ideal joint is generally associated with a subgroup of the group of Euclidean displacements. The number of parameters in the subgroup is called the degrees of freedom of the joint.\\nMechanical linkages are usually designed to transform a given input force and movement into a desired output force and movement."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%AE%E0%A9%88%E0%A8%B0%E0%A9%80%E0%A8%9C%E0%A8%BC_%E0%A8%95%E0%A9%8C%E0%A8%82%E0%A8%A1%E0%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Maryse_Cond%C3%A9.jpg","page_title":"ਮੈਰੀਜ਼ ਕੌਂਡੋ","context_page_description":"ਮੈਰੀਜ਼ ਕੌਂਡੋ, [ਜਨਮ ਸਮੇਂ ਮੈਰੀਸ ਲਿਲੀਅਨ ਐਪੋਲੀਨ ਬੂਕੋਲਨ, 11 ਫ਼ਰਵਰੀ 1937, ਪੌਂਟੇ-ਅ-ਪਿਤਰੇ ] ਇੱਕ ਪੱਤਰਕਾਰ ਹੈ, ਸਾਹਿਤ ਦੀ ਪ੍ਰੋਫੈਸਰ ਅਤੇ ਆਪਣੇ ਸਭ ਤੋਂ ਵੱਧ ਵਿਕਣ ਵਾਲੇ ਇੱਕ ਇਤਿਹਾਸਕ ਨਾਵਲ, ਸੇਗੂ ਲਈ ਸਭ ਤੋਂ ਵੱਧ ਜਾਣੀ ਜਾਂਦੀ ਫ੍ਰੈਂਚ ਲੇਖਕ ਹੈ। ਇਸ ਤੋਂ ਇਲਾਵਾ, ਉਹ ਫ੍ਰੈਂਸੋਫੋਨ ਸਾਹਿਤ ਦੀ ਵਿਦਵਾਨ ਅਤੇ ਕੋਲੰਬੀਆ ਯੂਨੀਵਰਸਿਟੀ ਵਿਚ ਫ੍ਰੈਂਚ ਦੀ ਪ੍ਰੋਫੈਸਰ ਐਮੇਰੀਤਾ ਹੈ।\\nਫ੍ਰੈਂਚ ਵਿੱਚ ਲਿਖੇ ਉਸ ਦੇ ਨਾਵਲਾਂ ਦਾ ਅੰਗਰੇਜ਼ੀ, ਜਰਮਨ, ਡੱਚ, ਇਤਾਲਵੀ, ਸਪੈਨਿਸ਼, ਪੁਰਤਗਾਲੀ ਅਤੇ ਜਾਪਾਨੀ ਵਿੱਚ ਅਨੁਵਾਦ ਕੀਤਾ ਗਿਆ ਹੈ। ਉਸਨੇ ਆਪਣੀਆਂ ਲਿਖਤਾਂ ਲਈ ਗ੍ਰਾਂਡ ਪ੍ਰਿਕਸ ਲਿਟਰੇਅਰ ਡੀ ਲਾ ਫੇਮੇ, ਪ੍ਰਿਕਸ ਡੀ ਐਲ 'ਅਕਾਡੇਮੀ ਫ੍ਰੈਂਚਾਈਸ' ਅਤੇ ਸਾਹਿਤ ਵਿਚ ਨਵਾਂ ਅਕੈਡਮੀ ਪੁਰਸਕਾਰ ਜਿੱਤੇ ਹਨ।"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%83%BC%E3%83%9E%E6%9D%A1%E7%B4%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/EU_Roma_Musei_Capitolini_close-up.jpg","page_title":"ローマ条約","context_page_description":"ローマ条約は、1957年3月25日に調印された欧州連合の2つの基本条約。ベルギー、フランス、イタリア、ルクセンブルク、オランダ、西ドイツによって調印された。この2条約とは欧州経済共同体設立条約と欧州原子力共同体設立条約である。両共同体はこの数年前に設立された欧州石炭鉄鋼共同体に続く、超国家主義的な性格をもつ国際機関である。\\n両条約は1958年1月1日に発効したが、そのうち欧州経済共同体設立条約はその後の条約で大幅に修正されており、1993年11月発効のマーストリヒト条約で「欧州共同体設立条約」への改称を経たのち、2009年12月に発効したリスボン条約では「欧州連合の機能に関する条約」 に改称されている。その一方で欧州原子力共同体設立条約は原子力に対する市民感情からあまり修正されていない。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%8B%D0%B1%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_%D0%95%D1%84%D0%B8%D0%BC%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/%D0%94%D0%B8%D0%B1%D0%B5%D0%BD%D0%BA%D0%B8_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_2.jpg","page_title":"Дыбенко, Павел Ефимович","context_page_description":"Па́вел Ефи́мович Дыбе́нко — советский революционер, политический и военный деятель, 1-й народный комиссар по морским делам РСФСР, командарм 2-го ранга.\\nЧлен РСДРП с 1912 года."},{"page_url":"https://ca.wikipedia.org/wiki/Lessard-le-National","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Mairie_Lessard-National.jpg","page_title":"Lessard-le-National","context_page_description":"Lessard-le-National és un municipi francès, situat al departament de Saona i Loira i a la regió de Borgonya - Franc Comtat. L'any 2007 tenia 636 habitants."},{"page_url":"https://en.wikipedia.org/wiki/List_of_American_painters_exhibited_at_the_1893_World%27s_Columbian_Exposition","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Tryon_Morning_Int.Studio_Nov1909_p.9.jpg","page_title":"List of American painters exhibited at the 1893 World's Columbian Exposition","context_page_description":"Chicago hosted the 1893 World's Columbian Exposition, a world's fair commemorating the 400th anniversary of Christopher Columbus's arrival in the New World. Artists from the United States and 19 foreign countries exhibited at the Exposition. A complete list of the artists and works exhibited in the Palace of Fine Arts can be found here:\\nThe Art Department's focus was on modern American painting, works painted in the 17 years since the 1876 Centennial Exposition. Hundreds of American painters submitted works, and more than 1,000 paintings in oil and more than 200 in watercolor were selected for exhibition in the Palace of Fine Arts. Additional works—not in competition for medals—were exhibited in other Exposition buildings, including the Woman's Building and individual state buildings.\\nThe tradition of the Paris Salon was to award a single gold medal, a couple silver medals, several bronze medals, and numerous honorable mentions in each medium. Instead of this tiered system with medals awarded for individual paintings, Exposition judges awarded one level of medals that was for an artist's whole exhibit."},{"page_url":"https://ca.wikipedia.org/wiki/Alborge","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Alborge%2C_Zaragoza%2C_Espa%C3%B1a%2C_2015-12-23%2C_DD_46.JPG","page_title":"Alborge","context_page_description":"Alborche és un municipi d'Aragó situat a la província de Saragossa i enquadrat a la comarcar del Ribera Baixa de l'Ebre."},{"page_url":"https://de.wikipedia.org/wiki/Bohumil_Byd%C5%BEovsk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Bohumil_Byd%C5%BEovsk%C3%BD_%281880-1969%29.jpg","page_title":"Bohumil Bydžovský","context_page_description":"Bohumil Bydžovský war ein tschechischer Mathematiker. Er befasste sich vor allem mit algebraischer Geometrie und Algebra.\\nBydzovsky machte 1898 am Akademischen Gymnasium in Prag sein Abitur und studierte dann Mathematik und Physik an der Karls-Universität Prag, wo Eduard Weyr sein Lehrer war. Unter seinem Einfluss wandte er sich der Geometrie zu und wurde 1903 promoviert. Danach war er Lehrer, unter anderem 1907 bis 1910 an der Realschule Prag-Karlin. 1909 habilitierte er sich und hielt Vorlesungen am Polytechnikum in Prag und habilitierte 1911 auch als Ingenieur. 1917 wurde er Titularprofessor an der Universität Prag, an der er 1920 eine volle Professur erhielt. 1930/31 war er Dekan der Naturwissenschaftlichen Fakultät, die sich zuvor von der Philosophischen Fakultät abspaltete. 1946 wurde er Rektor der Universität. 1949 wurde er Vorsitzender des Tschechoslowakischen Forschungsrats.\\nEr schrieb Hochschul-Lehrbücher der analytischen Geometrie und Linearen Algebra und Schulbücher für Arithmetik. Bydzovsky befasste sich mit unendlichen Gruppen, Theorie der Matrizen und Determinanten und geometrischen Konfigurationen."},{"page_url":"https://de.wikipedia.org/wiki/Instituto_Chico_Mendes_de_Conserva%C3%A7%C3%A3o_da_Biodiversidade","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/MarcaICMBio.jpg","page_title":"Instituto Chico Mendes de Conservação da Biodiversidade","context_page_description":"Das Instituto Chico Mendes de Conservação da Biodiversidade, kurz ICMBio, deutsch Chico-Mendes-Institut für Biodiversitätserhalt, ist eine halbstaatliche Organisation, die sich zusammen mit dem staatlichen Instituto Brasileiro do Meio Ambiente e dos Recursos Naturais Renováveis um die Belange des Naturschutzes in Brasilien kümmert. Sie untersteht dem Umweltministerium Ministério do Meio Ambiente.\\nNamenspatron ist der 1988 ermordete Umweltaktivist und Kautschukzapfergewerkschafter Chico Mendes. Das ICMBio wurde 2007 mit Sitz in Brasília gegründet. Es ist in das Sistema Nacional do Meio Ambiente integriert. Präsident ist Rômulo Mello."},{"page_url":"https://en.wikipedia.org/wiki/Kwun_Tong","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Kwun_Tong_Town_Centre_1.jpg","page_title":"Kwun Tong","context_page_description":"Kwun Tong is an area in the Kwun Tong District of Hong Kong, situated at the eastern part of the Kowloon Peninsula, and its boundary stretches from Lion Rock in the north to Lei Yue Mun in the south, and from the winding paths of Kowloon Peak in the east to the north coast of the former Kai Tak Airport runway in the west.\\nOne of the first New towns in Hong Kong, Kwun Tong was, and remains, a major industrial area. Its population has been growing rapidly, and the demand for housing, medical and educational facilities and services has been increasing. In view of this, a number of community development projects, such as the redevelopment of old housing estates and the construction of major parks, have been implemented in recent years. These projects have incorporated a wide range of supporting facilities, like primary and secondary schools, clinics, community centres and open spaces. All these facilities have brought about a new face to the Kwun Tong District, making it a more comfortable place for the people to live."},{"page_url":"https://en.wikipedia.org/wiki/SYM_Motors","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Mother_Child_Motorbike_Vietnam.jpg","page_title":"SYM Motors","context_page_description":"Sanyang Motor Co., Ltd. was founded in Taipei in 1954 by Huang Chi-Chun and Chang Kuo An. The company's headquarters is established in Hsinchu County, Taiwan and sells its two-wheeled products under the brand name SYM. Sanyang's three major production bases are in Taiwan, China and Vietnam. The company manufactures and sells scooters, motorcycles and ATVs under the SYM brand, while it also manufactures automobiles and mini-trucks under the Hyundai brand.\\nSince it began, the company has produced more than 800 thousand automobiles and 16 million scooters and motorcycles. The annual sales revenue of the company exceeds 1 Billion US dollars and it produces about 600,000 units of motorcycles and 20,000 automobiles per year. SYM currently employs around 2,300 people in its Taiwan manufacturing plants."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Cormeilles-en-Vexin","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Cormeilles-en-Vexin_%2895%29%2C_%C3%A9glise_Saint-Martin%2C_nef%2C_N.-D._de_Cormeilles-en-V._2.jpg","page_title":"Liste der Monuments historiques in Cormeilles-en-Vexin","context_page_description":"Die Liste der Monuments historiques in Cormeilles-en-Vexin führt die Monuments historiques in der französischen Gemeinde Cormeilles-en-Vexin auf."},{"page_url":"https://af.wikipedia.org/wiki/Maja","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Palenque_-_Maske_des_Pakal.jpg","page_title":"Maja","context_page_description":"Die Majas is 'n etniese groep en die nasate van die gelyknamige Meso-Amerikaanse beskawing wat in die huidige lande Belize, El Salvador, Guatemala, Honduras en Meksiko se Yucatán-skiereiland woon. Die historiese middelpunt van die beskawing was in die hedendaagse Meksikaanse deelstate Yucatán, Campeche en Quintana Roo. Die belangrikste taal van die Majas is Majaans, een van die oorblywende Majatale. Hedendaags is die meeste Majas tweetalig met Spaans as tweede taal.\\nDie Majas is veral bekend vir hul kuns, argitektuur, wiskundige en sterrekundige stelsel, vir die kalender wat deur die Asteke oorgeneem en aangepas is en die hoogsontwikkelde skryfstelsel, wat ook vir getalle gebruik is. Die Majaskryfstelsel is die enigste wat vandag uit die pre-Colombiaanse Amerika bekend is.\\nDie klassieke tydperk van die Majabeskawing het gestrek van 250 tot 900 n.C. Die Majas het nie 'n verenigde land gestig nie en het in onafhanklike stadstate gewoon. Die state het op hul hoogtepunt rofweg die huidige lande Meksiko, Guatemala en die noorde van Belize beslaan. Bekende ruïnestede sluit in Calakmul, Chichén Itzá, Copán, El Mirador, Joya de Cerén, Palenque, Quiriguá, Tikal en Uxmal."},{"page_url":"https://fi.wikipedia.org/wiki/Kiinan_muinaishistoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Revised_migration_routes_of_modern_human.png","page_title":"Kiinan muinaishistoria","context_page_description":"Kiinan muinaishistoria alkaa esihistorialliselta ajalta ja jatkuu ensimmäisten kirjoitusten syntyajalla varhaishistoriana. Varhaisia nykyihmisen edeltäjiä eli Kiinassakin. Nykyihminen saapui Kiinaan noin 70 000–45 000 vuotta sitten. Noin 8000 eaa. alkoi riisin ja hirssin viljely ja sikojen pito. Viljelyn ja karjanhoidon pohjalta syntyi kasvavia kyliä. Viimeistään 4000 eaa. kylien ympärille ilmestyi muureja, ja yhteiskunnalliset erot alkoivat kasvaa.\\nSeuraavan parin vuosituhannen aikana muotoutui Kiinan sivilisaatio suurine asutuskeskuksineen ja temppeleineen. Noin vuosina 1900–1600 eaa. vallinnut Erlitoun kulttuuri oli varhaisen valtion keskus."},{"page_url":"https://en.wikipedia.org/wiki/Britain_Quay","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Fire_Dublin_1920s_W.D._Hogan_Photographer_%286376087487%29.jpg","page_title":"Britain Quay","context_page_description":"Britain Quay is a street and quay in Dublin on the south bank of the River Liffey between Sir John Rogerson's Quay and the confluence of the River Liffey, River Dodder and Grand Canal.\\nOriginally known as Great Britain Quay, the quay was built in the 1790s as part of the opening of Grand Canal Dock. The quay was widened in the mid-19th century, with works undertaken to dredge and deepen the riverbed alongside the quay wall in the 1870s. In 1873, Great Britain Quay was recorded as being 250 feet in length.\\nPart of the working Dublin Port facilities for several hundred years, the quay was a docking point for coal carrying cargo vessels, and the site of a number of industrial buildings – including a chemical works which was destroyed by fire in the early 20th century. By this time the quay's structures also included a navigation \\"hailing station\\" at the junction with Sir John Rogerson's Quay. A time ball sat on top of this station which, when operated remotely from Dunsink Observatory, signaled that it was 1pm. In the early 21st century this station, by then a protected structure, was demolished by the Dublin Docklands Development Authority."},{"page_url":"https://fr.wikipedia.org/wiki/Wolff-Metternich","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Flehingen_Schloss187.JPG","page_title":"Wolff-Metternich","context_page_description":"La famille von Wolff-Metternich est une famille de la noblesse ancienne de Rhénanie, qui descend des seigneurs Wolff von Gudenberg, originaires de la Hesse du Nord.\\nCette famille ne doit pas être confondue avec les comtes et princes de Metternich-Winneburg."},{"page_url":"https://it.wikipedia.org/wiki/SIG_Sauer_P228","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/M11_Pistol_%287414627234%29.jpg","page_title":"SIG Sauer P228","context_page_description":"La SIG Sauer P228 è una pistola semiautomatica ideata e prodotta dall'azienda svizzera Schweizerische Industrie Gesellschaft in collaborazione con la tedesca Sauer. Si tratta della versione compatta della SIG Sauer P226."},{"page_url":"https://en.wikipedia.org/wiki/Bayt_Nattif","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Cistern_at_Bayt_Nattif%2C_October_2015.jpg","page_title":"Bayt Nattif","context_page_description":"Bayt Nattif or Beit Nattif was a Palestinian Arab village, located some 20 kilometers southwest of Jerusalem, midway on the ancient Roman road between Beit Guvrin and Jerusalem, and 21 km northwest of Hebron.\\nIn Roman times the town was known as Bethletepha, and commonly known by its Greek equivalent, Bethletephon. The original Arabic version of the name was Bayt Lettif.\\nThe village lay nestled on a hilltop, surrounded by olive groves and almonds, with woodlands of oak and carobs overlooking Wadi es-Sunt to its south. It contained several shrines, including a notable one dedicated to al-Shaykh Ibrahim. Roughly a dozen khirbas lay in the vicinity.\\nDuring the British Mandate it was part of the Hebron Subdistrict. Bayt Nattif was depopulated during the 1948 Arab–Israeli War on October 21, 1948 under Operation Ha-Har."},{"page_url":"https://pt.wikipedia.org/wiki/Canon_EOS_750D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/EOS760-1.jpg","page_title":"Canon EOS 750D","context_page_description":"A Canon EOS 750D, conhecida como a Rebel T6i nas Américas, é uma SLR digital de nível médio de entrada de 24,2 megapixels anunciada pela Canon em 6 de fevereiro de 2015. É a sucessora da Canon EOS 700D.\\nA 750D foi anunciada e lançada em conjunto com a 760D, um modelo muito semelhante, que adota algumas das características ergonômicas 70D."},{"page_url":"https://sco.wikipedia.org/wiki/Leet_o_leaders_o_Middle_Eastren_an_North_African_states","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Fayez_al-Sarraj_in_Washington_-_2017_%2838751877521%29_%28cropped%29.jpg","page_title":"Leet o leaders o Middle Eastren an North African states","context_page_description":"This is a Leet o leaders o Middle Eastren an North African states. It conseests o the heids o state an govrenment athin the Arab League, an o ither MENA kintras ootside it."},{"page_url":"https://vi.wikipedia.org/wiki/Th%C3%A1p_Busan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Yongdusan_Park.jpg","page_title":"Tháp Busan","context_page_description":"Tháp Busan cao 118 mét ở Công viên Yongdusan, Jung-gu, Busan, Hàn Quốc.\\nTháp Busan được xây dựng vào năm 1973. Nó chỉ sử dụng cho mục đích giải trí và không có bất kì thiết bị truyền tải nào như các tháp khác chủ yếu được xây dựng như tháp truyền hình và radio. Tầng chính có thể quan sát toàn cảnh và một quán cà phê nhỏ, nó hoạt động trong giờ hành chính thông qua hai thang máy tốc độ cao. Cơ sở của tháp được kết nối với phòng trưng bày và cửa hàng lưu niệm. Tháp thường được đề cập trong hướng dẫn du lịch như là một địa điểm tốt để quan sát toàn cảnh cảng Busan."},{"page_url":"https://de.wikipedia.org/wiki/Metox","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Funkempf%C3%A4nger_Metox_R_600_A_-_Gesamtschaltbild.jpg","page_title":"Metox","context_page_description":"Metox war die Bezeichnung des Funkmessbeobachtungsgeräts FuMB 1 der Kriegsmarine. Hergestellt wurde das Gerät von den Pariser Firmen Metox und Grandin. Dieses Radarwarngerät wurde ab 1940 auf Überwassereinheiten und ab August 1942 auf deutschen U-Booten eingesetzt, um damit die von Schiffen, Flugzeugen oder Landstationen emittierten Radarwellen orten zu können. Die Herkunft des Signals konnte nicht bestimmt werden."},{"page_url":"https://no.wikipedia.org/wiki/Nordsund_bru","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Farsund1.jpg","page_title":"Nordsund bru","context_page_description":"Nordsund bru på fylkesvei 43 i Farsund i Vest-Agder krysser Nordsundet mellom Spindsodden på fastlandet og Farøy. Den er ei fritt frambygg-bru, med tre spenn. Totallengden er 284 meter, hovedspennet 142 meter. Brua ble bygd i årene 1969-71 og erstattet ei tidligere stålfagverksbru på 266 meter på samme sted, åpnet i 1930.\\nI løpet av tolv år fra brua ble åpnet i 1971 til 1983, sank midtspennet med 40 cm. Undersøkelser gjort av et sveitsisk konsulentfirma viste at senkningen skyldtes at spennkablene hadde 30 % lavere spennkraft enn forutsatt, samt at betongspenningen var for lav i brudekket og for høy i bunnplaten. Brua ble reparert ved at ca. 25 000 meter spennline ble montert og oppspent like under brudekket, og østre bruspenn ble strammet opp og forankret med fjellforankringskabler. Etter disse reparasjonene hevet midtspennet seg noe igjen."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%A7%D9%86%D9%84_%D8%AE%D9%88%D8%B1%D8%B4%DB%8C%D8%AF%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Solar_Panels_on_Caguas%2C_Puerto_Rico_Walmart.jpg","page_title":"پانل خورشیدی","context_page_description":"سیستم پنل خورشیدی به این صورت است که می‌تواند انرژی خورشید را دریافت کند و آن را به الکتریسیته تبدیل کند که برای مصرف‌های تجاری و مسکونی قابل استفاده باشد. سیستم‌های فتوولتائیک معمولاً شامل یک پنل و ماژول‌های صفحات خورشیدی، اینورتر، و گاهی اوقات یک باتری یا ردیاب خورشیدی و سیم‌کشی اتصالات نیز می‌باشد.\\nپانل خورشیدی به یک ماژول فتوولتاییک اطلاق می‌شود یا یک پانل آب گرم خورشیدی، یا به یک مجموعه از ماژول‌های PV خورشیدی که به لحاظ الکتریکی، روی یک ساختار تکیه گاهی نصب شده‌اند. یک مدل PV، مجموعه‌ای از سلول‌های خورشیدی است که به هم متصل شده‌اند. پانل‌های خورشیدی را می‌توان به عنوان مؤلفه‌ای از یک سیستم فتوولتاییک بزرگتر، برای تولید و ذخیرهٔ الکتریسیته در کاربردهای تجاری و مسکونی، استفاده کرد. هر ماژول با یک توان خروجی DC، درجه‌بندی شده‌است که تحت شرایط تست استاندارد عمل می‌کنند و نوعاً از ۳۲۰ – ۱۰۰ وات دامنه و تنوع دارند. راندمان یک ماژول، مساحت ماژول را تعیین می‌کند – ماژولی ۲۳۰ وات با راندمان ۸٪ دارای دو برابر مساحت یک ماژول ۲۳۰ واتی با راندمان ۱۶ درصد است – تعداد اندکی از پانل‌های خورشیدی وجود دارند که راندمانشان / بازده‌شان بیشتر از ۱۹ درصد باشد. یک ماژول خورشیدی منفرد می‌تواند تنها به میزان محدودی توان تولید کند، اکثر تأسیسات حاوی ماژول‌های چندگانه هستند."},{"page_url":"https://it.wikipedia.org/wiki/Bos_taurus","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Kuh_5778.JPG","page_title":"Bos taurus","context_page_description":"Il toro, chiamato talvolta impropriamente bue, è una specie di mammifero artiodattilo appartenente alla famiglia Bovidae. La femmina del toro domestico, la vacca, viene allevata per trarne il latte, liquido secreto dalla ghiandola mammaria per l'alimentazione del vitello, molto usato nell'alimentazione umana sia come bevanda, sia come materia prima da cui ricavare formaggio, panna, burro, ricotta e altri derivati del latte, sia come ingrediente per alimenti più complessi. I vitelli vengono allevati principalmente per la carne: solo una parte viene infatti lasciata crescere per destinarla alla riproduzione.\\nPrima della meccanizzazione agricola i buoi, essendo forti come i tori ma molto più mansueti grazie alla castrazione, erano spesso impiegati anche come forza motrice per macchine agricole e mezzi di trasporto. Dalle deiezioni bovine si possono ottenere molti macroelementi e microelementi per la coltivazione dei terreni agricoli, in primis l'azoto, utile per la crescita delle piante. A cavallo tra XX e XXI secolo sull'allevamento dei bovini è stato posto l'accento per l'effetto serra cui contribuisce: il biochimismo digestivo bovino produce infatti metano, gas a effetto serra."},{"page_url":"https://en.wikipedia.org/wiki/Higham_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Higham_Park%2C_Bridge%2C_Kent_-_geograph.org.uk_-_123345.jpg","page_title":"Higham Park","context_page_description":"Higham Park is a Grade II* listed neoclassical style house and gardens, located at Bridge, Kent, 3 miles south of Canterbury."},{"page_url":"https://fr.wikipedia.org/wiki/Camaret-sur-Aigues","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Camaret_-_Mairie.JPG","page_title":"Camaret-sur-Aigues","context_page_description":"Camaret-sur-Aygues est une commune française, située dans le département de Vaucluse en région Provence-Alpes-Côte d'Azur."},{"page_url":"https://ro.wikipedia.org/wiki/Rubl%C4%83_belarus%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Belarus-1992-Bill-0.5-Reverse.jpg","page_title":"Rublă belarusă","context_page_description":"Rublă belarusă este unitatea monetară oficială a Belarusului. Subunitatea rublei este copeica.\\nDe la 1 iulie 2016, a fost introdusa noua rubla belarusă la un curs de 1 rubla noua = 10.000 ruble vechi. Rubla veche si noua vor circula in paralel de la 1 iulie 2016 pana la 31 decembrie 2016. De asemenea s-a schimbat si codul ISO 4217 din BYR in BYN."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%83%A9%E3%83%BC%E3%83%8E%E3%83%BB%E3%82%AB%E3%82%B9%E3%83%86%E3%83%83%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Map_of_comune_of_Torano_Castello_%28province_of_Cosenza%2C_region_Calabria%2C_Italy%29.svg","page_title":"トラーノ・カステッロ","context_page_description":"トラーノ・カステッロは、イタリア共和国カラブリア州コゼンツァ県にある、人口約4,600人の基礎自治体。"},{"page_url":"https://lt.wikipedia.org/wiki/Stankai","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Stankai%2C_dar%C5%BEin%C4%97.JPG","page_title":"Stankai","context_page_description":"Stankai – kaimas Vilniaus rajono savivaldybėje, 5 km į šiaurės vakarus nuo Sužionių. Įsikūręs Širvino ežero šiauriniame krante, prie į jį įtekančio upelio. Iš visų pusių kaimą supa raistingi miškai. Pasiekiamas keliuku iš Kaidonėlių.\\nStankuose yra kaimo kryžius, gausu tradicinės architektūros paveldo. Yra fermos griuvėsiai."},{"page_url":"https://fr.wikipedia.org/wiki/Sikorsky_CH-53_Sea_Stallion","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/CH-53A_first_helo_final_assembly_NAN7-64.jpg","page_title":"Sikorsky CH-53 Sea Stallion","context_page_description":"Le Sikorsky CH-53 Stallion est un hélicoptère de manœuvre et d'assaut lourd militaire américain capable de transporter jusqu'à 55 personnes, bien que sa capacité habituelle soit de 37 hommes de troupes avec leur équipement. La version améliorée CH-53E Super Stallion, avec 3 moteurs, est capable d'emporter jusqu'à 15 tonnes de charge.\\nConstruit à plus de 400 exemplaires en plusieurs versions depuis 1964, le CH-53 a été exporté vers l'Allemagne de l'Ouest — qui l'a fabriqué sous licence} par Vereinigte Flugtechnische Werke}, l'Autriche, le Mexique, l'Iran et Israël. — Huit hélicoptères de ce type prirent part à l'opération Eagle Claw, en 1980."},{"page_url":"https://vec.wikipedia.org/wiki/Antartide","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Aurore_australe_-_Aurora_australis.jpg","page_title":"Antartide","context_page_description":"El Antartide el xe un continente de 'ƚ emisfero meridional.\\nEl xe sircondà da ƚe porsion meridionaƚi de 'ƚ Osèano Atlàntego, de 'ƚ Osèano Indian e de 'ƚ Osèano Pasìfego."},{"page_url":"https://pt.wikipedia.org/wiki/Saunders-Roe_Princess","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Saro_Princess_G-ALUN_Cowes_1954.jpg","page_title":"Saunders-Roe Princess","context_page_description":"O SR.45 Princess foi um hidroavião turboélice monoplano octomotor, construído no Reino Unido pela Saunders-Roe, baseada em Cowes na Ilha de Wight. O Princess foi o maior hidroavião de metal de todos os tempos. Seu projeto foi cancelado após somente três exemplares terem sido construídos."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A8%D7%98%D7%99%D7%9F_%D7%9E%D7%A7%D7%92%D7%99%D7%A0%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/MartinMcGuinness_%28cropped%29.jpg","page_title":"מרטין מקגינס","context_page_description":"ג'יימס מרטין פאכלי מקגינס היה פוליטיקאי מצפון אירלנד מטעם מפלגת שין פיין לשעבר כיהן כסגן השר הראשון של צפון אירלנד מאז 2007 עד למותו במרץ 2017. ב-2011 הוא התמודד בבחירות לתפקיד נשיא אירלנד.\\nכמנהיג לשעבר של הצבא האירי הרפובליקני, היה מקגינס חבר הפרלמנט הבריטי החל מ-1997 ועד להתפטרותו ב-2 בינואר 2013. כמו כל חברי שין פיין, מקגינס נקט במדיניות של \\"היעדרות\\" בנוגע למושבו בפרלמנט הבריטי. בעקבות הסכם סנט אנדרוס ובעקבות הבחירות לאספה של צפון אירלנד ב-2007, הוא מונה להיות סגן השר הראשון של צפון אירלנד, כשמנהיג המפלגה היוניוניסטית הדמוקרטית, איאן פייזלי, נבחר להיות השר הראשון של צפון אירלנד. ב-5 ביוני 2008 הוא מונה מחדש לתפקיד הסגן לצדו של פיטר רובינסון שנבחר להיות השר הראשון במקומו של פייזלי. בין השנים 1999–2002 כיהן מקגינס כשר החינוך של צפון אירלנד."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D1%98_%D0%91%D1%80%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sergey_Brin.JPG","page_title":"Сергеј Брин","context_page_description":"Сергеј Михајлович Брин е руски и американски информатичар и претприемач, најдобро познат како соосновач, заедно со Лери Пејџ, на Google, најголемата Интернет компанија во светот.\\nВо 2011 година, неговото лично богатство се проценува на 16,7 билиони долари. Брин имигрирал во Соединетите Американски Држави од Советскиот Сојуз на шестгодишна возраст. Тој дипломирал на Универзитетот во Мериленд, следејки ги стапките на неговиот татко и дедо студирајќи математика како и компјутерски науки. По дипломирањето, заминува на Стенфорд каде се запознава со Larry Page, со кого подоцна стануваат пријатели. Тие ја преполниле нивната соба во студентскиот дом со евтини компјутери и го употребиле data mining системот на Брин за да изградат супериорна истражувачка машина. Програмата станала популарна на Стандфорд и тие ги ставиле во мирување нивните докторски студии за да започнат со работата на Google, во изнајмена гаража. Списанието Економист го смета Грин за „Просветлен човек“ и некој кој верува дека знаењето е секогаш подобро од незнаењето, филозофија која е мото на Google и која овозможува сите светски информации да бидат универзално достапни и корисни."},{"page_url":"https://fr.wikipedia.org/wiki/C-802","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/YJ-83.jpg","page_title":"C-802","context_page_description":"Désigné par l'OTAN CSS-N-8 Saccade, le C-802 est la version d'exportation du missile anti-navire chinois C801. Dévoilé pour la première fois en 1989, il a été conçu par la China Haiying Electro-Mechanical Technology Academy, aussi connue sous le nom de 3ᵉ académie. Il peut être tiré depuis une grande variété de plateformes, qu'elles soient aériennes, de surface ou terrestres. Les sous-marins sont également en mesure de l'employer."},{"page_url":"https://en.wikipedia.org/wiki/Filetail_fanskate","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Sympterygia_lima_Raja_buergeri_DELFIN%2C_1902.jpg","page_title":"Filetail fanskate","context_page_description":"The filetail fanskate is a species of fish in the family Arhynchobatidae. It is endemic to the Pacific coast of Chile. Its natural habitat is open seas."},{"page_url":"https://en.wikipedia.org/wiki/Cassia_roxburghii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Red_Cassia14.JPG","page_title":"Cassia roxburghii","context_page_description":"The Red Cassia, also known as the Roxburgh's cassia, and Ceylon senna, is a flowering plant in the family Fabaceae. The species is native to the Indian subcontinent and adjacent regions of Southeast Asia. It ranges throughout South India and Sri Lanka.\\nThe Latin specific epithet roxburghii refers to the Scottish Botanist William Roxburgh."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BB%D1%83%D0%B1%D0%B5%D0%B2,_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Golubev_Leonid_Vasiljevich.jpg","page_title":"Голубев, Леонид Васильевич","context_page_description":"Леони́д Васи́льевич Го́лубев — советский инженер."},{"page_url":"https://en.wikipedia.org/wiki/Tr%C3%A9m%C3%A9ven,_Finist%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Mairie_de_Tr%C3%A9m%C3%A9ven%2C_Finist%C3%A8re.JPG","page_title":"Tréméven, Finistère","context_page_description":"Tréméven is a commune in the Finistère department of Brittany in north-western France."},{"page_url":"https://en.wikipedia.org/wiki/Shuaip_Pasha%27s_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Shtepia_e_Shuaip_Pashes.JPG","page_title":"Shuaip Pasha's House","context_page_description":"Shuaip Pasha's House was the home of Shuaip Pasha, first Albanian Minister of Finance. It was located in Prizren, Kosovo, near Old Stone Bridge, at the riverside of Prizrenska Bistrica. The house was built in the early 19th century by Shuaip Aga, a prominent leader of the Albanian League of Prizren, and it was destroyed in 1999. In 2012, under the supervision of Cultural Heritage without Borders organisation, a plan of conservation and reconstruction was presented."},{"page_url":"https://fr.wikipedia.org/wiki/Chartreuse_de_Buxheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/KlosterBuxheimGrundriss.png","page_title":"Chartreuse de Buxheim","context_page_description":"La chartreuse de Buxheim est un ancien couvent de chartreux, aujourd’hui siège des Salésiens de Don Bosco. Il se trouve à Buxheim en Souabe, près de Memmingen et fait partie du diocèse d’Augsbourg. L’établissement religieux, fondé vers 1100 à des fins d’instruction, a passé en 1402 aux chartreux, devenant le couvent Maria Saal, et a été utilisé comme tel jusqu’en 1812. À partir de 1548, c'était la seule chartreuse d’obédience impériale dans le cadre du Saint-Empire romain germanique.\\nLes bâtiments conventuels, dont la célèbre église Sainte-Marie, sont très largement conservés. Aujourd’hui, certaines parties abritent le Musée allemand des chartreuses, d’autres, avec le gymnase attenant, sont utilisées par les Salésiens comme internat et école de jour. Dans l’église, les stalles de Buxheim passent pour l’un des chefs-d’œuvre de l’art baroque."},{"page_url":"https://fr.wikipedia.org/wiki/Mus%C3%A9e_national_d%27art_d%27Azerba%C3%AFdjan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/%D0%9B%D0%B0%D0%B7%D0%B0%D1%80%D1%8C_%D0%9B%D0%B8%D1%81%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_-_%D0%93%D0%BE%D1%80%D0%BE%D0%B4_%28%D0%A1%D1%83%D0%BF%D1%80%D0%B5%D0%BC%D0%B0%D1%82%D0%B8%D0%B7%D0%BC%29.jpg","page_title":"Musée national d'art d'Azerbaïdjan","context_page_description":"Le musée national d’art d’Azerbaïdjan est l’un des plus grands musées d’art d'Azerbaïdjan. Dix-sept mille objets y sont stockés. Le musée est fondé en 1936 et depuis 1943, il porte le nom de Roustam Moustafaïev, l’un des fondateurs de l’art décoratif théâtral en Azerbaïdjan. Le musée est installé dans deux bâtiments : l'ancien palais De Bourr et l'ancien lycée féminin Marie, construits à la fin du XIXᵉ siècle à Bakou. Le musée contient des œuvres d’art couvrant les différentes périodes de l’art de l’Orient ancien et d’Azerbaïdjan, de Russie et d’Europe occidentale. Les œuvres d'art de valeur de la collection du musée ont été exposées au Canada, à Cuba, en Syrie, en France, en Tchécoslovaquie, en Algérie, en Irak et dans d'autres pays."},{"page_url":"https://en.wikipedia.org/wiki/Bicolorana_bicolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Metrioptera_bicolor_%282388981528%29.jpg","page_title":"Bicolorana bicolor","context_page_description":"Bicolorana bicolor\\nis a species of bush cricket in the subfamily Tettigoniinae and tribe Platycleidini: found in mainland Western Europe. Individuals are normally brachypterous, but long-winged forms may be encountered.\\nDatabases currently disagree on the preferred placement of this and the synonym Metrioptera bicolor. It was originally described by RA Philippi in 1830 as \\"Locusta bicolor\\"."},{"page_url":"https://hr.wikipedia.org/wiki/Brojilo_elektri%C4%8Dne_energije","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Drehstromzaehler_01_KMJ.jpg","page_title":"Brojilo električne energije","context_page_description":"Brojilo električne energije ili električno brojilo je mjerni instrument ili uređaj koji, radi obračuna pri razmjeni ili kupoprodaji, mjeri i bilježi električnu energiju što se kroza nj prenosi. Postavlja se na odabrano mjerno mjesto, i pokazuje ukupnu električnu energiju koja je njime prostrujala od početka mjerenja."},{"page_url":"https://pnb.wikipedia.org/wiki/%DB%81%D8%A7%D9%86_%D8%B3%D9%84%D8%B7%D9%86%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Han_Dynasty_Plain_map.PNG","page_title":"ہان سلطنت","context_page_description":"ہان راج ٹبر جاں خاندان چین دا اک شاہی خاندان سی۔ ایہ خاندان 202 قبل مسیح وچ اقتدار وچ آیا سی ۔ انہاں نے کنفیوشس مت تےلیگل ازم دے فلسفہ دی پیروی کیتی۔ اس شاہی ٹبر دے دور وچچین نے فن تے سائنس وچ بہت ترقی کیتی۔ اسی دور وچ فتوحات دا سلسلہ شروع ہویا تے ہان سلطنت پھیلدی چلی گئی۔ چین نے ہور دیساں دی اک وڈی تعداد دے نال تجارت شروع کر دتی۔ تاجر شاہراہ ریشم دے ذریعے چین تک پہنچدے سن۔ اسے دور وچ چین وچ بدھ مت نوں متعارف کرایا گیا۔ ہان خاندان دا دور قدیم چین دا بہت اہم دور سی بلکہ ایہ اک سنہری دور دے نام توں جانیا جاندا ہے۔"},{"page_url":"https://ca.wikipedia.org/wiki/Bar%C4%B1%C5%9F_Esen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Baris_Esen_2012.jpg","page_title":"Barış Esen","context_page_description":"Barış Esen és un jugador d'escacs turc que té el títol de Gran Mestre des del 2010.\\nA la llista d'Elo de la FIDE del juny de 2016, hi tenia un Elo de 2516 punts, cosa que en feia el jugador número 6 de Turquia. El seu màxim Elo va ser de 2593 punts, a la llista de setembre de 2014."},{"page_url":"https://en.wikipedia.org/wiki/May_2050_lunar_eclipse","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Lunar_eclipse_from_moon-2050Oct30.png","page_title":"May 2050 lunar eclipse","context_page_description":"A total lunar eclipse will take place on May 6, 2050.\\nThis lunar eclipse will be the first of a tetrad, four total lunar eclipses in series. The previous series will have taken place in 2043 and 2044, starting with the March 2043 lunar eclipse.\\nThis will be the 58th member of Lunar Saros 122. The previous event will have been the April 2032 lunar eclipse."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%83%D1%8D%D0%B9_(%D0%BD%D0%B0%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Ma_Lin.jpg","page_title":"Хуэй (народ)","context_page_description":"Хуэй-цзу кит. упр. 回族, пиньинь: huízú, то есть «народность хуэй») — одно из 56 официально признанных национальных меньшинств КНР. Их отличие от ханьцев состоит не в наличии особого языка, а в том, что они в течение многих веков исповедуют ислам и являются носителями исламского культурного наследия.\\nХотя в официальных китайских материалах, посвящённых языку и письменности национальных меньшинств, в качестве родного языка для хуэй указан китайский, этот этноним употребляется также в отношении небольшой группы уцулов, живущих на Хайнане. Уцулы также исповедуют ислам, но говорят на языке, который не является родственным китайскому."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%A8%D8%B1%D9%8A%D9%84_%D8%B4%D8%B1%D8%A7%D9%8A%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Abril_Schreiber.jpg","page_title":"أبريل شرايبر","context_page_description":"أبريل شرايبر ‏ هي ممثلة كولومبية وفنزويلية، ولدت في 12 فبراير 1987 في كاراكاس في فنزويلا."},{"page_url":"https://sv.wikipedia.org/wiki/Lene%C5%A1ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lenesice%28Louny%29_kostel_sv_Simona_a_Judy_side.JPG","page_title":"Lenešice","context_page_description":"Lenešice är en ort i Tjeckien. Den ligger i länet Ústí nad Labem, i den nordvästra delen av landet, 60 km nordväst om huvudstaden Prag. Lenešice ligger 182 meter över havet och antalet invånare är 1 298.\\nTerrängen runt Lenešice är huvudsakligen platt, men åt nordost är den kuperad. Lenešice ligger nere i en dal. Den högsta punkten i närheten är Raná, 457 meter över havet, 3,6 km norr om Lenešice. Runt Lenešice är det ganska tätbefolkat, med 134 invånare per kvadratkilometer. Närmaste större samhälle är Most, 16,9 km nordväst om Lenešice. Trakten runt Lenešice består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är augusti, då medeltemperaturen är 21 °C, och den kallaste är januari, med -6 °C."},{"page_url":"https://ro.wikipedia.org/wiki/Codrin_%C8%9Aapu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Codrin_Tapu.jpg","page_title":"Codrin Țapu","context_page_description":"Codrin Ștefan Țapu este un psiholog și autor român care a elaborat o abordare umanist-sistemică a personalității."},{"page_url":"https://de.wikipedia.org/wiki/Stadtplatz_Aichach","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Aichach-Rathaus_ab_1221%2C_heutiges_Aussehen_von_1704.jpg","page_title":"Stadtplatz Aichach","context_page_description":"Der Stadtplatz ist ein Bauensemble in Aichach, der Kreisstadt des Landkreises Aichach-Friedberg im bayerischen Regierungsbezirk Schwaben."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Norwegen","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Modell_av_Paleet_og_hagen_OB.A8497.jpg","page_title":"Liste von Burgen und Schlössern in Norwegen","context_page_description":"Diese Liste gibt eine Übersicht über Burgen, Schlösser und Festungen in Norwegen."},{"page_url":"https://ca.wikipedia.org/wiki/Receptors_ion%C3%B2trops","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/R%C3%A9cepteur_ionotrope.svg","page_title":"Receptors ionòtrops","context_page_description":"Un receptor ionòtrop sensible a un lligand és una proteïna de membrana que obre un canal iònic. Generalment són selectius a ions com Na+, K+, Ca2+ o Cl-. Es troben a nivell de les sinapsis, on converteixen ràpidament un missatge presinàptic químic en missatge postsinàptic elèctric. Els receptors ionòtrops s'oposen als receptors metabòtrops, els quals no tenen canals iònics."},{"page_url":"https://en.wikipedia.org/wiki/Austrian_walled_towns","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Vischer_-_Topographia_Ducatus_Stiriae_-_377_Schladming.jpg","page_title":"Austrian walled towns","context_page_description":"Walled towns in Austria started to appear in the 11th century. Their establishment was closely connected with the development of Austria as a march of the Holy Roman Empire and in particular by the Stauffenberg Emperors and their Marcher Lords, the Babenbergs. In present-day Austria, there are 106 towns or cities that were walled. The walls of Radstadt, Freiburg, Hainburg and Drosendorf survive almost intact, and Austria has some of the most impressive walled towns in Europe.\\nOther cities or towns such as Vienna, Salzburg and St Pölten have had their defences almost completely obliterated. In Austria, the procedure for granting civic status or creating a Stadt was relatively simple. Initially, a local lord or official ministerialis could petition for market rights or Marktrect. At that point, the town would be laid out by a surveyor and it would have been surrounded by an earthen-banked enclosure surmounted with a vertical wooden palisade. Often a stone gatehouse or Tor would be built for the collection of custom dues from traders coming to the market."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%DA%A9%D8%B4%D9%88%D8%B1%D9%87%D8%A7_%D8%A8%D8%A7_%D9%81%D8%B1%D8%A7%D9%86%D8%B3%D9%88%DB%8C_%D8%A8%D9%87%E2%80%8C%D8%B9%D9%86%D9%88%D8%A7%D9%86_%D8%B2%D8%A8%D8%A7%D9%86_%D8%B1%D8%B3%D9%85%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/New-Map-Francophone_World.svg","page_title":"فهرست کشورها با فرانسوی به‌عنوان زبان رسمی","context_page_description":"زبان فرانسوی در ۲۹ کشور یکی از زبان‌های رسمی است. این فهرست به ارائه این موارد می‌پردازد."},{"page_url":"https://es.wikipedia.org/wiki/Jard%C3%ADn_de_las_Tuller%C3%ADas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Tuileries_projet_et_jardins.jpg","page_title":"Jardín de las Tullerías","context_page_description":"El jardín de las Tullerías, a veces llamado jardines de las Tullerías, en plural, es un parque público parisino localizado en el I Distrito, entre el Louvre y la plaza de la Concordia. Fue creado por Catalina de Medicis, a partir de 1564, como jardín del palacio de las Tullerías —antigua residencia real e imperial hoy desaparecida— en el emplazamiento de unas antiguas tejeras que le dieron su nombre. Finalmente se abrió al público en 1667 y se convirtió en un parque público después de la Revolución Francesa. En los siglos XIX y XX, era un lugar donde los parisinos celebraban, conocían, paseaban y se relajaban. Es el jardin à la française más importante y más antiguo de la capital y fue clasificado como monumento histórico en 1914, como un sitio inscrito en 1975 y en 1991 quedó incluido en la ámbito protección del Patrimonio Mundial de la UNESCO en relación con las Riberas del Sena en París. ​El jardín ahora es parte del dominio nacional del Louvre y de las Tullerías.​\\nAcoge varios eventos y manifestaciones, como los rendez-vous aux jardins [Encuentros en los jardines] y las foires internationales d'art contemporain."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%86%E1%80%94%E1%80%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/US_long_grain_rice.jpg","page_title":"ဆန်","context_page_description":"ပြည်ထောင်စု မြန်မာနိုင်ငံသည် လွတ်လပ်သောအချုပ်အချာ\\nအာဏာပိုင်နိုင်ငံဖြစ်လာသည်နှင့်အမျှ စီးပွားရေးဖက်၌လည်း\\nတောင့်တင်း ကြံ့ခိုင်ဖို့လိုပေသည်။ သို့မှသာလျှင် ပြည်ထောင်စု\\nတိုင်းရင်းသား တို့၏ လူနေမှုအဆင့်အတန်းသည် တိုးတက်\\nလာမည်ဖြစ်၏။ ကမ္ဘာ့ဈေးကွက်တွင် မြန်မာ့ဆန်ကို တွင်ကျယ်\\nစွာရောင်းချနိုင်ရန် နိုင်ငံတော်အစိုးရစိုက်ပျိုးရေးဌာနက စပါး\\nမျိုးကောင်းမျိုးသန့် ရရှိရေး၊ စပါးဖျက်ပိုးနှင့် ရောဂါနှိမ်နင်းရေး၊\\nမြေဩဇာအသုံးပြုရေး၊ ခေတ်မှီစိုက်ပျိုးရေးကရိယာများ အသုံးချ\\nရေးစသည့် စိုက်ပျိုးရေးလုပ်ငန်းတို့ကို ထိရောက်စွာဆောင်ရွက်\\nလျက်ရှိပေသည်။\\nရှေးလွန်လေပြီးသော ခေတ်အခါကပင် လူတို့သည် ဆန်\\nရရှိအောင် စပါးကိုစိုက်ပျိုးခဲ့ကြသည်။ မြန်မာလူမျိုးတို့အဖို့\\nဆန်သည် ပဓာနအစာဖြစ်သည်။ အထူးသဖြင့် အရှေ့တိုင်းသားများအဖို့ အခြားကောက်ပဲသီးနှံများထက် ဆန်သည် အရေးပါလှသည်။ ရုက္ခဗေဒပညာရှင်များက ယခုစိုက်ပျိုးလုပ်ကိုင်နေကြသော စပါးမျိုးများသည် အရှေးအခါက အရိုင်းပေါက်ခဲ့သော စပါးမျိုးမှ ဆင်းသက်လာသည်ဟုဆိုသည်။"},{"page_url":"https://es.wikipedia.org/wiki/Rosult","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Rosult_%28Nord%2C_Fr%29_mairie.JPG","page_title":"Rosult","context_page_description":"Rosult es una población y comuna francesa, en la región de Norte-Paso de Calais, departamento de Norte, en el distrito de Valenciennes y cantón de Saint-Amand-les-Eaux-Rive gauche."},{"page_url":"https://sl.wikipedia.org/wiki/Belolisi_rjav%C4%8Dek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Erebia_ligea01.jpg","page_title":"Belolisi rjavček","context_page_description":"Belolisi rjavček je dnevni metulj iz družine pisančkov."},{"page_url":"https://ast.wikipedia.org/wiki/Entrena","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Entrena_1.JPG","page_title":"Entrena","context_page_description":"Entrena ye un conceyu de la provincia y Comunidá Autónoma de La Rioxa. En 2008 tenía 1.451 habitantes y el so términu municipal ocupa 21,03 km². Ta asitiáu a 13 km de Logroño. El xentiliciu de la llocalidá ye entreneru/a."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B1%D9%82%D8%AF_%D9%87%D9%84%D8%A7%D9%84_%D8%A7%D9%84%D8%B9%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Helal-havayi_%281%29.jpg","page_title":"مرقد هلال العلي","context_page_description":"مرقد هلال العلي هو مرقد شيعي تاريخي يعود إلى السلالة الصفوية، ويقع في مقاطعة آران وبيدغل."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%82%D0%BE_%D0%9F%D1%80%D0%B5%D0%B4%D0%B5%D1%81%D1%82%D0%B8%D0%BD%D0%B0%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Goto_Predestinacia_1.jpg","page_title":"Гото Предестинация","context_page_description":"«Го́то Предестина́ция» — российский 58-пушечный парусный линейный корабль, спущенный на воду 27 апреля 1700 год на воронежской верфи Воронежского адмиралтейства. Строился по проекту русского царя Петра I под руководством известного в будущем корабельного мастера Федосея Моисеевича Скляева. Пётр I принимал участие и в кораблестроительных работах; он же руководил церемонией закладки корпуса «Гото Предестинации» и участвовал в спуске корабля на воду.\\n«Гото Предестинация» стал первым российским линейным кораблём и первым кораблём IV ранга по британской ранговой классификации 1706 года, созданным в России без участия иностранных специалистов. Во время своей службы линейный корабль входил в состав Азовского флота. После неудачного Прутского похода и потери Азова корабль был продан Османской империи.\\nВ 2014 году была открыта историческая копия корабля."},{"page_url":"https://no.wikipedia.org/wiki/Saskatchewans_flagg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Flag_of_the_Lieutenant-Governor_of_Saskatchewan.svg","page_title":"Saskatchewans flagg","context_page_description":"Saskatchewans flagg er delt i grønt over gult, symboler for provinsens skogdekte nordlige områder og hvetelandet i sør. I flaggets frie ende er det plassert en blomst av arten western red lily. Dette er provinsens offisielle blomstersymbol. I kantonen er provinsen Saskatchewans våpenskjold plassert. Dette viser en rød løve på gult i skjoldhodet, og under dette tre gule kornbånd på grønt felt. Løven er et kongelig symbol, Englands løve i omvendte farger, mens kornbåndene representerer provinsens rike landbruk. Våpenet ble opprinnelig gitt provinsen av kong Edward VII 25. august 1906. Flagget, som er i størrelsesforholdet 1:2, ble vedtatt av provinsforsamlingen 31. mars 1969 og kunngjort av viseguvernøren 22. september samme år."},{"page_url":"https://fr.wikipedia.org/wiki/Neyland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Neyland_High_Street_Town_Hall.jpg","page_title":"Neyland","context_page_description":"Neyland est une communauté du pays de Galles, au Royaume-Uni, située dans le comté du Pembrokeshire."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%B8%E0%B8%AA%E0%B8%B2%E0%B8%99%E0%B8%AB%E0%B8%A5%E0%B8%A7%E0%B8%87_%E0%B8%A7%E0%B8%B1%E0%B8%94%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%9A%E0%B8%9E%E0%B8%B4%E0%B8%98%E0%B8%AA%E0%B8%96%E0%B8%B4%E0%B8%95%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%AA%E0%B8%B5%E0%B8%A1%E0%B8%B2%E0%B8%A3%E0%B8%B2%E0%B8%A1%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%A7%E0%B8%A3%E0%B8%A7%E0%B8%B4%E0%B8%AB%E0%B8%B2%E0%B8%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mausoleum_of_Savang_Vadhana.jpg","page_title":"สุสานหลวง วัดราชบพิธสถิตมหาสีมารามราชวรวิหาร","context_page_description":"วัดราชบพิธสถิตมหาสีมารามเป็นพระอารามหลวงชั้นเอก ประจำรัชกาลพระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว รัชกาลที่ 5 แห่งพระบรมราชจักรีวงศ์ ซึ่งมิเพียงคงความวิจิตรงดงามในเชิงสถาปัตยกรรมไทยแบบพระราชนิยมแห่งหนึ่งในกรุงรัตนโกสินทร์แล้ว พระอารามนี้ยังประกอบด้วยเขตสุสานหลวงจุฬาลงกรณ์ราชสันตติวงศ์ อันเป็นบริเวณเฉพาะที่นับเนื่องด้วยราชสกุลและสายสัมพันธ์แห่งพระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัว\\nสุสานหลวง วัดราชบพิธสถิตมหาสีมารามราชวรวิหารเป็นสุสานที่พระบาทสมเด็จพระจุลจอมเกล้าเจ้าอยู่หัวทรงพระกรุณาโปรดเกล้าฯ ให้สร้างขึ้น ด้วยมีพระราชประสงค์จะให้ผู้ที่มีความรักใคร่ห่วงใยอย่างใกล้ชิดคือ พระมเหสี เจ้าจอมมารดา และพระราชโอรส พระราชธิดา ได้อยู่รวมกันหลังจากที่ได้ล่วงลับไปแล้ว ในทั่วไปจะเป็นการสร้างอนุสาวรีย์ของพระมเหสีและเจ้าจอมมารดา เพื่อให้ลูกได้อยู่รวมกับแม่หรืออย่างน้อยในบ้านของแม่ เว้นแต่ในกรณีที่พระราชโอรสหรือพระราชธิดาสิ้นพระชนม์ก่อนพระมารดาก็สร้างอนุสาวรีย์ของพระเจ้าลูกเธอพระองค์นั้นไปก่อน"},{"page_url":"https://en.wikipedia.org/wiki/Odawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Flag_of_the_Little_Traverse_Bay_Bands_of_Odawa_Indians.PNG","page_title":"Odawa","context_page_description":"The Odawa, said to mean \\"traders\\", are an Indigenous American ethnic group who primarily inhabit land in the Eastern Woodlands region, commonly known as the northern United States and southern Canada. They have long had territory that crosses the current border between the two countries, and they are federally recognized as Native American tribes in the United States and have numerous recognized First Nations bands in Canada. They are one of the Anishinaabeg, related to but distinct from the Ojibwe and Potawatomi peoples.\\nAfter migrating from the East Coast in ancient times, they settled on Manitoulin Island, near the northern shores of Lake Huron, and the Bruce Peninsula in the present-day province of Ontario, Canada. They considered this their original homeland. After the 17th century, they also settled along the Ottawa River, and in the states of Michigan and Wisconsin, as well as through the Midwest south of the Great Lakes in the latter country. In the 21st century, there are approximately 15,000 Odawa living in Ontario, and Michigan and Oklahoma.\\nThe Ottawa dialect is part of the Algonquian language family."},{"page_url":"https://sv.wikipedia.org/wiki/Yves_Boisset","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Cloture-6339_06.jpg","page_title":"Yves Boisset","context_page_description":"Yves Boisset, född 13 mars 1939 i Paris, är en fransk filmregissör. Han vann juryns specialpris vid filmfestivalen i Berlin 1975 för Oskyldigt offer och tilldelades Louis Delluc-priset 1976 för Man kallade honom sheriffen. Till hans kändaste filmer hör även En lila taxi från 1977, som bygger på en roman av Michel Déon och tävlade vid filmfestivalen i Cannes, och Pengarna eller livet från 1983, en mediakritisk framtidsskildring efter en novell av Robert Sheckley."},{"page_url":"https://es.wikipedia.org/wiki/Caracol_Televisi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Caracol_2015.PNG","page_title":"Caracol Televisión","context_page_description":"Caracol Televisión es un canal de televisión abierta colombiano, el cual tiene su origen institucional en la tradicional compañía radiodifusora Caracol, sigla de Cadena Radial Colombiana. El canal tiene como propiedad a los canales de suscripción Novelas Caracol, Canal Época, Caracol Internacional y a los canales de televisión digital terrestre Caracol HD2, Blu Radio y La Kalle. La compañía es propiedad del Grupo Valorem del empresario Alejandro Santo Domingo Dávila.\\nEl centro de producción y emisión de Caracol cuenta con catorce estudios y diez unidades móviles. Además, posee los derechos de transmisión de los torneos de la FIFA para Colombia, como la Copa Mundial de Fútbol, los partidos de la selección nacional de fútbol, de las Grandes Vueltas de ciclismo y los Juegos Olímpicos.\\nEl canal ha realizado producciones de fama internacional, como Desafío, A otro nivel, Yo me llamo, Escobar, el patrón del mal, La reina del flow, Pasión de gavilanes, La Promesa, El cartel, La saga, negocio de familia, Las muñecas de la mafia, Caballo viejo, Pedro el escamoso, La ronca de oro, La niña, Bolívar y Sin tetas no hay paraíso, entre otras."},{"page_url":"https://ru.wikipedia.org/wiki/Aristonectes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Aristonectes2DB.jpg","page_title":"Aristonectes","context_page_description":"Aristonectes — род вымерших плезиозавров из семейства эласмозавридов."},{"page_url":"https://sh.wikipedia.org/wiki/Hans_Otto","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Hans_Otto-stamp.jpg","page_title":"Hans Otto","context_page_description":"Hans Otto bio je njemački glumac, poznat kao jedna od prvih žrtava nacističkog režima.\\nOtto je odrastao u Dresdenu i pohađao istu školu sa znamenitim književnikom Erichom Kästnerom. Glumačku karijeru je započeo 1921. godine. S vremenom je postao jedan od najpopularnijih glumaca njemačkog kazališta, a 1929. je odigrao naslovnu ulogu u prestižnoj kazališnoj adaptaciji Winnettoua.\\nGodine 1930. mu je ponuđena uloga Friedricha Velikog u Das Flötenkonzert von Sans-souci. Otto, koji je od 1924. bio član Komunističke partije Njemačke ju je odbio iz političkih razloga. Iste je godine organizirao glumački sindikat.\\nZa razliku od mnogih svojih kolega nije napustio Njemačku nakon što su početkom 1933. u njoj na vlasti došli nacisti, a odbio je ponudu Maxa Reinhardta da se preseli u Beč. 24. novembra su ga u restoranu uhapsili pripadnici nacističkih Jurišnih odreda; tokom nekoliko sati je nekoliko puta premještan iz kasarni SA u Gestapo, gdje je svaki put bio izložen mučenju. Istog je dana odveden u policijsku bolnicu gdje je umro od ozljeda. Ministar propagande Joseph Goebbels je posebnim dopisom zabranio njemačkim medijima da objave vijest o njegovoj smrti.\\nKlaus Mann je godine 1936."},{"page_url":"https://en.wikipedia.org/wiki/List_of_companies_of_the_Isle_of_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Peel_-_Peel_Bay_Beach_-_geograph.org.uk_-_1719663.jpg","page_title":"List of companies of the Isle of Man","context_page_description":"The Isle of Man is a self-governing crown dependency in the Irish Sea between England and Northern Ireland. The head of state is Queen Elizabeth II, who holds the title of Lord of Mann. The Lord of Mann is represented by a lieutenant governor. Foreign relations and defence are the responsibility of the British Government.\\nThe Isle of Man is a low-tax economy with no capital gains tax, wealth tax, stamp duty, or inheritance tax and a top rate of income tax of 20%. The rate of corporation tax is 0% for almost all types of income; the only exceptions are that the profits of banks are taxed at 10%, as is rental income from land and buildings situated on the Isle of Man.\\nOffshore banking, manufacturing, and tourism form key sectors of the economy. Agriculture and fishing, once the mainstays of the economy, now make declining contributions to the island's Gross Domestic Product."},{"page_url":"https://hu.wikipedia.org/wiki/Magyar_irodalom","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Halotti_besz%C3%A9d.jpg","page_title":"Magyar irodalom","context_page_description":"Magyar irodalomnak azon irodalmi művek összességét tekintjük, amelyeket magyar nyelven írnak. Tágabb értelemben ide tartozik a magyar nyelvű szakirodalom, a műfordítások, a magyar népköltészet, a filmes és zenés műfajokhoz kapcsolódó magyar nyelvű irodalmi tevékenység, valamint az olyan irodalmi művek is, melyeket más nyelven írtak ugyan, de szerzőjük miatt vagy témájukban kapcsolódnak Magyarországhoz, esetleg korai magyar nyelvű töredékeket, nyelvemlékeket tartalmaznak."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Uccle-Calevoet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Calevoet_Station_-_Tunnel_-_01-09-18.jpg","page_title":"Gare d'Uccle-Calevoet","context_page_description":"La gare d’Uccle-Calevoet est une gare ferroviaire belge de la ligne 124, de Bruxelles-Midi à Charleroi-Sud, située sur le territoire de la commune d'Uccle dans la région de Bruxelles-Capitale, non loin de l'ancien hameau de Calevoet.\\nElle est mise en service en 1873 par l'administration des chemins de fer de l'État belge.\\nC'est une gare de la Société nationale des chemins de fer belges desservie par des trains Suburbains et d'Heure de pointe."},{"page_url":"https://en.wikipedia.org/wiki/French_war_planning_1920%E2%80%931940","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Maginot_Linie_Karte.jpg","page_title":"French war planning 1920–1940","context_page_description":"The Dyle Plan or Plan D was the plan of the Commander-in-Chief of the French Army, Général d'armée Maurice Gamelin to defeat a German attempt to invade France through Belgium. The Dyle river is 86 km long, from Houtain-le-Val through Flemish Brabant and Antwerp; Gamelin intended French, British and Belgian troops to halt a German invasion force along the line of the river. The Franco-Belgian Accord of 1920 had co-ordinated communication and fortification efforts of both armies. The Belgian government let the accord lapse after the German Remilitarization of the Rhineland on 7 March 1936, to adopt a policy of strict neutrality, with the German Army on the Belgian border.\\nFrench doubts about the Belgian army led to uncertainty about whether French troops could move fast enough into Belgium to avoid an encounter battle and fight a defensive battle from prepared positions. The Escaut Plan/Plan E and Dyle Plan/Plan D were devised for a forward defence in Belgium, along with a possible deployment on the French–Belgian border to Dunkirk. Gamelin chose the Escaut Plan, then substituted Plan D for an advance to the line of the Dyle, which was 43–50 mi shorter."},{"page_url":"https://sv.wikipedia.org/wiki/Du%C5%A1ko_Popov","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/1944_NormandyLST.jpg","page_title":"Duško Popov","context_page_description":"Dušan \\"Duško\\" Popov född 10 juli 1912 i Titel, Österrike-Ungern och död 10 augusti 1981 i Frankrike var en dubbelagent; under kodnamnet \\"Tricycle\\" hos brittisk underrättelsetjänst och hos Abwehr med kodnamnet \\"Ivan\\", som arbetade för brittisk underrättelsetjänst under andra världskriget. Ian Fleming uppgav senare att Popov varit inspirationskälla för karaktären James Bond."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%90%E1%83%A5%E1%83%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Montage_of_Baku_2019.jpg","page_title":"ბაქო","context_page_description":"ბაქო — აზერბაიჯანის დედაქალაქი, მდებარეობს კასპიის ზღვის აფშერონის ნახევარკუნძულის სამხრეთ სანაპიროზე. თანამედროვე ბაქო სამი ნაწილისგან შედგება: ძველი ქალაქი, კოლონიური ნაწილი და საბჭოთა პერიოდში აშენებული ქალაქი. ქალაქის მოსახლეობა 2011 წლის მონაცემებით იყო 2.0 მილიონი, აგლომერაციაში 3 მილიონამდე ადამიანი სახლობს ლტოლვილთა და იძულებით გადაადგილებულ პირთა ჩათვლით."},{"page_url":"https://simple.wikipedia.org/wiki/Trochophore","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Polyplacophora_ontogeny.jpg","page_title":"Trochophore","context_page_description":"A trochophore is a type of larva found in marine plankton. It belongs to animals of several related phyla, in the superphylum Lophotrochozoa.\\nThey have two or more bands of cilia. By moving their cilia rapidly, a water eddy is created. In this way they control the direction of their movement. Also, in this way they bring their food closer, to capture it more easily."},{"page_url":"https://en.wikipedia.org/wiki/Tod_H._Mikuriya","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Author_Dr._Tod_Mikuriya.jpg","page_title":"Tod H. Mikuriya","context_page_description":"Tod Hiro Mikuriya was a psychiatrist, and author of books such as Marijuana Medical Papers: 1839–1972. He is known as an outspoken advocate for the legalization and use of cannabis for medical purposes. He is regarded by some as the grandfather of the medical cannabis movement in the United States, most especially California."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%82%D8%AF_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/President_Barack_Obama%2C_2012_portrait_crop.jpg","page_title":"عقد 2010","context_page_description":"عقد 2010 هي فترة زمنية في التقويم الغريغوري، وبدأت يوم 1 يناير 2010 وانتهت في 31 ديسمبر 2019."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1913","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Jos%C3%A9_Sol%C3%ADs_%28cropped%29.jpg","page_title":"Lijst van personen geboren in 1913","context_page_description":"Dit is een lijst van personen die geboren zijn in 1913.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://pt.wikipedia.org/wiki/Apeadeiro_de_Gelfa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Linha_do_Minho.svg","page_title":"Apeadeiro de Gelfa","context_page_description":"O Apeadeiro de Gelfa é uma interface ferroviária desactivada da Linha do Minho, que servia a localidade de Gelfa, na Freguesia de Âncora, em Portugal."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Leiden,_Binnenstad-Zuid","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Leiden_-_Plantsoen_7_GM-966_20200418.jpg","page_title":"Lijst van gemeentelijke monumenten in Leiden, Binnenstad-Zuid","context_page_description":"De wijk Binnenstad-Zuid in Leiden heeft 615 gemeentelijke monumenten, hieronder een overzicht."},{"page_url":"https://fr.wikipedia.org/wiki/Georges-Louis_Arlaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Clo%C3%AEtre_de_l%27abbaye_de_Nieul-sur-l%27Autise_en_Vend%C3%A9e%2C_Georges-Louis_Arlaud.jpg","page_title":"Georges-Louis Arlaud","context_page_description":"Georges-Louis Arlaud est un photographe français né en 1869 à Genève et mort en 1944 à La Ciotat."},{"page_url":"https://pl.wikipedia.org/wiki/Lipperhey","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/55_Rho_Cancri_1_d.png","page_title":"Lipperhey","context_page_description":"Lipperhey – najbardziej odległa ze znanych planet orbitujących wokół 55 Cancri."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%88%D1%82%D0%B0%D0%BD_%D0%BF%D0%BE%D1%81%D0%B5%D0%B2%D0%BD%D0%BE%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Fromage_de_Banon.JPG","page_title":"Каштан посевной","context_page_description":"Кашта́н посевно́й — дерево, вид рода Каштан семейства Буковые. Происходит из юго-восточной Европы и Малой Азии. В русскоязычной литературе встречаются и другие наименования этого вида: Каштан съедобный, Каштан настоящий и Каштан благородный."},{"page_url":"https://en.wikipedia.org/wiki/German_survey_ship_Meteor","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/The_Meteor_of_the_German_Meteor_expedition.jpg","page_title":"German survey ship Meteor","context_page_description":"Meteor was a German survey vessel, noted for her survey work in the Atlantic Ocean between 1925 and 1927. Handed over to the Soviet Union following World War II, the ship was renamed Ekvator. Her ultimate fate is not known."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Zabolotnyj%2C_Daniil_Kirillovich.jpg","page_title":"Українці","context_page_description":"Украї́нці — східнослов'янський етнос, основне і корінне населення України. Як етнос сформувався на землях сучасної України та частин суміжних земель сучасних: Польщі, Білорусі, Молдови, Румунії, Угорщини, Словаччини та Росії. За межами України проживають в Росії, Казахстані, Молдові, Білорусі, Киргизстані, Узбекистані, Польщі, Канаді, США, Аргентині та багатьох інших країнах. Загальна чисельність перевищує 46 мільйонів осіб. З них 37 мільйонів мешкає в Україні. Більшість українців розмовляють українською мовою, що належить до східнослов'янської мовної групи. За релігійною приналежністю — православні та греко-католицькі християни. До XX століття вживали самоназву русь, русини, козаки. Також українців називали рутенами, черкасами, малоросами."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%AB%D5%A2%D6%80%D5%AB%D5%A4%D5%A1%D6%81%D5%B8%D6%82%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%EC%9A%B8%ED%94%84%EB%8F%856.jpg","page_title":"Հիբրիդացում","context_page_description":"Հիբրիդացում ՝ տարբեր հատկանիշների՝ առնվազն մեկ զույգով տարբերվող ծնողական առանձնյակների խաչասերման միջոցով հիբրիդային սերունդ ստանալն է։ Այնուհետև ստացված հիբրիդային սերնդում ընտրության միջոցով առանձնացվում է պիտանի և տնտեսապես կարևոր հատկանիշներով մի առանձնյակ, որն օգտագործվում է հետագա սերունդներ ստանալու համար։"},{"page_url":"https://ceb.wikipedia.org/wiki/Proustia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Proustia_cuneifolia_mendocina.jpg","page_title":"Proustia","context_page_description":"Henero sa mga tanom nga bulak ang Proustia. Ang Proustia sakop sa kabanay nga Asteraceae.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D8%A7%D8%B1%D9%87_%D8%AA%D8%A7%D9%8A%D9%84%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Sarah_Taylor.jpg","page_title":"ساره تايلور","context_page_description":"ساره تايلور لاعبه كريكت من المملكه المتحده."},{"page_url":"https://fr.wikipedia.org/wiki/Route_principale_11_(Suisse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Boltigen_068.jpg","page_title":"Route principale 11 (Suisse)","context_page_description":"La Route principale 11, du réseau suisse des routes principales, relie Vionnaz dans la vallée du Rhône en Valais à Wassen dans les Alpes uranaises, en passant par les Préalpes vaudoises, les Préalpes bernoises et les Alpes bernoises."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%83%A4%EC%98%A4%EA%B0%84%EC%8B%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Xiaogan.jpg","page_title":"샤오간시","context_page_description":"샤오간은 중화인민공화국 후베이 성에 있는 지급시이다."},{"page_url":"https://cs.wikipedia.org/wiki/D%C4%9Bln%C3%ADk_a_kolchoznice","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/The_Worker_and_Kolkhoz_Woman.jpg","page_title":"Dělník a kolchoznice","context_page_description":"Dělník a kolchoznice je monumentální sousoší ve stylu socialistického realismu. Dílo vytvořila v roce 1937 sochařka Věra Muchinová pro světovou výstavu v Paříži. Pomník se nachází v Moskvě."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D0%B2%D1%84%D0%B8%D0%BC%D0%B8%D0%B9_%D0%97%D0%B8%D0%B3%D0%B0%D0%B1%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Euthymius_Zigabenus%2C_Orthodoxae_fidei_panoplia_dogmatica.png","page_title":"Евфимий Зигабен","context_page_description":"Евфи́мий Зигабе́н — византийский богослов и экзегет.\\nСначала блестящий придворный, потом монах. Написал историю всех существовавших в то время ересей, начиная от Симона Волхва до ислама, с их краткими опровержениями, заимствованными из произведений Отцов Церкви. Характер этого сочинения — вполне компилятивный. Толкования 3игабена на четвероевангелие, а также на псалмы и Песнь песней богословская критика оценила довольно высоко. Все его сочинения собраны в Patrologia Graeca Миня."},{"page_url":"https://cy.wikipedia.org/wiki/Guillaume_Philippe_Benoist","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Portrait_of_Sr._John_Phillips_Bart_%284669884%29.jpg","page_title":"Guillaume Philippe Benoist","context_page_description":"Gwneuthurwr printiau a gwerthwr printiau o Ffrainc oedd Guillaume Philippe Benoist. Cafodd ei eni yn Coutances yn 1725 a bu farw yn Llundain.\\nMae yna enghreifftiau o waith Guillaume Philippe Benoist yng nghasgliad portreadau Llyfrgell Genedlaethol Cymru a hefyd yng nghasgliad Yr Oriel Bortreadau Genedlaethol yn Llundain."},{"page_url":"https://uz.wikipedia.org/wiki/Kanada_federal_saylovi_(2011)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Canada_fed_election_2011_results_by_riding.svg","page_title":"Kanada federal saylovi (2011)","context_page_description":"2011-yilgi Kanada federal saylovi Kanadada oʻtkazilgan 41-umumiy parlament saylovi boʻlib, 2011-yil 2-mayida boʻlib oʻtdi. Natijalar Kanada Konservativ Partiyasi parlamentda oʻz nufuzlarini oshirishgani, 167 oʻrin egallab, koʻpchilikni tashkil etganini koʻrsatdi. Bosh vazir Stephen Harper mansabida qoldi. Qolgan oʻrinlarni Yangi Demokratlar, Liberallar, Kvebek separatistlari hamda Yashillar egallashdi. Saylovda ovoz beruvchi aholining 61.4%i qatnashdi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%91%D1%80,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Bundesarchiv_Bild_183-2008-0915-500%2C_Alexander_L%C3%B6hr.jpg","page_title":"Лёр, Александер","context_page_description":"Александер Лёр — австрийский, затем немецкий офицер, участник Первой и Второй мировых войн, генерал-полковник, кавалер Рыцарского креста с Дубовыми листьями."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%B4%D0%B5%D1%80%D0%BD%D0%B5-%D0%B4%D0%B5-%D0%90%D0%BB%D1%8C%D1%8F%D1%80%D0%B8%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Situacion_Paderne_de_Allariz.PNG","page_title":"Падерне-де-Альярис","context_page_description":"Падерне-де-Альярис — муниципалитет в Испании, входит в провинцию Оренсе в составе автономного сообщества Галисия. Муниципалитет находится в составе района Альярис-Маседа. Занимает площадь 38,76 км². Население 1604 человека."},{"page_url":"https://it.wikipedia.org/wiki/Insetti_pronubi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Episyrphus_balteatus_-_head_close-up_%28aka%29.jpg","page_title":"Insetti pronubi","context_page_description":"Si definiscono insetti prònubi quegli insetti che trasportano il polline da un fiore all'altro permettendo l'impollinazione e la conseguente formazione del frutto.\\nSono molti gli insetti in grado di svolgere questo compito, tra cui i più importanti sono sicuramente le api."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D9%83%D9%84%D8%A7%D9%86%D8%AF_(%D9%85%D9%82%D8%A7%D8%B7%D8%B9%D8%A9_%D9%85%D8%A7%D9%86%D9%8A%D8%AA%D9%88%D9%88%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/WIMap-doton-Rockland_c.png","page_title":"روكلاند (مقاطعة مانيتووك)","context_page_description":"روكلاند، مقاطعة مانيتووك ‏ هي بلدة تقع بولاية ويسكونسن في الولايات المتحدة. تبلغ مساحتها 92، وترتفع عن سطح البحر 246 م، بلغ عدد سكانها 896 نسمة في عام 2000 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 10 نسمة/كم²."},{"page_url":"https://en.wikipedia.org/wiki/Miniature_Schnauzer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Schnauzer_welp.jpg","page_title":"Miniature Schnauzer","context_page_description":"The Miniature Schnauzer is a breed of small dog of the Schnauzer type that originated in Germany in the mid-to-late 19th century. Miniature Schnauzers may have been developed from the smallest specimens of the Standard Schnauzer, or crosses between the Standard and one or more smaller breeds such as the Affenpinscher, Miniature Pinscher, and Poodles, as farmers bred a small dog that was an efficient ratting dog. They are described as \\"spunky\\" but aloof dogs, with good guarding tendencies without some guard dogs' predisposition to bite. Miniature Schnauzers are recognized in four colors internationally: solid black, black and silver, salt and pepper, and white.\\nIt is the most popular Schnauzer breed, and remains one of the most popular worldwide, primarily for its temperament and relatively small size. As of 2017 it is the 17th most popular breed in the U.S."},{"page_url":"https://en.wikipedia.org/wiki/Salmon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Time_series_for_global_capture_of_true_salmon.png","page_title":"Salmon","context_page_description":"Salmon is the common name for several species of ray-finned fish in the family Salmonidae. Other fish in the same family include trout, char, grayling and whitefish. Salmon are native to tributaries of the North Atlantic and Pacific Ocean. Many species of salmon have been introduced into non-native environments such as the Great Lakes of North America and Patagonia in South America. Salmon are intensively farmed in many parts of the world.\\nTypically, salmon are anadromous: they hatch in fresh water, migrate to the ocean, then return to fresh water to reproduce. However, populations of several species are restricted to fresh water through their lives. Folklore has it that the fish return to the exact spot where they hatched to spawn. Tracking studies have shown this to be mostly true. A portion of a returning salmon run may stray and spawn in different freshwater systems; the percent of straying depends on the species of salmon. Homing behavior has been shown to depend on olfactory memory. Salmon date back to the Neogene."},{"page_url":"https://fr.wikipedia.org/wiki/L%27%C3%89cho_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Femme-au-journal_sepia.jpg","page_title":"L'Écho de Paris","context_page_description":"L'Écho de Paris est un quotidien français créé sous la Troisième République, publié entre 1884 et 1944, avec une orientation plutôt conservatrice et patriotique. Il a eu comme propriétaire le richissime Edmond Blanc."},{"page_url":"https://it.wikipedia.org/wiki/Bassem_Amin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Amin%2C_Bassem_%2829532389132%29.jpg","page_title":"Bassem Amin","context_page_description":"Bassem Amin è uno scacchista egiziano, Grande Maestro, Campione africano assoluto nel 2009, 2013, 2015, 2017 e 2018.\\nNella lista FIDE di gennaio 2019 ha raggiunto il proprio record Elo, con 2712 punti, primo giocatore africano e 35º al mondo, unico giocatore africano a superare la soglia dei 2700 punti che informalmente definisce i SuperGM."},{"page_url":"https://ja.wikipedia.org/wiki/9%E6%9C%8816%E6%97%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Engelbert_Kaempfer.jpg","page_title":"9月16日","context_page_description":"9月16日はグレゴリオ暦で年始から259日目にあたり、年末まであと106日ある。"},{"page_url":"https://el.wikipedia.org/wiki/Black_Ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/ACDC_-_Toronto_November_7%2C_2008.JPG","page_title":"Black Ice","context_page_description":"Black Ice είναι ο τίτλος του 14ου στούντιο δίσκου του Αυστραλιανού hard rock συγκροτήματος AC/DC, ο οποίος κυκλοφόρησε στις 17 Οκτωβρίου του 2008 μέσω της δισκογραφικής εταιρείας \\"Columbia\\"."},{"page_url":"https://ca.wikipedia.org/wiki/Crenicichla_saxatilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/PSM_V68_D531_Crenicichla_saxatilis_of_the_chiclidae.png","page_title":"Crenicichla saxatilis","context_page_description":"Crenicichla saxatilis és una espècie de peix de la família dels cíclids i de l'ordre dels perciformes."},{"page_url":"https://es.wikipedia.org/wiki/Roseanne_Barr","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Roseanne_barr.jpg","page_title":"Roseanne Barr","context_page_description":"Roseanne Cherrie Barr es una actriz, comediante, escritora y productora de televisión estadounidense. Barr comenzó su carrera en el stand comedy antes de ganar elogios en la comedia de televisión Roseanne. Ella ganó un Emmy y un Globo de Oro a la Mejor Actriz por su trabajo en el programa.\\nRoseanne fue revivida en 2018 en ABC. Un éxito de audiencia, se renovó por una temporada adicional, pero se canceló después de que Barr hizo un controvertido tweet condenado como racista por muchos comentaristas. Barr se refirió al tuit como un \\"mal chiste\\". ​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B3%D0%BB-%D0%9F%D0%B0%D1%81%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Old_map-Eagle_Pass-1887.jpg","page_title":"Игл-Пасс","context_page_description":"Игл-Пасс — город в США, расположенный в южной части штата Техас, административный центр округа Мэверик. По данным переписи за 2010 год число жителей составляло 26 248 человек, по оценке Бюро переписи США в 2017 году в городе проживало 28 945 человек."},{"page_url":"https://hu.wikipedia.org/wiki/Brit_tengeralattj%C3%A1r%C3%B3k_a_Balti-tengeren_(I._vil%C3%A1gh%C3%A1bor%C3%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/British_submarine_E_13.jpg","page_title":"Brit tengeralattjárók a Balti-tengeren (I. világháború)","context_page_description":"A brit admiralitás 1915-ben elhatározta, hogy új tengeri-frontot nyit a Balti-tengeren, ezért először hét darab E osztályú tengeralattjárót, majd négy C osztályú tengeralattjárót küldött a térségbe. A hajók kezdetben sikereket értek el, de 1916-tól lényegében nem tudtak jelentős eredményeket felmutatni, a szárazföldi német előrenyomulás következtében a Finn-öbölbe szorultak vissza. A breszt-litovszki béke aláírását követően a brit admiralitás utasította a megmaradt brit tengeralattjárók legénységét, hogy Arhangelszken át térjenek haza. Ezt követően a legénység elsüllyesztette hajóit."},{"page_url":"https://ro.wikipedia.org/wiki/Villingen-Schwenningen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Villinger_Riettor.jpg","page_title":"Villingen-Schwenningen","context_page_description":"Villingen-Schwenningen este o localitate situată în sud-vestul landului Baden-Württemberg, Germania. Cu 85.000 de locuitori este oraș-district și cel mai mare oraș al districtului Schwarzwald-Baar."},{"page_url":"https://de.wikipedia.org/wiki/Oreocereus_trollii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Oreocereus_trollii_1.jpg","page_title":"Oreocereus trollii","context_page_description":"Oreocereus trollii ist eine Pflanzenart aus der Gattung Oreocereus in der Familie der Kakteengewächse. Der Artname ehrt den Pflanzengeographen Carl Troll."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%AB%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/RALSE_mart.jpg","page_title":"ラルズ","context_page_description":"株式会社ラルズは、北海道の道央地区を中心にスーパーマーケット「スーパーアークス」「ビッグハウス」「ラルズプラザ」などを展開するアークスグループの中核企業。本社は、札幌市中央区南13条西11丁目2-32。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%AA%D8%A7_%D8%A3%D8%B2%D8%B1%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Pitta_cyanea_1_-_Khao_Yai.jpg","page_title":"بيتا أزرق","context_page_description":"بيتا أزرق ‏ هي نوع من الطيور تتبع جنس البيتا المخطط من فصيلة طيور البيتا. يتواجد هذا النوع من الطيور في بنغلاديش وبوتان وكمبوديا والصين والهند ولاوس وميانمار وتايلاند وفيتنام. الموائل الطبيعية هي الغابات والأراضي المنخفضة شبه الاستوائية أو المدارية الرطبة والغابات الجبلية أو شبه المدارية الرطبة."},{"page_url":"https://pl.wikipedia.org/wiki/Zofia_Trzci%C5%84ska-Kami%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Poznan_pomnik_koscuszko.jpg","page_title":"Zofia Trzcińska-Kamińska","context_page_description":"Zofia Trzcińska-Kamińska – polska rzeźbiarka i medalierka. Należała do grup „Młoda Sztuka” i „Rytm”."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BB%D0%B5%D0%B1_(%D0%BC%D1%83%D1%85%D0%B0%D1%84%D0%B0%D0%B7%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Al_Bab_District.png","page_title":"Халеб (мухафаза)","context_page_description":"Ха́леб — одна из 14 мухафаз на севере Сирии. Административный центр — город Алеппо. Площадь — 18 498 км², население — 4 868 000 человек."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%83%A5%E3%82%A6%E3%82%B7%E3%83%A5%E3%82%A6%E3%83%92%E3%83%A1%E3%82%AA%E3%82%AA%E3%82%AF%E3%83%AF%E3%82%AC%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Dorcus_montivagus_adachii_2007_Kagoshima.jpg","page_title":"キュウシュウヒメオオクワガタ","context_page_description":"キュウシュウヒメオオクワガタ は甲虫目クワガタムシ科オオクワガタ属に属するヒメオオクワガタの1亜種である。"},{"page_url":"https://be.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82_%D0%86%D0%B2%D0%B0%D0%BD%D0%B0%D0%B2%D1%96%D1%87_%D0%A0%D0%BE%D0%BB%D0%B0%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/%D0%90%D0%BD%D1%82%D0%BE%D0%BD%D0%B8%D0%BD%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0_%D0%A0%D0%BE%D0%BB%D0%B0%D0%BD%D0%B4_%28%D1%84%D0%BE%D0%BD_%D0%A4%D0%B5%D1%82%D1%82%D0%B8%D0%BD%D0%B3%29.jpg","page_title":"Роберт Іванавіч Роланд","context_page_description":"Роберт Іванавіч Роланд — урач губернскай управы горада Магілёва, магілёўскі губернскі ўрачэбны інспектар."},{"page_url":"https://fi.wikipedia.org/wiki/Laivanrakennus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Museum_f%C3%BCr_Antike_Schifffahrt%2C_Mainz_01._Spritsail.jpg","page_title":"Laivanrakennus","context_page_description":"Laivanrakennus on hyvin vanha taito, joka on historian myötä kehittynyt laivoja telakoilla rakentavaksi teollisuudenalaksi. Ihmisillä on riittänyt rohkeutta lähteä vesille jo hyvin varhain. Kannusteena lienee ollut pääsy paremmille kalavesille ja metsästysmaille. Jo pronssikautiset punoksilla sidotut laidoitetut veneet, kuten Ferribyn veneet, ovat olleet taitavasti tehtyjä ja niillä on lähdetty pitkille matkoille. Laivanrakennustaito on kehittynyt eri puolilla maailmaa toisistaan riippumatta ja historian aikana on havaittavissa monenlaisia perinteitä veneiden ja laivojen rakenteissa. Sodankäynti ja kilpavarustelu on usein ollut laivanrakennuksen kehittämisen motiivina. Vuosituhansia laivoja tehtiin puusta ja ne kulkivat purjeilla tai soutajien voimalla. 1800-luvulla voimanlähteeksi tuli vähitellen höyrykone ja rungon rakennemateriaaliksi teräs. 1900-luvulla käyttövoimana on ollut höyryturbiini, dieselmoottori ja joissakin laivoissa myös ydinvoima. Laivanrakennusmestarit olivat ensimmäisten joukossa julkisesti auktorisoituja ammattilaisia. Merellä kulkevan laivan käyttöikä on joitakin kymmeniä vuosia, joten jatkuva uudistaminen on välttämätöntä."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BA%D0%BE%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D0%B9,_%D0%BA%D0%BE%D1%82%D0%B8%D1%80%D1%83%D1%8E%D1%89%D0%B8%D1%85%D1%81%D1%8F_%D0%BD%D0%B0_%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B9_%D1%84%D0%BE%D0%BD%D0%B4%D0%BE%D0%B2%D0%BE%D0%B9_%D0%B1%D0%B8%D1%80%D0%B6%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Oyu_Tolgoi_23.JPG","page_title":"Список компаний, котирующихся на Монгольской фондовой бирже","context_page_description":"Это список компаний, котирующихся на монгольской фондовой бирже, названных по-английски и монгольски, указаны склад, коды, промышленность, как это отражено на официальном сайте биржи. Список не включают информацию о компаниях, которые были исключены до 12 сентября 2007 года.\\nМонгольская фондовая биржа, основанная в 1991 году Улан-Баторе, Монголия, является самой маленькой фондовой биржей в мире по рыночной капитализации. Его перечисленных компаний рыночная капитализация составляла около 1 миллиарда долларов США в 2010 году на 336 листинговых компаний. Монгольская фондовая биржа является единственной фондовой биржей Монголии, на которой ежедневно идут торги по акциям около 350 монгольских эмитентов с общей капитализацией почти 448,3 миллиард тугриков. В состав участников торгов МФБ входят около 45 организаций — профессиональных участников рынка ценных бумаг, клиентами которых являются более 400 тысяч инвесторов.\\nБиржа входит в Федерацию фондовых бирж Азии и Океании."},{"page_url":"https://vec.wikipedia.org/wiki/Br%C3%A9tigny-sur-Orge","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Mairie_Bretigny.JPG","page_title":"Brétigny-sur-Orge","context_page_description":"Brétigny-sur-Orge el xé on comun de 26 528 abitanti del departemento de Essonne che el fa parte del rejon Île-de-France in Fransa."},{"page_url":"https://de.wikipedia.org/wiki/Neues_Rathaus_(Nordhausen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Roland.jpg","page_title":"Neues Rathaus (Nordhausen)","context_page_description":"Das Neue Rathaus der thüringischen Kreisstadt Nordhausen wurde 1936 bis 1937 erbaut und 1937 eingeweiht. Es ist der Sitz der Stadtverwaltung.\\nDas Gebäude liegt am Markt 15, an dem sich direkt gegenüber das Alte Rathaus mit dem Roland davor sowie das Stadthaus befinden. Das Neue Rathaus wurde bei den Luftangriffen auf Nordhausen im April 1945 schwer beschädigt. Nach dem Wiederaufbau wurde am 12. Oktober 1946 das erste Obergeschoss der Stadtverwaltung wieder übergeben. Das Gebäude besitzt neben seiner eigentlichen Funktion auch öffentliche Ausstellungsräume, wie den Bürgersaal, und einen gastronomischen Betrieb im „Ratskeller“.\\nIm Neuen Rathaus ist die Original-Roland-Statue aus dem Jahr 1717 ausgestellt, während sich auf dem Marktplatz eine Replik aus Epoxidharz befindet.\\nIm Sommer 1997 zog das Stadtarchiv Nordhausen in das Neue Rathaus um."},{"page_url":"https://la.wikipedia.org/wiki/Imidazolum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Imidazole-3D-balls.png","page_title":"Imidazolum","context_page_description":"Imidazolum est compositum chemicum organicum. Heterocyclus ista est anulus chemicus cum atomis carbonii tribus et duobus nitrogenii formulae summarum C₃N₂C₄."},{"page_url":"https://en.wikipedia.org/wiki/2012_United_States_Senate_elections","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Charles_E._Summers_II.jpg","page_title":"2012 United States Senate elections","context_page_description":"The 2012 United States Senate elections were held on November 6, 2012, with 33 of the 100 seats in the Senate being contested in regular elections whose winners would serve six-year terms beginning January 3, 2013, with the 113th Congress. Democrats had 21 seats up for election, plus 1 Independent and 1 Independent Democrat, while the Republicans had only 10 seats up for election. The Democrats gained Republican-held seats in Massachusetts and Indiana and one from an Independent Democrat in Connecticut, leaving them with a total of 53 seats. Additionally, they held open seats in Hawaii, New Mexico, North Dakota, Virginia and Wisconsin. The Republicans, despite losing two of their seats, picked up an open seat in Nebraska and retained open seats in Arizona and Texas, ending with a total of 45 seats. The Independents retained a seat in Vermont and gained an additional seat from the Republicans in Maine, bringing their total to 2 seats. Both Independents would caucus with the Democrats, forming a majority caucus with a combined total of 55 seats.\\nAs of 2020, this is the last time Democrats won control of the Senate."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%99%88%E5%A0%83%F0%A8%B1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Wang_Xuan_statue%2C_Wuxi_Museum.jpg","page_title":"陈堃𨱇","context_page_description":"陈堃𨱇，上海人，计算机科学家，北京大学计算机科学技术研究所教授。著名计算机科学家王选之妻。"},{"page_url":"https://en.wikipedia.org/wiki/Ashok_Kumar_Das","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ashok_Kumar_Das_MLA_Odisha.jpg","page_title":"Ashok Kumar Das","context_page_description":"Ashok Kumar Das is an Indian politician. He joined the Jay Prakash Movement in 1974 and was political Prisoner under MISA. He was member of Swatantra Party, Utkal Congress, Janata Party, Janata Party, Janata Dal, Biju Janata Dal then Janata Dal.\\nHe was elected to the Odisha Legislative Assembly from Korei in the 1974, 1977, 1990, 1995 and 2000.\\nHe was Leaders of Opposition in Odisha Legislative Assembly from 1996 to 1997 post death of Biju Patnaik."},{"page_url":"https://simple.wikipedia.org/wiki/Lucho_Gonz%C3%A1lez","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Lucho_Gonzalez_%28OM%29.jpg","page_title":"Lucho González","context_page_description":"Lucho González is an Argentine football player. He plays for Olympique Marseille and Argentina national team."},{"page_url":"https://tr.wikipedia.org/wiki/TCG_Kemalreis_(F-247)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Tur_F247.jpg","page_title":"TCG Kemalreis (F-247)","context_page_description":"TCG Kemalreis (F-247), Türk Deniz Kuvvetleri'nin Barbaros sınıfı fırkateynlerinden biridir. 1998 yılında denize indirilen ve 2000 yılında hizmete giren TCG Kemalreis (F-247), 118 metre uzunluktadır. Fırkateynde 24 subay, 100 astsubay, 8 uzman erbaş, 61 erbaş/er görev yapmaktadır."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%84%D1%96%D1%86%D1%96%D0%B9%D0%BD%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D0%BB%D1%96%D0%BA_%D1%80%D0%B5%D0%B3%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE_%D1%80%D1%96%D0%B4%D0%BA%D1%96%D1%81%D0%BD%D0%B8%D1%85_%D1%82%D0%B2%D0%B0%D1%80%D0%B8%D0%BD_%D0%9B%D1%8C%D0%B2%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/LeucorrhiniaAlbifrons.jpg","page_title":"Офіційний перелік регіонально рідкісних тварин Львівської області","context_page_description":"Офіційний перелік регіонально рідкісних тварин Львівської області — список, що містить перелік видів тварин, які не занесені до Червоної книги України, але є рідкісними або такими, що перебувають під загрозою зникнення на території Львівської області."},{"page_url":"https://it.wikipedia.org/wiki/Casino_Nobile","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Roma_Villa_Torlonia_-_Casino_nobile_2.JPG","page_title":"Casino Nobile","context_page_description":"Il Casino Nobile o Casino Principale è un edificio di Villa Torlonia, villa di Via Nomentana a Roma.\\nDall'ingresso della Villa si accede mediante un piccolo vialetto alberato in terra battuta e ghiaia che immette ad uno scalone che a sua volta introduce ad un ampio spiazzale ov'è l'ingresso del Casino.\\nUna particolarità, la biglietteria del Casino Nobile è direttamente sullo spiazzale d'accesso di Villa Torlonia."},{"page_url":"https://eo.wikipedia.org/wiki/Kviteseid","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Bandak_fraa_Riksveg_45.jpg","page_title":"Kviteseid","context_page_description":"Kviteseid estas komunumo de Norvegio. Ĝi apartenas al la departemento Telemark. Fine de 2016 en la komunumo vivis 2 448 loĝantoj. Parto de la komunuma teritorio estas la lago Bandak."},{"page_url":"https://fr.wikipedia.org/wiki/Les_M%C3%A9tairies","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/LesM%C3%A9tairies2.JPG","page_title":"Les Métairies","context_page_description":"Les Métairies est une commune du Sud-Ouest de la France, située dans le département de la Charente."},{"page_url":"https://oc.wikipedia.org/wiki/Sant_Cierge_la_Serre","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/2017-06-04_Saint-Cierge-la-Serre_%2814%29.JPG","page_title":"Sant Cierge la Serre","context_page_description":"Sant Cierge la Serre es una comuna occitana de Vivarés situada dins lo departament d'Ardecha e la region de Ròse-Aups."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A4%D1%80%D0%BE%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Western_front_1915-16.jpg","page_title":"Фронт","context_page_description":"Фронт у најширем значењу представља простор на којој се води оружана борба, без обзира на величину јединица, употребљена средства, географске и друге објекте, време и сл.\\nУ борбеном поретку представља део снага и земљишни простор на којем се води борба.\\nФронтом се назива и стратегијска групација, јачине три до шест армија. Јавља се у Првом светском рату у руској војсци, а користе га као форму стратегијског груписања јединица и пољска и совјетска армија, током Пољско-совјетског рата, почетком 1920их година. Велики број стратегијских групација под називом \\"фронт“ постојао је у совјетској Црвеној армији током Другог светског рата.\\nУ неким армијама света фронт одговара називу група армија."},{"page_url":"https://et.wikipedia.org/wiki/Kontinentaalblokaad","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Europa_1815.svg","page_title":"Kontinentaalblokaad","context_page_description":"Kontinentaalblokaad oli 21. novembril 1806 Berliinis Napoleon I algatusel välja kuulutatud majandusblokaad Suurbritanniale, vastuseks 16. mail 1806 kehtestatud mereblokaadile.\\nLõpetati Euroopa mandri ja Briti saarte vahelised kaubandussuhted, et Suurbritannia majandust nõrgestada. See oli ettevalmistus Suurbritannia vallutamiseks.\\nBlokaad lõpetati novembris 1814."},{"page_url":"https://de.wikipedia.org/wiki/Balthasar_Gloxin_(Jurist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/WP_Balthasar_Gloxin.jpg","page_title":"Balthasar Gloxin (Jurist)","context_page_description":"Balthasar Gloxin war ein deutscher Jurist und herzoglicher Rat."},{"page_url":"https://nl.wikipedia.org/wiki/Tenthredo_distinguenda","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Tenthredo.distinguenda.-.lindsey.jpg","page_title":"Tenthredo distinguenda","context_page_description":"Tenthredo distinguenda is een vliesvleugelig insect uit de familie van de bladwespen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1885 door Stein."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8A%BC%E4%B8%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Toei_Asakusa_line_symbol.svg","page_title":"押上站","context_page_description":"押上車站是位於日本東京都墨田區押上一丁目，屬於京成電鐵、東京都交通局、東京地下鐵、東武鐵道的鐵路車站。\\n東京晴空塔城開業後，2012年5月22日以後，所有公司引入共同作為副站名的「晴空塔前」。"},{"page_url":"https://pt.wikipedia.org/wiki/Reino_de_Matar%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Java_-_Candi_Ngawen_-_001_%288667529348%29.jpg","page_title":"Reino de Matarão","context_page_description":"O Reino de Matarão ou de Medangue foi um estado do Sudeste Asiático hindu-budista que floresceu entre os séculos VIII e X na ilha de Java. Inicialmente esteve centrado em Java Central e mais tarde em Java Oriental. Foi fundado pelo rei Sanjaia e foi governado pela dinastia Sailendra.\\nDurante a maior parte da sua história, aparentemente o reino dependeu fortemente da agricultura, em especial da cultura extensiva de arroz, e no período mais tardio também beneficiou do comércio marítimo. De acordo com fontes estrangeiras e achados arqueológicos, o estado parece ter ter sido bastante populoso e próspero. Desenvolveu uma sociedade complexa e uma cultura avançada, tendo alcançado um elevado nível de sofisticação e uma civilização requintada.\\nNo período entre o final do século VIII e meados do século IX, o reino assistiu ao florescimento da arte e arquitetura clássicas javanesa, testemunhada pelo rápido crescimento da construção de templos espalhados pela paisagem do coração do seu território, nas regiões próximas da atual Joguejacarta, nomeadamente nas planícies de Prambanã e de Kedu. Os templos mais notáveis construídos pelo Reino de Matarão são Kalasan, Sewu, Borobudur e Prambanan."},{"page_url":"https://ca.wikipedia.org/wiki/Der_Tagesspiegel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Tagesspiegel-Geb%C3%A4ude_an_der_Potdamer_Stra%C3%9Fe.jpg","page_title":"Der Tagesspiegel","context_page_description":"Der Tagesspiegel és un periòdic alemany liberal clàssic. Fundat el 27 de setembre de 1945 per Erik Reger, Karsch Walther, i Redslob Edwin, l'oficina principal del Tagesspiegel es troba a la Potsdamer Strasse de Berlín, al barri de Tiergarten, a menys d'un quilòmetre de la Potsdamer Platz i l'antiga ubicació del Mur de Berlín. També té oficines regionals de corresponsals a Washington DC i Potsdam. És l'únic diari important de la capital que ha augmentat el seu tiratge -ara 148000- des de la reunificació.\\nDurant més de 45 anys, Der Tagesspiegel fou propietat d'una organització independent. El 1993, en resposta a un entorn cada vegada més competitiu en la premsa, i per atreure les inversions necessàries per a la modernització tècnica, com l'encàrrec d'una nova planta d'impressió i la millora de la distribució, va ser comprat pel Grup Editorial Holtzbrinck. El seu editor actual és Stefan von Holtzbrinck, i té cinc caps de redacció, Stephan-Andreas Casdorff i Lorenz Maroldt, que es va destacar per utilitzar la desafortunada frase \\"Entartete\\" Werkstatt der Kulturen, en descriure una institució cultural multiètnica a Berlín."},{"page_url":"https://it.wikipedia.org/wiki/Scholars_at_Risk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Anne_Frank_Awards_2017_%2837160905931%29.jpg","page_title":"Scholars at Risk","context_page_description":"Scholars at Risk è una rete internazionale di istituti di istruzione superiore con sede negli Stati Uniti. SAR sostiene e difende i principi della libertà accademica. La rete comprende oltre 400 istituti di istruzione superiore in 39 paesi. La sezione nazionale SAR Italia si è costituita nel 2019."},{"page_url":"https://vi.wikipedia.org/wiki/Magnolia_Springs,_Alabama","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/St._Paul%27s_Episcopal_Magnolia_Springs_May_2013_1.jpg","page_title":"Magnolia Springs, Alabama","context_page_description":"Magnolia Springs là một thị trấn thuộc quận Baldwin, tiểu bang Alabama, Hoa Kỳ. Dân số năm 2009 là 684 người, mật độ đạt 295 người/km²."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D5%B8%D6%82%D5%BF%D5%A2%D5%B8%D5%AC%D5%AB_%D4%B5%D5%BE%D6%80%D5%B8%D5%BA%D5%A1%D5%B5%D5%AB_%D5%A1%D5%BC%D5%A1%D5%BB%D5%B6%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Germany_vs_Poland_0-0_%2827103531294%29.jpg","page_title":"Ֆուտբոլի Եվրոպայի առաջնություն 2016","context_page_description":"Ֆուտբոլի Եվրոպայի առաջնություն 2016, Ֆուտբոլի Եվրոպայի առաջնություն 15-րդ խաղարկությունն էր, որն անցկացվեց Ֆրանսիայում 2016 թվականի հունիսի 10-ից մինչև հուլիսի 10-ը։ Գործող չեմպիոն Իսպանիան պարտվեց Իտալիային 1/8 եզրափակչում 0-2 հաշվով։ Առաջնության հաղթող դարձավ Պորտուգալիան, որը եզրափակչում հաղթեց առաջնության ընդունող երկրին \` Ֆրանսիային 1-0 հաշվով, եզրափակիչը տեղի ունեցավ Փարիզի Ստադ դը Ֆրանս մարզադաշտում:\\nԱռաջնությունում առաջին անգամ մրցեցին 24 հավաքական նախկին 16-ի փոխարեն: Նախկին ձևաչափը գործում էր սկսած 1996 թվականի Եվրոպայի առաջնությունից։ Այս ձևաչափով եզրափակիչ փուլ հասած հավաքականներից կազմվռց վեց խումբ, որից հետո եղավ փլեյ-օֆֆի երեք փուլ և եզրափակիչ։ 19 հավաքական միացան Ֆրանսիային որակավորման փուլի արդյունքներով և մասնակցեցին առաջնության եզրափակիչ փուլին, ևս 4 հավաքական հայտնի դարձան 2015 թվականի նոյեմբերին լրացուցիչ խաղերի արդյունքում։\\nՖրանսիան ընտրվել է որպես ընդունող երկիր 2010 թվականի մայիսի 28-ին՝ հայտերի գործընթացից հետո, երբ Ֆրանսիան առաջ անցավ Իտալիայից և Թուրքիայից։ Բոլոր խաղերը կկայանան տասը քաղաքների տասը մարզադաշտերում՝ Բորդո, Լանս, Լիլ, Լիոն, Մարսել, Նիս, Փարիզ, Սեն-Դենի, Սենտ Էտիեն և Թուլուզ։"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B0%E0%AF%8B%E0%AE%B7%E0%AF%8D_%E0%AE%B9%E0%AE%B7%E0%AE%BE%E0%AE%A9%E0%AE%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Liten_askenasisk_sjofar_5380.jpg","page_title":"ரோஷ் ஹஷானா","context_page_description":"ரோஷ் ஹஷானா, என்பது யூதப் புதுவருடம் ஆகும். இது அதி பரிசுத்த நாட்களில் முதலாவது ஆகும். ரோஷ் ஹஷானா வடக்கு அரைக்கோளத்தின் ஆரம்ப இலையுதிர் காலத்தில் இடம்பெறுகிறது. இரண்டு நாட்கள் கொண்டாடப்படும் ரோஷ் ஹஷானா, யூத நாட்காட்டியில் முதல் முதல் மாதமான திஸ்ரி மாதத்தின் முதல் தினத்தில் ஆரம்பமாகும். இந்த நாள் ஆதாம், ஏவாளின் படைப்பின் ஆண்டு விழா எனவும், அவர்கள் கடவுளின் உலகில் மனித குலத்தின் பங்கு பற்றி உணர்ந்த செயல்பட்டதும் என நம்பப்படுகின்றது. ரோஷ் ஹஷானாவில் சோபார் ஊதக் கேட்டல், அடையாள உணவாக தேனில் அமிழ்த்தி எடுக்கப்பட்ட அப்பிளை உண்ணல் என்பன நடைமுறையாகும். \\"ஷனா டோவா\\" என்பது இந்த நாளில் வாழ்த்தும் முறையாகும்."},{"page_url":"https://cy.wikipedia.org/wiki/Rhestr_o_bobl_a_anwyd_yng_Ngweriniaeth_Iwerddon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Joseph_Mary_Plunkett.jpg","page_title":"Rhestr o bobl a anwyd yng Ngweriniaeth Iwerddon","context_page_description":"Diwedd y rhestr a gynhyrchwyd yn otomatig o Wicidata."},{"page_url":"https://ro.wikipedia.org/wiki/Limba_galic%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Tablette_de_d%C3%A9fixion_de_l%27Hospitalet-du-Larzac_2.jpg","page_title":"Limba galică","context_page_description":"Limba galică este o limbă celtică dispărută, care a fost vorbită de către gali, poporul care locuia regiunea cunoscută ca Galia din Epoca Fierului până în perioadă romană. Aria vorbitoare de galică a acoperit teritoriile care aparțin astăzi mai multor țări din Europa Occidentală, inclusiv Franța, Elveția, partea septentrională a Italiei, partea orientală a Belgiei, Luxembourg și partea occidentală a Germaniei.\\nDupă cucerirea romană a Galiei, limba galică a subzistat în popor, amestecându-se cu limba latină și în urmă fiind înlocuită aproape complet de varianta vulgară a limbii Imperiului și de limbi germanice diverse între secolul IV și secolul VI Elementele lexicului galic au fost păstrate mai ales în limba franceză în forma de substrat lexical conținând între 180 și 400 de cuvinte și în toponimie, dat faptul că cuceritorii romani de obicei au adaptat numele galice ale localităților din cauza apropierii morfologice a limbilor.\\nGalica este clasificată împreună cu limba celtiberică în subfamilia continentală a limbilor celtice. Majoritatea inscripțiilor descoperite arată de asemenea că a trebuit să aparțină și limbilor P-celtice."},{"page_url":"https://fi.wikipedia.org/wiki/J%C3%A4ms%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Aamu_Kankarisvesi_Patalanselk%C3%A4_J%C3%A4ms%C3%A4_300716.png","page_title":"Jämsä","context_page_description":"Jämsä on Suomen kaupunki, joka sijaitsee Keski-Suomen maakunnan eteläosassa Suomen toiseksi suurimman järven Päijänteen länsirannalla. Kaupungissa asuu 20 120 henkilöä, ja sen pinta-ala on 1 823,91 km², josta 252,54 km² on vesistöjä. Väestötiheys on 12,8 asukasta/km².\\nJämsä on maakuntansa ainoa keskiaikainen pitäjä. Jämsän kunta perustettiin vuonna 1866, kauppalanoikeudet se sai vuonna 1969, ja kaupungiksi se muuttui vuonna 1977. Jämsän naapurikuntia ovat Juupajoki, Jyväskylä, Keuruu, Kuhmoinen, Luhanka, Mänttä-Vilppula, Orivesi ja Petäjävesi.\\nKuoreveden kunta liitettiin Jämsään 2001. Vuoden 2007 alusta liitettiin Pirkanmaan maakuntaan kuuluvan Längelmäen itäiset osat Jämsään ja läntiset osat Oriveden kaupunkiin. Jämsään liitetyllä alueella asui noin 2/3 Längelmäen asukkaista. Liitoksella ei ollut vaikutusta Pirkanmaan ja Keski-Suomen vaalipiireistä vuoden 2007 eduskuntavaaleissa valittavien kansanedustajien lukumäärään. Kuntaliitokset jatkuivat vuonna 2009, jolloin Jämsä ja Jämsänkoski liittyivät yhteen. Jämsänkoskeen oli vuoden 1969 alussa liitetty Koskenpään kunta. Uuden kaupungin nimeksi tuli Jämsä ja vaakunaksi Jämsänkosken vaakuna."},{"page_url":"https://en.wikipedia.org/wiki/Merton_London_Borough_Council","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Merton_London_Borough_Council_June_2019_by_election.png","page_title":"Merton London Borough Council","context_page_description":"Merton London Borough Council is the local authority for the London Borough of Merton in Greater London, England. It is one of the 32 councils that form Greater London."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B8%D0%BA%D0%B8%D0%BD%D0%B0,_%D0%9E%D0%BB%D1%8C%D0%B3%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Chikina_Olga.jpg","page_title":"Чикина, Ольга Сергеевна","context_page_description":"Ольга Чикина — российский автор и исполнитель песен, художник."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%91%D1%8A%D0%BB%D0%B3%D0%B0%D1%80%D1%81%D0%BA%D0%B8_%D1%82%D1%8A%D1%80%D0%B3%D0%BE%D0%B2%D1%81%D0%BA%D0%B8_%D0%B0%D0%B3%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%B0_%D0%B2_%D0%9E%D1%81%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%82%D0%B0_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Bulgarian_Trade_Agency_Bitolya_Document_1905.jpg","page_title":"Български търговски агентства в Османската империя","context_page_description":"Българските търговски агентства, а от 1909 година – консулства, са дипломатическите представителства на България в Османската империя в периода от 1897 до 1916 г."},{"page_url":"https://vi.wikipedia.org/wiki/Th%E1%BB%95_d%C3%A2n_t%E1%BA%A1i_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Indios_apiaka_no_rio_Arinos.jpg","page_title":"Thổ dân tại Brasil","context_page_description":"Thổ dân tại Brasil, hay Người Brasil gốc, gồm một nhóm nhiều sắc tộc sống tại vùng ngày nay là Brasil từ trước khi các đợt thám hiểm của Châu Âu diễn ra vào khoảng năm 1500. Khác với Christopher Columbus, người nghĩ mình đã tới Đông Ấn, những người Bồ Đào Nha, nổi tiếng nhất là Vasco da Gama, đã tới Ấn Độ trước bằng đường biển Ấn Độ Dương khi họ đến Brasil.\\nDù vậy, từ índios được dùng lúc đó để chỉ những người thuộc Tân Thế giới và tiếp tục được sử dụng ngày nay trong tiếng Bồ Đào Nha, trong khi những người Ấn Độ thực sự được gọi là indianos nhằm phân biệt hai người.\\nTại thời điểm tiếp xúc với người châu Âu, những người bản địa tại Brasil phần lớn theo truyền thống bán du mục trong những bộ lạc kiếm găn trên săn bắt, đánh cá, hái lượm và nông nghiệp. Rất nhiều trong số ước tính hơn 2,000 quốc gia và bộ lạc tồn tại trong thế kỷ thứ 16 bị biến mất vì cuộc thực dân hóa của châu Âu, và rất nhiều bị đồng hóa vào dân Brasil nói chung.\\nMột phần lớn dân số thổ dân bị biến mất bởi những dịch bệnh mà người châu Âu mang tới, từ đỉnh điểm của hằng triệu người của thời Colombo cho đến khoảng 300,000 vào năm 1997, ảnh hưởng khoảng 200 bộ lạc."},{"page_url":"https://fr.wikipedia.org/wiki/L%27Usine_(Gen%C3%A8ve)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Zoolusine.jpg","page_title":"L'Usine (Genève)","context_page_description":"L'Usine est un centre culturel alternatif et autogéré situé à Genève.\\nC'est aussi une structure regroupant 18 collectifs et associations qui a établi son siège dans l'ancienne usine genevoise de dégrossissage d'or, un bâtiment localisé au bord du Rhône, à proximité immédiate du Bâtiment des Forces motrices, et attribué par la commune à l'association État d'Urgences en 1989. L'association revendique une éthique de vie et de travail fondée sur « l'autogestion, le plaisir et l'ouverture aux autres ». Sa programmation se caractérise par son caractère novateur, en marge du marché et de sa logique de profit.\\nL'aspect le plus visible de l'Usine est la programmation de spectacles, manifestations, fêtes, concerts et expositions dans les différents lieux qui la composent : salles de concert, boîtes de nuit, galeries artistiques, théâtre, cinéma et diverses succursales consacrées au développement d'activités créatives et récréatives."},{"page_url":"https://hr.wikipedia.org/wiki/Ky%C5%A1tymska_katastrofa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Ostural-Spur.png","page_title":"Kyštymska katastrofa","context_page_description":"Kyštymska katastrofa je incident kontaminiranja radijacijom koji se dogodio 29. rujna 1957. u postrojenju za preradu nuklearnog goriva Majak u Rusiji. Ovaj incident je označen ocjenom 6 na međunarodnoj ljestvici nuklearnih događaja, što ga čini drugim najozbiljnijim nuklearnim incidentom ikada zabilježenim. Incident se dogodio u gradu Ozersku, zatvorenom gradu izgrađenom oko tvornice Majaka. Kako Ozersk / Majak nisu bili označeni na zemljovidima, katastrofa je dobila ime po Kyštymu, najbližem poznatom gradu."},{"page_url":"https://en.wikipedia.org/wiki/Irapuato","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Catedral-diocesis-irapuato.JPG","page_title":"Irapuato","context_page_description":"Irapuato is a Mexican city located at the foot of the Arandas Hill, in the central region of the state of Guanajuato. It lies between the Silao River and the Guanajuato River, a tributary of the Lerma River, at 1,724 m above sea level. It is located at 20°40′N 101°21′W. The city is the second-largest in the state, with a population of 342,561 according to the 2005 census, while its municipality has a population of 529,440. The municipality has an area of 845.16 km² and includes numerous smaller outlying communities. Although it is now an important center for regional trade and transportation center as well the site of several automotive and chemical manufacturing plants, the city's main industry has historically been agriculture and it has long been known for its strawberries and the raising of pigs and cattle. The fruits and flowers of Irapuato's luxurious gardens are well-known throughout Mexico."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%B1%D9%88%D9%87_%D9%86%DB%8C%D8%B3%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/NISSAN_ROOX_G.jpg","page_title":"گروه نیسان","context_page_description":"گروه نیسان شرکت خوشه‌ای ژاپنی است، که در حوزه‌های خودروسازی، صنایع سنگین، صنایع شیمیایی، ساخت تجهیزات نیروگاهی، سیستم‌های اطلاعاتی و مخابراتی، تولید تجهیزات الکترونیکی، ارائه خدمات مالی و بیمه، همچنین ساخت‌وساز املاک و مستغلات فعالیت می‌نماید. گروه نیسان در سال ۱۹۲۸ توسط کارآفرین ژاپنی؛ یوشیسوکه آیکاوا تأسیس شد.\\nدفتر مرکزی این شرکت در چیودا، توکیو، ژاپن قرار دارد. از شرکت‌های زیرمجموعه گروه نیسان می‌توان به: نیسان، هیتاچی، نیپون اویل، نیسان کمیکال، هیتاچی کنکی، هیتاچی زوسن، هیتاچی مکسل، یودی تراکس، نیسمو، داتسون، اینفینیتی و جی‌اکس هولدینگز اشاره کرد."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8D%87%E7%A6%A7%E8%89%BA%E5%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Starhill_Gallery.jpg","page_title":"升禧艺廊","context_page_description":"升禧艺廊，又称星同广场或升禧广场，是一座位在吉隆坡武吉免登的高级商场，于1996年开幕。该商场由杨忠礼集团旗下的升禧环球信托所持有，与万豪酒店和威斯汀酒店共构。"},{"page_url":"https://fi.wikipedia.org/wiki/El_Castillo_de_las_Guardas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/2002-10-26_11-15_Andalusien%2C_Lissabon_238.jpg","page_title":"El Castillo de las Guardas","context_page_description":"El Castillo de las Guardas on noin 1500 asukkaan kunta Sevillan maakunnan alueella Espanjan Andalusiassa. Kunta sijaitsee noin 54 kilometrin päässä maakunnan pääkaupungista Sevillasta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D1%82%D0%BE%D0%B4_%D1%81%D1%82%D1%80%D1%96%D0%BB%D1%8C%D0%B1%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Shooting_method_trajectories.png","page_title":"Метод стрільби","context_page_description":"В чисельних методах, метод стрільби - це метод для розв'язку крайової задачі зведенням її до розв'язання задачі початкових значень. Розв'язок задачі початкових значень дає нам функцію, яка в залежності від цих початкових значень буде повертати значення розв'язку на іншому кінці. Це дасть звичайне алгебраїчне рівняння, яке можна розв'язати якимось методом.\\nДля крайової задачі звичайного диференціального рівняння другого порядку, метод описується так:\\nНехай\\nце крайова задача.\\nНехай y описує розв'язок задачі початкових значень:\\nЗадамо функцію F як різницю між y та заданим значенням на краю y₁.\\nЯкщо крайова задача має розв'язок, тоді F має корінь,\\nі цей корінь - лише значення що дає розв'язок крайової задачі y.\\nДалі можна використовувати звичайні методи для знаходження коренів, наприклад метод дихотомії, чи метод Ньютона."},{"page_url":"https://sv.wikipedia.org/wiki/Mitte,_Berlin_(stadsdel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Unter_den_Linden_von_oben.jpg","page_title":"Mitte, Berlin (stadsdel)","context_page_description":"Mitte eller Berlin-Mitte är en stadsdel i stadsdelsområdet med samma namn i Berlin. Stadsdelen utgör staden Berlins historiska centrum, ungefär motsvarande den utsträckning staden hade under 1700-talet.\\nMitte var före Berlinmurens fall en stadsdel i Östberlin. Många Berlinbor avser än idag den mindre stadsdelen snarare än det större administrativa stadsdelsområdet när de talar om Mitte. I detta egentliga Mitte återfinns ett flertal av Berlins historiska och kejserliga institutioner utmed paradgatan Unter den Linden samt vid torget Gendarmenmarkt, bland andra Staatsbibliothek zu Berlin, Humboldtuniversitetet, Deutsches Historisches Museum och museerna på Museumsinsel.\\nEfter murens fall har Mitte även kommit att gradvis överta en roll som viktigt finans- och shoppingkvarter, det senare inte minst i trakten av gatan Friedrichstrasse. Vid Brandenburger Tor gränsar stadsdelen till regeringskvarteren i Tiergarten. Österut domineras området av Alexanderplatz och det närliggande Fernsehturm samt Berlins rådhus, Rotes Rathaus. Norra Mitte är idag shopping-, bar- och nöjeskvarter, centrerade omkring Hackescher Markt, Scheunenviertel och Oranienburger Strasse."},{"page_url":"https://ceb.wikipedia.org/wiki/Nei%C3%9Feaue","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Zentendorf_oestlichster_Punkt_Deutschlands.jpg","page_title":"Neißeaue","context_page_description":"Munisipyo ang Neißeaue sa Alemanya. Nahimutang ni sa estado pederal sa Saxony, sa sidlakang bahin sa nasod, 180 km sa habagatan-sidlakan sa Berlin ang ulohan sa nasod. Adunay 1,774 ka molupyo. Naglangkob kin og 47 ka kilometro kwadrado.\\nAng yuta sa Neißeaue kay patag.\\nHapit nalukop sa kaumahan ang palibot sa Neißeaue. Dunay mga 86 ka tawo kada kilometro kwadrado sa palibot sa Neißeaue medyo hilabihan populasyon. Ang klima klima sa kontinente. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -6 °C."},{"page_url":"https://eo.wikipedia.org/wiki/Baziliko_Sankta_Petronio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Mohameddemons2.jpg","page_title":"Baziliko Sankta Petronio","context_page_description":"La baziliko Sankta Petronio estas la ĉefa preĝejo de Bolonjo. Ĝia fasado superregas la faman urboplacon. Per siaj gigantaj dimensioj ĝi estas la kvina plej alta preĝejo de la mondo. Rimarkinda estas la vigla kolorigo de la internaj muroj kaj la multkoloraj vitraloj."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E6%9C%97%E5%9F%8E%E5%B8%82%E4%BA%BA%E5%8F%A3%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/T%C9%99briz.jpg","page_title":"伊朗城市人口列表","context_page_description":"本条目为依照人口排列的伊朗城市列表："},{"page_url":"https://de.wikipedia.org/wiki/Atlas_of_Peculiar_Galaxies","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/UGC4457_-_SDSS_DR14.jpg","page_title":"Atlas of Peculiar Galaxies","context_page_description":"Der Atlas of Peculiar Galaxies ist ein Astronomischer Katalog. In ihm sind 338 ungewöhnliche Galaxien mit photographischen Aufnahmen aufgeführt."},{"page_url":"https://zh.wikipedia.org/wiki/Adidas_Tango_12","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Euro_2012.jpg","page_title":"Adidas Tango 12","context_page_description":"Adidas Tango 12是UEFA2012年欧洲足球锦标赛官方指定用球。虽然这款球沿用了原有非常成功的Adidas Tango家族的名称，但Tango 12采用了完全不同的新设计。这款球的其它版本已经被用于包括非洲杯、夏季奥运会在内的许多比赛，虽然阿迪达斯并没有把它们全都划入“Adidas Tango 12”家族，但它们有着相似的设计。\\n这款球在2011年12月2日在基辅举行的欧洲杯小组赛抽签仪式上正式发布。据报道，这款足球被设计得比他的前一代普天同庆更方便运球和控制。Tango 12的构造设计基于普天同庆，但做了大幅修改。普天同庆遭到了很多守门员的谴责，包括巴西门将儒利奥·塞萨尔。\\nAdidas Tango 12采用了很多现代设计，诸如色彩的灵感来自于两个主办国波兰和乌克兰两国的国旗。蚀刻在球上的是三个以剪纸为背景的定制图案。剪纸装饰艺术是这两个主办国农村地区的传统。设计者认为这样的设计代表了足球的三个核心价值——团结，竞争和激情。"},{"page_url":"https://sv.wikipedia.org/wiki/Ojibway_Provincial_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Ojibway_Provincial_Park.jpg","page_title":"Ojibway Provincial Park","context_page_description":"Ojibway Provincial Park är en park i Kanada. Den ligger i provinsen Ontario, i den sydöstra delen av landet, 1 300 km väster om huvudstaden Ottawa. Ojibway Provincial Park ligger 373 meter över havet.\\nTerrängen runt Ojibway Provincial Park är platt. Den högsta punkten i närheten är 400 meter över havet, 2,2 km söder om Ojibway Provincial Park. Trakten runt Ojibway Provincial Park är nära nog obefolkad, med mindre än två invånare per kvadratkilometer. Det finns inga samhällen i närheten.\\nI omgivningarna runt Ojibway Provincial Park växer i huvudsak blandskog. Trakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 0 °C. Den varmaste månaden är juli, då medeltemperaturen är 17 °C, och den kallaste är februari, med -24 °C. Genomsnittlig årsnederbörd är 912 millimeter. Den regnigaste månaden är juni, med i genomsnitt 137 mm nederbörd, och den torraste är november, med 42 mm nederbörd."},{"page_url":"https://cs.wikipedia.org/wiki/Linienzugbeeinflussung","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Lininenleiter_im_Gleis_mit_Kreuzungsstelle.jpg","page_title":"Linienzugbeeinflussung","context_page_description":"Linienzugbeeinflussung, nebo též Linienförmige Zugbeeinflussung, je liniové vlakové zabezpečovací zařízení vyvinuté v Německu pro vysokorychlostní tratě. Toto zařízení má dvě základní funkce:\\nPřenos souhlasu k jízdě a údajů pro řízení vlaku na stanoviště strojvedoucího\\nSledování parametrů jízdy vlaku, zejména maximální rychlosti a brzdné křivky, a v případě překročení rychlosti zavedení rychločinného brzdění.\\nPřenášená data je v principu možné využít i k automatickému řízení vlaku. Tento systém je kromě Německa využíván i v Rakousku a ve Španělsku a taktéž u některých rychlodrážních sítí v jiných zemích."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%B2%D9%87_%D9%87%D9%86%D8%B1_%D8%A7%D8%B3%D9%84%D8%A7%D9%85%DB%8C_%D8%AF%D9%88%D8%AD%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Unknown%2C_Iran_-_Page_from_the_Shahnama_of_Shah_Tahmasp_-_Google_Art_Project.jpg","page_title":"موزه هنر اسلامی دوحه","context_page_description":"موزه هنر اسلامی در دوحه تأسیس ۲۰۰۸، نام یک موزه هنر از دوران اسلامی است که در پایتخت کشور قطر قرار دارد.\\nمعمار این بنا آی. ام. پی، معمار معروف آمریکایی، است.\\nدر مراسم گشایش این موزه، یو-یو ما نوازنده معروف آمریکایی هنرنمایی نمود."},{"page_url":"https://sv.wikipedia.org/wiki/Tyska_bokhandelns_fredspris","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Friedenspreis-ffm-2009-magris-005.jpg","page_title":"Tyska bokhandelns fredspris","context_page_description":"Tyska bokhandelns fredspris är ett tyskt, internationellt, fredspris. Det delas ut årligen i samband med Bokmässan i Frankfurt av Börsenverein des Deutschen Buchhandels sedan dess instiftande 1950. Priset delas ut i Paulskirche i närvaro av Tysklands förbundspresident, och består av 25 000 euro."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B0%D0%B4%D1%9A%D0%B0%D0%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Badnjak_saleswoman.jpg","page_title":"Бадњак","context_page_description":"Бадњак, у неким крајевима зван и весељак, грана је дрвета или младо дрво која се код православних Срба обредно налаже на ватру домаћег огњишта на Бадње вече. Дрво за бадњак, најчешће млад и прав цер, сијече се ритуално рано ујутру на Бадњи дан. Сјечење, припрема, уношење и налагање изводе се кроз сложене обреде, који у разним крајевима имају различите форме. Изгарање бадњака попраћено је молитвама да у наредној години не мањка хране, среће, љубави и новца. Према бадњаку се односе као према личности; упућују му поздраве и приносе жртве: жито, вино и мед. Бадњак гори и током Божића: први посјетилац на Божић удара по њему жарачем или граном док жели да срећа и напредак породице буду обилати као варнице које излијећу из бадњака. Будући да данашњи начин становања не дозвољава ватру на огњишту, бадњак је најчешће представљен церовом гранчицом којом се на Бадњи дан украси дом.\\nБадњак се свечано ложи у знак сјећања на ватру коју су по народном предању витлејемски пастири наложили у пећини у којој се родио Исус Христос, да би огријали божанско новорођенче и његову мајку."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D1%82%D0%B0-%D0%9A%D1%80%D1%83%D1%81-%D0%B4%D0%B5%D0%BB%D1%8C-%D0%9D%D0%BE%D1%80%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Santa_Cruz_del_Norte.jpg","page_title":"Санта-Крус-дель-Норте","context_page_description":"Санта-Крус-дель-Норте — муниципалитет и город в провинции Маябеке на Кубе. Город основан в 1800 году.\\nПлощадь муниципалитета составляет 376 км². Численность населения муниципалитета в 2004 году — 32 576 человек, а плотность — 86,6 чел./км².\\nГород Санта-Крус-дель-Норте расположен на востоке провинции, между городами Гавана и Матансас, в устье реки Санта Круз. Город был построен рыбаками, и получил статус центра муниципалитета только в 1931 году.\\nВ Санта-Крус-дель-Норте находится производство рома кампании Havana Club, здесь производятся все темные сорта рома. Кроме того, в муниципалитете производится электроэнергия, добывается нефть и развито рыболовство.\\nВ состав муниципалитета Санта-Крус-дель-Норте входят районы Бока-де-Харуко, Хибакоа, Аркос-де-Канаси и собственно Санта-Крус-дель-Норте.\\nС 24 по 31 июля 2010 года в муниципалитете состоялся 66-й международный молодёжный конгресс эсперанто."},{"page_url":"https://es.wikipedia.org/wiki/Secretar%C3%ADa_General_T%C3%A9cnica_del_Ministerio_de_Econom%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Ministerio_de_Industria%2C_Turismo_y_Comercio_de_Espa%C3%B1a_%28Madrid%29_01.jpg","page_title":"Secretaría General Técnica del Ministerio de Economía","context_page_description":"La Secretaría General Técnica del Ministerio de Asuntos Económicos y Transformación Digital es el órgano dependiente de la Subsecretaría del departamento encargado de dar asesoramiento técnico, así como de realizar las tareas administrativas, económico-financieras, de personal y de gestión que se le encomienden."},{"page_url":"https://sh.wikipedia.org/wiki/Univerzitet_u_Newcastlu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Devonshire_Walk%2C_Newcastle_University%2C_5_September_2013.jpg","page_title":"Univerzitet u Newcastlu","context_page_description":"Univerzitet u Newcastlu javni je istraživački univerzitet u engleskom gradu Newcastle upon Tyne u metropolitanskoj grofoviji Tyne and Wear. Institucija je jedna od članica prestižne Russellove grupe javnih britanskih istraživačkih univerziteta kao i dio brojnih drugih međuuniverzitetskih i akademskih organizacija. Univerzitet je podijeljen u 24 akademske škole i 40 instituta i istraživačkih centara koji su svi dio jednoga od tri fakulteta. Na univerzitetu se izvode predavanja na 175 preddiplomskih studijskih programa redovnog tipa kao i 340 poslijediplomskih programa. Univerzitet u Newcastlu jedan je od najuspješnijih univerziteta u Ujedinjenom Kraljevstvu u povlačenju sredstava iz istraživačkih fondova Europske unije."},{"page_url":"https://fr.wikipedia.org/wiki/Porsche_911","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Porsche_RSR_am_19.05.1974.jpg","page_title":"Porsche 911","context_page_description":"La Porsche 911 est une voiture de sport haut de gamme fabriquée par la firme allemande Porsche. La première génération est commercialisée en 1964, intégralement conçue par la firme de Stuttgart. Cinquante ans plus tard, le modèle emblématique de Porsche en conserve l'esthétique et le nom. La 911 est toujours produite et commercialisée dans sa dernière version en date, la 992. L'architecture du moteur est restée inchangée jusqu'à aujourd'hui. Il s'agit du 6-cylindres à plat, disposé en porte-à-faux arrière.\\nLa 911 est le modèle le plus célèbre de Porsche. Huit générations se sont succédé. Les anciens modèles font aujourd’hui partie des voitures de sport les plus recherchées par les collectionneurs. Le 11 mai 2017, Porsche a célébré le millionième exemplaire de Porsche 911 produit par la marque.\\nLa forme particulière et originale des phares vaut à la 911 le surnom de grenouille, sobriquet largement employé par les inconditionnels de la marque."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D1%97%D1%80_%D0%A1%D0%B0%D0%BB%D0%B0%D1%85%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Tahir_Salahov.jpg","page_title":"Таїр Салахов","context_page_description":"Таїр Теймурович Салахов — радянський, азербайджанський і російський живописець, театральний художник, педагог, професор. Член Президії Академії мистецтв СРСР з 1979 року, віце-президент Російської академії мистецтв з 1997 року.\\nАкадемік Академії мистецтв СРСР. Герой Соціалістичної Праці. Народний художник СРСР. Народний художник Російської Федерації. Лауреат Державної премії СРСР і Державної премії Російської Федерації. Член КПРС з 1964 року.\\nДепутат Верховної Ради СРСР 7-8-го скликань. Депутат Верховної Ради Азербайджанської РСР. Член ЦК КПРС у 1990—1991 рр."},{"page_url":"https://fr.wikipedia.org/wiki/Kl%C3%A1ra_Koukalov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Zakopalova_RG13_%288%29_%289380971251%29_crop.jpg","page_title":"Klára Koukalová","context_page_description":"Klára Koukalová, née le 24 février 1982 à Prague, est une joueuse de tennis tchèque, professionnelle entre 1999 et 2016. Elle est également connue sous son ancien nom marital, Klára Zakopalová, mais son divorce en 2014 la conduit à reprendre officiellement le nom de Klára Koukalová.\\nEn 2003, à l'occasion de sa première participation dans le tableau principal d'un tournoi du Grand Chelem, elle atteint le 3ᵉ tour à l'Open d'Australie, ce qui restera longtemps sa meilleure performance dans un des quatre Majeurs. Ce n'est qu'en 2010 qu'elle fera mieux, avec un huitième de finale à Wimbledon."},{"page_url":"https://de.wikipedia.org/wiki/Sternwarte_am_purpurnen_Berg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Abridged_Armilla_Nanjing.JPG","page_title":"Sternwarte am purpurnen Berg","context_page_description":"Die Sternwarte am purpurnen Berg, international als Purple Mountain Observatory bekannt, ist eine Sternwarte nahe der Stadt Nanjing in der Volksrepublik China. Das Observatorium liegt im östlichen Randgebiet der Stadt auf einer Hügelkuppe im Westen der Purpurberge in einer Höhe von 267 m über dem Meeresspiegel.\\nDer Bau der Sternwarte begann 1929. Fünf Jahre später, am 1. September 1934, wurde der Beobachtungsbetrieb aufgenommen.\\nIm Dezember 1937 während des Zweiten Japanisch-Chinesischen Krieges fast vollkommen zerstört, dienten die wenigen erhaltenen Gebäude als Wohnhäuser, als durch die Rückverlegung der Hauptstadt des KMT-Regimes ab April 1946 Wohnraum knapp wurde. Bereits im September begann dann der Wiederaufbau. Heute ist die Anlage ein modernes astronomisches Observatorium, das der Chinesischen Akademie der Wissenschaften unterstellt ist.\\nAn der Sternwarte am purpurnen Berg wurden drei Kometen entdeckt, darunter der periodische 60P/Tsuchinshan. Zu den Entdeckungen zählen darüber hinaus 147 Asteroiden, unter anderem die Trojaner Sarpedon, Cebriones und Palamedes, sowie ferner auch der nach der Warte benannte Purple Mountain."},{"page_url":"https://en.wikipedia.org/wiki/%C3%9Crkmez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/%C4%B0zmir_location_Seferhisar.svg","page_title":"Ürkmez","context_page_description":"Ürkmez is a small coastal town with own municipality and administratively depending the district center of Seferihisar in İzmir Province, Turkey.\\nIt is also a holiday resort, situated at a distance of approximately 50 km from the province center of Izmir. Ürkmez has a permanent population of about 5,000 during winter and the number of inhabitants rises to about 25,000 during the summer.\\nÜrkmez is where the ancient city of Lebedos was located and there are still some traces of the historic settlement. There are also thermal springs in Ürkmez."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%9A_(%E1%80%81%E1%80%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Katakana_%E3%83%A4_stroke_order_animation.gif","page_title":"ယ (ခန)","context_page_description":"ဟိရဂန တွင် や သို့မဟုတ် ခတခန တွင်ヤ သည် ဂျပန်ဘာသာစကား၏ ခနတစ်ခုဖြစ်ပြီး တစ်ခုချင်းစီသည် မိုရ တစ်ခုကို ကိုယ်စားပြုသည်။"},{"page_url":"https://en.wikipedia.org/wiki/Fr%C3%A9d%C3%A9ric_Chopin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Maria_Wodzi%C5%84ska.jpeg","page_title":"Frédéric Chopin","context_page_description":"Frédéric François Chopin, born Fryderyk Franciszek Chopin, was a Polish composer and virtuoso pianist of the Romantic era who wrote primarily for solo piano. He has maintained worldwide renown as a leading musician of his era, one whose \\"poetic genius was based on a professional technique that was without equal in his generation.\\"\\nChopin was born in Żelazowa Wola in the Duchy of Warsaw and grew up in Warsaw, which in 1815 became part of Congress Poland. A child prodigy, he completed his musical education and composed his earlier works in Warsaw before leaving Poland at the age of 20, less than a month before the outbreak of the November 1830 Uprising. At 21, he settled in Paris. Thereafter—in the last 18 years of his life—he gave only 30 public performances, preferring the more intimate atmosphere of the salon. He supported himself by selling his compositions and by giving piano lessons, for which he was in high demand. Chopin formed a friendship with Franz Liszt and was admired by many of his other musical contemporaries, including Robert Schumann."},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Hachigata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Hachigata_Station_20121102.JPG","page_title":"Stazione di Hachigata","context_page_description":"La stazione di Hachigata è una stazione ferroviaria della cittadina di Yorii, nel distretto di Ōsato della prefettura di Saitama, in Giappone, ed è servita dalla linea Tōbu Tōjō delle Ferrovie Tōbu. In questa sezione della linea è disponibile solo il servizio locale, e per dirigersi verso Kawagoe e Ikebukuro, è necessario cambiare treno a Ogawamachi."},{"page_url":"https://ca.wikipedia.org/wiki/Amerindis_de_Florida","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Rc11029_Timucua_Indian_village_drawing_by_Le_Moyne_de_Morgues.jpg","page_title":"Amerindis de Florida","context_page_description":"Els amerindis de Florida eren els pobles amerindis que van viure en el que ara es coneix com a Florida durant més de 12.000 anys abans del moment del primer contacte amb els europeus. Els indígenes de la Florida havien mort en gran part pel segle XVIII. Alguns apalachees emigraren a Louisiana, on els seus descendents viuen encara, alguns supervivents van ser portats a Cuba i Mèxic pels espanyols al segle XVIII, i uns pocs supervivents poden haver estat absorbits per les tribus seminola i miccosukee."},{"page_url":"https://vec.wikipedia.org/wiki/Saint-Clair-sur-les-Monts","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%C3%89glise_de_Saint-Clair-sur-les-Monts.jpg","page_title":"Saint-Clair-sur-les-Monts","context_page_description":"Saint-Clair-sur-les-Monts el xé on comun de 591 abitanti del departemento de Seine-Maritime che el fa parte del rejon Normandia in Fransa."},{"page_url":"https://de.wikipedia.org/wiki/Wasserburg_Rohr","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Wasserburg_Rohr%2C_002.jpg","page_title":"Wasserburg Rohr","context_page_description":"Die Wasserburg Rohr ist eine abgegangene Burg im Stadtteil Rohr des Stuttgarter Stadtbezirks Vaihingen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%BB%D1%8C%D1%82%D0%B5%D1%80%D1%8C%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Minibull_Moletai_May_2014.jpg","page_title":"Бультерьер","context_page_description":"Бультерьер — порода собак, относящаяся к группе терьеров."},{"page_url":"https://en.wikipedia.org/wiki/Workbench","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Carpenter%27s_workbench.jpg","page_title":"Workbench","context_page_description":"A workbench is a sturdy table at which manual work is done. They range from simple flat surfaces to very complex designs that may be considered tools in themselves. Workbenches vary in size from tiny jewellers benches to the huge benches used by staircase makers. Almost all workbenches are rectangular in shape, often using the surface, corners and edges as flat/square and dimension standards. Design is as varied as the type of work for which the benches are used but most share these attributes:\\nA comfortable height for working with provisions for seated or standing work\\nA way to fix the workpiece to the surface so that it may be worked with both hands\\nProvisions for mounting, storing and accessing tools\\nWorkbenches are made from many different materials including metal, wood, stone, and composites depending on the needs of the work."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A5%A7%E6%96%AF%E5%A1%94%E4%B8%BB%E6%95%99%E5%BA%A7%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Aosta_Cattedrale.JPG","page_title":"奧斯塔主教座堂","context_page_description":"奥斯塔主教座堂是意大利西北部城市奥斯塔的一座罗马天主教的主教座堂，修建于4世纪。这座教堂是天主教奥斯塔教区的主教座堂。现在的教堂正面立面是新古典主义风格，修建于1846年至1848年。"},{"page_url":"https://tr.wikipedia.org/wiki/Susie_Essman","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Susie_Essman_at_the_2009_Tribeca_Film_Festival.jpg","page_title":"Susie Essman","context_page_description":"Susan \\"Susie\\" Essman, Amerikalı komedyen, oyuncu ve seslendirme sanatçısı. Curb Your Enthusiasm dizisinde Otis seslendirmesi ile bilinmektedir."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B3%D8%AC%D8%AF_%D9%83%D8%A7%D9%85%D8%A8%D8%B1%D9%8A%D8%AF%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Cmglee_Cambridge_Mosque_atrium.jpg","page_title":"مسجد كامبريدج","context_page_description":"مسجد كامبريدج المركزي هو أول مسجد صديق للبيئة في أوروبا وأول مسجد بني لهذا الغرض في مدينة كامبريدج بإنجلترا. ويتمثل مهمته في تلبية احتياجات المجتمع المسلم في المملكة المتحدة وخارجها من خلال تسهيل العبادة، وتنمية المجتمع، والتماسك الاجتماعي والحوار بين الأديان. تم افتتاح مسجد كامبريدج المركزي للجمهور في 24 أبريل 2019."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_la_Grange_Fort","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Carte_postale_ancienne_grangefort_2.jpg","page_title":"Château de la Grange Fort","context_page_description":"Le château de la Grange Fort, ou Grangefort, est un château datant du XVᵉ siècle situé au lieu-dit « La Grange Fort » sur la commune Les Pradeaux, près de la ville d'Issoire. Il a été reconverti en château-camping-chambres d'hôtes par les Van Bronkhorst, ancienne famille aristocratique néerlandaise originaire de Engelo."},{"page_url":"https://de.wikipedia.org/wiki/Oberleitungsbus_Landskrona","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sk%C3%A5netrafiken_6994_on_Storgatan.jpg","page_title":"Oberleitungsbus Landskrona","context_page_description":"Der Oberleitungsbus Landskrona ist der einzige Oberleitungsbus-Betrieb in Schweden. Neben dem Oberleitungsbus Bergen in Norwegen ist er außerdem einer von nur zwei Obus-Betrieben in Skandinavien. Mit 28.679 Einwohnern zählt Landskrona zu den weltweit kleinsten Städten, die ein Obus-System besitzen.\\nDie Oberleitungsinfrastruktur gehört den Technischen Werken der Stadt. Die Verkehrsleistungen werden von der südschwedischen Nahverkehrsgesellschaft Skånetrafiken bestellt, welcher auch das Rollmaterial gehört. Bisherige Auftragnehmer waren Orusttrafiken ab Betriebseröffnung im September 2003, Arriva ab 1. April 2004, Swebus ab 18. Juni 2006 und Nobina Sverige seit 1. Dezember 2009."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BD%D0%B0%D0%BD%D1%81%D0%BE%D0%B2_%D0%BC%D0%B5%D1%85%D0%B0%D0%BD%D0%B8%D0%B7%D1%8A%D0%BC_%D0%BD%D0%B0_%D0%95%D0%98%D0%9F_%D0%B8_%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B6%D0%BA%D0%B8_%D1%84%D0%B8%D0%BD%D0%B0%D0%BD%D1%81%D0%BE%D0%B2_%D0%BC%D0%B5%D1%85%D0%B0%D0%BD%D0%B8%D0%B7%D1%8A%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/EEA_Norway_logos.gif","page_title":"Финансов механизъм на ЕИП и Норвежки финансов механизъм","context_page_description":"Безвъзмездните средства от ЕИП и Норвегия представляват приноса на Исландия, Лихтенщайн и Норвегия за намаляване на социалните и икономическите различия в Европейското икономическо пространство и за укрепване на двустранните отношения с 15 държави от ЕС в Централна и Южна Европа. Безвъзмездните средства също така допринасят за укрепване на основните европейски ценности като демокрация, толерантност и върховенство на закона."},{"page_url":"https://pl.wikipedia.org/wiki/Gianni_Clerici","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/93/Gianni_Clerici.jpg","page_title":"Gianni Clerici","context_page_description":"Gianni Clerici – włoski dziennikarz sportowy, pisarz, tenisista.\\nW młodości uprawiał tenis, osiągając m.in. finał mistrzostw Włoch juniorów w singlu oraz dwa tytuły mistrza Włoch juniorów w deblu; w 1950 był w składzie reprezentacji, która sięgnęła po Puchar Galea. Startował w międzynarodowych mistrzostwach Francji oraz na Wimbledonie.\\nWiększe uznanie przyniosła mu praca dziennikarza sportowego. Od 1956 był publicystą i reporterem mediolańskiego dziennika \\"Il Giorno\\"; od 1988 publikuje na łamach rzymskiego dziennika \\"La Repubblica\\", a od 1960 na łamach tygodnika \\"L'Espresso\\". Jako korespondent uczestniczył w ponad 170 turniejach wielkoszlemowych. Opublikował ponad 6 tysięcy artykułów o tematyce sportowej, a także kilka znanych książek, m.in. 500 Anni di Tennis, Il Vero Tennis, Il Tennis Facile. Jest autorem znanej biografii tenisistki francuskiej Suzanne Lenglen – La Diva du Tennis, która doczekała się francuskojęzycznej wersji scenicznej w Paryżu. Poza prasą udziela się jako komentator tenisowy w telewizji włoskiej.\\nClerici zasłużył się także dla popularyzacji tenisa jako współtwórca otwartego w 2003 Roland Garros Tenniseum przy arenie French Open."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A4%E0%B5%83%E0%B4%AA%E0%B5%81%E0%B4%B0%E0%B4%BE%E0%B4%A8%E0%B5%8D%E0%B4%A4%E0%B4%95%E0%B5%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Rajarajesvaram_Temple_29-10a.jpg","page_title":"തൃപുരാന്തകൻ","context_page_description":"കേരളത്തിൽ ആരാധിക്കുന്ന ശൈവമൂർത്തികളിൽ പ്രധാനിയാണ് ത്രിപുരാന്തകൻ. ത്രിപുരന്മാരുടെരുടെ അന്തകനായ ശിവൻ എന്നാണ് പദാർത്ഥം. മലപ്പുറം ജില്ലയിൽകിഴിശ്ശേരിക്കടുത്ത് പ്രസിദ്ധമായ ത്രിപുരാന്തകക്ഷേതംസ്ഥിതിചെയ്യുന്നു. ആന്ധ്രപ്രദേശിൽപ്രകാശം ജില്ലയിൽ ത്രിപുരാന്തകത്ത് ഉള്ള ത്രിപുരാന്തകസ്വാമി ക്ഷേത്രവും പ്രശസ്തമാണ്. തമിഴ്നാട്ടിൽ തിരുവള്ളുവർ ജില്ലയിലും ഒരു ത്രിപുരാന്തകസ്വാമിക്ഷേത്രം ഉണ്ട്."},{"page_url":"https://fr.wikipedia.org/wiki/Ji%C5%99et%C3%ADn_pod_Jedlovou","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Jiretin_pod_Jedlovou_DC_CZ.png","page_title":"Jiřetín pod Jedlovou","context_page_description":"Jiřetín pod Jedlovou est une commune du district de Děčín, dans la région d'Ústí nad Labem, en Tchéquie. Sa population s'élevait à 662 habitants en 2018."},{"page_url":"https://ms.wikipedia.org/wiki/Pertempuran_Toulouse_(721)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Vasconia_wide_740_3_-_80.jpg","page_title":"Pertempuran Toulouse (721)","context_page_description":"Pertempuran Toulouse (721) merujuk pada sebuah pertempuran yang berlaku antara pasukan tentera Kristian dari Aquitaine yang diketuai oleh Duke Odo dari Aquitaine menentang tentera Muslim khilafah Umayyad yang mengepung kota Toulouse, dan diketuai oleh gabenor Al-Andalus, Al-Samh ibn Malik al-Khawlani. Kemenangan ini menghalang perluasan kawalan Umayyah ke barat daripada Narbonne ke dalam Aquitaine."},{"page_url":"https://af.wikipedia.org/wiki/Bilzen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/AldenBiesen01.jpg","page_title":"Bilzen","context_page_description":"Bilzen is 'n Belgiese stad en munisipaliteit in die suidooste van die Vlaamse provinsie Limburg. Die munisipale gebied het sowat 31 000 inwoners en 'n oppervlakte van 76 km².\\nIn die plek Rijkhoven lê die Alden Biesen, 'n baie groot kasteel."},{"page_url":"https://de.wikipedia.org/wiki/Junkers_Ju_390","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Abandoned_JU-390_IWM_CH_15687.jpg","page_title":"Junkers Ju 390","context_page_description":"Die Ju 390 der Junkers Flugzeug- und Motorenwerke in Dessau war eine vergrößerte Weiterentwicklung der viermotorigen Ju 290. Der Entwurf stammt vom Junkers-Chefkonstrukteur Ernst Zindel. Die Ju 390 war mit sechs Motoren ausgestattet, ansonsten entsprach sie ihrem Vorgängermodell."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D1%8B_%D0%BF%D0%BE_%D1%88%D0%BE%D1%81%D1%81%D0%B5%D0%B9%D0%BD%D0%BE%D0%BC%D1%83_%D0%B2%D0%B5%D0%BB%D0%BE%D1%81%D0%BF%D0%BE%D1%80%D1%82%D1%83_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/2017_European_Road_Championships_%E2%80%93_Women%27s_road_race_01.jpg","page_title":"Чемпионат Европы по шоссейному велоспорту 2017","context_page_description":"23-й Чемпионат Европы по шоссейному велоспорту проводился в датском городе Хернинг с 2 по 6 августа 2017 года. Программа чемпионата включала индивидуальные и групповые гонки среди мужской и женской элиты, мужчин и женщин в возрасте до 23-х лет, юниоров обоих полов."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_november_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Harrison_Dillard_1952_%28cropped%29.jpg","page_title":"Lijst van personen overleden in november 2019","context_page_description":"Dit is een lijst van bekende personen die zijn overleden in november 2019."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A3%9E%E8%A1%8C%E7%94%B2%E6%9D%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Kusnzov2.jpg","page_title":"飞行甲板","context_page_description":"航空母艦上的飛行甲板是飛機起飛和降落的地方，也就是一個小型的海上流動飛機場。在一些不以航空為主要任務的海軍艦艇上，直升飛機和一些垂直起降的飛機起降地也稱為飛行甲板。"},{"page_url":"https://eu.wikipedia.org/wiki/Sillago_flindersi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Sillago_flindersi2.jpg","page_title":"Sillago flindersi","context_page_description":"Sillago flindersi Sillago generoko animalia da. Arrainen barruko Sillaginidae familian sailkatzen da."},{"page_url":"https://it.wikipedia.org/wiki/Giovanni_Ferrini","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/CristoforiOvalSpinetLeipzigII.jpg","page_title":"Giovanni Ferrini","context_page_description":"Giovanni Ferrini è stato un celebre cembalaro italiano.\\nUnico allievo certo di Bartolomeo Cristofori, al quale si avvicina quale instancabile sperimentatore, ne riprese il sofisticato meccanismo del cembalo a martelli. I documenti che descrivono Ferrini quale apprendista del maestro padovano sono un anonimo dizionario manoscritto settecentesco e i due testamenti redatti da Cristofori."},{"page_url":"https://fr.wikipedia.org/wiki/Catalogne","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Montserrat_des_del_Bages.jpg","page_title":"Catalogne","context_page_description":"La Catalogne est une communauté autonome se trouvant au nord-est de l´Espagne, elle est officiellement considérée comme ayant une nationalité. Sa capitale et métropole est la ville de Barcelone. Elle est entourée par la Communauté valencienne au sud, l'Aragon à l'ouest, la France au nord, l'Andorre au nord-ouest, et la mer Méditerranée à l'est. Une grande partie de ses terres fait donc frontière avec la France. Elle couvre une superficie de 31 950 km². Ses langues officielles sont le catalan, l'occitan et l'espagnol ou castillan. En 2015, elle comptait 7 508 106 habitants, ce qui en faisait la deuxième communauté d'Espagne après l'Andalousie et la dixième subdivision territoriale de premier niveau administratif d'Europe au regard de la population. Elle est également la plus peuplée parmi les Pays catalans, ensemble culturel et linguistique qui la lie à la Communauté valencienne, aux îles Baléares, à la principauté d'Andorre, à la Franja aragonaise et à l'essentiel du département français des Pyrénées-Orientales."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_%D1%84%D0%BE%D0%BD_%D0%A9%D0%BE%D0%BB%D0%B1%D0%B5%D1%80%D0%B3-%D0%92%D0%B5%D1%80%D0%BD%D0%B8%D0%B3%D0%B5%D1%80%D0%BE%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Pieszyce_palac_01.jpg","page_title":"Фридрих фон Щолберг-Вернигероде","context_page_description":"Фридрих фон Щолберг-Вернигероде е граф на Щолберг-Вернигероде-Вернигероде.\\nТой е най-големият син на граф Фердинанд фон Щолберг-Вернигероде-Петерсвалдау и съпругата му графиня Мария Агнес Каролина фон Щолберг-Щолберг, дъщеря на граф Фридрих Леополд фон Щолберг-Щолберг и Хенриета Елеонора Агнес фон Витцлебен.\\nФридрих фон Щолберг-Вернигероде умира на 60 години на 5 януари 1865 г. в Петерсвалдау, Полша."},{"page_url":"https://fr.wikipedia.org/wiki/Cryptoclidus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Cryptoclidus1DB.jpg","page_title":"Cryptoclidus","context_page_description":"Cryptoclidus est un genre éteint de plésiosaures du Jurassique supérieur en Angleterre, en France, en Argentine et à Cuba. Son nom signifie « clavicule cachée ».\\nPlusieurs squelettes restaurés peuvent être observés dans les grands musées d'Europe et à l'American Museum of Natural History de New York."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%90%BD%E5%90%88%E9%A7%85_(%E5%8C%97%E6%B5%B7%E9%81%93)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%E8%90%BD%E5%90%88%E9%A7%85.jpg","page_title":"落合駅 (北海道)","context_page_description":"落合駅は、北海道空知郡南富良野町字落合にある北海道旅客鉄道根室本線の駅である。駅番号はT37。電報略号はオチ。標高は413mである。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%AA%E3%82%B7%E3%83%A5%E3%81%AE%E6%B3%95%E4%BB%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/6_Kalisz_66.jpg","page_title":"カリシュの法令","context_page_description":"「ユダヤ人の自由に関する一般憲章」は、1264年9月8日、カリシュにおいて大ポーランドのボレスワフ敬虔公によって発布された憲章。この憲章はポーランドのユダヤ人の法的地位の根拠となり、これによって「国民内国民」とも言えるようなイディッシュ語話者による自治組織が創始された。この憲章は1795年の第3次ポーランド分割まで存続した。この憲章によってユダヤ人に関する事案はユダヤ人の裁判所のみが取り扱うことになり、ユダヤ人とキリスト教徒が関わる事案については別個に独立した法廷で取り扱うことになった。この法令は同時に、ユダヤ人の安全と個人の自由を保障しており、これによりポーランドのユダヤ人たちは安心して自分たちの信仰を守り、商売を行い、旅行をすることができた。カリシュの法令は1334年にカジミェシュ3世大王、1453年にカジミェシュ4世王、1539年にジグムント1世王によって、それぞれ改めて承認されている。"},{"page_url":"https://nl.wikipedia.org/wiki/Paurothericles","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Paurothericles_marsabitica_female.jpg","page_title":"Paurothericles","context_page_description":"Paurothericles is een geslacht van rechtvleugeligen uit de familie Thericleidae. De wetenschappelijke naam van dit geslacht is voor het eerst geldig gepubliceerd in 1977 door Descamps."},{"page_url":"https://no.wikipedia.org/wiki/Merkatorprojeksjon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Mercator-proj.jpg","page_title":"Merkatorprojeksjon","context_page_description":"Merkatorprojeksjon er en projeksjonsmetode hvor meridianene avsettes loddrett på parallellsirklene, og hvor avstanden langs disse sirklene blir strukket gradvis mer i forhold til terrenget dess nærmere polen man kommer. Første ledd i uttrykket kommer etter etternavnet til den nederlandske geografen Gerardus Mercator som introduserte teknikken i 1569.\\nMetoden er vanlig forekommende, eksempelvis på verdens- og sjøkart. Den bevarer retninger korrekt. Ettersom en rettvisende kurs mellom to punkt på kart av dette slaget bygger en rett linje, anvendes de ofte for sjøkart. Det er dog ikke korteste veien. Den korteste veien er en geodetisk linje som er nesten det samme som en storsirkel. Lengdeskalaen er variabel og minsker med avstanden til polene."},{"page_url":"https://ro.wikipedia.org/wiki/Ivancea,_Orhei","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Lake_in_Ivancha.jpg","page_title":"Ivancea, Orhei","context_page_description":"Ivancea este satul de reședință al comunei cu același nume din raionul Orhei, Republica Moldova.\\nÎn sat se află un parc, monument de arhitectură peisagistică, în care se ridică conacul familiei Balioz."},{"page_url":"https://ceb.wikipedia.org/wiki/Meroglossa_modesta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Meroglossa_modesta_f.jpg","page_title":"Meroglossa modesta","context_page_description":"Espesye sa buyog ang Meroglossa modesta. Una ning gihulagway ni Houston ni adtong 1975. Ang Meroglossa modesta sakop sa kahenera nga Meroglossa sa kabanay nga Colletidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B5_%D0%95%D0%B2%D1%80%D0%BE%D0%B2%D0%B8%D0%B4%D0%B5%D0%BD%D0%B8%D0%B5_%E2%80%94_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Ivana_Petkovska_%26_Magdalena_Aleksovska_at_stage_of_JESC_2015.jpg","page_title":"Детское Евровидение — 2015","context_page_description":"Детский конкурс песни Евровидение 2015 — тринадцатый ежегодный детский конкурс песни Евровидение, который прошёл в Софии, столице Болгарии, 21 ноября 2015 года. Несмотря на то, что прошлогодний конкурс, который прошёл на Мальте, выиграл 14-летний дебютант — представитель Италии Винченцо Кантьелло, страна-победитель организовывать у себя конкурс 2015 года не решилась.\\nБолгарский национальный телеканал БНТ выступил вещателем и организатором данного события. В этом году на конкурсе дебютировали две страны — Ирландия и Австралия. После двухлетнего перерыва вернулась Албания, а также Македония, не участвовавшая в прошлом году. В итоге в Детском Евровидении 2015 приняли участие 17 стран. Хорватия из-за неудачного выступления в 2014 году решила отказаться от участия в конкурсе. Не принял участия из-за финансовых трудностей и Кипр. А Швеция заявила о своей незаинтересованности в дальнейшем участии.\\nПобедителем конкурса стала Дестини Чукуньере с Мальты с песней «Not My Soul». Это уже вторая победа этой страны на конкурсе, причём с абсолютным рекордом по количеству набранных баллов. До этого рекорд принадлежал Марии Исабель из Испании, которая в 2004 году набрала 171 балл."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%85%E0%A4%82%E0%A4%A4%E0%A4%B0%E0%A4%B0%E0%A4%BE%E0%A4%B7%E0%A5%8D%E0%A4%9F%E0%A5%8D%E0%A4%B0%E0%A5%80%E0%A4%AF_%E0%A4%97%E0%A4%A3%E0%A4%BF%E0%A4%A4%E0%A5%80%E0%A4%AF_%E0%A4%93%E0%A4%B2%E0%A4%82%E0%A4%AA%E0%A4%BF%E0%A4%AF%E0%A4%BE%E0%A4%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/IMO_logo.svg","page_title":"अंतरराष्ट्रीय गणितीय ओलंपियाड","context_page_description":"अंतरराष्ट्रीय गणितीय ओलंपियाड एक पूर्व-कॉलेजिएट छात्रों के लिए वार्षिक छह-प्रशन, 42-बिंदु गणितीय ओलंपियाड हैं, जो की अन्तर्राष्ट्रीय विज्ञान ओलम्पियाड में सबसे पुराना हैं। प्रथम आइएमओ 1959 में रोमानिया में आयोजित किया गया था। इसके पश्चात से इसे, 1980 में छोड़कर, सालाना आयोजित किया गया। आइएमओ में लगभग 100 देशों की टीम भाग लेती हैं, प्रत्येक टीम में अधिकाधिक छह छात्र, एक टीम नेता, उप नेता व प्रेक्षक होता है।"},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%B4%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Mordy_-_zesp%C3%B3%C5%82_ko%C5%9Bcio%C5%82a_par._-_ko%C5%9Bci%C3%B3%C5%82_p.w._%C5%9Bw._Micha%C5%82a_Archanio%C5%82a_MK2.jpg","page_title":"Морды","context_page_description":"Морды — горад у Польшчы, за 115 км на ўсход ад цэнтра Варшавы і за 80 км на захад ад Брэста. Уваходзіць у склад Сядлецкага павета Мазавецкага ваяводства, сядзіба вяскова-гарадской гміны Морды. Насельніцтва 1,8 тыс. чалавек."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BD%CF%84%CE%B9%CE%BC%CF%8C%CE%BD%CE%B9%CE%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Antimon.PNG","page_title":"Αντιμόνιο","context_page_description":"Το αντιμόνιο είναι το χημικό στοιχείο με χημικό σύμβολο Sb και ατομικό αριθμό 51. Το χημικά καθαρό αντιμόνιο, στις συνηθισμένες συνθήκες, είναι στιλπνό γκρίζο μεταλλοειδές, που βρίσκεται στη φύση κυρίως με τη μορφή του αντιμονίτη, ενός θειούχου ορυκτού. Οι ενώσεις του αντιμονίου ήταν γνωστές από την αρχαιότητα, οπότε χρησιμοποιούνταν σε κοσμητικές εφαρμογές. Το μεταλλικό αντιμόνιο ήταν επίσης γνωστό, αλλά θεωρείτο λανθασμένα ότι ήταν μορφή του μολύβδου, μέχρι που ανακαλύφθηκε η αλήθεια, δηλαδή ότι πρόκειται για ξεχωριστό στοιχείο. Στα 1540, αναφέρθηκε για πρώτη φορά η απομόνωση και η περιγραφή του αντιμονίου από το Βαννόκιο Μπιρινγκούκιο.\\nΓια κάποιο χρονικό διάστημα, η Κίνα ήταν η μεγαλύτερη παραγωγός μεταλλικού αντιμονίου και των ενώσεών του, και μάλιστα με το μεγαλύτερο μέρος της παραγωγής τους ειδικά από το ορυχείο του Xikuangshan στο Χουνάν. Οι βιομηχανικές μέθοδοι για την παραγωγή αντιμονίου είναι θέρμανση μαζί με επακόλουθη καρβοθερμική ή άμεση αναγωγή του αντιμονίτη με σίδηρο.\\nΟι μεγαλύτερες εφαρμογές του μεταλλικού αντιμονίου είναι η παραγωγή κραμάτων με μόλυβδο και κασσίτερο, και οι πλάκες μολύβδου - αντιμονίου σε μπαταρίες μολύβδου-οξέος."},{"page_url":"https://en.wikipedia.org/wiki/Mullica_Hill,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/MULLICA_HILL_HISTORIC_DIST._GLOUCESTER_COUNTY.jpg","page_title":"Mullica Hill, New Jersey","context_page_description":"Mullica Hill is a census-designated place and unincorporated community located within Harrison Township, in Gloucester County, New Jersey, United States. As of the 2010 United States Census, the CDP's population was 3,982."},{"page_url":"https://pt.wikipedia.org/wiki/Paelha","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/01_Paella_Valenciana_original.jpg","page_title":"Paelha","context_page_description":"A paelha, é um prato à base de arroz, típico da gastronomia valenciana — daí que em Portugal seja comumente conhecido como arroz à valenciana e no Brasil como paelha valenciana — e popularizado por toda a Espanha e noutros países, convertendo-se numa referência da gastronomia espanhola.\\nÉ um guisado de arroz, carne e verduras preparado numa paella sobre fogo, seja um paeller ou um fogão. A receita é originária da marjal da Albufeira de Valência, na comarca natural da Ribeira do Júcar, a sul da cidade de Valência. É consumida em qualquer ocasião, especialmente quando se reúnem amigos ou famílias, sábados, domingos ou em feriados tradicionais e é considerado o prato típico do País Valenciano por excelência.\\nO prato era inicialmente uma refeição simples confeccionada com os ingredientes disponíveis para além do arroz: carne de coelho, frango ou até pato; verduras, azeite, água, açafrão, caracóis e sal. Ao longo do tempo foi modernizando-se e entrou nas ementas dos restaurantes, onde é cozinhada com diferentes tipos de marisco, incluindo bogavantes, camarões ou lagostas.\\nA sua internacionalização levou à criação de pratos com pouca relação com o original valenciano."},{"page_url":"https://lt.wikipedia.org/wiki/Dabu%C5%BEi%C5%B3_Kristaus_%C5%BDengimo_%C4%AF_dang%C5%B3_ba%C5%BEny%C4%8Dia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Dabu%C5%BEiai%2C_%C5%BDvinys.JPG","page_title":"Dabužių Kristaus Žengimo į dangų bažnyčia","context_page_description":"Dabužių Kristaus Žengimo į dangų bažnyčia stovi Dabužių kaime, 10 km į vakarus nuo Anykščių. Turi neogotikos bruožų."},{"page_url":"https://pt.wikipedia.org/wiki/Magdalena_Lobnig","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/20160717_Olympiaeinkleidung_AT_2408.jpg","page_title":"Magdalena Lobnig","context_page_description":"Magdalena Lobnig é uma remadora austríaca."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%A7%D7%A1_%D7%A4%D7%A8%D7%A1%D7%99_%D7%90%D7%95%D7%A1%D7%A7%D7%A8_%D7%94-66","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Steven_Spielberg_by_Gage_Skidmore.jpg","page_title":"טקס פרסי אוסקר ה-66","context_page_description":"טקס פרסי אוסקר ה-66 להענקת פרסי האוסקר של האקדמיה האמריקאית לקולנוע למיטב סרטי הקולנוע והטלוויזיה של שנת 1993 נערך בדורותי צ'נדלר פביליון שבלוס אנג'לס, קליפורניה, ב-21 במרץ 1994. השחקנית וופי גולדברג הנחתה את הטקס בפעם הראשונה שלה.\\nסרט השואה \\"רשימת שינדלר\\" היה מועמד ל-12 פרסי אוסקר וזכה בשבעה, ביניהם פרס הסרט הטוב ביותר, פרס הבמאי הטוב ביותר ופרס התסריט המעובד הטוב ביותר. כמו כן בלט סרט הדרמה \\"הפסנתר\\" אשר היה מועמד ל-8 פרסים, וזכה בפרסי השחקנית הטובה ביותר, שחקנית המשנה הטובה ביותר ופרס התסריט המקורי הטוב ביותר.\\nבמהלך הטקס הוענקו פרס אוסקר לשם כבוד לשחקנית דברה קר, ופרס לפעילות הומניטרית לשחקן פול ניומן."},{"page_url":"https://en.wikipedia.org/wiki/Queen%27s_Dock,_Port_of_Liverpool","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Liverpool_Queens_Dock_Feb_2014.JPG","page_title":"Queen's Dock, Port of Liverpool","context_page_description":"Queen's Dock is a dock on the River Mersey and part of the Port of Liverpool. It is situated in the southern dock system, connected to Wapping Dock to the north and Coburg Dock to the south."},{"page_url":"https://it.wikipedia.org/wiki/Carposinoidea","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/24/Carposina_scirrhosella_damage.jpg","page_title":"Carposinoidea","context_page_description":"Carposinoidea Walsingham, 1897 è una superfamiglia di lepidotteri diffusa in tutti i continenti con oltre 300 specie."},{"page_url":"https://hu.wikipedia.org/wiki/Cappelle-Brouck","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Population_-_Municipality_code_59130.svg","page_title":"Cappelle-Brouck","context_page_description":"Cappelle-Brouck település Franciaországban, Nord megyében. Cappelle-Brouck Saint-Pierre-Brouck, Bourbourg, Holque, Looberghe, Merckeghem és Millam községekkel határos."},{"page_url":"https://it.wikipedia.org/wiki/Le_Cateau-Cambr%C3%A9sis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Le_Cateau_Cambr%C3%A9sis_2.jpg","page_title":"Le Cateau-Cambrésis","context_page_description":"Le Cateau-Cambrésis è un comune francese di 7.143 abitanti situato nel dipartimento del Nord nella regione dell'Alta Francia."},{"page_url":"https://en.wikipedia.org/wiki/List_of_heads_of_state_of_Fiji","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/John_Bates_Thurston.jpg","page_title":"List of heads of state of Fiji","context_page_description":"Seru Epenisa Cakobau\\nNote that Cakobau had been the Vunivalu of Bau since 1852. He had long styled himself the Tui Viti, but had not been recognized as such by other chiefs, and he exercised no direct authority outside his domain of Bau until he united the country under his leadership in 1871. His ancestors, going back as far as 1770, have often - erroneously - been listed as \\"Kings\\" of Fiji."},{"page_url":"https://de.wikipedia.org/wiki/Izarra","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Izarra-1924.jpg","page_title":"Izarra","context_page_description":"Izarra ist ein ursprünglich aus Bayonne stammender baskischer Kräuterlikör, welcher seit 1906 produziert wird. Heute wird der Likör in Angers hergestellt.\\nUnter deutschen Touristen ist der Izarra auch als \\"der Teufel aus der Flasche\\" bekannt, in einigen Surfer-Gebieten auch als \\"Grüne Welle\\"."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%86%D8%A7%D8%B1_%D8%A7%D9%84%D8%AD%D8%B4%D8%A7%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/%D8%A7%D9%84%D9%85%D9%87%D9%86%D8%AF%D8%B3%D8%A9_%D9%85%D9%86%D8%A7%D8%B1_%D8%A7%D9%84%D8%AD%D8%B4%D8%A7%D8%B4.png","page_title":"منار الحشاش","context_page_description":"منار الحشاش، مهندسة كويتية، أمين عام جائزة الكويت الإلكترونية ومعينة من قبل الأمم المتحدة بمسمى القيادية الإلكترونية للأمم المتحدة UN e-Leader اختارتها شركة مايكروسوفت لتكون محكمة في لجنة التحكيم المسؤولة عن تصفيات الجولة النهائية لمنافسات كأس مايكروسوفت سنتي 2008 و 2009.\\nحاصلة على بكالوريس هندسة كمبيوتر سنة 2000، وماجستير إدارة أعمال عام 2006 من جامعة الكويت. في المجال التقني هي مدقق نظم معلومات في الصندوق الكويتي للتنمية الاقتصادية العربية، وعضو مؤسس مدير عام دوت ديزاين، أما دولياً فهي عضو مجلس إدارة منظمة جائزة الأمم المتحدة للمعلوماتية WSA، والخبيرة الإلكترونية لدولة الكويت في هيئة الخبراء في نفس المنظمة، وكانت سابقاً محكمة في لجنة التحكيم الكبرى للمنظمة، وفي المجال الإعلامي المرئي هي ومعدة ومقدمة برنامج \\"عالم الكمبيونت\\" في تلفزيون الكويت، معدة ومقدمة برنامج Zero Ones، وفي المجال الاجتماعي هي مؤسسة ومديرة مسابقة غراس ألكترو السنوية، ومؤسسة ومديرة مشروع غراس الكترو التوعوي لنشر الثقافة الإلكترونية، إضافة إلى ذلك قدمت برنامج مسابقة غراس الرمضانية الإلكترونية، ومسابقة سوني أريكسون الرمضانية، أما في مجال الاعلام المقروء فمنذ عام 2003-2005 أسست وأدارت مجلة دوت، وكانت معدة صفحة الوطن نت من عام 2000-2005، كما قدمت دورات تدريبية \\"مقدمة للانترنت\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B8%D0%BD%D0%B8,_%D0%A8%D0%B5%D0%B9%D0%BC%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Seamus_Heaney.jpg","page_title":"Хини, Шеймас","context_page_description":"Ше́ймас Джа́стин Хи́ни — ирландский писатель, поэт, переводчик и преподаватель. Лауреат Нобелевской премии по литературе 1995 года."},{"page_url":"https://fr.wikipedia.org/wiki/Mosqu%C3%A9e_al-Har%C3%A2m","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Mount_Safa_Mecca.jpg","page_title":"Mosquée al-Harâm","context_page_description":"La mosquée al-Harâm, ou grande mosquée de la Mecque, est une mosquée de la ville de La Mecque en Arabie saoudite. Elle est aussi le premier lieu saint de l'islam et la plus grande mosquée du monde. Elle abrite en son centre la Kaaba, bâtiment de petite taille, mais plus important sanctuaire de l'islam, dans lequel est enchâssée la pierre noire : c'est elle que les musulmans tentent de toucher au cours des ṭawāf qu'ils accomplissent durant leur pèlerinage ; et c'est dans la direction de la Kaaba que les musulmans du monde entier se tournent pour prier.\\nLe Masjid al-Harâm est un sanctuaire bâti dans un deuxième temps afin d'abriter ce sanctuaire préexistant de la Kaaba, qui est un bâtiment qui existait avant l'apparition de l'islam."},{"page_url":"https://en.wikipedia.org/wiki/Sir_William_Don,_7th_Baronet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Sir_William_Don_and_George_Coppin.jpg","page_title":"Sir William Don, 7th Baronet","context_page_description":"Sir William Henry Don, 7th Baronet was a British peer and actor."},{"page_url":"https://uz.wikipedia.org/wiki/Mutaffifin_surasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Title_Sura_083_Al-Mutaffifeen.jpg","page_title":"Mutaffifin surasi","context_page_description":"Mutaffifin surasi — Qurʼonning 83-surasi. Makkiy suralardan biri, 36 oyatdan iborat. Bu sura Qurʼonning 587–589-sahifasida va 30-juzida joylashgan. 86-boʻlib nozil boʻlgan."},{"page_url":"https://de.wikipedia.org/wiki/Verona_(New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Verona_twp_nj_013.png","page_title":"Verona (New Jersey)","context_page_description":"Verona ist ein Township im Essex County, New Jersey, USA. Bei der Volkszählung von 2000 wurde eine Bevölkerungszahl von 13.533 registriert."},{"page_url":"https://vi.wikipedia.org/wiki/Viola_mandshurica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Viola_mandshurica_%28200704%29.jpg","page_title":"Viola mandshurica","context_page_description":"Viola mandshurica là một loài thực vật có hoa trong họ Hoa tím. Loài này được W. Becker miêu tả khoa học đầu tiên năm 1917."},{"page_url":"https://ast.wikipedia.org/wiki/Moblame","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Arca_de_la_Batalla_de_Anghiari_%28M.A.N._51936%29_01.jpg","page_title":"Moblame","context_page_description":"Moblame ye'l conxuntu de muebles; son oxetos que sirven pa facilitar los usos y actividaes habituales en cases, oficines y otru tipu de locales. De normal el términu alude a los oxetos que faciliten les actividaes humanes comunes, tales como dormir, comer, cocinar, folgar, etc., por aciu meses, sielles, cames, estanteríes, muebles de cocina, etc. El términu esclúi instrumentos y máquines tales como PCs, teléfonos, electrodomésticos, etc."},{"page_url":"https://fr.wikipedia.org/wiki/Commerce_de_Marseille","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Commerce_de_Marseille-IMG_5773.jpg","page_title":"Commerce de Marseille","context_page_description":"Le Commerce de Marseille est un navire de guerre en service dans la Marine française de 1788 à 1793, puis dans la Royal Navy britannique jusqu'en 1802. C'est un vaisseau de ligne de premier rang, portant 118 canons sur trois ponts. Ce vaisseau ne doit pas être confondu avec le Commerce de Marseille, septième navire de la classe Téméraire, lancé en 1785. C'est un bâtiment qui est construit selon les plans types standardisés des ingénieurs Sané et Borda. Il est capturé par la Royal Navy au siège de Toulon et termine sa carrière en tant que bateau-prison quelques années plus tard."},{"page_url":"https://az.wikipedia.org/wiki/Solvanq_(Kaliforniya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Solvang_Danish_Mill_Bakery.jpg","page_title":"Solvanq (Kaliforniya)","context_page_description":"Solvanq — Amerika Birləşmiş Ştatlarında şəhər. Kaliforniya ştatında yerləşir. Əhali sayı 5 000-dən çoxdur."},{"page_url":"https://gl.wikipedia.org/wiki/Monstro_de_Frankenstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Frankenstein%27s_monster_%28Boris_Karloff%29.jpg","page_title":"Monstro de Frankenstein","context_page_description":"O monstro de Frankenstein, ás veces coñecido sinxelamente como Frankenstein, é un personaxe ficticio cuxo creador na ficción foi Victor Frankenstein. O monstro apareceu por vez primeira na novela de Mary Shelley de 1818 Frankenstein ou o moderno Prometeo. O título de Shelley compara a Victor Frankenstein co personaxe mitolóxico Prometeo que creou ós humanos con arxila e lume. Malia que a criatura da novela de Shelley non tiña nome, a criatura tomaría o nome de \\"Frankenstein\\" en anos posteriores.\\nNa historia gótica de Shelley, Victor Frankenstein construíu á súa criatura no laboratorio cun ambiguo método baseado na química e na alquimia. Shelley describe o monstro cunha altura de 2,4 metros, horriblemente feo, mais sensible e emocional. O monstro intenta encaixar na sociedade humana, pero é rexeitado, o cal o leva a vingarse contra o seu creador. Segundo o estudoso Joseph Carroll, o monstro atópase na \\"fronteira das características que definen normalmente a un protagonista dun antagonista\\"."},{"page_url":"https://de.wikipedia.org/wiki/Ba%C5%9F%C4%B1_Bozuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Basibozukchief.jpg","page_title":"Başı Bozuk","context_page_description":"Die Başı Bozuk waren irreguläre Truppen des Osmanischen Reiches, die sich aus verschiedenen Bevölkerungsgruppen zusammensetzten. Der Begriff başıbozuk bedeutet sinngemäß übersetzt so viel wie „Führerlos“, „irreguläre “, „Freischärler“, wörtlich jedoch „kaputter Kopf“, „Gestörter“, „Verwirrter“.\\nSie waren die irregulären Soldaten des osmanischen Sultans, die keiner militärischen Regelung oder Vorschrift der osmanischen Armee unterlagen und somit frei nach ihrem eigenen Ermessen bestrafen und töten durften. Sie hatten daher weder offizielle Uniformen noch sonstige spezielle Abzeichen. Diese Truppen wurden oft dazu benutzt, um Aufstände niederzuschlagen; dementsprechend waren sie verhasst unter der Zivilbevölkerung, bei der sie nicht selten äußerst brutal vorgingen, indem sie diese misshandelten und beraubten. Die mangelnde Disziplin und ihr auflehnendes Temperament machte es manchmal nötig, sie durch die regulären osmanischen Truppen zu entwaffnen.\\nUnter den mit rund 65.000 Mann bezifferten Kriegern befanden sich unter anderem Tataren aus der Dobrudscha, Albaner, Tscherkessen aus dem Kaukasus oder auch Turkmenen und Kurden aus Ostanatolien."},{"page_url":"https://de.wikipedia.org/wiki/Euphydryas_phaeton","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Euphydryas_phaeton_larva.jpg","page_title":"Euphydryas phaeton","context_page_description":"Euphydryas phaeton ist ein Schmetterling aus der Familie der Edelfalter. Seit 1973 wird die Art als Staatsinsekt des US-Bundesstaates Maryland auf der Liste der Staatsinsekten der Bundesstaaten der Vereinigten Staaten geführt. Obwohl offiziell nicht begründet, wird davon ausgegangen, dass Euphydryas phaeton aufgrund seiner Färbung gewählt wurde, da sowohl das Wappen des Staates Maryland sowie das der größten Stadt dieses Bundesstaates, Baltimore, als auch das Familienwappen von George Calvert, 1. Baron Baltimore die Farben Schwarz und Gelborange bzw. Goldgelb enthalten. Die Art wird im englischen Sprachgebrauch oft auch als „Baltimore Checkerspot Butterfly“ bezeichnet."},{"page_url":"https://en.wikipedia.org/wiki/H%C3%BCttenberg,_Austria","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Wappen_at_huettenberg.png","page_title":"Hüttenberg, Austria","context_page_description":"Hüttenberg is a market town in the district of Sankt Veit an der Glan in the Austrian state of Carinthia."},{"page_url":"https://fr.wikipedia.org/wiki/Bertry_Communal_Cemetery","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Bertry_42.jpg","page_title":"Bertry Communal Cemetery","context_page_description":"Bertry Communal Cemetery est un cimetière militaire de la Première Guerre mondiale situé sur le territoire de la commune de Bertry dans le département du Nord."},{"page_url":"https://es.wikipedia.org/wiki/Washington_D._C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/USA-Folger_Shakespeare_Library.jpg","page_title":"Washington D. C.","context_page_description":"Washington D. C., oficialmente el Distrito de Columbia, es la capital de los Estados Unidos de América. Se administra como distrito federal, una entidad diferente a los cincuenta estados que componen dicha nación, y depende directamente del gobierno federal. El Distrito de Columbia fue fundado el 16 de julio de 1790, y en 1791 se oficializó, dentro del distrito, una nueva ciudad denominada Washington, al este de la ya existente Georgetown. En 1871 se unificaron los gobiernos de estas dos ciudades y del resto de poblaciones del distrito en una sola entidad, D. C.\\nSe localiza a orillas del río Potomac y está rodeada por los estados de Virginia al oeste, y de Maryland al norte, este y sur.\\nLa ciudad de Washington nació como una ciudad planificada, y fue desarrollada a finales del siglo XVIII para servir como la capital nacional permanente, después de que diversas localidades ostentaran dicha posición desde la independencia del país, en 1776; en tanto, el distrito federal fue formado para marcar la diferencia entre la capital nacional y los estados. La ciudad fue nombrada en honor a George Washington, el primer presidente de los Estados Unidos."},{"page_url":"https://en.wikipedia.org/wiki/Wyandanch_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/WyandanchStation2018Rebuild.jpg","page_title":"Wyandanch station","context_page_description":"Wyandanch is a station along the Main Line of the Long Island Rail Road. It is located on Straight Path and Long Island Avenue, off Acorn Avenue in Wyandanch, New York. All parking near the station is free, and maintained either by Suffolk County or the Town of Babylon."},{"page_url":"https://fr.wikipedia.org/wiki/Trolleybus_de_Nancy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Naples_trolleybus-PzaCarlo3.JPG","page_title":"Trolleybus de Nancy","context_page_description":"Le réseau de trolleybus de Nancy était un système de transports en commun de l'agglomération de Nancy. Créé en 1982, le réseau compta trois lignes d'une longueur de 37 kilomètres et fonctionna jusqu'en 1998, date à laquelle les trolleybus ont été retirés de la circulation. Une partie de l'infrastructure du réseau a été réutilisée en 2001 pour la mise en service de l'unique ligne du « tramway » de Nancy. Les années 2000 ont vu, sans succès, diverses tentatives pour remettre en service des trolleybus à Nancy."},{"page_url":"https://br.m.wikipedia.org/wiki/Banniel_Ginea_ar_C'heheder","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Flag_of_Equatorial_Guinea.svg","page_title":"Banniel Ginea ar C'heheder","context_page_description":"Banniel Ginea ar C'heheder eo banniel broadel Ginea ar C'heheder abaoe dizalc'hiezh ar vro d'an 12 a viz Here 1968. Dilezet e voe etre 1972 ha 1979 e-pad diktatouriezh Francisco Macías Nguema.\\nGraet eo gant un tric'horn glas a-gleiz ha teir bandenn a-blaen gwer, gwenn ha ruz. Er vandenn wenn emañ ardamez ar vro."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AC%AC40%E5%B1%86%E9%87%91%E9%85%B8%E8%8E%93%E7%8D%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Rebel_Wilson_%286707611099%29_%28cropped%29.jpg","page_title":"第40屆金酸莓獎","context_page_description":"第40屆金酸莓獎是頒發給2019年表現最差的電影工作者的獎項。入圍名單於2020年2月8日公布。這是繼奧斯卡頒獎典禮之後舉行的第二次典禮，摒棄了在奧斯卡頒獎典禮前夕宣布獲獎者的傳統。這也將代表著該儀式的首次電視轉播。正值2019冠狀病毒病疫情的影響，該儀式原本將如期舉行，但隨後又取消。賽果於3月16日在金酸莓獎YouTube官方頻道公布。"},{"page_url":"https://en.wikipedia.org/wiki/Melitaea_nevadensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Nymphalidae_-_Melitaea_nevadensis-001.JPG","page_title":"Melitaea nevadensis","context_page_description":"Melitaea nevadensis is a species of butterfly of the family Nymphalidae."},{"page_url":"https://fi.wikipedia.org/wiki/Kuittua","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Hein%C3%A4vesi-map_Kuittua.jpg","page_title":"Kuittua","context_page_description":"Kuittua on yksi Etelä-Savossa sijaitsevan Heinäveden kunnan kylistä. Kylä sijaitsee läntisellä Heinävedellä."},{"page_url":"https://fr.wikipedia.org/wiki/Patagopteryx","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Patagopteryx_skeleton.jpg","page_title":"Patagopteryx","context_page_description":"Patagopteryx est un genre monotypique éteint d'oiseaux ornithuromorphes qui a vécu au Crétacé supérieur, il y a environ 80 millions d'années, dans ce qui est maintenant la Sierra Barrosa dans le nord-ouest de la Patagonie, en Argentine. De la taille d'un poulet, il s'agit du premier exemple connu sans équivoque d'incapacité secondaire à voler : son squelette montre des indications claires que les ancêtres de Patagopteryx étaient des oiseaux volants.\\nSitués dans les strates de la formation santonienne du Bajo de la Carpa, les vestiges d'origine ont été découverts par Oscar de Ferrariis, directeur du Musée d'histoire naturelle de l'Université nationale Comahue à Neuquén vers 1984-5. Il les a transmis au célèbre paléontologue José Bonaparte, qui a décrit l'espèce Patagopteryx deferrariisi en 1992."},{"page_url":"https://nds.wikipedia.org/wiki/Muus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Maus_im_Haus.JPG","page_title":"Muus","context_page_description":"Dit Woort hett noch annere Bedüden: kiek dorför ünner Muus.\\nEn Muus is en Gnaagdeert, dat sik in sien Levenswies an de Minschen anpasst hett. De Muus freet Koorn un annere Vörrät un warrt vundeswegen as Untüüch ankeken."},{"page_url":"https://en.wikipedia.org/wiki/Henry_Anderton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Anderton.jpg","page_title":"Henry Anderton","context_page_description":"Henry Anderton was an English painter, mainly known for his portraits."},{"page_url":"https://de.wikipedia.org/wiki/Herodot","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Butler_Orbis_Herodoti.jpg","page_title":"Herodot","context_page_description":"Herodot von Halikarnass war ein antiker griechischer Geschichtsschreiber, Geograph und Völkerkundler. Cicero verlieh ihm in seinem philosophischen Werk De legibus den bis heute oft zitierten Beinamen „Vater der Geschichtsschreibung“. Sein überliefertes Werk sind die wohl im 2. Jahrhundert v. Chr. in neun Bücher unterteilten Historien, die in Form einer Universalgeschichte den Aufstieg des Perserreichs im späten 6. Jahrhundert v. Chr. und die Perserkriege im frühen 5. Jahrhundert v. Chr. schildern.\\nDer von Herodot in den Historien aufgemachte geographische Horizont umfasste sogar die Randzonen der den Griechen seiner Zeit vorstellbaren Welt, in denen Raum für Fabelwesen und Phantasiebilder war. Die Zusammensetzung des persischen Heeres unter Xerxes I. beim Feldzug gegen die Griechen war Herodot aber auch Anlass, auf die vielfältigen Besonderheiten in äußerem Erscheinungsbild und Kultur der beteiligten Völkerschaften einzugehen. Zudem berief er sich auf die eigenen Eindrücke seiner ausgedehnten Reisen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%81%D0%B1%D0%B8%D0%BD%D0%B3,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8_%D0%A1%D0%B8%D0%BD%D0%B3%D0%BB%D0%B2%D1%83%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Bisbing%2C_Henry_Singlewood.jpg","page_title":"Бисбинг, Генри Синглвуд","context_page_description":"Генри Синглвуд Бисбинг — художник-анималист, пейзажист, гравер."},{"page_url":"https://pl.wikipedia.org/wiki/Saint-Maurice-des-Champs","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Eglise_Saint-Maurice-des-Champs_Clocher.JPG","page_title":"Saint-Maurice-des-Champs","context_page_description":"Saint-Maurice-des-Champs – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Saona i Loara.\\nWedług danych na rok 1990 gminę zamieszkiwało 66 osób, a gęstość zaludnienia wynosiła 11 osób/km²."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27arrondissement_de_Cherbourg","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Fa%C3%A7ade_du_ch%C3%A2teau%2C_R%C3%A9ville%2C_France.jpg","page_title":"Liste des monuments historiques de l'arrondissement de Cherbourg","context_page_description":"Cet article recense les monuments historiques situés dans l'arrondissement de Cherbourg, dans le département de la Manche."},{"page_url":"https://es.wikipedia.org/wiki/Isla_Madre_Sal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Bahia_jiquilisco.jpg","page_title":"Isla Madre Sal","context_page_description":"Isla Madre Sal​ es el nombre de una isla que pertenece al país centroamericano de El Salvador, ​ que se localiza en la Bahía de Jiquilisco, cerca del Océano Pacífico, en las coordenadas geográficas\\n13°13′N 88°30′O​ justo al sur de la isla San Dionisio, al este de la Isla El Espíritu Santo y al noroeste de las islas Pajarito y el Bajón. Su vegetación incluye palmeras y manglares. Administrativamente hace parte del Departamento salvadoreño de Usulután.​​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%9E%D7%A0%D7%9E%D7%9F_%D7%90%D7%99%D7%A8%D7%95%D7%A4%D7%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Siebenschl%C3%A4fer_im_Ge%C3%A4st.JPG","page_title":"נמנמן אירופי","context_page_description":"נַמְנְמָן אֵירוֹפִּי הוא מין יחיד בסוגו של מכרסם קטן ממשפחת הנמנמניים החי באירופה."},{"page_url":"https://ca.wikipedia.org/wiki/%C3%80nec_arbori_d%27Eyton","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Dendrocygna_eytoni_-Australia_Zoo%2C_Queensland%2C_Australia-8Jan2011.jpg","page_title":"Ànec arbori d'Eyton","context_page_description":"L'ànec arbori d'Eyton és un ocell de la família dels anàtids que habita aiguamolls, manglars, praderies i matolls en Austràlia, des de la Península del Cap York, cap al sud, fins Nova Gal·les del Sud."},{"page_url":"https://it.wikipedia.org/wiki/Ros%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Ros%C3%A0_ciclabile_%285%29.jpg","page_title":"Rosà","context_page_description":"Rosà è un comune italiano di 14 650 abitanti della provincia di Vicenza in Veneto.\\nIl comune ha 4 frazioni e confina con Bassano del Grappa, Cartigliano, Cassola, Rossano Veneto e Tezze sul Brenta. Il municipio si trova a 96 m sul livello del mare, nel cuore della pianura Veneta.\\nUn parco rurale di rilevanza comunitaria insiste sul territorio comunale, il Parco Civiltà delle Rogge, creato per preservare il nucleo delle numerose rogge che dal parco rurale si diramano, rogge alle quali il comune è molto legato fin dal loro scavo tra il 1360 e il 1370 e che hanno profondamente influenzato la crescita e lo sviluppo dell'agro rosatese."},{"page_url":"https://ga.wikipedia.org/wiki/Soho,_Midlands_Thiar","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Sohohouse1.JPG","page_title":"Soho, Midlands Thiar","context_page_description":"Is ceantar suite i mBirmingham é Soho."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B0%D0%BF%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BC%D1%96%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Coat_of_Arms_of_Anapa_%28Krasnodar_krai%29.png","page_title":"Анапський міський округ","context_page_description":"Ана́пський райо́н — адміністративна одиниця на півдні Росії. Розташований в південно-західній частині Краснодарського краю. Має кордони з Кримським і Темрюкським адміністративними районами, а також містом Новоросійськ."},{"page_url":"https://de.wikipedia.org/wiki/Ibaraki_(Ibaraki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Lake_Hinuma_04.jpg","page_title":"Ibaraki (Ibaraki)","context_page_description":"Ibaraki ist eine Stadt im Kreis Ost-Ibaraki der japanischen Präfektur Ibaraki. Sie liegt im Zentrum etwas abseits der Küste von Ibaraki am Westufer des Brackwassersses Hinuma, unmittelbar südlich der Hauptstadt Mito. Von Westen durch die Stadt fließt der Fluss Hinuma, der den See speist.\\nGegründet wurde die Stadt Ibaraki 1955 durch den Zusammenschluss der Stadt Nagaoka, der Dörfer Kawane, Kaminoai aus dem Kreis Ost-Ibaraki und dem Dorf Numasaki aus dem Kreis Kashima. 1958 wurde auch das Dorf Ishizaki im Nordosten eingemeindet, wodurch die Stadt abgesehen von kleineren Grenzkorrekturen ihre heutige Ausdehnung erreichte."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BC%D1%83%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%BB%D0%BE%D1%82%D0%B8%D0%BB%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/%D0%92%D0%BE%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%BF%D0%BE%D0%BD%D1%82%D0%BE%D0%BD_%D0%BD%D0%B0_%D0%90%D0%BC%D1%83%D1%80%D0%B5.JPG","page_title":"Амурская военная флотилия","context_page_description":"Аму́рская флоти́лия — несколько раз создававшееся объединение военных кораблей вооружённых сил России, различных периодов времени, на реке Амур и других реках Дальнего Востока.\\nВ литературе встречаются наименования — «Амурская речная флотилия», «Краснознамённая Амурская флотилия», «Амурская Красная речная флотилия», «КАФ»."},{"page_url":"https://ast.wikipedia.org/wiki/Rachel_Fuller_Brown","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Rachel_Fuller_Brown.jpg","page_title":"Rachel Fuller Brown","context_page_description":"Rachel Fuller Brown foi una química estauxunidense. Cola so socia Elizabeth Lee Hazen desenvolvió'l primera antibióticu efeutivu contra la enfermedá de fungos nos humanos, la meyora biomédico más importante dende'l descubrimientu de la penicilina dos décades antes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D0%B8%D1%8F_%D0%A0%D0%B5%D0%B4-%D0%A0%D0%B8%D0%B2%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Redrivermap.jpg","page_title":"Кампания Ред-Ривер","context_page_description":"Кампания Ред-Ривер известна так же как Экспедиция Ред-Ривер, представляла собой серию сражений на берегах Ред-Ривера в Луизиане во время американской гражданской войны. Кампания длилась с 10 марта по 22 мая 1864 года. В этой кампании, начатой по инициативе Союза, федеральная армия генерал-майора Натаниэля Бэнкса численностью примерно 30 000 человек действовала против отрядов генерал-лейтенанта Ричарда Тейлора, численность которых варьировалась от 6000 до 15 000."},{"page_url":"https://en.wikipedia.org/wiki/Cape_Irizaki","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Yonaguni_irizaki.jpg","page_title":"Cape Irizaki","context_page_description":"Cape Irizaki is the western tip of Yonaguni Island and the westernmost point in Japan. The cape is within the town of Yonaguni, Okinawa.\\nThere is a lighthouse, an observation platform, and a monument titled \\"Monument of the Westernmost Point of Japan\\" on the cape. Tourists gather at the cape daily to see the final sunset in Japan."},{"page_url":"https://pl.wikipedia.org/wiki/Bystrzyca_(dop%C5%82yw_Wieprza)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Lublin_dzielnice.png","page_title":"Bystrzyca (dopływ Wieprza)","context_page_description":"Bystrzyca – największy lewobrzeżny dopływ Wieprza, jedna z rzek Wyżyny Lubelskiej. Swoje źródła ma w Sulowie. Przepływa przez Lublin. Całkowita długość rzeki wynosi 70,3 km, a powierzchnia jej dorzecza 1315,5 km². Poniżej miejscowości Spiczyn uchodzi do Wieprza."},{"page_url":"https://ms.wikipedia.org/wiki/Saint-Avit,_Dr%C3%B4me","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Saint_Avit_Dr%C3%B4me.JPG","page_title":"Saint-Avit, Drôme","context_page_description":"Saint-Avit ialah komun di jabatan Drôme di tenggara Perancis."},{"page_url":"https://de.wikipedia.org/wiki/G%C3%A4rten_der_Welt","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Karl-Foerster-Staudengarten_%2815047871965%29.jpg","page_title":"Gärten der Welt","context_page_description":"Die Parkanlage Gärten der Welt liegt am nördlichen Fuß des Kienbergs im Berliner Ortsteil Marzahn des Bezirks Marzahn-Hellersdorf. Der Park wurde am 9. Mai 1987 anlässlich der 750-Jahr-Feier Berlins nach Plänen des damaligen Stadtgartendirektors in Ost-Berlin, Gottfried Funeck, als Berliner Gartenschau und Geschenk der Gärtner an die Hauptstadt der DDR eröffnet. Er umfasste damals rund 21 Hektar und bildete ein Gegenstück zum Britzer Garten, der 1985 zur BUGA in West-Berlin eingeweiht worden war.\\nZusammen mit den angrenzenden frei zugänglichen Erholungsflächen des Kienbergs und dem direkt östlich anschließenden Wuhletal ergibt sich eine Gesamtfläche von mehr als 100 Hektar. Betrieben wird der Park von der Grün Berlin Park und Garten GmbH, einer Gesellschaft des Landes Berlin, die auch weitere Gärten und Parks betreibt. Der Park kann nur gegen Eintrittsgeld besucht werden."},{"page_url":"https://en.wikipedia.org/wiki/Kata_Farm","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Kata_g%C3%A5rd_i_Varnhem.jpg","page_title":"Kata Farm","context_page_description":"Kata Farm is the remains of a large Viking-age farming estate, located in Varnhem, Västra Götaland. The ruins include a crypt dated to the late 10th century A.D., which could make it the oldest Christian church in Sweden. Until recently, Sweden was considered to have begun its Christianisation in the year 1000, when the king Olof Skötkonung was baptised by the English missionary-bishop Sigfrid of Sweden. The name Kata Farm derives from one of its presumed owners, a woman named Kata, who lived in the early 11th century A.D., and whose grave has been found on the grounds.\\nThe original church built on the estate in the late 10th century was made of wood. It was later replaced with a larger church building, made of stone.\\nIt is evident that builders from outside of Västergötland – most likely from Denmark, Germany, and England – erected the stone structure, as such building methods were not known in Sweden at the time. This may however have started a trend in Västergötland to build churches of stone, as these proliferate from the 11th century onwards. Churches at the time were built on private estates, and were a sign of the wealth and power of the landowners."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8F%D0%BE%D1%83%D0%BD%D1%81%D0%B2%D0%B8%D0%BB_(%D0%98%D0%BD%D0%B4%D0%B8%D1%98%D0%B0%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Jonesville%2C_Indiana.jpg","page_title":"Џоунсвил (Индијана)","context_page_description":"Џоунсвил град је у америчкој савезној држави Индијана."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC_%D0%A3%D0%BE%D1%80%D0%BD%D1%8A%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Sam_Warner_-_Feb_1919_MPW.jpg","page_title":"Сам Уорнър","context_page_description":"Самюел Луис „Сам“ Уорнър е американски филмов продуцент от полско-еврейски произход, съосновател и изпълнителен директор на Уорнър Брос.\\nПродуцира „The Jazz Singer“ – първия в историята пълнометражен филм със синхронно озвучаване на репликите. Умира от пневмония на 5 октомври 1927 г., един ден преди премиерата му."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B5%99%E6%B1%9F%E8%AF%AD%E8%A8%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Wu_Dialects.png","page_title":"浙江语言","context_page_description":"浙江的汉语分布情况较为复杂，境内三大汉语变体为吴语、闽语和徽语。吴语是境内使用人口比例最高的汉语分支，省内第二大方言为闽语，闽南话使用人口主要分布在平阳县西部、苍南县西部和南部、洞头县大部、玉环市的坎门以及长兴县部分地区，其使用人口约在200万，而闽东话则主要分布于泰顺县南部和苍南县东部沿海平原上，约聚居了20万左右使用人口。徽语是第三大方言，主要在在淳安县和建德市使用。此外，省内的主要少数民族-畬族所使用畲话，受客家话影响较大，常被认为是客家语的一种变种。"},{"page_url":"https://ms.wikipedia.org/wiki/Filateli","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Cover_US_philatelic_1925.jpg","page_title":"Filateli","context_page_description":"Filateli merupakan aktiviti mengumpul dan menyusun bahan-bahan pos seperti setem pos, surat, sampul surat, dan bahan-bahan lain. Koleksi ini, sama ada setem, sampul-sampul surat, dan lain-lain selalunya didokumenkan untuk mengesan peristiwa-peristiwa besar dan bersejarah, serta peristiwa-peristiwa yang lain."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A8%D0%B0%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D1%86%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Sir_Walter_Scott_-_Raeburn.jpg","page_title":"Шатландцы","context_page_description":"Шатландцы — народ, карэнныя насельнікі Шатландыі. Акрамя таго, жывуць у іншых месцах Вялікабрытаніі, ЗША, Канадзе, Аўстраліі і г. д. Агульная колькасць у свеце - каля 18 млн. чал."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A1%E0%B8%B0%E0%B8%AE%E0%B9%8C%E0%B8%94%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Imam_Mahdi.png","page_title":"มะฮ์ดี","context_page_description":"ตามแนวคิดทางอวสานวิทยาของศาสนาอิสลาม มะฮ์ดี คือบุคคลหนึ่ง ที่นบีมุฮัมมัดพยากรณ์ว่าจะมาขจัดความชั่วร้าย และปกครองโลกเป็นเวลาหลายปี และสร้างสันติสุขบนโลกก่อนที่ถึงวันกิยามะฮ์"},{"page_url":"https://ja.wikipedia.org/wiki/%E8%88%9E%E6%B4%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/%E8%88%9E%E6%B4%B2.JPG","page_title":"舞洲","context_page_description":"舞洲は、大阪府大阪市此花区にある人工島。面積は約220ヘクタール。\\n新都心の開発を目指して、1988年に策定された「テクノポート大阪」計画の対象となった人工島3地区の一つ。大阪北港の一画を占め、レジャー施設や物流拠点などが誘致されている。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D1%82%D1%82%D1%96%D0%BD%D0%B3%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Mettingen_Figuren.jpg","page_title":"Меттінген","context_page_description":"Меттінген — громада в Німеччині, знаходиться в землі Північний Рейн-Вестфалія. Підпорядковується адміністративному округу Мюнстер. Входить до складу району Штайнфурт.\\nПлоща — 40 км². Населення становить 11 644 ос."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BF%91%E9%89%8450000%E7%B3%BB%E9%9B%BB%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/KINTETSU50000_F3.JPG","page_title":"近鉄50000系電車","context_page_description":"近鉄50000系電車は、近畿日本鉄道の特急形車両。6両編成3本が在籍する。建造費は2編成で37億円\\n。追加の3編成目の製作費は14.5億円。\\n「しまかぜ」の車両愛称を持つ。名称の由来は、志摩に吹く風の爽やかさと、車内で過ごす時間の心地よさから名づけられた 。\\n解説の便宜上、本項では大阪難波側の先頭車の車両番号+Fを編成名として記述する。また、賢島方面に向かって右側を「海側」・左側を「山側」と記述する。"},{"page_url":"https://en.wikipedia.org/wiki/LSWR_S15_class","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/SR_828.jpg","page_title":"LSWR S15 class","context_page_description":"The LSWR S15 class was a British 2-cylinder 4-6-0 freight steam locomotive designed by Robert W. Urie, based on his H15 class and N15 class locomotives. The class had a complex build history, spanning several years of construction from 1920 to 1936. The first examples were constructed for the London and South Western Railway, where they hauled freight trains to the south coast ports and further west to Exeter, as well as occasional passenger work in conjunction with their larger-wheeled N15 class counterparts.\\nFollowing the Grouping of railway companies in 1923, the LSWR became part of the Southern Railway, and the Chief Mechanical Engineer of the newly formed company, Richard Maunsell, increased the S15 class strength to 45 locomotives. Maunsell incorporated several improvements, notably to the steam circuit and the locomotive's loading gauge, allowing it to operate on routes with height and width restrictions.\\nThe new locomotives were built in three batches at Eastleigh, and were in service with the Southern Railway for 14 years. The locomotives continued in operation with the Southern Region of British Railways until 1966."},{"page_url":"https://hr.wikipedia.org/wiki/Nassau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/NAS_US_departures.jpg","page_title":"Nassau","context_page_description":"Nassau je glavni i najveći grad države Bahami. Smješten je na najvećem bahamskom otoku New Providence. Prema podacima iz 2013. godine ima oko 260.000 stanovnika, što čini oko 80% ukupne populacije. Predstavlja kulturno i gospodarsko središte zemlje."},{"page_url":"https://sq.wikipedia.org/wiki/Peja","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Qarshia_e_Pejes_1.jpg","page_title":"Peja","context_page_description":"Peja është qytet dhe komunë ndodhur në Rajonin e Pejës në Kosovë. Po ashtu Peja është qendër e komunës dhe rajonit e të njëjtit emër. Ky qytet shtrihet rreth koordinantav gjeografike: 42° 39 V dhe 20° 18 L.\\nPeja njihet si qytet i lashtë që nga koha Ilire. Për shkak të luftërave të shumta në këtë rajon, që nga pushtimi Otoman e deri te kjo e fundit me Serbinë, nuk është mundur të ruhet e gjithë karakteristika ilire, ku përveç tjerash pësoi edhe Kalaja e Pejës.\\nNë kohën Ilire ishte një qendër e madhe vendbanimi. Sipas hulumtimeve arkeologjike ky qytet kishte edhe një kala, mbi gërmadhat e lashta të së cilës mjerisht është ngritur fabrika e akumullatorëve.\\nRegjimi serbosllav u mundua disa kisha katolike të mbetura në shumë vende të Kosovës që nga koha Ilire ti shëndërrojë në kisha ortodokse si p.sh. Patrikanën në Grykë të Rugovës.\\nKarakteristikë e saj është Çarshi-Xhamia e ndërtuar rreth viteve 1600 - 1700 si dhe Kulla e Haxhi Zekës. Haxhi Zeka ishte pjesëmarrës në Kuvendin e Prizrenit në vitin 1878 dhe organizator i Lidhjes së Pejës në vitin 1899. Në kohën e tij Peja i takonte Mbretërisë së Malit të Zi."},{"page_url":"https://fr.wikipedia.org/wiki/Sant_Mart%C3%AD_Sarroca","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Localitzaci%C3%B3_de_Sant_Mart%C3%AD_Sarroca.png","page_title":"Sant Martí Sarroca","context_page_description":"Sant Martí Sarroca est une commune de la province de Barcelone, en Catalogne, en Espagne, de la comarque d'Alt Penedès"},{"page_url":"https://en.wikipedia.org/wiki/Belgian_Navy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/LEOPOLD_I_6876.JPG","page_title":"Belgian Navy","context_page_description":"The Belgian Navy, officially the Belgian Marine Component of the Belgian Armed Forces, is the naval service of Belgium."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Magdeburg-Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Korn_Jenny_Stolperstein_Magdeburg.jpg","page_title":"Liste der Stolpersteine in Magdeburg-Altstadt","context_page_description":"Die Liste der Stolpersteine in Magdeburg-Altstadt enthält die Stolpersteine im Magdeburger Stadtteil Altstadt, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Sie ist nach Nachnamen sortiert und listet Namen, Standorte. Die Tabelle erfasst insgesamt 303 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://sv.wikipedia.org/wiki/S%C3%B6dra_underh%C3%A5llsregementet","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/AM.019937_01.jpg","page_title":"Södra underhållsregementet","context_page_description":"Södra underhållsregementet, var ett lednings- och underhållsförband inom svenska Försvarsmakten som verkade åren 1994–2001. Förbandsledningen var förlagd i Kristianstads garnison i Kristianstad."},{"page_url":"https://lmo.wikipedia.org/wiki/Stazion_de_Monterotondo-Mentana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Stazione_Monterotondo.jpg","page_title":"Stazion de Monterotondo-Mentana","context_page_description":"La Stazion de Monterotondo-Mentana a l'è 'na stazion ferroviaria di Ferrovie Laziali in del comun de Monterotondo. L'è verta dal 1864 e l'è in su la linia ferrovia Firenze-Roma. A l'è foeura de l'aria tariffaria urbana romana."},{"page_url":"https://de.wikipedia.org/wiki/Karlsruher_Dreiecksrennen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Bundesautobahn_A5%2C_Autobahndreieck_Karlsruhe.jpg","page_title":"Karlsruher Dreiecksrennen","context_page_description":"Das Karlsruher Dreiecksrennen war eine der zahlreichen Rennsportveranstaltungen auf temporären Motorsport-Rennstrecken, die nach dem Zweiten Weltkrieg in Deutschland auf meist öffentlichen Straßen eingerichtet wurden. Das Karlsruher Dreiecksrennen wurde auf Teilen der A 8 und der A 5 am auch heute noch so genannten Karlsruher Dreieck veranstaltet. In einigen Quellen wird die Veranstaltung nach dem Stadtteil Karlsruhe-Durlach benannt."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AF%D8%A7%D8%B1%D8%A7_%D8%B3%D9%88%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Darius_III_of_Persia.jpg","page_title":"دارا سوم","context_page_description":"ہخامنشی خاندان کا آخری بادشاہ جو اردشیر سوم کے تخت پر بیٹھا۔ اردشیر نے اسے آرمینیا کا گورنر مقرر کیا تھا۔ بڑا لائق اور دلیر تھا۔ اسس اوراربیلا کی جنگوں میں سکندر اعظم کی فوجوں سے مقابلہ کیا مگر شکست کھائی اور شمال کی طرف فرار ہو گیا۔ جہاں باختر کے ایرانی گورنر بے سس نے اسے گرفتار کر کے قتل کر دیا۔ سکندر جس وقت دمغان پہنچا تو اسے ایرانی کیمپ میں دارا کی لاش ملی۔ اس کے قتل کے بعد ایرانی سلطنت کا خاتمہ ہو گیا۔"},{"page_url":"https://cs.wikipedia.org/wiki/Hanspaulka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Praha%2C_Dejvice%2C_usedlost_Hercovka.jpg","page_title":"Hanspaulka","context_page_description":"Hanspaulka je vilová oblast v pražské čtvrti Dejvice, která zaujímá spolu s vilovou oblastí Baba vyvýšené území, vymezené údolím Šáreckého potoka, skalním ostrohem na východní straně Baby, nárazovým břehem meandrů Vltavy, údolím bývalého Dejvického potoka a umělým zářezem v místě Horoměřické ulice. Toto území bylo historicky souvisle osídleno již od staršího paleolitu. Ve středověku se jednalo o viničnou oblast s mnoha vinohrady a několika usedlostmi. Podle největší z nich – usedlosti Hanspaulka dostala oblast své dnešní jméno. Jako obytná čtvrť vznikla ve 20. letech 20. století v rámci rozšiřování hlavního města Československa Prahy. Do druhé světové války zde bylo vystavěno mnoho architektonicky zajímavých vil a rodinných domů – především se jedná o funkcionalistické stavby, oblast získala vlastní školu a další občanskou vybavenost. Na Hanspaulce bydlelo a bydlí mnoho významných osobností, ze sedmdesátých let 20. století je velmi známé tzv. hanspaulské hudební hnutí, v rámci kterého vzniklo několik význačných hudebních skupin, ve sportu nese jméno Hanspaulky tzv. Hanspaulská liga v malém fotbalu."},{"page_url":"https://it.wikipedia.org/wiki/Santuario_della_Madonna_della_Ghianda","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/SommaLombardo_MadonnaGhianda.jpg","page_title":"Santuario della Madonna della Ghianda","context_page_description":"Alla Madonna della Ghianda è dedicato l'omonimo santuario del comune di Somma Lombardo, in provincia di Varese."},{"page_url":"https://en.wikipedia.org/wiki/House_of_Khumalo","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Mzilikazi%27s_migration_from_Zululand_to_Matabeleland%2C_1823_to_1838.png","page_title":"House of Khumalo","context_page_description":"The House of Khumalo is the reigning Royal Family of the former Mthwakazi Kingdom. The Mthwakazi Kingdom was founded in 1823 by Mzilikazi kaMatshobana. While the Mthwakazi Kingdom ended in 1894 with the First Matabele War, The house has endured to the present day.\\nThere is no way Nkulumane descendants can claim the throne. In Ndebele a King is born of a King. Nkulumane never was King. Lobhengula's descendants are the one's who can rule. Making Bulelani Lobhengula inkosi."},{"page_url":"https://de.wikipedia.org/wiki/Putschversuch_in_der_T%C3%BCrkei_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/160801-D-PB383-016_US-General_Joseph_F._Dunford_Jr._tours_parts_of_the_Turkish_Grand_National_Assembly_that_were_destroyed_during_the_failed_July_15_coup_in_Ankara.JPG","page_title":"Putschversuch in der Türkei 2016","context_page_description":"Der Putschversuch in der Türkei 2016 in der Nacht vom 15. auf den 16. Juli 2016 war ein gescheiterter Putsch von Teilen des türkischen Militärs, der zum Ziel gehabt haben soll, die türkische Regierung mit Staatspräsident Recep Tayyip Erdoğan und dem Kabinett Yıldırım zu stürzen.\\nIn Ankara und Istanbul kam es zu schweren Angriffen und Zusammenstößen mit der Zivilbevölkerung. Bürgern in Ankara und Istanbul gelang es jedoch, viele Putschisten am weiteren Vorstoßen zu hindern, indem sie sich, oft in Gruppen, ihren Panzern in den Weg stellten. Dies hat entscheidend dazu beigetragen, dass der Putsch niedergeschlagen werden konnte.\\nSimultan zu den Kampfhandlungen in Ankara und Istanbul ging ein Teil der Putschisten dazu über, das Parlament, den Geheimdienst Millî İstihbarat Teşkilâtı und das Dezernat für Sondereinsätze der türkischen Polizei in Ankara anzugreifen.\\nNach ersten offiziellen Angaben gab es 249 Todesopfer. Die Zahl der verwundeten Menschen wurde mit über 2000 angegeben.\\nIn den Morgenstunden des 16. Juli 2016 flog eine Sondereinheit an Putschsoldaten mit der Absicht nach Marmaris, Präsident Erdoğan zu töten oder festzunehmen, der dort mit Familie und Stab gerade Urlaub machte."},{"page_url":"https://it.wikipedia.org/wiki/Paolo_Toschi_(incisore)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Paolo_Toschi_by_Carlo_Raimondi.jpg","page_title":"Paolo Toschi (incisore)","context_page_description":"Paolo Toschi è stato un incisore e architetto italiano, tra i maggiori protagonisti della vita artistica e culturale del Ducato di Parma del XIX secolo."},{"page_url":"https://vi.wikipedia.org/wiki/T%C3%A2m_l%C3%BD_h%E1%BB%8Dc_%C4%91%C3%A1m_%C4%91%C3%B4ng","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Gustave_Le_Bon.jpg","page_title":"Tâm lý học đám đông","context_page_description":"Tâm lý học đám đông còn được gọi là tâm lý đám đông là một nhánh của Tâm lý học xã hội nghiên cứu về tâm lý và hành xử của một người bình thường trong những hoạt động mang tính chất tập thể. Các nhà tâm lý xã hội đã phát triển một số lý thuyết để giải thích cách mà tâm lý của đám đông khác và tương tác với tâm lý của các cá nhân bên trong nó.\\nCác nhà lý thuyết chính trong tâm lý của đám đông bao gồm Gustave Le Bon, Gabriel Tarde, Sigmund Freud và Steve Reicher. Lĩnh vực này liên quan đến các hành vi và quá trình suy nghĩ của cả các thành viên đám đông riêng lẻ và đám đông như một thực thể. Hành vi của đám đông chịu ảnh hưởng nặng nề từ việc mất đi trách nhiệm của cá nhân và ấn tượng về tính phổ biến của hành vi, cả hai đều tăng theo quy mô của đám đông.\\nTheo Gustave Le Bon, trong cuốn ''Tâm lý học đám đông'', những đám đông luôn bị vô thức tác động, họ xử sự như người nguyên thuỷ, người dã man, không có khả năng suy nghĩ, suy luận, mà chỉ cảm nhận bằng hình ảnh, bằng sự liên kết các ý tưởng, họ không kiên định, thất thường, và đi từ trạng thái nhiệt tình cuồng loạn nhất đến ngây dại ngớ ngẩn nhất."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D0%B1%D0%B0%D0%B0%D0%BB_(%D1%86%D0%B0%D1%80%D1%8C_%D0%90%D1%80%D0%B2%D0%B0%D0%B4%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Battle_of_salamis.png","page_title":"Мербаал (царь Арвада)","context_page_description":"Мербаал — царь Арвада в начале V века до н. э."},{"page_url":"https://pt.wikipedia.org/wiki/Extintor","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Extintor736.JPG","page_title":"Extintor","context_page_description":"Um extintor de incêndio ou simplesmente extintor é um equipamento de segurança que possui a finalidade de extinguir ou controlar principios de incêndios em casos de emergência. Em geral, é um cilindro que pode ser carregado até o local do foco do incêndio, contendo um agente extintor sob pressão."},{"page_url":"https://de.wikipedia.org/wiki/Rotz_(Krankheit)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Erschossenes_Rotzpferd.jpg","page_title":"Rotz (Krankheit)","context_page_description":"Der Rotz ist primär eine Krankheit der Einhufer, die durch das vor allem in Afrika, Asien und Südamerika vorkommende Bakterium Burkholderia mallei verursacht wird. Auch Menschen und andere Säugetiere können sich mit Rotz infizieren. Die Erkrankung ist gekennzeichnet durch spezifische, eitrig-einschmelzende Prozesse in den oberen Atemwegen, der Lunge sowie in Form von Knoten, Geschwüren und Abszessen der Haut und der Schleimhäute. Der Verlauf variiert zwischen akut und chronisch, wobei sich deutliche Speziesunterschiede zeigen. Pferde können sich latent infizieren und sorgen als einziges natürliches Erregerreservoir für die weitere Verbreitung der Krankheit. Die Übertragung erfolgt durch den direkten oder indirekten Kontakt mit infektiösen Körperausscheidungen, häufige Eintrittspforten des Erregers sind die Schleimhäute des Kopfes sowie die äußere Haut.\\nDie Zoonose Rotz tritt beim Menschen selten auf und verläuft unbehandelt oft tödlich. Eine antibiotische Therapie gestaltet sich langwierig und gelegentlich schwierig. Wirksame Impfungen existieren nicht. Arbeiten mit dem Erreger sind auf Labore der Sicherheitsstufe 3 und höher begrenzt."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%DB%8C%D8%AF%D9%84%DB%8C%D9%86%DA%AF%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Kidlington_Railway_Station.jpg","page_title":"کیدلینگتون","context_page_description":"کیدلینگتن یک روستای بزرگ بین رودخانه چرول و کانال آکسفورد و در جنوب غربی بیکستر در آکسفوردشر می‌باشد. جمعیت این منطقه در سال ۲۰۱۱ تعداد ۱۳٬۷۲۳ نفر ثبت شده است."},{"page_url":"https://en.wikipedia.org/wiki/Motrio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Motrio_Ireland_Trade_Fair_2018.jpg","page_title":"Motrio","context_page_description":"Motrio is a brand of automotive spare parts launched by Renault in 1998. covering both Renault/Dacia vehicles and other brands. The objective of Motrio is to propose an alternative range to Renault genuine parts. Motrio became also a multibrand network of repairers in 2003."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A4%E0%A6%BE%E0%A6%B6%E0%A6%96%E0%A6%A8%E0%A7%8D%E0%A6%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Kukeldash_Madrasah_inner_yard.jpg","page_title":"তাশখন্দ","context_page_description":"তাশখন্দ উজবেকিস্তানের রাজধানী এবং বৃহত্তম শহর, এমনকি প্রাক্তন সোভিয়েত কেন্দ্রীয় এশিয়ার সবচেয়ে জনবহুল শহর। তাশখন্দ, কাজাখস্তান সীমান্তের নিকটবর্তী উত্তর-পূর্বে অবস্থিত। ২০১৮ সালে উজবেকিস্তানের জনসংখ্যা ছিল প্রায় ২, ৪৮৫, ৯০০ জন। ১৯৬৬ সালের তাশখন্দের ভূমিকম্পে শহরটির বেশিরভাগ অংশ ধ্বংস হয়ে যায়, যদিও এটি পরে সোভিয়েত শহরের মডেল হিসাবে এটিকে পুনর্নির্মাণ করা হয়েছিল।\\n৮ম শতাব্দীতে ইসলামিক সংস্কৃতির আগমনের পূর্বে তাশখন্দ তার প্রাথমিক ইতিহাসে সোগদিয়ান এবং তুর্কি সংস্কৃতি দ্বারা প্রভাবিত ছিল। ১২১৯ সালে চেঙ্গিস খান তাশখন্দ আক্রমণ করেন, এরপর শহরটি পুনর্নির্মাণ করা হয়, এবং সিল্ক রোড এর সাথে সংযুক্ত করা হয়। ১৮ থেকে ১৯ শতক অবধি, কোকান্দের খানাটের দ্বারা পুনরায় বিজয়ের আগ পর্যন্ত এই শহরটি একটি স্বাধীন নগর-রাজ্য হিসেবে পরিচিত ছিল। ১৮৬৫ সালে, রাশিয়ান সাম্রাজ্যের কাছে এর পতন ঘটে এবং রাশিয়ান তুর্কিস্তানের রাজধানী হয়। সোভিয়েত সময়ে, সোভিয়েত ইউনিয়ন এর অধীনে এ শহরের প্রবৃদ্ধি এবং জনসংখ্যার বেশ পরিবর্তন লক্ষ্য করা যায়। যা মূলত সোভিয়েত ইউনিয়নে জোর করে নির্বাসন দেওয়ার কারণে হয়।\\nআজ, একটি স্বাধীন উজবেকিস্তানের রাজধানী হিসাবে, তাশখন্দে বহু-জাতিগত জনসংখ্যা রয়েছে। এবং এখানে উজবেক হল সংখ্যাগরিষ্ঠ জাতি। ২০০৯ সালে, শহরটি তার ২, ২০০ বছরের ইতিহাস উদযাপন করে।"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A6%E3%83%AA%E4%BA%9C%E7%B6%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Lilium_japonicum_Sasayuri_in_Kasagatake_2001-7-28.jpg","page_title":"ユリ亜綱","context_page_description":"ユリ亜綱 は被子植物のタクソンの一つで、ユリ科を含む亜綱の階級に置かれているものである。単子葉植物の下位区分。代表的な分類体系では、クロンキスト体系がこのタクソンを認識している。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B2%B4%EB%A5%B4%EB%8B%88%ED%9E%88%EC%9A%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/BudArhiepiskop.JPG","page_title":"체르니히우","context_page_description":"체르니히우는 우크라이나 북부에 위치한 도시로 체르니히우주의 주도이며 면적은 79km², 인구는 300,500명, 인구 밀도는 1,547명/km²이다."},{"page_url":"https://pt.wikipedia.org/wiki/Cheshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/County_Flag_of_Cheshire.png","page_title":"Cheshire","context_page_description":"Cheshire é um condado da Inglaterra e o seu significado corresponde a uma expressão inglesa para uma pessoa que vive sorrindo ou ri muito.\\nLewis Carrol, autor de Alice no País das Maravilhas, que morou em Oxford, Inglaterra, utilizou Cheshire como o nome de um gato que Alice encontra no País das Maravilhas, o Cheshire Cat ou Gato Careteiro. Cheshire é famosa por ser sede da Bentley."},{"page_url":"https://ia.wikipedia.org/wiki/Republica_Roman","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Consul_et_lictores.png","page_title":"Republica Roman","context_page_description":"Le Republica Roman esseva le periodo del civilisation roman que habeva un forma republican de governamento. Illo comenciava in 509 aEC cum le subversion del monarchia roman, que esseva reimplaciate per duo capites conjuncte, le Consules, eligite pro servir un anno de mandato per, e sempre consultante cum, un assemblea de Patricios dicte Senato.\\nDurante le prime duo seculos de su existentia le Republica conquireva tote le peninsula italian. Durante le sequente seculos illo conquireva anque Africa del Nord, le Peninsula Iberic, Grecia, Gallia e un parte significante del Mediterraneo oriental.\\nUn serie de guerras civil poneva fin al historia del Res Publica, in conducer al formation del Imperio Roman in 27 aEC."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D1%80%D1%85%D0%B0%D0%B2%D0%BA%D0%B0_%D0%B3%D1%96%D0%B3%D0%B0%D0%BD%D1%82%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Giant_Puffball.jpg","page_title":"Порхавка гігантська","context_page_description":"Порхавка гігантська, лангерманія гігантська — їстівний вид грибів з родини Печерицевих."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_de_Tunis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Tunis_Mosqu%C3%A9e_Ksar.JPG","page_title":"Histoire de Tunis","context_page_description":"L'histoire de Tunis, la principale ville de la Tunisie, commence avant même celle de Carthage. L'existence de la localité est attestée dès le début du IVᵉ siècle av. J.-C. En raison de sa position géostratégique, elle attire la convoitise de toutes les civilisations méditerranéennes et passe successivement sous la domination des Numides, des Phéniciens, des Grecs, des Romains, des Arabes, des Espagnols, des Ottomans et des Français, avant que le pays ne devienne indépendant.\\nTunis est située au nord-est de la pointe extrême du continent africain, au bord du golfe de Tunis, à proximité immédiate de Carthage. Elle devient la capitale de la Tunisie avec l'avènement de la dynastie des Hafsides en 1229. Confirmée dans son statut après l'indépendance, elle devient également le chef-lieu du gouvernorat du même nom depuis sa création en 1956."},{"page_url":"https://nl.m.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1988","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Marleen_van_Iersel_FIVB_World_Tour_2010.jpg","page_title":"Lijst van personen geboren in 1988","context_page_description":"Dit is een lijst van personen die geboren zijn in 1988.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Aylmer_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Aylmer_Lake%2C_Northwest_Territories_map_01.jpg","page_title":"Aylmer Lake","context_page_description":"Aylmer Lake is a lake along the Lockhart River in the Northwest Territories of Canada. Of lakes in the Northwest Territories, it is the seventh largest."},{"page_url":"https://en.wikipedia.org/wiki/Jacopo_da_Empoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Ritratti_dei_membri_illustri_dell%27accademia_del_disegno%2C_08_l%27empoli.jpg","page_title":"Jacopo da Empoli","context_page_description":"Jacopo da Empoli was an Italian Florentine Reformist painter.\\nBorn in Florence as Jacopo Chimenti, he worked mostly in his native city. He apprenticed under Maso da San Friano. Like his contemporary in Counter-Maniera, Santi di Tito, he moved into a style often more crisp, less contorted, and less crowded than mannerist predecessors like Vasari. He collaborated with Alessandro Tiarini in some projects. His younger brother, Domenico Chimenti, born in Empoli, was also a painter. Among his pupils were Felice Ficherelli, Giovanni Battista Brazzè, Giovanni Battista Vanni, and Virgilio Zaballi.\\nFinally, working in a thematic often shunned by Florentine painters, after the 1620s he completed a series of exceptional still-life paintings."},{"page_url":"https://sv.wikipedia.org/wiki/Lunddocka","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Glaucidium_palmatum_0a2.JPG","page_title":"Lunddocka","context_page_description":"Lunddocka är en ranunkelväxtart som beskrevs av Sieb. och Zucc.. Lunddockan hör som ensam art till släktet Glaucidium och familjen ranunkelväxter. Inga underarter finns listade i Catalogue of Life. Andra tidigare namn som figurerat på svenska är lönnvallmo (1986) och bägarlönn (1994, 1998)."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B6%D0%BE%D1%83%D0%BB%D0%B8_%D0%A4%D0%B8%D1%88%D1%8A%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Fisher%2C_Joely_%282007%29.jpg","page_title":"Джоули Фишър","context_page_description":"Джоули Фишър е американска актриса. Позната е с ролите си Пейдж Кларк и Джой Старк съответно в ситкомите „Елън“ и „До смърт“."},{"page_url":"https://vi.wikipedia.org/wiki/Nanh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Moschus_moschiferus_in_Plzen_zoo_%2812.02.2011%29.jpg","page_title":"Nanh","context_page_description":"Nanh là hai chiếc răng sắc nhọn dài bất thường mọc từ hàm trên phía trước thường là để dùng làm vũ khí tấn công, vũ khí phòng vệ hay làm công cụ để thực hiện động tác xé, xẻ thức ăn ở các loài động vật. Nanh được sử dụng là một vũ khí sử dụng dành cho những cú cắn chí mạng dùng để kết liễu đối phương hoặc dùng để tự vệ một cách hữu hiệu và cũng là dấu hiệu cảnh báo, phô trương sức mạnh để dọa nạt của các loài động vật, đôi khi nó còn là vũ khí quan trọng bậc nhất để đấu tranh sinh tồn trong tự nhiên.\\nỞ các loài động vật có vú, một chiếc nanh là một chiếc răng nanh, dùng để cắn và xé thịt. Đối với các loài rắn, nó là một chiếc răng để tiêm nọc độc gọi là nanh vòng. Nhện cũng có răng nanh, mà là một phần của họ Chelicerae, nanh cũng được ghi nhận ở các loài côn trùng như kiến càng. Răng nanh là phổ biến nhất trong các loài ăn thịt hay động vật ăn tạp, nhưng một số động vật ăn cỏ, chẳng hạn như con dơi ăn quả. Chúng thường được sử dụng để giữ hoặc nhanh chóng giết chết con mồi, chẳng hạn như ở các loài mèo lớn\\nNhững động vật ăn tạp, ví dụ như gấu, sử dụng những chiếc răng nanh của chúng khi đi săn cá hay con mồi khác, nhưng chúng không cần thiết cho việc ăn trái cây."},{"page_url":"https://en.wikipedia.org/wiki/List_of_protected_heritage_sites_in_Bouillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Bouillon_omgeving_%28144%29.JPG","page_title":"List of protected heritage sites in Bouillon","context_page_description":"This table shows an overview of the protected heritage sites in the Walloon town Bouillon. This list is part of Belgium's national heritage."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8F%AF%E5%8F%AF%C2%B7%E7%BE%85%E6%81%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Coco_Rocha_in_Bill_Blass_by_Peter_Som_February_2008%2C_Photographed_by_Ed_Kavishe_for_Fashion_Wire_Press.jpg","page_title":"可可·羅恰","context_page_description":"可可·羅恰，生於加拿大多倫多，加拿大超級模特、舞蹈家和慈善家。"},{"page_url":"https://de.wikipedia.org/wiki/Vitus_Auslasser","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/138_Auslasser_Plantago_media.jpg","page_title":"Vitus Auslasser","context_page_description":"Vitus Auslasser, auch Veit Auslasser, war ein Benediktinermönch im St. Sebastianskloster in Ebersberg bei München. Ursprünglich stammte er aus Vomp bei Schwaz im heutigen Tirol. Er starb im 15. Jahrhundert.\\n1479 vollendete er ein Herbar mit 198 Pflanzendarstellungen mit für die Forschung noch heute bedeutsamen mittellateinischen und deutschen Pflanzennamen, das zusammen mit den Aquarellen von Erhard Reewiijk den Beginn einer Reihe von ähnlichen Werken bildet, die in die Darstellungen von Georg Öllinger und Samuel Quicchelberg Mitte des 16. Jahrhunderts mündet."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CF%8D%CE%BC%CE%B7_%CE%91%CE%B9%CE%BF%CE%BB%CE%AF%CE%B4%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Phocaea_mapa-es.jpg","page_title":"Κύμη Αιολίδας","context_page_description":"H Κύμη ήταν αρχαία πόλη των Αιολέων στα βορειοδυτικά παράλια της Μικράς Ασίας. Ο Στράβων τοποθετεί την πόλη βόρεια του Έρμου ποταμού στην θέση του σημερινού Τουρκικού χωριού Namurt. Η Κύμη θεωρούταν η ισχυρότερη και η σπουδαιότερη πόλη της Αιολικής Δωδεκάπολης. Ως παράλια πόλη είχε αναπτύξει ιδιαίτερα το εμπόριο. Όπως αναφέρει ο Ηρόδοτος ήταν μία από τις πόλεις στις οποίες είχε καταφύγει ο Λυδός κυβερνήτης Πακτύης μετά την αποτυχημένη επανάσταση που παρακίνησε εναντίον των Περσών."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B8_%D0%A1%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Novi_sad_map_1805.jpg","page_title":"Нови Сад","context_page_description":"Нови Сад е главен град на северната српска покраина Војводина и административен центар на Јужно-бачкиот округ. Нови Сад е поврзан со предградијата Сремска Каменица и Петроварадин, кои заедно со 13 други населени места се дел од новосадската општина.\\nНови Сад е втор по големина град во Србија, по Белград. На најновиот попис од 2011, градот има урбано население од 277.522‏, додека населението на општината е 341.625. Градот се наоѓа на границата помеѓу регионите Бачка и Срем, на брегот на реката Дунав и каналот Дунав-Тиса-Дунав, притоа гледајќи на северните падини на планината Фрушка Гора. Надморската височина на рамничарскиот дел на градот е од 72 до 80 метри, а градот се наоѓа помеѓу 1.252 и 1.262 километар од течението на Дунав.\\nУште од формирањето во 1694, Нови Сад е центар на српската култура и го добил прекарот Српска Атина. Денес, Нови Сад е голем индустриски и финансиски центар на српската економија, а исто така е еден од најголемите градежни локации во регионот."},{"page_url":"https://pl.wikipedia.org/wiki/Filmografia_Audrey_Hepburn","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Audrey_Hepburn_Mel_Ferrer_Mayerling_1957.jpg","page_title":"Filmografia Audrey Hepburn","context_page_description":"Audrey Hepburn w trwającej 33 lata karierze występowała w filmach, telewizji i na scenie. Pojawiła się w 28 produkcjach fabularnych. Pięciokrotnie nominowana była do nagrody Akademii Filmowej oraz dziewięciokrotnie do Złotego Globu, z czego zdobyła jedną statuetkę Oscara i jedną nagrodę Hollywoodzkiego Stowarzyszenia Prasy Zagranicznej. Hepburn uznawana jest za jedną z najwybitniejszych aktorek w historii amerykańskiej kinematografii oraz ikonę stylu i elegancji. Na dużym ekranie debiutowała w 1948 rolą stewardesy w komedii Holenderski w 7 lekcjach. Występowała również w musicalach wystawianych w teatrach muzycznych na West Endzie w Londynie, między innymi w Sauce Tartare i sequelu Sauce Piquante. W 1951 i 1952 grała na Broadwayu w sztuce Gigi.\\nW 1953 Hepburn zadebiutowała w Hollywood, występując u boku Gregory’ego Pecka w komedii romantycznej Rzymskie wakacje. Po premierze filmu zdobyła status gwiazdy, a jej zdjęcia publikowane były na okładkach wielu prestiżowych pism. Kreacja księżniczki Anny przyniosła jej nagrodę Akademii Filmowej dla najlepszej aktorki pierwszoplanowej, Złotego Globu dla najlepszej aktorki w filmie dramatycznym oraz BAFTĘ dla najlepszej brytyjskiej aktorki."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E7%81%A3%E8%9D%B4%E8%9D%B6%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Papilio_xuthus_20130804.jpg","page_title":"臺灣蝴蝶列表","context_page_description":"台灣有「蝴蝶王國」之稱，約有 370 種蝴蝶曾在臺灣被紀錄；若再加上偶發種、偶發定居種和疑問種等，可將臺灣的蝴蝶種類推至超過 400 種。其中，有約 50 種屬於臺灣特有種。與北方鄰國日本相比，日本的面積雖為臺灣的 10 倍大，但只有約 230 種蝴蝶，臺灣的蝶種密度為日本的 10 餘倍，這大概可以歸因於此島嶼地理與地形上的特殊性。臺灣位於北回歸線之上，以北屬於亞熱帶氣候，以南屬於熱帶氣候，隨著高度的遞增，中央山地又有溫帶和亞寒帶等氣候，因此形成了多元複雜的蝶相。\\n※類別\\n固有種：373種。每年定居、繁殖於臺灣的蝶種。含迷蝶的歸化種。\\n迷蝶：23種。由於颱風等自然因素由周邊國家飛來的蝶種。不會在臺灣繁殖。\\n疑問種：20種，誤報或是與記錄衝突的蝶種。\\n總計臺灣共有421種蝴蝶曾被記錄。這個列表只記錄固有種和迷蝶，共392種。"},{"page_url":"https://id.wikipedia.org/wiki/Muhammad_Maftuh_Basyuni","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Kabinet_maftuh_b.jpg","page_title":"Muhammad Maftuh Basyuni","context_page_description":"Muhammad Maftuh Basyuni adalah Menteri Agama pada Kabinet Indonesia Bersatu pimpinan Presiden Susilo Bambang Yudhoyono. Ia menyelesaikan pendidikan sarjananya di Universitas Islam Madinah, Arab Saudi pada tahun 1968.\\nPeriode 1976-1979, ia tampil sebagai Sekretaris Pribadi Konsul Jenderal Indonesia di Jeddah. Selain sebagai kepala rumah tangga kepresidenan saat Soeharto memimpin negara Indonesia, ia juga menjabat Sekretaris Negara pada awal pemerintahan Presiden Abdurrahman Wahid. Sejak 2002, ia adalah Duta Besar Indonesia untuk Arab Saudi. Pada 2004, ia tampil sebagai ketua Delegasi Indonesia pada Pertemuan Tingkat Menteri OKI. Dari tahun 2014 sampai meninggal, ia menjabat sebagai Ketua Badan Wakaf Indonesia.\\nMaftuh wafat pada Selasa, 20 September 2016 pukul 18.30 WIB di RSPAD Gatot Subroto, Jakarta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%94%D0%B2%D1%94%D1%80%D0%BE%D0%B4%D0%BE%D0%BD%D0%B5%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D0%93%D0%BE%D0%B3%D0%BE%D0%BB%D1%8C-%D1%81%D0%BA%D0%B2%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Winter_in_Gogol-Square4.jpg","page_title":"Сєвєродонецький Гоголь-сквер","context_page_description":"Гоголь-сквер у місті Сєвєродонецьк — сквер, присвячений Миколаю Гоголю."},{"page_url":"https://sv.wikipedia.org/wiki/Lekrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Playroom_of_West_Hikari_train.jpg","page_title":"Lekrum","context_page_description":"Ett lekrum är ett rum särskilt inrett och utrustat för att barn ska kunna leka där. Offentliga lekrum förekommer bland annat på förskolor, sjukhus, varuhus, restauranger, passagerarfärjor och tåg. Särskilda lekrum i privata hem är ovanligt, men kan förekomma. I privathem skiljer sig lekrummet från barnkammaren främst genom att lekrummet inte är avsett att sova i, vilket ger mer lekutrymme då säng saknas."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%B0%E9%BB%84%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Rehmannia.JPG","page_title":"地黄属","context_page_description":"地黄属是玄参科下的一个属，为多年生草本植物。该属共有6－8种，分布于亚洲东部。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_%C3%9A%C5%A1t%C4%9Bku","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Venkovsk%C3%A1_usedlost_%28Rochov%29%2C_Rochov_41.JPG","page_title":"Seznam kulturních památek v Úštěku","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Úštěk v okrese Litoměřice vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Bundesstra%C3%9Fe_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Bundesstra%C3%9Fe_1_und_444_bei_Steinbrueck_Soelde.jpg","page_title":"Bundesstraße 1","context_page_description":"Die Bundesstraße 1 ist eine Bundesstraße in Deutschland und erstreckt sich von der niederländischen Grenze bei Aachen im Westen bis zur polnischen Grenze in Küstriner Vorland an der Oder im Osten. Von der AS Holzwickede bis zum Kreuz Dortmund/Unna, ist die B 1 auf dem kurzen Stück Teil der Europastraße 331, die dort beginnt und bis nach Kassel verläuft.\\nBekannteste Teilstrecken sind heute der Rheinufertunnel in Düsseldorf, der Ruhrschnellweg, mit 155.000 Fahrzeugen pro Tag eine der meistbefahrenen Strecken Deutschlands, die historische Glienicker Brücke als Grenzbrücke zur Zeit der deutschen Teilung und die Straßenführung in Berlin, die große Teile ost- und westdeutscher Geschichte repräsentiert.\\nDie Straße entwickelte sich aus einer alten Handelsstraße zur Zeitenwende über den Hellweg und die Via Regia zur 1392 Kilometer langen ehemaligen Reichsstraße 1, die von der deutsch-niederländischen Grenze vor Aachen über das Ruhrkohlerevier, Magdeburg, Berlin und Königsberg bis an die deutsch-litauische Grenze führte und damit die längste je existierende deutsche Straße war. Zu Zeiten der DDR hieß sie dort Fernverkehrsstraße 1 bzw. in der Kurzform F 1."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B8%D0%BF%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Hammurabi%27s_Babylonia_1.svg","page_title":"Нипур","context_page_description":"Нипур – свещен град на древните шумери в Южното Междуречие. В Нипур се намирал храмът на главния бог на шумерите – Енлил.\\nВ XVIII век до н.е. Нипур бил завладян от Вавилон, като по-късно придобил вътрешна автономия.\\nВ Нипур избирали цар, взимали решения за данъците и мира."},{"page_url":"https://cs.wikipedia.org/wiki/Kole%C4%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Kolec_CZ_flag.jpg","page_title":"Koleč","context_page_description":"Obec Koleč se nachází 11 km severovýchodne od Kladna, v okrese Kladno, kraj Středočeský. Žije zde 582 obyvatel."},{"page_url":"https://it.wikipedia.org/wiki/Tito_Lucrezio_Caro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Seneca.JPG","page_title":"Tito Lucrezio Caro","context_page_description":"Tito Lucrezio Caro è stato un poeta e filosofo romano, seguace dell'epicureismo."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8F%B0%E6%B9%BE%E8%BB%8D_(%E6%97%A5%E6%9C%AC%E8%BB%8D)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Taiwan_Army_Headquarters_of_IJA.JPG","page_title":"台湾軍 (日本軍)","context_page_description":"台湾軍は、大日本帝国陸軍の軍の一つ。台湾を管轄した。"},{"page_url":"https://hr.wikipedia.org/wiki/Bijeli_patuljak","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Size_IK_Peg.svg","page_title":"Bijeli patuljak","context_page_description":"Bijeli patuljak ili degenerirani patuljak je malena zvijezda koja se sastoji uglavnom od materije koja ne sadrži elektrone u sebi. Kako je masa bijelih patuljaka slična masi Sunca a volumen Zemlji te su zvijezde veoma guste. Bijeli patuljci sjaje zbog topline koja je zaostala u njima. Kako oni polagano zrače tu toplinu u okolni prostor tako se hlade. Kada se bijeli patuljak ohladi onda se zove crni patuljak."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%88%AA%E5%B0%8D%E8%A7%92%E5%85%AD%E6%96%B9%E5%81%8F%E6%96%B9%E9%9D%A2%E9%AB%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Water_Cube_The_National_Aquatics_Center_Chaoyang_Beijing.jpg","page_title":"截對角六方偏方面體","context_page_description":"在几何学中，截对角六方偏方面体是指截去六方偏方面体顶角与底角所形成的立体，由12个五边形和2个六边形组成。"},{"page_url":"https://ko.wikipedia.org/wiki/%EA%BD%88%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Physalis_alkekengi_franchetii_0.4_R.jpg","page_title":"꽈리","context_page_description":"꽈리는 가지과에 속하는 여러해살이풀이다."},{"page_url":"https://vi.wikipedia.org/wiki/Alfonso_Maria_de%27_Liguori","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/S.-alfonso-1.gif","page_title":"Alfonso Maria de' Liguori","context_page_description":"Alfonso Maria de' Liguori là người sáng lập ra Dòng Chúa Cứu Thế, Giám mục Sant'Agata de' Goti, là một trong những nhà thần học luân lý lừng danh nhất trong lịch sử Giáo hội Công giáo Rôma. Mối quan tâm đến phần cứu rỗi các linh hồn thúc đẩy ông tham gia vào việc truyền bá đức tin tông đồ bằng ngòi bút. Tổng số tác phẩm của ông lên đến 111 quyển, bao gồm các lĩnh vực luân lý, tín lý và tu đức. Ông được Giáo hoàng Piô VII tôn phong Chân phước ngày 15 tháng 9 năm 1816 và Giáo hoàng Grêgôriô XVI tôn phong Hiển Thánh ngày 26 tháng 5 năm 1839. Năm 1871, ông được Giáo hoàng Piô IX tôn phong Tiến sĩ Hội thánh."},{"page_url":"https://tr.wikipedia.org/wiki/Arbore_Kilisesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Biserica_Arbore12.jpg","page_title":"Arbore Kilisesi","context_page_description":"Arbore Kilisesi, Romanya'nın Suceava ilindeki Arbore komününde yer alan bir Rumen Ortodoks manastır kilisesidir. 1502 yılında inşa edilmiş ve Vaftizci Yahya'nın Başının Kesilmesi'ne adanmıştır. Boğdan'daki Kiliseler Dünya Mirası Alanını oluşturan sekiz binadan biridir. Ayrıca ülkenin Kültür ve Din İşleri Bakanlığı tarafından tarihi bir anıt olarak listelenmiştir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%80%D0%B5,_%D0%AD%D0%BC%D0%B8%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Emile_Sauret.jpg","page_title":"Соре, Эмиль","context_page_description":"Эми́ль Соре́ — французский скрипач, композитор и музыкальный педагог. Сын тромбониста и музыкального педагога Франсуа Соре.\\nУчился в Страсбургской консерватории, где преподавал его отец, у Симона Шведерле. Как исполнитель-виртуоз гастролировал по Европе и США. В 1873—1875 годах был женат на пианистке Терезе Карреньо. Преподавал в берлинской Новой Академии музыки Теодора Куллака, лондонской Королевской академии музыки, а также в Чикаго и Женеве. Был первым исполнителем посвящённого ему скрипичного концерта Морица Мошковского.\\nНаписал два скрипичных концерта, серенаду для скрипки с оркестром, сонату для скрипки и фортепиано, сборник этюдов «Gradus ad Parnassum» и др. Известностью пользуется каденция Соре к Первому скрипичному концерту Николо Паганини."},{"page_url":"https://hr.wikipedia.org/wiki/Planetezimal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/UltimaThule_CA06_color_20190516.png","page_title":"Planetezimal","context_page_description":"U kozmogoniji, planetezimali predstavljaju objekte za koje se vjeruje da su postojali unutar solarnih maglica. Smatra se da su se planetezimali formirali zbog koagulacije čestica koji su orbitirale oko prirastajućeg diska solarne maglice; akumulacija planetezimala je dovela do stvaranja protoplanetarnog diska, koji je s vremenom koagulirao u protoplanete i planete. Ponekad se isti pojam uopćeno koristi za asteroide i komete; drugi, kao Comins koriste termin za objekte s promjerom manjim od 10 km.\\nOpćenito se smatra da je oko 3,8 milijardi godina većina planetezimala stvorenih unutar Sunčevog sustava ili napustilo orbitu ili koagulirala u veće objekte. Većina preostalih planetezimala postoji unutar asteroidnog pojasa.\\nTeorija velikog udara predlaže hipotezu prema kojoj se Zemljin Mjesec formirao uslijed kolosalnog udara planetezimala zvanog Teja u Zemlju tokom rane povijesti Sunčevog sustava."},{"page_url":"https://en.wikipedia.org/wiki/Deportees%27_Cross_1914%E2%80%931918","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Croix_des_D%C3%A9port%C3%A9s_AVERS.jpg","page_title":"Deportees' Cross 1914–1918","context_page_description":"The Deportees' Cross 1914–1918 was a Belgian war medal established on 27 November 1922 by royal decree and awarded to Belgian citizens deported to Germany for forced labour during the First World War.\\nDeportees who died during their deportation were not awarded this cross, instead, they received the Order of Leopold II with the ribbon bearing a central longitudinal gold stripe."},{"page_url":"https://sv.wikipedia.org/wiki/Pachycondyla_luteipes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Brachyponera_luteipes_casent0178451_label_1.jpg","page_title":"Pachycondyla luteipes","context_page_description":"Pachycondyla luteipes är en myrart som först beskrevs av Mayr 1862. Pachycondyla luteipes ingår i släktet Pachycondyla och familjen myror."},{"page_url":"https://nn.wikipedia.org/wiki/Lesse","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Han-sur-Lesse_Riv1JPG.jpg","page_title":"Lesse","context_page_description":"Lesse er ei elv i Ardennane i Belgia, og ei av sideelvene til Maas frå høgre.\\nHo har sitt utspring nær Libramont-Chevigny i den belgiske provinsen Luxembourg. Lesse renn stort sett nordvestover, og nær Han-sur-Lesse går heile elva under bakken og gjennom nokre kalksteinsgrotter. Mange av grottene langs breidda av Lesse er viktige arkeologiske stader, og desse inkluderer Trou de Chaleux, og Trou des Nutons og Trou du Frontal ved Furfooz. Lesse munnar ut i elva Maas ved landsbyen Anseremme i kommunen Dinant. Landsbyar langs Lesse er Daverdisse, Han-sur-Lesse, Houyet og Anseremme."},{"page_url":"https://vi.wikipedia.org/wiki/Henry_VII_c%E1%BB%A7a_Anh","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Margaret_Tudor.jpg","page_title":"Henry VII của Anh","context_page_description":"Henry VII là Quốc vương của nước Anh và là Lãnh chúa của Ireland, lên ngôi này 22 tháng 8, năm 1485 cho đến khi ông qua đời. Ông là vị quân vương đầu tiên của Triều đại Tudor.\\nHenry đã giành được ngôi vị khi ông đã đánh bại Richard III trong Trận Bosworth. Ông là vị Quân chủ cuối cùng của Anh chiếm được ngai vàng từ chiến trường. Ông đã thành công trong việc khôi phục lại sức mạnh và sự ổn định của chế độ quân chủ Anh sau khi biến động chính trị của cuộc Chiến tranh Hoa Hồng. Ông thành lập một triều đại lâu dài, và sau khi trị vì gần 24 năm, nền thái bình thịnh trị được con trai ông, Henry VIII, giữ vững.\\nMặc dù Henry có thể được ca ngợi với việc khôi phục ổn định chính trị ở Anh, và một số khen ngợi về những cải cách hành chính, kinh tế và ngoại giao, nhưng những năm cuối của triều đại ông đã được được đặc bởi việc tham nhũng tài chính kéo căng các giới hạn của tính hợp pháp. Theo nhà sử học đương đại Polydore Vergil, \\"tham nhũng\\" trong phần lớn được nhấn mạnh qua các kiểm soát viên hoàng gia đã khẳng định trong những năm cuối đời của Henry."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%96%D1%96%D0%BD%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Average_earnings_of_workers_by_education_and_sex_-_2006.png","page_title":"Жінка","context_page_description":"Жі́нка — доросла людина жіночої статі. Дітей та підлітків жіночої статі називають дівчатками та дівчатами. Інколи поняття жінка вживається узагальнено для всіх осіб жіночої статі незалежно від віку. Жінки, зазвичай мають дві X-хромосоми, матку, вагіну, клітор, вульву та молочні залози. Жінки з типовим генетичним розвитком від пубертату до менопаузи переживають регулярні менструації, коли не є вагітними, та зазвичай здатні народжувати.\\nДослідженням різних аспектів жіночого буття займаються жіноча історія, жіночі студії, феміністська теорія та гендерні дослідження загалом. З дискримінацією жінок у суспільстві бореться фемінізм."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D1%83%D1%88%D0%B5%D0%B2%D0%B0_%D0%9F%D0%BB%D0%B0%D0%BD%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/%D0%A0%D0%B0%D0%BD%D0%B8_%D0%B7%D0%BE%D1%80%D0%B8_%D0%BD%D0%B0%D0%B4_%D0%9F%D0%B5%D0%BB%D0%B0%D0%B3%D0%BE%D0%BD%D0%B8%D1%98%D0%B0_%D0%B8_%D0%91%D1%83%D1%88%D0%B5%D0%B2%D0%B0_%D0%9F%D0%BB%D0%B0%D0%BD%D0%B8%D0%BD%D0%B0.JPG","page_title":"Бушева Планина","context_page_description":"Бушева Планина е средновисока планина во Македонија, со највисокиот врв Мусица, на чии падини се наоѓа градот Крушево."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E7%81%A3%E9%90%B5%E9%81%93%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/1923%E5%B9%B4%E6%97%A5%E6%9C%AC%E7%9A%87%E5%A4%AA%E5%AD%90%E8%A3%95%E4%BB%81%E6%AD%A5%E5%87%BA%E5%8F%B0%E5%8C%97%E5%81%9C%E8%BB%8A%E5%A0%B4_Japanese_Crown_Prince_Hirohito_left_Taipei_Railway_Station%2C_TAIWAN.jpg","page_title":"臺灣鐵道史","context_page_description":"臺灣鐵道史又稱臺灣鐵路史，可以追溯至臺灣清治時期晚期，一般以清朝臺灣首任巡撫劉銘傳於1887年成立全臺鐵路商務總局鋪設臺灣鐵路為開始，但其實在1877年時基隆八斗子煤礦便已鋪設了輕便鐵道運送煤礦，為臺灣的第一段鐵路，但一般客貨運鐵路仍以劉銘傳所倡建的鐵路最早。\\n但清朝時的臺灣鐵路只有基隆經臺北到新竹的路段，發揮的效益有限，且品質亦不符合後來日人的標準。而目前臺灣鐵路體系的形成主要是奠基於日治時期。日治時期除了官營鐵路外，尚有各地的輕便鐵路。日治時期臺灣與大日本帝國的其他地方逐漸形成陸海空的交通聯運網，而且鐵道部還出版旅遊書《臺灣鐵道紀要》、《臺灣鐵道旅行案內》宣傳臺灣的風景名勝和推廣鐵道旅遊。但是由於鐵道部各項計畫的預算經常遭到臺灣總督府財務局及日本帝國議會刪減，常無法照計畫實行並達到預定效果，導致鐵路在「速成延長主義」下基礎建設不足，日後保養與改良亦難以確實。在1936年縱貫線軌條有六成為使用了二、三十年的老舊軌條，對列車行駛與安全都造成了影響。大谷光瑞曾揶揄官鐵說：「我以為這是輕便鐵路。但仔細一看，原來不是。再看它行走的時候，才知道它真的不輕便。」。在中日戰爭爆發的前夕，臺灣官鐵在線路品質上已遠遜於日本國鐵、南滿州鐵道、朝鮮鐵道。\\n進入民國時期後，由於年久失修與戰爭的破壞，故剛開始著重於鐵路的修復，後來才開始興築新的鐵路路線，如臺鐵的北迴線、南迴線與台糖的玉左線、南北平行預備線等。然而另一方面隨著公路交通的發展與產業的變遷，臺灣的鐵路運輸逐漸衰退，尤以各地的產業鐵路為最──例如糖業鐵路在1982年停辦客運，貨運功能在2010年代僅剩虎尾糖廠馬公厝線仍在運作。而從1980年代開始，台北捷運、高雄捷運、台灣高鐵與高雄輕軌的籌建使得臺灣的鐵路體系又進入另一個階段。"},{"page_url":"https://ro.wikipedia.org/wiki/Margareta_de_Valois","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/SchlafzimmerBartholomaeusnacht.jpg","page_title":"Margareta de Valois","context_page_description":"Margareta de Valois, cunoscută și sub numele de Regina Margot, a fost mai întâi regină a Navarrei, apoi regină a Franței și ducesă de Valois.\\nNăscută la palatul Saint-Germain-en-Laye, Margareta era fiica lui Henric al II-lea al Franței și a Caterinei de Medici. Aparținea ramurii Valois- Angoulême din dinastia Capețienilor. Trei din frații săi au devenit regi ai Franței: Francisc al II-lea, Carol al IX-lea și Henric al III-lea. Sora sa, Elisabeta de Valois, va deveni cea de-a treia soție a regelui Filip al II-lea al Spaniei.\\nPrin căsătoria cu Henric al III-lea de Navarra devine regină a Navarrei. Căsătoria, care trebuia să celebreze reconcilierea dintre catolici și hughenoți, va fi umbrită de masacrul din noaptea Sfântului Bartolomeu și de dezordinile religioase ce reîncep. Episodul descris în Marea Cronică, a fost folosit ca sursă de documentare pentru scriitorii secolului al XIX-lea. După moartea fratelui său, Henric al III-lea al Franței, ea rămâne ultimul vlăstar al ramurii de Valois. Latinistă excepțională, de o inteligență sclipitoare, a jucat un rol semnificativ în viața culturală de la curte, mai ales după întoarcerea din exil în 1605."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%84%D8%B9%D8%A9_%D8%AA%D8%A8%D8%B1%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Alishah.jpg","page_title":"قلعة تبريز","context_page_description":"قلعة تبريز هي قلعة تاريخية تعود إلى عصر الدولة الإلخانية، وتقع في تبريز."},{"page_url":"https://br.wikipedia.org/wiki/Llanddewi_yn_Hwytyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Whitton_church_-_geograph.org.uk_-_867255.jpg","page_title":"Llanddewi yn Hwytyn","context_page_description":"Llanddewi yn Hwytyn pe Hwytyn zo ur gêriadenn hag ur gumuniezh eus Kembre, e reter Powys. Emañ er c'hreisteiz da Drefyclawdd, tost da Gleuz Offa.\\nEr gumuniezh emañ ivez kêriadennoù Disgoed, Casgob ha Pilalau. E Pilalau e voe trec'h Owain Glyndŵr en Emgann Bryn Glas e 1402. E 1870 e voe kavet korfoù-eskern e-kichen iliz Llanddewi yn Hwytyn; krediñ a reer e oant relegoù ar soudarded a gemeras perzh en emgann-se.\\nE 2011 e oa 348 a dud o chom e kumuniezh Llanddewi yn Hwytyn hag 28 anezho a oa kembraegerien."},{"page_url":"https://ca.wikipedia.org/wiki/Manuel_Cruz_Rodr%C3%ADguez","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%28Manuel_Cruz%29_2019.06.27._Toma_de_posesi%C3%B3n_de_Guillermo_Fern%C3%A1ndez_Vara_%2848142285262%29_%28cropped%29.jpg","page_title":"Manuel Cruz Rodríguez","context_page_description":"Manuel Cruz Rodríguez, filòsof i polític català, va ser el president del Senat d'Espanya entre maig i desembre de 2019. Fou diputat a les Corts Generals durant la XII Legislatura espanyola i és senador de la XIII legislatura, des de 2019. És catedràtic de Filosofia Contemporània a la Universitat de Barcelona i va presidir l'associació Federalistes d'Esquerres."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%B8%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%A8%E0%B3%8D%E2%80%8C_%E0%B2%9C%E0%B3%8B%E0%B2%B8%E0%B3%8D%E2%80%8C%E2%80%8C,_%E0%B2%95%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%B2%E0%B2%BF%E0%B2%AB%E0%B3%8B%E0%B2%B0%E0%B3%8D%E0%B2%A8%E0%B2%BF%E0%B2%AF%E0%B2%BE/%E0%B2%95%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%B2%E0%B2%BF%E0%B2%AB%E0%B3%8B%E0%B2%B0%E0%B3%8D%E0%B2%A8%E0%B2%BF%E0%B2%AF%E0%B2%BE%E0%B2%A6_%E0%B2%B8%E0%B3%8D%E0%B2%AF%E0%B2%BE%E0%B2%A8%E0%B3%8D%E2%80%8C_%E0%B2%9C%E0%B3%8B%E0%B2%B8%E0%B3%8D%E2%80%8C%E2%80%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/SJ_City_Hall_Rotunda.jpg","page_title":"ಸ್ಯಾನ್‌ ಜೋಸ್‌‌, ಕ್ಯಾಲಿಫೋರ್ನಿಯಾ/ಕ್ಯಾಲಿಫೋರ್ನಿಯಾದ ಸ್ಯಾನ್‌ ಜೋಸ್‌‌","context_page_description":"ಸ್ಯಾನ್‌ ಜೋಸ್‌‌ ಅಥವಾ ಸ್ಯಾನ್‌ ಜೋಸ್ ಕ್ಯಾಲಿಫೋರ್ನಿಯಾದಲ್ಲಿ ಮೂರನೇ-ಬೃಹತ್‌‌ ಮಹಾನಗರವಾಗಿ, ಯುನೈಟೆಡ್‌‌ ಸ್ಟೇಟ್ಸ್‌‌ನಲ್ಲಿ ಹತ್ತನೇ-ಬೃಹತ್‌‌ ನಗರವಾಗಿದೆಯಲ್ಲದೇ, ಸಾಂಟಾ/ತಾ ಕ್ಲಾರಾ ಕೌಂಟಿಯ ಕೌಂಟಿ ಜಿಲ್ಲೆಯಾಗಿದೆ. ರಾಷ್ಟ್ರದಲ್ಲಿಯೇ 31ನೇ-ಅತಿದೊಡ್ಡ ಮಹಾನಗರವಲಯಕ್ಕೆ ಆಸರೆಯಾಗಿರುವ ನಗರವು, ಕೊಲ್ಲಿ/ಬೇ ಪ್ರದೇಶದ ದಕ್ಷಿಣತುದಿಯಲ್ಲಿರುವ, 7.4 ದಶಲಕ್ಷ ಜನರಿರುವ ಪ್ರದೇಶವಾಗಿದೆ. ಒಂದು ಕಾಲದಲ್ಲಿ ಸಣ್ಣ ಕೃಷಿಆಧಾರಿತ ನಗರವಾಗಿದ್ದ ಸ್ಯಾನ್‌ ಜೋಸ್‌‌, 1950ರ ದಶಕದಿಂದ ಪ್ರಸ್ತುತದವರೆಗೆ ಉಪನಗರಗಳಲ್ಲಿನ ಹೊಸ ವಸತಿಪ್ರದೇಶಗಳೆಡೆ ಧಾವಿಸುವ ನವವಾಸಿಗಳನ್ನು ಆಕರ್ಷಿಸುವ ಚುಂಬಕಶಕ್ತಿಯಾಗಿ ಪರಿಣಮಿಸಿದೆ. ಜನಸಂಖ್ಯೆ, ಭೂವಿಸ್ತೀರ್ಣ ಹಾಗೂ ಕೈಗಾರಿಕಾ ಅಭಿವೃದ್ಧಿಗಳಲ್ಲಿ ಸ್ಯಾನ್‌ ಜೋಸ್‌‌ ಕೊಲ್ಲಿ/ಬೇ ಪ್ರದೇಶದ ಅತಿದೊಡ್ಡ ಮಹಾನಗರವಾಗಿದೆ. ಜನವರಿ 1, 2010ರ ವೇಳೆಗೆ ಇಲ್ಲಿನ ಅಂದಾಜು ಜನಸಂಖ್ಯೆ 1,023,083 ಇದ್ದು ಸ್ಯಾನ್‌ ಜೋಸ್‌‌ಅನ್ನು 10ನೇ ಅತಿದೊಡ್ಡ U.S. ಮಹಾನಗರವಾಗಿಸಿದೆ.\\nನವೆಂಬರ್‌ 29, 1777ರಂದು ಎಲ್‌‌ ಪ್ಯುಯೆಬ್ಲೋ ಡೆ ಸ್ಯಾನ್‌ ಜೋಸ್ ಡೆ ಗ್ವಾಡಾಲುಪೆ/El Pueblo de San José de Guadalupe ಎಂಬ ಹೆಸರಿನಿಂದ ನಂತರ ಅಲ್ಟಾ ಕ್ಯಾಲಿಫೋರ್ನಿಯಾವಾಗಿ ಹೆಸರಿಸಲ್ಪಟ್ಟ ನ್ಯುಯೆವಾ ಕ್ಯಾಲಿಫೋರ್ನಿಯಾದ ಸ್ಪ್ಯಾನಿಷ್‌ ವಸಾಹತುಗಳಲ್ಲಿನ ಪ್ರಥಮ ಪಟ್ಟಣವಾಗಿ ಸ್ಯಾನ್‌ ಜೋಸ್‌‌ಅನ್ನು ಸ್ಥಾಪಿಸ/ಕಂಡುಹಿಡಿಯಲಾಯಿತು. ಈ ಮಹಾನಗರವು ಸ್ಯಾನ್‌ ಫ್ರಾನ್ಸಿಸ್ಕೋ ಹಾಗೂ ಮಾಂಟೆರೆಗಳಲ್ಲಿನ ಸ್ಪ್ಯಾನಿಷ್‌ ಸೇನಾನೆಲೆಗಳನ್ನು ಬೆಂಬಲಿಸುವ ಕೃಷಿ ಸಮುದಾಯವಾಗಿ ನೆರವಾಗುತ್ತಿತ್ತು."},{"page_url":"https://vi.wikipedia.org/wiki/Physogyra_lichtensteini","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Physogyra_y_Lysmata_amboinensis.jpg","page_title":"Physogyra lichtensteini","context_page_description":"Physogyra lichtensteini là một loài san hô trong họ Euphyllidae. Loài này được Milne Edwards and Haime mô tả khoa học năm 1851."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%B3%DB%8C%D8%AF%DB%95%DA%A9%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/B-Kelashin3.jpg","page_title":"سیدەکان","context_page_description":"ئەم وتارە سەبارەت بە برادۆست نووسراوە. بۆ بینینی وتارە هاوشێوەکان بڕوانە برادۆست.\\nسیدەکان شارۆچکەیەکی سەر بە قەزای سۆرانە دەکەوێتە دووری ١٤٤ کیلۆمەتری بەشی باکووری ڕۆژهەڵاتی شاری هەولێر، ناوەندی ناحيه‌ى سیدەکانه‌ و تا پێش ساڵى 1996 به‌ ره‌سمى هه‌ر به‌ ناحيه‌ى برادۆست ده‌ناسرا. سيده‌كان لە ئەوپەڕی باکووری پارێزگای ھەولێره‌ و کەوتۆتە رۆژئاوای ‏شاری شنۆ وە و لە رووی رووبەرەوە گەورەترین ناحیەکانی ھەولێرە و زۆربەی ‏دەڤەرەکە شاخاویە و دەشتانیی کەمە. باشترین شوێنە بۆ بەروبوومی ئاژەڵداری و کشتوکاڵ ھەروەھا لە رۆژگاری دێریندا ‏رێرەوێکی گرینگی بازرگانی بووە رۆژھەڵات و رۆژئاوای پێکەوە بەستۆتەوە بە رێگەی کێلە شینەوە."},{"page_url":"https://ro.wikipedia.org/wiki/Opera%C8%9Biunea_Inimaginabil","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Allied_army_positions_on_10_May_1945.png","page_title":"Operațiunea Inimaginabil","context_page_description":"Operațiunea Inimaginabil a fost numele codificat de două planuri legate de un conflict între aliații occidentali și Uniunea Sovietică. Ambele au fost ordonate de către prim-ministrul britanic Winston Churchill în 1945 și dezvoltat de către Hastings Lionel Ismay șef de stat major al Forțelor Armate Britanice la sfârșitul războiului în Europa.\\nPrima dintre cele două se baza pe un atac surpriză asupra forțelor sovietice staționate în Germania, în scopul de a \\"impune voința aliaților occidentali\\" asupra sovieticilor și de a-l forța pe Iosif Stalin să-și onoreze acordurile încheiate în ceea ce privește viitorul Europei Centrale.\\nAtunci când șansele au fost judecate ca fiind \\"fanteziste\\", planul inițial a fost abandonat. Numele de cod a fost folosit în schimb pentru un scenariu defensiv, în care britanicii se apărau împotriva unei înaintări sovietice spre Marea Nordului și Oceanului Atlantic în urma retragerii forțelor americane de pe continent.\\nStudiul a devenit primul plan de contingență al erei Războiului Rece pentru un război cu Uniunea Sovietică.\\nAmbele planuri au fost strict secrete la momentul creării lor, și nu a fost publicate până în 1998."},{"page_url":"https://en.wikipedia.org/wiki/Mason,_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Tipton_County_Tennessee_Incorporated_and_Unincorporated_areas_Mason_Highlighted_4746420.svg","page_title":"Mason, Tennessee","context_page_description":"Mason is a town in Tipton County, Tennessee. The population was 1,609 at the 2010 census. Mason is located along U.S. Route 70, and is home to a federal detention facility."},{"page_url":"https://en.wikipedia.org/wiki/Kalmar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Kalmar_alt.jpg","page_title":"Kalmar","context_page_description":"Kalmar is a city in the southeast of Sweden, situated by the Baltic Sea. It had 36,392 inhabitants in 2010 and is the seat of Kalmar Municipality. It is also the capital of Kalmar County, which comprises 12 municipalities with a total of 236,399 inhabitants.\\nFrom the thirteenth to the seventeenth centuries, Kalmar was one of Sweden's most important cities. Between 1602 and 1913 it was the episcopal see of Kalmar Diocese, with a bishop, and the Kalmar Cathedral from 1702 is an example of classicistic architecture. It became a fortified city, with the Kalmar Castle as the center. After the Treaty of Roskilde in 1658, Kalmar's importance diminished, until the industry sector was initiated in the 19th century. The city is home to parts of Linnaeus University.\\nKalmar is adjacent to the main route to the island of Öland over the Öland Bridge."},{"page_url":"https://ms.wikipedia.org/wiki/Meghan_Trainor","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Meghan_Trainor_%2815996126761%29_%28edited%29.jpg","page_title":"Meghan Trainor","context_page_description":"Meghan Elizabeth Trainor ialah penyanyi, penulis lagu dan penerbit rakaman Amerika Syarikat. Dilahirkan dan dibesarkan di Nantucket, Massachusetts, Trainor menulis, merakamkan dan menghasilkan tiga album bebas yang dikeluarkan antara 15 dan 17 tahun. Pada tahun 2011, beliau telah menandatangani satu perjanjian penerbitan dengan Big Yellow Dog Music, dan mengejar kerjaya dalam penulisan lagu.\\nSelepas menandatangani perjanjian rakaman dengan Epic Records pada tahun 2014, Trainor meningkat kepada kemasyhuran dengan pengeluaran album studio sulung beliau bersama label itu, Title. Album ini mengungguli di nombor satu di US Billboard 200, dan terjual lebih satu juta salinan dalam negara, dan menghasilkan tiga single top 10: \\"All About That Bass\\", \\"Lips Are Movin\\" dan \\"Like I'm Gonna Lose You\\". Keluaran utama kedua \\"Thank You\\" telah dikeluarkan pada 2016, didahului oleh yang single utama \\"No\\" yang memuncak pada nombor 3 di Billboard Hot 100.\\nJelas dipengaruhi oleh era tahun 1950-an dan 1960-an dalam muzik, muzik Trainor ini telah terkenal dengan gaya retro estetik. Tema yang sama dalam lirik beliau termasuk subjek kewanitaan moden, imej badan, dan pemberian kuasa."},{"page_url":"https://tr.wikipedia.org/wiki/Alain_Casanova","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Alain_Casanova_2009-06-29.jpg","page_title":"Alain Casanova","context_page_description":"Alain Casanova, kaleci pozisyonunda görev yapan futbol yöneticisidir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B5%D0%B2%D0%B0%D0%BB_%D0%A4%D0%B5%D1%80%D1%81%D0%BC%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/%D0%9F%D0%B5%D1%80%D0%B5%D0%B2%D0%B0%D0%BB_%D0%A4%D0%B5%D1%80%D1%81%D0%BC%D0%B0%D0%BD%D0%B0_2.JPG","page_title":"Перевал Ферсмана","context_page_description":"Перевал Ферсмана — перевал в Мурманской области, высота — 974 м над уровнем моря. Располагается в западной части Хибин между вершиной Ферсмана и плато Юдычвумчорр, соединяет долины Меридионального ручья и Малой Белой реки.\\nНазван в честь советского геохимика и исследователя Хибин — Александра Евгеньевича Ферсмана."},{"page_url":"https://bs.wikipedia.org/wiki/Zgrada_prijateljstva_izme%C4%91u_Gr%C4%8Dke_i_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Evstafiev-sarajevo-building-burns.jpg","page_title":"Zgrada prijateljstva između Grčke i Bosne i Hercegovine","context_page_description":"Zgrada prijateljstva između Grčke i Bosne i Hercegovine je poslovna zgrada smještena u Sarajevu, Bosna i Hercegovina. U zgradi je smješteno Vijeće ministara Bosne i Hercegovine. Zgrada grčko-bosanskog prijateljstva je često, pogrešno, nazivana zgradom Parlamenta Bosne i Hercegovine."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%86%D0%BA%D0%B5%D0%B2%D0%B8%D1%87,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87_(%D1%84%D0%B8%D0%BB%D0%BE%D1%81%D0%BE%D1%84)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Matskevich_Uladzimir.jpg","page_title":"Мацкевич, Владимир Владимирович (философ)","context_page_description":"Влади́мир Влади́мирович Мацке́вич — белорусский философ и методолог, общественно-политический деятель, телеведущий. Основатель и руководитель Агентства гуманитарных технологий. Первый глава Рады Международного консорциума «ЕвроБеларусь». Основатель программы создания современного университета в Беларуси «Летучий университет»."},{"page_url":"https://fr.wikipedia.org/wiki/2005_dans_les_parcs_de_loisirs","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Blackgang_Chine_Cliffhanger.JPG","page_title":"2005 dans les parcs de loisirs","context_page_description":"Hong Kong Disneyland\\nKings City\\nPlopsa Indoor Hasselt\\nWonderla\\nZoomarine"},{"page_url":"https://en.wikipedia.org/wiki/Onyx_Grand_Prix","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Bertrand_Gachot_1989_Belgian_GP_2.jpg","page_title":"Onyx Grand Prix","context_page_description":"Onyx Grand Prix is a former Formula One constructor from Britain that competed in the 1989 and 1990 Formula One seasons. The team participated in 26 World Championship Grands Prix and scored six World Constructors' Championship points. Its best result was third place, in the 1989 Portuguese Grand Prix, for Stefan Johansson."},{"page_url":"https://es.wikipedia.org/wiki/Lago_Victoria","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Human_density_Lake_Victoria.png","page_title":"Lago Victoria","context_page_description":"El lago Victoria, ​ está situado en la zona centro-oriental de África, rodeado por Uganda, Tanzania y Kenia. Se extiende en un área de 69 482 km² y en su punto de mayor profundidad alcanza los 82 m. Es el segundo lago de agua dulce más grande de la Tierra, después del lago Superior, de Norteamérica. Es una de las principales fuentes del río Nilo, que prosigue su curso hasta el lago Alberto, en el tramo superior del río denominado Nilo Blanco.\\nEl afluente más caudaloso del lago Victoria es el río Kagera, localizado al noroeste de Tanzania. Si se considera parte de la cuenca del Nilo, su nacimiento sería el punto más alejado del Mediterráneo, siendo el Nilo-Kagera el segundo río más largo del mundo.\\nEl primer europeo en llegar al lago fue el explorador británico John Hanning Speke, quien lo nombró Lago Victoria, en homenaje a su reina.\\nDesde principios del siglo XX, el ferry del lago Victoria ha sido un importante medio de transporte entre Uganda, Tanzania y Kenia. Los principales puertos del lago son Kisumu, Mwanza, Bukoba, Entebbe, Port Bell y Jinja.\\nEl lago ocupa una depresión poco profunda en África y tiene una profundidad máxima de 82 m y una profundidad media de 40 m.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%83%B4%E3%82%A3%E3%83%BB%E3%82%B9%E3%82%AB%E3%83%AB%E3%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Soekarno.jpg","page_title":"デヴィ・スカルノ","context_page_description":"デヴィ・スカルノは、日本生まれでインドネシア国籍のタレント、YouTuber。インドネシアのスカルノ元大統領第3夫人。NPO法人アースエイドソサエティ総裁。株式会社デヴィーナ・ソサエティ代表取締役。本名・インドネシア名:ラトナ・サリ・デヴィ・スカルノ、旧名・日本名:根本 七保子、通称はデヴィ夫人。\\nスカルノ大統領との間に生まれた一人娘のカリナは、2005年11月26日にオランダで米系大手金融機関シティバンクの欧州・中近東・アフリカ地区CEOフレデリック・シーガスと結婚している。"},{"page_url":"https://it.wikipedia.org/wiki/Organi_della_chiesa_di_San_Giacomo_a_Lubecca","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/L%C3%BCbeck_Jakobikirche_Treppe_%282%29.jpg","page_title":"Organi della chiesa di San Giacomo a Lubecca","context_page_description":"Con organi della chiesa di San Giacomo ci si riferisce a tre strumenti costruiti a Lubecca, in Germania."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A6%8F%E5%B3%B6%E8%97%A4%E5%8A%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/%E9%95%B7%E5%AE%89%E5%80%B6%E6%A5%BD%E9%83%A801.jpg","page_title":"福島藤助","context_page_description":"福島 藤助は、青森県弘前市の醸造家・実業家。福島酒造会社、富名醸造株式会社、陸奥製糸株式会社、株式会社北日本農園、弘前印刷株式会社の創業者。"},{"page_url":"https://sk.wikipedia.org/wiki/Toyota_Supra","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/3rd_Toyota_Supra.jpg","page_title":"Toyota Supra","context_page_description":"Toyota Supra je športový automobil/grand tourer, ktorý v rokoch 1979 až 2002 vyrábala japonská automobilka Toyota Motor Corporation. Dizajn Toyoty Supra bol odvodený z Toyoty Celica, ale bol dlhší a širší. Striedavo Toyota zastavovala používanie prefixu Celica a začala nazývať automobil iba ako Supra. Kvôli podobnosti a predchádzajúcemu názvu Celica, je mnohokrát nesprávne používaný názov pre Toyotu Supra a naopak. Všetky štyri generácie používali radový šesťvalcový motor.\\nV roku 1998 Toyota zastavila predaj Supry v USA a v roku 2002 Toyota oficiálne zastavila výrobu Supry v Japonsku.\\nAko ikonický športový automobil, sa Supra objavila v mnohých videohrách, filmoch, hudobných videách a televíznych show. Medzi niektoré zo známych použití Supry patria série videohier Gran Turismo, Forza Motorsport, Need for Speed a Midnight Club a film Rýchlo a zbesilo z roku 2001."},{"page_url":"https://en.wikipedia.org/wiki/Germans_in_Holyoke","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/Hans_Goldschmidt2.jpg","page_title":"Germans in Holyoke","context_page_description":"Despite representing a significantly smaller population than their Irish, French, Polish, or Puerto Rican counterparts, in the late 19th century through the mid-20th century, German immigrants predominantly from Saxony and Rhineland played a significant economic, cultural, and political role in the history of Holyoke, Massachusetts. The influx of these immigrants can largely be attributed to a single mill and millworker complex, the Germania Woolen Mills, which formed the basis of the immigrant colony that would make the ward encompassing the South Holyoke neighborhood that with the highest German population per capita, in all of New England by 1875. Along with unionization efforts by the Irish community, Germans would also play a key role in the city and region's socialist labor movements as workers organized for higher pay and improved living conditions in the textile and paper mill economies."},{"page_url":"https://it.wikipedia.org/wiki/Grotta_Sant%27Angelo_(Balsorano)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Balsorano_antico_monastero_sant%27Angelo.jpg","page_title":"Grotta Sant'Angelo (Balsorano)","context_page_description":"La Grotta di Sant'Angelo è una grotta naturale di origine carsica situata sulla catena montuosa della Serra Lunga, nel comune di Balsorano."},{"page_url":"https://en.wikipedia.org/wiki/No._616_Squadron_RAF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Gloster_Meteor_F.8_WH456_L.616_BLA_05.09.55_edited-2.jpg","page_title":"No. 616 Squadron RAF","context_page_description":"No. 616 Squadron is an active Reserve unit of the Royal Auxiliary Air Force assigned to the RAF ISTAR Force at RAF Waddington. It was originally formed as a unit of the British Auxiliary Air Force in 1938, active throughout World War 2 as a fighter unit, becoming the 1st operational RAF unit to fly jets and disbanded in 1957. The unit reformed in its current guise in April 2019 as 616 Squadron Royal Auxiliary Air Force."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9A%E3%83%B3%E3%82%BF%E3%82%B3%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Pentacon_Electra_%287387145834%29.jpg","page_title":"ペンタコン","context_page_description":"ペンタコンはドイツ民主共和国に存在したカメラメーカー、およびそのブランドである。"},{"page_url":"https://de.wikipedia.org/wiki/Thiersheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Thiersheim_-_Sankt_%C3%84gidien_Kirche_-_01.jpg","page_title":"Thiersheim","context_page_description":"Thiersheim ist ein Markt im Landkreis Wunsiedel im Fichtelgebirge an der Bayerischen Porzellanstraße und der Sitz der Verwaltungsgemeinschaft Thiersheim."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A6%E3%82%A7%E3%82%B9%E3%83%88%E3%83%A9%E3%83%B3%E3%83%89_%E3%82%A6%E3%82%A7%E3%83%AB%E3%82%AD%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Westland_Welkin.jpg","page_title":"ウェストランド ウェルキン","context_page_description":"ウェストランド ウェルキン はイギリスのウェストランド・エアクラフト社で開発、製造された双発戦闘機である。イギリス初の高高度戦闘機だっただけに、実験的性格が強くトラブルも多発し少数の生産で打ち切りとなった。スペックを一覧すれば分かるように非常に長大な主翼を持ち、与圧キャビンも強力なものであった。70機生産されたがドイツ機の高高度空襲のおそれがなくなったこともあり、ほとんどすべてが実験機として使用されていたという説もある。"},{"page_url":"https://nv.wikipedia.org/wiki/Tsin_diwozh%C3%ADtah_ts%C3%ADdii","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Pseudoseisura_lophotes_-_Brown_Cacholote.JPG","page_title":"Tsin diwozhítah tsídii","context_page_description":"Tsin diwozhítah tsídii éí tsídii tsídígíí dah yikahjí atah daasdzoh, áádóó éí Shádiʼááhjí kéyah dah siʼánígíí bikááʼgóó dahólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Pseudoseisura lophotes\\" deiłníigo deiyózhí. Tsin diwozhítah tsídii éí dį́į́ʼ ałʼąą ádaatʼé."},{"page_url":"https://is.wikipedia.org/wiki/Skr%C3%BD%C3%B0ingardeilan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Investiturewoodcut.jpg","page_title":"Skrýðingardeilan","context_page_description":"Skrýðingardeilan voru hörð átök milli kirkjunnar og konungsvaldsins í Evrópu á miðöldum. Á 11. og 12. öld börðust páfar gegn því að veraldleg yfirvöld skipuðu háttsetta embættismenn kirkjunnar, svo sem biskupa og ábóta. Höfuðdeilan stóð milli páfa og keisara hins Heilaga rómverska ríkis og hófst árið 1075 en hliðstæðar deilur áttu sér stað víðsvegar um Evrópu. Deilan var leyst með sáttagerðinni í Worms árið 1122 þar sem vald páfa yfir skipan embættismanna kirkjunnar var staðfest. Lausn deilunnar styrkti páfann í sessi en veikti vald keisaranna í Þýskalandi og á Ítalíu."},{"page_url":"https://en.wikipedia.org/wiki/William_Coffey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Gravestone_of_William_Coffey_VC.jpg","page_title":"William Coffey","context_page_description":"William Coffey VC DCM, born in Knocklong, County Limerick, was an Irish recipient of the Victoria Cross, the highest and most prestigious award for gallantry in the face of the enemy that can be awarded to British and Commonwealth forces."},{"page_url":"https://sl.wikipedia.org/wiki/Krnski_grad","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Maria_Saal_Karnburg_Pfalzkirche_Innenraum_15092011_144.jpg","page_title":"Krnski grad","context_page_description":"Krnski grad je naselje na desni terasi reke Gline na zahodni strani Gosposvetskega polja na Koroškem, kjer stoji oziroma kjer je nekoč stal Krnski grad.\\nV naselju, ki se razteza na nadmorski višini 510 metrov, je ob popisu leta 2001 živelo 540 prebivalcev."},{"page_url":"https://br.wikipedia.org/wiki/Saghadal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Saddell_lords_of_the_isles_stones.jpg","page_title":"Saghadal","context_page_description":"Saghadal, Saddell e saozneg, zo ur gêriadenn e Bro-Skos, e reter ledenez Cinn Tìre en Argyll and Bute, dirak Kilbrannan Sound hag Enez Arran, un 10 km eus Campbeltown, war an hent da g-Carradale. Dont a ra an anv Saddell eus ur ger norsek hag a dalv kement ha traoñienn draezhek."},{"page_url":"https://fr.wikipedia.org/wiki/Maciej_P%C5%82a%C5%BCy%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Maciej_P%C5%82a%C5%BCy%C5%84ski_Kancelaria_Senatu_2005.jpg","page_title":"Maciej Płażyński","context_page_description":"Maciej Płażyński, né le 10 février 1958 à Młynary et mort le 10 avril 2010 lors du crash de l'avion présidentiel polonais à Smolensk, est un homme politique polonais."},{"page_url":"https://de.wikipedia.org/wiki/Hochzeitswiese","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Hochzeitswiese_am_Benther_Berg_IMG_8670.jpg","page_title":"Hochzeitswiese","context_page_description":"Das Nutzungskonzept einer Hochzeitswiese geht auf den alten Brauch zurück, dass Hochzeitspaare einen Obstbaum pflanzen. Dieser Baum stand dann als Symbol für Kraft, Stärke und Beständigkeit in der Ehe. Bisweilen ist auch vorgesehen, die Geburt eines Kindes zum Anlass zu nehmen, einen Obstbaum zu pflanzen, dann als Zeichen der Beständigkeit und Fruchtbarkeit.\\nDieser Brauch wurde in jüngster Zeit, vor allem seit der Jahrtausendwende, aber auch schon zuvor, z. B. in Bodelshausen bereits im Jahr 1986, von vielen Städten und Gemeinden wieder aufgenommen und kommunale Grünflächen, Wiesen o. ä. als offizielle Hochzeitswiesen erklärt. Demnach können dort, in der Regel zu gewissen Terminen zweimal im Jahr, von frisch Vermählten oder Verlobten Bäume, meist Obstbäume, gepflanzt werden.\\nEinzelne Kommunen erlauben dabei auch das Anbringen einer Gedenktafel. Ein Beispiel ist der Gallenkamp in Lübbecke."},{"page_url":"https://es.wikipedia.org/wiki/Capvern","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Thermes2.jpg","page_title":"Capvern","context_page_description":"Capvern es una población y comuna francesa, situada en la región de Mediodía-Pirineos, departamento de Altos Pirineos, en el distrito de Bagnères-de-Bigorre y cantón de Lannemezan."},{"page_url":"https://es.wikipedia.org/wiki/V%C3%ADa_Popilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Polla_via_popilia_da_reggio_a_capua.jpg","page_title":"Vía Popilia","context_page_description":"El nombre Vía Popilia fue dado a dos vías romanas diferentes, que se iniciaron durante el consulado de Publio Popilio Lenas, más conocido por su ataque contra los Gracos. El otro cónsul, en el año -132, era Publio Rupilio.\\nLa primera de estas vías es una extensión de la Vía Flaminia desde Ariminum hacia el norte del Mar Adriático.\\nLa segunda llevaba de Capua a Regio de Calabria en el estrecho de Mesina. El cipo de Polla, que se encuentra en San Pietro di Polla, cerca de Polla, lleva grabado de forma explícita los detalles de su itinerario y su historia. En virtud de esta inscripción, la distancia total de Capua a Regio era de 321 millas, o sea 475 km."},{"page_url":"https://de.wikipedia.org/wiki/Englisch-Niederl%C3%A4ndischer_Krieg_(1665%E2%80%931667)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Great_Fire_London.jpg","page_title":"Englisch-Niederländischer Krieg (1665–1667)","context_page_description":"Der Zweite Englisch-Niederländische Krieg war ein militärischer Konflikt zwischen dem Königreich England und den Vereinigten Provinzen der Niederlande in den Jahren 1663 bis 1667; die offizielle englische Kriegserklärung war jedoch erst im März 1665 erfolgt.\\nEs war der zweite in einer Reihe englisch-niederländischer Seekriege im 17. und 18. Jahrhundert. In der Auseinandersetzung ging es vor allem um die Gewinnung wirtschaftlicher Vorteile. Auch die Königreiche Frankreich und Dänemark sowie das Fürstbistum Münster wurden in den Krieg verwickelt, nahmen jedoch nur in geringem Umfang an ihm teil. Zur Beendigung der letztlich für die Niederlande siegreichen Kampfhandlungen, die drei offene Seeschlachten umfassten, schlossen die Parteien schließlich am 31. Juli 1667 den für die Niederlande günstigen, aber für England moderaten Frieden von Breda."},{"page_url":"https://en.wikipedia.org/wiki/Jinchuan_campaigns","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Conquest_of_the_mountain_Ripang_and_others.jpg","page_title":"Jinchuan campaigns","context_page_description":"The Jinchuan campaigns, also known as the suppression of the Jinchuan Hill Peoples, were two wars between Qing Empire and the rebel forces of Gyalrong cheftains from the Jinchuan region. The first campaign against Chiefdom of Chuchen happened in 1747 when the Tusi of Greater Jinchuan Slob Dpon attacked Mingzheng Tusi. The Qianlong Emperor decided to mobilize forces and suppress Slob Dpon, who surrendered to the central government in 1749. The second campaign against Chiefdom of Tsanlha took place in 1771, when the Jinchuan Tusi Sonom killed Gebushiza Tusi of Ngawa County in Sichuan Province. After Sonom killed Gebushiza Tusi, he helped Tusi of Lesser Jinchuan, Senge Sang, to occupy the lands belonging to the other Tusi in the region. The provincial government ordered Sonom to return lands and accept the trial at the Ministry of Justice immediately. Sonom refused to retreat his rebels. Qianlong was furious and gathered 80,000 troops and entered Jinchuan. In 1776, Qing troops sieged the castle of Sonom to force his surrender.\\nThe Jinchuan campaigns were two of the Ten Great Campaigns of Qianlong. Compare to his other eight campaigns, the cost of fighting Jinchuan was extraordinary."},{"page_url":"https://de.wikipedia.org/wiki/Tiefsee-Anglerfische","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Gigantactis_photo.JPG","page_title":"Tiefsee-Anglerfische","context_page_description":"Die Tiefsee-Anglerfische oder Tiefseeangler sind eine Unterordnung von Tiefseefischen und mit etwa 160 Arten das artenreichste Taxon der Wirbeltiere im Bathypelagial.\\nSie kommen in allen Weltmeeren unterhalb von 300 Meter Tiefe vor. Die Tiefsee-Anglerfische bestehen aus elf verschiedenen Familien und werden zur Ordnung der Armflosser gezählt. Im Unterschied zu allen anderen Armflossern, die bodenbewohnend sind, leben die Tiefsee-Anglerfische pelagisch.\\nAbgesehen von morphologischen Untersuchungen an Totfängen sind die Tiefsee-Anglerfische wenig erforscht. Beobachtungen an lebenden Fischen sind selten."},{"page_url":"https://it.wikipedia.org/wiki/Mura_spagnole_di_Milano","image_url":"https://upload.wikimedia.org/wikipedia/it/9/91/Bastioni_di_Milano_verso_Porta_Volta.jpg","page_title":"Mura spagnole di Milano","context_page_description":"Le mura spagnole di Milano, o bastioni di Milano, erano una delle tre cinte murarie che nel corso dei secoli munirono la città di Milano. Innalzate durante la dominazione spagnola fra il 1548 e il 1562 per sostituire le mura medievali della città, vennero nel corso degli anni demolite, per la gran parte, alla fine del XIX secolo come conseguenza dell'attuazione del Piano Beruto, primo piano regolatore di Milano."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BC%D0%B5%D1%82%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Tomato_Cucumber_Salat.jpg","page_title":"Сметана","context_page_description":"Смета́на — кисломолочний продукт отриманий з вершків і закваски.\\nСметану виробляють методом сквашування вершків чистими культурами мезофільних молочнокислих білків, з додаванням чи без додавання термофільного молочнокислого стрептокока.\\nЦе один з найпоживніших молочних продуктів харчування. Завдяки змінам, що відбуваються з білковою частиною в процесі сквашування, сметана засвоюється організмом швидше і легше ніж вершки відповідної жирності.\\nНа відміну від молока, у сметані менший вміст білків, але більший вміст жиру та розчинених у жирі вітамінів. У ній містяться всі вітаміни, що є в молоці, притому жиророзчинних вітаміну А та вітаміну E у декілька разів більше. Деякі молочнокислі бактерії в процесі сквашування здатні синтезувати вітаміни групи B.\\nСметана має чистий кисломолочний смак з вираженим присмаком і ароматом, властивими пастеризованому продукту. Консистенція її однорідна, в міру густа. Колір — від білого до блідо-жовтого. Для сметани жирністю 30 % характерний глянсовий відтінок."},{"page_url":"https://af.wikipedia.org/wiki/Poppekas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Puppets%2C_a_2002_photo_of_a_lithograph_from_xerographic_direct_imaging_of_two_20th_century_hand_puppets.png","page_title":"Poppekas","context_page_description":"Poppekas is 'n vorm van teater of opvoering wat die manipulasie van poppe – lewelose voorwerpe, wat dikwels lyk soos 'n mens of dier insluit en wat geanimeer of gemanipuleer word deur 'n mens, staan bekend as 'n poppespeler. Die opvoering word ook 'n marionettespel genoem. Die poppespeler gebruik bewegings van hande, arms of beheer toestelle soos stokke of snare om die liggaam, kop, ledemate en in sommige gevalle die mond en oë van die marionet te beweeg. Die poppespeler praat dikwels in die stem van die karakter van die handpop, en dan word die bewegings van die marionet se mond gesinchroniseer met hierdie gesproke deel. Die dade, gebare en gesprek wat deur die poppe opgevoer word, is tipies die gebruik van storievertelling.\\nDaar is baie verskillende variëteite van poppe en hulle word gemaak van 'n wye reeks materiale, afhangende van hul vorm en die beoogde gebruik. Hul konstruksie kan baie kompleks of baie eenvoudig wees."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A6%E0%A7%87%E0%A6%93%E0%A6%B0%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE_%E0%A6%A4%E0%A6%BE%E0%A6%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Deoria_Tal_Chandrashila_Chaukamba_reflection.jpg","page_title":"দেওরিয়া তাল","context_page_description":"দেওরিয়া তাল উত্তরাখন্ডের উখীমঠ-চোপ্তা রোডে মুস্তুরু গ্রাম থেকে ৪কিমি চড়াই এবং সারি গ্রাম থেকে ২কিমি চড়াইয়ে অবস্থিত একটি হ্রদ। এটি ২৪৩৮মিটার উচ্চতায় তুষারাবৃত হিমালয় পর্বতমালায় ও গাছপালায় ঘেরা । এখান থেকে চৌখাম্বা, মন্দানি, সুমেরু, কেদারনাথ প্পভৃতি শৃঙ্গ দৃশ্যমান।"},{"page_url":"https://sq.wikipedia.org/wiki/Stadiumi_%E2%80%9CAir_Albania%E2%80%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Air_Albania_Stadium_inauguration_match_Alb_vs_Fra.jpg","page_title":"Stadiumi “Air Albania“","context_page_description":"Arena Kombëtare njohur me emrin tregtar si Stadiumi Air Albania është një stadium futbolli i projektuar për shumë qëllime. I vendosur në kryeqytetin e Tiranës, stadiumi është ndërtuar në tokën e ish Stadiumit Qemal Stafa. Ai ka një kapacitet prej 22.500 vendesh që e bën stadiumin më të madh në Shqipëri.\\nStadiumi zotërohet nga organi drejtues i futbollit shqiptar, Shoqata Shqiptare e Futbollit dhe Shteti Shqiptar, përmes Shoqërisë Sportive Kuq e Zi Sh.A, një degë e krijuar me qëllim ndërtimin, administrimin dhe mirëmbajtjen e strukturës.\\nKrijuar nga Marco Casamonti i Archea Associati, struktura e stadiumit është një formë e veçantë shumëfaqëshe në mënyrë që secila palë të lejojë hyrjen në pjesët e tjera te ndara. Në një cep të strukturës së stadiumit është një kullë e gjatë 112 metra, e cila aktualisht është kulla më e lartë në Shqipëri. Për çdo aspekt parashikohen te ardhura të ndryshme, duke identifikuar kështu përdoruesit e zonave private, të tilla si kulla e hotelit, zonat tregtare dhe spektatorët e stadiumit."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%81%D0%BA%D0%B0_%D0%90%D1%82%D0%B0%D1%82%D1%8E%D1%80%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Ataturk_in_Izmir.jpg","page_title":"Маска Ататюрка","context_page_description":"Маска Ататюрка — великий рельєф з бетону, вкраплений в скелясту вершину, який зображає частину обличчя і голови Мустафи Кемаля Ататюрка, засновника сучасної Туреччини, розташований на південь від Кадіфекале історичного замку Ізміра на 38°24′22″ пн. ш. 27°08′46″ сх. д. Монумент був завершений у 2009 році.\\nМаска Ататюрка висотою 42 м. — це найвища рельєфна скульптура в Туреччині, і десята у світі рельєфна скульптура. Вона побудована штучно, а не вирізана з частини гори, як гора Рашмор у Сполучених Штатах. Якщо бути конкретнішим, то пам'ятник являє собою сталеву конструкцію, що містить систему космічної ферми. Маска, на побудову якої витрачено було понад три роки, має висоту навіть вище статуї Ісуса Христа в Ріо-де-Жанейро, Бразилія.\\nПісля того як погодні умови нанесли споруді значні пошкодження, допомогу з ремонтом просили надати кваліфікованих альпіністів з досвідом висотних робіт, бо висотний кран не дістає до деяких місць пам'ятника."},{"page_url":"https://en.wikipedia.org/wiki/PacWest_Center","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/PacWestCenterPortland.jpg","page_title":"PacWest Center","context_page_description":"PacWest Center is a 30-story, 127.41 m office skyscraper in Portland, Oregon. It is the fifth-tallest building in Portland, and the fourth largest with 491,528 sq ft. The building was designed by Hugh Stubbins & Associates of Cambridge, Massachusetts, and completed in 1984."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%AD%D9%8A%D8%B1%D9%87_%D8%A8%D9%8A%D9%84%D9%88%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Shand_Dam%2C_Lake_Belwood_-_Wellington_County%2C_Ontario.jpg","page_title":"بحيره بيلود","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبيلود بحيره فى كندا."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D8%B1%D9%88%D9%81%D8%B1_%D9%83%D8%B1%D8%A7%D9%86%D8%AA%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Washington_-_Smithsonian_Museum_-_Grover_Krantz_%26_Clyde.jpg","page_title":"غروفر كرانتز","context_page_description":"غروفر ساندرز كرانتز ‏ ؛ هو عالم أنثروبولوجيا أمريكي راحل؛ كان أحد قلائل العلماء الذين بحثوا عن بيغ فوت، بل وعبر أيضا عن اعتقاده بوجود المخلوق. ألف كرانتز طوال حياته المهنية أكثر من 60 مقالا أكاديميا وعشرة كتب عن تطور الإنسان، وأجرى البحوث الميدانية في أوروبا والصين وجاوة.\\nفيما عدا دراساته الرسمية في الأنثروبولوجيا التطورية وعلم الحيوانات الراقية، فقد واجهت أبحاث كرانتز على بيج فوت انتقادات شديدة واتهامات من زملائه بدعمه \\"للعلوم الهامشية\\"، ما كلفه المنح البحثية والترقيات، وأخر فترة عمله في الجامعة. وعلاوة على ذلك، تم رفض مقالاته حول الموضوع من قبل المجلات العلمية. ومع ذلك، ظل كرانتز عنيدا في عمله، وظل منجذبا إلى مواضيع مثيرة للجدل، مثل بقايا رجل كينويك، مطالبا بالحفاظ عليها ودراستها. ووصف بأنه \\"العالم الوحيد\\" و \\"المحترف الوحيد\\" الذي نظر إلى بيغ فوت بجدية في زمنه، في حقل يسيطر عليه هواة الطبيعيات بشكل كبير."},{"page_url":"https://en.wikipedia.org/wiki/Agua_Prieta_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Mapa_Municipios_Sonora_Agua_Prieta.png","page_title":"Agua Prieta Municipality","context_page_description":"Agua Prieta Municipality is a municipality in Sonora in north-western Mexico. As of 2015, the municipality had a total population of 82,918."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%94%B0%E5%9D%91%E6%9D%91%E5%8F%A4%E5%BB%BA%E7%AD%91%E7%BE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Watchtower%2C_Tiankeng_V_382.jpg","page_title":"田坑村古建筑群","context_page_description":"田坑村古建築群位於廣東省惠東縣多祝鎮，建成於清乾隆年間。為陳氏入惠八世祖西峰公及後人所建，俗稱「田坑古城」。\\n古城占地12000多平方米，有20多座四合院式民宅，房廳約400個，興盛時曾容納過700多村民。四周圍繞著4-5米高的城牆，長500多米。城牆上建有7個二至三層的碉樓，城門設在東面。田坑古城結構對稱、布局精巧，融匯廣府、潮汕、客家風格，是廣東客家圍屋的代表作之一。"},{"page_url":"https://fr.wikipedia.org/wiki/Chrysler_300M","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/2002-2004_Chrysler_300M_--_05-23-2012.JPG","page_title":"Chrysler 300M","context_page_description":"La Chrysler 300M est une berline de luxe fabriquée par Daimler Chrysler, de 1999 à 2004. C'est une traction avant, avec deux moteurs V6 différents et possédant la plateforme Chrysler LH. Elle était 254 mm plus courte que la Chrysler Concorde pour la rendre exportable en Europe comme une berline sportive. Le « M » correspond à la génération du modèle, succédant aux C-300 à 300L."},{"page_url":"https://ro.wikipedia.org/wiki/Hi_(liter%C4%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Chi_uc_lc.svg","page_title":"Hi (literă)","context_page_description":"Litera χ este o literă din alfabetul grec. Este utilizată în fizică pentru a desemna un coeficient de compresibilitate."},{"page_url":"https://sq.wikipedia.org/wiki/Manastiri_Vitovnica","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Milutinvit2.JPG","page_title":"Manastiri Vitovnica","context_page_description":"Manastiri Vitovnica është manastir i Kishës Ortodokse Serbe, i cili ndodhet në Serbinë lindore jo shumë larg nga qyteti Petrovac na Mlavi.\\nManastiri i është përkushtuar Ngritjes në qiell në Maries, nënës së Jezu Krishtit.\\nManastirin e ka ndërtuar mbreti serb Stefan Milutin Nemanjiç në vitin 1291."},{"page_url":"https://en.wikipedia.org/wiki/1969_in_the_Vietnam_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/William_Calley_Jr.jpg","page_title":"1969 in the Vietnam War","context_page_description":"6 January\\nThe South Vietnamese Minister of Education, Dr. Le Minh Tri, was killed when two VC on a motorcycle threw a hand grenade through the window of the car in which he was riding.\\n12 January to 7 February\\nIn Operation Bold Mariner the 2nd Battalion, 26th Marines and 3rd Battalion, 26th Marines clear, search and depopulate the Batangan Peninsula a Viet Cong stronghold in Quảng Ngãi Province.\\n18 January\\nThe parties to the Paris Peace Talks came to an agreement on the shape of the conference tables and the placement of the representatives who were negotiating an end to the war. After being delayed for nearly six weeks over procedural disagreements raised by South Vietnamese Vice President Nguyễn Cao Kỳ, the parties came to an accord that \\"The two sides would be 'clearly separated' by two rectangular tables with a round one in the middle\\" and that the tables would have \\"no nameplates, no flags and no written minutes of the understanding\\" on the setup.\\n20 January\\nRichard Nixon is inaugurated as 37th President of the United States.\\n21 January\\nThe White House issues National Security Study Memorandum 1 to the U.S."},{"page_url":"https://id.wikipedia.org/wiki/Mamoru_Miyano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Miyano_Mamoru_from_%22Human_Lost%22_at_Opening_Ceremony_of_the_Tokyo_International_Film_Festival_2019_%2849013608721%29.jpg","page_title":"Mamoru Miyano","context_page_description":"Mamoru Miyano adalah pengisi suara, aktor, dan penyanyi dari Prefektur Saitama, Jepang. Ia terkenal karena perannya pada Steins;Gate, Vampire Knight, Death Note, Soul Eater, Wolf's Rain, Ouran High School Host Club, Ajin: Demi-Human, Fullmetal Alchemist: Brotherhood, Tokyo Ghoul, Free!, Mobile Suit Gundam 00, Kōtetsu Sangokushi, Nobunaga the Fool, Bungo Stray Dogs, dan Uta no Prince-sama. Pada Penghargaan Seiyu 2007, ia dinominasikan pada dua penghargaan untuk perannya sebagai Light Yagami pada Death Note, dan pada tahun 2008, ia memenangkan penghargaan \\"Pengisi Suara Terbaik\\" pada Pameran Anime Internasional Tokyo 2008. Pada Penghargaan Seiyu 2008, Miyano memenangkan \\"Penghargaan Aktor Pemeran Utama Terbaik\\" untuk perannya sebagai Setsuna F. Seiei pada Mobile Suit Gundam 00, dan sebagai Hakugen Rikuson pada Kōtetsu Sangokushi.\\nMiyano memulai kariernya sebagai musisi pada tahun 2007. Ia merilis debut singel, \\"Kuon\\", pada bulan Mei di bawah label King Records. Pada bulan Maret 2009, ia merilis debut album Break."},{"page_url":"https://sv.wikipedia.org/wiki/Heldrungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Heldrungen_in_KYF.png","page_title":"Heldrungen","context_page_description":"Heldrungen är en ortsteil i staden An der Schmücke i Kyffhäuserkreis i förbundslandet Thüringen i Tyskland. Heldrungen var en stad fram till den 1 januari 2019 när den uppgick i den nya staden An der Schmücke. Heldrungen hade 530 invånare 2018."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A1%D7%98%D7%A8%D7%99%D7%93,_%D7%A0%D7%A1%D7%99%D7%9B%D7%AA_%D7%A9%D7%95%D7%95%D7%93%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Princess_Astrid_engaged_in_1926.jpg","page_title":"אסטריד, נסיכת שוודיה","context_page_description":"אסטריד, נסיכת שוודיה, הייתה אשתו של לאופולד השלישי, מלך הבלגים."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9F%8E%E6%9D%91%E6%B1%89%E5%9F%8E%E9%81%97%E5%9D%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Wuyishan_Chengcun_Hancheng_Yizhi_2012.08.24_10-14-26.jpg","page_title":"城村汉城遗址","context_page_description":"城村汉城遗址位于中国福建省武夷山市兴田镇城村西南的丘陵坡地之上，是一座汉代城池遗址。学术界对城池建筑者、所有者多有争议，或称闽越王城遗址。\\n1958年第一次全国文物普查时被发现，1959年试掘。1961年被列为福建省文物保护单位。1980年时，当地农民准备在遗址上进行开垦。为保护遗址，福建省相关部门开始全面探查和重点发掘。1996年，遗址被列为第四批全国重点文物保护单位。1999年作为世界文化和自然遗产武夷山的一部分，申报入世界遗产。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%83%D0%B1%D0%BB%D1%96%D1%87%D0%BD%D0%B0_%D0%B4%D0%B8%D0%BF%D0%BB%D0%BE%D0%BC%D0%B0%D1%82%D1%96%D1%8F_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Ua_now-logo_SVG_2.svg","page_title":"Публічна дипломатія України","context_page_description":"Публічна дипломатія України — це інструмент зовнішньої політики України, спрямований на просування привабливого образу держави за кордоном шляхом комунікації на рівні громадськості інших держав. Включає у себе використання культурної дипломатії, соціальних медіа, співпрацю з недержавними організаціями і українською діаспорою, створення та просування державного бренду тощо. Поштовхом для активізації української публічної дипломатії стала протидія російській збройній агресії проти України і інформаційній війні, пошук Україною іноземної підтримки, а також процес європейської і євроатлантичної інтеграції України."},{"page_url":"https://sl.wikipedia.org/wiki/Osmansko_cesarstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Central_europe_1683.png","page_title":"Osmansko cesarstvo","context_page_description":"Ósmansko cesárstvo ali Otománsko cesárstvo, je bila večetnična država, ki je obstajala od 27. julija 1299 do 29. oktobra 1923.\\nCesarstvo je ustanovil Osman I. iz turškega plemena Oguzov v vzhodni Anatoliji, po katerem je vladajoča dinastija Osmanov dobila ime. Bilo je eno največjih cesarstev, ki je na višku svoje moči v 16. in 17. stoletju obsegalo ozemlje Jugovzhodne Evrope, Bližnjega vzhoda in severne Afrike. Imelo je 29 provinc in številne vazalne države. Nekatere države je cesarstvo absorbiralo, druge pa so imele različne oblike neodvisnosti. Zaradi fevdne prisege zvestobe osmanskemu sultanu in kalifu ali okupacije je občasno vladalo tudi oddaljenim čezmorskim ozemljem. S prisego zvestobe na primer je leta 1656 je dobilo sultanat Ačeh na severu Sumatre, z začasno okupacijo leta 1585 pa otok Lanzarote v Atlantskem oceanu.\\nV diplomaciji zahodnoevropskih držav so cesarstvo pogosto imenovali Visoka porta, kar pomeni visoka vrata. Naziv je nastal iz starega orientalskega običaja, da je vladar sprejemal goste in tuje diplomate pred mestnimi vrati ali pred vrati svoje palače. Naziv je imel tudi simboličen pomen in je jasno kazal na mejo med Evropo in Azijo."},{"page_url":"https://ca.wikipedia.org/wiki/Dilofonotinis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Callionima_parce_MHNT_CUT_2010_0_16_Punta_Lobos%2C_Baja_California_Sur%2C_Mexico.jpg","page_title":"Dilofonotinis","context_page_description":"Dilophonotini és una tribu de lepidòpters heteròcers glossats de la família Sphingidae. Les espècies de la subtribu Hemarina es caracteritzen per imitar abellots."},{"page_url":"https://sk.wikipedia.org/wiki/Semble%C3%A7ay","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Map_commune_FR_insee_code_36217.png","page_title":"Sembleçay","context_page_description":"Sembleçay je francúzska obec, ktorá sa nachádza v departemente Indre, v regióne Centre-Val de Loire."},{"page_url":"https://fr.wikipedia.org/wiki/Ernst_Constam","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Patent_CH_147_025.jpg","page_title":"Ernst Constam","context_page_description":"Ernst Constam, né le 16 décembre 1888 à Enge, et mort en 1965 à Denver, est un ingénieur mécanique americano-suisse."},{"page_url":"https://it.wikipedia.org/wiki/Congregazione_dei_Sacri_Cuori","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Le_bon_pere_Coudrin.jpg","page_title":"Congregazione dei Sacri Cuori","context_page_description":"La Congregazione dei Sacri Cuori, o di Picpus, è un istituto religioso maschile di diritto pontificio. I membri di questa congregazione clericale, detti anche Picpusiani, pospongono al loro nome la sigla SS.CC."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D1%81%D1%82%D0%B8%D1%89%D0%B5_(%D0%9A%D0%B8%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Mostische2.jpg","page_title":"Мостище (Киевская область)","context_page_description":"Мости́ще — село в Киевской области Украины, административный центр Мостищенского сельского совета.\\nСело расположено на реке Ирпень.\\nИздревле деревня на своей территории имела около семи мостов.\\nДеревня была нанесена на карту Боплана ещё в 1650 году, а в письменных источниках впервые упоминается в 1583 году."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D0%B9%D1%82,_%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Richard_Bright_%28actor%29.jpg","page_title":"Брайт, Ричард","context_page_description":"Ричард Брайт — американский актёр."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Antoniego_Padewskiego_w_Jerzmanicach-Zdroju","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Jerzmanice-Zdr%C3%B3j%2C_ko%C5%9Bci%C3%B3%C5%82_filialny._pw._%C5%9Bw._Antoniego_Padewskiego.jpg","page_title":"Kościół św. Antoniego Padewskiego w Jerzmanicach-Zdroju","context_page_description":"Kościół pw. św. Antoniego Padewskiego w Jerzmanicach-Zdroju - rzymskokatolicka świątynia w miejscowości Jerzmanice-Zdrój w województwie dolnośląskim. Jest to kościół filialny parafii pw. Narodzenia Najświętszej Maryi Panny w Złotoryi."},{"page_url":"https://de.wikipedia.org/wiki/Sasha_Banks","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/WrestleMania_32_2016-04-03_20-06-04_ILCE-6000_9703_DxO_%2827636593530%29.jpg","page_title":"Sasha Banks","context_page_description":"Mercedes Kaestner-Varnado, besser bekannt unter ihrem Ringnamen Sasha Banks, ist eine US-amerikanische Wrestlerin und steht derzeit bei WWE unter Vertrag.\\nSie ist eine ehemalige Raw Women’s Championesse und wurde von Pro Wrestling Illustrated zur drittbesten weiblichen Wrestlerin des Jahres 2015 und zur zweitbesten weiblichen Wrestlerin des Jahres 2016 gewählt."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A6%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D1%8F%D1%86%D1%96%D1%86%D0%B5%D0%BB%D1%8F_%D0%A6%D1%96%D1%85%D0%B0%D0%BD%D0%B0_(%D0%92%D1%96%D0%BB%D0%B5%D0%B9%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/%D0%A6%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D1%8F%D1%86%D1%96%D1%86%D0%B5%D0%BB%D1%8F_%D0%BF%D0%B0%D1%82%D1%80%D1%8B%D1%8F%D1%80%D1%85%D0%B0_%D0%A6%D1%96%D1%85%D0%B0%D0%BD%D0%B0_%28%D0%92%D1%96%D0%BB%D0%B5%D0%B9%D0%BA%D0%B0%29_2.jpg","page_title":"Царква Свяціцеля Ціхана (Вілейка)","context_page_description":"Царква Свяціцеля Ціхана, Патрыярха Усерасійскага у г. Вілейка, Мінскай вобласці, па вуліцы Валынца, 13. Месціцца на паўночным ускрайку горада, на месцы былога фальварка Гарадзішча, ля скрыжавання выезду на Куранец."},{"page_url":"https://fi.wikipedia.org/wiki/Adlersparre","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/COA_family_sv_Adlersparre.png","page_title":"Adlersparre","context_page_description":"Adlersparre on Ruotsin ritarihuoneeseen kirjoitettu aatelissuku numero 1988, jonka yksi haara on korotettu vapaaherralliseen ja kreivilliseen arvoon. Valtionkonttorin sihteerin, komissaari Christoffer Christoferssenin ja hänen vaimonsa Sophia Nordlindin lapset Christoffer, Johanna ja Hedvig aateloitiin vuonna 1757 nimellä Adlersparre. Pojanpoika Georg eteni amiraaliksi läntisessä laivastossa ja hänet korotettiin vapaaherraksi 1809 ja kreiviksi 1816. Vuonna 1809 hän johti Värmlannissa kuningas Kustaa IV Aadolfin vastaista kapinaa. Georgin poika Carl August tuli kuuluisaksi salanimellä Albanon julkaistujen runojensa ansiosta."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B6%80%EC%82%B0%EC%A7%84_%EC%88%9C%EC%A0%88%EB%8F%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Busanjinsunjeoldo.jpg","page_title":"부산진 순절도","context_page_description":"부산진 순절도는 임진왜란 당시의 격전 장면을 동래부 화원이었던 변박이 그린 기록화이다. 이 순절도는 동래부순절도와 함께 숙종 35년에 처음 그려졌으나 현존하는 것은 영조 36년 동래부사 홍명한이 당시 동래부 감영 소속의 화원이었던 변박을 시켜 고쳐 그리게 한 것이다. 원래 동래부 순절도와 함께 안락서원에 있던 것으로 지금은 육군박물관으로 옮겨져 소장되고 있다.\\n이 작품은 선조 25년년 4월 13일과 14일 이틀간에 걸쳐 부산진에서 벌어졌던 왜병과의 전투장면을 묘사한 것이다.\\n부산진성은 경상도 해안지방에 설치된 수군 첨절제사의 진영인 부산포진ㆍ다대포진ㆍ가덕진ㆍ미조항진 등 4개 진 가운데 경상도 제1의 해상관문으로서, 왜군들이 조선에 상륙할 때는 반드시 거쳐야 할 요충지였다.\\n1592년 4월 13일, 700여 척의 배와 1만 8,700여 명의 병사를 이끌고 오후 5시경 부산포 앞 바다에 도착한 왜군 사령관 고니시군은 14일 새벽 부산진을 완전히 포위했고, 당시 부산진의 첨사였던 송상현 정발은 성안의 군민 1000여명과 더불어 끝까지 항전하다가 전사함으로써 마침내 부산진성은 함락되었다.\\n이 부산진 전투의 패배는 바로 동래성 전투의 패배를 예고하는 것이기도 했다."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_offentlig_konst_i_Sundbybergs_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Sissi_-_Aline_Magnusson_01.jpg","page_title":"Lista över offentlig konst i Sundbybergs kommun","context_page_description":"Det här är en lista över offentlig konst i Sundbybergs kommun. Listan är en ofullständig förteckning över främst utomhusplacerad offentlig konst i Sundbybergs kommun."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D1%8C%D1%8F%D0%BA,_%D0%A4%D1%80%D0%B0%D0%BD%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Frank_Bagnack.jpg","page_title":"Баньяк, Франк","context_page_description":"Маки Франк Баньяк Муэньи — камерунский футболист, защитник клуба «Адмира Ваккер Мёдлинг»."},{"page_url":"https://es.wikipedia.org/wiki/Idioma_aimara","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Idioma_aimara.png","page_title":"Idioma aimara","context_page_description":"El idioma aymara, a veces escrito aimara, ​ es la principal lengua perteneciente a las lenguas aimaraicas. Este idioma es hablado en diversas variantes, por el pueblo aimara en Bolivia, ​ en Perú, Argentina y Chile. El idioma es cooficial en Bolivia​ y en el Perú​ junto con el español.​ Constituye la primera lengua de un 18 % de la población de Bolivia y es el principal idioma amerindio del sur peruano y el norte chileno.​ La Organización de las Naciones Unidas para la Educación, la Ciencia y la Cultura considera que este idioma se encuentra en situación «vulnerable» de cara a su supervivencia futura.​\\nEn el caso de Argentina sigue siendo hablado por las comunidades aymaras que conviven junto con los quechuas en el norte del país​"},{"page_url":"https://pl.wikipedia.org/wiki/K%C4%99b%C5%82owo_(przystanek_kolejowy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/56806_Keblowo_dworzec_1.JPG","page_title":"Kębłowo (przystanek kolejowy)","context_page_description":"Kębłowo – zamknięty przystanek kolejowy i ładownia, dawniej stacja kolejowa we wsi Kębłowo w woj. wielkopolskim, w powiecie wolsztyńskim, w gminie Wolsztyn.\\nBudynek adaptowany jest do innych celów."},{"page_url":"https://it.wikipedia.org/wiki/Boston_Red_Sox","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/DavidOrtiz.JPG","page_title":"Boston Red Sox","context_page_description":"I Boston Red Sox sono una delle franchigie di baseball della Major League Baseball, fondata nel 1901 a Boston, Massachusetts sotto il nome di Boston Americans, sono stati anche soprannominati nei primi anni Boston Somersets, in onore del primo proprietario Charles Somers. Fin dal 1912 la squadra gioca le proprie partite interne al Fenway Park, che è il più antico ancora esistente tra gli stadi della Major League Baseball.\\nL'attuale denominazione Red Sox, scelta dal terzo proprietario John Irving Taylor nel 1908, è una contrazione dialettale della parola Red Socks e deriva dal colore dei calzettoni indossati dai giocatori della squadra.\\nLa franchigia, tra le più famose al mondo, vinse cinque World Series tra il 1903 ed il 1918, ma in seguito non riuscì più a conquistare il titolo per un periodo di 86 anni; si credette che questo fatto fosse stato causato dalla cessione di Babe Ruth ai rivali dei New York Yankees, tanto che la gente iniziò a parlare di una presunta maledizione, a cui venne dato il nome di Maledizione del Bambino. Tuttavia nel 2004 i bostoniani tornarono alla vittoria, replicandosi poi anche nel 2007, 2013 e nel 2018."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Onondaga_County,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Oswego_Oneida_Historic_District.jpg","page_title":"National Register of Historic Places listings in Onondaga County, New York","context_page_description":"This is a list of the properties and districts listed on the National Register of Historic Places listings in Onondaga County, New York. The locations of National Register properties and districts may be seen in a map by clicking on \\"Map of all coordinates\\". There are 162 properties and districts listed on the National Register in the county. Of those, 54 are outside the city of Syracuse, and are listed here, while the rest are covered in National Register of Historic Places listings in Syracuse, New York. One property, the New York State Barge Canal, spans both the city and the remainder of the county.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%99%D7%A8%D7%95%D7%AA_%D7%91%D7%AA%D7%99_%D7%94%D7%A1%D7%95%D7%94%D7%A8_(%D7%A4%D7%95%D7%9C%D7%99%D7%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/SW_RENAULT_MASTER.jpg","page_title":"שירות בתי הסוהר (פולין)","context_page_description":"שירות בתי הסוהר הוא הגוף הממשלתי בפולין המבצע משימות הקשורות לביצוע עונשי מאסר ומעצר לפני משפט ואחזקת מתקני המאסר בפולין. כפוף ישירות למשרד המשפטים ובעל מבנה ארגוני משלו."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%BC%D0%B0%D0%BD%D0%BE,_%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8_%D0%9A%D0%B0%D1%80%D0%BB%D1%81%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Christy_Carlson_Romano_2%2C_2009.jpg","page_title":"Романо, Кристи Карлсон","context_page_description":"Кристи Карлсон Романо, родилась 20 марта 1984, Милфорд, Коннектикут — американская актриса и певица. Наиболее известна по роли в ситкоме «Even Stevens» и озвучке Ким Пять-с-Плюсом в мультсериале «Ким Пять-с-Плюсом», а также озвучке Юффи Кисараги в игре «Kingdom Hearts» и в «Final Fantasy VII Advent Children»."},{"page_url":"https://nl.wikipedia.org/wiki/Santo_Ant%C3%B4nio_do_Leste","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Bandeira_Santo_Antonio_do_Leste.jpeg","page_title":"Santo Antônio do Leste","context_page_description":"Santo Antônio do Leste is een gemeente in de Braziliaanse deelstaat Mato Grosso. De gemeente telt 3.573 inwoners."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%90%D0%B2%D0%B8%D0%B0%D0%BF%D0%BE%D1%88%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/LeasideAirExpressEaton%27sPackages.jpg","page_title":"Авиапошт","context_page_description":"Авиапо́шт, я авиацин по́шт, — пошто дIайохьуьйтург авиацин гIоьнца хIаваан новкъа дIахьуш долу поштан зIен тайпа. Уггаре керла хIаваан поштан тайпа.\\nАвиапоштан лерина филателин дакъанах аэрофилатели олу."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%AE%A9-%E9%9B%85%E5%85%8B%C2%B7%E5%A8%81%E5%B0%94%E9%A9%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Jean-Jacques_Willmar.jpg","page_title":"让-雅克·威尔马","context_page_description":"让-雅克·马德林·威尔马卢森堡政治家和法学家，他是第二任卢森堡首相，任职五年，从1848年12月6日至1853年9月23日。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Regensburg-Zentrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Gesandtenstra%C3%9Fe_11_Regensburg_2013.JPG","page_title":"Liste der Baudenkmäler in Regensburg-Zentrum","context_page_description":"Auf dieser Seite sind die Baudenkmäler der Oberpfälzer Stadt Regensburg-Zentrum zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_in_Toblach","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Mitteralplsee_Toblach_02.jpg","page_title":"Liste der Naturdenkmäler in Toblach","context_page_description":"Die Liste der Naturdenkmäler in Toblach enthält die 22 als Naturdenkmal ausgewiesenen Objekte auf dem Gebiet der Gemeinde Toblach in Südtirol.\\nBasis ist das im Internet einsehbare offizielle Verzeichnis der Naturdenkmäler in Südtirol. Dabei kann es sich um botanische, geologische oder hydrologische Naturdenkmäler handeln. Die Reihenfolge in dieser Liste orientiert sich an der ID, alternativ ist sie auch nach dem Namen sortierbar."},{"page_url":"https://en.wikipedia.org/wiki/Battle_honour","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Drapeau_du_1er_RIMa.png","page_title":"Battle honour","context_page_description":"A battle honour is an award of a right by a government or sovereign to a military unit to emblazon the name of a battle or operation on its flags, uniforms or other accessories where ornamentation is possible.\\nIn European military tradition, military units may be acknowledged for their achievements in specific wars or operations of a military campaign. In Great Britain and those countries of the Commonwealth which share a common military legacy with the British, battle honours are awarded to selected military units as official acknowledgement for their achievements in specific wars or operations of a military campaign. These honours usually take the form of a place and a date.\\nTheatre honours, a type of recognition in the British tradition closely allied to battle honours, were introduced to honour units which provided sterling service in a campaign but were not part of specific battles for which separate battle honours were awarded. Theatre honours could be listed and displayed on regimental property but not emblazoned on the colours."},{"page_url":"https://ceb.wikipedia.org/wiki/Stollberg_(lungsod)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Stollberg-Erzgeb._in_ERZ.png","page_title":"Stollberg (lungsod)","context_page_description":"Lungsod ang Stollberg sa Alemanya. Nahimutang ni sa estado pederal sa Saxony, sa sentro nga bahin sa nasod, 210 km sa habagatan sa Berlin ang ulohan sa nasod. 417 metros ibabaw sa dagat kahaboga ang nahimutangan sa Stollberg, ug adunay 12,948 ka molupyo.\\nAng yuta palibot sa Stollberg kay kasagaran patag, apan sa habagatang-sidlakan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 513 ka metro ug 1.0 km sa habagatan-sidlakan sa Stollberg. Dunay mga 297 ka tawo kada kilometro kwadrado sa palibot sa Stollberg nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Chemnitz, 17.4 km sa amihanan-sidlakan sa Stollberg. Sa rehiyon palibot sa Stollberg, mga lasang talagsaon komon.\\nHapit nalukop sa lasang nga sagolsagol ang palibot sa Stollberg. Ang klima boreal. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Agosto, sa 17 °C, ug ang kinabugnawan Enero, sa -6 °C."},{"page_url":"https://fr.wikipedia.org/wiki/Cycle_d%27orientation_(Gen%C3%A8ve)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Carte_CO_Gen%C3%A8ve.png","page_title":"Cycle d'orientation (Genève)","context_page_description":"Le cycle d'orientation désigne la première partie du système d'enseignement secondaire en place dans le canton de Genève. Il se divise en trois années et marque la fin de la scolarisation obligatoire à l'âge de 15 ans environ."},{"page_url":"https://it.wikipedia.org/wiki/Paul_Willis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Nobody%27s_Kid_%281921%29_-_1.jpg","page_title":"Paul Willis","context_page_description":"Paul Willis è stato un attore statunitense, noto soprattutto come attore bambino nel cinema muto americano dal 1913 e il 1917 e quindi come giovane attore fino al 1923."},{"page_url":"https://en.wikipedia.org/wiki/Suguru_Egawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Suguru_Egawa_20180615.jpg","page_title":"Suguru Egawa","context_page_description":"Suguru Egawa is a Japanese former pitcher and current baseball analyst."},{"page_url":"https://en.wikipedia.org/wiki/Croxton,_Cambridgeshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Thatched_cottages%2C_High_Street%2C_Croxton%2C_Cambs_-_geograph.org.uk_-_386153.jpg","page_title":"Croxton, Cambridgeshire","context_page_description":"Croxton is a village and civil parish about 13 miles west of Cambridge in South Cambridgeshire, England. In 2001, the resident population was 163 people, falling slightly to 160 at the 2011 Census. Croxton Park is to the south of the current village and contains a large house and parkland."},{"page_url":"https://pl.wikipedia.org/wiki/Interleukina_13","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/IL13_Solution_Structure.rsh.png","page_title":"Interleukina 13","context_page_description":"Interleukina 13 – cytokina produkowana przede wszystkim przez limfocyty Th2, ale także przez eozynofile czy komórki NK. Wykazuje ona szerokie działanie częściowo zbliżone do działania IL-4. Odgrywa ważną rolę w odpowiedzi na pasożytnicze nicienie. Jest mediatorem zapalenia związanego z alergią.\\nLudzka IL-13 to glikoproteina o masie 17 kDa. Kodujący ją gen położony jest na chromosomie 5, w otoczeniu genów kodujących IL-4, IL-3, IL-5, IL-9, i GM-CSF.\\nStymuluje ekspresję cząsteczek MHC klasy I oraz MHC klasy II."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A1%83%E5%9C%92%E6%8D%B7%E9%81%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/TWtransportseries.png","page_title":"桃園捷運","context_page_description":"桃園都會區大眾捷運系統，簡稱桃園捷運、桃捷，是服務臺北都會區和桃園都會區的大眾捷運系統及臺灣桃園國際機場的機場聯絡軌道系統，路網範圍涵蓋臺北市、新北市和桃園市共三座城市，為中華民國第三座投入營運的捷運系統。\\n桃園捷運的規劃於1989年即展開，因種種因素導致延宕，最終延至2006年才得以正式開始建造。根據規劃，桃園捷運為交通部鐵道局、臺北市政府捷運工程局、桃園市政府捷運工程局所興建，桃園捷運的營運則由臺北市政府、新北市政府、桃園市政府合資成立的桃園大眾捷運股份有限公司負責，首條路線機場線歷經六次延宕後，最終於2017年2月2日起試營運、並在同年3月2日正式營運。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_B%C3%A4retswil","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Bauernhaus_DSC1753.JPG","page_title":"Liste der Kulturgüter in Bäretswil","context_page_description":"Die Liste der Kulturgüter in Bäretswil enthält alle Objekte in der Gemeinde Bäretswil im Kanton Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://pl.wikipedia.org/wiki/Vojt%C4%9Bch_Nejedl%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Vojtech_Nejedly_1884.png","page_title":"Vojtěch Nejedlý","context_page_description":"Vojtěch Nejedlý – czeski ksiądz katolicki, poeta i prozaik."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B9%D0%BC%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Reims_Fontaine_Sub%C3%A9_2.jpg","page_title":"Реймс","context_page_description":"Реймс - Францияның солтүстік-шығысындағы қала. Шампань-Арденна аймағындағы Марна департаментінде орналасқан. Тұрғын саны - 184984 адам. Реймс қаласы префектура немесе әкімшілік орталық болмаса да, Францияда халық санынан 12 орнында және Шампань-Арденна аймағының халық тығыздығынан бірінші орнында тұр.\\nРеймсті «королдер қаласы» немесе «тәж кигізу қаласы» деп те атайды. Себебі 10 ғасыр бойы І Хлодвигтен бастап 1825 жылы Х Карлға дейінбарлық франция королдеріне Реймс соборында тәж кигізу жорасы өткізілген. Бұл собордаң басқа да қалада көрнекті, тарихи маңызды жерлер көп. Олардың төртеуі ЮНЕСКО-ның дүниежүзілік мұралары тізіміне кірген.\\nОрта ғасырларды ашылған Шампан шымырлайтын шарабы Реймстің экономикасының негізгі табыс көзі болып табылады.\\n1945 ж. 7 мамырда Германияның капитуляция актісі бірінші рет осы жерде бегітілген.\\nҚаланың географиялық орналасуы өте тиімді: Германия, Бельги, Люксембургқа Францияның ең жақын орналасқан ірі қаласы және Париж - Страсбург, Солтүстік теңіз - Ортажердік теңіз көлік қозғалу торабы болып табылады."},{"page_url":"https://fr.wikipedia.org/wiki/Estonia_(ferry)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Estonias_bogvisir_p%C3%A5_Musk%C3%B6.jpg","page_title":"Estonia (ferry)","context_page_description":"L’Estonia est un ferry construit de 1979 à 1980 aux chantiers Meyer Werft de Papenburg en Allemagne de l'Ouest sous le nom de Viking Sally. Naviguant tout d'abord sous les couleurs de la compagnie finlandaise Viking Line, le navire est revendu en 1990 au groupe EffJohn avant d'intégrer, en 1993, la flotte de l'armateur estonien EstLine. L‘Estonia devient alors le premier navire à relier l'Estonie à la Suède depuis la chute de l'URSS, ce qui fait du car-ferry un symbole fort de l'indépendance de l'Estonie. Le 28 septembre 1994, cependant, l‘Estonia fait naufrage alors qu'il naviguait de nuit entre Tallinn et Stockholm avec 989 personnes à son bord. La catastrophe coûte la vie à 852 personnes et est encore aujourd'hui le sujet de nombreuses controverses sur les causes réelles du naufrage et le déroulement exact des faits.\\nÀ Tallinn, dans le parc, entre les remparts de la vieille ville et le port, un monument intitulé Ligne brisée porte les noms et célèbre la mémoire des 852 victimes du naufrage de l’Estonia."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D1%82%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Genthin_Denkmal_1939.jpg","page_title":"Гентин","context_page_description":"Генти́н — город в Германии, в земле Саксония-Анхальт.\\nВходит в состав района Йерихов. Подчиняется управлению Гентин. Население составляет 15 498 человек. Занимает площадь 103,73 км². Официальный код — 15 3 58 014.\\nГород подразделяется на 8 городских районов."},{"page_url":"https://nl.wikipedia.org/wiki/Mosles","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Mosles_2.JPG","page_title":"Mosles","context_page_description":"Mosles is een gemeente in het Franse departement Calvados en telt 289 inwoners. De plaats maakt deel uit van het arrondissement Bayeux."},{"page_url":"https://da.wikipedia.org/wiki/Venezuelas_delstater","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Escudo_del_Estado_Yaracuy_Vzla.png","page_title":"Venezuelas delstater","context_page_description":"Venezuela er inddelt i 23 delstater, et hovedstadsdistrikt og et føderalt distrikt, der består af en større række øer, samt Guayana Esequiba. Venezuela er yderligere underinddelt i 335 kommuner. Disse er underinddelt i over tusind sogn. Staterne er grupperet i ni administrative regioner."},{"page_url":"https://sv.wikipedia.org/wiki/Bourgetsj%C3%B6n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/0509_Lac_du_Bourget.JPG","page_title":"Bourgetsjön","context_page_description":"Bourgetsjön, Lac du Bourget, är Frankrikes största sjö helt inom Frankrikes gränser. Den ligger i norra delen av departementet Savoie, 70 km öster om Lyon, med de västra Alperna runt om. Bourgetsjön är en av de franska sjöar som uppstod efter de tillbakadragande glaciärerna i Alperna, sedan istidsmaximum för omkring 19 000 år sedan. Sjön kallas lokalt ibland Lac Gris."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%83%D0%BF_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3,_%D0%98%D0%BB%D0%BB%D0%B8%D0%BD%D0%BE%D0%B9%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Pope_County_Courthouse%2C_Golconda.jpg","page_title":"Поуп (округ, Иллинойс)","context_page_description":"Округ Поуп располагается в штате Иллинойс, США. Официально образован в 1816 году. По состоянию на 2010 год, численность населения составляла 4470 человек."},{"page_url":"https://hu.wikipedia.org/wiki/B%C3%A9csi_metr%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Wientalverbauung%2C_Zollamtssteg_und_U-Bahn-Br%C3%BCcke_%28109552%29_IMG_3564.jpg","page_title":"Bécsi metró","context_page_description":"A bécsi metró az osztrák főváros, Bécs öt vonalból álló metróhálózata. Noha az első utasokat szállító metrószerelvény csak 1976. május 8-án indult el az U4-es metrón, de a metró építményei közül akad jó néhány, ami idén 122 éves. Ennek oka, hogy az U4-es és az U6-os metró az egykori Stadtbahn-hálózat hídjait használja, melyet már 1898-ban megnyitottak. A metróvonalakat naponta körülbelül 1,4 millió ember veszi igénybe, éves utasforgalma 567,6 millió fő.\\nAz immár öt vonalból álló hálózat a kezdetek óta ütemesen fejlődik, néhány évente adnak át új szakaszokat, illetve állomásokat. Ugyan öt metróvonal van, de mégis létezik U6-os jelzésű metró. Ennek egyszerű oka van: az U5-ös viszonylatszámot kihagyták. Ezt várhatóan 2023-ra pótolják be.\\nA metró egyik igen pozitív tulajdonsága, hogy az U6-os vonal kivételével a viszonylatok kompatibilisek egymással, vagyis egy metrószerelvény gond nélkül átmehet az egyik vonalról a másikra. Emellett a metróvonalak és a többi közösségi közlekedési eszköz – különös tekintettel az S-Bahnra – koncepcionálisan is integrált rendszert alkotnak, mind a tarifarendszert tekintve, mind pedig menetrendileg."},{"page_url":"https://fi.wikipedia.org/wiki/William_Caslon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Caslon_family_grave%2C_St_Luke%27s.jpg","page_title":"William Caslon","context_page_description":"William Caslon tai William Caslon I oli englantilainen kirjasinleikkaaja ja kaivertaja sekä kirjasinvalimo Caslon Foundryn perustaja.\\nCaslon työskenteli nuorena lontoolaisen asesepän oppipoikana ja perusti oman yrityksensä vuonna 1716. Hän kaiversi aluksi aseiden lukkoja ja valmisti kirjansitojien työkaluja. Vuonna 1720 William Bowyer vanhempi vei Caslonin tutustumaan arvostettuun Jamesin kirjasinvalimoon. Bowyer auttoi sen jälkeen Caslonia perustamaan oman kirjasinvalimon. William Caslonin maine perustuu vuonna 1734 julkaistuihin antiikvakirjasimiin, jotka pohjautuivat hollantilaisiin antiikva-kirjasintyyppeihin. Caslonin taidokkaasti leikkaamia kirjasintyyppejä pidettiin esikuviaan laadukkaampina, tasapainoisempina ja hienostuneempina, ja siitä lähtien Englanti ei enää ollut riippuvainen hollantilaisista kirjakkeista.\\nCaslon leikkasi antiikvojen lisäksi myös kreikkalaisia, arabialaisia, heprealaisia, koptilaisia ja armenialaisia kirjaimia sekä suunnitteli muutamia kauniita ornamentteja. Englannin lisäksi Caslonin kirjasintyypit olivat arvostettuja myös sen siirtomaissa, ja muun muassa Yhdysvaltain itsenäisyysjulistus ladottiin Caslonin leikkaamalla antiikvalla."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B5%E0%A5%87%E0%A4%B8%E0%A5%8D%E0%A4%9F%E0%A4%AE%E0%A4%BF%E0%A4%A8%E0%A5%8D%E0%A4%B8%E0%A5%8D%E0%A4%9F%E0%A4%B0_%E0%A4%85%E2%80%8D%E0%A5%85%E0%A4%AC%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Westminster-Abbey.JPG","page_title":"वेस्टमिन्स्टर अ‍ॅबी","context_page_description":"वेस्टमिन्स्टर अ‍ॅबी हे लंडन महानगराच्या सिटी ऑफ वेस्टमिन्स्टर बरोमधील एक ऐतिहासिक चर्च आहे. अंदाजे १०व्या शतकामध्ये गॉथिक वास्तुशास्त्र वापरून बांधलेले वेस्टमिन्स्टर अ‍ॅबी वेस्टमिन्स्टर राजवाड्याच्या पश्चिमेस असून ते युनायटेड किंग्डममधील सर्वात प्रसिद्ध धार्मिक स्थळांपैकी एक म्हणून ओळखले जाते. पारंपरिक काळापासून इंग्लंड व ब्रिटनच्या राजांचा राज्याभिषेक व मृत्यूनंतर दफन येथेच होत असे. इ.स. १५४० ते १५५६ दरम्यान वेस्टमिन्स्टर अ‍ॅबीला कॅथेड्रलचा दर्जा प्राप्त झाला.\\nवेस्टमिन्स्टर अ‍ॅबी युनेस्कोचे जागतिक वारसा स्थान आहे."},{"page_url":"https://en.wikipedia.org/wiki/Hungary_in_the_Eurovision_Song_Contest_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Pierrot_%28A_Dal_2016%29.jpg","page_title":"Hungary in the Eurovision Song Contest 2016","context_page_description":"Hungary participated in the Eurovision Song Contest 2016 with the song \\"Pioneer\\" written by Zé Szabó and Borbála Csarnai. The song was performed by Freddie. The Hungarian entry for the 2016 contest in Stockholm, Sweden was selected through the national final A Dal 2016, organised by the local Media Services and Support Trust Fund and the Hungarian public broadcaster Duna Media Service Provider. An initial 30 entries competed in the national final which consisted of six shows: three heats, two semi-final and a final. Entries were selected to advance in the competition based on the votes of a four-member judging panel as well as the votes from the public. Eight entries qualified to compete in the final of A Dal 2016 where the judging panel first selected four of the entries to proceed to a second round of voting. In the second round of voting, \\"Pioneer\\" performed by Freddie was selected as the winner based entirely on a public vote.\\nHungary was drawn to compete in the first semi-final of the Eurovision Song Contest which took place on 10 May 2016."},{"page_url":"https://br.wikipedia.org/wiki/Bonn_(Vande)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Eglise_de_Bouin_85230.jpg","page_title":"Bonn (Vande)","context_page_description":"Bonn a zo ur gumun e Marzioù Breizh ha Poatev etre Naoned ha Nervouster, bremañ e departamant ar Vande. Emañ e kreizig-kreiz ar Geunioù Brezhon."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_spalinowych_zespo%C5%82%C3%B3w_trakcyjnych_i_wagon%C3%B3w_eksploatowanych_w_Polsce","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/MS-W-01%2C_Tarn%C3%B3w%2C_2016-01-26.jpg","page_title":"Lista spalinowych zespołów trakcyjnych i wagonów eksploatowanych w Polsce","context_page_description":"Lista spalinowych zespołów trakcyjnych i wagonów eksploatowanych w Polsce w ruchu planowym przez polskich przewoźników."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Forest_Heath","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Barton_Mills_Church_-_geograph.org.uk_-_207926.jpg","page_title":"Grade II* listed buildings in Forest Heath","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of Forest Heath in Suffolk."},{"page_url":"https://en.wikipedia.org/wiki/Soil_compaction","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Seabees_compactor_roller.jpg","page_title":"Soil compaction","context_page_description":"In geotechnical engineering, soil compaction is the process in which stress is applied to a soil causes densification as air is displaced from the pores between the soil grains. When stress is applied that causes densification due to water being displaced from between the soil grains, then consolidation, not compaction, has occurred. Normally, compaction is the result of heavy machinery compressing the soil, but it can also occur due to the passage of, for example, animal feet.\\nIn soil science and agronomy, soil compaction is usually a combination of both engineering compaction and consolidation, so may occur due to a lack of water in the soil, the applied stress being internal suction due to water evaporation as well as due to passage of animal feet. Affected soils become less able to absorb rainfall, thus increasing runoff and erosion. Plants have difficulty in compacted soil because the mineral grains are pressed together, leaving little space for air and water, which are essential for root growth. Burrowing animals also find it a hostile environment, because the denser soil is more difficult to penetrate."},{"page_url":"https://ceb.wikipedia.org/wiki/Rivi%C3%A8re_Manicouagan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Manic-5_and_Manic-5-PA_overview.jpg","page_title":"Rivière Manicouagan","context_page_description":"Suba ang Rivière Manicouagan sa Kanada. Nahimutang ni sa lalawigan sa Québec, sa habagatan-sidlakang bahin sa nasod, 700 km sa amihanan-sidlakan sa Ottawa ang ulohan sa nasod. Ang Rivière Manicouagan mao ang bahin sa tubig-saluran sa Rivière Manicouagan. Rivière Manicouagan nidagayday paingon ngadto sa Kadagatang Atlantiko."},{"page_url":"https://fr.wikipedia.org/wiki/A%C3%A9rodrome_Ta%27_Qali","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Gloster_Meteor_T.7_WA637_Q3-5_613_Sqn_Takali_07.52_edited-2.jpg","page_title":"Aérodrome Ta' Qali","context_page_description":"L'aérodrome Ta' Qali est le premier terrain d'aviation construit à Malte par l'administration britannique, au début du XXᵉ siècle."},{"page_url":"https://lmo.wikipedia.org/wiki/Rapperswil_(BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Rapperswil1.jpg","page_title":"Rapperswil (BE)","context_page_description":"Rapperswil a l'è un cumün svizzer del circol aministrativ de Seeland, in de la region aministrativa omònima, in de la part del Canton Berna a magioranza linguistega todèsca. La süperfiss del teritori del cumün l'è de 18.2 km² e in del Dicember 2010 al gh'eva una popolazion de 2111 abitant.\\nEl cumün de Rapperswil al se tröva a una altitüden de 521 meter sura al livel del mar e l'è tacaa ai cumün de Scheunen, Bangerten, Zuzwil, Deisswil bei Münchenbuchsee, Münchenbuchsee, Schüpfen, Grossaffoltern, Wengi, Ruppoldsried e Messen."},{"page_url":"https://fr.wikipedia.org/wiki/Emmanuel_Masqueray","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Emmanuel_Louis_Masqueray.jpg","page_title":"Emmanuel Masqueray","context_page_description":"Emmanuel Louis Masqueray, né à Dieppe le 10 septembre 1861 et mort à Saint Paul le 26 mai 1917, est un architecte français qui fit sa carrière aux États-Unis."},{"page_url":"https://vi.wikipedia.org/wiki/Viola_biflora","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Viola_biflora_Kilpisjarvi_2012-07.jpg","page_title":"Viola biflora","context_page_description":"Viola biflora là một loài thực vật có hoa trong họ Hoa tím. Loài này được L. miêu tả khoa học đầu tiên năm 1753."},{"page_url":"https://eu.wikipedia.org/wiki/Blackfoot_(Idaho)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Blackfoot%2C_Idaho.jpg","page_title":"Blackfoot (Idaho)","context_page_description":"Blackfoot Idahoko hiri bat da. Bingham konderrian kokatua dago. 2010ean 11.899 biztanle zituen, 150,88 kilometro koadrotan banatuta."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B7%D0%BC%D0%BD%D0%BE%D0%B6%D0%B8%D1%82%D0%B5%D0%BB%D1%8C_(%D0%BA%D0%BE%D0%BD%D1%84%D0%B8%D0%B3%D1%83%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%D0%BA%D0%BB%D0%B5%D1%82%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Conways_game_of_life_breeder_animation.gif","page_title":"Размножитель (конфигурация клеточного автомата)","context_page_description":"Размножитель — конфигурация таких клеточных автоматов, как игра «Жизнь», растущая квадратично, производя множество копий вторичной конфигурации, каждая из которых производит множество копий третичной конфигурации."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ozzy_Osbourne_members","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Ozzy_Osbourne_%2841493579160%29.jpg","page_title":"List of Ozzy Osbourne members","context_page_description":"Ozzy Osbourne is an English heavy metal vocalist from Aston, Birmingham. After he was fired from Black Sabbath earlier in the year, Osbourne formed a solo band in November 1979 with guitarist Randy Rhoads, bassist Bob Daisley and drummer Lee Kerslake. Since their inception, the group's personnel have changed regularly. The current lineup includes guitarist Zakk Wylde, bassist Rob \\"Blasko\\" Nicholson, keyboardist and rhythm guitarist Adam Wakeman, and drummer Tommy Clufetos."},{"page_url":"https://en.wikipedia.org/wiki/Emil_K%C3%A4llstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Emil_K%C3%A4llstr%C3%B6m_%2824412636388%29_%28cropped%29.jpg","page_title":"Emil Källström","context_page_description":"Emil Källström is a Swedish politician for the Centre Party. He represents the Västernorrland constituency and has been a member of the Riksdag since 2010. He has frequently been featured in media because of his political career, for his looks, and also for appearing high on a list of the most influential young Swedes in 2015."},{"page_url":"https://es.wikipedia.org/wiki/Harada_Naojir%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kannon_Riding_a_Dragon_by_Harada_Naojiro_%28National_Museum_of_Modern_Art%2C_Tokyo%29.jpg","page_title":"Harada Naojirō","context_page_description":"Harada Naojirō fue un pintor yōga japonés. Harada fue amigo del novelista Mori Ōgai y sirvió de modelo para el protagonista del cuento de Ōgai, Utakata no ki."},{"page_url":"https://en.wikipedia.org/wiki/Cinematic_style_of_Christopher_Nolan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Hans-Zimmer-profile.jpg","page_title":"Cinematic style of Christopher Nolan","context_page_description":"Christopher Nolan is a British-American filmmaker known for using aesthetics, themes and cinematic techniques that are instantly recognisable in his work. Regarded as an auteur and postmodern filmmaker, Nolan is partial to elliptical editing, documentary-style lighting, hand-held camera work, natural settings, and real filming locations over studio work. Embedded narratives and crosscutting between different time frames is a major component of his work, and his films often feature experimental soundscapes and mathematically inspired images and concepts. Nolan prefers shooting on film to digital video and advocates for the use of higher-quality, larger-format film stock. He also favours practical effects over computer-generated imagery, and is a proponent of theatrical exhibition.\\nHis work explores existential and epistemological themes such as subjective experience, materialism, distortion of memory, human morality, the nature of time, causality, and the construction of personal identity. His characters are often emotionally disturbed, obsessive, and morally ambiguous, facing the fears and anxieties of loneliness, guilt, jealousy, and greed."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9C%D0%B0%D0%B9%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/William_Henry_Pringle_by_Plimer.png","page_title":"Битва при Майя","context_page_description":"В битве при Майя имперский французский корпус во главе с Жан-Батистом Друэ, графом д’Эрлоном, атаковал 2-ю британскую дивизию под командованием Уильяма Стюарта на перевале Майя в западных Пиренеях. Несмотря на внезапность атаки, численно уступающие врагу британские солдаты сражались самоотверженно, причинив французам больший урон, чем понесли сами. К полудню французы стали одерживать верх и начали продвигаться вперед, но запоздалое прибытие бригады из 7-й британской дивизии стабилизировало ситуацию. Британские войска ускользнули под покровом ночи, а французы не преследовали их. Битва при Майя произошла во время Пиренейских войн и была частью битвы при Пиренеях, которая завершилась значительной победой союзников."},{"page_url":"https://ca.wikipedia.org/wiki/Joaqu%C3%ADn_de_Ordu%C3%B1a_y_Feliu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Joaqu%C3%ADn_de_Ordu%C3%B1a_y_Feliu%2C_diputaci%C3%B3n_de_Alicante%2C_Espa%C3%B1a.jpg","page_title":"Joaquín de Orduña y Feliu","context_page_description":"Joaquín de Orduña y Feliu, conegut com el Cacic del Castell de Guadalest va ser un polític i terratinent valencià, membre d'una notable i rica família alacantina."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Brokes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Seal_Johann_Bro%28c%29kes_01.jpg","page_title":"Johann Brokes","context_page_description":"Johann Brokes, auch Brockes, war Admiral und später Bürgermeister der Hansestadt Lübeck."},{"page_url":"https://eo.wikipedia.org/wiki/Nov-Hamp%C5%9Diro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Flag_of_New_Hampshire.svg","page_title":"Nov-Hampŝiro","context_page_description":"Nov-Hampŝiro estas subŝtato en la regiono de Nov-Anglio en la nordorienta Usono. Ĝi estas borderata sude far Masaĉuseco, okcidente far Vermonto, oriente far Majno kaj la Atlantika Oceano, kaj norde far la Kanada provinco Kebekio. Nov-Hampŝiro estas la kvine plej malgranda kaj la deke plej malpopulata de la 50 subŝtatoj. Konkordo estas la ĉefurbo de la subŝtato, kvankam Manĉestro estas la plej granda urbo en la subŝtato. Ĝi nek havas ajnan ĝeneralan vendaĵimposton, nek personalan enspezimposton estas impostata en subŝtata aŭ loka nivelo. La Nov-Hampŝira unubatolado estas la unua unubatolado en la Usona prezidanta ciklo de batalado. Ĝiaj licencplatoj portas la devizon de la subŝtato, “Vivu Libere aŭ Mortu”. Ĝi fariĝis la 9-a subŝtato de Usono je la 21-a de junio 1788.\\nLoĝantaro: 1,235,786\\nĈefurbo: Concord\\nLa ŝtata birdo de Nov-Hampŝiro estas la Purpura karpodako.\\nTTT-ejo de Nov-Hampŝiro en la angla http://www.state.nh.us\\nPolitiko de Nov-Hampŝiro en la angla http://www.freestateproject.org/"},{"page_url":"https://pt.wikipedia.org/wiki/Parque_Nacional_Serra_da_Capivara","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Serra_da_Capivara_-_Several_Paintings_2b.jpg","page_title":"Parque Nacional Serra da Capivara","context_page_description":"O Parque Nacional Serra da Capivara é uma unidade de conservação brasileira de proteção integral à natureza que se localiza nos municípios piauienses de Canto do Buriti, Coronel José Dias, São João do Piauí e São Raimundo Nonato. Esta área tem a maior e mais antiga concentração de sítios pré-históricos da América. Estudos científicos confirmam que a cadeia montanhosa de Capivara era densamente povoada na era pré-colombiana.\\nO parque foi criado através do decreto de nº 83.548, emitido pela Presidência da República em 5 de junho de 1979, com a finalidade de proteger um dos mais importantes exemplares do patrimônio pré-histórico do país. Originalmente com 100 000 hectares, a proteção do Parque foi ampliada pelo decreto de nº 99.143 de 12 de março de 1990 com a criação de Áreas de Preservação Permanentes de 35 000 hectares. A administração da unidade está a cargo do Instituto Chico Mendes de Conservação da Biodiversidade.\\nO Parque Nacional Serra da Capivara é um local de conservação arqueológica com uma grande riqueza de vestígios que se conservaram durante milênios."},{"page_url":"https://en.wikipedia.org/wiki/P191_Starobilsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/P191_Starobilsk_%28unloading%29.jpg","page_title":"P191 Starobilsk","context_page_description":"P191 Starobilsk is an Island-class patrol boat of the Naval Forces of Armed Forces of Ukraine.\\nOriginally she was named for Drummond Island, Michigan and then renamed for Starobilsk town. Drummond was commissioned October 19, 1988 at Bollinger Shipyard in Lockport, Louisiana, and was last homeported in San Juan, Puerto Rico. With a top speed in excess of 30 knots and a cruising speed of 26 knots, the ship is capable of enduring unsupported operations for six days and accommodates two officers and sixteen enlisted personnel.\\nThe Coast Guard's first Sentinel class cutters were stationed in Florida, replacing Island Class cutters like the Drummond."},{"page_url":"https://it.wikipedia.org/wiki/Storia_di_Guardiagrele","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Guardiagrele%2C_san_nicola%2C_esterno%2C_portale_del_1550-1600_ca._01.jpg","page_title":"Storia di Guardiagrele","context_page_description":"La storia di Guardiagrele vede la nascita della città durante il Medioevo, nell'XI secolo circa. Benché si abbiano notizie di una necropoli paleolitica nella località Comino, la città fu fondata dai Normanni come agglomerato di due villaggi fortificati, Guardia e Graeli. Nel XIV secolo la città vide l'esplosione artistica del gotico, il cui massimo rappresentante fu Nicola da Guardiagrele; inoltre per la ricchezza dei commerci, ebbe anche il privilegio da Ladislao di Durazzo di battere moneta. Nei secoli successivi il Medioevo, le sorti della città dipesero da Chieti, e la città cadde in decadenza dopo i danni del terremoto della Maiella del 1706, riacquistando importanza artistica ed economica solo nel secondo dopoguerra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B0%D1%81%D0%BE%D0%B2%D0%BD%D1%8F_%D0%A1%D1%82%D0%B5%D1%84%D0%B0%D0%BD%D0%B0_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%BF%D0%B5%D1%80%D0%BC%D1%81%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/%D0%A7%D0%B0%D1%81%D0%BE%D0%B2%D0%BD%D1%8F_%D0%A1%D1%82%D0%B5%D1%84%D0%B0%D0%BD%D0%B0_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%BF%D0%B5%D1%80%D0%BC%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_1915.jpg","page_title":"Часовня Стефана Великопермского","context_page_description":"Часовня Стефана Великопермского — часовня в Перми, построенная в честь Стефана Пермского. Расположена на углу Петропавловской улицы и Комсомольского проспекта.\\nПолное наименование — «Часовня и братство во имя Святителя Стефана, Епископа Пермского, и его преемников Герасима, Питирима и Ионы»."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_d%27%C3%A9l%C3%A8ves_de_l%27%C3%89cole_sp%C3%A9ciale_militaire_de_Saint-Cyr","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Gaspard_Lavocat.jpg","page_title":"Liste d'élèves de l'École spéciale militaire de Saint-Cyr","context_page_description":"Cet article est une liste de saint-cyriens notoires, qui disposent d'un article Wikipédia, classée par promotion, et par ordre alphabétique à l'intérieur de chacune d’elles."},{"page_url":"https://id.wikipedia.org/wiki/Kekristenan_pada_abad_ke-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Messianic_symbols.png","page_title":"Kekristenan pada abad ke-1","context_page_description":"Kekristenan di abad ke-1 mencakup sejarah Kekristenan, dari permulaan pelayanan Yesus hingga kematian Dua Belas Rasul terakhir. Oleh karena itu dikenal juga sebagai Zaman Kerasulan.\\nKekristenan awal berkembang dari pelayanan Yesus. Setelah kematian Yesus, para pengikutnya yang paling awal membentuk sekte Yahudi Mesianik selama periode Bait Suci Kedua akhir abad ke-1. Awalnya percaya bahwa kebangkitan Yesus adalah awal dari akhir zaman, kepercayaan mereka segera berubah dalam kedatangan Yesus yang diharapkan kedua dan permulaan Kerajaan Tuhan di kemudian hari.\\nRasul Paulus, seorang Yahudi yang saleh yang telah menganiaya umat Kristen masa awal, bertobat kr. 33–36 dan mulai menyebarkan injil di antara bangsa-bangsa lain. Menurut Paulus, orang-orang yang bukan Yahudi dapat dibenarkan dibebaskan dari sebagian besar perintah-perintah Yahudi, dengan alasan bahwa semua orang dibenarkan karena iman kepada Yesus. Ini adalah bagian dari awal pemisahan bertahap Kekristenan awal dan Yudaisme, karena kekristenan menjadi agama yang berbeda termasuk kepatuhan non-Yahudi.\\nYerusalem memiliki komunitas Kristen awal, yang dipimpin oleh Uskup Yakobus yang Adil."},{"page_url":"https://pt.wikipedia.org/wiki/Jo%C3%A3o_da_Cruz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/El_Monte_Carmelo.jpg","page_title":"João da Cruz","context_page_description":"João da Cruz, O.C.D. foi um místico, sacerdote e frade carmelita espanhol venerado como santo pelos católicos. Nascido em Fontiveros, em Castela a Velha, foi um dos mais importantes expoentes da Contrarreforma.\\nGrande reformador da Ordem Carmelita, é considerado, juntamente com Santa Teresa de Ávila, o fundador dos Carmelitas Descalços. João também é conhecido por suas obras literárias e tanto sua poesia quanto suas investigações sobre o crescimento da alma são consideradas o ápice da literatura mística e se destacam entre as grandes obras da literatura espanhola.\\nJoão da Cruz foi canonizado em 1726 por Bento XIII e é um dos Doutores da Igreja Católica Apostólica Romana."},{"page_url":"https://en.wikipedia.org/wiki/List_of_current_members_of_the_United_States_House_of_Representatives","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Alcee_Hastings_Portrait_c111-112th_Congress.jpg","page_title":"List of current members of the United States House of Representatives","context_page_description":"This is a list of individuals currently serving in the United States House of Representatives."},{"page_url":"https://fr.wikipedia.org/wiki/George_Kink","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/George_Kink.jpg","page_title":"George Kink","context_page_description":"George Kink est un joueur professionnel allemand de hockey sur glace.\\nIl est le fils du joueur Georg Kink et frère de Marcus Kink."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%83%D0%BF%D0%B5%D1%80%D1%81%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/SkywalkFromOutsideLedge.jpg","page_title":"Суперсооружения","context_page_description":"Суперсооружения - документальный телевизионный сериал канала National Geographic, освещающий вопросы строительства, функционирования и уничтожения крупнейших сооружений построенных человеком. Каждая серия даёт краткий экскурс в историю создания каждого суперсооружения, его применения и кратко рассказывает о перспективах развития.\\nРяд серий позднее были выделены в отдельные сериалы, такие как: Суперсооружения древности, Боевые машины, Мегаслом, Мегазаводы, Супермосты, Грандиозные переезды."},{"page_url":"https://en.wikipedia.org/wiki/Sue_Kunitomi_Embrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/SueEmbrey.jpg","page_title":"Sue Kunitomi Embrey","context_page_description":"Sue Kunitomi Embrey was a teacher, activist and long-time chair of the Manzanar Committee, which established the annual Manzanar pilgrimage and obtained National Historic Site status for the former concentration camp. Born Sueko Kunitomi, the sixth of her Japanese immigrant parents' eight children, Embrey was delivered by a mid-wife at the Kunitomi family's home in the Little Tokyo neighborhood of downtown Los Angeles. She attended the Amelia Street School, and like many other Nisei she would go to Japanese language school each day after her regular classes. At fourteen, her father was killed in a truck accident. The family got by on the debts owed to Mr. Kunitomi, which Embrey's mother would collect from friends and neighbors. This went on until Mrs. Kunitomi took out a loan and opened a small grocery store in 1941. Embrey graduated from Lincoln High School later that year and postponed going to college to help her mother with the family business. She was working at the store when news of the Japanese attack on Pearl Harbor came over the radio on December 7, 1941."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B2%83%E7%88%BE%E9%9C%8D%E5%A4%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/Coat_of_Arms_of_Volkhov_%28Leningrad_oblast%29.png","page_title":"沃爾霍夫","context_page_description":"沃爾霍夫 是俄羅斯列寧格勒州東部的一個城市，位於沃爾霍夫河畔和來往聖彼得堡—沃洛格達和摩爾曼斯克的鐵路交匯點。2002年人口46,100人。\\n1933年設市。1940年改名。"},{"page_url":"https://fr.wikipedia.org/wiki/Saline_de_Soulce","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Sel_Comtois_Logo.png","page_title":"Saline de Soulce","context_page_description":"La saline de Soulce est exploitée par la Suisse au Moyen Âge et à l'époque moderne à Soulce-Cernay dans le département du Doubs, en région de Bourgogne-Franche-Comté. L'exploitation primitive remonterait à l'époque celtique.\\nLe gisement exploité correspond au bassin salifère de Franche-Comté daté du Trias supérieur."},{"page_url":"https://fr.wikipedia.org/wiki/Col_des_Saisies","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Mont_Blanc_%28from_Les_Saisies%29.jpg","page_title":"Col des Saisies","context_page_description":"Le col des Saisies est un col routier alpin situé dans le département français de la Savoie à 1 633 m d'altitude. Il permet le passage entre la vallée du Beaufortain et celle du val d'Arly. À son sommet, se situe une station, Les Saisies, où se pratique des sports d'hiver, notamment le ski nordique."},{"page_url":"https://hu.wikipedia.org/wiki/Kineta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Kineta_SE_View.jpg","page_title":"Kineta","context_page_description":"Kineta kisváros Athén központjától 52 km-re, a szomszédos Megarával együtt a görög főváros elővárosa.\\nAttika régió legnyugatibb városa. Az Athént és Korinthoszt összekötő régi főút, a GR-8 mellett fekszik és Kineta közelében nyúlik el a fizetős új autópálya, a GR-8A is. Nyugatra Korinthia prefektúra terül el tőle, délre a Szaróni-öböl, keletre Kakia Szkala városa és egy meredek, bozótos, sziklás terület és némi erdő. Észak és északnyugat felől hegyek övezik. Korinthosz mintegy 25 km-re keletre van Kinetától.\\nFő gazdasági ága a turizmus, az utóbbi évtizedekben sok szálloda épült itt. Kinetában nincs iskola, a gyerekek Megarába vagy Agioi Theodoroiba járnak át. Temploma, kis postája, rendőrőrse és egy nagy tere van. Lakossága 1991-es adat szerint 1878 fő.\\nKinetát érinti a Spartathlon ultramaratoni futóverseny útvonala."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A7%DB%8C%D8%A7%D9%86_%D8%A7%DA%AF%D9%88%D9%84%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ryan_Eggold_2009.jpg","page_title":"رایان اگولد","context_page_description":"رایان جیمز اگولد بازیگر آمریکایی است. وی در سریال‌هایی چون بورلی هیلز ۹۰۲۱۰ و لیست سیاه و لیست سیاه: رستگاری نقش‌آفرینی کرده است.\\nاو همچنین در سریال نیو آمستردام از شبکه‌ی ان‌بی‌سی یکی از شخصیت های اصلی سریال است.‌\\nرایان در سال ۲۰۰۲ دبیرستان خود را به پایان رسانید. در دوران دبیرستان او در تئاتر اجراهای زیادی را داشت. سپس به دانشگاه کالیفرنیای جنوبی رفته و در رشته هنرهای تئاتر فارغ‌التحصیل می‌شود."},{"page_url":"https://ca.wikipedia.org/wiki/Loric%C3%ADfers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Pliciloricus_enigmatus.jpg","page_title":"Loricífers","context_page_description":"Els loricífers constitueixen un petit fílum d'animals marins amb unes trenta-tres espècies conegudes distribuïdes en nou gèneres. Aquest fílum fou descobert l'any 1983 per Reinhardt Kristensen. Els loricífers tenen cap, boca i sistema digestiu així com un conjunt d'esquelets especialitzats en forma de paraigües. No presenten sistema circulatori ni sistema endocrí. Són hermafrodites i probablement ovípars. No hi ha registre fòssil conegut.\\nEs pensa que els parents més propers de l'embrancament Loricifera són Kinorhyncha i Priapulida amb els quals constitueixen el tàxon Scalidophora."},{"page_url":"https://eo.wikipedia.org/wiki/Johann_Christian_Reil","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Johann_Christian_Reil%2C_Grab.JPG","page_title":"Johann Christian Reil","context_page_description":"Johann Christian REIL estis germana kuracisto kaj pionira psikiatro."},{"page_url":"https://lt.wikipedia.org/wiki/Derbento_emyratas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Caucasus_900_map_alt_de.png","page_title":"Derbento emyratas","context_page_description":"Derbento emyratas – nepriklausoma valstybė, egzistavusi aplink Derbento miestą, istoriniame Maskuto regione IX–XII a.\\nDerbentas buvo įkurtas dar prieš mūsų erą ir buvo labai svarbus miestas visais laikais. VII a. miestą užėmus arabams, jis įėjo į Kalifato sudėtį, kur 735 m. gavo savivaldą. Byrant Kalifatui, IX a. jis buvo viena teritorijų, kurios tapo nepriklausomos nuo centrinės valdžios, kartu su Armėnija, Gruzija ir Širvanu. Čia įsitvirtino Hašemidų dinastija.\\nPo nepriklausomybės laikotarpio 1067–71 m. emyratą prijungė prie savo sultonato Seldžiukai, o šių valdžiai nusilpus XII a. Derbentas vėl atgavo nepriklausomybę, kurios labai ilgam laikui neteko 1239 m., visą regioną užkariavus mongolams. Nuo tada miestas ėjo iš rankų į rankas: jį valdė Ilchanidai, Timūridai, Safavidai, Rusijos imperija.\\nDar vienas Derbento nepriklausomybės laikotarpis buvo 1743–1813 m., kuomet regione susikūrė Derbento chanatas. Jis galutinai prijungtas prie Rusijos imperijos."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B6%D8%BA%D8%B7_(%D8%AA%D9%85%D8%B1%D9%8A%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Liegestuetz02_ani_fcm.gif","page_title":"ضغط (تمرين)","context_page_description":"تمرين الضغط هو تمرين شائع يتم تطبيقه بالتمدد على الأرض والوجه إلى أسفل ثم رفع الجسم بدفع اليدين عن طريق ضغط الأرض. يركز تمرين الضغط على تطوير العضلة الصدرية الكبيرة والعضلة ثلاثية الرؤوس العضدية، و على تنمية وتطوير بعض العضلات الدالية، العضلة المنشارية الأمامية، والعضلة الغرابية العضدية.\\nالضغط تمرين أساسي للرياضيين والمدربين الرياضيين ويستخدم كثيرا في التدريبات العسكرية وهو عقاب شائع في المؤسسات العسكرية والمادة الرياضية في المدارس."},{"page_url":"https://de.wikipedia.org/wiki/Ritterkanton_Donau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Kantondonau.JPG","page_title":"Ritterkanton Donau","context_page_description":"Der Ritterkanton Donau war einer der fünf Kantone der Reichsritterschaft von Schwaben.\\nDer Sitz des Kantons war im vorderösterreichischen Ehingen."},{"page_url":"https://pl.wikipedia.org/wiki/Rytro","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/73/Pasmo_Jaworzyny_BS4.JPG","page_title":"Rytro","context_page_description":"Rytro – wieś w Polsce, położona w województwie małopolskim, w powiecie nowosądeckim, w gminie Rytro.\\nWieś królewska Rytter, położona była w drugiej połowie XVI wieku w powiecie sądeckim województwa krakowskiego, należała do tenuty barcickiej. W latach 1975–1998 miejscowość administracyjnie należała do województwa nowosądeckiego."},{"page_url":"https://id.wikipedia.org/wiki/Kabinet_Conte_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/GiuliaBongiorno_%28cropped%29.jpg","page_title":"Kabinet Conte I","context_page_description":"Kabinet Conte yang dipimpin oleh Giuseppe Conte adalah kabinet ke-65 di Republik Italia. Kabinet ini dibentuk sesuai dengan kesepakatan antara Gerakan Bintang Lima dengan Lega. Kabinet ini juga disebut \\"Pemerintahan Perubahan\\" atau \\"Pemerintahan Kuning-Hijau\\" sesuai dengan warna resmi masing-masing partai."},{"page_url":"https://pl.wikipedia.org/wiki/Walk_of_Game","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lara_Croft_star%2C_Walk_of_Game.JPG","page_title":"Walk of Game","context_page_description":"Walk of Game – nieistniejąca już amerykańska galeria sławy poświęcona ikonom i pionierom przemysłu gier komputerowych. Wzorowana na Hollywoodzkiej Walk of Fame galeria powstała w 2005 w należącym do Sony centrum handlowym Metreon w San Francisco."},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Kufstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Alpbach_im_Bezirk_KU.png","page_title":"Bezirk Kufstein","context_page_description":"Der Bezirk Kufstein ist ein politischer Bezirk des österreichischen Bundeslandes Tirol."},{"page_url":"https://ca.wikipedia.org/wiki/Puig_de_Son_Nassi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Carretera_de_S%C3%B3ller.jpg","page_title":"Puig de Son Nassi","context_page_description":"El Puig de Son Nassi és una muntanya de Mallorca. Pertany al municipi de Bunyola."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8E%84%E5%B0%94%C2%B7%E6%B2%83%E4%BC%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Alameda_County_Superior_Court.jpg","page_title":"厄尔·沃伦","context_page_description":"厄爾·華倫，美國著名政治家、法學家，第14任美國首席大法官、第30任美國加利福尼亞州州長。 他也曾擔任華倫委員會的主席，負責調查1963年甘迺迪總統遇刺案。 截止2020年，華倫是最後一位曾在政府內擔任過要職的美國首席大法官，他被廣泛視為美國歷史上最具影響力的首席大法官和政治領袖之一，其主政下的美國最高法院主導了美國近代史上一場劃時代的自由主義憲政革命。\\n華倫出生於美國洛杉磯，在加州的貝克斯菲爾德長大，畢業於柏克萊加州大學，先後獲得本科學位及法律博士學位。 1920-1943年間，他先後擔任舊金山灣區奧克蘭市副檢察官、阿拉米達縣地方檢察官、加州檢察總長等職務，是加州共和黨的領導人之一。1943年他就職第30任加州州長，並於1946年及1951年連續兩次成功連任，是歷史上唯一一位連任三屆的加州州長。 在華倫擔任州長期間，加州的經濟迅速發展，以加州大學為首的公立大學體系日趨完善，州內的種族隔離逐漸瓦解，而華倫也參加了1945年的聯合國國際組織會議、見證了《聯合國憲章》在加州舊金山的簽署。\\n在1948年美國總統選舉中，華倫作為湯瑪斯·杜威的競選搭檔、參選美國副總統，但杜威最終敗給了民主黨參選人哈瑞·杜魯門；在1952年美國總統選舉中，華倫尋求共和黨的提名參選，但共和黨最終提名了德懷特·艾森豪。 1953年，美國第34任當選總統艾森豪任命厄爾·華倫作為第14任美國最高法院首席大法官。 在擔任首席大法官期間，華倫領導的最高法院成為了美國自由主義、進步主義的堡壘，作出了確立美國「一人一票」民主普選制、禁止種族隔離、推廣權利法案、政教分離、逮捕程序改革、抗擊麥卡錫主義、保障言論自由、保障婚姻自由等眾多里程碑式的判決，他還協助廢除了美國的種族隔離法——吉姆·克勞法。\\n1969年6月，厄爾·華倫從最高法院正式退休，由聯邦上訴法院的保守派法官華倫·厄爾·伯格繼任首席大法官。 儘管華倫法院所作的部分判決受到了許多保守派人士的批評，但卻獲得了民主自由派人士的廣泛支持和稱讚，而且這些裁決幾乎沒有被華倫法院的繼任者們所推翻。2006年12月，美國知名雜誌《大西洋月刊》將華倫評為「美國歷史上最具影響力的100位人物」第29名，也是美國歷史上第二有影響力的首席大法官、僅次於約翰·馬歇爾。"},{"page_url":"https://uk.wikipedia.org/wiki/SVIL","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/PBB_GE_SVIL_202565_s_at_fs.png","page_title":"SVIL","context_page_description":"SVIL – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 10-ї хромосоми. Довжина поліпептидного ланцюга білка становить 2 214 амінокислот, а молекулярна маса — 247 746.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у такому біологічному процесі, як альтернативний сплайсинг.\\nБілок має сайт для зв'язування з молекулою актину, іоном кальцію.\\nЛокалізований у клітинній мембрані, цитоплазмі, цитоскелеті, мембрані, клітинних контактах, клітинних відростках."},{"page_url":"https://cs.wikipedia.org/wiki/Laho%C5%A1%C5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Laho%C5%A1%C5%A5_2016-07-20_Bou%C5%99livec.jpg","page_title":"Lahošť","context_page_description":"Obec Lahošť se nachází v okrese Teplice v Ústeckém kraji. Žije v ní 671 obyvatel."},{"page_url":"https://fr.wikipedia.org/wiki/Nagakubo-shuku","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/Kisokaido27_Nagakubo.jpg","page_title":"Nagakubo-shuku","context_page_description":"Nagakubo-shuku était la vingt-septième des soixante-neuf stations du Nakasendō. Elle est située dans la ville moderne de Nagawa, dans le district de Chiisagata, préfecture de Nagano au Japon."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D8%B3%D9%88%D8%A7%D8%AF%DA%A9%D9%88%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Iranian_Railways_5284_%2831277329991%29.jpg","page_title":"شهرستان سوادکوه","context_page_description":"شهرستان سوادکوه یکی از شهرستان‌های استان مازندران در شمال ایران و زادگاه رضاشاه پهلوی است که در ناحیهٔ البرز مرکزی و در مجاورت استان سمنان قرار گرفته‌است.\\nشهرستان سوادکوه از سمت شمال به شهرستان سوادکوه شمالی، از سمت جنوب به شهرستان فیروزکوه در استان تهران و شهرستان مهدیشهر در استان سمنان، از سمت غرب به شهرستان بابل و از سمت شرق به شهرستان ساری و ارتفاعات دودانگه و دهستان چاشم در شهرستان مهدیشهر محدود است.\\nطبق سرشماری نفوس و مسکن سال ۱۳۹۵ جمعیت این شهرستان برابر با ۴۳٬۹۱۳ نفر و جمعیت منطقه ۶۸٬۷۴۷ نفر می‌باشد و مساحت آن به ۲۰۷۸ کیلومتر مربع می‌رسد. این شهرستان با تراکم نسبی جمعیت ۹/۳۲ نفر در هر کیلومتر مربع مساحت، دارای یکی از پائین‌ترین میانگین در سطح شهرستان‌های استان مازندران است."},{"page_url":"https://es.wikipedia.org/wiki/Alameda_(jardiner%C3%ADa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Paseo_Espol%C3%B3n_Burgos.JPG","page_title":"Alameda (jardinería)","context_page_description":"Una alameda es un lugar poblado de álamos, aunque también se extiende el uso del término a otro tipo de bosquetes de árboles como el olmo, roble, almez, tilo, morera o plátano de sombra.\\nCuando los álamos crecen en la ribera de un río y son espontáneos forma parte del paisaje natural. Existen además alamedas plantadas como alineaciones de árboles por el hombre, con el fin de criar árboles de interés maderero. Otras alineaciones de árboles han sido plantados con fines constructivos para asentar terrenos inestables. De este modo planatadas sobre grandes diques servían para contener las tierras, los cuales conforma diques de las orillas de ríos, canales y lagos. De este modo se ha procedido desde el siglo XIII en los Países Bajos; o en murallas y taludes de fortificaciones militares como se hizo en Luca, Italia. Algunas de estas alamedas de entramado de taludes, y no planificadas como recreo, pronto pasaron a ser frecuentadas espontáneamente por los hombres a consecuencia de la sombra producida por las alineaciones de árboles en los meses de calor."},{"page_url":"https://sv.wikipedia.org/wiki/Porteiras","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Bras%C3%A3o_de_Porteiras-CE.jpg","page_title":"Porteiras","context_page_description":"Porteiras är en kommun i Brasilien. Den ligger i delstaten Ceará, i den östra delen av landet, 1 300 km nordost om huvudstaden Brasília. Antalet invånare är 15 065.\\nOmgivningarna runt Porteiras är huvudsakligen savann. Runt Porteiras är det ganska glesbefolkat, med 29 invånare per kvadratkilometer. Ett varmt stäppklimat råder i trakten. Årsmedeltemperaturen i trakten är 24 °C. Den varmaste månaden är oktober, då medeltemperaturen är 30 °C, och den kallaste är juni, med 20 °C. Genomsnittlig årsnederbörd är 772 millimeter. Den regnigaste månaden är mars, med i genomsnitt 166 mm nederbörd, och den torraste är augusti, med 6 mm nederbörd."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BD%D1%83%D1%84%D1%80%D1%96%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B4%D0%B5%D0%BD%D0%B4%D1%80%D0%BE%D0%BF%D0%B0%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Onufriivskyi_Park_%282019-08-18%29_32.jpg","page_title":"Онуфріївський дендропарк","context_page_description":"Ону́фріївський дендропа́рк — історичний парк у селищі міського типу Онуфріївка на Кіровоградщині; пам'ятка садово-паркового мистецтва XIX століття, один з визначних туристичних об'єктів краю."},{"page_url":"https://ca.wikipedia.org/wiki/Ostrakon","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Letters_copied_by_schoolboy%2C_Hieratic_script%2C_Western_Thebes%2C_Egypt%2C_Reign_of_Ramesses_II%2C_c._1270_BC_-_Royal_Ontario_Museum_-_DSC09723.JPG","page_title":"Ostrakon","context_page_description":"Ostrakon o òstracon és una petxina o un fragment de ceràmica sobre el qual s'escrivia.\\nEn arqueologia, s'empra el terme ostrakon per a designar els trossos de ceràmica que s'utilitzaven com a esborranys per a aprendre a escriure o pintar. Els òstracon són molt nombrosos i són una font d'informació molt útil."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_pol%C3%ADticos_dos_Estados_Unidos_cujo_uso_da_Cannabis_%C3%A9_reconhecido","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/George_Washington_1795.jpg","page_title":"Lista de políticos dos Estados Unidos cujo uso da Cannabis é reconhecido","context_page_description":"A Cannabis é uma planta e, na forma de cânhamo, também é uma fonte de fibras, extratos e sementes. Antes de sua proibição, os políticos americanos conhecidos por cultivar Cannabis incluem alguns dos Pais Fundadores e presidentes do país Os políticos que admitiram fazer uso recreativo da droga durante a proibição incluem prefeitos, governadores, membros da Câmara dos Representantes, senadores e presidentes."},{"page_url":"https://vi.wikipedia.org/wiki/Chi%E1%BA%BFn_tranh_Hoa_H%E1%BB%93ng","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/WarRosesFamilyTree.png","page_title":"Chiến tranh Hoa Hồng","context_page_description":"Chiến tranh Hoa Hồng là một loạt các cuộc nội chiến tranh giành vương vị nước Anh giữa những người ủng hộ hai dòng họ Lancaster và York. Cuộc chiến diễn ra trong các giai đoạn rời rạc khoảng từ 1455 tới 1485. Nguyên nhân của cuộc chiến xuất phát từ những rối ren về xã hội và tài chính theo sau cuộc Chiến tranh Trăm Năm, cộng thêm tình trạng thần kinh bất ổn về nền cai trị yếu mềm của vua Henry VI đã thúc đẩy Công tước xứ York là Richard nổi lên đòi ngôi báu.\\nChiến tranh kết thúc với chiến thắng của Bá tước xứ Richmond Henry Tudor, một người thừa kế của nhà Lancaster đã thành lập nên nhà Tudor cai trị nước Anh và xứ Wales trong 117 năm. Sở dĩ cuộc chiến có tên gọi chiến tranh Hoa Hồng là do huy hiệu của hai dòng họ đứng đầu cuộc chiến đều có hình ảnh hoa hồng: hoa hồng trắng của nhà York và hoa hồng đỏ của nhà Lancaster."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Korb_(W%C3%BCrttemberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/J.-F.-Weishaar-Stra%C3%9Fe_14_Korb.jpg","page_title":"Liste der Kulturdenkmale in Korb (Württemberg)","context_page_description":"In der Liste der Kulturdenkmale in Korb sind Bau- und Kunstdenkmale der Gemeinde Korb verzeichnet. Die Liste wurde nach dem Flächennutzungsplan 2015 des Planungsverband Unteres Remstal erstellt.\\nStand dieser Liste ist der 14. Juni 2004.\\nDiese Liste ist nicht rechtsverbindlich. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Gemeinde Korb erhältlich."},{"page_url":"https://en.wikipedia.org/wiki/Balcani","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Balcani_jud_Bacau.png","page_title":"Balcani","context_page_description":"Balcani is a commune in Bacău County, Western Moldavia, Romania. It is composed of four villages: Balcani, Frumoasa, Ludași and Schitu Frumoasa."},{"page_url":"https://et.wikipedia.org/wiki/Lauterach_(Vorarlberg)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Lauterach_im_Bezirk_B.png","page_title":"Lauterach (Vorarlberg)","context_page_description":"Lauterach on alev ja vald Austria Vorarlbergi liidumaal Bregenzi ringkonnas. Soome ja Suurbritannia aukonsulaadid asuvad Lauterachis.\\nLauterachi saatja on 116 m kõrge ringhäälinguseade.\\nEuroopa tee E60 läheb läbi Lauterachi."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%99%D7%94%D7%95_%D7%98%D7%95%D7%A1%D7%A7%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Chevrolet_Epica_V200_rear_China_2012-04-28.jpg","page_title":"דייהו טוסקה","context_page_description":"דייהו טוסקה היא מכונית משפחתית גדולה מתוצרת יצרנית הרכב דייהו - Daewoo Motors אשר יוצרה בין השנים 2006–2011 בדרום קוריאה ובין השנים 2006–2013 בסין על ידי יצרנית הרכב הסינית \\"SAIC-GM\\".\\nבראש פרויקט הייצור עמדה חטיבת המכוניות שברולט, מבית ג'נרל מוטורס. דגמי \\"דייהו טוסקה\\" היו קרוים גם: Chevrolet Tosca, ו-Chevrolet Epica. במקביל, דגמי \\"Holden\\" האוסטרלית"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_s%C3%A9pultures_des_souverains_de_Bretagne","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Tombeau_Alix_de_Thouars_et_Yolande_de_Bretagne.png","page_title":"Liste des sépultures des souverains de Bretagne","context_page_description":"La Bretagne, contrairement à la France et à sa Nécropole royale de la basilique de Saint-Denis, n'a jamais eu pour ses souverains un sanctuaire privilégié. Les rois et ducs de Bretagne reposent dans des lieux très éloignés les uns des autres. Cette dispersion tient d'abord au fait que le Royaume puis Duché de Bretagne n'avait pas de capitale définie. Puis, certains souverains de Bretagne ayant des ferveurs spéciales pour certaines abbayes qu'ils avaient fondées, décidèrent d'y reposer.\\nLe temps faisant son œuvre, la plupart des tombeaux des souverains bretons furent détruits ou perdus dans les méandres de l'histoire. La fin du XVIIIᵉ siècle est marqué par la Révolution française et ses excès. On ordonne, non sans résistance, la destruction des « monuments des despotes ». Le rapport de Bertrand Barère du 31 juillet 1793 marque le début d'une période sombre, la Convention décrète que les tombeaux et mausolées des « ci-devant rois », élevés dans l'église Saint-Denis, « dans les Temples et autres lieux », dans toute l'étendue de la République, seront détruits le 10 août qui suit."},{"page_url":"https://en.wikipedia.org/wiki/Connor_Downs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/The_Turnpike_Inn%2C_Connor_Downs_-_geograph.org.uk_-_1100224.jpg","page_title":"Connor Downs","context_page_description":"Connor Downs is a village in west Cornwall, England, United Kingdom, in the civil parish of Gwinear-Gwithian. It is situated approximately two miles east of Hayle and about two miles south-southeast of Gwithian churchtown. The name \\"Connor\\" was originally the name of Connerton, the medieval manor of the parish of Gwithian.\\nThe village straddles the old course of the A30 road but has now been bypassed and the new road passes to the north. Facilities include a school, a petrol station and a fish-and-chip shop."},{"page_url":"https://de.wikipedia.org/wiki/Institut_Laue-Langevin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Esrf_grenoble.jpg","page_title":"Institut Laue-Langevin","context_page_description":"Das Institut Laue-Langevin in Grenoble ist ein internationales Forschungszentrum, das mit seinem Höchstflussreaktor die stärkste Neutronenquelle der Welt betreibt. Jedes Jahr werden von zirka 1500 Gastforschern mehr als 800 Experimente, vor allem auf dem Gebiet der Neutronenstreuung, durchgeführt. Das ILL liegt nur wenige Kilometer vom Grenobler Bahnhof entfernt auf einem ehemaligen Artillerie-Übungsgelände auf der Kies-Halbinsel vor der Einmündung des Drac in die Isère. Es grenzt fast unmittelbar an das französische Centre d'études nucléaires de Grenoble. Auf dem Gelände des ILL haben sich inzwischen auch eine Außenstelle des EMBL und die ESRF niedergelassen.\\nDie als Schwimmbadreaktor gebaute Anlage erreicht einen Neutronenfluss von über 10¹⁵ cm⁻²s⁻¹. Mit Strahlrohren und Neutronenleitern werden die Neutronen an über dreißig Experimentierplätze geführt."},{"page_url":"https://en.wikipedia.org/wiki/%C3%89mile_Bernard_chronology","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Affiche_Volpini.jpg","page_title":"Émile Bernard chronology","context_page_description":"This is an Émile Bernard chronology of the life and career of French artist, art critic and writer Émile Bernard, based on documents hitherto published - however, most of the relevant sources remain unpublished. To a certain extent, these gaps can be filled by information derived from letters and biographies of e.g. Vincent van Gogh, Paul Gauguin and Émile Schuffenecker. Bernard and his work is associated with Post-Impressionism, Cloisonnism and Synthetism.\\nSince 1891, Bernard used to date his letters.\\nContents:1860s 1870s 1880s 1890s 1900s 1910s 1920s 1930s 1940s\\nThe Vanguard Years: 1884 1886 1887 1888 1889 1890 1891 1892 1893 1894 1895 1896 1897\\nFootnotes\\nReferences\\nExternal links"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%92%D0%B0%D0%B9%D1%83%D1%80%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Map_commune_FR_insee_code_12287.png","page_title":"Вайурль","context_page_description":"Вайурль — Франциянең Аверон департаментына караган коммуна, Вильфранш-де-Руэрг кантонына карый."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D1%8C%D0%BF%D1%96%D1%81_%D0%BF%D0%BE%D0%BC%D0%BD%D1%96%D0%BA%D0%B0%D1%9E_%D0%B0%D1%80%D1%85%D1%96%D1%82%D1%8D%D0%BA%D1%82%D1%83%D1%80%D1%8B_%D0%92%D1%8F%D0%BB%D1%96%D0%BA%D0%B0%D0%B3%D0%B0_%D0%9A%D0%BD%D1%8F%D1%81%D1%82%D0%B2%D0%B0_%D0%9B%D1%96%D1%82%D0%BE%D1%9E%D1%81%D0%BA%D0%B0%D0%B3%D0%B0,_%D0%B7%D1%80%D1%83%D0%B9%D0%BD%D0%B0%D0%B2%D0%B0%D0%BD%D1%8B%D1%85_%D1%83%D0%BB%D0%B0%D0%B4%D0%B0%D0%BC%D1%96_%D0%A0%D0%B0%D1%81%D0%B5%D0%B9%D1%81%D0%BA%D0%B0%D0%B9_%D1%96%D0%BC%D0%BF%D1%8D%D1%80%D1%8B%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Vilnia%2C_Vastrabramskaja%2C_Trajeckaja._%D0%92%D1%96%D0%BB%D1%8C%D0%BD%D1%8F%2C_%D0%92%D0%B0%D1%81%D1%82%D1%80%D0%B0%D0%B1%D1%80%D0%B0%D0%BC%D1%81%D0%BA%D0%B0%D1%8F%2C_%D0%A2%D1%80%D0%B0%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%281863%29.jpg","page_title":"Сьпіс помнікаў архітэктуры Вялікага Княства Літоўскага, зруйнаваных уладамі Расейскай імпэрыі","context_page_description":"Русіфікацыя Беларусі, дакладней маскалізацыя або расеізацыя — мэтанакіраваная палітыка сьвядомага адрыву беларускага народу ад гістарычных традыцыяў, роднай культуры і мовы і насаджэньня расейскай мовы і культуры.\\nУ 2-й палове XIX ст. улады Расейскай імпэрыі пачалі масава зьнішчаць старажытныя праваслаўныя цэрквы Вялікага Княства Літоўскага, а таксама перабудоўваць у стылі архітэктуры Маскоўскай дзяржавы колішнія рымска-каталіцкія, уніяцкія і нават спрадвеку праваслаўныя сьвятыні. Падобным чынам Маскоўскі патрыярхат імкнуўся абазначыць «кананічную» тэрыторыю. Фінансавалася гэтая справа з сродкаў, сабраных з удзельнікаў нацыянальна-вызвольнага паўстаньня ў выглядзе штрафаў і кантрыбуцыяў. Так, яшчэ ў 1863 годзе па аглядзе цэркваў Менскай губэрні падпалкоўнік генэральнага штабу архітэктар Зяленскі зацьвердзіў праекты на перабудову каля 100 будынкаў. У выніку падобных рэканструкцыяў адбывалася зьнявечаньне кампазыцыяў і стылёвага разьвязку помнікаў архітэктуры, зьнішчаліся высокамастацкія фрэскі, алтары, амбоны і інш.\\nУ сьпісе прыводзяцца помнікі архітэктуры Вялікага Княства Літоўскага, поўнасьцю або часткова зруйнаваныя ўладамі Расейскай імпэрыі."},{"page_url":"https://en.wikipedia.org/wiki/Babi%C4%8Di","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Babi%C4%8Di.JPG","page_title":"Babiči","context_page_description":"Babiči is a village in the City Municipality of Koper in the Littoral region of Slovenia.\\nA small church on a hill above the settlement is dedicated to Saints John and Paul. It was abandoned after it was looted by German soldiers that took refuge in the church in the Second World War and it was never restored."},{"page_url":"https://it.wikipedia.org/wiki/Samuel_Le_Bihan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Samuel_Le_Bihan_2015.jpg","page_title":"Samuel Le Bihan","context_page_description":"Samuel Le Bihan è un attore francese."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BC%D0%B5%D1%80%D1%88%D0%B8%D0%B5_%D0%B2_%D0%B4%D0%B5%D0%BA%D0%B0%D0%B1%D1%80%D0%B5_2019_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Galina_Volchek%2C_November_2011.jpeg","page_title":"Умершие в декабре 2019 года","context_page_description":"Это список известных людей, соответствующих установленным критериям значимости, умерших в декабре 2019 года.\\nПричина смерти указывается лишь в исключительных случаях. В остальных случаях — не указывается.\\n← Ноябрь 2019"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B8%D0%BE%D0%BD%D1%81%D0%BA%D0%B8_%D0%B0%D1%80%D1%85%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Statuettes_of_Harpokrates%2C_the_companion_of_Isis%2C_from_the_sanctuary_of_Isis%2C_Archaeological_Museum%2C_Dion_%286933816840%29.jpg","page_title":"Дионски археологически музей","context_page_description":"Дионският археологически музей е музей в археологическия обект на древногръцкия град Дион, Гърция."},{"page_url":"https://id.wikipedia.org/wiki/Pesta_Olahraga_Asia_Tenggara_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Jakabaring_Aquatic_Center%2C_SEA_Games_2011_Palembang_1.jpg","page_title":"Pesta Olahraga Asia Tenggara 2011","context_page_description":"Pesta Olahraga Asia Tenggara 2011 merupakan Pesta Olahraga Asia Tenggara yang diselenggarakan selama 12 hari di Jakarta dan Palembang, Indonesia, pada 11-22 November 2011.\\nJakarta sudah pernah menyelenggarakan SEA Games 3 kali, yaitu pada tahun 1979, 1987, dan 1997. Palembang akan menjadi kota ketiga yang menyelenggarakan SEA Games di luar ibu kota negara setelah Chiang Mai dan Nakhon Ratchasima, Thailand.\\nJuara umum Pesta Olahraga Asia Tenggara ke-26 2011 adalah tuan rumah Indonesia."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BD%D0%B0_%D0%A0%D0%B5%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/%D0%90%D1%9F%D0%B8%D0%BD%D0%B0_%D0%A0%D0%B5%D0%BA%D0%B0_2.jpg","page_title":"Горна Река","context_page_description":"Горна Река — географска и етнографска област која го зафаќа северниот дел од Реканскиот регион, односно горното течение на реката Радика, во Западна Македонија. Нејзината територија административно им припаѓа на општините Маврово и Ростуше и Гостивар. Подрачјето е населено со муслиманско и православно христијанско население со албански како мајчин јазик, познато под името Шкрети, главно со македонско и во помал дел со албанско самосознание.\\nГорна Река е изразит планински предел ограничен од планините Кораб на запад, најјужната огранка на масивот на Шар Планина — Ничпурска Планина на север и Бистра на исток, додека на југ е отворена кон долината на Радика, но како пределна граница со Долна Река ја има клисурата Барич. Пределот е изразито алпски и суров со пасишта и говеда. Во поново време, најголемо населено место е селото Врбјани. Областа претставува изолирано и неразвиено подрачје со ограничени комуникациски врски, така што пристапот до него е отежнат во снежни услови за време на зимските месеци.\\nНаселението на областа низ историјата главно се занимавало со земјоделство, а дел од него и денес се занимава со оваа стопанска дејност."},{"page_url":"https://pt.wikipedia.org/wiki/Castelo_de_Chaves","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Torre_de_Menagem_Chaves_03.JPG","page_title":"Castelo de Chaves","context_page_description":"O Castelo de Chaves localiza-se na freguesia de Santa Maria Maior, cidade e concelho de Chaves, distrito de Vila Real, em Portugal.\\nEm posição dominante sobre uma elevação à beira do rio Tâmega, defendia a fronteira com a Galiza."},{"page_url":"https://es.wikipedia.org/wiki/Juegos_Ol%C3%ADmpicos_de_Estocolmo_1912","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/1912_Athletics_men%27s_400_metre_final2.JPG","page_title":"Juegos Olímpicos de Estocolmo 1912","context_page_description":"Los Juegos Olímpicos de Estocolmo 1912, oficialmente conocidos como los Juegos de la V Olimpiada, fue un evento multideportivo celebrado en la ciudad de Estocolmo, capital de Suecia, entre el 5 de mayo y el 27 de julio de 1912. Participaron 2407 atletas —2359 hombres y 48 mujeres—​ provenientes de 28 países, ​ los cuales compitieron en 102 especialidades pertenecientes a 14 deportes olímpicos. A excepción de los eventos de tenis —que comenzaron el 5 de mayo— y los de fútbol y tiro —que lo hicieron el 29 de junio—, todos los demás se iniciaron después de la inauguración oficial, que se llevó a cabo el 6 de julio.\\nEsta edición fue la primera en la que se celebraron eventos de arte, decatlón y pentatlón —ambas pruebas ganadas por Jim Thorpe—, saltos femeninos y natación femenina. Además, se incluyeron importantes avances tecnológicos a la hora de cronometrar en las pruebas de atletismo.\\nLas medallas se repartieron en su mayoría entre las delegaciones de Suecia y Estados Unidos. Los locales se impusieron en el medallero global con 65 medallas totales, mientras que los estadounidenses fueron los más exitosos en cuanto a medallas de oro, con 25."},{"page_url":"https://da.wikipedia.org/wiki/Baileybro","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Baileybro_ved_Ribe_6.jpg","page_title":"Baileybro","context_page_description":"En Baileybro er en transportabel præfabrikeret gitterbro, som er udformet til brug for ingeniørtropper til at bygge broer af op til 60 meters længde. Der kræves ingen særlige værktøjer eller tungt udstyr til bygningen, broens dele er så små, at de kan transporteres på lastbiler og broen er stærk nok til at kunne bære kampvogne. Broen betragtes som et fremragende eksempel på militær ingeniørkunst.\\nBaileybroen er en feltbro, det vil sige en midlertidig bro, der ofte er opført således at militære enheder kan forcere vandløb og kløfter. Disse feltbroer blev oprindeligt opført af forhåndenværende materialer. Flydebroen er ved siden af Baileybroen et moderne eksempel på en feltbro."},{"page_url":"https://id.wikipedia.org/wiki/Huangshan_(kota)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Loujiepailou.jpg","page_title":"Huangshan (kota)","context_page_description":"Huangshan adalah sebuah prefektur di provinsi Anhui selatan, Tiongkok. Huangshan berarti Gunung Kuning dalam bahasa Mandarin dan kota ini dinamai sesuai dengan gunung yang termasyhur itu, yang mencakup banyak wilayah geografis kota yang luas. Kota prefektur Huangshan mencakup tiga distrik urban dan empat county. Pusat kota Huangshan awalnya adalah kota Tunxi, namun sekarang disebut Distrik Tunxi. Penduduk lokal masih menyebut kota Tunxi untuk membedakan bagian inti perkotaan ini dari bagian lainnya di Huangshan.\\nHuangshan berada di bagian selatan Anhui, dibatasi oleh Chizhou di barat laut, Xuancheng di timur laut, provinsi Jiangxi di barat daya dan Zhejiang di tenggara. Sejarah Huangshan berasal dari zaman kaisar pertama Qin Shi Huangdi. Yurisdiksi kota saat ini mencakup sebagian besar wilayah sejarah dan budaya Huizhou yang bersama dengan Anqing membentuk nama Provinsi Anhui. Huangshan memiliki 2 Situs Warisan Dunia UNESCO yaitu: Gunung Huang dan Desa Kuno di Anhui Selatan - Xidi dan Hongcun. Keduanya merupakan tempat tujuan wisata terkemuka di Tiongkok."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%A2%E9%A9%AC%E9%87%8C%E6%80%BB%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Sharif_Sheikh_Ahmed%2C_12th_AU_Summit%2C_090202-N-0506A-337-2.jpg","page_title":"索马里总理","context_page_description":"索马里总理，是索马里政府首脑。1956年设立。\\n总理由总统提名，组阁后30日以内议会决定承认指名提名。"},{"page_url":"https://fr.wikipedia.org/wiki/Occidozyga_semipalmata","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Occidozyga_semipalmata.jpeg","page_title":"Occidozyga semipalmata","context_page_description":"Occidozyga semipalmata est une espèce d'amphibiens de la famille des Dicroglossidae."},{"page_url":"https://ga.wikipedia.org/wiki/Somerton","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Somerton.jpg","page_title":"Somerton","context_page_description":"Is baile atá suite in oirdheisceart Somerset é Somerton. Bhí cónaí ar 4,697 duine sa bhliain 2011."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_a_las_Cortes_Valencianas_de_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Ximo_Puig_2016_%28cropped%29.jpg","page_title":"Elecciones a las Cortes Valencianas de 2019","context_page_description":"Las elecciones a las Cortes Valencianas correspondientes a la x Legislatura de la Comunidad Valenciana del actual período democrático tuvieron lugar el domingo 28 de abril de 2019 después de la polémica respecto a su fecha de celebración, haciéndolas coincidir con las elecciones generales anticipadas.​ De acuerdo con el Estatuto de Autonomía del 2006 y la ley electoral valenciana, la circunscripción electoral es la provincia​​ y cada una de las tres provincias valencianas tiene asignado un mínimo de veinte diputados, más un número adicional variable en función de su población, hasta llegar a los 99 diputados que forman las Cortes Valencianas. Fue la primera vez que no se celebraron junto con las elecciones municipales y las del resto de autonomías del régimen común, que se celebraron el 26 de mayo.​"},{"page_url":"https://pl.wikipedia.org/wiki/Blumenstein","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Blumenstein_BE_Switzerland.JPG","page_title":"Blumenstein","context_page_description":"Blumenstein – miejscowość i gmina w Szwajcarii, w kantonie Berno. W 2017 roku liczyła 1227 mieszkańców."},{"page_url":"https://it.wikipedia.org/wiki/Kur%C5%A1%C4%97nai","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Kur%C5%A1%C4%97nai_1.JPG","page_title":"Kuršėnai","context_page_description":"Kuršėnai è la venticinquesima città lituana per grandezza. Il significato del suo nome deriva da kur e šienas ossia \\"dove è il fieno\\".\\nSi trova 25 km ad ovest di Šiauliai e si sviluppa su entrambe le rive del fiume Venta. Viene a volte considerata la capitale del distretto municipale di Šiauliai, essendone la città più grande. Ha una caratteristica unica: è l'unica città lituana ad avere due stazioni ferroviarie.\\nIvi nacque il cestista Vytautas Kulakauskas."},{"page_url":"https://it.wikipedia.org/wiki/Bill_Champlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bill_Champlin.jpg","page_title":"Bill Champlin","context_page_description":"William Bradford \\"Bill\\" Champlin è un cantante, tastierista, chitarrista e arrangiatore statunitense, noto soprattutto per essere stato, dal 1981 al 2009, uno dei componenti della band Chicago. È vincitore di due Grammy Awards, nel 1979 e nel 1981."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EB%A5%B4%EA%B2%8C%EC%9D%B4_%EB%B9%84%ED%85%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Sergei_Yulyevich_Witte_1905.jpeg","page_title":"세르게이 비테","context_page_description":"세르게이 율리예비치 비테 백작은 러시아 제국의 첫 번째 총리였다.\\n러시아는 1905년부터 총리 제도를 실시하였다. 그 이전에는 차르 니콜라이 2세가 강력한 전제 정치를 폈던 전제 군주제국가였다. 그러나 당시에는 총리가 되려면 차르와 친분 관계가 있어야 했고, 비록 총리 제도가 실시되었지만 황제의 강권은 여전하였다.\\n러시아 재무부 철도사업국 국장, 교통부 장관, 재무부 장관, 총리 등을 역임하였다. 러일전쟁의 강화 조약인 포츠머스 조약 체결시에 러시아측 전권대표로서 일본측의 대표였던 고무라 주타로 외상과 교섭을 하였다. 이로 인해 총리 권력을 이반 고레미킨에게 넘겼다."},{"page_url":"https://sv.wikipedia.org/wiki/Maxera_lophocera","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Pl.38-06-Maxera_lophocera_%28Hampson%2C_1910%29_%28Parathermes%29.JPG","page_title":"Maxera lophocera","context_page_description":"Maxera lophocera är en fjärilsart som beskrevs av George Francis Hampson 1910. Maxera lophocera ingår i släktet Maxera och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Afrikanischer_Quastenstachler","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Atherurus_africanus_distribution_map.png","page_title":"Afrikanischer Quastenstachler","context_page_description":"Der Afrikanische Quastenstachler ist eine Stachelschweinart aus der Gattung der Quastenstachler. Er kommt in West- und Zentralafrika südlich der Sahara vor."},{"page_url":"https://de.wikipedia.org/wiki/Ladislaus_IV.","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Ladislaus_IV_Litho.JPG","page_title":"Ladislaus IV.","context_page_description":"Ladislaus IV. der Kumane aus dem Adelsgeschlecht der Árpáden war von September 1272 bis 1290 König von Ungarn und Kroatien.\\nEr war der Sohn König Stephans V. von Ungarn und der kumanischen Prinzessin Elisabeth. Ladislaus war verheiratet mit Isabella von Anjou, Tochter des Königs Karl I. von Neapel."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Wasserlosen","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Wasserlosen%2C_Schwemmelsbach%2C_Gromb%C3%BChl%2C_Prozessionsaltar%2C_001.jpg","page_title":"Liste der Baudenkmäler in Wasserlosen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Gemeinde Wasserlosen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 97 Baudenkmäler."},{"page_url":"https://hr.wikipedia.org/wiki/Splitska_katedrala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/SplitBellTower.JPG","page_title":"Splitska katedrala","context_page_description":"Splitska katedrala posvećena je Uznesenju Blažene Djevice Marije, u narodu je poznata kao Katedrala sv. Dujma. Katedrala je smještena u kompleksu Dioklecijanove palače u Splitu, na Peristilu i prvotno je bila carski mauzolej, sagrađen početkom 4. stoljeća. Katedrala sv. Duje najstarija je katedrala u svijetu."},{"page_url":"https://simple.wikipedia.org/wiki/Lithuania","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Lithuanian_President_Valdas_Adamkus_and_Vice_President_Dick_Cheney_in_Vilnius%2C_Lithuania.jpg","page_title":"Lithuania","context_page_description":"Lithuania is a country in northern Europe on the eastern shore of the Baltic Sea. Lithuania is a member of the European Union, NATO, and several other organizations.\\nAbout 3,000,000 people live in the country. The official language is Lithuanian which is spoken by more than 82% of the people. Vilnius is the capital and largest city.\\nThe colors of the Lithuanian flag are yellow, for the sun, green, for the fields, and red, for the blood of Lithuanians fighting for its independence."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Amis_des_amis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/EmbarrassmentsHenryJames1896Cover.jpg","page_title":"Les Amis des amis","context_page_description":"Les Amis des amis est une nouvelle fantastique d'Henry James, aussi connue sous les titres L'Origine de la chose ou Comment tout arriva.\\nCette nouvelle fantastique appartient au sous-genre des histoires de fantômes, mais fidèle à son art, Henry James s'y refuse aux effets superficiels du genre pour mieux sonder les profondeurs psychologiques de ses personnages."},{"page_url":"https://en.wikipedia.org/wiki/Matt_Baumgardner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Tropical_Languor_-3.jpg","page_title":"Matt Baumgardner","context_page_description":"Matthew Clay Baumgardner was an American contemporary artist and National Endowment for the Arts Visual Artist Fellowship winner whose work was featured in multiple public and private collections including the Gibbes Museum of Art and the Greenville Museum of Art in Greenville, SC. After graduating with an MFA from University of North Carolina at Chapel Hill in 1982, he was a fixture for over three decades in New York City's art scene.\\nSince leaving New York for Travelers Rest, South Carolina in 2006 he has been featured in numerous magazines, newspapers and online articles some of which focus on his art and others on his home and studio."},{"page_url":"https://de.wikipedia.org/wiki/Lophiodon","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Georges_Cuvier_large.jpg","page_title":"Lophiodon","context_page_description":"Lophiodon ist eine ausgestorbene Gattung der Säugetiere, deren Vertreter im Eozän lebten und überwiegend im heutigen Europa nachgewiesen wurden, wo sie in jener Zeit sehr häufig auftraten. Bekannt ist die Gattung über zahlreiche, teilweise auch vollständige Skelettfunde, die vor allem aus dem Geiseltal, aber auch aus der Grube Messel und weiten Bereichen West- und Südeuropas stammen. Die zu Lophiodon gehörenden Tiere ähnelten äußerlich heutigen Tapiren und gehören in deren weiteren Verwandtenkreis, sind aber möglicherweise näher mit den ebenfalls ausgestorbenen Chalicotherien verwandt. Die Tiere lebten an Flussläufen in tropischen Regenwäldern und ernährten sich hauptsächlich von Blättern. Erstmals beschrieben wurde die Gattung bereits 1822. Im Laufe der Forschungsgeschichte wurden zahlreiche zu dieser Gattung gehörende Arten beschrieben."},{"page_url":"https://ca.wikipedia.org/wiki/Candidatura_de_T%C3%B2quio_als_Jocs_Ol%C3%ADmpics_de_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Tokyo_2016_Olympic_bid_Oka1.JPG","page_title":"Candidatura de Tòquio als Jocs Olímpics de 2016","context_page_description":"La candidatura de Tòquio als Jocs Olímpics de 2016 va ser l'intent de Tòquio, la ciutat capital del Japó en ser escollida pel Comitè Olímpic Internacional per albergar els XXXI Jocs Olímpics de 2016. La ciutat anteriorment va ser seu dels Jocs Olímpics de 1964. La seva candidatura es va oficialitzar el 14 de setembre de 2007. Tòquio va ser una de les candidatures que va passar a la llista curta el 4 de juny de 2008, en la qual la guanyadora va ser anunciada el 2 d'octubre de 2009. Les altres ciutats candidates van ser Chicago, Madrid i Rio de Janeiro. Si Tòquio hagués guanyat la candidatura, els jocs serien realitzats entre el 29 de juliol al 14 d'agost de 2016, i els Paralímpics entre el 31 d'agost a l'11 de setembre del mateix any.\\nAl costat de les quatre candidates oficials, també es van postular pels Jocs Olímpics de 2016 les ciutats de Praga, Doha i Bakú, que no van superar la primera avaluació del COI."},{"page_url":"https://en.wikipedia.org/wiki/Media_independence","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/RDR_indicator_scores_for_policy_transparency_in_regards_to_third-party_requests_for_content_or_account_restriction.png","page_title":"Media independence","context_page_description":"Media independence is the absence of external control and influence on an institution or individual working in the media. It is a measure of one's capacity to \\"make decisions and act according to its own logic,\\" and distinguishes independent media from state media.\\nThe concept of media independence has often been contested as a normative principle in media policy and journalism. Nick Couldry considers that digital transformations tend to compromise the press as a common good by the technological, political and social dynamics that it brings. For this reason, authors such as Daniel Hallin, Kelly McBride, and Tom Rosenstiel consider other norms to be more relevant. Karppinen and Moe state that \\"what we talk about when we talk about media independence, then, are the characteristics of the relations between, on the one side, specific entities ranging from media institutions, via journalistic cultures, to individual speakers, and, on the other, their social environment, including the state, political interest groups, the market or the mainstream culture.\\""},{"page_url":"https://en.wikipedia.org/wiki/Euchlaena_obtusaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Euchlaena_obtusaria.jpg","page_title":"Euchlaena obtusaria","context_page_description":"Euchlaena obtusaria, the obtuse euchlaena moth, is a species of moth of the family Geometridae. It is found in North America, where it has been recorded from Alberta east to Nova Scotia, south to Florida and Texas. The habitat consists of mixedwood forests.\\nThe wingspan is 27–48 mm. The wings are purplish-grey, tan or dark chestnut brown with yellow on the median area. There are black spots at the tip of the forewings. Adults are on wing from April to September.\\nThe larvae feed on Rosa and Impatiens species. They are twig mimics. They are striped with pale and brown. The species overwinters in the larval stage."},{"page_url":"https://en.wikipedia.org/wiki/List_of_highways_in_Ontario","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Ontario_Highway_641.png","page_title":"List of highways in Ontario","context_page_description":"This is a list of current and former provincially maintained highways in the Canadian province of Ontario."},{"page_url":"https://en.wikipedia.org/wiki/Marvel_Comics","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/6.21.10BrubakerGageFractionBendisByLuigiNovi1.jpg","page_title":"Marvel Comics","context_page_description":"Marvel Comics is the brand name and primary imprint of Marvel Worldwide Inc., formerly Marvel Publishing, Inc. and Marvel Comics Group, a publisher of American comic books and related media. In 2009, The Walt Disney Company acquired Marvel Entertainment, Marvel Worldwide's parent company.\\nMarvel was started in 1939 by Martin Goodman under a number of corporations and imprints but now known as Timely Comics, and by 1951 had generally become known as Atlas Comics. The Marvel era began in 1961, the year that the company launched The Fantastic Four and other superhero titles created by Stan Lee, Jack Kirby, Steve Ditko and many others. The Marvel brand, which had been used over the years, was solidified as the company's primary brand.\\nMarvel counts among its characters such well-known superheroes as Spider-Man, Iron Man, the Hulk, Thor, Captain America, Ant-Man, the Wasp, Black Widow, Wolverine, Captain Marvel, Black Panther, Doctor Strange, Ghost Rider, Blade, Daredevil, the Punisher and Deadpool."},{"page_url":"https://es.wikipedia.org/wiki/Centro_de_convenciones_de_Fukuoka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Marine_Messe.jpg","page_title":"Centro de convenciones de Fukuoka","context_page_description":"El Centro de convenciones de Fukuoka situado en Fukuoka, Japón, es un grupo de tres edificios separados donde opera la Fundación del centro de convenciones de Fukuoka."},{"page_url":"https://fr.wikipedia.org/wiki/Hurbache","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Hurbache_88210.jpg","page_title":"Hurbache","context_page_description":"Hurbache est une commune française située dans le département des Vosges, en région Grand Est.\\nSes habitants sont appelés les Hurbachois."},{"page_url":"https://en.wikipedia.org/wiki/Flaman_Speed_Indicator_and_Recorder","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/H220_Flaman_recorder.jpg","page_title":"Flaman Speed Indicator and Recorder","context_page_description":"The Flaman Speed Indicator and Recorder was a device patented in 1901 by Nicolas Charles Eugène Flaman of France for indicating the current speed of a vehicle and recording it on a paper tape that could be unrolled and examined at the end of a run to provide evidence of the speeds attained on the journey."},{"page_url":"https://de.wikipedia.org/wiki/Fujifilm-X-Serie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Fujifilm_X70_with_wide-converter_front-left_2016_China_P%26E.jpg","page_title":"Fujifilm-X-Serie","context_page_description":"Die X-Serie ist eine Reihe von digitalen Kameragehäusen eines digitalen Kamerasystems von Fujifilm, die anspruchsvolle Amateure und professionelle Fotografen als Zielgruppe hat. Der Name leitet sich von den Modellbezeichnungen der Kameragehäuse ab, welche alle mit einem X beginnen. Die X-Serie zeichnet sich durch die einheitliche Verwendung von Sensoren in APS-C Format mit Fujifilms X-Trans Farbfilter aus. Das Bedienkonzept lehnt sich an analoge Kameras an, so besitzen die meisten Objektive zum Beispiel einen eigenen Blendenring."},{"page_url":"https://id.wikipedia.org/wiki/Station_wagon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Three_body_styles_with_pillars_and_boxes.png","page_title":"Station wagon","context_page_description":"Station wagon adalah bentuk mobil berbasis sedan yang atap bagian belakangnya dipanjangkan sampai ke atas bagasi. Hal ini membuat ruang bagasi station wagon menyatu dengan ruang penumpang. Dengan demikian station wagon memiliki pilar D pada ujung belakangnya. Station wagon pada umumnya memiliki pintu bagasi yang membuka ke atas seperti layaknya hatchback, tetapi ada juga yang memiliki pintu membuka ke bawah dan jendela yang dapat dibuka terpisah."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Sigmundsherberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Rodingersdorf_Immaculata.jpg","page_title":"Liste der denkmalgeschützten Objekte in Sigmundsherberg","context_page_description":"Die Liste der denkmalgeschützten Objekte in Sigmundsherberg enthält die 29 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Marktgemeinde Sigmundsherberg."},{"page_url":"https://fi.wikipedia.org/wiki/Tohtorinpuukasvit","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Protium_heptaphyllum.jpg","page_title":"Tohtorinpuukasvit","context_page_description":"Tohtorinpuukasvit on trooppinen kasviheimo koppisiemenisten Sapindales-lahkossa. Heimoon kuuluvat mm. gabonpuut, hartsistaan kuulut olibaanit, tohtorinpuut, elemit ja mirhapuut."},{"page_url":"https://es.wikipedia.org/wiki/Pierre_Wom%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Pierre_Wom%C3%A9.jpg","page_title":"Pierre Womé","context_page_description":"Pierre Nlend Wome, nació el 26 de marzo de 1979, es un exfutbolista Camerunés de fútbol, que jugó de lateral izquierdo por diversos equipos italianos, cerrando de su carrera en Alemania, en el club FC Colonia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A5%BF%E5%A1%B1%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Xilang_Station_Concourse_Part_3.JPG","page_title":"西塱站","context_page_description":"西塱站是廣州地鐵1號線的西南端終點站，以及廣佛地鐵的中途站，因位處芳村西塱村而命名。車站於1997年6月28日隨1號線試運營啟用。\\n本站廣州地鐵1號線與位於北側的西朗車輛段接軌。另外，西塱站是廣州地鐵1號線兩個地面車站之一，另一個是坑口站。"},{"page_url":"https://sh.wikipedia.org/wiki/Likavka","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Likava_Likavaka_castle_hrad_ch%C3%A2teau.jpg","page_title":"Likavka","context_page_description":"Likavka je naseljeno mjesto u okrugu Ružomberok, u Žilinskom kraju, Republika Slovačka."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%B4%D8%B1%DA%A9%D8%AA%E2%80%8C%D9%87%D8%A7%DB%8C_%D9%87%D9%88%D8%A7%D9%BE%DB%8C%D9%85%D8%A7%DB%8C%DB%8C_%D8%A2%D9%84%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/D-AEAG_DHL_%28European_Air_Transport_-_EAT%29_%286872540344%29.jpg","page_title":"فهرست شرکت‌های هواپیمایی آلمان","context_page_description":"این مقاله شامل فهرست شرکت‌های هواپیمایی آلمان است."},{"page_url":"https://sl.wikipedia.org/wiki/Rob_Blake","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Rob_Blake.jpg","page_title":"Rob Blake","context_page_description":"Robert Bowlby »Rob« Blake, kanadski hokejist, * 10. december 1969, Mimico, Ontario, Kanada.\\nBlake velja za enega najboljših hokejskih napadalcev na svetu, je tudi eden redkih s trojno krono, naslovom olimpijskega prvaka, svetovnega prvaka in zmagovalca Stanleyjevega pokala.\\nKariero je začel v regionalni ligi OJHL, nato igral v CCHA, sezone 1989 pa v ligi NHL, za klube Los Angeles Kings, Colorado Avalanche, kjer je osvojil Stanleyjev pokal leta 2001, in San Jose Sharks, kjer se je po sezoni 2009/10 upokojil. Za kanadsko reprezentanco je nastopil na treh olimpijskih igrah, kjer je bil dobitnik zlate medalje, in petih svetovnih hokejskih prvenstvih, kjer je osvojil dve zlati in eno srebrno medaljo.\\nLeta 2014 je bil sprejet v Hokejski hram slavnih lige NHL, leta 2018 pa v Mednarodni hokejski hram slavnih. 17. januarja 2015 so v klubu Los Angeles Kings upokojili njegov dres s št. 4."},{"page_url":"https://es.wikipedia.org/wiki/Condado_de_G%C3%A9vaudan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Aragon_arms.svg","page_title":"Condado de Gévaudan","context_page_description":"El condado de Gévaudan aunque la capital de la región del Gévaudan fuese Mende, que feudalmente pertenecía a los obispos)."},{"page_url":"https://ast.wikipedia.org/wiki/Spermophilopsis_leptodactylus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Meyers_b11_s0979a.jpg","page_title":"Spermophilopsis leptodactylus","context_page_description":"Spermophilopsis leptodactylus ye una especie de royedor de la familia Sciuridae."},{"page_url":"https://eu.wikipedia.org/wiki/Lake_Lure_(Ipar_Carolina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Lake_Lure_from_Chimney_Rock.JPG","page_title":"Lake Lure (Ipar Carolina)","context_page_description":"Lake Lure Ipar Carolinako herri bat da. Rutherford konderrian kokatua dago. 2010ean 1.192 biztanle zituen, 34,65 kilometro koadrotan banatuta."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%93%E3%82%A2%E3%83%AB%E3%83%A2%E3%82%B9%E3%82%AF%E3%82%B9%E4%BA%9C%E7%9B%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/PhthinosuchusDB1.jpg","page_title":"ビアルモスクス亜目","context_page_description":"ビアルモスクス亜目 あるいは、エオティタノスクス亜目 / フチノスクス亜目 は、古生代ペルム紀中期から後期に生息した単弓類。テトラケラトプスに次いで出現した獣弓目の初期分類群である。"},{"page_url":"https://ja.wikipedia.org/wiki/T2101V","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/T2101V_Cradle_Ura.jpg","page_title":"T2101V","context_page_description":"FOMA T2101Vは、東芝によって開発された、NTTドコモの第三世代携帯電話 端末製品である。"},{"page_url":"https://tt.wikipedia.org/wiki/%D0%9B%D0%B5-%D0%A1%D0%B0%D0%BB%D1%8C-%D1%81%D1%8E%D1%80-%D0%92%D0%B5%D1%80%D0%B4%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Map_commune_FR_insee_code_83122.png","page_title":"Ле-Саль-сюр-Вердон","context_page_description":"Ла-Моль — Франциянең Вар департаментына караган коммуна."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%81%D1%83%D0%B3%D0%B0_%D0%B3%D0%BE%D1%80%D0%BD%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Tsuga_mertensiana2.jpg","page_title":"Тсуга горная","context_page_description":"Тсуга го́рная, или Мертенса — дерево рода тсуга семейства Сосновые.\\nЭндемик горных районов западного побережья Северной Америки. Видовое название дано в честь немецкого ботаника Карла Генриха Мертенса."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Thomas_Eakins","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Eakins_G109_Washington.jpg","page_title":"List of works by Thomas Eakins","context_page_description":"This is a list of professionally authenticated paintings, drawings, and sculptures by Thomas Eakins. As there is no catalogue raisonné of Eakins' works, this is an aggregation of existing published catalogs."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Clay_County_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Pearl_and_Bess_Meyer_House_in_Flora.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Clay County (Illinois)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Clay County in Illinois führt alle Bauwerke und historischen Stätten im Clay County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_Alphonse-Daudet","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Rue_Alphonse-Daudet%2C_Paris_%28France%29.jpg","page_title":"Rue Alphonse-Daudet","context_page_description":"La rue Alphonse-Daudet est une voie du 14ᵉ arrondissement de Paris, en France."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B8%AF%E9%90%B5%E5%85%AC%E5%8F%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/MTR_CRH380A-0251_G5622%28Hong_Kong_West_Kowloon_to_Shenzhenbei%29_03-06-2019.jpg","page_title":"港鐵公司","context_page_description":"香港鐵路有限公司於1975年9月26日創立，當時名為地下鐵路公司，於2000年宣布私有化，同年4月26日註冊成為有限公司，更名為地鐵有限公司。2007年兩鐵合併，同年12月2日起透過服務經營權營運九廣鐵路公司網絡及業務而改為現時名稱。\\n香港鐵路有限公司總部位於香港九龍灣偉業街33號德福廣場港鐵總部大樓及國際金融中心二期若干樓層，主要業務是在香港經營壟斷型的綜合鐵路網絡——港鐵，當中包括由其建造及擁有的系統及服務經營權下的九廣鐵路公司系統。"},{"page_url":"https://id.wikipedia.org/wiki/Bandar_Udara_Kagoshima","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Kagoshima_Airport01n4592.jpg","page_title":"Bandar Udara Kagoshima","context_page_description":"Bandar Udara Kagoshima adalah sebuah bandar udara kelas dua yang berlokasi di Kirishima, Perfektur Kagoshima, Japan, 296 km timur laut stasiun Kagoshima-Chūō di kota Kagoshima City. Landasan pacu dibuka pada tahun 1944, meskipun penerbangan reguler dari bandara tidak dimulai hingga tahun 1962. 2000 merupakan tahun pertama di mana lebih dari 2.5 juta penumpang datang dan berangkat dari bandara tersebut."},{"page_url":"https://pl.wikipedia.org/wiki/Trmice","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Trmice.JPG","page_title":"Trmice","context_page_description":"Trmice − miasto w Czechach, w kraju ujskim.\\nWedług danych z 31 grudnia 2003 powierzchnia miasta wynosiła 666 ha, a liczba jego mieszkańców 2 862 osób."},{"page_url":"https://en.wikipedia.org/wiki/Amelia_Earhart","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Amelia_Earhart%2C_circa_1928.jpg","page_title":"Amelia Earhart","context_page_description":"Amelia Mary Earhart was an American aviation pioneer and author. Earhart was the first female aviator to fly solo across the Atlantic Ocean. She set many other records, wrote best-selling books about her flying experiences, and was instrumental in the formation of The Ninety-Nines, an organization for female pilots.\\nBorn in Atchison, Kansas, Earhart developed a passion for adventure at a young age, steadily gaining flying experience from her twenties. In 1928, Earhart became the first female passenger to cross the Atlantic by airplane, for which she achieved celebrity status. In 1932, piloting a Lockheed Vega 5B, Earhart made a nonstop solo transatlantic flight, becoming the first woman to achieve such a feat. She received the United States Distinguished Flying Cross for this accomplishment. In 1935, Earhart became a visiting faculty member at Purdue University as an advisor to aeronautical engineering and a career counselor to women students. She was also a member of the National Woman's Party and an early supporter of the Equal Rights Amendment."},{"page_url":"https://es.wikipedia.org/wiki/Alcalino","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Uyuni_landsat.JPG","page_title":"Alcalino","context_page_description":"Los metales alcalinos o simplemente alcalinos son los seis elementos químicos litio, sodio, potasio, rubidio, cesio y francio. Estos elementos, junto con el hidrógeno, constituyen el grupo 1 que se encuentra en el bloque-s de la tabla periódica.\\nTodos los metales alcalinos tienen su electrón más extremo en un orbital-s, esta configuración electrónica compartida da como resultado que tengan propiedades características muy similares. De hecho, los metales alcalinos proporcionan el mejor ejemplo de patrones de grupos parecidos en sus propiedades de la tabla periódica, con elementos que exhiben un comportamiento característico homólogo. Esta familia de elementos es también conocida con la familia del litio al ser este su primer elemento.\\nLos metales alcalinos son metales brillantes, blandos, altamente reactivos a temperatura y presión estándar y pierden fácilmente su electrón más externo para formar cationes con carga +1. Todos se pueden cortar fácilmente con un cuchillo debido a su suavidad, exponiendo una superficie brillante que se empaña rápidamente en el aire debido a la oxidación por la humedad atmosférica y el oxígeno."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Bundesarchiv_Bild_102-09411%2C_Primo_de_Rivera_und_der_K%C3%B6nig_von_Spanien.jpg","page_title":"Historia de España","context_page_description":"La historia de España engloba el período comprendido desde la primera colonización humana en la prehistoria en la península ibérica hasta la actualidad. Si bien la formación del estado español dataría de finales de la Edad Media con la unión y la invasión de los reinos que la acabarían formando: Castilla, León, Aragón, Navarra y el Reino de Granada, y es a partir de ese momento que empieza a conocerse como un estado único hasta la actualidad."},{"page_url":"https://no.wikipedia.org/wiki/Karl_Ferdinand,_hertug_av_Berry","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Undated_signature_of_Charles_Ferdinand_d%27Artois%2C_Duke_of_Berry.JPG","page_title":"Karl Ferdinand, hertug av Berry","context_page_description":"Karl Ferdinand, hertug av Berry var fransk prins, yngre sønn av den fremtidige kong Karl X av Frankrike og Marie-Thérèse-Charlotte av Frankrike.\\nHan ble i 1812 gift med en engelsk kvinne ved navn Amy Brown, men ekteskapet ble oppløst i 1815.\\nI 1816 ble han gift med Maria Carolina av De begge Sicilier. De fikk fire barn, hvorav to døde tidlig og to levde til voksen alder. De som levde til voksen alder var Louise Marie Thérèse og Henri, hertug av Bordeaux."},{"page_url":"https://vi.wikipedia.org/wiki/Gaetano_Donizetti","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Virginia_Vasselli%2C_wife_of_Gaetano_Donizetti%2C_c._1820.jpg","page_title":"Gaetano Donizetti","context_page_description":"Domenico Gaetano Maria Donizetti là nhà soạn nhạc người Ý đến từ Bergamo, Lombardia. Công trình tiêu biểu của ông là các vở opera L'elisir d'amore, Lucia di Lammermoor, và Don Pasquale, tất cả điều bằng tiếng Ý, và các vở opera bằng tiếng Pháp như La favorite và La fille du régiment. Cùng với Vincenzo Bellini và Gioachino Rossini, ông là nhà cách tân opera hài Ý xuất sắc, giúp thể loại này vượt qua nguy cơ bị quên lãng."},{"page_url":"https://sv.wikipedia.org/wiki/Vendlincourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Karte_Gemeinde_Vendlincourt_2018.png","page_title":"Vendlincourt","context_page_description":"Vendlincourt är en ort och kommun i distriktet Porrentruy i kantonen Jura, Schweiz. Kommunen har 557 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Vern","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Vern_Vergt.JPG","page_title":"Vern","context_page_description":"Der Vern ist ein Fluss in Frankreich, der im Département Dordogne in der Region Nouvelle-Aquitaine verläuft. Er entspringt im Gemeindegebiet von Veyrines-de-Vergt, entwässert generell in nordwestlicher Richtung und mündet nach 40 Kilometern im Gemeindegebiet von Neuvic als linker Nebenfluss in die Isle. Westlich von Vergt, beim Ort Pont Romieux, verschwindet der Vern im karstigen Untergrund und tritt in mehreren Karstquellen, die sich über eine Entfernung von bis zu 14 Kilometern verteilen, wieder ans Tageslicht."},{"page_url":"https://no.wikipedia.org/wiki/Krokstien_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Krokstien_I.jpg","page_title":"Krokstien (Oslo)","context_page_description":"Krokstien er en vei på Hellerud i bydel Alna i Oslo. Den går som blindvei østover fra Rundtjernveien.\\nNavnet ble vedtatt i 1933 og henspiller på veiens form."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E9%A6%AC%E9%9E%8D%E5%B1%B1%E6%B8%B8%E6%B3%B3%E6%B1%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Ma_On_Shan_Swimming_Pool_Restaurant_2012.jpg","page_title":"馬鞍山游泳池","context_page_description":"马鞍山游泳池位于香港沙田区马鞍山鞍骏街33号，是沙田区三个公众游泳池之一，由香港康乐及文化事务署管理。马鞍山游泳池每月平均约有39,500入场人次，是全港第四个最多人使用的非暖水池。\\n游泳池位于马鞍山市中心马鞍山公园旁边，占地2.45公顷，是沙田区继显田游泳池后第二个有嬉水设施的游泳池，设有蘑菇和树木形的喷水池、鳄鱼和鲸鱼形的喷泉等，平台上设有四条9米高滑水梯，是游泳池的最高点，可俯览整个游泳池和欣赏吐露港的海景，还有一个船身设计的观众看台，共有1,200个座位。入口处的前面有一个大广场。"},{"page_url":"https://pl.wikipedia.org/wiki/Lista_gatunk%C3%B3w_z_rodzaju_krzy%C5%BCownica","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Na_hor%C3%A1ch_%2815%29.jpg","page_title":"Lista gatunków z rodzaju krzyżownica","context_page_description":"Lista gatunków z rodzaju krzyżownica – lista gatunków z rodzaju roślin z rodziny krzyżownicowatych. Należy do niego co najmniej 623 gatunki, poza tym 707 taksonów ma status gatunków niepewnych."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Blankenese","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/1472_Baurs_Park_21.JPG","page_title":"Liste der Kulturdenkmäler in Hamburg-Blankenese","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Blankenese enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet des Stadtteils Blankenese der Freien und Hansestadt Hamburg.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Transparenzportal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013 unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung. Alle Denkmäler in Blankenese, die schon nach dem Denkmalschutzgesetz vom 3. Dezember 1973, zuletzt geändert am 27. November 2007, unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Altona zu finden."},{"page_url":"https://en.wikipedia.org/wiki/Frederick_J._Bacon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bacon_advertisement%2C_Cadenza%2C_February_1907.jpg","page_title":"Frederick J. Bacon","context_page_description":"Frederick J. Bacon was a late 19th to mid 20th century performer and recording artist on the five string banjo. He was also an inventor and entrepreneur, educator, composer, and designer and manufacturer of banjos.\\nAt the height of his performance career he played the banjo nationally. Along with Fred Van Eps and Vess Ossman he was part of a group of banjoists labeled \\"virtuoso\\" in the newspapers. He founded the F.J Bacon Co., possibly as early as 1902, after having invented a new resonator for open-back banjos. It wasn’t until 1908 that Bacon came up with Bacon Mfg. & Publishing Co. to sell his banjos and music compositions. During the Big Five tour Bacon became Bacon Mfg. Co in 1911 from Forestdale and incorporated Bacon Mfg. Co. in 1912. In 1918 from New London he called himself Bacon Banjo Mfg. Co. around 1918, and formally the Bacon Banjo Co. Inc in 1920 with E.O Winship and wives. In 1922 his company gained business experience in David L. Day, formerly of Vega. Together they produced Bacon and Day banjos, some of which have been considered worthy of display in museums, as showpieces of artistic impulse from the Jazz Age."},{"page_url":"https://ro.wikipedia.org/wiki/Vespoidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/2919baldf.w.jpg","page_title":"Vespoidea","context_page_description":"Vespoidea este o suprafamilie taxonomică de insecte care face parte din ordinul Hymenoptera. Împreună cu suprafamiliile Apoidea și Chrysidoidea fac parte din infraordinul Aculeata. Suprafamilia Vespoidea cuprinde 10 familii cu ca. 24.000 de specii în care se află familiile Vespidae și Formicidae."},{"page_url":"https://en.wikipedia.org/wiki/Arnold_Lyongr%C3%BCn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Lyongr%C3%BCn%2C_Fr%C3%BChling_an_der_Luhe.jpg","page_title":"Arnold Lyongrün","context_page_description":"Ernst Arnold Lyongrün was a German practitioner of the Jugendstil or Art Nouveau style of decorative arts and a painter in the Impressionistic mode."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pam%C3%A1tn%C3%BDch_strom%C5%AF_v_okrese_Zl%C3%ADn","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/File-Memorable_horse-chestnut_in_Fry%C5%A1t%C3%A1k_%283%29.jpg","page_title":"Seznam památných stromů v okrese Zlín","context_page_description":"Toto je seznam památných stromů v okrese Zlín, v němž jsou uvedeny památné stromy na území okresu Zlín."},{"page_url":"https://es.wikipedia.org/wiki/Invasi%C3%B3n_de_bah%C3%ADa_de_Cochinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/LittleHavanOct06BayOfPigsMonument.jpg","page_title":"Invasión de bahía de Cochinos","context_page_description":"La invasión de bahía de Cochinos, también conocida como invasión de playa Girón o la batalla de Girón, ​ fue una operación militar en la que tropas de cubanos exiliados, apoyados por el gobierno de Estados Unidos, invadieron Cuba en abril de 1961, para intentar crear una cabeza de playa, formar un gobierno provisional que reemplace al de Fidel Castro y buscar el apoyo de la Organización de los Estados Americanos y el reconocimiento de la comunidad internacional. La acción acabó en fracaso en menos de 65 horas. Fue completamente aplastada por las milicias y las Fuerzas Armadas Revolucionarias de Cuba. Más de un centenar de soldados invasores murieron, y el ejército cubano capturó a 1200, junto con importante material bélico."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89parchie_de_%C5%A0abac","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Crkva_Sv._Georgija%2C_Ma%C4%8Dvanski_Pri%C4%8Dinovi%C4%87010.jpg","page_title":"Éparchie de Šabac","context_page_description":"L'éparchie de Šabac est une circonscription de l'Église orthodoxe serbe. Elle a son siège à Šabac et, en 2016, elle a à sa tête l'évêque Lavrentije."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A0%D7%95%D7%98%D7%99%D7%A8%D7%A0%D7%95%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tyrannosaurusscale.png","page_title":"ננוטירנוס","context_page_description":"ננוטירנוס הוא סוג של דינוזאור ממשפחת הטירנוזאוריים שחי בסופו של הקרטיקון לפני 68.5–66 מיליון שנה באמריקה הצפונית. סוג דינוזאור זה התגלה ב-1988 וקיבל שם בידי החוקרים רוברט בקר, פיליפ קורי ומייקל ויליאם. עם זאת כיום מספר חוקרים רואים בו סוג בספק שמאובניו שייכים לצעירים של טירנוזאורוס רקס. הוא היה קטן יחסית לטירנוזאורוס והגיע לאורך 5.2 מטר, גובה של 2 מטר ומשקל 600–900 ק\\"ג.\\nהמאובנים של דינוזאור זה נמצאו ב-1946, אך זוהו כמאובני גורגוזאורוס. בהמשך התגלו הבדלים במבנה שגרמו להפריד אותו. התגלו מאובנים של גולגולת חלקית ושל כמה עצמות. אם היה סוג נפרד, היצור היה דומה מאוד לטירנוזאורוס, אך קטן יותר וכמותו בעל זוג אצבעות קטנות ברגליו הקדמיות. הוא הכיל לסת מלאת שיניים והשתמש בשרירי הצוואר כדי לנשוך בחוזקה את טרפו.\\nהיצור נכחד ככל הנראה בעת הכחדת הקרטיקון הגדולה לצד קרובו הגדול."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%91%D2%AF%D0%B6%D0%B8%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Grandjete.jpg","page_title":"Бүжиг","context_page_description":"Бүжиг нь санаа сэтгэл, авъяас чадвараа илтгэхээр хөгжмийн айзмын хэмнэлээр биеэ хөдөлгөх урлаг юм. Үүнээс гадна хүмүүсийн үггүй харилцааны нэг хэлбэр төдийгүй амьтад ч бас бүжиглэдэг.\\nГимнастик, уран гулгалт, усны гимнастик зэрэг бүжиглэдэг спортын төрлүүд бий.\\nАрдын болоод орчин үеийн, сонгодог гэх мэтээр ангилагддаг."},{"page_url":"https://fr.wikipedia.org/wiki/Slate_(police_d%27%C3%A9criture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Flugmodus_BB10-2.png","page_title":"Slate (police d'écriture)","context_page_description":"Slate est une police d’écriture linéale créée en 2006 par Rod McDonald pour Monotype. Elle est dessinée pour une grande lisibilité à l’écran et sur papier, basée sur des travaux de recherche de McDonald et de l’Institut national canadien pour les aveugles. La police Slate Pro est utilisée pour l’interface du système d’exploitation BlackBerry 10."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%88%D8%B4%DB%8C%D8%AA%D8%B3%D9%87_(%D9%86%D8%A7%D8%AD%DB%8C%D9%87_%D9%BE%D8%B1%D8%B1%D9%88%D9%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Su%C5%A1ice_%28PR%29.jpg","page_title":"سوشیتسه (ناحیه پرروف)","context_page_description":"سوشیتسه یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه پرروف واقع شده‌است. سوشیتسه ۴٫۸۴ کیلومتر مربع مساحت و ۳۳۵ نفر جمعیت دارد و ۲۳۳ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B2%E0%B4%BF%E0%B4%B2%E0%B5%8D%E0%B4%B2%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Lilium_fargesii.jpg","page_title":"ലില്ലി","context_page_description":"മനോഹരമായ പൂക്കളുള്ള ഒരു ചെടിയാണ് ലില്ലി. ലില്ലി കുടുംബത്തിലെ അനേകം ഇനം പൂക്കളുണ്ട്.Lilium എന്ന പേരിലാണ് ഈ സസ്യവർഗ്ഗം അറിയപ്പെടുന്നത്."},{"page_url":"https://no.wikipedia.org/wiki/Greske_mynter","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Didrachm_Knossos_425-360BC_obverse_CdM_Paris.jpg","page_title":"Greske mynter","context_page_description":"Greske mynter henspiller på antikkens greske preging av mynt og kan bli delt i tre perioder: arkaisk tid, klassisk tid og hellenistisk tid. Den arkaiske tidsepoken strekker seg fra myntpreging ble innført i den greske verden en gang rundt år 600 f.Kr. og fram til perserkrigene omtrent rundt år 480 f.Kr. Den klassiske perioden begynner deretter og varer fram til erobringene til Aleksander den store omtrent år 330 f.Kr. hvor den hellenistiske perioden begynner og varer fram til Romerriket oppsluker den greske verden på 100-tallet f.Kr. De greske byene fortsatte å produsere sine egne mynter i ytterligere noen århundrer under romersk styre, da kalt for romerske provinsmynter."},{"page_url":"https://it.wikipedia.org/wiki/Filippo_Magnini","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Filippo_Magnini.jpg","page_title":"Filippo Magnini","context_page_description":"Filippo Magnini è un ex nuotatore italiano.\\nConsiderato il miglior stileliberista italiano di sempre, con Giorgio Lamberti, nelle distanze brevi, è stato due volte campione mondiale nei 100 m nel 2005 e nel 2007. Ha vinto anche due titoli mondiali in vasca corta e complessivamente diciassette ori europei."},{"page_url":"https://fi.wikipedia.org/wiki/Aalto-yliopiston_oppimiskeskus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Toolo_campus_library.jpg","page_title":"Aalto-yliopiston oppimiskeskus","context_page_description":"Aalto-yliopiston oppimiskeskus on Aalto-yliopiston kaikille avoin tieteellinen kirjasto.\\nAalto-yliopiston kirjasto aloitti toimintansa vuoden 2010 alusta, jolloin Helsingin Kauppakorkeakoulun kirjasto, Taideteollisen korkeakoulun kirjasto ja Teknillisen korkeakoulun kirjasto yhdistyivät. Aalto-yliopiston kirjasto muuttui Aalto-yliopiston oppimiskeskukseksi vuonna 2015."},{"page_url":"https://es.wikipedia.org/wiki/Plaza_de_la_Bastilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Genio_de_la_Libertad.jpg","page_title":"Plaza de la Bastilla","context_page_description":"La plaza de Bastilla es una plaza de París, lugar simbólico de la Revolución francesa, situada en el emplazamiento de la antigua fortaleza de la Bastilla, que fue tomada el 14 de julio de 1789."},{"page_url":"https://en.wikipedia.org/wiki/Punjab_Culture_Day","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Virasti_Mela%2C_Bathinda_%28Punjabi_Heritage_Festival%29_%2840%29.jpg","page_title":"Punjab Culture Day","context_page_description":"Punjab Culture Day, also known as Punjabi Culture Day or Sikh New Year, is a day is celebrated on 14th of March all over Punjab for the celebration and demonstration of Punjabi culture by Punjabis and Punjabi diaspora."},{"page_url":"https://fr.wikipedia.org/wiki/Comt%C3%A9_de_Sussex_(New_Jersey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/East_from_Kittatinny_Mountain_DWGNRA_Walpack_Twsp_NJ.jpg","page_title":"Comté de Sussex (New Jersey)","context_page_description":"Le comté de Sussex est un comté situé au nord-ouest de l'État de New Jersey, aux États-Unis. Il fait partie de l'agglomération new-yorkaise. Son siège est à Newton."},{"page_url":"https://id.wikipedia.org/wiki/Kathmandu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/KMC_logo.jpg","page_title":"Kathmandu","context_page_description":"Kathmandu adalah ibu kota sekaligus kota terbesar di Nepal. Kota berpenduduk 3,2 juta jiwa ini terletak di Lembah Kathmandu di Nepal bagian tengah, dekat Sungai Vishnumati. Wilayah Metropolitan Kathmandu, yang meliputi Patan, Lalitpur dan Bhaktapur, memiliki populasi besar sekitar 5-6 juta orang. Kathmandu juga merupakan kota metropolis terbesar di wilayah Pegunungan Himalaya. Bahasa Nepali dan Nepal Basha/Newari adalah bahasa yang paling banyak digunakan di kota.\\nKathmandu, juga dikenal sebagai Kota Kuil, berada di ketinggian sekitar 1.400 meter di atas permukaan laut di Lembah Kathmandu yang berbentuk seperti mangkuk di Nepal bagian tengah. Lembah ini secara historis disebut sebagai \\"Mandala Nepal\\" dan telah menjadi pusat kebudayaan suku Newar atau Nepami, sebuah peradaban kota kosmopolitan di kaki Pegunungan Himalaya. Kota ini dulunya adalah ibukota Kerajaan Nepal yang menjadi tuan rumah bagi istana, rumah-rumah mewah dan taman-taman kaum aristokrat Nepal. Sejak tahun 1985, kota ini telah menjadi markas besar Asosiasi Kerja Sama Regional Asia Selatan."},{"page_url":"https://en.wikipedia.org/wiki/Typeface_anatomy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Typographia.svg","page_title":"Typeface anatomy","context_page_description":"Typeface anatomy describes the graphic elements that make up letters in a typeface."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D9%81%D9%86%DB%8C_%D9%88_%D8%B9%D9%84%D9%88%D9%85_%D9%84%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Lilliad_Learning_Center_Innovation.jpg","page_title":"دانشگاه فنی و علوم لیل","context_page_description":"دانشگاه فنی و علوم لیل"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B5%D9%81_%D8%A7%D9%84%D9%86%D8%A7%D8%AA%D9%88_%D9%84%D9%85%D9%82%D8%B1_%D8%A7%D9%84%D8%A5%D8%B0%D8%A7%D8%B9%D8%A9_%D9%88%D8%A7%D9%84%D8%AA%D9%84%D9%81%D8%B2%D9%8A%D9%88%D9%86_%D8%A7%D9%84%D8%B5%D8%B1%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Master_RTS.jpg","page_title":"قصف الناتو لمقر الإذاعة والتلفزيون الصربي","context_page_description":"قامت حلف الناتو بالقصف الجوي بتاريخ 23 أبريل عام 1999م، على مبنى مقر الإذاعة والتلفزيون الصربي والتي تسبب بمقتل 16 شخصاً و16 آخرين."},{"page_url":"https://it.wikipedia.org/wiki/Sade_(gruppo_musicale)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Sade_Adu_Band.jpg","page_title":"Sade (gruppo musicale)","context_page_description":"I Sade sono un gruppo musicale jazz-pop britannico, che prende il nome dalla propria leader Sade Adu. La loro musica fonde elementi di R&B, soul music, jazz e soft rock.\\nL'album di debutto, Diamond Life, fu pubblicato nel 1984 e raggiunse la seconda posizione nella Official Albums Chart britannica, con oltre 1,2 milioni di copie vendute nel solo Regno Unito. L'album si aggiudicò anche il BRIT Award per il miglior album britannico del 1985. L'album fu un successo internazionale, raggiungendo la prima posizione in diversi Paesi e la top ten negli Stati Uniti, dove vendette oltre 4 milioni di copie. A fine 1985 i Sade pubblicarono il loro secondo album, Promise, che arrivò al numero 1 sia nel Regno Unito che negli Stati Uniti. L'album fu certificato nel Regno Unito con il doppio disco di platino dalla BPI e negli USA con il quadruplo disco di platino dalla RIAA. Nel 1986 la band vinse il Grammy Award al miglior artista esordiente. Nel 2002 Sade ha vinto un Grammy con l'album Lovers Rock nella categoria \\"Best Pop Vocal Album; for solo artists, duos or groups\\"."},{"page_url":"https://sco.wikipedia.org/wiki/Funchal","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Madeira_19_2014.jpg","page_title":"Funchal","context_page_description":"Funchal is the lairgest ceety, the municipal seat an the caipital o Portugal's Autonomous Region o Madeira. The ceety haes a population o 111,892 an haes been the caipital o Madeira for mair nor five centuries."},{"page_url":"https://gl.wikipedia.org/wiki/Engrenaxe","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Involuta.png","page_title":"Engrenaxe","context_page_description":"Denomínase engrenaxe ou roda dentada ao mecanismo utilizado para transmitir potencia dun compoñente a outro dentro dunha máquina. As engrenaxes están formadas por dúas rodas dentadas, das cales a maior se denomina coroa e a menor piñón. Unha engrenaxe serve para transmitir movemento circular mediante contacto de rodas dentadas. Unha das aplicacións máis importantes das engrenaxes é a transmisión do movemento desde o eixo dunha fonte de enerxía, como pode ser un motor de combustión interna ou un motor eléctrico, ata outro eixo situado a certa distancia e que ha de realizar un traballo. De maneira que unha das rodas está conectada pola fonte de enerxía e é coñecida como engrenaxe motora, e a outra está conectada ao eixo que debe recibir o movemento do eixo motor e que se denomina engrenaxe conducida.\\nSe o sistema está composto de máis dun par de rodas dentadas, denomínase tren de engrenaxes.\\nA principal vantaxe que teñen as transmisións por engrenaxe respecto da transmisión por poleas é que non patinan como as poleas, co que se obtén exactitude na relación de transmisión."},{"page_url":"https://de.wikipedia.org/wiki/Utenbach_(Apolda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Kirche_Utenbach.JPG","page_title":"Utenbach (Apolda)","context_page_description":"Utenbach ist ein Ortsteil der Stadt Apolda im Nordosten des Landkreises Weimarer Land."},{"page_url":"https://ru.wikipedia.org/wiki/Glandirana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Tsuchi-gaeru_20130702_Aichi%2C_Japan%281%29.JPG","page_title":"Glandirana","context_page_description":"Glandirana — род бесхвостых земноводных из семейства настоящих лягушек. В самостоятельный род выделен в 1990 году, ранее включался в род Rana в качестве подрода. Является сестринской группой по отношению к роду Hylarana."},{"page_url":"https://ro.wikipedia.org/wiki/Gergueil","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Gergueil_pre%C4%9Dejo.JPG","page_title":"Gergueil","context_page_description":"Gergueil este o comună în departamentul Côte-d'Or, Franța. În 2009 avea o populație de 145 de locuitori."},{"page_url":"https://fr.wikipedia.org/wiki/Savane_du_Rupununi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Guyana_veg_1973.jpg","page_title":"Savane du Rupununi","context_page_description":"La savane du Rupununi est une plaine herbeuse d'environ 15 000 km² qui s'étend au sud-ouest de l'État sud-américain du Guyana à la frontière avec le Brésil.\\nS'étendant dans le bassin de la rivière Rupununi cette savane est en continuité avec celles qui s'étendent au Venezuela et dans l'État brésilien du Roraima.\\nNormalement située dans le bassin versant du fleuve Essequibo qui se jette dans la mer des Caraïbes les eaux de la savane entrent en contact avec celles du bassin de l'Amazone très proches lors des pluies de la saison humide. Cette zone est isolée de la côte guyanaise par de vastes forêts tropicales, elle a donc connu un développement différent."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B5%D0%BB%D0%B5%D0%B0%D1%81_%D0%B8_%D0%9C%D0%B5%D0%BB%D0%B8%D0%B7%D0%B0%D0%BD%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Mary_Garden_in_Debussy%27s_Pell%C3%A9as_et_M%C3%A9lsande.jpg","page_title":"Пелеас и Мелизанда","context_page_description":"Пелеас и Мелизанда е опера от 5 действия с музика от Клод Дебюси и либрето от Морис Метерлинк."},{"page_url":"https://ro.wikipedia.org/wiki/Fran%C8%9Ba","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Carte_climatique_de_la_France.svg","page_title":"Franța","context_page_description":"Franța, oficial Republica Franceză, este o republică constituțională unitară având un regim semi-prezidențial, mare parte din teritoriul său și din populație fiind situată în Europa de Vest, dar care cuprinde și mai multe regiuni și teritorii răspândite în toată lumea. Capitala sa este orașul Paris, limba oficială este franceza iar moneda este euro. Deviza națională este „Libertate, egalitate, fraternitate”, iar drapelul Franței este format din trei benzi verticale colorate, respectiv în albastru, alb, roșu. Imnul național este La Marseillaise.\\nÎn timpul epocii fierului, zona ce reprezintă astăzi Franța a fost locuită de gali, un popor celtic. Roma a anexat zona în anul 51 î.Hr. și a deținut regiunea până în anul 486, când francii au cucerit regiunea și au format Regatul Franței. Franța a devenit o mare putere europeană în Evul Mediu, în urma victoriei din războiul de o sută de ani. În perioada renașterii, cultura franceză a înflorit, iar Franța a pus bazele unui imperiu colonial global, care urma ulterior să devină al doilea cel mai mare din lume. Secolul al XVI-lea a fost dominat de către războaie civile și religioase, între catolici și protestanți."},{"page_url":"https://lt.wikipedia.org/wiki/Bukynas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Buchenwald_1.jpg","page_title":"Bukynas","context_page_description":"Bukynas – medynas, kuriame vyrauja bukai.\\nBukas dažniau nei kitos plačialapės rūšys sudaro grynus miško medynus, taip pat yra mišrių miškų su spygliuočiais dalis. Paprastasis bukas Europoje auga ir lygumose, ir kalnuotose vietovėse; kalnuose tai paprastai aukščiausiai auganti medžių rūšis. Stačiuose kalnų šlaituose bukynai turi didelę reikšmę dirvožemio apsaugai ir vandens išsaugojimui. Miškininkystėje bukas vertinamas kaip mišką formuojanti, klimatą reguliuojanti rūšis. Paprastasis bukas Europoje savaime auga beveik visoje Europoje – nuo Ispanijos iki Kaliningrado srities, Lenkijos, Vakarų Ukrainos, taip pat Jungtinėje Karalystėje. Tarp bukynų pastatyta daugybė sanatorijų ir poilsio namų.\\nNors anksčiau bukynai Europoje užėmė didelę teritoriją, dėl žmogaus ūkinės veiklos daug jų buvo išnaikinta. Dabar iškirstų bukynų vietoje buvo pasodinti kitokie medžiai. Natūralūs bukynai yra saugomi daugelyje Europos šalių."},{"page_url":"https://en.wikipedia.org/wiki/List_of_populated_places_in_D%C3%BCzce_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/D%C3%BCzce_districts.png","page_title":"List of populated places in Düzce Province","context_page_description":"Below is the list of populated places in Düzce Province, Turkey by the districts. In the following lists, first place in each list is the administrative center of the district."},{"page_url":"https://nl.wikipedia.org/wiki/Tumuli_du_Soleil","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Wasseiges-Tumuli_du_Soleil_%282%29.JPG","page_title":"Tumuli du Soleil","context_page_description":"De Tumuli du Soleil of Tombes du Soleil zijn twee Gallo-Romeinse grafheuvels bij Ambresin in de Belgische provincie Luik in de gemeente Wasseiges. De heuvels liggen aan de straat Chaussée Romaine: de oude Romeinse weg Via Belgica tussen Tongeren en Bavay. Verder liggen ze nabij de Rue de Hannut, de N624, ten noorden van Ambresin."},{"page_url":"https://sv.wikipedia.org/wiki/Bandiagara_Cercle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Cercle_of_Bandiagara.png","page_title":"Bandiagara Cercle","context_page_description":"Bandiagara Cercle är en krets i Mali. Den ligger i regionen Mopti, i den centrala delen av landet, 500 km öster om huvudstaden Bamako. Antalet invånare är 317 965. Arean är 10 520 kvadratkilometer.\\nTerrängen i Bandiagara Cercle är kuperad österut, men västerut är den platt.\\nEtt varmt stäppklimat råder i trakten. Årsmedeltemperaturen i trakten är 28 °C. Den varmaste månaden är april, då medeltemperaturen är 33 °C, och den kallaste är januari, med 24 °C. Genomsnittlig årsnederbörd är 771 millimeter. Den regnigaste månaden är augusti, med i genomsnitt 293 mm nederbörd, och den torraste är januari, med 1 mm nederbörd."},{"page_url":"https://eo.wikipedia.org/wiki/Katedralo_de_Ciudad_Real","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Ciudad_Real_-_Catedral_de_Nuestra_Se%C3%B1ora_del_Prado_1.jpg","page_title":"Katedralo de Ciudad Real","context_page_description":"La Katedralo de Ciudad Real aŭ en hispana oficiale Santa Iglesia Prioral Basílica Catedral de las Órdenes Militares de Nuestra Señora Santa María del Prado de Ciudad Real, Hispanio, komencita en la 15a jarcento, estas de gotika stilo, kvankam ĝi havas elementojn antaŭajn de malfruromanika stilo apartenantaj al la antaŭaĵo de la katedralo: nome la paroĥa preĝejo de la epoko de Alfonso la 10-a la Saĝulo. Sur tiu oni konstruis la katedralon, kiu estis finita meze de la 16a jarcento post la konstruado de la kovriloj de la volboj. Tamen estas ankaŭ elementoj postaj, de stiloj de la renesanco kaj baroko. Laste estis konstruita la aktuala turo, ĝis komenco de la 19a jarcento.\\nLaŭ la tradicio legenda, en 1088 aperis la Virgulino tie antaŭ lokanoj de la domaro de Pozo de Don Gil. En 1531 oni starigis la preĝejon de Sankta Maria, kaj oni lasis el la primitiva romanika ermitejo nur la sudan pordegon nome de la Pardono. La impresa turo kvaretaĝa estis ekkonstruita en la 17a jarcento kaj finita en la 19a jarcento pro lastaj reformoj post la tertremo de Lisbono de la 18a jarcento."},{"page_url":"https://es.wikipedia.org/wiki/Micrelaps","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/%D7%9E%D7%97%D7%A8%D7%95%D7%96%D7%9F_%D7%94%D7%98%D7%91%D7%A2%D7%95%D7%AA_%28%D7%93%D7%95-%D7%92%D7%95%D7%A0%D7%99%29.jpg","page_title":"Micrelaps","context_page_description":"Micrelaps es un género de serpientes venenosas de la familia Lamprophiidae. Sus especies se distribuyen por África y Oriente Próximo."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%B3%D9%85%D8%B1%D8%A7%D9%88%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Mohamed_Samraoui.jpg","page_title":"محمد سمراوي","context_page_description":"العقيد محمد سمراوي المدعو لحبيب: ولد سنة 1953 بمدينة عنابة. ضابط سامي في المخابرات الجزائرية سابقا. وعضو مؤسس لحركة رشاد الجزائرية المعارضة للنظام حاليا.\\nتخرج من قسم العلوم البيولوجية من جامعة قسنطينة عام 1976 حيث التحق بجامعة في فرنسا وحصل منها على الماجستير في العلوم الكيميائية عام 1977، عمل بعدها أستاذاً في جامعة قسنطينة حتى التحق بجهاز المخابرات عام 1978، تدرج بعدها في مناصب ومسؤولياتٍ مختلفة حتى العام 1987 حيث حصل على دورةٍ في الاستخبارات لمدة عامٍ من روسيا، عاد بعدها مسؤولاً أمنياً عن ولاية قالمة ثم انتقل إلى القيادة العامة للمخابرات عام 1989 وفي العام 1990 أصبح رئيساً لقسم مباحث أمن الدولة في جهاز المخابرات ومسؤولاً لإدارة الطوارئ، ولعب دوراً بارزاً في انقلاب 12 يناير عام 1992 حيث كان نائباً للمسؤول الأمني عن الانقلاب، عين في نهاية أغسطس عام 1992 مسؤولاً عن مكتب المخابرات الجزائرية في ألمانيا بدرجة مستشار أول حتى 22 أبريل عام 1996 حيث قرر اللجوء السياسي لإحدى الدول الأوروبية.\\nوفي سنة 2007 اسس حركة رشاد رفقة عدد من المعارضين للنظام الجزائري.\\nفي سنة 2003 الف كتاب اسمه: يروي فيه شهادته على ماحصل في الجزائر عندما كان مسؤلا امنيا فيها."},{"page_url":"https://it.wikipedia.org/wiki/Coco_bread","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Coco_bread_on_yellow_plate.jpg","page_title":"Coco bread","context_page_description":"Il Coco bread è un pane tipico giamaicano, ma diffuso anche in altre zone dei caraibi. Il pane contiene latte di cocco, ed ha un sapore leggermente dolce. In luogo del latte di cocco, si possono utilizzare anche latte vaccino ed acqua.\\nViene utilizzato spesso per essere farcito con jamaican patty."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Rolandseck","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Rolandsbogen_1900.jpg","page_title":"Burg Rolandseck","context_page_description":"Die Burg Rolandseck im Remagener Stadtteil Rolandswerth war eine Höhenburg am Rhein, deren erhaltene Ruine Rolandsbogen genannt wird. Im Jahr 1040 wurde sie erstmals als Rulcheseck erwähnt. Die Burg wurde 1122 durch Erzbischof Friedrich I. von Köln zusammen mit dem Frauenkloster Nonnenwerth erbaut. Möglicherweise bestand ein Vorgängerbau seit 1040.\\nDie Ruine der Burg Rolandseck liegt unterhalb des Rodderberges auf einem 155,2 m ü. NHN hohen Basaltfelsen oberhalb des Mittelrheintales, genau an dessen letzter linksrheinischer Engstelle vor der schrittweisen Ausweitung in die Niederrheinische Bucht, und diente zusammen mit den fast direkt gegenüberliegenden Burgen Drachenfels und Wolkenburg der Sicherung der Südgrenze des geschlossenen Territoriums des Erzstifts Köln im 12. Jahrhundert. Im 14. Jahrhundert wandelte sich der alte Namen in den heutigen.\\n1475 im Burgundischen Krieg zerstört, wurde sie wieder errichtet und im Dreißigjährigen Krieg um 1632 von den Schweden schwer beschädigt und verfiel zur Ruine. Diese stürzte am 19. Februar 1673 bei einem Erdbeben bis auf ein letztes Burgfenster, den sog. Rolandsbogen, ein."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BE%E0%AE%A9%E0%AF%8D%E0%AE%9A%E0%AF%81%E0%AE%9F%E0%AE%A9%E0%AF%8D%E0%AE%9F%E0%AE%BF%E0%AE%A9%E0%AF%8B%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%BF%E0%AE%B3%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%B5%E0%AF%80%E0%AE%B4%E0%AF%8D%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Constantinople_1453.jpg","page_title":"கான்சுடன்டினோப்பிளின் வீழ்ச்சி","context_page_description":"கான்சுடன்டினோப்பிளின் வீழ்ச்சி என்பது கிழக்கு உரோமைப் பேரரசின் தலைநகரான கான்சுடன்டினோப்பிள் ஒட்டோமான் பேரரசால் கைப்பற்றப்பட்ட நிகழ்வாகும். 21 வயது நிரம்பிய ஒட்டோமான் சுல்தான் இரண்டாம் மெகமுத் இந்நகரை முற்றுகையிட்டு கைப்பற்ற ஆணையிட்டான். இந்நகரைக் கிழக்கு உரோமைப் பேரரசு என்றழைக்கப்பட்ட பைசாந்தியத்தின் அரசன் பதினொன்றாம் கான்சுடன்டைன் காத்து நின்றான். இம்முற்றுகை ஏப்பிரல் 6, 1453 முதல் மே 29, 1453 வரை நடந்தது.\\nகான்சுடன்டினோப்பிளின் வீழ்ச்சி 1500 ஆண்டுகள் நீடித்த உரோமைப் பேரரசுக்கு முடிவு கட்டியது. இந்நகர வீழ்ச்சி ஒட்டோமான் பேரரசு ஐரோப்பா நோக்கி முன்னேறுவதற்குக் குறுக்கே நின்ற சிறு தடையை நீக்கிவிட்டது. கான்சுடன்டினோப்பிளைக் கைப்பற்றியதும் ஒட்டோமான் சுல்தான் இரண்டாம் மெகமுத் ஒட்டோமான் பேரரசின் தலைநகராக இருந்த ஏடிரியானோபிளை கான்சுடன்டினோப்பிளுக்கு மாற்றினார். கான்சுடன்டினோப்பிளின் வீழ்ச்சிக்கு முன்னும் பின்னும் பல கிரேக்க, கிரேக்கரல்லாத அறிஞர்கள் நகரை விட்டு வெளியேறினார்கள். இவர்களில் பெரும்பாலோர் இத்தாலிக்குச் சென்றனர்.\\nகான்சுடன்டிநோப்பிளின் வீழ்ச்சியும் அதைத்தொடர்ந்து நிகழ்ந்த கிழக்கு உரோமைப் பேரரசின் வீழ்ச்சியும் ஐரோப்பிய இடைக்காலத்தின் முடிவு என சில வரலாற்று அறிஞர்கள் கருதுகிறார்கள்."},{"page_url":"https://de.wikipedia.org/wiki/E._Clay_Shaw","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/E_Clay_Shaw.png","page_title":"E. Clay Shaw","context_page_description":"Eugene Clay Shaw war ein US-amerikanischer Jurist und Politiker, der den Bundesstaat Florida im US-Repräsentantenhaus vertrat.\\nClay Shaw besuchte zunächst die Edison Senior High School in seiner Heimatstadt Miami; danach studierte er an der Stetson University in DeLand und der University of Alabama in Tuscaloosa. Im Anschluss ging er erneut auf die Stetson University, erhielt dort 1966 seinen Juris Doctor am College of Law und wurde als Rechtsanwalt tätig. 1968 wurde er zunächst stellvertretender Prozessanwalt der Stadt Fort Lauderdale; danach war er dort oberster städtischer Staatsanwalt bis 1969 sowie beigeordneter Richter am Stadtgericht bis 1971. Nachdem er von 1973 bis 1975 als Vizebürgermeister von Fort Lauderdale fungiert hatte, übte er von 1975 bis 1980 als Nachfolger von Virginia S. Young das Amt des Bürgermeisters der Stadt aus.\\nShaw wurde 1980 als Republikaner in den Kongress gewählt und vertrat dort im Repräsentantenhaus vom 3. Januar 1981 bis zum 3. Januar 2007 zunächst den 12., dann den 15. und schließlich den 22. Wahlbezirk von Florida. Bei den Wahlen des Jahres 2006 unterlag er seinem demokratischen Herausforderer Ron Klein."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%8A%D8%AC%D9%88%D8%B1_%D9%85%D9%8A%D9%84%D9%88%D8%B3%D9%8A%D9%81%D9%8A%D8%AA%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Igor_Milosevic.png","page_title":"ايجور ميلوسيفيتش","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nايجور ميلوسيفيتش لاعب كرة سله من اليونان و صيربيا."},{"page_url":"https://sl.wikipedia.org/wiki/Makole","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Makole_Forma_Viva_2.jpg","page_title":"Makole","context_page_description":"Makole, nemško nekdaj Maxau, so naselje na zahodnem obrobju Haloz in sedež istoimenske občine."},{"page_url":"https://fr.wikipedia.org/wiki/Roystonea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Roystonea_regia.jpg","page_title":"Roystonea","context_page_description":"Roystonea est un genre de palmiers de la famille des Arécacées. Il comprend des palmiers d'assez grande taille, qui vivent principalement en Amérique centrale et en Amérique du Sud."},{"page_url":"https://eo.wikipedia.org/wiki/M._C._Escher","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Denhaag_relief_houtrustweg2.jpg","page_title":"M. C. Escher","context_page_description":"Maurits Cornelis ESCHER naskiĝis je la 17-a de junio 1898 en Leeuwarden kaj mortis je la 27-a de marto 1972 en Hilversum. Li estis nederlanda artisto, kiu tre konatiĝis per siaj ligno- kaj ŝton-gravuraĵoj.\\nEscher tre profunde studis la ecojn de la grafika reproduktado de realaĵoj, precipe la problemojn de perspektivo, inkluzive la diferencojn inter du- kaj tridimensiaj figuroj. Li produktis famajn \\"neeblajn\\" desegnaĵojn, kiuj ŝajnas montri realan objekton, kiu tamen en realo tute no povas ekzisti. Krome li studis la kovradon de ebenaĵo per identaj aŭ similaj figuroj. Li ankaŭ ŝatis surprizajn titolojn por siaj bildoj; ekzemplo estas lia bildo \\"mano kun spegula globo\\", kiu estas ĝuste tio—sed en la globo kompreneble speguliĝas la artisto, do estas memportreto.\\nLa usona sciencisto kaj verkisto Douglas Hofstadter dediĉis al Escher grandajn partojn de sia libro \\"Gödel, Escher, Bach – an eternal golden braid\\", emfazante la mem-referencojn en liaj bildoj.\\nKompreneble la bildoj de Escher estas sub kopirajto, do nur en 2042 eblos publikigi specimenon en Vikipedio, kvankam alilingvaj vikipedioj jam tion faras."},{"page_url":"https://de.wikipedia.org/wiki/You_Keep_Coming_Back_Like_a_Song","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Irving_Berlin_Portrait2.jpg","page_title":"You Keep Coming Back Like a Song","context_page_description":"You Keep Coming Back Like a Song ist ein Lied, das Irving Berlin für den Soundtrack des Musikfilms Blau ist der Himmel von Stuart Heisler aus dem Jahr 1946 komponierte und textete. Im Film wird es von Bing Crosby vorgetragen. Der Refrain lautet: You keep coming back like a song, A song that keeps saying ‚Remember‘ … und handelt davon, dass die Erinnerung immer wieder zurückkommt, wie ein alter Song, den man liebt, und dem man nicht entrinnen kann."},{"page_url":"https://id.wikipedia.org/wiki/Nicki_Minaj","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Kanye_West_At_the_Big_Chill_2011.jpg","page_title":"Nicki Minaj","context_page_description":"Onika Tanya Maraj, dikenal secara professional sebagai Nicki Minaj, adalah seorang rapper, penyanyi, model dan aktris berkebangsaan Trinidad-Amerika Serikat. Lahir di Saint James, Port of Spain, Trinidad and Tobago dan dibesarkan di Queens, New York City, dia mendapatkan perhatian publik setelah merilis mixtape berjudul Playtime Is Over, Sucka Free, dan Beam Me Up Scotty.\\nSetelah dikontrak oleh Young Money Entertainment pada tahun 2009, Minaj merilis album studio pertamanya, Pink Friday, yang berada dinomor satu di US Billboard 200 dan akhirnya disertifikasi tiga kali platinum oleh Recording Industry Association of America. Album studio keduanya, Pink Friday: Roman Reloaded, dirilis pada tahun 2012 dan debut dinomor satu dibeberapa negara. Minaj membuat penampilan debut filmnya di film animasi tahun 2012 berjudul Ice Age: Continental Drift. Pada tahun 2013, dia menjadi juri di musim kedua belas dari American Idol. Album studio ketiga Minaj, The Pinkprint, dirilis pada tahun 2014. Dia memerankan peran pendukung di film berjudul The Other Woman dan Barbershop: The Next Cut. Album studio keempatnya, Queen, dirilis pada tahun 2018."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Latvia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Nikolaja_v%C4%81rti_%28Daugavpils_cietoksnis%29.JPG","page_title":"History of Latvia","context_page_description":"The history of Latvia began around 9000 BC with the end of the last glacial period in northern Europe. Ancient Baltic peoples arrived in the area during the second millennium BC, and four distinct tribal realms in Latvia's territory were identifiable towards the end of the first millennium AD. Latvia's principal river Daugava, was at the head of an important trade route from the Baltic region through Russia into southern Europe and the Middle East that was used by the Vikings and later Nordic and German traders.\\nIn the early medieval period, the region's peoples resisted Christianisation and became subject to attack in the Northern Crusades. Latvia's capital city Riga, founded in 1201 by Germans at the mouth of the Daugava, became a strategic base in a papally-sanctioned conquest of the area by the Livonian Brothers of the Sword. It was to be the first major city of the southern Baltic and, after 1282, a principal trading centre in the Hanseatic League.\\nBy the 16th century, Baltic German dominance in Terra Mariana was increasingly challenged by other powers."},{"page_url":"https://fr.wikipedia.org/wiki/Bernard_Picart","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Gerard_Wigmana.jpg","page_title":"Bernard Picart","context_page_description":"Bernard Picart, né le 11 juin 1673 à Paris où il vécut rue Saint-Jacques, installé en 1711 à Amsterdam où il vécut dans la Kalverstraat et où il est mort le 8 mai 1733, est un dessinateur et graveur français."},{"page_url":"https://es.wikipedia.org/wiki/Estaci%C3%B3n_de_ferrocarril_de_Delhi_Junction","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Old_Delhi_Railway_Station_%28DLI%29.jpg","page_title":"Estación de ferrocarril de Delhi Junction","context_page_description":"Delhi Junction, también conocida como Old Delhi Railway Station o «antigua estación de Delhi», es la estación de ferrocarril más antigua de la ciudad de Delhi, India, y una estación de cruce. Fue inaugurada en 1864 y es una de las estaciones de ferrocarril más concurridas de la India en términos de frecuencia. Alrededor de 250 trenes comienzan, terminan o pasan por la estación diariamente.\\nSe estableció cerca de Chandni Chowk en 1864 cuando los trenes de Howrah, Calcuta, comenzaron a operar hasta Delhi. Su edificio actual fue construido por el gobierno de la India británica al estilo del fuerte rojo cercano y se inauguró en 1903. Ha sido una importante estación de ferrocarril del país y precedió a la estación de ferrocarril de Nueva Delhi por unos 60 años. La estación de metro Chandni Chowk del metro de Delhi está cerca."},{"page_url":"https://en.wikipedia.org/wiki/Revolutionary_Socialism_(Portugal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Socialismo-Revolucion%C3%A1rio.png","page_title":"Revolutionary Socialism (Portugal)","context_page_description":"Revolutionary Socialism is a Trotskyist political organisation in Portugal. It was affiliated to the Committee for a Workers' International until 2019. Prior to 2008 it was named Socialist Alternative.\\nWith ongoing social unrest since the onset of the global recession in 2008, the organisation has been critical of the leadership of the CGTP and UGT union federations for their inaction and declining to take \\"the tremendous opportunity to call a general strike on the same day as the Spanish general strike\\". Revolutionary Socialism has also criticised the Portuguese Communist Party and Left Bloc for having \\"hardly used their influential position to mobilise people\\".\\nThe organisation has been active in the campaign to stop evictions and the demolition of homes in the municipality of Amadora.\\nIn 2019, the organisation left the CWI and joined International Revolutionary Left."},{"page_url":"https://en.wikipedia.org/wiki/Richard_Pite","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Jazz_Drummer_Richard_Pite.jpg","page_title":"Richard Pite","context_page_description":"Richard Pite is a British professional musician and jazz historian specialising in the jazz of the early 20th Century. He is founder of two music companies - PartyJazz and The Jazz Repertory Company and is also the Director of Music for Boisdale which presents jazz and other live music on a nightly basis at its four London venues. For many years he specialised in 1920s music and the drum techniques and visual tricks of the era's jazz drummers and over the last 12 years has worked together with musical partner Pete Long, to preserve jazz history through live performance. Together they have recreated historic moments from jazz in association with The National Jazz Archive. For the 100th Anniversary of Gene Krupa's birth in 2009, Pite staged the only UK concert celebrating the life and work of the artist who was one of the most important and flamboyant drummers in jazz history."},{"page_url":"https://de.wikipedia.org/wiki/Johann_V._(Portugal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Portugal_no_m%C3%AAs_de_Julho_de_Dois_Mil_e_Catorze_P7130512_%2814548788257%29.jpg","page_title":"Johann V. (Portugal)","context_page_description":"Johann V., genannt „der Großherzige“, war König von Portugal von 1706 bis 1750. Er entstammte dem Haus Braganza."},{"page_url":"https://fr.wikipedia.org/wiki/Chris_Cheek","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Chris_cheek_06N5333sw.jpg","page_title":"Chris Cheek","context_page_description":"Chris Cheek, né le 16 septembre 1968 à Saint-Louis, est un saxophoniste de jazz américain."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Jablanica","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Jablanicki_district.gif","page_title":"Distrito de Jablanica","context_page_description":"El Distrito de Jablanica es uno de los 18 ókrug o distritos en que está dividida Serbia Central, la región histórica de Serbia. Su capital administrativa es la ciudad de Leskovac.​"},{"page_url":"https://es.wikipedia.org/wiki/Asamblea_de_la_Rep%C3%BAblica_de_Portugal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Assembleia_Republica_Portugal_2.JPG","page_title":"Asamblea de la República de Portugal","context_page_description":"La Asamblea de la República es el órgano legislativo de la República Portuguesa. Es unicameral y posee hasta 230 diputados. La Asamblea tiene su sede en el Palácio de São Bento en Lisboa.\\nLa legislatura tiene una duración de cuatro años, convocándose elecciones una vez terminado ese plazo, salvo que el Presidente de la República disuelva la cámara y convoque elecciones anticipadas."},{"page_url":"https://zh.wikipedia.org/zh-tw/K132/133%E3%80%81K134/131%E6%AC%A1%E5%88%97%E8%BD%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/DSC_6271_%288749627999%29.jpg","page_title":"K132/133、K134/131次列车","context_page_description":"K132/133、K134/131次列車是中國鐵路運行於甘肅省會蘭州至廣東經濟特區深圳之間的一對快速旅客列車，自2011年7月1日起按現車次開行，由蘭州鐵路局蘭州客運段深圳車隊負責客運任務，為該局承運里程最長客運線路。列車使用中國鐵路25G型客車，沿隴海鐵路、京九鐵路及平南鐵路運行，全程3100公里，跨越甘肅、陝西、河南、安徽、湖北、江西、廣東七省。其中蘭州站至深圳西站運行44小時07分，使用車次為K132/133次；深圳西站至蘭州站運行42小時31分，使用車次為K134/131次。列車的開行為中國西部與南方沿海、內陸城市的多領域交流增加了一個新的通道，對於加快西部大開發步伐具有深遠的意義。"},{"page_url":"https://de.wikipedia.org/wiki/Blockhaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Blockhaus_im_Bau.jpg","page_title":"Blockhaus","context_page_description":"Ein Blockhaus oder eine Blockhütte ist ein in Blockbauweise errichtetes Gebäude mit Wänden aus übereinanderliegenden, rohen oder bearbeiteten Baumstämmen."},{"page_url":"https://de.wikipedia.org/wiki/Michelle_Obama","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/First_Lady_Michelle_Obama_meets_with_Melania_Trump_for_tea_in_the_Yellow_Oval_Room_of_the_White_House.jpg","page_title":"Michelle Obama","context_page_description":"Michelle LaVaughn Robinson Obama ist eine US-amerikanische Rechtsanwältin und Autorin. Sie war als Ehefrau des 44. US-Präsidenten Barack Obama von 2009 bis 2017 die First Lady der Vereinigten Staaten."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%81%D1%82%D0%B5%D0%BB%D0%BB%D0%B5%D1%80%D0%BE","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Castellero.jpg","page_title":"Кастеллеро","context_page_description":"Кастеллеро — муніципалітет в Італії, у регіоні П'ємонт, провінція Асті.\\nКастеллеро розташоване на відстані близько 490 км на північний захід від Рима, 34 км на південний схід від Турина, 11 км на захід від Асті.\\nНаселення — 304 особи.\\nЩорічний фестиваль відбувається 29 червня. Покровитель — San Pietro in Vincoli."},{"page_url":"https://it.wikipedia.org/wiki/Lago_di_Tovel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Riflessi_nel_lago_di_Tovel.jpg","page_title":"Lago di Tovel","context_page_description":"Il lago di Tovel è un lago alpino situato nella val di Tovel, sul territorio del comune di Ville d'Anaunia in Val di Non, a un'altitudine di 1178 m s.l.m. e all'interno del Parco Naturale Adamello-Brenta. La valle si insinua dall’abitato di Tuenno per 17 km tra il Monte Peller a ovest e il massiccio della Campa a est, fino all'imponente circo roccioso delle Dolomiti di Brenta che circoscrive l'alta valle, dove è situato il lago.\\nÈ stato anche chiamato lago degli orsi perché sono presenti alcuni orsi bruni nella valle, e lago rosso per il fenomeno dell'arrossamento delle sue acque, che avveniva fino al 1964 per azione di un'alga."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_vertebrats_del_Vall%C3%A8s_Occidental","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Sylvia_atricapilla_male_2.jpg","page_title":"Llista de vertebrats del Vallès Occidental","context_page_description":"Aquesta és una llista d'espècies animals del Vallès Occidental que es cenyeix a la susdita comarca però no pas a la seua estricta delimitació administrativa sinó més aviat als seus límits naturals o físics, ja que, des d'un punt de vista faunístic, només els elements topogràfics són els que delimiten una regió. En aquest sentit, el riu Llobregat marca el límit d'aquesta comarca a l'occident i la Riera de Caldes a l'orient. Per la banda nord s'hi inclou la totalitat del massís de Sant Llorenç del Munt i la Serra de l'Obac, ja que formen una unitat geogràfica. I, per acabar, la Serra de Collserola separa la comarca pel sud de la plana del Barcelonès."},{"page_url":"https://zh.wikipedia.org/zh-my/%E9%BA%A5%E5%85%8B%E8%AB%BE%E7%89%B9%E5%BD%97%E6%98%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Comet_mcnaught_sydney_2007.jpg","page_title":"麥克諾特彗星","context_page_description":"麦克诺特彗星是一颗由澳大利亚的天文学家罗伯特·麦克诺特在2006年8月7日发现的彗星。它在2007年1月上旬，过近日点前亮度大增，是30年来最亮的彗星；也是70年来第二亮的，仅次于1965年达-17等的池谷·关彗星；比1947年的南天大彗星C/1947 X1、1976年的威斯特彗星C/1975 V1、1996年的百武彗星以及1997年的海尔·博普彗星都还要亮。一月底前在南、北半球较高纬度地区，白天肉眼可见。"},{"page_url":"https://it.wikipedia.org/wiki/San_Carlos_(Cojedes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Municipio-Escudo_Municipio-1-.jpg","page_title":"San Carlos (Cojedes)","context_page_description":"San Carlos è una città del Venezuela capitale dello stato di Cojedes e capoluogo della municipalità di Ezequiel Zamora.\\nLa città venne fondata il 27 aprile 1678 dal frate cappuccino Pedro de Berja con il nome di San Carlos de Austria."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%81%E0%AE%B2%E0%AE%BF%E0%AE%9A%E0%AF%8D%E0%AE%9A%E0%AE%BF%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Tigon4.jpg","page_title":"புலிச்சிங்கம்","context_page_description":"புலிச்சிங்கம் அல்லது வேயரிமா என்பது ஆண்புலியும் பெண்சிங்கமும் சேர்ந்த கலப்பினத்தில் பிறந்த பூனை இனத்தைச் சேர்ந்த பேரின விலங்காகும். இவ்வினம் லைட்டிகான் விலங்கைப்போல் ஒரு கலப்பின விலங்கு ஆகும். இதன் வளர்ச்சி அசுர தன்மை கொண்டதாக உள்ளது. இந்த விலங்கு உயிரின தோன்றலின் போது இருந்தவை அல்ல. 19ம் நூற்றாண்டுக்கும் 20ம் நூற்றாண்டிற்கும் இடைப்பட்ட காலத்தில் மனிதனின் ஆராய்ச்சியினால் கலப்பு இனமாக பிறந்த ஒரு விலங்கு. ஜெரார்டு ஐல்ஸ் என்பவர் மூன்று டைகான் இருந்ததாக குறிப்பிட்டுள்ளார். ஆனால் லிகர் பார்த்ததாக குறிப்பிடவில்லை.டைகான் விலங்கைப் பார்த்தால் இரண்டு மரபணு மூலம் பிறந்தது என்று கண்டுபிடித்துவிட முடியும். ஏனெனில் இவை இரண்டு பெற்றோரின் குணங்களையும் வெளிப்படுத்தும் தன்னை கொண்டதாக உள்ளது."},{"page_url":"https://pl.wikipedia.org/wiki/Moc_(tarot)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Minchiate_card_deck_-_Florence_-_1860-1890_-_Trumps_-_07_-_La_Forza.jpg","page_title":"Moc (tarot)","context_page_description":"Moc – karta tarota należąca do Arkanów Wielkich. Zazwyczaj oznaczana numerem XI, czasem VIII. Czasem kojarzona z postacią Heraklesa."},{"page_url":"https://nl.wikipedia.org/wiki/Griekse_beekkikker","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Benny_Trapp_Griechischer_Frosch_Rana_graeca.jpg","page_title":"Griekse beekkikker","context_page_description":"De Griekse beekkikker is een kikker uit de familie echte kikkers. De soort werd voor het eerst wetenschappelijk beschreven door George Albert Boulenger in 1891."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D0%BE%D1%8F%D1%82%D0%B8_%D0%90%D0%BD%D0%B4%D0%B8%D2%B7%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Andijan_districts.png","page_title":"Вилояти Андиҷон","context_page_description":"Вилояти Андиҷон — шарқтарин вилояти Ӯзбекистон, дар қисми шарқии водии Фарғона ҷойгир аст. Санаи ташкилаш 6 марти 1941. Маркази маъмурӣ — шаҳри Андиҷон."},{"page_url":"https://it.wikipedia.org/wiki/SMS_Goeben","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bundesarchiv_Bild_146-1981-137-08A%2C_Konstantinopel%2C_Besuch_Kaiser_Wilhelm_II..jpg","page_title":"SMS Goeben","context_page_description":"La SMS Goeben fu il secondo incrociatore da battaglia della classe Moltke della marina imperiale tedesca, varato nel 1911, deve il suo nome al generale August Karl von Goeben. Insieme al suo gemello SMS Moltke, il Goeben aveva una configurazione simile alla classe precedente Von der Tann, ma più grande e con una corazzatura più spessa e con l'aggiunta di due cannoni in una nuova torre. In confronto con le pari classe della Royal Navy, erano più grandi e meglio corazzati.\\nQuattro mesi dopo la sua entrata in servizio del 2 luglio 1912, la Goeben, con l'incrociatore leggero SMS Breslau, costituì la Divisione del Mediterraneo della Marina tedesca che operò durante le guerre balcaniche. Dopo lo scoppio della prima guerra mondiale, il 28 luglio 1914, la Goeben e la Breslau sfuggirono alle forze navali britanniche e raggiunsero Costantinopoli. Le due navi furono cedute all'Impero Ottomano il 16 agosto 1914 e la Goeben divenne l'ammiraglia della flotta ottomana con il nome di Yavuz Sultan Selim, abbreviato in Yavuz. Nel 1936 fu ribattezzata TCG Yavuz; trasportò le spoglie mortali di Mustafa Kemal Atatürk da Istanbul a İzmit nel 1938."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%84%D8%B9%D8%A8_%D8%B3%D8%AA%D9%88%D8%B2%D9%8A%D8%AA%D8%B3%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Stozice4.jpg","page_title":"ملعب ستوزيتسه","context_page_description":"ملعب ستوزيتسه هو ملعب متعدد الاستخدام يقع في مدينة ليوبليانا، سلوفينيا. يسع الملعب لجلوس 16,038 متفرج. يعتبر الملعب الرسمي الذي يخوض فيه منتخب سلوفينيا مبارياته. تم افتتاح الملعب في 11 أغسطس 2010 حيث لعبت مباراة كرة قدم ودية بين سلوفينيا وأستراليا فازت بها الأولى 2–0."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D9%85%DB%8C%D8%B1%D8%A7%D8%AB_%D8%AC%D9%87%D8%A7%D9%86%DB%8C_%DB%8C%D9%88%D9%86%D8%B3%DA%A9%D9%88_%D8%AF%D8%B1_%D9%81%D8%B1%D8%A7%D9%86%D8%B3%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Pontdugard.jpg","page_title":"فهرست میراث جهانی یونسکو در فرانسه","context_page_description":"فهرست میراث جهانی یونسکو در فرانسه شامل ۳۷ میراث می‌باشد..\\nمیراث جهانی یونسکو نام عهدنامه‌ای بین‌المللی است که در تاریخ ۱۶ نوامبر ۱۹۷۲ میلادی به تصویب کنفرانس عمومی یونسکو رسید. موضوع آن حفظ آثار تاریخی، طبیعی و فرهنگی بشر است که اهمیت جهانی دارند و متعلق به تمام انسان‌های زمین، فارغ از نژاد، مذهب و ملیت خاص، می‌باشند.\\nفرانسه در ژوئن ۲۷، ۱۹۷۵ به این کنوانسیون پیوست.\\nفهرست پیشنهادی فرانسه نیز شامل ۳۳ میراث است.\\nنام‌های میراث نام‌های ارائه شده توسط یونسکو هستند که شامل سه نوع مختلف طبیعی٬فرهنگی و ترکیبی است.\\nمعیارهای انتخاب I، II، III معیارهای فرهنگی و معیارهای انتخاب VII، VIII، IX و X معیارهای طبیعی است."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC71%E5%9B%9E%E3%83%97%E3%83%A9%E3%82%A4%E3%83%A0%E3%82%BF%E3%82%A4%E3%83%A0%E3%83%BB%E3%82%A8%E3%83%9F%E3%83%BC%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Peter_Dinklage_by_Gage_Skidmore.jpg","page_title":"第71回プライムタイム・エミー賞","context_page_description":"第71回プライムタイム・エミー賞は、2019年のテレビ芸術科学アカデミーが主催するエミー賞の一つで、2018年6月1日から2019年5月31日までにアメリカ合衆国でプライムタイムに放送された優れたテレビ番組に送られる賞である。授賞式は2019年9月22日にカリフォルニア州ロサンゼルスにあるマイクロソフトシアターで行われ、アメリカではFOXが放送した。1975年、1998年、2003年に続き、史上4回目の司会者不在の授賞式となった。主要部門以外のプライムタイム・クリエイティブ・アート・エミー賞は先行して9月14日と15日に発表された。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC71%E5%9B%9E%E3%83%97%E3%83%A9%E3%82%A4%E3%83%A0%E3%82%BF%E3%82%A4%E3%83%A0%E3%83%BB%E3%82%A8%E3%83%9F%E3%83%BC%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Peter_Dinklage_by_Gage_Skidmore.jpg","page_title":"第71回プライムタイム・エミー賞","context_page_description":"第71回プライムタイム・エミー賞は、2019年のテレビ芸術科学アカデミーが主催するエミー賞の一つで、2018年6月1日から2019年5月31日までにアメリカ合衆国でプライムタイムに放送された優れたテレビ番組に送られる賞である。授賞式は2019年9月22日にカリフォルニア州ロサンゼルスにあるマイクロソフトシアターで行われ、アメリカではFOXが放送した。1975年、1998年、2003年に続き、史上4回目の司会者不在の授賞式となった。主要部門以外のプライムタイム・クリエイティブ・アート・エミー賞は先行して9月14日と15日に発表された。"},{"page_url":"https://de.wikipedia.org/wiki/Cooperative_Mensch","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Logo_Cooperative_Mensch_500_185.png","page_title":"Cooperative Mensch","context_page_description":"Die Cooperative Mensch eG ist ein freier Träger der Berliner Behindertenhilfe, welcher als Genossenschaft mit Sitz in Berlin Einrichtungen betreibt, in denen Menschen mit cerebralen Bewegungsstörungen sowie Körper- und Mehrfachbehinderungen betreut werden."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A9%D7%99%D7%99%D7%97%27","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bedouin_Chief_of_Palmyra.jpg","page_title":"שייח'","context_page_description":"שייח' הוא תואר שניתן למנהיג בשבטים ערביים שהם בדואיים ופלאחיים. משמעות השם בערבית היא זקן, אף שהשייח' אינו בהכרח כזה.\\nהכינוי מתייחס לעיתים קרובות לאחד מזקני השבט, לאדם משכיל או לעולמא. למרות שהכינוי מתייחס בעיקר לגברים, קיימות בהיסטוריה מספר דוגמאות שבהן היו גם נשים שנשאו תואר זה. בקרב הסופים שייח' הוא כינויו של מנהיג המסדר.\\nהשייח' אחראי להתנהלותו הכללית של השבט, והוא הסמכות העליונה בנושאים כמו נישואין, סחר, נדידות, טיפול, משפט, טיפוח העדרים וכיוצא בזה.\\nכיום, בעיקר בחברה הבדואית, מעמד השייח' הולך ונכחד ואין לו השפעה כפי שהייתה בעבר בהיותו חורץ גורלות ומיישב סכסוכים.\\nתפקיד או מעמד השייח' עובר בדרך כלל לאדם בירושה, מאביו או סבו ועבודתו היא בהתנדבות מלאה."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%BA_%D0%9B%D0%B8%D1%82%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/LT-1997-1litas-Bank-Au-b.png","page_title":"Банк Литви","context_page_description":"Банк Литви — центральний банк Литовської Республіки."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%DA%A9%D8%A7%D9%88%D9%86%D8%AA%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Covenry_Airport_control_tower_6f07.JPG","page_title":"فرودگاه کاونتری","context_page_description":"فرودگاه کاونتری یک فرودگاه همگانی حمل و نقل با کد یاتا CVT است که یک باند فرود آسفالت دارد و طول باند آن ۲۰۰۸ متر است. این فرودگاه در شهر کاونتری کشور انگلستان قرار دارد و در ارتفاع ۸۱ متری از سطح دریا واقع شده‌است."},{"page_url":"https://pl.wikipedia.org/wiki/Nowa_Ruda","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Nowa_Ruda_-_widok_z_ratusza_02.jpg","page_title":"Nowa Ruda","context_page_description":"Nowa Ruda – miasto w województwie dolnośląskim, nad Włodzicą, w powiecie kłodzkim. Wchodzi w skład aglomeracji wałbrzyskiej.\\nNowa Ruda uzyskała lokację miejską przed 1360 rokiem. W latach 1975–1998 miasto administracyjnie należało do województwa wałbrzyskiego. Obecnie Nowa Ruda pełni funkcję ponadgminnego ośrodka administracyjno-edukacyjnego dla mikroregionu noworudzko-radkowskiego.\\nNową Rudę zamieszkuje niemal 22 tys. mieszkańców, co czyni ją drugim po Kłodzku miastem pod względem liczby ludności w powiecie, oraz piętnastym w województwie dolnośląskim. Nowa Ruda jest ważnym węzłem komunikacyjnym, krzyżują się tutaj trasy wojewódzkie. W mieście znajduje się stacja kolejowa i dworzec autobusowy, dzięki czemu można do Nowej Rudy dotrzeć koleją lub autobusami PKS-u."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B1%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Kobe_kitano_thomas_house07_2816.jpg","page_title":"Кобе","context_page_description":"Ко́бе — місто в Японії, у південно-східній частині префектури Хьоґо, адміністративний центр цієї префектури. Входить до списку міст державного значення Японії.\\nКобе — одне з найбільших міст узбережжя Осацької затоки, в акваторії Внутрішнього Японського моря. Місто є великим міжнародним портом і має ідеальну глибоководну бухту у вигляді розгорнутого віяла. Центром Кобе пролягають гори Рокко, у підніжжя яких знаходиться гарячі ванни на термальних водах Аріма, одні з найстаріших у Японії. Місто вважається батьківщиною японських дач і куротів.\\nІсторично Кобе входило до складу провінції Ідзумі і було важливим транспортним і торговельним пунктом на шляху до японської столиці Кіото. У цьому поселенні традиційно знаходилося багато контор оптовиків і лихварів, а також виробників японської горілки саке. Крім цього Кобе було значним релігійним центром і славилося «трьома святинями», синтоїстькими святилищами Ікута, Наґата і Мінатоґава. З середини 19 століття місто стало одним з головних осередків модернізації країни, центром сталеваріння, кораблебудування, машинобудування, хімічної промисловості і виробництва штучних перлів."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D8%A7%D8%B1%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/HonigbergKirchenburg1.jpg","page_title":"هارمان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهارمان, قريه فى رومانيا."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8A%E3%83%95%E3%83%86%E3%83%B3%E9%85%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Naphthens%C3%A4ure.svg","page_title":"ナフテン酸","context_page_description":"ナフテン酸は主に石油中の複数の酸性物質が混合した異なるカルボン酸の混合物である。\\n産地を問わず原油には含まれるが、特にナフテン基原油に多く含まれる。ナフテン酸が多い原油は精製時の腐食が問題となるため対策が求められる。一般的な石油精製では酸素化合物として除去対象であるため、意図的に添加したケースを除くと石油製品にはほぼ残存しない。\\n石油から生産され、各種添加剤として用いられている。\\n主成分は、シクロペンタンとシクロヘキサンのカルボン酸化合物である。"},{"page_url":"https://bg.wikipedia.org/wiki/Douglas_DC-3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/N34---Douglas-DC3-Cockpit.jpg","page_title":"Douglas DC-3","context_page_description":"Douglas DC-3 e двумоторен витлов самолет, ключов за развитието на въздушния транспорт от средата на 30-те до началото на 60-те години на ХХ век. Превозва от 21 до 32 пътници със скорост до 290 km/h на разстояние до 2415 km. Неговата непретенциозност и пословична сигурност го правят известен. Появилият се през 1935 г. самолет завладява пазара на транспортни пътнически самолети и до началото на Втората световна война 80% от самолетния парк е от този тип. DC-3 е произведен в огромни количества – 10 655 броя, както и такива, произведени по лиценз в СССР под името Ли-2, и в Япония, където по лиценз са произведени 485 самолета, обозначени като L2D."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A1%D6%80%D5%B8%D5%AF%D5%AF%D5%B8_%D5%B3%D5%A1%D6%80%D5%BF%D5%A1%D6%80%D5%A1%D5%BA%D5%A5%D5%BF%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Kaisersaal_W%C3%BCrzburg.jpg","page_title":"Բարոկկո ճարտարապետություն","context_page_description":"Բարոկկո ճարտարապետությունը գեղարվեստական ուղղություն և ճարտարապետական ոճ է, ներառում է մի շարք պատմական-տարածաշրջանային գեղարվեստական ոճեր, ուղղություններ և դպրոցներ, ինչպես նաև ընդգրկում է Եվրոպայի և Ամերիկայի երկրներում ճարտարապետության զարգացման դարաշրջանը՝ մոտ 150-200 տարի: Բարոկկո ոճը պատմական զարգացման ընթացքում իր արտահայտությունն է գտել արվեստի բոլոր ճյուղերում, նախ և առաջ ճարտարապետության, այնուհետև գեղանկարչության մեջ, թատրոնում, քանդակագործության մեջ։"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A7%E3%83%89%E3%82%A4%E3%83%84%E3%83%84%E3%83%BC%E3%83%AA%E3%83%B3%E3%82%B0%E3%82%AB%E3%83%BC%E9%81%B8%E6%89%8B%E6%A8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Ford_Sierra_RS500_%2839039227074%29.jpg","page_title":"旧ドイツツーリングカー選手権","context_page_description":"ドイチェ・トゥーレンヴァーゲン・マイスターシャフト は、1984年から1995年まで開催されたドイツのツーリングカー選手権。ヨーロッパ各地でのレースが追加され、1996年には国際ツーリングカー選手権 へ移行した。\\n2000年から再開されたドイチェ・トゥーレンヴァーゲン・マスターズ も略称はDTMで、日本語表記も同じドイツツーリングカー選手権と訳されることが多い。当項目は区別のため「旧ドイツツーリングカー選手権」と表記する。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%93%88%E5%AF%86%E5%B0%94%E9%A1%BF_(%E5%AE%89%E5%A4%A7%E7%95%A5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/McMasterUnionStudentCentre.jpg","page_title":"哈密尔顿 (安大略)","context_page_description":"哈密尔顿是加拿大安大略省东南部的一座港口城市，位于多伦多以西及尼亚加拉瀑布以北。据2011年加拿大人口普查所示，哈密尔顿市内有519,949名居民。哈密尔顿的都会区则包含邻近的伯灵顿市和格里姆斯比镇，2011年人口为721,053人；自1981年起，哈密尔顿都会区人口一直位居全国第九及安省第三。\\n1812年战争后，商人暨政治家佐治·哈密尔顿着手打造一座小镇。1846年，哈密尔顿正式成为法定城市。及后经过多年演变，哈密尔顿发展成安大略湖西岸金马蹄地区的重要工业枢纽。2001年，哈密尔顿与哈密尔顿-温特沃斯区辖下的数个小镇合并，成为现时的哈密尔顿市。合并后的哈密尔顿市为一个单层次行政区，对上不设县或区级行政架构。\\n哈密尔顿的本土经济以往靠重工业及钢铁业带动，故该城亦有“钢铁城”之称，但近年来则倚重如医疗业等的服务业。哈密尔顿市内主要有两所专上学院，分别为麦克马斯特大学及莫霍克学院。另外，市内有多处旅游点、名胜及古迹，如皇家植物园、加拿大战机博物馆、布鲁斯远足径及全国首家蒂姆·霍顿斯咖啡店等。\\n哈密尔顿的邮政编码前缀是L8E至L8W；电话地区编码则为905及289。"},{"page_url":"https://de.wikipedia.org/wiki/Dametzhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Linz_Dametzhof_Hoft%C3%BCr.jpg","page_title":"Dametzhof","context_page_description":"Der Dametzhof ist ein von 1927 bis 1928 nach den Plänen von Curt Kühne errichteter Gemeindebau der Stadt Linz mit 188 Wohnungen und wurde nach dem ehemaligen Bürgermeister Josef Dametz benannt. Die Wohnhausanlage steht unter Denkmalschutz.\\nDie 13 fünfgeschoßigen Wohnhäuser wurden U-förmig an der Hyrtlstraße, Reischekstraße und Körnerstraße errichtet. Die Errichtung wurde unter der Leitung des Stadtbauamtes mit Matthäus Schlager, Friedrich Gangl, Karl Pader, Ernst Hillbrand, Vaterländische Baugesellschaft, Humer & Krenmayr durchgeführt.\\nDie Architektur Kühnes setzte durch risalitartig vortretende Eckteile Akzente. Das Erdgeschoss als Sockelzone und die Stiegenhausachsen wurden expressiv in Klinkerbauweise ausgeführt. An den Eckteilen und Hoffronten sind spitzwinklig vorkragende Erker. Die Staubläden wurden bunt dekoriert.\\nIm nach Süden offenen Straßenhof des Dametzhofes zur Weissenwolffstraße wurde um 1942 ein zweigeschoßiger Zwischenbau, das sogenannte Klubhaus, mit einem Walmdach im Stil der NS-Zeit errichtet. Das Gebäude steht auch unter Denkmalschutz."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%86%D1%96_%D0%BD%D0%B0_%D0%BF%D1%96%D0%B2%D0%B4%D0%BD%D1%96_%D0%A0%D0%BE%D1%81%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Ukrainians1989ru.PNG","page_title":"Українці на півдні Росії","context_page_description":"Українці на півдні Росії проживають переважно на Кубані. За останнє століття близько 90% від попередньої кількості було русифіковано та асимільовано."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8B%A0%EC%8A%A4%EB%84%A4%EC%9D%B4%ED%81%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Synsnake.jpg","page_title":"신스네이크","context_page_description":"대한민국의 트랜스코어 밴드 신스네이크"},{"page_url":"https://eu.wikipedia.org/wiki/Sant_Feliu_de_Buixalleu","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Sant-Feliu-de-Buixalleu.jpg","page_title":"Sant Feliu de Buixalleu","context_page_description":"Sant Feliu de Buixalleu Kataluniako udalerria da, Selva eskualdean eta Gironako probintzian kokatua. 2009ko urtarrilaren 1eko erroldaren arabera 811 biztanle zituen. 61,9 km²-ko azalera du."},{"page_url":"https://sv.wikipedia.org/wiki/Regementet_d%27Ag%C3%A9nois","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/R%C3%A9g_d_Agenois_1692.png","page_title":"Regementet d'Agénois","context_page_description":"Agénoisregementet var ett franskt linjeinfanteriregementet uppsatt 1692 och nedlagt 1749. Det var uppkallat efter historiska landskapet Agenais i Gascogne."},{"page_url":"https://pl.wikipedia.org/wiki/Andrzej_Mroczek","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Andrzej_A._Mroczek.jpg","page_title":"Andrzej Mroczek","context_page_description":"Andrzej A. Mroczek – polski konstruktor, dziennikarz, fotografik."},{"page_url":"https://lt.wikipedia.org/wiki/Kristiansfeldas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Woodframed_house_near_Christiansfeld.jpg","page_title":"Kristiansfeldas","context_page_description":"Kristiansfeldas – miestas pietų Danijoje. Jį 1773 m. įkūrė Moravitų bažnyčios sekėjai bei pavadino Danijos ir Norvegijos karaliaus Kristijono VII vardu. 2015 m. miestas buvo įtrauktas į UNESCO Pasaulio paveldo sąrašą.\\nDidžioji dalis miesto buvo pastatyta 1773–1800 m. laikotarpiu pagal griežtą planą. Skatindamas miesto statybas karalius Kristijonas VII suteikė miestui 10 metų mokestinę nuolaidą bei apmokėjo 10 procentų naujų namų statybos kaštų. Miestas buvo vienas iš daugelio Šlėzvige turgaus miesto statusą turinčių miestų.\\n1864 m. miestas ir likusi Šlėzvigo dalis buvo prijungta prie Prūsijos, kai Danija pralaimėjo Danijos kare. Ši teritorija išliko Vokietijos dalimi iki 1920 m. Tuomet po Versalio sutarties įsigaliojimo šiaurės Šlėzvigo gyventojai nusprendė prisijungti prie Danijos.\\nPo 2007 m. Danijos savivaldybių reformos Šlėzvigas priklauso Koldingo savivaldybei.\\nŠiuo metu miestas yra turistų traukos centras. Čia yra senasis miesto centras, Moravijos bažnyčia ir specialios kapinės. 2015 m. liepos 4 d. miestas buvo įtrauktas į Pasaulio paveldo sąrašą."},{"page_url":"https://de.wikipedia.org/wiki/Berchtold_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Wappen_Berchtold_zu_Ungarsch%C3%BCtz.jpg","page_title":"Berchtold (Adelsgeschlecht)","context_page_description":"Berchtold war der Name eines Adelsgeschlechts, das ursprünglich aus Tirol stammte. Neben Niederösterreich war es ab dem 16. Jahrhundert auch in Ungarn sowie in Böhmen und Mähren verbreitet."},{"page_url":"https://el.wikipedia.org/wiki/Setra_S_431_DT","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Achilleio_490_84%2C_Greece_-_panoramio_%2878%29.jpg","page_title":"Setra S 431 DT","context_page_description":"Το Setra S 431 DT είναι διώροφο τουριστικό λεωφορείο και κατασκευάζεται από την γερμανική εταιρεία Setra, από το 2001."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%9C%E0%A6%BF%E0%A6%93%E0%A6%AB%E0%A7%8D%E0%A6%B0%E0%A7%87_%E0%A6%89%E0%A6%87%E0%A6%B2%E0%A7%8D%E0%A6%95%E0%A6%BF%E0%A6%A8%E0%A7%8D%E0%A6%B8%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Geoffrey_Wilkinson_ca._1976.png","page_title":"জিওফ্রে উইল্কিন্সন","context_page_description":"স্যার জিওফ্রে উইল্কিন্সন একজন নোবেল বিজয়ী ইংরেজ রসায়নবিজ্ঞানী।"},{"page_url":"https://no.wikipedia.org/wiki/Str%C3%B6msund","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Str%C3%B6msund_Bredg%C3%A5rdsgatan.jpg","page_title":"Strömsund","context_page_description":"Strömsund er et tettsted i Jämtlands län i landskapet Jämtland i Sverige. Det ligger rundt 100 kilometer nord for Östersund. Det er Strömsund kommunes administrasjonssenter. I 2010 hadde tettstedet 3 589 innbyggere."},{"page_url":"https://en.wikipedia.org/wiki/List_of_crossings_of_the_River_Severn","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/River_Severn%2C_Cressage_road_bridge_-_geograph.org.uk_-_1001985.jpg","page_title":"List of crossings of the River Severn","context_page_description":"This is a list of crossings of the River Severn in Great Britain, in order from source to mouth.\\nThe Severn has historically been a very important and busy river, and has been bridged throughout history. The bridges that stand today are often of great historical and/or engineering interest — for example the world's first iron bridge, The Iron Bridge, built from cast iron crosses the River Severn at Ironbridge Gorge. The Iron Bridge is one of three bridges on the River Severn that are listed as grade I structures, including Bewdley Bridge and the Severn Bridge, which was opened in 1966. In total, 31 bridges that cross the River Severn are listed, either grade I, II* or II. Four bridges are Scheduled Monuments, including The Iron Bridge, which are nationally important archaeological bridges.\\nMany reaches of the Severn are prone to severe flooding, prompting the design of many unique bridges to cope with this.\\nThere were historically also ferry crossings on the tidal river at:\\nMinsterworth\\nFramilode\\nPurton, Lydney\\nNewnham on Severn"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D1%8C%D0%B2%D0%B5_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Balve_stadtbrunnen.jpg","page_title":"Бальве (город)","context_page_description":"Бальве — город в Германии, в земле Северный Рейн-Вестфалия.\\nПодчинён административному округу Арнсберг. Входит в состав района Меркиш. Население составляет 11 955 человек. Занимает площадь 74,76 км². Официальный код — 05 9 62 008.\\nГород подразделяется на 7 городских районов."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%82%A3%E3%83%A0%E3%83%BB%E3%82%AF%E3%83%A9%E3%83%99%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Tim_Krabbe_1969.jpg","page_title":"ティム・クラベー","context_page_description":"ティム・クラベーは、オランダの小説家、推理作家。男性。オランダの首都アムステルダム生まれ。アムステルダム在住。\\n日本語ではティム・クラッベ、ティム・クラベとも表記される。"},{"page_url":"https://et.wikipedia.org/wiki/S%C3%A4revi_Teatrituba","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Tallinn%2C_maja%2C_kus_aastail_1938-1970_elas_Andres_S%C3%A4rev_ja_1920-1930_Jaan_Soots_%281%29.jpg","page_title":"Särevi Teatrituba","context_page_description":"Särevi Teatrituba on Eesti Teatri- ja Muusikamuuseumi allüksus Tallinnas aadressil Tina tänav 23-13.\\nAnna ja Andres Särev elasid selles 3-toalises korteris 1938–1980. Pärijate puudumisel soovisid Särevid, et pärast nende surma tegutseks korteris teatrimuuseum.\\nMuuseum avati 1982. aastal. Muuseum on avatud ettetellimisel ning külastajatel on võimalik pääseda elutuppa, endisse magamistuppa ja kabinetti. Kabinetis on eksponeeritud Särevite ligi 6000-köiteline raamatukogu ja Andres Särevi töölaud. Muuseumil on pikk luuleõhtute traditsioon ja seal tehakse haridustööd."},{"page_url":"https://fr.wikipedia.org/wiki/Gabrio_Casati","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Gabrio_Casati_foto.jpg","page_title":"Gabrio Casati","context_page_description":"Gabrio Casati est un homme politique italien."},{"page_url":"https://id.wikipedia.org/wiki/Stasiun_Gambringan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/PapanNamaStasiun_GBN.png","page_title":"Stasiun Gambringan","context_page_description":"Stasiun Gambringan merupakan stasiun kereta api kelas II yang terletak di Tambirejo, Toroh, Grobogan. Stasiun yang terletak pada ketinggian +40 meter ini berada di Daerah Operasi IV Semarang. Stasiun ini merupakan pertemuan jalur kereta api dari arah Solo Balapan, Semarang Tawang, dan Surabaya Pasarturi. Letak stasiun ini hanya berjarak 1,7 km di sebelah timur Stasiun Ngrombo.\\nStasiun Gambringan memiliki enam jalur kereta api. Awalnya, jalur 4 merupakan sepur lurus arah Semarang maupun Surabaya serta jalur 3 merupakan sepur lurus dari dan ke arah Solo. Setelah jalur ganda segmen Ngrombo-Jambon resmi dioperasikan pada bulan Desember 2013, emplasemen stasiun ini diperpanjang ke arah timur laut maupun barat daya. Jalur 4 dijadikan sebagai sepur lurus untuk arah Surabaya saja, jalur 5 dijadikan sebagai sepur lurus hanya untuk arah Semarang, jalur 3 dijadikan sebagai jalur buntu, sedangkan sepur lurus dari dan ke arah Solo dialihkan ke jalur 2."},{"page_url":"https://fi.wikipedia.org/wiki/Gillian_Hills","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/AClockworkOrangeGillianHills.png","page_title":"Gillian Hills","context_page_description":"Gillian Hills on brittiläinen näyttelijä ja laulaja. Hän sai aluksi kuuluisuutta teini-ikäisenä esiintyessään brittielokuvissa Paha tyttö ja Blow-Up – erään suudelman jälkeen. Hän asui Ranskassa useiden vuosien ajan, jossa hän aloitti laulajanuran ja esiintyi lukuisissa ranskalaiselokuvissa."},{"page_url":"https://vi.wikipedia.org/wiki/Diuris_maculata","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Diuris_pardina_-_Flickr_004.jpg","page_title":"Diuris maculata","context_page_description":"Diuris pardina là một loài thực vật có hoa trong họ Lan. Loài này được Sm. mô tả khoa học đầu tiên năm 1805."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%97%E0%A5%88%E0%A4%B2%E0%A5%8D%E0%A4%B5%E0%A4%BE%E0%A4%A8%E0%A5%80_%E0%A4%B8%E0%A5%87%E0%A4%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Galvanic_cell_labeled.svg","page_title":"गैल्वानी सेल","context_page_description":"गैल्वानी सेल या वोल्टाई सेल एक विद्युतरासायनिक युक्ति है अपने अन्दर होने वाली रेडॉक्स अभिक्रिया के फलस्वरूप विद्युत ऊर्जा प्रदान करता है। इसके ये नाम क्रमशः लुइगी गैल्वानी तथा एलेसान्द्रो वोल्टा के नाम पर रखे गये हैं जिन्होने इस क्षेत्र में सबसे पहले काम किया। सेल के अन्दर दो भिन्न धातुएँ होतीं हैं जो एक लवण-सेतु के माध्यम से जुड़ी होतीं हैं।\\nवोल्टा ने वोल्टाई पाइल का आविष्कार किया जो प्रथम विद्युत बैटरी थी। साधारण प्रयोग में बैटरी एक सेल को भी बैटरी कह दिया जाता है किन्तु बैटरी का वास्तविक अर्थ 'एक से अधिक सेलों का संयोजन' है।\\nThis cell is also called 'syed' or 'galloesa'.\\nगैल्वेनिक सेल:- इस सेल में रासायनिक ऊर्जा को विद्युत ऊर्जा में परिवर्तित किया जाता है इसने सतत् रेडॉक्स अभिक्रियाओं के कारण विद्युत धारा उत्पन्न होती हैं\\nउदाहरण:- डेनियल सेल, लेड-अम्ल बैटरी!"}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},G={class:"card-container"},F={key:0,class:"empty-state"},I=["disabled"],R={key:0},K={key:1};function H(a,e,s,m,o,r){const d=h("PoemCard");return t(),n("section",null,[e[4]||(e[4]=i("div",{class:"top-banner"},[i("div",{class:"top-banner-title"},[i("div",{class:"top-banner-title-text"},"🤔AI Techniques🧠")])],-1)),i("div",T,[e[3]||(e[3]=i("span",{class:"search-icon"},"🔍",-1)),_(i("input",{type:"text",class:"search-input","onUpdate:modelValue":e[0]||(e[0]=l=>o.searchQuery=l),placeholder:"Search..."},null,512),[[k,o.searchQuery]]),o.searchQuery?(t(),n("button",{key:0,class:"clear-search",onClick:e[1]||(e[1]=l=>o.searchQuery="")}," ✕ ")):p("",!0)]),i("div",G,[(t(!0),n(w,null,b(r.displayedPoems,(l,c)=>(t(),D(d,{key:c,poem:l},null,8,["poem"]))),128)),r.displayedPoems.length===0?(t(),n("div",F,' No results found for "'+u(o.searchQuery)+'". ',1)):p("",!0)]),r.hasMorePoems?(t(),n("button",{key:0,class:"load-more-button",disabled:o.isLoading,onClick:e[2]||(e[2]=(...l)=>r.loadMore&&r.loadMore(...l))},[o.isLoading?(t(),n("span",K,"Loading...")):(t(),n("span",R,"See more"))],8,I)):p("",!0)])}const N=g